var textForPages =["","","\u041f\u0410\u0421\u0425\u0410 \u0425\u0420\u0418\u0421\u0422\u041e\u0412\u0410 \u2013 12 \u043a\u0432\u0456\u0442\u043d\u044f \u000d\u000a\u0414\u0412\u0410\u041d\u0410\u0414\u0415\u0421\u042f\u0422\u0406 \u2013 \u041f\u0415\u0420\u0415\u0425\u0406\u0414\u041d\u0406\u000d\u000a5 \u043a\u0432\u0456\u0442\u043d\u044f, \u043d\u0435\u0434\u0456\u043b\u044f \u2013 \u0412\u0445\u0456\u0434 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0456\u0439 \u0443 \u0404\u0440\u0443\u0441\u0430\u043b\u0438\u043c.\u000d\u000a21 \u0442\u0440\u0430\u0432\u043d\u044f, \u0447\u0435\u0442\u0432\u0435\u0440 \u2013 \u0412\u043e\u0437\u043d\u0435\u0441\u0456\u043d\u043d\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0454.\u000d\u000a31 \u0442\u0440\u0430\u0432\u043d\u044f, \u043d\u0435\u0434\u0456\u043b\u044f \u2013 \u0414\u0435\u043d\u044c \u0421\u0432\u044f\u0442\u043e\u0457 \u0422\u0440\u043e\u0439\u0446\u0456. \u000d\u000a\u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u044f.\u000d\u000a\u0414\u0412\u0410\u041d\u0410\u0414\u0415\u0421\u042f\u0422\u0406 \u2013 \u041d\u0415\u041f\u0415\u0420\u0415\u0425\u0406\u0414\u041d\u0406\u000d\u000a6 \u0441\u0456\u0447\u043d\u044f, \u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a \u2013 \u0425\u0440\u0435\u0449\u0435\u043d\u043d\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0454.\u000d\u000a2 \u043b\u044e\u0442\u043e\u0433\u043e, \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a \u2013 \u0421\u0442\u0440\u0456\u0442\u0435\u043d\u043d\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0454.\u000d\u000a25 \u0431\u0435\u0440\u0435\u0437\u043d\u044f, \u0441\u0435\u0440\u0435\u0434\u0430 \u2013 \u0411\u043b\u0430\u0433\u043e\u0432\u0456\u0449\u0435\u043d\u043d\u044f \u000d\u000a\u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456.\u000d\u000a6 \u0441\u0435\u0440\u043f\u043d\u044f, \u0447\u0435\u0442\u0432\u0435\u0440 \u2013 \u041f\u0440\u0435\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u043d\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0454.\u000d\u000a15 \u0441\u0435\u0440\u043f\u043d\u044f, \u0441\u0443\u0431\u043e\u0442\u0430 \u2013 \u0423\u0441\u043f\u0456\u043d\u043d\u044f \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456.\u000d\u000a8 \u0432\u0435\u0440\u0435\u0441\u043d\u044f, \u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a \u2013 \u0420\u0456\u0437\u0434\u0432\u043e \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456.\u000d\u000a14 \u0432\u0435\u0440\u0435\u0441\u043d\u044f, \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a \u2013 \u0412\u043e\u0437\u0434\u0432\u0438\u0436\u0435\u043d\u043d\u044f \u000d\u000a\u0425\u0440\u0435\u0441\u0442\u0430 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e.\u000d\u000a21 \u043b\u0438\u0441\u0442\u043e\u043f\u0430\u0434\u0430, \u0441\u0443\u0431\u043e\u0442\u0430 \u2013 \u0412\u0432\u0435\u0434\u0435\u043d\u043d\u044f \u0443 \u000d\u000a\u0445\u0440\u0430\u043c \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456.\u000d\u000a25 \u0433\u0440\u0443\u0434\u043d\u044f, \u043f'\u044f\u0442\u043d\u0438\u0446\u044f \u2013 \u0420\u0456\u0437\u0434\u0432\u043e \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u0435.\u000d\u000a\u0412\u0415\u041b\u0418\u041a\u0406 \u0421\u0412\u042f\u0422\u0410\u000d\u000a1 \u0441\u0456\u0447\u043d\u044f, \u0447\u0435\u0442\u0432\u0435\u0440 \u2013 \u041e\u0431\u0440\u0456\u0437\u0430\u043d\u043d\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0454 \u0456 \u000d\u000a\u043f\u0430\u043c\u2019\u044f\u0442\u044c \u0441\u0432\u0442. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e.\u000d\u000a24 \u0447\u0435\u0440\u0432\u043d\u044f, \u0441\u0435\u0440\u0435\u0434\u0430 \u2013 \u0420\u0456\u0437\u0434\u0432\u043e \u0406\u043e\u0430\u043d\u0430 \u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456.\u000d\u000a29 \u0447\u0435\u0440\u0432\u043d\u044f, \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a \u2013 \u0441\u0432\u044f\u0442\u0438\u0445 \u043f\u0435\u0440\u0448\u043e\u0432\u0435\u0440\u0445\u043e\u0432\u043d\u0438\u0445 \u0430\u043f\u043e\u0441\u0442\u043e\u043b\u0456\u0432 \u041f\u0435\u0442\u0440\u0430 \u0456 \u041f\u0430\u0432\u043b\u0430.\u000d\u000a29 \u0441\u0435\u0440\u043f\u043d\u044f, \u0441\u0443\u0431\u043e\u0442\u0430 \u2013 \u0423\u0441\u0456\u043a\u043d\u043e\u0432\u0435\u043d\u043d\u044f \u0433\u043e\u043b\u043e\u0432\u0438 \u0406\u043e\u0430\u043d\u0430 \u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456.\u000d\u000a1 \u0436\u043e\u0432\u0442\u043d\u044f, \u0447\u0435\u0442\u0432\u0435\u0440 \u2013 \u041f\u043e\u043a\u0440\u043e\u0432\u0430 \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456.\u000d\u000a\u0426\u0415\u0420\u041a\u041e\u0412\u041d\u0406 \u041f\u0410\u041c\u2019\u042f\u0422\u041d\u0406 \u0414\u041d\u0406\u000d\u000a3 \u043b\u044e\u0442\u043e\u0433\u043e, \u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a \u2013 \u0434\u0435\u043d\u044c \u0456\u043d\u0442\u0440\u043e\u043d\u0456\u0437\u0430\u0446\u0456\u0457 \u000d\u000a\u0411\u043b\u0430\u0436\u0435\u043d\u043d\u0456\u0439\u0448\u043e\u0433\u043e \u041c\u0438\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0430 \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0432\u0441\u0456\u0454\u0457 \u0423\u043a\u0440\u0430\u0457\u043d\u0438 \u0415\u043f\u0456\u0444\u0430\u043d\u0456\u044f.\u000d\u000a12 \u0442\u0440\u0430\u0432\u043d\u044f, \u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a \u2013 \u0434\u0435\u043d\u044c \u0442\u0435\u0437\u043e\u0456\u043c\u0435\u043d\u0438\u0442\u0441\u0442\u0432\u0430 \u0411\u043b\u0430\u0436\u0435\u043d\u043d\u0456\u0439\u0448\u043e\u0433\u043e \u041c\u0438\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0430 \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0432\u0441\u0456\u0454\u0457 \u0423\u043a\u0440\u0430\u0457\u043d\u0438 \u0415\u043f\u0456\u0444\u0430\u043d\u0456\u044f.\u000d\u000a15 \u043b\u0438\u043f\u043d\u044f, \u0441\u0435\u0440\u0435\u0434\u0430 \u2013 \u0440\u0456\u0432\u043d\u043e\u0430\u043f\u043e\u0441\u0442\u043e\u043b\u044c\u043d\u043e\u0433\u043e \u000d\u000a\u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043a\u043d\u044f\u0437\u044f \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0412\u043e\u043b\u043e\u0434\u0438\u043c\u0438\u0440\u0430. \u0414\u0435\u043d\u044c \u0445\u0440\u0435\u0449\u0435\u043d\u043d\u044f \u0420\u0443\u0441\u0438-\u0423\u043a\u0440\u0430\u0457\u043d\u0438.\u000d\u000a\u041f\u0420\u041e \u041f\u041e\u0421\u0422\u0418 \u0406 \u0422\u0420\u0410\u041f\u0415\u0417\u0418\u000d\u000a\u0411\u0410\u0413\u0410\u0422\u041e\u0414\u0415\u041d\u041d\u0406 \u041f\u041e\u0421\u0422\u0418\u000d\u000a\u0412\u0435\u043b\u0438\u043a\u0438\u0439 \u043f\u0456\u0441\u0442 \u2013 \u0437 23 \u043b\u044e\u0442\u043e\u0433\u043e \u043f\u043e 3 \u043a\u0432\u0456\u0442\u043d\u044f.\u000d\u000a\u0421\u0442\u0440\u0430\u0441\u043d\u0438\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u2013 \u0437 6 \u043f\u043e 11 \u043a\u0432\u0456\u0442\u043d\u044f.\u000d\u000a\u041f\u0435\u0442\u0440\u0456\u0432 \u043f\u0456\u0441\u0442 \u2013 \u0437 8 \u043f\u043e 28 \u0447\u0435\u0440\u0432\u043d\u044f.\u000d\u000a\u0423\u0441\u043f\u0435\u043d\u0441\u044c\u043a\u0438\u0439 \u043f\u0456\u0441\u0442 \u2013 \u0437 1 \u0441\u0435\u0440\u043f\u043d\u044f \u043f\u043e 14 \u0441\u0435\u0440\u043f\u043d\u044f.\u000d\u000a\u0420\u0456\u0437\u0434\u0432\u044f\u043d\u0438\u0439 (\u041f\u0438\u043b\u0438\u043f\u0456\u0432) \u043f\u0456\u0441\u0442 \u2013 \u0437 15 \u043b\u0438\u0441\u0442\u043e\u043f\u0430\u0434\u0430 \u043f\u043e 24 \u0433\u0440\u0443\u0434\u043d\u044f.\u000d\u000a\u041e\u0414\u041d\u041e\u0414\u0415\u041d\u041d\u0406 \u041f\u041e\u0421\u0422\u0418\u000d\u000a\u0421\u0435\u0440\u0435\u0434\u0430 \u0456 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044f \u0432\u043f\u0440\u043e\u0434\u043e\u0432\u0436 \u0443\u0441\u044c\u043e\u0433\u043e \u0440\u043e\u043a\u0443, \u000d\u000a\u0437\u0430 \u0432\u0438\u043d\u044f\u0442\u043a\u043e\u043c \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u0438\u0446\u044c.\u000d\u000a\u0425\u0440\u0435\u0449\u0435\u043d\u0441\u044c\u043a\u0438\u0439 \u0441\u0432\u044f\u0442\u0432\u0435\u0447\u0456\u0440 (\u043d\u0430\u0432\u0435\u0447\u0456\u0440\u2019\u044f \u000d\u000a\u0411\u043e\u0433\u043e\u044f\u0432\u043b\u0435\u043d\u043d\u044f) \u2013 5 \u0441\u0456\u0447\u043d\u044f.\u000d\u000a\u0423\u0441\u0456\u043a\u043d\u043e\u0432\u0435\u043d\u043d\u044f \u0433\u043b\u0430\u0432\u0438 \u0406\u043e\u0430\u043d\u0430 \u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456 \u2013 29 \u000d\u000a\u0441\u0435\u0440\u043f\u043d\u044f.\u000d\u000a\u0412\u043e\u0437\u0434\u0432\u0438\u0436\u0435\u043d\u043d\u044f \u0425\u0440\u0435\u0441\u0442\u0430 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e \u2013 \u000d\u000a14 \u0432\u0435\u0440\u0435\u0441\u043d\u044f.\u000d\u000a\u0417\u0410\u0413\u0410\u041b\u042c\u041d\u0418\u0426\u0406\u000d\u000a\u0421\u0432\u044f\u0442\u043a\u0438 \u2013 \u0437 25 \u0433\u0440\u0443\u0434\u043d\u044f \u043f\u043e 4 \u0441\u0456\u0447\u043d\u044f.\u000d\u000a\u041c\u0438\u0442\u0430\u0440\u044f \u0456 \u0444\u0430\u0440\u0438\u0441\u0435\u044f \u2013 \u0437 2 \u043f\u043e 8 \u043b\u044e\u0442\u043e\u0433\u043e.\u000d\u000a\u0421\u0438\u0440\u043d\u0430 (\u043c\u0430\u0441\u043b\u044f\u043d\u0430) \u2013 \u0437 16 \u043f\u043e 22 \u043b\u044e\u0442\u043e\u0433\u043e.\u000d\u000a\u041f\u0430\u0441\u0445\u0430\u043b\u044c\u043d\u0430 (\u0421\u0432\u0456\u0442\u043b\u0430) \u2013 \u0437 13 \u043f\u043e 19 \u043a\u0432\u0456\u0442\u043d\u044f.\u000d\u000a\u0422\u0440\u043e\u0457\u0446\u044c\u043a\u0430 \u2013 \u0437 1 \u043f\u043e 7 \u0447\u0435\u0440\u0432\u043d\u044f.\u000d\u000a\u041f\u0420\u041e \u0422\u0420\u0410\u041f\u0415\u0417\u0423 \u0423 \u0421\u0412\u042f\u0422\u0410\u000d\u000a\u0417\u0430 \u0446\u0435\u0440\u043a\u043e\u0432\u043d\u0438\u043c \u0443\u0441\u0442\u0430\u0432\u043e\u043c \u0443 \u0441\u0432\u044f\u0442\u0430 \u0420\u0456\u0437\u0434\u0432\u0430 \u000d\u000a\u0425\u0440\u0438\u0441\u0442\u043e\u0432\u043e\u0433\u043e \u0456 \u0411\u043e\u0433\u043e\u044f\u0432\u043b\u0435\u043d\u043d\u044f, \u0449\u043e \u043f\u0440\u0438\u043f\u0430\u043b\u0438 \u000d\u000a\u043d\u0430 \u0441\u0435\u0440\u0435\u0434\u0443 \u0456 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e, \u043f\u043e\u0441\u0442\u0443 \u043d\u0435\u043c\u0430\u0454. \u0423 \u000d\u000a\u0420\u0456\u0437\u0434\u0432\u044f\u043d\u0438\u0439 \u0456 \u0425\u0440\u0435\u0449\u0435\u043d\u0441\u044c\u043a\u0438\u0439 \u0441\u0432\u044f\u0442\u0432\u0435\u0447\u043e\u0440\u0438, \u0443 \u000d\u000a\u0441\u0432\u044f\u0442\u0430 \u0412\u043e\u0437\u0434\u0432\u0438\u0436\u0435\u043d\u043d\u044f \u0425\u0440\u0435\u0441\u0442\u0430 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e \u000d\u000a\u0442\u0430 \u0423\u0441\u0456\u043a\u043d\u043e\u0432\u0435\u043d\u043d\u044f \u0433\u043e\u043b\u043e\u0432\u0438 \u0406\u043e\u0430\u043d\u0430 \u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456 \u000d\u000a\u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454\u0442\u044c\u0441\u044f \u0457\u0436\u0430 \u0437 \u043e\u043b\u0456\u0454\u044e. \u0423 \u0441\u0432\u044f\u0442\u0430 \u0421\u0442\u0440\u0456\u0442\u0435\u043d\u043d\u044f \u000d\u000a\u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e, \u041f\u0440\u0435\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u043d\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e, \u000d\u000a\u0420\u0456\u0437\u0434\u0432\u0430 \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u041f\u043e\u043a\u0440\u043e\u0432\u0438 \u000d\u000a\u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0412\u0432\u0435\u0434\u0435\u043d\u043d\u044f \u0407\u0457 \u0443 \u0445\u0440\u0430\u043c, \u000d\u000a\u0423\u0441\u043f\u0456\u043d\u043d\u044f, \u0420\u0456\u0437\u0434\u0432\u0430 \u0406\u043e\u0430\u043d\u0430 \u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456, \u0430\u043f\u043e\u0441\u0442\u043e\u043b\u0456\u0432 \u000d\u000a\u041f\u0435\u0442\u0440\u0430 \u0456 \u041f\u0430\u0432\u043b\u0430, \u0406\u043e\u0430\u043d\u0430 \u0411\u043e\u0433\u043e\u0441\u043b\u043e\u0432\u0430 \u0442\u0430 \u0432 \u0434\u043d\u0456 \u000d\u000a\u0445\u0440\u0430\u043c\u043e\u0432\u0438\u0445 \u0441\u0432\u044f\u0442, \u0449\u043e \u043f\u0440\u0438\u043f\u0430\u0434\u0430\u044e\u0442\u044c \u043d\u0430 \u0441\u0435\u0440\u0435\u0434\u0443 \u000d\u000a\u0456 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e, \u0430 \u0442\u0430\u043a\u043e\u0436 \u043d\u0430 \u043f\u0435\u0440\u0456\u043e\u0434 \u0432\u0456\u0434 \u041f\u0430\u0441\u0445\u0438 \u0434\u043e \u000d\u000a\u0422\u0440\u043e\u0439\u0446\u0456 \u0432 \u0441\u0435\u0440\u0435\u0434\u0443 \u0456 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454\u0442\u044c\u0441\u044f \u000d\u000a\u0440\u0438\u0431\u0430.\u000d\u000a\u0417\u0410\u0413\u0410\u041b\u042c\u041d\u0406 \u0412\u0406\u0414\u041e\u041c\u041e\u0421\u0422\u0406\u000d\u000a\u041d\u0410 2026 \u0420\u0406\u041a\u000d\u000a3","\u0414\u041d\u0406 \u041e\u0421\u041e\u0411\u041b\u0418\u0412\u041e\u0413\u041e \u000d\u000a\u041f\u041e\u041c\u0418\u041d\u0410\u041d\u041d\u042f \u041f\u041e\u041c\u0415\u0420\u041b\u0418\u0425\u000d\u000a\u0421\u0443\u0431\u043e\u0442\u0430 \u043c\u2019\u044f\u0441\u043e\u043f\u0443\u0441\u043d\u0430 \u2013 14 \u043b\u044e\u0442\u043e\u0433\u043e.\u000d\u000a\u0421\u0443\u0431\u043e\u0442\u0430 2-\u0433\u043e \u0442\u0438\u0436\u043d\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443 \u2013 \u000d\u000a7 \u0431\u0435\u0440\u0435\u0437\u043d\u044f.\u000d\u000a\u0421\u0443\u0431\u043e\u0442\u0430 3-\u0433\u043e \u0442\u0438\u0436\u043d\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443 \u2013 \u000d\u000a14 \u0431\u0435\u0440\u0435\u0437\u043d\u044f.\u000d\u000a\u0421\u0443\u0431\u043e\u0442\u0430 4-\u0433\u043e \u0442\u0438\u0436\u043d\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443 \u2013 \u000d\u000a21 \u0431\u0435\u0440\u0435\u0437\u043d\u044f.\u000d\u000a\u041f\u043e\u043c\u0438\u043d\u0430\u043d\u043d\u044f \u0436\u0435\u0440\u0442\u0432 \u0427\u043e\u0440\u043d\u043e\u0431\u0438\u043b\u044c\u0441\u044c\u043a\u043e\u0457 \u000d\u000a\u0430\u0432\u0430\u0440\u0456\u0457 \u2013 26 \u043a\u0432\u0456\u0442\u043d\u044f.\u000d\u000a\u041f\u043e\u043c\u0438\u043d\u0430\u043d\u043d\u044f \u0437\u0430\u0433\u0438\u0431\u043b\u0438\u0445 \u0443 \u0406\u0406 \u0421\u0432\u0456\u0442\u043e\u0432\u0456\u0439 \u0432\u0456\u0439\u043d\u0456\u000d\u000a\u2013 8 \u0442\u0440\u0430\u0432\u043d\u044f.\u000d\u000a\u041f\u0440\u043e\u0432\u043e\u0434\u0438 \u2013 \u0437 20 \u043f\u043e 26 \u043a\u0432\u0456\u0442\u043d\u044f.\u000d\u000a\u0421\u0443\u0431\u043e\u0442\u0430 \u0422\u0440\u043e\u0457\u0446\u044c\u043a\u0430 \u2013 30 \u0442\u0440\u0430\u0432\u043d\u044f.\u000d\u000a\u041f\u043e\u043c\u0438\u043d\u0430\u043d\u043d\u044f \u0437\u0430\u0433\u0438\u0431\u043b\u0438\u0445 \u0437\u0430\u0445\u0438\u0441\u043d\u0438\u043a\u0456\u0432 \u000d\u000a\u0423\u043a\u0440\u0430\u0457\u043d\u0438 \u2013 29 \u0441\u0435\u0440\u043f\u043d\u044f.\u000d\u000a\u0421\u0443\u0431\u043e\u0442\u0430 \u0414\u0438\u043c\u0438\u0442\u0440\u0456\u0432\u0441\u044c\u043a\u0430 \u2013 24 \u0436\u043e\u0432\u0442\u043d\u044f.\u000d\u000a\u041f\u043e\u043c\u0438\u043d\u0430\u043b\u044c\u043d\u0430 \u0441\u0443\u0431\u043e\u0442\u0430 \u0432\u0441\u0456\u0445 \u0432 \u0423\u043a\u0440\u0430\u0457\u043d\u0456 \u0433\u043e\u043b\u043e\u0434\u043e\u043c \u0437\u0430\u043c\u043e\u0440\u0435\u043d\u0438\u0445 \u2013 28 \u043b\u0438\u0441\u0442\u043e\u043f\u0430\u0434\u0430.\u000d\u000a\u041d\u0415 \u0417\u0412\u0415\u0420\u0428\u0423\u0404\u0422\u042c\u0421\u042f \u0412\u0406\u041d\u0427\u0410\u041d\u041d\u042f\u000d\u000a\u041d\u0430\u043f\u0435\u0440\u0435\u0434\u043e\u0434\u043d\u0456 \u0441\u0435\u0440\u0435\u0434\u0438 \u0456 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u0456 \u0432\u043f\u0440\u043e\u0434\u043e\u0432\u0436 \u000d\u000a\u0443\u0441\u044c\u043e\u0433\u043e \u0440\u043e\u043a\u0443 (\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a \u0456 \u0447\u0435\u0442\u0432\u0435\u0440), \u043d\u0435\u0434\u0456\u043b\u044c\u043d\u0438\u0445 \u000d\u000a\u0434\u043d\u0456\u0432 (\u0441\u0443\u0431\u043e\u0442\u0430), \u0434\u0432\u0430\u043d\u0430\u0434\u0435\u0441\u044f\u0442\u0438\u0445, \u0445\u0440\u0430\u043c\u043e\u0432\u0438\u0445 \u0456 \u0432\u0435\u043b\u0438\u043a\u0438\u0445 \u0441\u0432\u044f\u0442, \u0443\u043f\u0440\u043e\u0434\u043e\u0432\u0436 \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e, \u041f\u0435\u0442\u0440\u043e\u0432\u043e\u0433\u043e, \u000d\u000a\u0423\u0441\u043f\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0420\u0456\u0437\u0434\u0432\u044f\u043d\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0456\u0432, \u0443\u043f\u0440\u043e\u0434\u043e\u0432\u0436 \u000d\u000a\u0441\u0432\u044f\u0442\u043e\u043a \u2013 \u0437 25 \u0433\u0440\u0443\u0434\u043d\u044f \u043f\u043e 7 \u0441\u0456\u0447\u043d\u044f, \u0443\u043f\u0440\u043e\u0434\u043e\u0432\u0436 \u000d\u000a\u0441\u0438\u0440\u043e\u043f\u0443\u0441\u043d\u043e\u0457 \u0441\u0435\u0434\u043c\u0438\u0446\u0456, \u0440\u043e\u0437\u043f\u043e\u0447\u0438\u043d\u0430\u044e\u0447\u0438 \u0437 \u043d\u0435\u0434\u0456\u043b\u0456 \u000d\u000a\u043c\u2019\u044f\u0441\u043e\u043f\u0443\u0441\u043d\u043e\u0457 \u0456 \u0432 \u043d\u0435\u0434\u0456\u043b\u044e \u0441\u0438\u0440\u043e\u043f\u0443\u0441\u043d\u0443, \u0432\u043f\u0440\u043e\u0434\u043e\u0432\u0436 \u000d\u000a\u041f\u0430\u0441\u0445\u0430\u043b\u044c\u043d\u043e\u0457 (\u0421\u0432\u0456\u0442\u043b\u043e\u0457) \u0441\u0435\u0434\u043c\u0438\u0446\u0456, \u0432 \u0434\u043d\u0456 \u0456 \u043d\u0430\u043f\u0435\u0440\u0435\u0434\u043e\u0434\u043d\u0456 \u0423\u0441\u0456\u043a\u043d\u043e\u0432\u0435\u043d\u043d\u044f \u0433\u043e\u043b\u043e\u0432\u0438 \u0406\u043e\u0430\u043d\u0430 \u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456 \u000d\u000a\u2013 29 \u0441\u0435\u0440\u043f\u043d\u044f \u0456 \u0412\u043e\u0437\u0434\u0432\u0438\u0436\u0435\u043d\u043d\u044f \u0425\u0440\u0435\u0441\u0442\u0430 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e \u2013 14 \u0432\u0435\u0440\u0435\u0441\u043d\u044f.\u000d\u000a\u041f\u041e\u042f\u0421\u041d\u0415\u041d\u041d\u042f \u0414\u041e \u041c\u0406\u0421\u042f\u0426\u0415\u0421\u041b\u041e\u0412\u0410\u000d\u000a\u041f\u0456\u0441\u043b\u044f \u0432\u043a\u0430\u0437\u0456\u0432\u043a\u0438 \u0441\u0432\u044f\u0442\u0430 \u0447\u0438 \u043d\u0435\u0434\u0456\u043b\u0456, \u0433\u043b\u0430\u0441\u0443 \u0456 \u0441\u0435\u0434\u043c\u0438\u0446\u0456 \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456 \u0443 \u043f\u0435\u0440\u0448\u043e\u043c\u0443 \u0430\u0431\u0437\u0430\u0446\u0456 \u043f\u043e\u0440\u0443\u0447 \u000d\u000a\u0456\u0437 \u0446\u0438\u0444\u0440\u0430\u043c\u0438 \u0432\u043c\u0456\u0449\u0435\u043d\u043e \u0456\u043c\u0435\u043d\u0430 \u0432\u0441\u0435\u043b\u0435\u043d\u0441\u044c\u043a\u0438\u0445, \u0443\u043a\u0440\u0430\u0457\u043d\u0441\u044c\u043a\u0438\u0445 \u0456 \u0440\u0443\u0441\u044c\u043a\u0438\u0445 \u0441\u0432\u044f\u0442\u0438\u0445, \u044f\u043a\u0456 \u043c\u0430\u044e\u0442\u044c \u0441\u043b\u0443\u0436\u0431\u0443 \u0432 \u041c\u0456\u043d\u0435\u044f\u0445 \u0456 \u0422\u0440\u0456\u043e\u0434\u044f\u0445; \u0443 \u0434\u0440\u0443\u0433\u043e\u043c\u0443 \u2013 \u0456\u043d\u0448\u0456 \u0441\u0432\u044f\u0442\u0430, \u043f\u0430\u043c\u2019\u044f\u0442\u044c \u000d\u000a\u044f\u043a\u0438\u0445 \u043f\u0440\u0438\u043f\u0430\u0434\u0430\u0454 \u043d\u0430 \u0446\u0435\u0439 \u0434\u0435\u043d\u044c; \u0443 \u0442\u0440\u0435\u0442\u044c\u043e\u043c\u0443 \u2013 \u0441\u0432\u044f\u0442\u0430 \u000d\u000a\u043d\u0430 \u0447\u0435\u0441\u0442\u044c \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456. \u0410\u0440\u0430\u0431\u0441\u044c\u043a\u0430 \u0446\u0438\u0444\u0440\u0430 \u000d\u000a\u043f\u0456\u0441\u043b\u044f \u0456\u043c\u0435\u043d\u0456 \u0441\u0432\u044f\u0442\u043e\u0433\u043e \u043e\u0437\u043d\u0430\u0447\u0430\u0454 \u0440\u0456\u043a \u0439\u043e\u0433\u043e \u0443\u043f\u043e\u043a\u043e\u0454\u043d\u043d\u044f \u000d\u000a\u0430\u0431\u043e \u0437\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432. \u0420\u0438\u043c\u0441\u044c\u043a\u0430 \u0446\u0438\u0444\u0440\u0430 \u043e\u0437\u043d\u0430\u0447\u0430\u0454 \u000d\u000a\u0441\u0442\u043e\u043b\u0456\u0442\u0442\u044f, \u0432 \u044f\u043a\u043e\u043c\u0443 \u0436\u0438\u0432 \u0441\u0432\u044f\u0442\u0438\u0439. \u0426\u0438\u0444\u0440\u0430 \u043f\u0456\u0441\u043b\u044f \u043d\u0430\u0439\u043c\u0435\u043d\u0443\u0432\u0430\u043d\u043d\u044f \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u2013 \u0440\u0456\u043a \u043f\u0440\u043e\u0441\u043b\u0430\u0432\u043b\u0435\u043d\u043d\u044f \u0446\u0456\u0454\u0457 \u0456\u043a\u043e\u043d\u0438. \u0423 \u0432\u043a\u0430\u0437\u0456\u0432\u043a\u0430\u0445 \u0447\u0438\u0442\u0430\u043d\u044c \u0440\u0438\u043c\u0441\u044c\u043a\u0430 \u000d\u000a\u0446\u0438\u0444\u0440\u0430 (\u043f\u0456\u0441\u043b\u044f \u0437\u0430\u0447\u0430\u043b\u0430) \u043e\u0437\u043d\u0430\u0447\u0430\u0454 \u0433\u043b\u0430\u0432\u0443, \u0430\u0440\u0430\u0431\u0441\u044c\u043a\u0456 \u2013 \u000d\u000a\u0441\u0442\u0438\u0445\u0438 \u0446\u0456\u0454\u0457 \u0433\u043b\u0430\u0432\u0438. \u0414\u0430\u0442\u0438 \u0432 \u043a\u043e\u043b\u043e\u043d\u0446\u0456 \u0443\u0441\u0442\u0430\u0432\u043d\u0438\u0445 \u0437\u0430\u043c\u0456\u0442\u043e\u043a, \u0432\u043a\u0430\u0437\u0456\u0432\u043a\u0438 \u043d\u0430 \u0447\u0438\u0441\u043b\u0430 \u0456 \u043c\u0456\u0441\u044f\u0446\u0456 \u0456\u043d\u0448\u0438\u0445 \u0434\u043d\u0456\u0432 \u0441\u043a\u0440\u0456\u0437\u044c \u000d\u000a\u043f\u043e\u0434\u0430\u043d\u043e \u0437\u0430 \u0441\u0442\u0430\u0440\u0438\u043c \u0441\u0442\u0438\u043b\u0435\u043c.\u000d\u000a\u0421\u041a\u041e\u0420\u041e\u0427\u0415\u041d\u041d\u042f\u000d\u000a\u0430\u043f. \u2013 \u0430\u043f\u043e\u0441\u0442\u043e\u043b; \u0430\u043f\u043f. \u2013 \u0430\u043f\u043e\u0441\u0442\u043e\u043b\u0438; \u0430\u0440\u0445\u0456\u0454\u043f. \u2013 \u000d\u000a\u0430\u0440\u0445\u0456\u0454\u043f\u0438\u0441\u043a\u043e\u043f; \u0430\u0440\u0445\u0456\u043c. \u2013 \u0430\u0440\u0445\u0456\u043c\u0430\u043d\u0434\u0440\u0438\u0442; \u0431\u0435\u0437\u0441\u0440.\u000d\u000a\u2013 \u0431\u0435\u0437\u0441\u0440\u0456\u0431\u043d\u0438\u043a; \u0431\u043b\u0433\u0432. \u2013 \u0431\u043b\u0430\u0433\u043e\u0432\u0456\u0440\u043d\u0438\u0439; \u0431\u043b\u0436. \u2013 \u000d\u000a\u0431\u043b\u0430\u0436\u0435\u043d\u043d\u0438\u0439; \u0432\u043c\u0447. \u2013 \u0432\u0435\u043b\u0438\u043a\u043e\u043c\u0443\u0447\u0435\u043d\u0438\u043a; \u0432\u043c\u0446. \u2013 \u0432\u0435\u043b\u0438\u043a\u043e\u043c\u0443\u0447\u0435\u043d\u0438\u0446\u044f; \u0434\u0438\u044f\u043a. \u2013 \u0434\u0438\u044f\u043a\u043e\u043d; \u0454\u043f. \u2013 \u0454\u043f\u0438\u0441\u043a\u043e\u043f; \u000d\u000a\u0456\u0433\u0443\u043c. \u2013 \u0456\u0433\u0443\u043c\u0435\u043d; \u0441\u043f\u043e\u0432. \u2013 \u0441\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u043a; \u043a\u043d. \u2013 \u043a\u043d\u044f\u0437\u044c; \u000d\u000a\u043c\u0438\u0442\u0440. \u2013 \u043c\u0438\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442; \u043c\u0446. \u2013 \u043c\u0443\u0447\u0435\u043d\u0438\u0446\u044f; \u043c\u0446\u0446.\u000d\u000a\u2013 \u043c\u0443\u0447\u0435\u043d\u0438\u0446\u0456; \u043c\u0447. \u2013 \u043c\u0443\u0447\u0435\u043d\u0438\u043a; \u043c\u0447\u0447. \u2013 \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0438; \u000d\u000a\u043f\u0430\u0442\u0440. \u2013 \u043f\u0430\u0442\u0440\u0456\u0430\u0440\u0445; \u043f\u0440\u0430\u0432. \u2013 \u043f\u0440\u0430\u0432\u0435\u0434\u043d\u0438\u0439; \u043f\u0440\u043f.\u000d\u000a\u2013 \u043f\u0440\u0435\u043f\u043e\u0434\u043e\u0431\u043d\u0438\u0439; \u043f\u0440\u043f\u043f. \u2013 \u043f\u0440\u0435\u043f\u043e\u0434\u043e\u0431\u043d\u0456; \u043f\u0440\u043c\u0446.\u000d\u000a\u2013 \u043f\u0440\u0435\u043f\u043e\u0434\u043e\u0431\u043d\u043e\u043c\u0443\u0447\u0435\u043d\u0438\u0446\u044f; \u043f\u0440\u043c\u0447. \u2013 \u043f\u0440\u0435\u043f\u043e\u0434\u043e\u0431\u043d\u043e\u043c\u0443\u0447\u0435\u043d\u0438\u043a; \u043f\u0440\u0435\u0441\u0432\u0456\u0442. \u2013 \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440; \u043f\u0440\u043e\u0440.\u000d\u000a\u2013 \u043f\u0440\u043e\u0440\u043e\u043a; \u0441\u0432. \u2013 \u0441\u0432\u044f\u0442\u0438\u0439; \u0441\u0432\u0432. \u2013 \u0441\u0432\u044f\u0442\u0456; \u0441\u0432\u0442. \u2013 \u000d\u000a\u0441\u0432\u044f\u0442\u0438\u0442\u0435\u043b\u044c; \u0441\u0432\u0442\u0442. \u2013 \u0441\u0432\u044f\u0442\u0438\u0442\u0435\u043b\u0456; \u0441\u0449\u043c\u0447. \u2013 \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u043c\u0443\u0447\u0435\u043d\u0438\u043a; \u0441\u0449\u043c\u0447\u0447. \u2013 \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0438; \u000d\u000a\u0432\u0435\u0447. \u2013 \u0432\u0435\u0447\u0456\u0440\u043d\u044f; \u0440\u0430\u043d. \u2013 \u0440\u0430\u043d\u043d\u044f; \u041b\u0456\u0442. \u2013 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f; \u000d\u000a\u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454: \u041c\u0444. \u2013 \u0432\u0456\u0434 \u041c\u0430\u0442\u0444\u0435\u044f, \u041c\u043a. \u2013 \u0432\u0456\u0434 \u041c\u0430\u0440\u043a\u0430, \u041b\u043a. \u2013 \u0432\u0456\u0434 \u041b\u0443\u043a\u0438, \u0406\u043d. \u2013 \u0432\u0456\u0434 \u0406\u043e\u0430\u043d\u0430. \u0414\u0456\u044f\u043d. \u2013 \u0414\u0456\u044f\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0438\u0445 \u0430\u043f\u043e\u0441\u0442\u043e\u043b\u0456\u0432. \u041f\u043e\u0441\u043b\u0430\u043d\u043d\u044f \u0430\u043f\u043e\u0441\u0442\u043e\u043b\u0456\u0432: \u042f\u043a. \u2013 \u042f\u043a\u043e\u0432\u0430, 1 \u041f\u0435\u0442. \u2013 1-\u0448\u0435 \u041f\u0435\u0442\u0440\u0430, 2 \u041f\u0435\u0442.\u000d\u000a\u2013 2-\u0433\u0435 \u041f\u0435\u0442\u0440\u0430, 1 \u0406\u043d. \u2013 1-\u0448\u0435 \u0406\u043e\u0430\u043d\u0430, 2 \u0406\u043d. \u2013 2-\u0433\u0435 \u000d\u000a\u0406\u043e\u0430\u043d\u0430, 3 \u0406\u043d. \u2013 3-\u0442\u0454 \u0406\u043e\u0430\u043d\u0430, \u0406\u0443\u0434. \u2013 \u0406\u0443\u0434\u0438. \u041f\u043e\u0441\u043b\u0430\u043d\u043d\u044f \u000d\u000a\u0430\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u041f\u0430\u0432\u043b\u0430: \u0420\u0438\u043c. \u2013 \u0434\u043e \u0440\u0438\u043c\u043b\u044f\u043d, 1 \u041a\u043e\u0440. \u2013 \u000d\u000a1-\u0448\u0435 \u0434\u043e \u043a\u043e\u0440\u0438\u043d\u0444\u044f\u043d, 2 \u041a\u043e\u0440. \u2013 2-\u0433\u0435 \u0434\u043e \u043a\u043e\u0440\u0438\u043d\u0444\u044f\u043d, \u000d\u000a\u0413\u0430\u043b. \u2013 \u0434\u043e \u0433\u0430\u043b\u0430\u0442\u0456\u0432, \u0415\u0444. \u2013 \u0434\u043e \u0435\u0444\u0435\u0441\u044f\u043d, \u0424\u043b\u043f. \u2013 \u0434\u043e \u000d\u000a\u0444\u0438\u043b\u0438\u043f\u2019\u044f\u043d, \u041a\u043e\u043b. \u2013 \u0434\u043e \u043a\u043e\u043b\u043e\u0441\u044f\u043d, 1 \u0421\u043e\u043b. \u2013 1-\u0448\u0435 \u000d\u000a\u0434\u043e \u0441\u043e\u043b\u0443\u043d\u044f\u043d, 2 \u0421\u043e\u043b. \u2013 2-\u0433\u0435 \u0434\u043e \u0441\u043e\u043b\u0443\u043d\u044f\u043d, 1 \u0422\u0438\u043c.\u000d\u000a\u2013 1-\u0448\u0435 \u0434\u043e \u0422\u0438\u043c\u043e\u0444\u0456\u044f, 2 \u0422\u0438\u043c. \u2013 2-\u0433\u0435 \u0434\u043e \u0422\u0438\u043c\u043e\u0444\u0456\u044f, \u000d\u000a\u0422\u0438\u0442. \u2013 \u0434\u043e \u0422\u0438\u0442\u0430, \u0424\u043b\u043c. \u2013 \u0434\u043e \u0424\u0438\u043b\u0438\u043c\u043e\u043d\u0430, \u0404\u0432\u0440. \u2013 \u000d\u000a\u0434\u043e \u0454\u0432\u0440\u0435\u0457\u0432. \u041a\u043d\u0438\u0433\u0438 \u0421\u0442\u0430\u0440\u043e\u0433\u043e \u0417\u0430\u0432\u0456\u0442\u0443: \u0411\u0443\u0442. \u2013 \u0411\u0443\u0442\u0442\u044f; \u000d\u000a\u0412\u0438\u0445. \u2013 \u0412\u0438\u0445\u0456\u0434; \u041f\u0440\u0438\u0442\u0447. \u2013 \u041f\u0440\u0438\u0442\u0447\u0456 \u0421\u043e\u043b\u043e\u043c\u043e\u043d\u0430; \u0406\u0441. \u2013 \u000d\u000a\u0406\u0441\u0430\u0457; \u0406\u043e\u0457\u043b. \u2013 \u0406\u043e\u0457\u043b\u044f; \u0417\u0430\u0445. \u2013 \u0417\u0430\u0445\u0430\u0440\u0456\u0457.\u000d\u000a\u041f\u043e\u0432\u0441\u044f\u043a\u0434\u0435\u043d\u043d\u0430\u000d\u000a\u0417\u0430\u0443\u043f\u043e\u043a\u0456\u0439\u043d\u0430\u000d\u000a\u0412\u0435\u043b\u0438\u043a\u043e\u043f\u043e\u0441\u0442\u043e\u0432\u0430\u000d\u000a\u041f\u0430\u0441\u0445\u0430\u043b\u044c\u043d\u0430\u000d\u000a\u0411\u0434\u0456\u043d\u043d\u044f (\u0434\u0432\u0430\u043d\u0430\u0434\u0435\u0441\u044f\u0442\u0456)\u000d\u000a\u0411\u0434\u0456\u043d\u043d\u044f (\u0432\u0435\u043b\u0438\u043a\u0456 \u0442\u0430 \u0456\u043d\u0448\u0456)\u000d\u000a\u041f\u043e\u043b\u0456\u0454\u043b\u0435\u0439\u000d\u000a\u0421\u043b\u0430\u0432\u043e\u0441\u043b\u0456\u0432\u2019\u044f\u000d\u000a\u0428\u0435\u0441\u0442\u0435\u0440\u0438\u0447\u043d\u0430\u000d\u000a\u0423\u041c\u041e\u0412\u041d\u0406 \u041f\u041e\u0417\u041d\u0410\u0427\u0415\u041d\u041d\u042f \u0411\u041e\u0413\u041e\u0421\u041b\u0423\u0416\u0406\u041d\u042c\u000d\u000a4","","6\u000d\u000a\u041e\u0411\u0420\u0406\u0417\u0410\u041d\u041d\u042f \u0413\u041e\u0421\u041f\u041e\u0414\u041d\u0404. \u0421\u0432\u0442. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e, \u0430\u0440\u0445\u0456\u0454\u043f. \u041a\u0435\u0441\u0430\u0440\u0456\u0457 \u000d\u000a\u041a\u0430\u043f\u043f\u0430\u0434\u043e\u043a\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (379). \u041c\u0447. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0410\u043d\u043a\u0456\u0440\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 362). \u0421\u0432. \u0415\u043c\u0456\u043b\u0456\u0457, \u043c\u0430\u0442\u0435\u0440\u0456 \u0441\u0432\u0442. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e (\u0406V). \u041f\u0440\u043f. \u0410\u043c\u0444\u0456\u043b\u043e\u0445\u0456\u044f \u041f\u043e\u0447\u0430\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u000d\u000a\u0432 \u043c\u0430\u043b\u0456\u0439 \u0441\u0445\u0438\u043c\u0456 \u0419\u043e\u0441\u0438\u0444\u0430, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f \u0406\u043b\u043e\u0432\u0435\u0446\u044c\u043a\u043e\u0433\u043e. (1971).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e.\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 35 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), X, 1 \u2013 9. \u000d\u000a\u041b\u0456\u0442. \u2013 \u041e\u0431\u0440\u0456\u0437\u0430\u043d\u043d\u044f: \u041a\u043e\u043b., 254 \u0437\u0430\u0447., II, 8 \u2013 12. \u041b\u043a., 6 \u0437\u0430\u0447., II, 20 \u2013 21, 40 \u2013 52. \u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 318 \u0437\u0430\u0447., VII, 26 \u2013 VIII, 2. \u0406\u043d., 36 \u0437\u0430\u0447., X, 9 \u2013 16.\u000d\u000a\u041f\u0440\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23. (\u043f\u0456\u0434 \u0437\u0430\u0447\u0430\u043b\u043e).\u000d\u000a\u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0430\u043d\u0442\u0438\u0444\u043e\u043d\u0438 \u0441\u0432\u044f\u0442\u043a\u043e\u0432\u0456 (\u0434\u0438\u0432. \u0443 \u0434\u043e\u0434\u0430\u0442\u043a\u0443 \u0441. 85), \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0414\u043e\u0441\u0442\u043e\u0439\u043d\u043e \u0454\u2026\u00bb \u2013 \u00ab\u0422\u043e\u0431\u043e\u044e \u0440\u0430\u0434\u0456\u0454, \u0411\u043b\u0430\u0433\u043e\u0434\u0430\u0442\u043d\u0430...\u00bb. \u0412\u0456\u0434\u043f\u0443\u0441\u0442 \u0441\u0432\u044f\u0442\u0430.\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a1\u000d\u000a\u041f\u0435\u0440\u0435\u0434\u0441\u0432\u044f\u0442\u043e \u0411\u043e\u0433\u043e\u044f\u0432\u043b\u0435\u043d\u043d\u044f. \u0421\u0432\u0442. \u0421\u0438\u043b\u044c\u0432\u0435\u0441\u0442\u0440\u0430, \u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0430 \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(335). \u041f\u0440\u043f. \u0421\u0435\u0440\u0430\u0444\u0438\u043c\u0430 \u0421\u0430\u0440\u043e\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (1833). \u041f\u0440\u043f. \u0421\u0438\u043b\u044c\u0432\u0435\u0441\u0442\u0440\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406). \u0421\u0449\u043c\u0447. \u0424\u0435\u043e\u0433\u0435\u043d\u0430, \u0454\u043f. \u041f\u0430\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 320).\u000d\u000a\u0404\u0432\u0440., 326 \u0437\u0430\u0447., X, 35 \u2013 XI, 7. \u041c\u043a., 39 \u0437\u0430\u0447., IX, 10 \u2013 16 (\u0437\u0430 \u0447\u0435\u0442\u0432\u0435\u0440, \u043f\u0456\u0434 \u0437\u0430\u0447\u0430\u043b\u043e).\u000d\u000a\u0404\u0432\u0440., 327 \u0437\u0430\u0447., XI, 8, 11 \u2013 16. \u041c\u043a., 41 \u0437\u0430\u0447., IX, 33 \u2013 41 (\u0437\u0430 \u043f'\u044f\u0442\u043d\u0438\u0446\u044e).\u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 318 \u0437\u0430\u0447., VII, 26 \u2013 VIII, 2. \u0406\u043d., 8 \u0437\u0430\u0447., \u0406\u0406\u0406, 1 \u2013 15.\u000d\u000a\u0417 \u0446\u044c\u043e\u0433\u043e \u0434\u043d\u044f \u0434\u043e 5 \u0441\u0456\u0447\u043d\u044f \u2013 \u043f\u0435\u0440\u0435\u0434\u0441\u0432\u044f\u0442\u043e \u0411\u043e\u0433\u043e\u044f\u0432\u043b\u0435\u043d\u043d\u044f.\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a2\u000d\u000a\u0421\u0443\u0431\u043e\u0442\u0430 \u043f\u0435\u0440\u0435\u0434 \u0411\u043e\u0433\u043e\u044f\u0432\u043b\u0435\u043d\u043d\u044f\u043c. \u041f\u0440\u043e\u0440. \u041c\u0430\u043b\u0430\u0445\u0456\u0457 (400 \u0440. \u0434\u043e \u0420. \u0425.). \u000d\u000a\u041c\u0447. \u0413\u043e\u0440\u0434\u0456\u044f (\u0406V). \u041f\u0440\u043f \u0416\u0435\u043d\u0435\u0432\u2019\u0454\u0432\u0438 \u041f\u0430\u0440\u0438\u0437\u044c\u043a\u043e\u0457 (\u0431\u043b. 512)\u000d\u000a\u0421\u0443\u0431\u043e\u0442\u0438 \u043f\u0435\u0440\u0435\u0434 \u0411\u043e\u0433\u043e\u044f\u0432\u043b\u0435\u043d\u043d\u044f\u043c: 1 \u0422\u0438\u043c., 284 \u0437\u0430\u0447., III, 14 \u2013 IV, 5. \u041c\u0444., 5 \u0437\u0430\u0447., \u000d\u000aIII, 1 \u2013 11.\u000d\u000a\u041c\u0447.: 2 \u0422\u0438\u043c., 292 \u0437\u0430\u0447., II, 1 \u2013 10. \u041c\u0444., 36 \u0437\u0430\u0447., \u0425, 16 \u2013 22.\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a3\u000d\u000a30-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456, \u043f\u0435\u0440\u0435\u0434 \u0411\u043e\u0433\u043e\u044f\u0432\u043b\u0435\u043d\u043d\u044f\u043c. \u000d\u000a\u0413\u043b\u0430\u0441 5-\u0439.\u000d\u000a\u0421\u043e\u0431\u043e\u0440 70-\u0445 \u0430\u043f\u043e\u0441\u0442\u043e\u043b\u0456\u0432: \u042f\u043a\u043e\u0432\u0430, \u0431\u0440\u0430\u0442\u0430 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e; \u041c\u0430\u0440\u043a\u0430 \u0456 \u041b\u0443\u043a\u0438, \u000d\u000a\u0454\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0441\u0442\u0456\u0432; \u041a\u043b\u0435\u043e\u043f\u0438, \u0421\u0438\u043c\u0435\u043e\u043d\u0430, \u0412\u0430\u0440\u043d\u0430\u0432\u0438, \u0406\u043e\u0441\u0456\u0457, \u0437\u0432\u0430\u043d\u043e\u0433\u043e \u042e\u0441\u0442\u043e\u043c, \u0424\u0430\u0434\u0435\u044f, \u0410\u043d\u0430\u043d\u0456\u044f, \u0421\u0442\u0435\u0444\u0430\u043d\u0430, \u0424\u0438\u043b\u0438\u043f\u0430, \u041f\u0440\u043e\u0445\u043e\u0440\u0430, \u041d\u0438\u043a\u0430\u043d\u043e\u0440\u0430, \u0422\u0438\u043c\u043e\u043d\u0430, \u041f\u0430\u0440\u043c\u0435\u043d\u0430, \u0422\u0438\u043c\u043e\u0444\u0456\u044f, \u0422\u0438\u0442\u0430, \u0424\u0438\u043b\u0438\u043c\u043e\u043d\u0430, \u041e\u043d\u0438\u0441\u0438\u043c\u0430, \u0415\u043f\u0430\u0444\u0440\u0430\u0441\u0430, \u0410\u0440\u0445\u0438\u043f\u0430, \u0421\u0438\u043b\u0438, \u000d\u000a\u0421\u0438\u043b\u0443\u0430\u043d\u0430, \u041a\u0440\u0438\u0441\u043a\u0435\u043d\u0442\u0430, \u041a\u0440\u0438\u0441\u043f\u0430, \u0415\u043f\u0435\u043d\u0435\u0442\u0430, \u0410\u043d\u0434\u0440\u043e\u043d\u0456\u043a\u0430, \u0421\u0442\u0430\u0445\u0456\u044f, \u0410\u043c\u043f\u043b\u0456\u044f, \u000d\u000a\u0423\u0440\u0432\u0430\u043d\u0430, \u041d\u0430\u0440\u043a\u0438\u0441\u0430, \u0410\u043f\u0435\u043b\u0456\u044f, \u0410\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u043b\u0430, \u0420\u043e\u0434\u0456\u043e\u043d\u0430 (\u0406\u0440\u043e\u0434\u0456\u043e\u043d\u0430), \u0410\u0433\u0430\u0432\u0430, \u000d\u000a\u0420\u0443\u0444\u0430, \u0410\u0441\u0438\u043d\u043a\u0440\u0438\u0442\u0430, \u0424\u043b\u0435\u0433\u043e\u043d\u0442\u0430, \u0404\u0440\u043c\u0430, \u041f\u0430\u0442\u0440\u043e\u0432\u0430, \u0404\u0440\u043c\u0456\u044f, \u041b\u0456\u043d\u0430, \u0413\u0430\u044f, \u0424\u0456\u043b\u043e\u043b\u043e\u0433\u0430, \u041b\u0443\u043a\u0456\u044f, \u042f\u0441\u043e\u043d\u0430, \u0421\u043e\u0441\u0438\u043f\u0430\u0442\u0440\u0430, \u041e\u043b\u0456\u043c\u043f\u0430 (\u041e\u043b\u0456\u043c\u043f\u0430\u043d\u0430), \u0422\u0435\u0440\u0442\u0456\u044f, \u0415\u0440\u0430\u0441\u0442\u0430, \u000d\u000a\u041a\u0443\u0430\u0440\u0442\u0430, \u0415\u0432\u043e\u0434\u0430, \u041e\u043d\u0438\u0441\u0438\u0444\u043e\u0440\u0430, \u041a\u043b\u0438\u043c\u0435\u043d\u0442\u0430, \u0421\u043e\u0441\u0444\u0435\u043d\u0430, \u0410\u043f\u043e\u043b\u043b\u043e\u0441\u0430, \u0422\u0438\u0445\u0438\u043a\u0430, \u000d\u000a\u0415\u043f\u0430\u0444\u0440\u043e\u0434\u0438\u0442\u0430, \u041a\u0430\u0440\u043f\u0430, \u041a\u043e\u043d\u0434\u0440\u0430\u0442\u0430, \u041c\u0430\u0440\u043a\u0430, \u0441\u0438\u043d\u0430 \u0412\u0430\u0440\u043d\u0430\u0432\u0438, \u0417\u0456\u043d\u0438, \u0437\u0430\u043a\u043e\u043d\u043d\u0438\u043a\u0430, \u0410\u0440\u0438\u0441\u0442\u0430\u0440\u0445\u0430, \u041f\u0443\u0434\u0430, \u0422\u0440\u043e\u0444\u0438\u043c\u0430, \u041c\u0430\u0440\u043a\u0430, \u0410\u0440\u0442\u0435\u043c\u0438, \u0410\u043a\u0438\u043b\u0438, \u0424\u043e\u0440\u0442\u0443\u043d\u0430\u0442\u0430, \u000d\u000a\u0410\u0445\u0430\u0457\u043a\u0430, \u0414\u0456\u043e\u043d\u0456\u0441\u0456\u044f \u0410\u0440\u0435\u043e\u043f\u0430\u0433\u0456\u0442\u0430 \u0456 \u0421\u0438\u043c\u0435\u043e\u043d\u0430 \u041d\u0456\u0433\u0435\u0440\u0430. \u041f\u0440\u043f. \u0424\u0435\u043e\u043a\u0442\u0438\u0441\u0442\u0430, \u0456\u0433\u0443\u043c. \u000d\u000a\u041a\u0443\u043a\u0443\u043c\u0430 \u0421\u0438\u043a\u0435\u043b\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (800). \u0421\u0432\u0442. \u0404\u0432\u0441\u0442\u0430\u0444\u0456\u044f \u0406, \u0430\u0440\u0445\u0456\u0454\u043f. \u0421\u0435\u0440\u0431\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. \u000d\u000a1285). \u041f\u0440\u043f. \u0410\u0445\u0456\u043b\u0438, \u0434\u0438\u044f\u043a., \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406V). \u041f\u0440\u043c\u0447. \u0417\u043e\u0441\u0438\u043c\u0438 \u0456 \u043c\u0447. \u0410\u0444\u0430\u043d\u0430\u0441\u0456\u044f (\u0406\u0406\u0406 \u2013 \u0406V).\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a4","7\u000d\u000a31-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456.\u000d\u000a\u041d\u0430\u0432\u0435\u0447\u0456\u0440\u2019\u044f \u0411\u043e\u0433\u043e\u044f\u0432\u043b\u0435\u043d\u043d\u044f (\u0425\u0440\u0435\u0449\u0435\u043d\u0441\u044c\u043a\u0438\u0439 \u0441\u0432\u044f\u0442\u0432\u0435\u0447\u0456\u0440). \u0421\u0449\u043c\u0447. \u0424\u0435\u043e\u043f\u0435\u043c\u043f\u0442\u0430, \u0454\u043f. \u041d\u0456\u043a\u043e\u043c\u0438\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u043c\u0447. \u0424\u0435\u043e\u043d\u0438, \u0432\u043e\u043b\u0445\u0432\u0430 (303). \u041f\u0440\u043f. \u0421\u0438\u043d\u043a\u043b\u0456\u0442\u0438\u043a\u0456\u0457 \u000d\u000a\u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (\u0431\u043b. 350). \u041f\u0440\u043e\u0440. \u041c\u0438\u0445\u0435\u044f (\u0406\u0425 \u0441\u0442. \u0434\u043e \u0420. \u0425.). \u041f\u0440\u043f. \u0410\u043f\u043e\u043b\u0456\u043d\u0430\u0440\u0456\u0457 (\u0431\u043b. 470). \u041f\u0440\u043f\u043f. \u0424\u043e\u0441\u0442\u0438\u0440\u0456\u044f \u0442\u0430 \u041c\u0438\u043d\u0438 (V\u0406). \u041f\u0440\u043f. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f \u0410\u043a\u0440\u0438\u0442\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 820).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e.\u000d\u000a\u041d\u0430 1-\u043c\u0443 \u0447\u0430\u0441\u0456 \u2013 \u0414\u0456\u044f\u043d., 33 \u0437\u0430\u0447., \u0425\u0406\u0406\u0406, 25 \u2013 32. \u041c\u0444., 5 \u0437\u0430\u0447., \u0406\u0406\u0406, 1 \u2013 11.\u000d\u000a\u041d\u0430 3-\u043c\u0443 \u0447\u0430\u0441\u0456 \u2013 \u0414\u0456\u044f\u043d., 42 \u0437\u0430\u0447., \u0425\u0406\u0425, 1 \u2013 8. \u041c\u043a., 1 \u0437\u0430\u0447., \u0406, 1 \u2013 8.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456 \u2013 \u0420\u0438\u043c., 91 \u0437\u0430\u0447., VI, 3 \u2013 11. \u041c\u043a., 2 \u0437\u0430\u0447., \u0406, 9 \u2013 15.\u000d\u000a\u041d\u0430 9-\u043c\u0443 \u0447\u0430\u0441\u0456 \u2013 \u0422\u0438\u0442., 302 \u0437\u0430\u0447., \u0406\u0406, 11 \u2013 14; \u0406\u0406\u0406, 4 \u2013 7. \u041c\u0444., 6 \u0437\u0430\u0447., \u0406\u0406\u0406, 13 \u2013 17.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u041a\u043e\u0440., 143 \u0437\u0430\u0447., IX, 19 \u2013 27. \u041b\u043a., 9 \u0437\u0430\u0447., III, 1 \u2013 18.\u000d\u000a\u041f\u0456\u0434 \u0447\u0430\u0441 \u043e\u0441\u0432\u044f\u0447\u0435\u043d\u043d\u044f \u0432\u043e\u0434\u0438 \u2013 1 \u041a\u043e\u0440., 143 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b.), \u0425, 1 \u2013 4. \u041c\u043a., 2 \u0437\u0430\u0447., \u000d\u000a\u0406, 9 \u2013 11.\u000d\u000a\u041f\u0456\u0441\u043d\u0438\u0439 \u0434\u0435\u043d\u044c.\u000d\u000a1-\u0438\u0439 \u0447\u0430\u0441 \u0434\u043e \u0440\u0430\u043d\u043d\u044c\u043e\u0457 \u043d\u0435 \u043f\u0440\u0438\u0454\u0434\u043d\u0443\u0454\u0442\u044c\u0441\u044f, \u0430\u043b\u0435 \u0432\u0456\u0434\u043f\u0440\u0430\u0432\u043b\u044f\u044e\u0442\u044c\u0441\u044f \u043e\u043a\u0440\u0435\u043c\u043e \u000d\u000a\u0447\u0430\u0441\u0438 \u043d\u0430\u0432\u0435\u0447\u0456\u0440\u2019\u044f \u0442\u0430 \u0437\u043e\u0431\u0440\u0430\u0436\u0430\u043b\u044c\u043d\u0456, \u00ab\u0411\u043b\u0430\u0436\u0435\u043d\u043d\u0456...\u00bb \u0447\u0438\u0442\u0430\u044e\u0442\u044c\u0441\u044f. \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u000d\u000a\u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0447\u0438\u043d\u0430\u0454\u0442\u044c\u0441\u044f \u0437 \u0432\u0435\u0447\u0456\u0440\u043d\u0456. \u041f\u0456\u0441\u043b\u044f \u0432\u0445\u043e\u0434\u0443 \u000d\u000a\u0437 \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454\u043c \u2013 \u043f\u0440\u043e\u043a\u0438\u043c\u0435\u043d \u0434\u043d\u044f, \u0447\u0438\u0442\u0430\u043d\u043d\u044f 13-\u043e\u0445 \u043f\u0430\u0440\u0435\u043c\u0456\u0439 \u0437\u0456 \u0441\u043f\u0456\u0432\u0430\u043d\u043d\u044f\u043c \u0437\u0430\u0441\u043f\u0456\u0432\u0456\u0432 \u043f\u0456\u0441\u043b\u044f 3-\u043e\u0457 \u0442\u0430 6-\u043e\u0457: \u00ab\u041b\u044e\u0434\u0438\u043d\u043e\u043b\u044e\u0431\u0447\u0435, \u0441\u043b\u0430\u0432\u0430 \u0422\u043e\u0431\u0456\u00bb \u0442\u0430 \u00ab\u0422\u0456\u043b\u044c\u043a\u0438 \u043d\u0430 \u0441\u0438\u0434\u044f\u0447\u0438\u0445 \u0443 \u043f\u0456\u0442\u044c\u043c\u0456, \u0441\u043b\u0430\u0432\u0430 \u0422\u043e\u0431\u0456\u00bb. \u041f\u0456\u0441\u043b\u044f \u043f\u0440\u043e\u0447\u0438\u0442\u0430\u043d\u043d\u044f \u043f\u0430\u0440\u0435\u043c\u0456\u0439 \u2013 \u043c\u0430\u043b\u0430 \u0435\u043a\u0442\u0435\u043d\u0456\u044f, \u000d\u000a\u0432\u0438\u0433\u043e\u043b\u043e\u0441 \u00ab\u0411\u043e \u0422\u0438 \u0441\u0432\u044f\u0442\u0438\u0439, \u0411\u043e\u0436\u0435 \u043d\u0430\u0448...\u00bb, \u0442\u0440\u0438\u0441\u0432\u044f\u0442\u0435 \u0456 \u0434\u0430\u043b\u0456 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u000d\u000a\u00ab\u0414\u043e\u0441\u0442\u043e\u0439\u043d\u043e \u0454\u2026\u00bb \u2013 \u00ab\u0422\u043e\u0431\u043e\u044e \u0440\u0430\u0434\u0456\u0454, \u0411\u043b\u0430\u0433\u043e\u0434\u0430\u0442\u043d\u0430...\u00bb. \u041f\u0456\u0441\u043b\u044f \u0437\u0430\u0430\u043c\u0432\u043e\u043d\u043d\u043e\u0457 \u043c\u043e\u043b\u0438\u0442\u0432\u0438 \u2013 \u0442\u0440\u043e\u043f\u0430\u0440\u0456 \u00ab\u0413\u043e\u043b\u043e\u0441 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0456\u0439...\u00bb \u0456 \u0432\u0435\u043b\u0438\u043a\u0435 \u043e\u0441\u0432\u044f\u0447\u0435\u043d\u043d\u044f \u0432\u043e\u0434\u0438. \u00ab\u041d\u0435\u0445\u0430\u0439 \u000d\u000a\u0431\u0443\u0434\u0435 \u0456\u043c\u2019\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0454...\u00bb (\u0442\u0440\u0438\u0447\u0456), 33-\u0439 \u043f\u0441\u0430\u043b\u043e\u043c \u0456 \u0432\u0456\u0434\u043f\u0443\u0441\u0442. \u041f\u0456\u0441\u043b\u044f \u0432\u0456\u0434\u043f\u0443\u0441\u0442\u0443 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0447\u0438\u043d \u0441\u043b\u0430\u0432\u043b\u0435\u043d\u043d\u044f, \u043a\u043b\u0456\u0440\u0438\u043a\u0438 \u043f\u0435\u0440\u0435\u0434 \u0456\u043a\u043e\u043d\u043e\u044e \u0456 \u0441\u0432\u0456\u0447\u043d\u0438\u043a\u043e\u043c \u0437 \u0437\u0430\u043f\u0430\u043b\u0435\u043d\u043e\u044e \u000d\u000a\u0441\u0432\u0456\u0447\u043a\u043e\u044e \u0441\u043f\u0456\u0432\u0430\u044e\u0442\u044c \u0442\u0440\u043e\u043f\u0430\u0440 \u0456 \u043a\u043e\u043d\u0434\u0430\u043a \u0441\u0432\u044f\u0442\u0430 \u0411\u043e\u0433\u043e\u044f\u0432\u043b\u0435\u043d\u043d\u044f.\u000d\u000a\u0421\u0412\u042f\u0422\u0415 \u0411\u041e\u0413\u041e\u042f\u0412\u041b\u0415\u041d\u041d\u042f. \u0425\u0420\u0415\u0429\u0415\u041d\u041d\u042f \u0413\u041e\u0421\u041f\u041e\u0414\u0410 \u0411\u041e\u0413\u0410 \u0406 \u0421\u041f\u0410\u0421\u0418\u0422\u0415\u041b\u042f \u041d\u0410\u0428\u041e\u0413\u041e \u0406\u0421\u0423\u0421\u0410 \u0425\u0420\u0418\u0421\u0422\u0410.\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 \u0417\u043e\u043b\u043e\u0442\u043e\u0443\u0441\u0442\u043e\u0433\u043e.\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u043a., 2 \u0437\u0430\u0447., I, 9 \u2013 11. \u000d\u000a\u041b\u0456\u0442. \u2013 \u0422\u0438\u0442., 302 \u0437\u0430\u0447., II, 11 \u2013 14; III, 4 \u2013 7. \u041c\u0444., 6 \u0437\u0430\u0447., III, 13 \u2013 17.\u000d\u000a\u041f\u0456\u0434 \u0447\u0430\u0441 \u043e\u0441\u0432\u044f\u0447\u0435\u043d\u043d\u044f \u0432\u043e\u0434\u0438 \u2013 1 \u041a\u043e\u0440., 143 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b.), \u0425, 1 \u2013 4. \u041c\u043a., 2 \u000d\u000a\u0437\u0430\u0447., \u0406, 9 \u2013 11.\u000d\u000a\u0412\u0441\u0435\u043d\u0456\u0447\u043d\u0430 \u043f\u043e\u0447\u0438\u043d\u0430\u0454\u0442\u044c\u0441\u044f \u0437 \u0432\u0438\u0433\u043e\u043b\u043e\u0441\u0443: \u00ab\u0421\u043b\u0430\u0432\u0430 \u0421\u0432\u044f\u0442\u0456\u0439, \u0404\u0434\u0438\u043d\u043e\u0441\u0443\u0449\u043d\u0456\u0439, \u000d\u000a\u0416\u0438\u0432\u043e\u0442\u0432\u043e\u0440\u0447\u0456\u0439 \u0456 \u041d\u0435\u0440\u043e\u0437\u0434\u0456\u043b\u044c\u043d\u0456\u0439 \u0422\u0440\u043e\u0439\u0446\u0456 \u0437\u0430\u0432\u0436\u0434\u0438, \u043d\u0438\u043d\u0456 \u0456 \u043f\u043e\u0432\u0441\u044f\u043a\u0447\u0430\u0441, \u0456 \u043d\u0430 \u0432\u0456\u043a\u0438 \u000d\u000a\u0432\u0456\u043a\u0456\u0432\u00bb. \u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0422\u0435\u0431\u0435, \u0416\u0438\u0442\u0442\u0454\u0434\u0430\u0432\u0447\u0435 \u0425\u0440\u0438\u0441\u0442\u0435, \u0449\u043e \u0437\u0430\u0440\u0430\u0434\u0438 \u043d\u0430\u0441 \u043d\u0438\u043d\u0456 \u043f\u043b\u043e\u0442\u0442\u044e \u0445\u0440\u0435\u0441\u0442\u0438\u0432\u0441\u044f \u0432\u0456\u0434 \u0406\u043e\u0430\u043d\u0430 \u0443 \u0432\u043e\u0434\u0430\u0445 \u0419\u043e\u0440\u0434\u0430\u043d\u0441\u044c\u043a\u0438\u0445\u00bb. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \"\u0427\u0435\u0441\u043d\u0456\u0448\u0443...\" \u2013 \u043f\u0440\u0438\u0441\u043f\u0456\u0432\u0438 \u0441\u0432\u044f\u0442\u0430. 1-\u0439 \u043f\u0440\u0438\u0441\u043f\u0456\u0432: \"\u0412\u0435\u043b\u0438\u0447\u0430\u0439, \u0434\u0443\u0448\u0435 \u043c\u043e\u044f, \u0447\u0435\u0441\u043d\u0456\u0448\u0443 \u0456 \u0441\u043b\u0430\u0432\u043d\u0456\u0448\u0443 \u0432\u0456\u0434 \u0433\u043e\u0440\u043d\u0456\u0445 \u0432\u043e\u0457\u043d\u0441\u0442\u0432 \u0414\u0456\u0432\u0443 \u041f\u0440\u0435\u0447\u0438\u0441\u0442\u0443 \u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u044e\". \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u2013 \u0430\u043d\u0442\u0438\u0444\u043e\u043d\u0438 \u0441\u0432\u044f\u0442\u0430, \u0432\u0445\u0456\u0434\u043d\u0438\u0439 \u0441\u0442\u0438\u0445: \u00ab\u0411\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0435\u043d\u043d\u0438\u0439, \u0445\u0442\u043e \u0439\u0434\u0435 \u0432 \u0456\u043c\u2019\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0454, \u0431\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u043b\u044f\u0454\u043c\u043e \u0432\u0430\u0441 \u0456\u0437 \u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a6\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a5\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 8-\u0435, \u0406\u043d., 64 \u0437\u0430\u0447., XX, 11 \u2013 18.\u000d\u000a\u041b\u0456\u0442. \u2013 \u043d\u0435\u0434\u0456\u043b\u0456 \u043f\u0435\u0440\u0435\u0434 \u0411\u043e\u0433\u043e\u044f\u0432\u043b\u0435\u043d\u043d\u044f\u043c: 2 \u0422\u0438\u043c., 298 \u0437\u0430\u0447., IV, 5 \u2013 8. \u041c\u043a., 1 \u000d\u000a\u0437\u0430\u0447., I, 1 \u2013 8.\u000d\u000a\u0410\u043f\u043f.: \u0420\u0438\u043c., 96 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), VIII, 3 \u2013 9. \u041b\u043a., 50 \u0437\u0430\u0447., X, 1 \u2013 15.","8\u000d\u000a\u0434\u043e\u043c\u0443 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e, \u0411\u043e\u0433 \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u0456 \u044f\u0432\u0438\u0432\u0441\u044f \u043d\u0430\u043c\u00bb. \u041d\u0430 \u0430\u0440\u0445\u0456\u0454\u0440\u0435\u0439\u0441\u044c\u043a\u0456\u0439 \u000d\u000a\u0441\u043b\u0443\u0436\u0431\u0456 \u0432 \u0434\u0435\u043d\u044c \u0441\u0432\u044f\u0442\u0430 \u0456 \u043d\u0430 \u0449\u043e\u0434\u0435\u043d\u043d\u0438\u0445 \u0441\u043b\u0443\u0436\u0431\u0430\u0445 \u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f (\u0432\u043a\u043b\u044e\u0447\u043d\u043e) \u043d\u0430 \u000d\u000a\u0432\u0445\u043e\u0434\u0456 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u00ab\u041f\u0440\u0438\u0439\u0434\u0456\u0442\u044c, \u043f\u043e\u043a\u043b\u043e\u043d\u0456\u043c\u043e\u0441\u044c\u2026 \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, \u0449\u043e \u000d\u000a\u0432 \u0419\u043e\u0440\u0434\u0430\u043d\u0456 \u0445\u0440\u0435\u0441\u0442\u0438\u0432\u0441\u044f\u2026\u00bb. \u0423 \u0434\u0435\u043d\u044c \u0441\u0432\u044f\u0442\u0430 \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u0442\u0440\u0438\u0441\u0432\u044f\u0442\u043e\u0433\u043e \u2013 \u00ab\u0412\u0441\u0456 \u0432\u0438, \u0449\u043e \u000d\u000a\u0432 \u0425\u0440\u0438\u0441\u0442\u0430 \u0445\u0440\u0435\u0441\u0442\u0438\u043b\u0438\u0441\u044f...\u00bb. \u0417\u0430\u0434\u043e\u0441\u0442\u043e\u0439\u043d\u0438\u043a \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0439, \u0434\u0443\u0448\u0435 \u043c\u043e\u044f...\u00bb, \u00ab\u041d\u0435 \u0432 \u000d\u000a\u0437\u043c\u043e\u0437\u0456 \u043d\u0456\u044f\u043a\u0430 \u043b\u044e\u0434\u0438\u043d\u0430...\u00bb. \u041f\u0456\u0441\u043b\u044f \u0437\u0430\u0430\u043c\u0432\u043e\u043d\u043d\u043e\u0457 \u043c\u043e\u043b\u0438\u0442\u0432\u0438 \u2013 \u0432\u0435\u043b\u0438\u043a\u0435 \u043e\u0441\u0432\u044f\u0447\u0435\u043d\u043d\u044f \u0432\u043e\u0434\u0438. \u00ab\u041d\u0435\u0445\u0430\u0439 \u0431\u0443\u0434\u0435 \u0456\u043c\u2019\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0454...\u00bb (\u0442\u0440\u0438\u0447\u0456), 33-\u0439 \u043f\u0441\u0430\u043b\u043e\u043c \u0456 \u0432\u0456\u0434\u043f\u0443\u0441\u0442. \u000d\u000a\u0423\u0432\u0435\u0447\u0435\u0440\u0456 \u0446\u044c\u043e\u0433\u043e \u0434\u043d\u044f \u0437\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f \u0432\u0435\u043b\u0438\u043a\u0430 \u0432\u0435\u0447\u0456\u0440\u043d\u044f \u0437 \u0432\u0445\u043e\u0434\u043e\u043c \u0456 \u0432\u0435\u043b\u0438\u043a\u0438\u043c \u043f\u0440\u043e\u043a\u0438\u043c\u043d\u043e\u043c: \u00ab\u0411\u043e\u0433 \u043d\u0430\u0448 \u043d\u0430 \u043d\u0435\u0431\u0435\u0441\u0430\u0445 \u0456 \u043d\u0430 \u0437\u0435\u043c\u043b\u0456, \u0432\u0441\u0435, \u0449\u043e \u0437\u0430\u0445\u043e\u0442\u0456\u0432, \u0441\u0442\u0432\u043e\u0440\u0438\u0432\u00bb.\u000d\u000a\u0421\u043e\u0431\u043e\u0440 \u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456 \u0456 \u0425\u0440\u0435\u0441\u0442\u0438\u0442\u0435\u043b\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e \u0406\u043e\u0430\u043d\u0430.\u000d\u000a\u042f\u043a., 50 \u0437\u0430\u0447., I, 1 \u2013 18. \u041c\u043a., 44 \u0437\u0430\u0447., X, 11 \u2013 16.\u000d\u000a\u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456: \u0414\u0456\u044f\u043d., 42 \u0437\u0430\u0447., XIX, 1 \u2013 8. \u0406\u043d., 3 \u0437\u0430\u0447., I, 29 \u2013 34.\u000d\u000a\u041f\u0440\u043f\u043f. \u0413\u0435\u043e\u0440\u0433\u0456\u044f \u0425\u043e\u0437\u0435\u0432\u0456\u0442\u0430 (V\u0406\u0406) \u0442\u0430 \u0415\u043c\u0456\u043b\u0456\u0430\u043d\u0430, \u0441\u043f\u043e\u0432. (\u0406\u0425). \u041f\u0440\u043f. \u0414\u043e\u043c\u043d\u0456\u043a\u0438 (\u0431\u043b. \u000d\u000a474). \u041f\u0440\u043f. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (1093). \u041f\u0440\u043f. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406 \u2013 \u0425\u0406V). \u0421\u0449\u043c\u0447. \u041a\u0430\u0440\u0442\u0435\u0440\u0456\u044f, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 \u000d\u000a\u041a\u0435\u0441\u0430\u0440\u0456\u0457 \u041a\u0430\u043f\u043f\u0430\u0434\u043e\u043a\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (304). \u0421\u0449\u043c\u0447. \u0424\u0435\u043e\u0444\u0456\u043b\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0430, \u0442\u0430 \u043c\u0447. \u0415\u043b\u043b\u0430\u0434\u0456\u044f (\u0406V). \u041c\u0447\u0447. \u042e\u043b\u0456\u0430\u043d\u0430, \u041a\u0435\u043b\u0441\u0456\u044f, \u0410\u043d\u0442\u043e\u043d\u0456\u044f, \u0410\u043d\u0430\u0441\u0442\u0430\u0441\u0456\u044f, \u043c\u0446\u0446. \u0412\u0430\u0441\u0438\u043b\u0456\u0441\u0438 \u0456 \u041c\u0430\u0440\u0456\u043e\u043d\u0456\u043b\u0438, \u0441\u0456\u043c\u043e\u0445 \u043e\u0442\u0440\u043e\u043a\u0456\u0432 \u0442\u0430 20-\u043e\u0445 \u0432\u043e\u0457\u043d\u0456\u0432 (313). \u041f\u0440\u043f. \u0406\u043b\u043b\u0456 \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u000d\u000a\u041c\u0447. \u0410\u0431\u043e \u0422\u0431\u0456\u043b\u0456\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 790, \u0413\u0440\u0443\u0437.).\u000d\u000a\u042f\u043a., 51 \u0437\u0430\u0447., I, 19 \u2013 27. \u041c\u043a., 45 \u0437\u0430\u0447., X, 17 \u2013 27.\u000d\u000a\u041c\u0447. \u041f\u043e\u043b\u0456\u0454\u0432\u043a\u0442\u0430 (259). \u041f\u0440\u043e\u0440. \u0421\u0430\u043c\u0435\u044f (\u0425 \u0441\u0442. \u0434\u043e \u0420. \u0425.). \u0421\u0432\u0442. \u041f\u0435\u0442\u0440\u0430, \u0454\u043f. \u0421\u0435\u0432\u0430\u0441\u0442\u0456\u0457 \u0412\u0456\u0440\u043c\u0435\u043d\u0441\u044c\u043a\u043e\u0457 (\u0406V). \u041f\u0440\u043f. \u0404\u0432\u0441\u0442\u0440\u0430\u0442\u0456\u044f, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (\u0406\u0425). \u041f\u0440\u043f. \u0406\u043e\u043d\u0438 \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1902).\u000d\u000a\u042f\u043a., 52 \u0437\u0430\u0447., I\u0406, 1 \u2013 13. \u041c\u043a., 46 \u0437\u0430\u0447., X, 24 \u2013 32.\u000d\u000a\u0421\u0443\u0431\u043e\u0442\u0430 \u043f\u0456\u0441\u043b\u044f \u0411\u043e\u0433\u043e\u044f\u0432\u043b\u0435\u043d\u043d\u044f. \u0421\u0432\u0442. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f, \u0454\u043f. \u041d\u0438\u0441\u044c\u043a\u043e\u0433\u043e (395). \u000d\u000a\u041f\u0440\u043f. \u0414\u043e\u043c\u0435\u0442\u0456\u0430\u043d\u0430, \u0454\u043f. \u041c\u0435\u043b\u0456\u0442\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e (601). \u041f\u0440\u043f. \u041c\u0430\u0440\u043a\u0456\u0430\u043d\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 (V). \u041f\u0440\u043f. \u041c\u0430\u043a\u0430\u0440\u0456\u044f. \u0411\u043b\u0436. \u0424\u0435\u043e\u0437\u0432\u0438, \u0434\u0438\u044f\u043a\u043e\u043d\u0438\u0441\u0438, \u0441\u0435\u0441\u0442\u0440\u0438 \u0441\u0432\u0442. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f \u000d\u000a\u041d\u0438\u0441\u044c\u043a\u043e\u0433\u043e (385).\u000d\u000a\u0421\u0443\u0431\u043e\u0442\u0438 \u043f\u0456\u0441\u043b\u044f \u0411\u043e\u0433\u043e\u044f\u0432\u043b\u0435\u043d\u043d\u044f: \u0415\u0444., 233 \u0437\u0430\u0447., VI, 10 \u2013 17. \u041c\u0444., 7 \u0437\u0430\u0447., IV, \u000d\u000a1 \u2013 11.\u000d\u000a\u0421\u0432\u0442.: 1 \u041a\u043e\u0440., 151 \u0437\u0430\u0447., XII, 7 \u2013 11. \u041c\u0444., 34 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b.), X, 1 \u2013 8.\u000d\u000a\u041f\u0440\u043e\u043a\u0438\u043c\u0435\u043d, \u0430\u043b\u0438\u043b\u0443\u0430\u0440\u0456\u0439 \u0456 \u043f\u0440\u0438\u0447\u0430\u0441\u043d\u0438\u0439 \u2013 \u0441\u0432\u044f\u0442\u0430; \u0410\u043f\u043e\u0441\u0442\u043e\u043b \u0456 \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454 \u2013 \u0441\u0443\u0431\u043e\u0442\u0438 \u000d\u000a\u043f\u0456\u0441\u043b\u044f \u0411\u043e\u0433\u043e\u044f\u0432\u043b\u0435\u043d\u043d\u044f \u0456 \u0441\u0432\u044f\u0442\u0438\u0442\u0435\u043b\u044e.\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a7\u000d\u000a8\u000d\u000a9\u000d\u000a10\u000d\u000a31-\u0448\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456, \u043f\u0456\u0441\u043b\u044f \u0411\u043e\u0433\u043e\u044f\u0432\u043b\u0435\u043d\u043d\u044f. \u0413\u043b\u0430\u0441 6-\u0439.\u000d\u000a\u041f\u0440\u043f. \u0424\u0435\u043e\u0434\u043e\u0441\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e, \u0437\u0430\u0441\u043d\u043e\u0432\u043d\u0438\u043a\u0430 \u0441\u043f\u0456\u043b\u044c\u043d\u043e\u0442\u043d\u043e\u0433\u043e \u0436\u0438\u0442\u0442\u044f \u000d\u000a(529). \u041f\u0440\u043f. \u0424\u0435\u043e\u0434\u043e\u0441\u0456\u044f \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 412).\u000d\u000a\u0404\u043b\u0435\u0446\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (1060).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 9-\u0435, \u0406\u043d., 65 \u0437\u0430\u0447., X\u0425, 19 \u2013 31.\u000d\u000a\u041b\u0456\u0442. \u2013 \u043d\u0435\u0434\u0456\u043b\u0456 \u043f\u0456\u0441\u043b\u044f \u0411\u043e\u0433\u043e\u044f\u0432\u043b\u0435\u043d\u043d\u044f: \u0415\u0444., 224 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), IV, 7 \u2013 13. \u000d\u000a\u041c\u0444., 8 \u0437\u0430\u0447., IV, 12 \u2013 17.\u000d\u000a\u041f\u0440\u043f.: 2 \u041a\u043e\u0440., 176 \u0437\u0430\u0447., IV, 6 \u2013 15. \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a11","9\u000d\u000a\u041c\u0447\u0447. \u0404\u0440\u043c\u0438\u043b\u0430 \u0442\u0430 \u0421\u0442\u0440\u0430\u0442\u043e\u043d\u0456\u043a\u0430 (\u0431\u043b. 315). \u041c\u0447. \u041f\u0435\u0442\u0440\u0430 \u0410\u043d\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (309 \u2013 \u000d\u000a310). \u041f\u0440\u043f. \u042f\u043a\u043e\u0432\u0430, \u0454\u043f. \u041d\u0438\u0437\u0438\u0431\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (350).\u000d\u000a\u0404\u0432\u0440., 310 \u0437\u0430\u0447., IV, 1 \u2013 13. \u041b\u043a., 106 \u0437\u0430\u0447., XXI, 12 \u2013 19.\u000d\u000a\u041f\u0440\u043f.: \u0420\u0438\u043c., 99 \u0437\u0430\u0447., V\u0406\u0406\u0406, 28 \u2013 39. \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u0412\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0430 \u0411\u043e\u0433\u043e\u044f\u0432\u043b\u0435\u043d\u043d\u044f. \u041f\u0440\u043f\u043f. \u043e\u0442\u0446\u0456\u0432, \u044f\u043a\u0456 \u0432 \u0421\u0438\u043d\u0430\u0457 \u0439 \u0420\u0430\u0457\u0444\u0456 \u000d\u000a\u0431\u0443\u043b\u0438 \u0432\u0431\u0438\u0442\u0456: \u0406\u0441\u0430\u0457, \u0421\u0430\u0432\u0438, \u041c\u043e\u0439\u0441\u0435\u044f \u0456 \u0443\u0447\u043d\u044f \u0439\u043e\u0433\u043e \u041c\u043e\u0439\u0441\u0435\u044f, \u0404\u0440\u0435\u043c\u0456\u0457, \u041f\u0430\u0432\u043b\u0430, \u000d\u000a\u0410\u0434\u0430\u043c\u0430, \u0421\u0435\u0440\u0433\u0456\u044f, \u0414\u043e\u043c\u043d\u0430, \u041f\u0440\u043e\u043a\u043b\u0430, \u0406\u043f\u0430\u0442\u0456\u044f, \u0406\u0441\u0430\u0430\u043a\u0430, \u041c\u0430\u043a\u0430\u0440\u0456\u044f, \u041c\u0430\u0440\u043a\u0430, \u0412\u0435\u043d\u0456\u0430\u043c\u0456\u043d\u0430, \u0404\u0432\u0441\u0435\u0432\u0456\u044f, \u0406\u043b\u043b\u0456 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 \u0456\u0437 \u043d\u0438\u043c\u0438 (\u0406V \u2013 V). \u0420\u0456\u0432\u043d\u043e\u0430\u043f. \u041d\u0456\u043d\u0438, \u043f\u0440\u043e\u0441\u0432\u0456\u0442\u0438\u0442\u0435\u043b\u044c\u043a\u0438 \u0413\u0440\u0443\u0437\u0456\u0457 (335). \u041f\u0440\u043f. \u0419\u043e\u0441\u0438\u0444\u0430 \u0410\u043d\u0430\u043b\u0456\u0442\u0438\u043d\u0430 \u0420\u0430\u0457\u0444\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u000d\u000a\u041f\u0440\u043f. \u0424\u0435\u043e\u0434\u0443\u043b\u0430 (V). \u041f\u0440\u043f. \u0421\u0442\u0435\u0444\u0430\u043d\u0430 (V\u0406\u0406\u0406).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u0444., 34 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), X, 1 \u2013 8.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0404\u0432\u0440., 312 \u0437\u0430\u0447., V, 11 \u2013 V\u0406, 8. \u041b\u043a., 104 \u0437\u0430\u0447., XXI, 5 \u2013 7, 10 \u2013 11, 20 \u000d\u000a\u2013 24. \u000d\u000a\u0420\u0456\u0432\u043d\u043e\u0430\u043f.: 1 \u041a\u043e\u0440., 131 \u0437\u0430\u0447., IV, 9 \u2013 16. \u041c\u0444., 104 \u0437\u0430\u0447., XXV, 1 \u2013 13.\u000d\u000a\u0421\u043b\u0443\u0436\u0431\u0430 \u043f\u0440\u0435\u043f\u043e\u0434\u043e\u0431\u043d\u0438\u043c \u043e\u0442\u0446\u044f\u043c, \u044f\u043a\u0456 \u0432 \u0421\u0438\u043d\u0430\u0457 \u0439 \u0420\u0430\u0457\u0444\u0456 \u0431\u0443\u043b\u0438 \u0432\u0431\u0438\u0442\u0456, \u043f\u0435\u0440\u0435\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u043d\u0430 13 \u0441\u0456\u0447\u043d\u044f.\u000d\u000a\u041f\u0440\u043f. \u041f\u0430\u0432\u043b\u0430 \u0424\u0456\u0432\u0435\u0439\u0441\u044c\u043a\u043e\u0433\u043e (341) \u0442\u0430 \u0406\u043e\u0430\u043d\u0430 \u041a\u0443\u0449\u043d\u0438\u043a\u0430 (V). \u041f\u0440\u043c\u0447. \u041f\u0430\u043d\u0441\u043e\u0444\u0456\u044f \u000d\u000a(249 \u2013 251). \u041f\u0440\u043f\u043f. \u041f\u0440\u043e\u0445\u043e\u0440\u0430 (\u0425) \u0456 \u0413\u0430\u0432\u0440\u0438\u0457\u043b\u0430 (\u0425\u0406, \u0421\u0435\u0440\u0431.).\u000d\u000a\u0404\u0432\u0440., 315 \u0437\u0430\u0447., V\u0406\u0406, 1 \u2013 6. \u041b\u043a., 107 \u0437\u0430\u0447., XXI, 28 \u2013 33. \u000d\u000a\u041f\u0440\u043f\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30.\u000d\u000a\u0417 \u0446\u044c\u043e\u0433\u043e \u0434\u043d\u044f \u0434\u043e \u043f\u0435\u0440\u0435\u0434\u0441\u0432\u044f\u0442\u0430 \u0421\u0442\u0440\u0456\u0442\u0435\u043d\u043d\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u041e\u043a\u0442\u043e\u0457\u0445. \u0417 \u0446\u044c\u043e\u0433\u043e \u0434\u043d\u044f \u0456 \u0434\u043e \u0421\u0442\u0440\u0456\u0442\u0435\u043d\u043d\u044f \u043d\u0430 \u0441\u0432\u044f\u0442\u043a\u043e\u0432\u0456\u0439 \u0440\u0430\u043d\u043d\u0456\u0439 \u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f \u00ab\u0421\u0443\u0448\u0443 \u0432 \u000d\u000a\u0433\u043b\u0438\u0431\u0438\u043d\u0456 \u0437\u0435\u043c\u043b\u0456\u2026\u00bb.\u000d\u000a\u041f\u043e\u043a\u043b\u043e\u043d\u0456\u043d\u043d\u044f \u043e\u043a\u043e\u0432\u0430\u043c \u0430\u043f. \u041f\u0435\u0442\u0440\u0430. \u041c\u0447\u0447. \u0421\u043f\u0435\u0432\u0441\u0438\u043f\u0430, \u0404\u043b\u0435\u0432\u0441\u0438\u043f\u0430, \u041c\u0430\u043b\u0435\u0432\u0441\u0438\u043f\u0430 \u0456 \u0431\u0430\u0431\u0446\u0456 \u0457\u0445\u043d\u044c\u043e\u0457 \u041b\u0435\u043e\u043d\u0456\u043b\u0438, \u0456 \u0437 \u043d\u0438\u043c\u0438 \u041d\u0435\u043e\u043d\u0430, \u0422\u0443\u0440\u0432\u043e\u043d\u0430 \u0442\u0430 \u0406\u043e\u0432\u0438\u043b\u0438 (161 \u2013 \u000d\u000a180). \u041c\u0447. \u0414\u0430\u043d\u0430\u043a\u0442\u0430, \u0447\u0438\u0442\u0446\u044f (\u0406\u0406).\u000d\u000a\u0404\u0432\u0440., 317 \u0437\u0430\u0447., V\u0406\u0406, 18 \u2013 25. \u041b\u043a., 108 \u0437\u0430\u0447., XXI, 37 \u2013 XXII, 8.\u000d\u000a\u0410\u043f.: \u0414\u0456\u044f\u043d., 29 \u0437\u0430\u0447., XII, 1 \u2013 11. \u0406\u043d., 67 \u0437\u0430\u0447., XXI, 15 \u2013 25.\u000d\u000a\u041f\u0440\u043f. \u0410\u043d\u0442\u043e\u043d\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e (356).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30.\u000d\u000a\u041b\u0456\u0442. \u2013 \u041f\u0440\u043f.: \u0404\u0432\u0440., 335 \u0437\u0430\u0447., XIII, 17 \u2013 21. \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u0420\u044f\u0434: \u0415\u0444., 220 \u0437\u0430\u0447., \u0406\u0406, 11 \u2013 13. \u041b\u043a., 72 \u0437\u0430\u0447., XIII, 18 \u2013 29.\u000d\u000a32-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456 (\u0440\u044f\u0434\u043e\u0432\u0456 \u0447\u0438\u0442\u0430\u043d\u043d\u044f 29-\u0433\u043e \u0442\u0438\u0436\u043d\u044f \u000d\u000a\u0447\u0435\u0440\u0435\u0437 \u0425\u0440\u0435\u0449\u0435\u043d\u0441\u044c\u043a\u0443 \u0432\u0456\u0434\u0441\u0442\u0443\u043f\u043a\u0443).\u000d\u000a\u041c\u0446. \u0422\u0435\u0442\u044f\u043d\u0438 \u0456 \u0442\u0438\u0445 \u0437 \u043d\u0435\u044e, \u044f\u043a\u0456 \u0432 \u0420\u0438\u043c\u0456 \u0431\u0443\u043b\u0438 \u0437\u0430\u043c\u0443\u0447\u0435\u043d\u0456 (226 \u2013 235). \u041c\u0447. \u041c\u0435\u0440\u0442\u0456\u044f (284 \u2013 305). \u041c\u0447. \u041f\u0435\u0442\u0440\u0430 \u0410\u0432\u0435\u0441\u0430\u043b\u043e\u043c\u0456\u0442\u0430 (309 \u2013 310). \u041f\u0440\u043f. \u0404\u0432\u043f\u0440\u0430\u043a\u0441\u0456\u0457, \u000d\u000a\u0434\u0456\u0432\u0438 \u0422\u0430\u0432\u0435\u043d\u0441\u044c\u043a\u043e\u0457 (393). \u0421\u0432\u0442. \u0421\u0430\u0432\u0438, \u0430\u0440\u0445\u0456\u0454\u043f. \u0421\u0435\u0440\u0431\u0441\u044c\u043a\u043e\u0433\u043e (1237).\u000d\u000a\u0406\u043a\u043e\u043d \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456, \u0437\u0432\u0430\u043d\u0438\u0445 \u00ab\u0410\u043a\u0430\u0444\u0456\u0441\u0442\u043d\u0430\u00bb \u0442\u0430 \u00ab\u041c\u043e\u043b\u043e\u043a\u043e\u0436\u0438\u0432\u0438\u0442\u0435\u043b\u044c\u043a\u0430\u00bb.\u000d\u000a\u0404\u0432\u0440., 308 \u0437\u0430\u0447., \u0406\u0406I, 5 \u2013 11, 17 \u2013 19. \u041b\u043a., 102 \u0437\u0430\u0447., XX, 27 \u2013 44.\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a13\u000d\u000a14\u000d\u000a15\u000d\u000a16\u000d\u000a17\u000d\u000a12","10\u000d\u000a32-\u0433\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 7-\u0439.\u000d\u000a\u0421\u0432\u0442\u0442. \u0410\u0444\u0430\u043d\u0430\u0441\u0456\u044f (373) \u0442\u0430 \u041a\u0438\u0440\u0438\u043b\u0430 (444), \u0430\u0440\u0445\u0456\u0454\u043f\u043f. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u0438\u0445. \u041f\u0440\u043f. \u041c\u0430\u0440\u043a\u0456\u0430\u043d\u0430 \u041a\u0438\u0440\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 388).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 10-\u0435, \u0406\u043d., 66 \u0437\u0430\u0447., XXI, 1 \u2013 14.\u000d\u000a\u041b\u0456\u0442. \u2013 \u041a\u043e\u043b. 257 \u0437\u0430\u0447.; \u0406\u0406\u0406, 4 \u2013 11. \u041b\u043a., 85 \u0437\u0430\u0447., XV\u0406\u0406, 12 \u2013 19 (\u043d\u0435\u0434\u0456\u043b\u0456 29-\u043e\u0457).\u000d\u000a\u0421\u0432\u0442\u0442.: \u0404\u0432\u0440., 334 \u0437\u0430\u0447., XIII, 7 \u2013 16. \u041c\u0444., 11 \u0437\u0430\u0447., V, 14 \u2013 19.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a18\u000d\u000a33-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456 (\u0440\u044f\u0434\u043e\u0432\u0456 \u0447\u0438\u0442\u0430\u043d\u043d\u044f 32-\u0433\u043e \u0442\u0438\u0436\u043d\u044f \u000d\u000a\u0447\u0435\u0440\u0435\u0437 \u0425\u0440\u0435\u0449\u0435\u043d\u0441\u044c\u043a\u0443 \u0432\u0456\u0434\u0441\u0442\u0443\u043f\u043a\u0443).\u000d\u000a\u041f\u0440\u043f. \u041c\u0430\u043a\u0430\u0440\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e, \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0433\u043e (390 \u2013 391). \u0421\u0432\u0442. \u041c\u0430\u0440\u043a\u0430, \u000d\u000a\u0430\u0440\u0445\u0456\u0454\u043f. \u0415\u0444\u0435\u0441\u044c\u043a\u043e\u0433\u043e (1457). \u041f\u0440\u043f. \u041c\u0430\u043a\u0430\u0440\u0456\u044f, \u043f\u043e\u0441\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406). \u041f\u0440\u043f. \u041c\u0430\u043a\u0430\u0440\u0456\u044f, \u0434\u0438\u044f\u043a\u043e\u043d\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406V). \u041c\u0446. \u0404\u0432\u0444\u0440\u0430\u0441\u0456\u0457, \u0434\u0456\u0432\u0438 \u000d\u000a(303). \u041f\u0440\u043f. \u041c\u0430\u043a\u0430\u0440\u0456\u044f \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (394 \u2013 395). \u0421\u0432\u0442. \u0410\u0440\u0441\u0435\u043d\u0456\u044f, \u000d\u000a\u0430\u0440\u0445\u0456\u0454\u043f. \u041a\u0435\u0440\u043a\u0438\u0440\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406\u0406\u0406). \u041f\u0440\u043f. \u0410\u043d\u0442\u043e\u043d\u0456\u044f, \u0441\u0442\u043e\u0432\u043f\u043d\u0438\u043a\u0430, \u041c\u0430\u0440\u0442\u043a\u043e\u0431\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(V\u0406, \u0413\u0440\u0443\u0437.). \u041f\u0440\u043f. \u041b\u0430\u0432\u0440\u0435\u043d\u0442\u0456\u044f \u0427\u0435\u0440\u043d\u0456\u0433\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1950).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u041b\u0456\u0442. \u2013 \u042f\u043a., 53 \u0437\u0430\u0447., II, 14\u201326. \u041c\u043a., 48 \u0437\u0430\u0447., X, 46\u201352.\u000d\u000a\u041f\u0440\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30.\u000d\u000a\u041f\u0440\u043f. \u0404\u0432\u0444\u0438\u043c\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e (473). \u041c\u0447\u0447. \u0406\u043d\u043d\u0438, \u041f\u0456\u043d\u043d\u0438 \u0456 \u0420\u0438\u043c\u043c\u0438 (\u0406 \u2013 \u0406\u0406). \u000d\u000a\u041f\u0440\u043f\u043f. \u0404\u0432\u0444\u0438\u043c\u0456\u044f \u0441\u0445\u0438\u043c\u043d\u0438\u043a\u0430 (\u0425\u0406V) \u0456 \u041b\u0430\u0432\u0440\u0435\u043d\u0442\u0456\u044f \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 (\u0425\u0406\u0406\u0406 \u2013 \u000d\u000a\u0425\u0406V), \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u0438\u0445, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445. \u041c\u0447\u0447. \u0412\u0430\u0441\u0441\u0430, \u0404\u0432\u0441\u0435\u0432\u0456\u044f, \u0404\u0432\u0442\u0438\u0445\u0456\u044f \u0456 \u0412\u0430\u0441\u0438\u043b\u0456\u0434\u0430 (303).\u000d\u000a\u042f\u043a., 54 \u0437\u0430\u0447., III, 1\u201310. \u041c\u043a., 50 \u0437\u0430\u0447., XI, 11\u201323.\u000d\u000a\u041f\u0440\u043f.: \u0404\u0432\u0440., 335 \u0437\u0430\u0447., XIII, 17 \u2013 21. \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u041f\u0440\u043f. \u041c\u0430\u043a\u0441\u0438\u043c\u0430 \u0421\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u043a\u0430 (662). \u041c\u0447. \u041d\u0435\u043e\u0444\u0456\u0442\u0430 (304). \u041c\u0447\u0447. \u0404\u0432\u0433\u0435\u043d\u0456\u044f, \u000d\u000a\u041a\u0430\u043d\u0434\u0438\u0434\u0430, \u0412\u0430\u043b\u0435\u0440\u0456\u0430\u043d\u0430 \u0439 \u0410\u043a\u0438\u043b\u0438 (\u0406\u0406\u0406). \u041f\u0440\u043f. \u041c\u0430\u043a\u0441\u0438\u043c\u0430 \u0413\u0440\u0435\u043a\u0430 (1556). \u041c\u0446. \u0410\u0433\u043d\u0456\u0457, \u0434\u0456\u0432\u0438 (\u0431\u043b. 304). \u041c\u0447. \u0410\u043d\u0430\u0441\u0442\u0430\u0441\u0456\u044f (662).\u000d\u000a\u041a\u0442\u0438\u0442\u043e\u0440\u0441\u044c\u043a\u043e\u0457 (\u0406V) \u0442\u0430 \u043d\u0430\u0437\u0432\u0430\u043d\u043e\u0457 \u00ab\u0412\u0456\u0434\u0440\u0430\u0434\u0430\u00bb \u0430\u0431\u043e \u00ab\u0412\u0442\u0456\u0445\u0430\u00bb (807), \u0412\u0430\u0442\u043e\u043f\u0435\u0434\u0441\u044c\u043a\u0438\u0445 \u0456\u043a\u043e\u043d \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456.\u000d\u000a\u042f\u043a., 55 \u0437\u0430\u0447., III, 11 \u2013 IV, 6. \u041c\u043a., 51 \u0437\u0430\u0447., XI, 23\u201326.\u000d\u000a\u041f\u0440\u043f.: \u0404\u0432\u0440., 330 \u0437\u0430\u0447., XI, 33 \u2013 XII, 2. \u041b\u043a., 64 \u0437\u0430\u0447., XI\u0406, 8 \u2013 12.\u000d\u000a\u0410\u043f. \u0422\u0438\u043c\u043e\u0444\u0456\u044f (\u0431\u043b. 96). \u041f\u0440\u043c\u0447. \u0410\u043d\u0430\u0441\u0442\u0430\u0441\u0456\u044f \u041f\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e (628). \u000d\u000a\u041f\u0440\u043c\u0447. \u0410\u043d\u0430\u0441\u0442\u0430\u0441\u0456\u044f, \u0434\u0438\u044f\u043a. \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406). \u0421\u0449\u043c\u0447\u0447. \u041c\u0430\u043d\u0443\u0457\u043b\u0430, \u0413\u0435\u043e\u0440\u0433\u0456\u044f, \u041f\u0435\u0442\u0440\u0430, \u041b\u0435\u043e\u043d\u0442\u0456\u044f, \u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0456\u0432, \u0421\u0438\u043e\u043d\u0456\u044f, \u0413\u0430\u0432\u0440\u0438\u0457\u043b\u0430, \u0406\u043e\u0430\u043d\u0430, \u041b\u0435\u043e\u043d\u0442\u0430, \u041f\u0430\u0440\u043e\u0434\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0456\u0432, \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 377 \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0456\u0432 (\u0431\u043b. 817).\u000d\u000a\u042f\u043a., 56 \u0437\u0430\u0447., IV, 7 \u2013 V, 9. \u041c\u043a., 52 \u0437\u0430\u0447., XI, 27\u201333. \u000d\u000a\u0410\u043f.: 2 \u0422\u0438\u043c., 290 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), I, 3 \u2013 9. \u041b\u043a., 50 \u0437\u0430\u0447., X, 1 \u2013 15.\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a19\u000d\u000a20\u000d\u000a21\u000d\u000a22","11\u000d\u000a\u0421\u0449\u043c\u0447. \u041a\u043b\u0438\u043c\u0435\u043d\u0442\u0430, \u0454\u043f. \u0410\u043d\u043a\u0438\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u043c\u0447. \u0410\u0433\u0430\u0444\u0430\u043d\u0433\u0435\u043b\u0430 (312). \u041f\u0440\u043f. \u041c\u0430\u0432\u0441\u0438\u043c\u0438 \u0421\u0438\u0440\u0456\u0439\u0446\u044f (\u0406V). \u041f\u0440\u043f. \u0421\u0430\u043c\u0430\u043d\u0430, \u043c\u043e\u0432\u0447\u0430\u043b\u044c\u043d\u0438\u043a\u0430 (\u0431\u043b. 400). \u0421\u0432\u0442. \u041f\u0430\u0432\u043b\u0456\u043d\u0430 \u000d\u000a\u041c\u0438\u043b\u043e\u0441\u0442\u0438\u0432\u043e\u0433\u043e, \u0454\u043f. \u041d\u043e\u043b\u0430\u043d\u0441\u044c\u043a\u043e\u0433\u043e (431). \u041f\u0430\u043c\u2019\u044f\u0442\u044c V\u0406 \u0412\u0441\u0435\u043b\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u0441\u043e\u0431\u043e\u0440\u0443 (680 \u2013 681).\u000d\u000a1 \u041f\u0435\u0442., 58 \u0437\u0430\u0447., I, 1\u20132, 10\u201312; II, 6\u201310. \u041c\u043a., 53 \u0437\u0430\u0447., XII, 1\u201312.\u000d\u000a\u041f\u0440\u043f. \u041a\u0441\u0435\u043d\u0456\u0457 \u0420\u0438\u043c\u043b\u044f\u043d\u043a\u0438, \u0434\u0438\u044f\u043a\u043e\u043d\u0456\u0441\u0438 (V). \u041c\u0447\u0447. \u0412\u0430\u0432\u0438\u043b\u0438 \u0421\u0438\u0446\u0438\u043b\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u0442\u0430 \u000d\u000a\u0443\u0447\u043d\u0456\u0432 \u0439\u043e\u0433\u043e \u0422\u0438\u043c\u043e\u0444\u0456\u044f \u0439 \u0410\u0433\u0430\u043f\u0456\u044f (\u0406\u0406\u0406). \u041f\u0440\u043f. \u041c\u0430\u043a\u0435\u0434\u043e\u043d\u0456\u044f, \u0441\u0438\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u043f\u0443\u0441\u0442\u0435\u043b\u044c\u043d\u0438\u043a\u0430 (\u0431\u043b. 420). \u000d\u000a1 \u0421\u043e\u043b., 273 \u0437\u0430\u0447., V, 14\u201323. \u041b\u043a., 84 \u0437\u0430\u0447., XVII, 3\u201310.\u000d\u000a34-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u000d\u000a\u041f\u0440\u043f\u043f. \u041a\u0441\u0435\u043d\u043e\u0444\u043e\u043d\u0442\u0430, \u0434\u0440\u0443\u0436\u0438\u043d\u0438 \u0439\u043e\u0433\u043e \u041c\u0430\u0440\u0456\u0457 \u0442\u0430 \u0441\u0438\u043d\u0456\u0432 \u0457\u0445\u043d\u0456\u0445 \u0410\u0440\u043a\u0430\u0434\u0456\u044f \u0442\u0430 \u0406\u043e\u0430\u043d\u0430 (V \u2013 V\u0406). \u041c\u0447\u0447. \u0410\u043d\u0430\u043d\u0456\u0457, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u041f\u0435\u0442\u0440\u0430, \u0441\u0442\u043e\u0440\u043e\u0436\u0430 \u0432\u2019\u044f\u0437\u043d\u0438\u0446\u0456, \u0430 \u0437 \u043d\u0438\u043c\u0438 \u000d\u000a\u0441\u0456\u043c\u043e\u0445 \u0432\u043e\u0457\u043d\u0456\u0432 (295). \u041f\u0440\u043f. \u0421\u0438\u043c\u0435\u043e\u043d\u0430 \u0414\u0440\u0435\u0432\u043d\u044c\u043e\u0433\u043e, \u043f\u0443\u0441\u0442\u0435\u043b\u044c\u043d\u0438\u043a\u0430 (\u0431\u043b. 390). \u000d\u000a\u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u043f\u0440\u043f. \u0424\u0435\u0434\u043e\u0440\u0430, \u0456\u0433\u0443\u043c\u0435\u043d\u0430 \u0421\u0442\u0443\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (845). \u0421\u0432\u0442. \u000d\u000a\u0419\u043e\u0441\u0438\u0444\u0430, \u0430\u0440\u0445\u0456\u0454\u043f. \u0421\u043e\u043b\u0443\u043d\u0441\u044c\u043a\u043e\u0433\u043e (830). \u0411\u043b\u0433\u0432. \u0414\u0430\u0432\u0438\u0434\u0430 \u0406\u0406\u0406 \u0412\u0456\u0434\u043d\u043e\u0432\u0438\u0442\u0435\u043b\u044f, \u000d\u000a\u0446\u0430\u0440\u044f \u0406\u0432\u0435\u0440\u0456\u0457 \u0442\u0430 \u0410\u0431\u0445\u0430\u0437\u0456\u0457 (1125, \u0413\u0440\u0443\u0437.).\u000d\u000a1 \u041f\u0435\u0442., 59 \u0437\u0430\u0447., II, 21 \u2013 III, 9. \u041c\u043a., 54 \u0437\u0430\u0447., XII, 13\u201317.\u000d\u000a\u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u0441\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 \u0417\u043e\u043b\u043e\u0442\u043e\u0443\u0441\u0442\u043e\u0433\u043e (438).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 35 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), X, 1 \u2013 9. \u000d\u000a\u041b\u0456\u0442. \u2013 1 \u041f\u0435\u0442., 60 \u0437\u0430\u0447., III, 10\u201322. \u041c\u043a., 55 \u0437\u0430\u0447., XII, 18\u201327.\u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 318 \u0437\u0430\u0447., VII, 26 \u2013 VIII, 2. \u0406\u043d., 36 \u0437\u0430\u0447., X, 9 \u2013 16.\u000d\u000a\u041f\u0440\u043f. \u0404\u0444\u0440\u0435\u043c\u0430 \u0421\u0438\u0440\u0456\u043d\u0430 (373 \u2013 379). \u041f\u0440\u043f. \u0404\u0444\u0440\u0435\u043c\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0454\u043f. \u041f\u0435\u0440\u0435\u044f\u0441\u043b\u0430\u0432\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 1098). \u041f\u0440\u043f. \u041f\u0430\u043b\u043b\u0430\u0434\u0456\u044f, \u043f\u0443\u0441\u0442\u0435\u043b\u044c\u043d\u0438\u043a\u0430 \u000d\u000a(\u0406V). \u041f\u0440\u043f. \u0406\u0441\u0430\u0430\u043a\u0430 \u0421\u0438\u0440\u0456\u043d\u0430, \u0454\u043f. \u041d\u0456\u043d\u0435\u0432\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406). \u041f\u0440\u043f. \u0404\u0444\u0440\u0435\u043c\u0430 \u0423\u0433\u0440\u0438\u043d\u0430, \u041d\u043e\u0432\u043e\u0442\u043e\u0440\u0437\u044c\u043a\u043e\u0433\u043e (1053). \u0421\u0432\u0442\u0442. \u0454\u043f\u043f. \u041f\u0435\u0440\u0435\u044f\u0441\u043b\u0430\u0432\u0441\u044c\u043a\u0438\u0445: \u0404\u0444\u0440\u0435\u043c\u0430 (\u0431\u043b. 1098), \u041c\u0438\u043a\u043e\u043b\u0430\u044f (1074), \u041f\u0435\u0442\u0440\u0430 (1082), \u041b\u0430\u0437\u0430\u0440\u044f (1117), \u000d\u000a\u0421\u0438\u043b\u044c\u0432\u0435\u0441\u0442\u0440\u0430 (1123), \u0404\u0432\u0444\u0438\u043c\u0456\u044f (1155), \u0421\u0438\u043c\u0435\u043e\u043d\u0430 (1239).\u000d\u000a1 \u041f\u0435\u0442., 61 \u0437\u0430\u0447., IV, 1\u201311. \u041c\u043a., 56 \u0437\u0430\u0447., XII, 28\u201337.\u000d\u000a33-\u0442\u044f \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 8-\u0439.\u000d\u000a\u0421\u0432\u0442. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f \u0411\u043e\u0433\u043e\u0441\u043b\u043e\u0432\u0430, \u0430\u0440\u0445\u0456\u0454\u043f. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(389). \u041c\u0446. \u0424\u0456\u043b\u0456\u0446\u0430\u0442\u0438 \u0442\u0430 \u0441\u0438\u043d\u0456\u0432 \u0457\u0457 \u043c\u0447\u0447. \u042f\u043d\u0443\u0430\u0440\u0456\u044f, \u0424\u0435\u043b\u0456\u043a\u0441\u0430, \u0424\u0438\u043b\u0438\u043f\u0430, \u0421\u0438\u043b\u044c\u0432\u0430\u043d\u0430, \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430, \u0412\u0456\u0442\u0430\u043b\u0456\u044f \u0456 \u041c\u0430\u0440\u0446\u0456\u0430\u043b\u0430 (164). \u041f\u0440\u043f. \u041f\u043e\u043f\u043b\u0456\u044f \u0421\u0438\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(380). \u041f\u0440\u043f. \u041c\u0430\u0440\u0430, \u0441\u043f\u0456\u0432\u0446\u044f (\u0431\u043b. 430).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456, \u0437\u0432\u0430\u043d\u043e\u0457 \u00ab\u0423\u0442\u0430\u043c\u0443\u0439 \u043c\u043e\u0457 \u043f\u0435\u0447\u0430\u043b\u0456\u00bb.\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 11-\u0435, \u0406\u043d., 67 \u0437\u0430\u0447., XXI, 15 \u2013 25.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u0422\u0438\u043c., 285 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), IV, 9\u201315. \u041b\u043a., 94 \u0437\u0430\u0447., XIX, 1\u201310 \u000d\u000a(\u043f\u0440\u043e \u0417\u0430\u043a\u0445\u0435\u044f).\u000d\u000a\u0421\u0432\u0442.: 1 \u041a\u043e\u0440., 151 \u0437\u0430\u0447., XII, 7 \u2013 11. \u0406\u043d., 36 \u0437\u0430\u0447., X, 9 \u2013 16.\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a23\u000d\u000a24\u000d\u000a26\u000d\u000a27\u000d\u000a28\u000d\u000a25","12\u000d\u000a\u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u0441\u0449\u043c\u0447. \u0406\u0433\u043d\u0430\u0442\u0456\u044f \u0411\u043e\u0433\u043e\u043d\u043e\u0441\u0446\u044f (107). \u0421\u0432\u0442. \u041b\u0430\u0432\u0440\u0435\u043d\u0442\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0454\u043f. \u0422\u0443\u0440\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u000d\u000a\u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (1194). \u041c\u0447\u0447. \u0420\u043e\u043c\u0430\u043d\u0430, \u042f\u043a\u043e\u0432\u0430, \u0424\u0456\u043b\u043e\u0444\u0435\u044f, \u0406\u043f\u0435\u0440\u0438\u0445\u0456\u044f, \u000d\u000a\u0410\u0432\u0456\u0432\u0430, \u042e\u043b\u0456\u0430\u043d\u0430 \u0456 \u041f\u0430\u0440\u0438\u0433\u043e\u0440\u0456\u044f (297). \u0421\u0449\u043c\u0447\u0447. \u0421\u0438\u043b\u044c\u0432\u0430\u043d\u0430, \u0454\u043f., \u041b\u0443\u043a\u0438, \u0434\u0438\u044f\u043a., \u000d\u000a\u043c\u0447. \u041c\u043e\u043a\u0456\u044f, \u0447\u0438\u0442\u0446\u044f (312).\u000d\u000a1 \u041f\u0435\u0442., 62 \u0437\u0430\u0447., IV, 12 \u2013 V, 5. \u041c\u043a., 57 \u0437\u0430\u0447., XII, 38\u201344 (\u0437\u0430 \u0447\u0435\u0442\u0432\u0435\u0440).\u000d\u000a2 \u041f\u0435\u0442., 64 \u0437\u0430\u0447., I, 1 \u2013 10. \u041c\u043a., 58 \u0437\u0430\u0447., XII\u0406, 1\u20138 (\u0437\u0430 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e, \u043f\u0456\u0434 \u0437\u0430\u0447\u0430\u043b\u043e).\u000d\u000a\u0421\u0449\u043c\u0447.: \u0404\u0432\u0440., 311 \u0437\u0430\u0447. (\u0437 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), IV, 14 \u2013 V, 6. \u041c\u043a., 41 \u0437\u0430\u0447., IX, 33 \u2013 41.\u000d\u000a\u0411\u0435\u0437\u0441\u0440\u0440., \u043c\u0447\u0447. \u041a\u0438\u0440\u0430 \u0442\u0430 \u0406\u043e\u0430\u043d\u0430 \u0456 \u0437 \u043d\u0438\u043c\u0438 \u043c\u0446\u0446. \u0410\u0444\u0430\u043d\u0430\u0441\u0456\u0457 \u0442\u0430 \u0434\u043e\u0447\u043e\u043a \u0457\u0457 \u0424\u0435\u043e\u0434\u043e\u0442\u0456\u0457, \u000d\u000a\u0424\u0435\u043e\u043a\u0442\u0438\u0441\u0442\u0438 \u0456 \u0404\u0432\u0434\u043e\u043a\u0441\u0456\u0457 (311). \u0421\u0432\u0442. \u041c\u0438\u043a\u0438\u0442\u0438, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0454\u043f. \u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\u0441\u044c\u043a\u043e\u0433\u043e (1108). \u041c\u0447\u0447. \u0412\u0456\u043a\u0442\u043e\u0440\u0438\u043d\u0430, \u0412\u0456\u043a\u0442\u043e\u0440\u0430, \u000d\u000a\u041d\u0438\u043a\u0438\u0444\u043e\u0440\u0430, \u041a\u043b\u0430\u0432\u0434\u0456\u044f, \u0414\u0456\u043e\u0434\u043e\u0440\u0430, \u0421\u0435\u0440\u0430\u043f\u0456\u043e\u043d\u0430 \u0456 \u041f\u0430\u043f\u0456\u044f (251). \u041c\u0446. \u0422\u0440\u0438\u0444\u0435\u043d\u0438 \u000d\u000a\u041a\u0438\u0437\u0438\u0446\u044c\u043a\u043e\u0457.\u000d\u000a\u0411\u0435\u0437\u0441\u0440\u0456\u0431\u043d.: 1 \u041a\u043e\u0440., 153 \u0437\u0430\u0447., XII, 27 \u2013 XIII, 8. \u041c\u0444., 34 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), \u000d\u000aX, 1, 5 \u2013 8.\u000d\u000a\u0420\u044f\u0434.: 2 \u0422\u0438\u043c., 293 \u0437\u0430\u0447., II, 11\u201319. \u041b\u043a., 88 \u0437\u0430\u0447., XVIII, 2\u20138.\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a29\u000d\u000a31\u000d\u000a\u0421\u043e\u0431\u043e\u0440 \u0432\u0441\u0435\u043b\u0435\u043d\u0441\u044c\u043a\u0438\u0445 \u0443\u0447\u0438\u0442\u0435\u043b\u0456\u0432 \u0456 \u0441\u0432\u044f\u0442\u0438\u0442\u0435\u043b\u0456\u0432 \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e, \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f \u0411\u043e\u0433\u043e\u0441\u043b\u043e\u0432\u0430 \u0442\u0430 \u0406\u043e\u0430\u043d\u0430 \u0417\u043e\u043b\u043e\u0442\u043e\u0443\u0441\u0442\u043e\u0433\u043e. \u0421\u0449\u043c\u0447. \u0406\u043f\u043e\u043b\u0438\u0442\u0430, \u0454\u043f. \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e \u0442\u0430 \u0437 \u043d\u0438\u043c \u043c\u0447\u0447. \u041a\u0435\u043d\u0441\u043e\u0440\u0438\u043d\u0430, \u0421\u0430\u0432\u0438\u043d\u0430, \u0424\u0440\u0438\u0441\u0456\u0457, \u0434\u0456\u0432\u0438 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 20 \u043c\u0447\u0447. \u000d\u000a(\u0406\u0406\u0406). \u041f\u0440\u043f. \u0417\u0438\u043d\u043e\u043d\u0430, \u043f\u043e\u0441\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406V). \u041f\u0440\u043f. \u0417\u0438\u043d\u043e\u043d\u0430, \u0443\u0447\u043d\u044f \u0441\u0432\u0442. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e (V). \u041c\u0447. \u0424\u0435\u043e\u0444\u0456\u043b\u0430 \u000d\u000a\u041d\u043e\u0432\u043e\u0433\u043e (784). \u0411\u043b\u0433\u0432. \u041f\u0435\u0442\u0440\u0430, \u0446\u0430\u0440\u044f \u0411\u043e\u043b\u0433\u0430\u0440\u0441\u044c\u043a\u043e\u0433\u043e (967).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 36 \u0437\u0430\u0447., X, 9 \u2013 16.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0421\u0432\u0442\u0442.: \u0404\u0432\u0440., 334 \u0437\u0430\u0447., XIII, 7 \u2013 16. \u041c\u0444., 11 \u0437\u0430\u0447., V, 14 \u2013 19.\u000d\u000a\u041d\u0435\u0434\u0456\u043b\u044f \u043f\u0440\u043e \u043c\u0438\u0442\u0430\u0440\u044f \u0456 \u0444\u0430\u0440\u0438\u0441\u0435\u044f. \u0413\u043b\u0430\u0441 1-\u0439.\u000d\u000a\u041f\u0435\u0440\u0435\u0434\u0441\u0432\u044f\u0442\u043e \u0421\u0442\u0440\u0456\u0442\u0435\u043d\u043d\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e. \u041c\u0447. \u0422\u0440\u0438\u0444\u043e\u043d\u0430 (250). \u041c\u0446\u0446. \u041f\u0435\u0440\u043f\u0435\u0442\u0443\u0457 \u0456 \u0424\u0435\u043b\u0456\u0446\u0438\u0442\u0430\u0442\u0438, \u043c\u0447\u0447. \u0421\u0430\u0442\u0438\u0440\u0430, \u0420\u0435\u0432\u043e\u043a\u0430\u0442\u0430, \u0421\u0430\u0442\u043e\u0440\u043d\u0438\u043b\u0430, \u0421\u0435\u043a\u0443\u043d\u0434\u0430 (202 \u000d\u000a\u2013 203). \u041f\u0440\u043f. \u041f\u0435\u0442\u0440\u0430 \u0413\u0430\u043b\u0430\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (429). \u041f\u0440\u043f. \u0412\u0435\u043d\u0434\u0438\u043c\u0456\u0430\u043d\u0430, \u043f\u0443\u0441\u0442\u0435\u043b\u044c\u043d\u0438\u043a\u0430 \u0412\u0438\u0444\u0438\u043d\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 512).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 1-\u0435, \u041c\u0444., 116 \u0437\u0430\u0447., XXVIII, 16 \u2013 20.\u000d\u000a\u041b\u0456\u0442. \u2013 2 \u0422\u0438\u043c., 296 \u0437\u0430\u0447., III, 10\u201315. \u041b\u043a., 89 \u0437\u0430\u0447., XVIII, 10\u201314. \u000d\u000a\u041f\u043e\u0447\u0430\u0442\u043e\u043a \u041f\u043e\u0441\u0442\u043e\u0432\u043e\u0457 \u0442\u0440\u0456\u043e\u0434\u0456. \u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u043f\u0456\u0441\u043b\u044f 50-\u0433\u043e \u043f\u0441\u0430\u043b\u043c\u0430 (\u0434\u043e 5-\u043e\u0457 \u043d\u0435\u0434\u0456\u043b\u0456 \u000d\u000a\u0432\u043a\u043b\u044e\u0447\u043d\u043e) \u2013 \u00ab\u041f\u043e\u043a\u0430\u044f\u043d\u043d\u044f \u0432\u0456\u0434\u043a\u0440\u0438\u0439 \u043c\u0435\u043d\u0456 \u0434\u0432\u0435\u0440\u0456, \u0416\u0438\u0442\u0442\u0454\u0434\u0430\u0432\u0447\u0435...\u00bb. \u0423 \u043d\u0435\u0434\u0456\u043b\u044c\u043d\u0456 \u000d\u000a\u0434\u043d\u0456 (\u0434\u043e \u0432\u0435\u0440\u0431\u043d\u043e\u0457 \u043d\u0435\u0434\u0456\u043b\u0456) \u0441\u043b\u0443\u0436\u0431\u0430 \u0437\u0434\u0456\u0439\u0441\u043d\u044e\u0454\u0442\u044c\u0441\u044f \u0437\u0430 \u041e\u043a\u0442\u043e\u0457\u0445\u043e\u043c \u0456 \u0422\u0440\u0456\u043e\u0434\u0434\u044e, \u000d\u000a\u0430 \u041c\u0456\u043d\u0435\u044f \u043e\u043f\u0443\u0441\u043a\u0430\u0454\u0442\u044c\u0441\u044f (\u0437\u0430 \u0432\u0438\u043d\u044f\u0442\u043a\u043e\u043c \u043f\u0430\u043c\u2019\u044f\u0442\u0456 \u0441\u0432\u044f\u0442\u0438\u0445, \u044f\u043a\u0438\u043c \u0437\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f \u000d\u000a\u0431\u0434\u0456\u043d\u043d\u044f \u0430\u0431\u043e \u043f\u043e\u043b\u0456\u0454\u043b\u0435\u0439).\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a30\u000d\u000a1","13\u000d\u000a\u0421\u0422\u0420\u0406\u0422\u0415\u041d\u041d\u042f \u0413\u041e\u0421\u041f\u041e\u0414\u0410 \u041d\u0410\u0428\u041e\u0413\u041e \u0406\u0421\u0423\u0421\u0410 \u0425\u0420\u0418\u0421\u0422\u0410.\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 8 \u0437\u0430\u0447., II, 25 \u2013 32.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0404\u0432\u0440., 316 \u0437\u0430\u0447., VII, 7 \u2013 17. \u041b\u043a., 7 \u0437\u0430\u0447., II, 22 \u2013 40.\u000d\u000a\u0422\u0438\u0436\u0434\u0435\u043d\u044c \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u0438\u0439. \u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0422\u0435\u0431\u0435, \u0416\u0438\u0442\u0442\u0454\u0434\u0430\u0432\u0447\u0435 \u0425\u0440\u0438\u0441\u0442\u0435, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u041f\u0440\u0435\u0447\u0438\u0441\u0442\u0443 \u041c\u0430\u0442\u0456\u0440 \u0422\u0432\u043e\u044e, \u041d\u0435\u044e \u0436 \u0437\u0430 \u0437\u0430\u043a\u043e\u043d\u043e\u043c \u043d\u0438\u043d\u0456 \u043f\u0440\u0438\u043d\u0435\u0441\u0435\u043d\u0438\u0439 \u0431\u0443\u0432 \u000d\u000a\u0434\u043e \u0445\u0440\u0430\u043c\u0443 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e\u00bb. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0427\u0435\u0441\u043d\u0456\u0448\u0443...\u00bb \u2013 \u043f\u0440\u0438\u0441\u043f\u0456\u0432\u0438 \u0441\u0432\u044f\u0442\u0430. 1-\u0439 \u000d\u000a\u043f\u0440\u0438\u0441\u043f\u0456\u0432: \u00ab\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0435 \u0414\u0456\u0432\u043e, \u0443\u043f\u043e\u0432\u0430\u043d\u043d\u044f \u0445\u0440\u0438\u0441\u0442\u0438\u044f\u043d, \u043f\u043e\u043a\u0440\u0438\u0439, \u0437\u0431\u0435\u0440\u0435\u0436\u0438 \u0456 \u000d\u000a\u0441\u043f\u0430\u0441\u0438 \u0442\u0438\u0445, \u0445\u0442\u043e \u043d\u0430 \u0422\u0435\u0431\u0435 \u0443\u043f\u043e\u0432\u0430\u0454\u00bb. \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0430\u043d\u0442\u0438\u0444\u043e\u043d\u0438 \u0441\u0432\u044f\u0442\u043a\u043e\u0432\u0456 (\u0443 \u0434\u043e\u0434\u0430\u0442\u043a\u0443 \u0441. 85), \u043d\u0430 \u0432\u0445\u043e\u0434\u0456 \u0432\u0445\u0456\u0434\u043d\u0438\u0439 \u0441\u0442\u0438\u0445: \u00ab\u042f\u0432\u0438\u0432 \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u0441\u043f\u0430\u0441\u0456\u043d\u043d\u044f \u0421\u0432\u043e\u0454, \u000d\u000a\u043f\u0435\u0440\u0435\u0434 \u043d\u0430\u0440\u043e\u0434\u0430\u043c\u0438 \u0432\u0456\u0434\u043a\u0440\u0438\u0432 \u043f\u0440\u0430\u0432\u0434\u0443 \u0421\u0432\u043e\u044e\u00bb. \u0417 \u0446\u044c\u043e\u0433\u043e \u0434\u043d\u044f \u0456 \u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u000d\u000a\u043d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 (\u043a\u0440\u0456\u043c \u0432\u043e\u0441\u043a\u0440\u0435\u0441\u043d\u0438\u0445 \u0434\u043d\u0456\u0432) \u043f\u0456\u0441\u043b\u044f \u0432\u0445\u043e\u0434\u0443 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f: \u00ab\u041f\u0440\u0438\u0439\u0434\u0456\u0442\u044c, \u000d\u000a\u043f\u043e\u043a\u043b\u043e\u043d\u0456\u043c\u043e\u0441\u044c... \u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, \u043c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456\u2026\u00bb. \u000d\u000a\u0417\u0430\u0434\u043e\u0441\u0442\u043e\u0439\u043d\u0438\u043a \u2013 \u00ab\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0435 \u0414\u0456\u0432\u043e\u2026 \u0423 \u0417\u0430\u043a\u043e\u043d\u0456 \u0442\u0456\u043d\u0456\u2026\u00bb (\u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f). \u000d\u000a\u0412\u0456\u0434\u043f\u0443\u0441\u0442 \u0441\u0432\u044f\u0442\u0430: \u00ab\u0425\u0440\u0438\u0441\u0442\u043e\u0441, \u0449\u043e \u043d\u0430 \u0440\u0443\u043a\u0430\u0445 \u043f\u0440\u0430\u0432\u0435\u0434\u043d\u043e\u0433\u043e \u0421\u0438\u043c\u0435\u043e\u043d\u0430 \u0441\u043f\u043e\u0447\u0438\u0432\u0430\u0442\u0438 \u0437\u0432\u043e\u043b\u0438\u0432 \u0437\u0430\u0440\u0430\u0434\u0438 \u043d\u0430\u0448\u043e\u0433\u043e \u0441\u043f\u0430\u0441\u0456\u043d\u043d\u044f, \u0456\u0441\u0442\u0438\u043d\u043d\u0438\u0439 \u0411\u043e\u0433 \u043d\u0430\u0448\u2026\u00bb (\u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0432 \u0441\u0435\u0434\u043c\u0438\u0447\u043d\u0456 \u0434\u043d\u0456, \u0430 \u0432 \u043d\u0435\u0434\u0456\u043b\u044e \u2013 \u0432\u043e\u0441\u043a\u0440\u0435\u0441\u043d\u0438\u0439).\u000d\u000a\u041f\u0440\u043e\u0442\u044f\u0433\u043e\u043c \u0446\u044c\u043e\u0433\u043e \u0442\u0438\u0436\u043d\u044f \u043f\u043e\u0441\u0442\u0443 \u0432 \u0441\u0435\u0440\u0435\u0434\u0443 \u0456 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e \u043d\u0435\u043c\u0430\u0454. \u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a2\u000d\u000a\u041f\u0456\u0441\u043b\u044f\u0441\u0432\u044f\u0442\u043e \u0421\u0442\u0440\u0456\u0442\u0435\u043d\u043d\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e. \u041f\u0440\u0430\u0432\u0432. \u0421\u0438\u043c\u0435\u043e\u043d\u0430 \u0411\u043e\u0433\u043e\u043f\u0440\u0438\u0457\u043c\u0446\u044f \u0456 \u000d\u000a\u0410\u043d\u043d\u0438, \u043f\u0440\u043e\u0440\u043e\u0447\u0438\u0446\u0456 (\u0406). \u041f\u0440\u043e\u0440. \u0410\u0437\u0430\u0440\u0456\u0457 (\u0425 \u0441\u0442. \u0434\u043e \u0420. \u0425.). \u041c\u0447\u0447. \u041f\u0430\u043f\u0456\u044f, \u0414\u0456\u043e\u0434\u043e\u0440\u0430, \u000d\u000a\u041a\u043b\u0430\u0432\u0434\u0456\u0430\u043d\u0430 (250). \u041c\u0447\u0447. \u0410\u0434\u0440\u0456\u0430\u043d\u0430 \u0456 \u0404\u0432\u0432\u0443\u043b\u0430 (308 \u2013 309). \u041c\u0447. \u0412\u043b\u0430\u0441\u0456\u044f \u041a\u0435\u0441\u0430\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0406\u0406). \u0421\u0432\u0442. \u0406\u0433\u043d\u0430\u0442\u0456\u044f \u041c\u0430\u0440\u0456\u0443\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e, \u043c\u0438\u0442\u0440. \u0413\u043e\u0442\u0444\u0435\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u041a\u0435\u0444\u0430\u0439\u0441\u044c\u043a\u043e\u0433\u043e (1786). \u0420\u0456\u0432\u043d\u043e\u0430\u043f. \u041c\u0438\u043a\u043e\u043b\u0430\u044f, \u0430\u0440\u0445\u0456\u0454\u043f. \u042f\u043f\u043e\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(1912). \u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u0441\u0432\u0442. \u0420\u0430\u0444\u0430\u0457\u043b\u0430 (\u0417\u0430\u0431\u043e\u0440\u043e\u0432\u0441\u044c\u043a\u043e\u0433\u043e), \u043c\u0438\u0442\u0440. \u000d\u000a\u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u0413\u0430\u043b\u0438\u0446\u044c\u043a\u043e\u0433\u043e \u0456 \u0432\u0441\u0456\u0454\u0457 \u0420\u0443\u0441\u0438 (2024).\u000d\u000a2 \u041f\u0435\u0442., 66 \u0437\u0430\u0447., I, 20 \u2013 II, 9. \u041c\u043a., 59 \u0437\u0430\u0447., XIII, 9\u201313 (\u0437\u0430 \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a).\u000d\u000a2 \u041f\u0435\u0442., 67 \u0437\u0430\u0447., II, 9\u201322. \u041c\u043a., 60 \u0437\u0430\u0447., XIII, 14\u201323 (\u0437\u0430 \u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a).\u000d\u000a\u041f\u0440\u0430\u0432.: \u0404\u0432\u0440., 321 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), IX, 11 \u2013 14. \u041b\u043a., 8 \u0437\u0430\u0447., II, 25 \u2013 38 \u000d\u000a(\u043f\u0456\u0434 \u0437\u0430\u0447\u0430\u043b\u043e).\u000d\u000a\u0414\u0435\u043d\u044c \u0456\u043d\u0442\u0440\u043e\u043d\u0456\u0437\u0430\u0446\u0456\u0457 \u0411\u043b\u0430\u0436\u0435\u043d\u043d\u0456\u0439\u0448\u043e\u0433\u043e \u041c\u0438\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0430 \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u000d\u000a\u0432\u0441\u0456\u0454\u0457 \u0423\u043a\u0440\u0430\u0457\u043d\u0438 \u0415\u043f\u0456\u0444\u0430\u043d\u0456\u044f.\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a3\u000d\u000a\u041f\u0440\u043f. \u0406\u0441\u0438\u0434\u043e\u0440\u0430 \u041f\u0435\u043b\u0443\u0441\u0456\u043e\u0442\u0430 (\u0431\u043b. 436 \u2013 440). \u041c\u0447. \u0406\u0430\u0434\u043e\u0440\u0430 (\u0406\u0406\u0406). \u0421\u0449\u043c\u0447. \u0410\u0432\u0440\u0430\u0430\u043c\u0456\u044f, \u0454\u043f. \u0410\u0440\u0432\u0456\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 344 \u2013 347). \u041f\u0440\u043f. \u041c\u0438\u043a\u043e\u043b\u0430\u044f, \u0441\u043f\u043e\u0432., \u0456\u0433\u0443\u043c\u0435\u043d\u0430 \u000d\u000a\u0421\u0442\u0443\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (868).\u000d\u000a2 \u041f\u0435\u0442., 68 \u0437\u0430\u0447., III, 1\u201318. \u041c\u043a., 61 \u0437\u0430\u0447., XIII, 24\u201331.\u000d\u000a\u041c\u0446. \u0410\u0433\u0430\u0444\u0456\u0457 (251). \u0421\u0432\u0442. \u0424\u0435\u043e\u0434\u043e\u0441\u0456\u044f, \u0430\u0440\u0445\u0456\u0454\u043f. \u0427\u0435\u0440\u043d\u0456\u0433\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1696).\u000d\u000a\u041c\u0446. \u0424\u0435\u043e\u0434\u0443\u043b\u0438 \u0456 \u043c\u0447\u0447. \u0415\u043b\u043b\u0430\u0434\u0456\u044f, \u041c\u0430\u043a\u0430\u0440\u0456\u044f \u0456 \u0404\u0432\u0430\u0433\u0440\u0456\u044f (\u0431\u043b. 304).\u000d\u000a\u0404\u043b\u0435\u0446\u044c\u043a\u043e-\u0427\u0435\u0440\u043d\u0456\u0433\u0456\u0432\u0441\u044c\u043a\u043e\u0457 (1060), \u0421\u0438\u0446\u0438\u043b\u0456\u0439\u0441\u044c\u043a\u043e\u0457, \u0430\u0431\u043e \u0414\u0438\u0432\u043d\u043e\u0433\u043e\u0440\u0441\u044c\u043a\u043e\u0457 \u000d\u000a(1092), \u0456 \u0437\u0432\u0430\u043d\u043e\u0457 \u00ab\u0412\u0456\u0434\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u0437\u0430\u0433\u0438\u0431\u043b\u0438\u0445\u00bb \u0456\u043a\u043e\u043d \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456.\u000d\u000a1 \u0406\u043d., 69 \u0437\u0430\u0447., I, 8 \u2013 II, 6. \u041c\u043a., 62 \u0437\u0430\u0447., XIII, 31 \u2013 XIV, 2.\u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 335 \u0437\u0430\u0447., XIII, 17 \u2013 21. \u0406\u043d., 36 \u0437\u0430\u0447., X, 9 \u2013 16.\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a4\u000d\u000a5","14\u000d\u000a\u041f\u0440\u043f. \u0412\u0443\u043a\u043e\u043b\u0430, \u0454\u043f. \u0421\u043c\u0438\u0440\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 100). \u041f\u0440\u043f. \u0412\u0430\u0440\u0441\u043e\u043d\u043e\u0444\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u0442\u0430 \u0406\u043e\u0430\u043d\u0430, \u043f\u0440\u043e\u0440\u043e\u043a\u0430 (V\u0406). \u0421\u0432\u0442. \u0424\u043e\u0442\u0456\u044f, \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(891). \u041c\u0446\u0446. \u0414\u043e\u0440\u043e\u0444\u0435\u0457, \u0425\u0440\u0438\u0441\u0442\u0438\u043d\u0438, \u041a\u0430\u043b\u043b\u0456\u0441\u0442\u0438 \u0456 \u043c\u0447. \u0424\u0435\u043e\u0444\u0456\u043b\u0430 (288 \u2013 300). \u000d\u000a\u041c\u0446. \u0424\u0430\u0432\u0441\u0442\u0438, \u043c\u0447\u0447. \u0404\u0432\u0456\u043b\u0430\u0441\u0456\u044f \u0456 \u041c\u0430\u043a\u0441\u0438\u043c\u0430 (305 \u2013 311). \u041c\u0447. \u042e\u043b\u0456\u0430\u043d\u0430 (312). \u000d\u000a\u041c\u0446\u0446. \u041c\u0430\u0440\u0444\u0438, \u041c\u0430\u0440\u0456\u0457 \u0442\u0430 \u0431\u0440\u0430\u0442\u0430 \u0457\u0445 \u043f\u0440\u043c\u0447. \u041b\u0438\u043a\u0430\u0440\u0456\u043e\u043d\u0430, \u044e\u043d\u0430\u043a\u0430.\u000d\u000a1 \u0406\u043d., 70 \u0437\u0430\u0447., II, 7\u201317. \u041c\u043a., 63 \u0437\u0430\u0447., XIV, 3\u20139.\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a6\u000d\u000a\u041f\u0440\u043f. \u041f\u0430\u0440\u0444\u0435\u043d\u0456\u044f, \u0454\u043f. \u041b\u0430\u043c\u043f\u0441\u0430\u043a\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u041f\u0440\u043f. \u041b\u0443\u043a\u0438 \u0415\u043b\u043b\u0430\u0434\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. \u000d\u000a946). 1003 \u043c\u0447\u0447. \u041d\u0456\u043a\u043e\u043c\u0438\u0434\u0456\u0439\u0441\u044c\u043a\u0438\u0445 (303).\u000d\u000a2 \u0422\u0438\u043c., 295 \u0437\u0430\u0447., III, 1\u20139. \u041b\u043a., 103 \u0437\u0430\u0447., XX, 45 \u2013 XXI, 4.\u000d\u000a\u0412\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0430 \u0421\u0442\u0440\u0456\u0442\u0435\u043d\u043d\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e. \u041c\u0447. \u041d\u0438\u043a\u0438\u0444\u043e\u0440\u0430 \u0437 \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0457 \u0421\u0438\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (\u0431\u043b. 257). \u041f\u0440\u043f. \u041f\u0430\u043d\u043a\u0440\u0430\u0442\u0456\u044f, \u0456\u0454\u0440\u043e\u043c., \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406). \u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u0441\u0432\u0442. \u0406\u043d\u043e\u043a\u0435\u043d\u0442\u0456\u044f (\u041a\u0443\u043b\u044c\u0447\u0438\u0446\u044c\u043a\u043e\u0433\u043e), \u0454\u043f. \u0406\u0440\u043a\u0443\u0442\u0441\u044c\u043a\u043e\u0433\u043e (1805). \u000d\u000a\u0421\u0449\u043c\u0447\u0447. \u041c\u0430\u0440\u043a\u0435\u043b\u0430, \u0454\u043f. \u0421\u0438\u043a\u0435\u043b\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0424\u0456\u043b\u0430\u0433\u0440\u0456\u044f, \u0454\u043f. \u041a\u0456\u043f\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u041f\u0430\u043d\u043a\u0440\u0430\u0442\u0456\u044f, \u0454\u043f. \u0422\u0430\u0432\u0440\u043e\u043c\u0435\u043d\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406).\u000d\u000a1 \u0406\u043d., 71 \u0437\u0430\u0447., II, 18 \u2013 III, 10. \u041c\u043a., 49 \u0437\u0430\u0447., XI, 1 \u2013 11.\u000d\u000a\u0421\u0449\u043c\u0447. \u0425\u0430\u0440\u0430\u043b\u0430\u043c\u043f\u0456\u044f \u0456 \u0437 \u043d\u0438\u043c \u043c\u0447\u0447. \u041f\u043e\u0440\u0444\u0438\u0440\u0456\u044f \u0456 \u0412\u0430\u043f\u0442\u043e\u0441\u0430 \u0442\u0430 \u0442\u0440\u044c\u043e\u0445 \u043c\u0443\u0447\u0435\u043d\u0438\u0446\u044c (202). \u041f\u0440\u043f. \u041f\u0440\u043e\u0445\u043e\u0440\u0430, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u000d\u000a\u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (1107). \u041c\u0446\u0446. \u0434\u0456\u0432 \u0404\u043d\u0430\u0444\u0438, \u0412\u0430\u043b\u0435\u043d\u0442\u0438\u043d\u0438 \u0456 \u041f\u0430\u0432\u043b\u0438 (308). \u000d\u000a\u0411\u043b\u0433\u0432. \u043a\u043d. \u0410\u043d\u043d\u0438 \u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\u0441\u044c\u043a\u043e\u0457 (1056). \u041f\u0440\u0430\u0432. \u0413\u0430\u043b\u0438\u043d\u0438 (\u0406\u0406\u0406)\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u0412\u043e\u0433\u043d\u0435\u0432\u0438\u0434\u043d\u0430\u00bb.\u000d\u000a1 \u0406\u043d., 72 \u0437\u0430\u0447., III, 10 \u2013 20. \u041c\u043a., 64 \u0437\u0430\u0447., XIV, 10 \u2013 42.\u000d\u000a\u0421\u0449\u043c\u0447. \u0412\u043b\u0430\u0441\u0456\u044f, \u0454\u043f. \u0421\u0435\u0432\u0430\u0441\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 316). \u0411\u043b\u0433\u0432. \u043a\u043d. \u0412\u0441\u0435\u0432\u043e\u043b\u043e\u0434\u0430 \u000d\u000a\u041c\u0441\u0442\u0438\u0441\u043b\u0430\u0432\u0438\u0447\u0430, \u0443 \u0445\u0440\u0435\u0449\u0435\u043d\u043d\u0456 \u0413\u0430\u0432\u0440\u0438\u0457\u043b\u0430 (1138). \u041f\u0440\u0430\u0432. \u0424\u0435\u043e\u0434\u043e\u0440\u0438, \u0456\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u0456 \u0412\u0456\u0437\u0430\u043d\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0457, \u044f\u043a\u0430 \u0432\u0456\u0434\u043d\u043e\u0432\u0438\u043b\u0430 \u0448\u0430\u043d\u0443\u0432\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0438\u0445 \u0456\u043a\u043e\u043d (867).\u000d\u000a1 \u0406\u043d., 73 \u0437\u0430\u0447., III, 21 \u2013 IV, 6. \u041c\u043a., 65 \u0437\u0430\u0447., XIV, 43 \u2013 XV, 1.\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a7\u000d\u000a9\u000d\u000a10\u000d\u000a11\u000d\u000a\u041d\u0435\u0434\u0456\u043b\u044f \u043f\u0440\u043e \u0431\u043b\u0443\u0434\u043d\u043e\u0433\u043e \u0441\u0438\u043d\u0430. \u0413\u043b\u0430\u0441 2-\u0439.\u000d\u000a\u0412\u043c\u0447. \u0424\u0435\u0434\u043e\u0440\u0430 \u0421\u0442\u0440\u0430\u0442\u0438\u043b\u0430\u0442\u0430 (319). \u041f\u0440\u043e\u0440. \u0417\u0430\u0445\u0430\u0440\u0456\u0457 \u0421\u0435\u0440\u043f\u043e\u0432\u0438\u0434\u0446\u044f (\u0431\u043b. 520 \u000d\u000a\u0434\u043e \u0420. \u0425.). \u0421\u0432\u0442. \u0421\u0430\u0432\u0438 \u0406\u0406, \u0430\u0440\u0445\u0456\u0454\u043f. \u0421\u0435\u0440\u0431\u0441\u044c\u043a\u043e\u0433\u043e (1268 \u2013 1269).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 2-\u0435, \u041c\u043a., 70 \u0437\u0430\u0447., XVI, 1 \u2013 8.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u041a\u043e\u0440., 135 \u0437\u0430\u0447., VI, 12 \u2013 20. \u041b\u043a., 79 \u0437\u0430\u0447., XV, 11 \u2013 32.\u000d\u000a\u0412\u043c\u0447.: 2 \u0422\u0438\u043c., 292 \u0437\u0430\u0447., II, 1 \u2013 10. \u041c\u0444., 36 \u0437\u0430\u0447., \u0425, 16 \u2013 22.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0434\u043e \u0437\u0432\u0438\u0447\u0430\u0439\u043d\u0438\u0445 \u0434\u0432\u043e\u0445 \u043f\u043e\u043b\u0456\u0454\u043b\u0435\u0439\u043d\u0438\u0445 \u043f\u0441\u0430\u043b\u043c\u0456\u0432 \u043f\u0440\u0438\u0454\u0434\u043d\u0443\u0454\u043c\u043e \u043f\u0441\u0430\u043b\u043e\u043c 136-\u0439: \u00ab\u041d\u0430 \u0440\u0456\u043a\u0430\u0445 \u0412\u0430\u0432\u0438\u043b\u043e\u043d\u0441\u044c\u043a\u0438\u0445...\u00bb. \u0426\u0435\u0439 \u0436\u0435 \u043f\u0441\u0430\u043b\u043e\u043c \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0456 \u0432 \u000d\u000a\u0434\u0432\u0456 \u043d\u0430\u0441\u0442\u0443\u043f\u043d\u0456 \u043d\u0435\u0434\u0456\u043b\u0456.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a8","15\u000d\u000a\u0421\u0432\u0442. \u041c\u0435\u043b\u0435\u0442\u0456\u044f, \u0430\u0440\u0445\u0456\u0454\u043f. \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (381). \u0421\u0432\u0442. \u041e\u043b\u0435\u043a\u0441\u0456\u044f, \u043c\u0438\u0442\u0440. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0432\u0441\u0456\u0454\u0457 \u0420\u0443\u0441\u0438, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (1378). \u041f\u0440\u043f. \u041c\u0430\u0440\u0456\u0457, \u0437\u0432\u0430\u043d\u043e\u0457 \u000d\u000a\u041c\u0430\u0440\u0438\u043d\u043e\u043c, \u0442\u0430 \u0431\u0430\u0442\u044c\u043a\u0430 \u0457\u0457 \u0404\u0432\u0433\u0435\u043d\u0456\u044f (V\u0406). \u0421\u0432\u0442. \u0410\u043d\u0442\u043e\u043d\u0456\u044f, \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (895). \u000d\u000a\u0406\u0432\u0435\u0440\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (\u0425\u0406-\u0425\u0406\u0406).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 4 \u0437\u0430\u0447., I, 39 \u2013 49, 56.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u0406\u043d., 74 \u0437\u0430\u0447., IV, 20 \u2013 V, 21. \u041c\u043a., 66 \u0437\u0430\u0447., XV, 1 \u2013 15.\u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456: \u0424\u043b\u043f., 240 \u0437\u0430\u0447., II, 5 \u2013 11. \u041b\u043a., 54 \u0437\u0430\u0447., X, 38 \u2013 42; XI, 27 \u2013 28.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0422\u0435\u0431\u0435, \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u0430\u044f \u0414\u0456\u0432\u043e \u0411\u043e\u0433\u043e\u043c \u043e\u0431\u0440\u0430\u043d\u0430 \u041e\u0442\u043e\u0440\u043e\u043a\u043e\u0432\u0438\u0446\u0435, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u043e\u0431\u0440\u0430\u0437 \u0422\u0432\u0456\u0439 \u0441\u0432\u044f\u0442\u0438\u0439, \u0449\u043e \u043d\u0438\u043c \u043f\u043e\u0434\u0430\u0454\u0448 \u000d\u000a\u0437\u0446\u0456\u043b\u0435\u043d\u043d\u044f \u0432\u0441\u0456\u043c, \u0445\u0442\u043e \u0437 \u0432\u0456\u0440\u043e\u044e \u043f\u0440\u0438\u0445\u043e\u0434\u0438\u0442\u044c\u00bb.\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a12\u000d\u000a\u0410\u043f. \u0432\u0456\u0434 70-\u0445 \u0410\u043a\u0456\u043b\u0438 \u0442\u0430 \u0439\u043e\u0433\u043e \u0434\u0440\u0443\u0436\u0438\u043d\u0438 \u043c\u0443\u0447\u0435\u043d\u0438\u0446\u0456 \u041f\u0440\u0438\u0441\u043a\u0456\u043b\u0438 (\u0406). \u041f\u0440\u043f. \u041c\u0430\u0440\u0442\u0438\u043d\u0456\u0430\u043d\u0430 (V). \u041f\u0440\u043f\u043f. \u0417\u043e\u0457 \u0456 \u0424\u043e\u0442\u0438\u043d\u0456\u0457 (\u0421\u0432\u0456\u0442\u043b\u0430\u043d\u0438) (V). \u041f\u0440\u043f. \u0404\u0432\u043b\u043e\u0433\u0456\u044f, \u0430\u0440\u0445\u0456\u0454\u043f. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (607 \u2013 608). \u0411\u043b\u0433\u0432. \u043a\u043d. \u041a\u043e\u0441\u0442\u044f\u043d\u0442\u0438\u043d\u0430 \u041e\u0441\u0442\u0440\u043e\u0437\u044c\u043a\u043e\u0433\u043e (1608). \u041f\u0440\u043f. \u0421\u0442\u0435\u0444\u0430\u043d\u0430, \u0443 \u0447\u0435\u0440\u043d\u0435\u0446\u0442\u0432\u0456 \u0421\u0438\u043c\u0435\u043e\u043d\u0430, \u0446\u0430\u0440\u044f \u000d\u000a\u0421\u0435\u0440\u0431\u0441\u044c\u043a\u043e\u0433\u043e, \u041c\u0438\u0440\u043e\u0442\u043e\u0447\u0438\u0432\u043e\u0433\u043e (1200). \u000d\u000a2 \u0406\u043d., 75 \u0437\u0430\u0447., I, 1 \u2013 13. \u041c\u043a., 68 \u0437\u0430\u0447., XV, 22, 25, 33 \u2013 41.\u000d\u000a\u0411\u043b\u0433\u0432.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041c\u0444., 10 \u0437\u0430\u0447., IV, 25 \u2013 V, 12.\u000d\u000a\u0421\u0443\u0431\u043e\u0442\u0430 \u043c\u2019\u044f\u0441\u043e\u043f\u0443\u0441\u043d\u0430. \u041f\u0430\u043c\u2019\u044f\u0442\u044c \u0443\u0441\u0456\u0445 \u0432\u0456\u0434 \u0432\u0456\u043a\u0443 \u0441\u043f\u043e\u0447\u0438\u043b\u0438\u0445 \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u0438\u0445 \u000d\u000a\u0445\u0440\u0438\u0441\u0442\u0438\u044f\u043d \u2013 \u043e\u0442\u0446\u0456\u0432, \u0431\u0440\u0430\u0442\u0456\u0432 \u0456 \u0441\u0435\u0441\u0442\u0435\u0440 \u043d\u0430\u0448\u0438\u0445. \u041f\u0440\u043f. \u0410\u0432\u043a\u0441\u0435\u043d\u0442\u0456\u044f (\u0431\u043b. 470). \u000d\u000a\u0420\u0456\u0432\u043d\u043e\u0430\u043f. \u041a\u0438\u0440\u0438\u043b\u0430, \u0443\u0447\u0438\u0442\u0435\u043b\u044f \u0441\u043b\u043e\u0432\u2019\u044f\u043d\u0441\u044c\u043a\u043e\u0433\u043e (869). \u041f\u0440\u043f. \u0406\u0441\u0430\u043a\u0456\u044f, \u000d\u000a\u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0431\u043b. \u000d\u000a1090). 12-\u043e\u0445 \u0433\u0440\u0435\u043a\u0456\u0432, \u0431\u0443\u0434\u0456\u0432\u043d\u0438\u043a\u0456\u0432 \u0441\u043e\u0431\u043e\u0440\u043d\u043e\u0457 \u0423\u0441\u043f\u0435\u043d\u0441\u044c\u043a\u043e\u0457 \u0446\u0435\u0440\u043a\u0432\u0438 \u000d\u000a\u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0457 \u043b\u0430\u0432\u0440\u0438 (\u0425\u0406). \u041f\u0440\u043f. \u041c\u0430\u0440\u043e\u043d\u0430, \u043f\u0443\u0441\u0442\u0435\u043b\u044c\u043d\u0438\u043a\u0430 \u0421\u0438\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u0421\u0432\u0442. \u0410\u0432\u0440\u0430\u0430\u043c\u0456\u044f, \u0454\u043f. \u041a\u0430\u0440\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (V).\u000d\u000a\u041f\u043e\u043c\u0438\u043d\u0430\u043d\u043d\u044f \u043f\u043e\u043c\u0435\u0440\u043b\u0438\u0445.\u000d\u000a\u0417\u0430\u0443\u043f\u043e\u043a\u0456\u0439\u043d\u0435: 1 \u0421\u043e\u043b., 270 \u0437\u0430\u0447., IV, 13 \u2013 17. \u0406\u043d., 16 \u0437\u0430\u0447., V, 24 \u2013 30.\u000d\u000a\u0420\u044f\u0434.: 1 \u041a\u043e\u0440., 146 \u0437\u0430\u0447., X, 23 \u2013 28. \u041b\u043a., 105 \u0437\u0430\u0447., XXI, 8 \u2013 9, 25 \u2013 27, \u000d\u000a33 \u2013 36.\u000d\u000a\u0421\u043b\u0443\u0436\u0431\u0430 \u0437 \u041e\u043a\u0442\u043e\u0457\u0445\u0430 \u0442\u0430 \u0422\u0440\u0456\u043e\u0434\u0456. \u041d\u0430 \u0432\u0435\u0447\u0456\u0440\u043d\u0456 \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u043f\u0440\u043e\u043a\u0438\u043c\u043d\u0430 \u2013 \u00ab\u0410\u043b\u0438\u043b\u0443\u044f\u00bb \u000d\u000a\u0456\u0437 \u0437\u0430\u0443\u043f\u043e\u043a\u0456\u0439\u043d\u0438\u043c\u0438 \u0441\u0442\u0438\u0445\u0430\u043c\u0438. \u041f\u0456\u0441\u043b\u044f \u00ab\u041d\u0438\u043d\u0456 \u0432\u0456\u0434\u043f\u0443\u0441\u043a\u0430\u0454\u0448\u2026\u00bb \u2013 \u0442\u0440\u043e\u043f\u0430\u0440 \u00ab\u0413\u043b\u0438\u0431\u0438\u043d\u043e\u044e \u043c\u0443\u0434\u0440\u043e\u0441\u0442\u0456\u2026\u00bb \u0437 \u0431\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0447\u043d\u0438\u043c. \u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0411\u043e\u0433 \u0413\u043e\u0441\u043f\u043e\u0434\u044c\u2026\u00bb \u2013 \u00ab\u0410\u043b\u0438\u043b\u0443\u044f\u00bb. 17-\u0442\u0430 \u043a\u0430\u0444\u0438\u0437\u043c\u0430 \u0447\u0438\u0442\u0430\u0454\u0442\u044c\u0441\u044f \u0437 \u043f\u043e\u0434\u0456\u043b\u043e\u043c \u043d\u0430 \u0434\u0432\u0456 \u0441\u0442\u0430\u0442\u0442\u0456 \u000d\u000a\u0442\u0430 \u0437\u0430\u0443\u043f\u043e\u043a\u0456\u0439\u043d\u0438\u043c\u0438 \u043f\u0440\u0438\u0441\u043f\u0456\u0432\u0430\u043c\u0438.\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a13\u000d\u000a14\u000d\u000a\u041d\u0435\u0434\u0456\u043b\u044f \u043c\u2019\u044f\u0441\u043e\u043f\u0443\u0441\u043d\u0430, \u043f\u0440\u043e \u0421\u0442\u0440\u0430\u0448\u043d\u0438\u0439 \u0441\u0443\u0434. \u0413\u043b\u0430\u0441 3-\u0439.\u000d\u000a\u0410\u043f. \u0432\u0456\u0434 70-\u0445 \u041e\u043d\u0438\u0441\u0438\u043c\u0430 (\u0431\u043b. 109). \u041f\u0440\u043f. \u041f\u0430\u0444\u043d\u0443\u0442\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406). \u041f\u0440\u043f. \u041f\u0430\u0444\u043d\u0443\u0442\u0456\u044f \u0456 \u0434\u043e\u0447\u043a\u0438 \u0439\u043e\u0433\u043e \u0404\u0444\u0440\u043e\u0441\u0438\u043d\u0456\u0457 (V). \u041f\u0440\u043f. \u0404\u0432\u0441\u0435\u0432\u0456\u044f, \u043f\u0443\u0441\u0442\u0435\u043b\u044c\u043d\u0438\u043a\u0430 \u0421\u0438\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (V).\u000d\u000a\u0412\u0456\u043b\u0435\u043d\u0441\u044c\u043a\u043e\u0457 (\u043f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u0443 \u0412\u0456\u043b\u044c\u043d\u043e \u0432 1495 \u0440.) \u0456 \u0414\u0430\u043b\u043c\u0430\u0442\u0441\u044c\u043a\u043e\u0457 (1646) \u000d\u000a\u0456\u043a\u043e\u043d \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456.\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 3-\u0454, \u041c\u043a., 71 \u0437\u0430\u0447., XVI, 9 \u2013 20.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u041a\u043e\u0440., 140 \u0437\u0430\u0447., VIII, 8 \u2013 IX, 2. \u041c\u0444., 106 \u0437\u0430\u0447., XXV, 31 \u2013 46.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a15","16\u000d\u000a\u0412\u0456\u0434 \u041d\u0435\u0434\u0456\u043b\u0456 \u043c\u2019\u044f\u0441\u043e\u043f\u0443\u0441\u043d\u043e\u0457 \u0434\u043e \u0441\u0443\u0431\u043e\u0442\u0438 \u041b\u0430\u0437\u0430\u0440\u0435\u0432\u043e\u0457 \u0432\u0435\u0447\u0456\u0440\u043d\u0456 \u0442\u0430 \u0440\u0430\u043d\u043a\u043e\u0432\u0456 \u0441\u0442\u0438\u0445\u0438\u0440\u0438 \u000d\u000a\u043d\u0430 \u0441\u0442\u0438\u0445\u043e\u0432\u043d\u0456 \u041e\u043a\u0442\u043e\u0457\u0445\u0430 \u0437\u0430\u043c\u0456\u043d\u044f\u044e\u0442\u044c\u0441\u044f \u0441\u0442\u0438\u0445\u0438\u0440\u0430\u043c\u0438 \u0422\u0440\u0456\u043e\u0434\u0456.\u000d\u000a\u0417\u0430\u0433\u043e\u0432\u0438\u043d\u0438 \u043d\u0430 \u043c\u2019\u044f\u0441\u043e.\u000d\u000a\u0422\u0438\u0436\u0434\u0435\u043d\u044c \u0441\u0438\u0440\u043d\u0438\u0439 (\u043c\u0430\u0441\u043b\u044f\u043d\u0438\u0439) \u2013 \u0437\u0430\u0433\u0430\u043b\u044c\u043d\u0438\u0446\u044f. \u0421\u0449\u043c\u0447\u0447. \u041f\u0430\u043c\u0444\u0456\u043b\u0430, \u000d\u000a\u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u0412\u0430\u043b\u0435\u043d\u0442\u0430 (\u0423\u0430\u043b\u0435\u043d\u0442\u0430), \u0434\u0438\u044f\u043a\u043e\u043d\u0430, \u043c\u0447\u0447. \u041f\u0430\u0432\u043b\u0430, \u041f\u043e\u0440\u0444\u0438\u0440\u0456\u044f, \u0421\u0435\u043b\u0435\u0432\u043a\u0456\u044f, \u0424\u0435\u043e\u0434\u0443\u043b\u0430, \u042e\u043b\u0456\u0430\u043d\u0430, \u0421\u0430\u043c\u0443\u0457\u043b\u0430, \u0406\u043b\u043b\u0456, \u0414\u0430\u043d\u0438\u0457\u043b\u0430, \u0404\u0440\u0435\u043c\u0456\u0457, \u0406\u0441\u0430\u0457 (307 \u2013 \u000d\u000a309). \u041c\u0447\u0447. \u043f\u0435\u0440\u0441\u044c\u043a\u0438\u0445 \u0432 \u041c\u0430\u0440\u0442\u0438\u0440\u043e\u043f\u043e\u043b\u0456 (\u0406V). \u041f\u0440\u043f. \u041c\u0430\u0440\u0443\u0444\u0430, \u0454\u043f. \u041c\u0435\u0441\u043e\u043f\u043e\u0442\u0430\u043c\u0441\u044c\u043a\u043e\u0433\u043e (422).\u000d\u000a3 \u0406\u043d., 76 \u0437\u0430\u0447., I, 1 \u2013 15. \u041b\u043a., 96 \u0437\u0430\u0447., XIX, 29 \u2013 40; XXII, 7 \u2013 39.\u000d\u000a\u0412\u043f\u0440\u043e\u0434\u043e\u0432\u0436 \u0443\u0441\u044c\u043e\u0433\u043e \u0442\u0438\u0436\u043d\u044f \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454\u0442\u044c\u0441\u044f \u0432\u0436\u0438\u0432\u0430\u043d\u043d\u044f \u043c\u043e\u043b\u043e\u043a\u0430 \u0442\u0430 \u044f\u0454\u0446\u044c.\u000d\u000a\u0421\u0432\u0442. \u041b\u0435\u0432\u0430, \u043f\u0430\u043f\u0438 \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (461). \u0421\u0432\u0442. \u0410\u0433\u0430\u043f\u0456\u0442\u0430, \u0441\u043f\u043e\u0432., \u0454\u043f. \u0421\u0438\u043d\u0430\u0434\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(\u0406V). \u0421\u0432\u0442. \u0424\u043b\u0430\u0432\u0456\u0430\u043d\u0430, \u0441\u043f\u043e\u0432., \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (449 \u2013 450). \u000d\u000a\u041f\u0440\u043f. \u041a\u043e\u0441\u043c\u0438 \u042f\u0445\u0440\u043e\u043c\u0441\u044c\u043a\u043e\u0433\u043e (1492).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u043d\u0435 \u0437\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u043e\u0457\u043b. II, 12 \u2013 26. \u041d\u0430 \u0432\u0435\u0447.: \u0406\u043e\u0457\u043b. III, 12 \u2013 21.\u000d\u000a\u041f\u043e\u0447\u0438\u043d\u0430\u044e\u0447\u0438 \u0437 \u0432\u0435\u0447\u0456\u0440\u043d\u0456, \u0441\u043b\u0443\u0436\u0431\u0438 \u0432\u0456\u0434\u043f\u0440\u0430\u0432\u043b\u044f\u044e\u0442\u044c\u0441\u044f \u043f\u043e\u0434\u0456\u0431\u043d\u043e \u0434\u043e \u0432\u0435\u043b\u0438\u043a\u043e\u043f\u043e\u0441\u0442\u043e\u0432\u0438\u0445. \u0412\u0435\u043b\u0438\u043a\u043e\u043f\u043e\u0441\u0442\u043e\u0432\u0456 \u0442\u0440\u043e\u043f\u0430\u0440\u0456 \u043d\u0430 \u0447\u0430\u0441\u0430\u0445 \u0442\u0430 \u00ab\u0411\u043b\u0430\u0436\u0435\u043d\u043d\u0456\u2026\u00bb \u043d\u0430 \u0437\u043e\u0431\u0440\u0430\u0436\u0430\u043b\u044c\u043d\u0438\u0445 \u0447\u0438\u0442\u0430\u044e\u0442\u044c\u0441\u044f. \u041d\u0430\u043f\u0440\u0438\u043a\u0456\u043d\u0446\u0456 \u0432\u0435\u0447\u0456\u0440\u043d\u0456, \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0432\u0435\u0447\u0456\u0440\u2019\u044f, \u043f\u043e\u043b\u0443\u043d\u043e\u0448\u043d\u0438\u0446\u0456, \u000d\u000a\u0440\u0430\u043d\u043d\u044c\u043e\u0457, \u043a\u043e\u0436\u043d\u043e\u0433\u043e \u0447\u0430\u0441\u0443, \u0437\u043e\u0431\u0440\u0430\u0436\u0430\u043b\u044c\u043d\u0438\u0445 \u2013 \u043c\u043e\u043b\u0438\u0442\u0432\u0430 \u043f\u0440\u043f. \u0404\u0444\u0440\u0435\u043c\u0430 \u0421\u0438\u0440\u0456\u043d\u0430 \u000d\u000a\u0437 \u0442\u0440\u044c\u043e\u043c\u0430 \u043f\u043e\u043a\u043b\u043e\u043d\u0430\u043c\u0438.\u000d\u000a\u0410\u043f\u043f. \u0432\u0456\u0434 70-\u0445: \u0410\u0440\u0445\u0438\u043f\u0430 \u0442\u0430 \u0424\u0438\u043b\u0438\u043c\u043e\u043d\u0430 \u0456 \u043c\u0446. \u0440\u0456\u0432\u043d\u043e\u0430\u043f. \u0410\u043f\u0444\u0456\u0457 (\u0406). \u041c\u0447\u0447. \u041c\u0430\u043a\u0441\u0438\u043c\u0430, \u0424\u0435\u043e\u0434\u043e\u0442\u0430, \u0406\u0441\u0438\u0445\u0456\u044f, \u043c\u0446. \u0410\u0441\u043a\u043b\u0438\u043f\u0456\u043e\u0434\u043e\u0442\u0438 (305 \u2013 311). \u041f\u0440\u043f\u043f. \u0404\u0432\u0433\u0435\u043d\u0456\u044f \u0456 \u041c\u0430\u043a\u0430\u0440\u0456\u044f, \u0441\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u043a\u0456\u0432, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0456\u0432 \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u0438\u0445 (363). \u041f\u0440\u043f. \u0414\u043e\u0441\u0438\u0444\u0435\u044f (V\u0406\u0406), \u000d\u000a\u0443\u0447\u043d\u044f \u043f\u0440\u043f. \u0430\u0432\u0432\u0438 \u0414\u043e\u0440\u043e\u0444\u0435\u044f. \u041f\u0440\u043f. \u0420\u0430\u0432\u0443\u043b\u0438 (\u0431\u043b. 530). \u041f\u0440\u043f. \u0428\u0456\u043e \u041c\u0433\u0432\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(V\u0406, \u0413\u0440\u0443\u0437.) (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0443 \u0447\u0435\u0442\u0432\u0435\u0440 \u0441\u0438\u0440\u043e\u043f\u0443\u0441\u043d\u043e\u0433\u043e \u0442\u0438\u0436\u043d\u044f).\u000d\u000a\u0406\u0443\u0434., 78 \u0437\u0430\u0447., I, 11 \u2013 25. \u041b\u043a., 110 \u0437\u0430\u0447., XXIII, 1 \u2013 34, 44 \u2013 56.\u000d\u000a\u0411\u043b\u0433\u0432.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041c\u0444., 10 \u0437\u0430\u0447., IV, 25 \u2013 V, 12.\u000d\u000a\u041d\u0430 \u0446\u0435\u0439 \u0434\u0435\u043d\u044c \u043f\u0435\u0440\u0435\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u0441\u043b\u0443\u0436\u0431\u0430 \u0441\u0432\u044f\u0442\u043e\u043c\u0443 \u0431\u043b\u0430\u0433\u043e\u0432\u0456\u043d\u043d\u043e\u043c\u0443 \u043a\u043d\u044f\u0437\u044e \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u043c\u0443 \u042f\u0440\u043e\u0441\u043b\u0430\u0432\u0443 \u041c\u0443\u0434\u0440\u043e\u043c\u0443.\u000d\u000a\u0412\u043c\u0447. \u0424\u0435\u0434\u043e\u0440\u0430 \u0422\u0438\u0440\u043e\u043d\u0430 (\u0431\u043b. 306). \u041f\u0440\u043f. \u0424\u0435\u0434\u043e\u0440\u0430, \u043c\u043e\u0432\u0447\u0430\u043b\u044c\u043d\u0438\u043a\u0430 \u000d\u000a\u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406). \u041f\u0440\u0430\u0432. \u041c\u0430\u0440\u0456\u0430\u043c\u043d\u0438, \u000d\u000a\u0441\u0435\u0441\u0442\u0440\u0438 \u0430\u043f. \u0424\u0438\u043b\u0438\u043f\u0430 (\u0406). \u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u043c\u0447. \u041c\u0438\u043d\u0438 \u041a\u0430\u043b\u0456\u043a\u0435\u043b\u0430\u0434\u0430 (867 \u2013 \u000d\u000a889).\u000d\u000a\u0406\u0443\u0434., 77 \u0437\u0430\u0447., I, 1 \u2013 10. \u041b\u043a., 109 \u0437\u0430\u0447., XXII, 39 \u2013 42, 45 \u2013 XXIII, 1.\u000d\u000a\u0412\u043c\u0447.: 2 \u0422\u0438\u043c., 292 \u0437\u0430\u0447., II, 1 \u2013 10. \u0406\u043d., 52 \u0437\u0430\u0447., XV, 17 \u2013 XVI, 2.\u000d\u000a\u041f\u0440\u043f. \u041b\u0435\u0432\u0430, \u0454\u043f. \u041a\u0430\u0442\u0430\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 780). \u0411\u043b\u0433\u0432. \u043a\u043d. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u042f\u0440\u043e\u0441\u043b\u0430\u0432\u0430 \u000d\u000a\u041c\u0443\u0434\u0440\u043e\u0433\u043e (1054). \u041f\u0440\u043f. \u0410\u0433\u0430\u0444\u043e\u043d\u0430, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406 \u2013 \u0425\u0406V). \u0421\u0449\u043c\u0447. \u0421\u0430\u0434\u043e\u043a\u0430, \u0454\u043f. \u041f\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u0437 \u000d\u000a\u043d\u0438\u043c 128 \u043c\u0447\u0447. (342 \u2013 344). \u041f\u0440\u043f. \u0410\u0433\u0430\u0444\u043e\u043d\u0430, \u043f\u0430\u043f\u0438 \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (682).\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a16\u000d\u000a18\u000d\u000a19\u000d\u000a17\u000d\u000a20","17\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u043d\u0435 \u0437\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0417\u0430\u0445. VIII, 7 \u2013 17. \u041d\u0430 \u0432\u0435\u0447.: \u0417\u0430\u0445. VIII, 19 \u2013 23.\u000d\u000a\u041f\u043e\u0440\u044f\u0434\u043e\u043a \u0431\u043e\u0433\u043e\u0441\u043b\u0443\u0436\u0456\u043d\u044c \u0442\u0430\u043a\u0438\u0439 \u0436\u0435, \u044f\u043a \u0443 \u0441\u0435\u0440\u0435\u0434\u0443. \u000d\u000a\u0421\u043b\u0443\u0436\u0431\u0430 \u0431\u043b\u0430\u0433\u043e\u0432\u0456\u043d\u043d\u043e\u043c\u0443 \u043a\u043d\u044f\u0437\u044e \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u043c\u0443 \u042f\u0440\u043e\u0441\u043b\u0430\u0432\u0443 \u041c\u0443\u0434\u0440\u043e\u043c\u0443 \u043f\u0435\u0440\u0435\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u043d\u0430 \u0447\u0435\u0442\u0432\u0435\u0440.\u000d\u000a\u0412\u0441\u0456\u0445 \u043f\u0440\u0435\u043f\u043e\u0434\u043e\u0431\u043d\u0438\u0445 \u043e\u0442\u0446\u0456\u0432, \u044f\u043a\u0456 \u0432 \u043f\u043e\u0434\u0432\u0438\u0433\u0443 \u043f\u0440\u043e\u0441\u044f\u044f\u043b\u0438 (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u000d\u000a\u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 \u0441\u0443\u0431\u043e\u0442\u0443 \u0441\u0438\u0440\u043e\u043f\u0443\u0441\u043d\u043e\u0433\u043e \u0442\u0438\u0436\u043d\u044f). \u041f\u0440\u043f. \u0422\u0438\u043c\u043e\u0444\u0456\u044f, \u0449\u043e \u0432 \u0421\u0438\u043c\u0432\u043e\u043b\u0430\u0445 (795). \u0421\u0432\u0442. \u0404\u0432\u0441\u0442\u0430\u0444\u0456\u044f, \u0430\u0440\u0445\u0456\u0454\u043f. \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (337). \u0421\u0432\u0442. \u0413\u0435\u043e\u0440\u0433\u0456\u044f, \u000d\u000a\u0454\u043f. \u0410\u043c\u0430\u0441\u0442\u0440\u0438\u0434\u0441\u044c\u043a\u043e\u0433\u043e (802 \u2013 811). \u000d\u000a\u041a\u043e\u0437\u0435\u043b\u044c\u0449\u0430\u043d\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (1881).\u000d\u000a\u041f\u0440\u043f\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30.\u000d\u000a\u0420\u044f\u0434.: \u0420\u0438\u043c., 115 \u0437\u0430\u0447., XIV, 19 \u2013 26. \u041c\u0444., 16 \u0437\u0430\u0447., VI, 1 \u2013 13.\u000d\u000a1-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443. \u0421\u0449\u043c\u0447. \u041f\u043e\u043b\u0456\u043a\u0430\u0440\u043f\u0430, \u0454\u043f. \u0421\u043c\u0438\u0440\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(167). \u041f\u0440\u043f\u043f. \u0406\u043e\u0430\u043d\u0430, \u0410\u043d\u0442\u0456\u043e\u0445\u0430, \u0410\u043d\u0442\u043e\u043d\u0456\u043d\u0430, \u041c\u043e\u0439\u0441\u0435\u044f, \u0417\u0435\u0432\u0438\u043d\u0430, \u041f\u043e\u043b\u0456\u0445\u0440\u043e\u043d\u0456\u044f, \u000d\u000a\u0456\u043d\u0448\u043e\u0433\u043e \u041c\u043e\u0439\u0441\u0435\u044f \u0456 \u0414\u0430\u043c\u0456\u0430\u043d\u0430, \u043f\u0443\u0441\u0442\u0435\u043b\u044c\u043d\u0438\u043a\u0456\u0432 \u0441\u0438\u0440\u0456\u0439\u0441\u044c\u043a\u0438\u0445 (V). \u041f\u0440\u043f. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430, \u0437\u0430\u0441\u043d\u043e\u0432\u043d\u0438\u043a\u0430 \u043e\u0431\u0438\u0442\u0435\u043b\u0456 \u00ab\u041d\u0435\u0432\u0441\u0438\u043f\u0443\u0449\u0438\u0445\u00bb (\u0431\u043b. 430).\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. I, 1 \u2013 20. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. I, 1 \u2013 13. \u041f\u0440\u0438\u0442\u0447. I, 1 \u2013 20.\u000d\u000a\u0423 \u0431\u0443\u0434\u043d\u0456 \u0434\u043d\u0456 \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443 \u0441\u043b\u0443\u0436\u0431\u0430 \u0437\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f \u0437\u0430 \u041c\u0456\u043d\u0435\u0454\u044e \u0442\u0430 \u0422\u0440\u0456\u043e\u0434\u0434\u044e. \u0423 \u043f\u0435\u0440\u0448\u0456 \u0447\u043e\u0442\u0438\u0440\u0438 \u0434\u043d\u0456 \u0446\u044c\u043e\u0433\u043e \u0442\u0438\u0436\u043d\u044f \u043d\u0430 \u0432\u0435\u043b\u0438\u043a\u043e\u043c\u0443 \u043f\u043e\u0432\u0435\u0447\u0456\u0440\u2019\u0457 \u0447\u0438\u0442\u0430\u0454\u0442\u044c\u0441\u044f \u043a\u0430\u043d\u043e\u043d \u043f\u0440\u043f. \u0410\u043d\u0434\u0440\u0456\u044f \u041a\u0440\u0438\u0442\u0441\u044c\u043a\u043e\u0433\u043e. \u0423 \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a, \u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a \u0456 \u0447\u0435\u0442\u0432\u0435\u0440 \u000d\u000a\u0432\u0441\u0456\u0454\u0457 \u0441\u0432\u044f\u0442\u043e\u0457 \u0427\u043e\u0442\u0438\u0440\u0438\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u043d\u0435 \u0437\u0432\u0435\u0440\u0448\u0443\u044e\u0442\u044c\u0441\u044f.\u000d\u000a\u041f\u043e\u0447\u0430\u0442\u043e\u043a \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443.\u000d\u000a\u041f\u0435\u0440\u0448\u0435 (\u0406V) \u0456 \u0434\u0440\u0443\u0433\u0435 (452) \u0437\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u0433\u043e\u043b\u043e\u0432\u0438 \u0406\u043e\u0430\u043d\u0430 \u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456. \u000d\u000a\u041f\u0440\u043f.\u0415\u0440\u0430\u0437\u043c\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0431\u043b. 1160).\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. I, 19 \u2013 II, 3. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. I, 14 \u2013 23. \u041f\u0440\u0438\u0442\u0447. I, 20 \u2013 33.\u000d\u000a\u041d\u0430\u0446\u0456\u043e\u043d\u0430\u043b\u044c\u043d\u0438\u0439 \u0434\u0435\u043d\u044c \u043c\u043e\u043b\u0438\u0442\u0432\u0438 (\u0432\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0439 \u0412\u0435\u0440\u0445\u043e\u0432\u043d\u043e\u044e \u0420\u0430\u0434\u043e\u044e \u0423\u043a\u0440\u0430\u0457\u043d\u0438).\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a21\u000d\u000a23\u000d\u000a24\u000d\u000a\u041d\u0435\u0434\u0456\u043b\u044f \u0441\u0438\u0440\u043e\u043f\u0443\u0441\u043d\u0430, \u043f\u0440\u043e\u0449\u0435\u043d\u0430. \u0421\u043f\u043e\u043c\u0438\u043d \u0410\u0434\u0430\u043c\u043e\u0432\u043e\u0433\u043e \u0432\u0438\u0433\u043d\u0430\u043d\u043d\u044f \u0437 \u000d\u000a\u0440\u0430\u044e. \u0413\u043b\u0430\u0441 4-\u0439.\u000d\u000a\u0421\u0449\u043c\u0447 \u041f\u0430\u043f\u0456\u044f, \u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0430 \u0406\u0454\u0440\u0430\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0406). \u041c\u0447\u0447. \u041c\u0430\u0432\u0440\u0438\u043a\u0456\u044f \u0456 70-\u043e\u0445 \u0432\u043e\u0457\u043d\u0456\u0432: \u0424\u043e\u0442\u0438\u043d\u0430, \u0424\u0435\u0434\u043e\u0440\u0430, \u0424\u0438\u043b\u0438\u043f\u0430 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 (\u0431\u043b. 305). \u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u000d\u000a\u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0456\u0432, \u0449\u043e \u0432 \u0404\u0432\u0433\u0435\u043d\u0456\u0457 (395 \u2013 423). \u041f\u0440\u043f\u043f. \u0424\u0430\u043b\u0430\u0441\u0456\u044f, \u041b\u0438\u043c\u043d\u0456\u044f \u0456 \u0412\u0430\u0440\u0430\u0434\u0430\u0442\u0430, \u000d\u000a\u043f\u0443\u0441\u0442\u0435\u043b\u044c\u043d\u0438\u043a\u0456\u0432 \u0441\u0438\u0440\u0456\u0439\u0441\u044c\u043a\u0438\u0445 (V). \u041f\u0440\u043f. \u0410\u0444\u0430\u043d\u0430\u0441\u0456\u044f, \u0441\u043f\u043e\u0432. (821). \u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 4-\u0435, \u041b\u043a., 112 \u0437\u0430\u0447., XXIV, 1 \u2013 12.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0420\u0438\u043c., 112 \u0437\u0430\u0447., XIII, 11 \u2013 XIV, 4. \u041c\u0444., 17 \u0437\u0430\u0447., VI, 14 \u2013 21.\u000d\u000a\u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456: 2 \u041a\u043e\u0440., 176 \u0437\u0430\u0447., IV, 6 \u2013 15. \u041c\u0444., 40 \u0437\u0430\u0447., XI, 2 \u2013 15.\u000d\u000a\u0417\u0430\u0433\u043e\u0432\u0438\u043d\u0438 \u043d\u0430 \u0412\u0435\u043b\u0438\u043a\u0438\u0439 \u043f\u0456\u0441\u0442.\u000d\u000a\u0423 \u0446\u0435\u0439 \u0434\u0435\u043d\u044c \u043d\u0430 \u043b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0437\u0430\u0433\u043e\u0442\u043e\u0432\u043b\u044e\u044e\u0442\u044c\u0441\u044f \u0434\u0432\u0430 \u0410\u0433\u043d\u0446\u0456 \u0434\u043b\u044f \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0439 \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432 \u0443 \u0441\u0435\u0440\u0435\u0434\u0443 \u0456 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e.\u000d\u000a\u041d\u0430 \u0446\u0435\u0439 \u0434\u0435\u043d\u044c \u043f\u0435\u0440\u0435\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u043f\u043e\u043b\u0456\u0454\u043b\u0435\u0439\u043d\u0430 \u0441\u043b\u0443\u0436\u0431\u0430 \u043d\u0430 \u0447\u0435\u0441\u0442\u044c \u043f\u0435\u0440\u0448\u043e\u0433\u043e \u0456 \u000d\u000a\u0434\u0440\u0443\u0433\u043e\u0433\u043e \u0437\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u0433\u043e\u043b\u043e\u0432\u0438 \u0406\u043e\u0430\u043d\u0430 \u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456. \u000d\u000a\u0423 \u0446\u044e \u043d\u0435\u0434\u0456\u043b\u044e \u0442\u0430 \u043d\u0430\u0441\u0442\u0443\u043f\u043d\u0456 \u043f\u2019\u044f\u0442\u044c (\u0434\u043e \u0412\u0435\u0440\u0431\u043d\u043e\u0457 \u043d\u0435\u0434\u0456\u043b\u0456) \u0437\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f \u0432\u0435\u0447\u0456\u0440\u043d\u044f \u0456\u0437 \u0432\u0445\u043e\u0434\u043e\u043c \u0442\u0430 \u0432\u0435\u043b\u0438\u043a\u0438\u043c\u0438 \u043f\u0440\u043e\u043a\u0438\u043c\u043d\u0430\u043c\u0438: \u00ab\u041d\u0435 \u0432\u0456\u0434\u0432\u0435\u0440\u043d\u0438 \u043b\u0438\u0446\u044f \u0422\u0432\u043e\u0433\u043e...\u00bb \u0456 \u00ab\u0414\u0430\u0432 \u043c\u0435\u043d\u0456 \u043d\u0430\u0441\u043b\u0456\u0434\u0434\u044f...\u00bb, \u044f\u043a\u0456 \u0441\u043f\u0456\u0432\u0430\u044e\u0442\u044c\u0441\u044f \u043f\u043e\u0447\u0435\u0440\u0433\u043e\u0432\u043e. \u041f\u0456\u0441\u043b\u044f \u0432\u0435\u0447\u0456\u0440\u043d\u0456 \u000d\u000a\u0437\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f \u0447\u0438\u043d \u043f\u0440\u043e\u0449\u0435\u043d\u043d\u044f.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a22","18\u000d\u000a\u0421\u0432\u0442. \u0422\u0430\u0440\u0430\u0441\u0456\u044f, \u0430\u0440\u0445\u0456\u0454\u043f. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (806).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. II, 3 \u2013 11. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. I, 24 \u2013 II, 3. \u041f\u0440\u0438\u0442\u0447. II, 1 \u2013 22. \u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a25\u000d\u000a\u0421\u0432\u0442. \u041f\u043e\u0440\u0444\u0438\u0440\u0456\u044f, \u0430\u0440\u0445\u0456\u0454\u043f. \u0413\u0430\u0437\u044c\u043a\u043e\u0433\u043e (420). \u041c\u0447. \u0421\u0435\u0432\u0430\u0441\u0442\u0456\u0430\u043d\u0430 (\u0431\u043b. 66).\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. II, 11 \u2013 21. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. II, 4 \u2013 19. \u041f\u0440\u0438\u0442\u0447. III, 1 \u2013 18.\u000d\u000a\u041f\u0440\u043f. \u041f\u0440\u043e\u043a\u043e\u043f\u0456\u044f \u0414\u0435\u043a\u0430\u043f\u043e\u043b\u0456\u0442\u0430, \u0441\u043f\u043e\u0432. (\u0431\u043b. 750). \u041f\u0440\u043f. \u0422\u0438\u0442\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 \u000d\u000a\u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (1190). \u041f\u0440\u043f. \u0422\u0438\u0442\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u043a\u043e\u043b\u0438\u0448\u043d\u044c\u043e\u0433\u043e \u0432\u043e\u0457\u043d\u0430, \u0449\u043e \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 \u000d\u000a(\u0425\u0406V). \u041f\u0440\u043f. \u0424\u0430\u043b\u0430\u043b\u0435\u044f \u0421\u0438\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 460). \u041f\u0440\u043f. \u0404\u0444\u0440\u0435\u043c\u0430 \u041a\u0430\u0442\u0443\u043d\u0430\u043a\u0441\u044c\u043a\u043e\u0433\u043e (1998).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. III, 1 \u2013 14. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. II, 20 \u2013 III, 20. \u041f\u0440\u0438\u0442\u0447. III, 19 \u2013 34.\u000d\u000a\u041f\u0456\u0441\u043b\u044f \u0437\u0430\u0430\u043c\u0432\u043e\u043d\u043d\u043e\u0457 \u043c\u043e\u043b\u0438\u0442\u0432\u0438 \u2013 \u043c\u043e\u043b\u0435\u0431\u043d\u0438\u0439 \u043a\u0430\u043d\u043e\u043d \u0432\u043c\u0447. \u0424\u0435\u0434\u043e\u0440\u0443 \u0422\u0438\u0440\u043e\u043d\u0443 \u0442\u0430 \u000d\u000a\u0431\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0456\u043d\u043d\u044f \u043a\u043e\u043b\u0438\u0432\u0430.\u000d\u000a\u0412\u043c\u0447. \u0424\u0435\u0434\u043e\u0440\u0430 \u0422\u0438\u0440\u043e\u043d\u0430 (\u0431\u043b. 306) (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 \u0441\u0443\u0431\u043e\u0442\u0443 1-\u0433\u043e \u000d\u000a\u0442\u0438\u0436\u043d\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443). \u0421\u0432\u0442. \u0410\u0440\u0441\u0435\u043d\u0456\u044f (\u041c\u0430\u0446\u0456\u0454\u0432\u0438\u0447\u0430), \u043c\u0438\u0442\u0440. \u0420\u043e\u0441\u0442\u043e\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1772). \u041f\u0440\u043f. \u0412\u0430\u0441\u0438\u043b\u0456\u044f, \u0441\u043f\u043e\u0432. (750). \u0421\u0449\u043c\u0447. \u041f\u0440\u043e\u0442\u0435\u0440\u0456\u044f, \u043f\u0430\u0442\u0440. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (457). \u0421\u0449\u043c\u0447. \u041d\u0435\u0441\u0442\u043e\u0440\u0430, \u0454\u043f. \u041c\u0430\u0433\u0456\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (250). \u041f\u0440\u043f\u043f. \u000d\u000a\u041c\u0430\u0440\u0438\u043d\u0438 \u0456 \u041a\u0456\u0440\u0438 (\u0431\u043b. 450). \u041f\u0440\u043f. \u041a\u0430\u0441\u0456\u044f\u043d\u0430 \u0420\u0438\u043c\u043b\u044f\u043d\u0438\u043d\u0430 (435) (\u043f\u0430\u043c'\u044f\u0442\u044c \u043f\u0435\u0440\u0435\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u0437 29 \u043b\u044e\u0442\u043e\u0433\u043e). \u041f\u0440\u043f. \u041a\u0430\u0441\u0456\u044f\u043d\u0430, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0443 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (XIII \u2013 \u0425\u0406V) (\u043f\u0430\u043c'\u044f\u0442\u044c \u043f\u0435\u0440\u0435\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u0437 29 \u000d\u000a\u043b\u044e\u0442\u043e\u0433\u043e). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430, \u043d\u0430\u0437\u0432\u0430\u043d\u043e\u0433\u043e \u0412\u0430\u0440\u0441\u043e\u043d\u043e\u0444\u0456\u0454\u043c, \u0454\u043f. \u0414\u0430\u043c\u0430\u0441\u044c\u043a\u043e\u0433\u043e (V); \u043f\u0440\u043f. \u000d\u000a\u0424\u0435\u043e\u043a\u0442\u0438\u0440\u0438\u0441\u0442\u0430, \u0441\u043f\u043e\u0432., \u0456\u0433\u0443\u043c. \u041f\u0435\u043b\u0456\u043a\u0456\u0442\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406\u0406\u0406) (\u043f\u0430\u043c'\u044f\u0442\u044c \u043f\u0435\u0440\u0435\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u0437 29 \u000d\u000a\u043b\u044e\u0442\u043e\u0433\u043e). \u0421\u0432\u0442. \u041c\u0435\u043b\u0435\u0442\u0456\u044f, \u0430\u0440\u0445\u0456\u0454\u043f. \u0425\u0430\u0440\u043a\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1840). (\u043f\u0430\u043c'\u044f\u0442\u044c \u043f\u0435\u0440\u0435\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u0437 29 \u043b\u044e\u0442\u043e\u0433\u043e).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 \u0417\u043e\u043b\u043e\u0442\u043e\u0443\u0441\u0442\u043e\u0433\u043e.\u000d\u000a\u0412\u043c\u0447.: 2 \u0422\u0438\u043c., 292 \u0437\u0430\u0447., II, 1 \u2013 10. \u0406\u043d., 52 \u0437\u0430\u0447., XV, 17 \u2013 XVI, 2.\u000d\u000a\u0420\u044f\u0434.: \u0404\u0432\u0440., 303 \u0437\u0430\u0447., I, 1 \u2013 12. \u041c\u043a., 10 \u0437\u0430\u0447., II, 23 \u2013 III, 5.\u000d\u000a\u0421\u043b\u0443\u0436\u0431\u0430 \u0442\u0456\u043b\u044c\u043a\u0438 \u0437 \u0422\u0440\u0456\u043e\u0434\u0456. \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u043f\u0440\u043e\u043a\u0438\u043c\u0435\u043d, \u0433\u043b\u0430\u0441 7-\u0439 \u00ab\u0417\u0432\u0435\u0441\u0435\u043b\u0438\u0442\u044c\u0441\u044f \u000d\u000a\u043f\u0440\u0430\u0432\u0435\u0434\u043d\u0438\u043a \u0443 \u0413\u043e\u0441\u043f\u043e\u0434\u0456...\u00bb.\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a26\u000d\u000a27\u000d\u000a28\u000d\u000a1-\u0448\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443. \u0422\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u043e \u041f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u2019\u044f. \u0413\u043b\u0430\u0441 5-\u0439.\u000d\u000a\u041f\u0440\u043c\u0446. \u0404\u0432\u0434\u043e\u043a\u0456\u0457 (\u0431\u043b. 160 \u2013 170). \u041c\u0447\u0447. \u041d\u0435\u0441\u0442\u043e\u0440\u0430 \u0456 \u0422\u0440\u0438\u0432\u0456\u043c\u0456\u044f (\u0406\u0406\u0406). \u041c\u0446. \u0410\u043d\u0442\u043e\u043d\u0456\u043d\u0438 \u000d\u000a(\u0406\u0406\u0406 \u2013 \u0406V). \u041c\u0447\u0447. \u041c\u0430\u0440\u043a\u0435\u043b\u0430 \u0456 \u0410\u043d\u0442\u043e\u043d\u0456\u044f. \u041f\u0440\u043f. \u0414\u043e\u043c\u043d\u0456\u043d\u0438 \u0421\u0438\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (\u0431\u043b. 450 \u2013 460).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e.\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 5-\u0435, \u041b\u043a., 113 \u0437\u0430\u0447., XXIV, 12 \u2013 35.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0404\u0432\u0440., 329 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), XI, 24 \u2013 26, 32 \u2013 XII, 2. \u0406\u043d., 5 \u0437\u0430\u0447., I, 43 \u2013 51.\u000d\u000a\u041d\u0430 \u043c\u043e\u043b\u0435\u0431\u043d\u0456: \u0420\u0438\u043c. 121 \u0437\u0430\u0447., \u0425V\u0406, 17 \u2013 24. \u041c\u0444. 75 \u0437\u0430\u0447., \u0425V\u0406\u0406\u0406, 10 \u2013 20.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a1","19\u000d\u000a\u0421\u043b\u0443\u0436\u0431\u0430 \u0437 \u041e\u043a\u0442\u043e\u0457\u0445\u0430 \u0439 \u0422\u0440\u0456\u043e\u0434\u0456. \u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f \u00ab\u041c\u043e\u0440\u044f \u0427\u0435\u0440\u0432\u043e\u043d\u043e\u0433\u043e \u000d\u000a\u0431\u0435\u0437\u043e\u0434\u043d\u044e\u2026\u00bb. \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0430\u043d\u0442\u0438\u0444\u043e\u043d\u0438 \u0441\u0432\u044f\u0442\u043a\u043e\u0432\u0456 (\u0434\u0438\u0432. \u0443 \u0434\u043e\u0434\u0430\u0442\u043a\u0443 \u0441. 86), \u000d\u000a\u0437\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0414\u043e\u0441\u0442\u043e\u0439\u043d\u043e \u0454\u2026\u00bb \u2013 \u00ab\u0422\u043e\u0431\u043e\u044e \u0440\u0430\u0434\u0456\u0454...\u00bb. \u041f\u0456\u0441\u043b\u044f \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u2013 \u043c\u043e\u043b\u0435\u0431\u0435\u043d\u044c \u000d\u000a\u0422\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0430 \u041f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u2019\u044f.\u000d\u000a\u0423 \u0446\u0435\u0439 \u0434\u0435\u043d\u044c \u043d\u0430 \u043b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0437\u0430\u0433\u043e\u0442\u043e\u0432\u043b\u044e\u044e\u0442\u044c\u0441\u044f \u0434\u0432\u0430 \u0410\u0433\u043d\u0446\u0456 \u0434\u043b\u044f \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0439 \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432 \u0443 \u0441\u0435\u0440\u0435\u0434\u0443 \u0456 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e.\u000d\u000a2-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443. \u0421\u0449\u043c\u0447. \u0424\u0435\u043e\u0434\u043e\u0442\u0430, \u0454\u043f. \u041a\u0438\u0440\u0438\u043d\u0435\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(\u0431\u043b. 326). \u0421\u0432\u0442. \u0406\u043e\u0432\u0430 (\u0411\u043e\u0440\u0435\u0446\u044c\u043a\u043e\u0433\u043e), \u043c\u0438\u0442\u0440. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0432\u0441\u0456\u0454\u0457 \u0420\u0443\u0441\u0438 \u000d\u000a(1631). \u041c\u0446. \u0404\u0432\u0444\u0430\u043b\u0456\u0457 (257). \u041c\u0447. \u0422\u0440\u043e\u0430\u0434\u0456\u044f (\u0406\u0406\u0406). \u041f\u0440\u043f. \u0410\u0433\u0430\u0444\u043e\u043d\u0430 \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(V). \u041c\u0447\u0447. 440 \u0456\u0442\u0430\u043b\u0456\u0439\u0441\u044c\u043a\u0438\u0445 (579). \u0421\u0432\u0442. \u0410\u0440\u0441\u0435\u043d\u0456\u044f, \u0454\u043f. \u0422\u0432\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e (1409).\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. IV, 2 \u2013 V, 7. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. III, 21 \u2013 IV, 7. \u041f\u0440\u0438\u0442\u0447. III, 34 \u2013 \u000d\u000aIV, 22.\u000d\u000a\u041c\u0447\u0447. \u0404\u0432\u0442\u0440\u043e\u043f\u0456\u044f, \u041a\u043b\u0435\u043e\u043d\u0438\u043a\u0430 \u0456 \u0412\u0430\u0441\u0438\u043b\u0456\u0441\u043a\u0430 (\u0431\u043b. 308). \u041f\u0440\u043f. \u041f\u0456\u0430\u043c\u0438, \u0434\u0456\u0432\u0438 (337). \u000d\u000a\u0421\u0432\u0432. \u0417\u0438\u043d\u043e\u043d\u0430 \u0456 \u0417\u043e\u0457\u043b\u0430.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. V, 7 \u2013 16. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. IV, 8\u201315. \u041f\u0440\u0438\u0442\u0447. V, 1 \u2013 15.\u000d\u000a\u041f\u0440\u043f. \u0413\u0435\u0440\u0430\u0441\u0438\u043c\u0430, \u044f\u043a\u0438\u0439 \u043d\u0430 \u0419\u043e\u0440\u0434\u0430\u043d\u0456 (475). \u041c\u0447. \u041f\u0430\u0432\u043b\u0430 \u0456 \u043c\u0446. \u042e\u043b\u0456\u0430\u043d\u0456\u0457 (\u0431\u043b. 273). \u000d\u000a\u041f\u0440\u043f. \u042f\u043a\u043e\u0432\u0430, \u043f\u043e\u0441\u043d\u0438\u043a\u0430 (V\u0406). \u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u0431\u043b\u0433\u0432. \u043a\u043d. \u0412\u2019\u044f\u0447\u0435\u0441\u043b\u0430\u0432\u0430 \u000d\u000a\u0427\u0435\u0441\u044c\u043a\u043e\u0433\u043e (938). \u041f\u0440\u043f. \u0413\u0435\u0440\u0430\u0441\u0438\u043c\u0430 \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u0456\u0433\u0443\u043c. \u0412\u043e\u043b\u043e\u0433\u043e\u0434\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(1178). \u0421\u0432\u0442. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f, \u0454\u043f. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0446\u0456\u0457 \u041a\u0456\u043f\u0440\u0441\u044c\u043a\u043e\u0457. \u041f\u0440\u043c\u0447. \u0406\u043e\u0430\u0441\u0430\u0444\u0430 \u0421\u043d\u0456\u0442\u043d\u043e\u0433\u043e\u0440\u0441\u044c\u043a\u043e\u0433\u043e (1299).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. I\u0406, 3 \u2013 11. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. I, 14 \u2013 23. \u041f\u0440\u0438\u0442\u0447. I, 20 \u2013 33.\u000d\u000a\u041c\u0447. \u041a\u043e\u043d\u043e\u043d\u0430 \u0406\u0441\u0430\u0432\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406). \u041c\u0447. \u041e\u043d\u0438\u0441\u0456\u044f (\u0406). \u041c\u0447. \u041a\u043e\u043d\u043e\u043d\u0430, \u0433\u0440\u0430\u0434\u0430\u0440\u044f \u000d\u000a(\u0437\u0435\u043c\u043b\u0435\u0440\u043e\u0431\u0430) (\u0406\u0406\u0406). \u041f\u0440\u043f. \u041c\u0430\u0440\u043a\u0430 (V). \u041f\u0440\u043f. \u0406\u0441\u0438\u0445\u0456\u044f (\u0431\u043b. 790). \u041c\u0446. \u0406\u0440\u0430\u0457\u0434\u0438. \u000d\u000a\u041c\u0447. \u0404\u0432\u043b\u043e\u0433\u0456\u044f, \u0449\u043e \u0432 \u041f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0456. \u041c\u0447. \u0404\u0432\u043b\u0430\u043c\u043f\u0456\u044f.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. VI, 1 \u2013 12. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. V, 1\u201324. \u041f\u0440\u0438\u0442\u0447. VI, 3 \u2013 20.\u000d\u000a\u041c\u0447\u0447. 42 \u0432 \u0410\u043c\u043c\u043e\u0440\u0456\u0457: \u041a\u043e\u0441\u0442\u044f\u043d\u0442\u0438\u043d\u0430, \u0410\u0435\u0442\u0456\u044f, \u0424\u0435\u043e\u0444\u0456\u043b\u0430, \u0424\u0435\u0434\u043e\u0440\u0430, \u041c\u0435\u043b\u0456\u0441\u0435\u043d\u0430, \u041a\u0430\u043b\u0456\u0441\u0442\u0430, \u0412\u0430\u0441\u043e\u044f \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 \u0437 \u043d\u0438\u043c\u0438 (\u0431\u043b. 845). \u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u0447\u0435\u0441\u043d\u043e\u0433\u043e \u0425\u0440\u0435\u0441\u0442\u0430 \u0456 \u0446\u0432\u044f\u0445\u0456\u0432 \u000d\u000a\u0441\u0432. \u0446\u0430\u0440\u0438\u0446\u0435\u044e \u041e\u043b\u0435\u043d\u043e\u044e \u0432 \u0404\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0456 (326). \u041f\u0440\u043c\u0447. \u041a\u043e\u043d\u043e\u043d\u0430 \u0456 \u0441\u0438\u043d\u0430 \u0439\u043e\u0433\u043e \u041a\u043e\u043d\u043e\u043d\u0430 (270 \u2013 275). \u041f\u0440\u043f. \u0410\u0440\u043a\u0430\u0434\u0456\u044f \u041a\u0456\u043f\u0440\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 361). \u000d\u000a\u0406\u043a\u043e\u043d \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u0427\u0435\u043d\u0441\u0442\u043e\u0445\u043e\u0432\u0441\u044c\u043a\u043e\u0457, \u0428\u0435\u0441\u0442\u043e\u043a\u0456\u0432\u0441\u044c\u043a\u043e\u0457 \u0456 \u00ab\u0411\u043b\u0430\u0433\u043e\u0434\u0430\u0442\u043d\u0435 \u043d\u0435\u0431\u043e\u00bb.\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. VII, 1 \u2013 14. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. V, 32 \u2013 VI, 8. \u041f\u0440\u0438\u0442\u0447. VI, 20 \u2013 \u000d\u000aVII, 1.\u000d\u000a\u0421\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0456\u0432, \u044f\u043a\u0456 \u0432 \u0425\u0435\u0440\u0441\u043e\u043d\u0435\u0441\u0456 \u0431\u0443\u043b\u0438 \u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0430\u043c\u0438: \u0412\u0430\u0441\u0438\u043b\u0456\u044f, \u0404\u0444\u0440\u0435\u043c\u0430, \u041a\u0430\u043f\u0456\u0442\u043e\u043d\u0430, \u0404\u0432\u0433\u0435\u043d\u0456\u044f, \u0404\u0444\u0435\u0440\u0456\u044f, \u0415\u043b\u043f\u0456\u0434\u0456\u044f \u0442\u0430 \u0410\u0433\u0430\u0444\u043e\u0434\u043e\u0440\u0430 (\u0406V). \u041f\u0440\u043f. \u041f\u0430\u0432\u043b\u0430 \u041f\u0440\u0435\u043f\u0440\u043e\u0441\u0442\u043e\u0433\u043e (\u0406V). \u0421\u0432\u0442. \u041f\u0430\u0432\u043b\u0430, \u0441\u043f\u043e\u0432., \u0454\u043f. \u041f\u0440\u0443\u0441\u0456\u0430\u0434\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0425). \u041f\u0440\u043f. \u0415\u043c\u0456\u043b\u0456\u0430\u043d\u0430 \u0406\u0442\u0430\u043b\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e.\u000d\u000a2\u000d\u000a3\u000d\u000a4\u000d\u000a5\u000d\u000a6\u000d\u000a7\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430","20\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u0421\u043f\u043e\u0440\u0443\u0447\u043d\u0438\u0446\u044f \u0433\u0440\u0456\u0448\u043d\u0438\u0445\u00bb.\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 \u0417\u043e\u043b\u043e\u0442\u043e\u0443\u0441\u0442\u043e\u0433\u043e.\u000d\u000a\u041f\u043e\u043c\u0438\u043d\u0430\u043d\u043d\u044f \u043f\u043e\u043c\u0435\u0440\u043b\u0438\u0445.\u000d\u000a\u0417\u0430\u0443\u043f\u043e\u043a\u0456\u0439\u043d\u0435: 1 \u0421\u043e\u043b., 270 \u0437\u0430\u0447., IV, 13 \u2013 17. \u0406\u043d., 16 \u0437\u0430\u0447., V, 24 \u2013 30.\u000d\u000a\u0420\u044f\u0434.: \u0404\u0432\u0440., 309 \u0437\u0430\u0447., III, 12 \u2013 16. \u041c\u043a., 6 \u0437\u0430\u0447., I, 35 \u2013 44.\u000d\u000a\u041d\u0430 \u0432\u0435\u0447\u0456\u0440\u043d\u0456 \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u043f\u0440\u043e\u043a\u0438\u043c\u043d\u0430 \u0456 \u043d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0411\u043e\u0433 \u0413\u043e\u0441\u043f\u043e\u0434\u044c...\u00bb \u2013 \u000d\u000a\u00ab\u0410\u043b\u0438\u043b\u0443\u044f\u00bb. \u0412 \u0446\u044e \u0442\u0430 \u0434\u0432\u0456 \u043d\u0430\u0441\u0442\u0443\u043f\u043d\u0438\u0445 \u0441\u0443\u0431\u043e\u0442\u0438 \u0437\u0430\u0443\u043f\u043e\u043a\u0456\u0439\u043d\u0430 \u0441\u043b\u0443\u0436\u0431\u0430 \u0437\u0430 \u0422\u0440\u0456\u043e\u0434\u0434\u044e \u000d\u000a\u043f\u043e\u0454\u0434\u043d\u0443\u0454\u0442\u044c\u0441\u044f \u0437\u0456 \u0441\u043b\u0443\u0436\u0431\u043e\u044e \u041c\u0456\u043d\u0435\u0457 \u0442\u0430 \u041e\u043a\u0442\u043e\u0457\u0445\u0430.\u000d\u000a2-\u0433\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443. \u0413\u043b\u0430\u0441 6-\u0439.\u000d\u000a\u0421\u0432\u0442. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f \u041f\u0430\u043b\u0430\u043c\u0438, \u0430\u0440\u0445\u0456\u0454\u043f. \u0424\u0435\u0441\u0430\u043b\u043e\u043d\u0456\u043a\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u000d\u000a\u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 2-\u0433\u0443 \u043d\u0435\u0434\u0456\u043b\u044e \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443). \u0421\u043e\u0431\u043e\u0440 \u0443\u0441\u0456\u0445 \u043f\u0440\u0435\u043f\u043e\u0434\u043e\u0431\u043d\u0438\u0445 \u043e\u0442\u0446\u0456\u0432 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u0438\u0445 (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 2-\u0433\u0443 \u043d\u0435\u0434\u0456\u043b\u044e \u000d\u000a\u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443). \u041f\u0440\u043f. \u0424\u0435\u043e\u0444\u0456\u043b\u0430\u043a\u0442\u0430, \u0441\u043f\u043e\u0432., \u0454\u043f. \u041d\u0456\u043a\u043e\u043c\u0438\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (842 \u2013 \u000d\u000a845). \u0410\u043f. \u0404\u0440\u043c\u0430 (\u0406). \u0421\u0449\u043c\u0447. \u0424\u0435\u043e\u0434\u043e\u0440\u0438\u0442\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (361 \u000d\u000a\u2013 363). \u041f\u0440\u043f. \u0414\u043e\u043c\u0435\u0442\u0456\u044f (363).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e.\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 6-\u0435, \u041b\u043a., 114 \u0437\u0430\u0447., XXIV, 36 \u2013 53.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0404\u0432\u0440., 304 \u0437\u0430\u0447., I, 10 \u2013 II, 3. \u041c\u043a., 7 \u0437\u0430\u0447., II, 1 \u2013 12.\u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 318 \u0437\u0430\u0447., VII, 26 \u2013 VIII, 2. \u0406\u043d., 36 \u0437\u0430\u0447., X, 9 \u2013 16.\u000d\u000a\u041f\u0440\u043f\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 V\u0406, 2. \u041b\u043a., 24 \u0437\u0430\u0447., V\u0406, 17 \u2013 23 (\u043f\u0456\u0434 \u0437\u0430\u0447\u0430\u043b\u043e).\u000d\u000a\u0423 \u0446\u0435\u0439 \u0434\u0435\u043d\u044c \u043d\u0430 \u043b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0437\u0430\u0433\u043e\u0442\u043e\u0432\u043b\u044e\u044e\u0442\u044c\u0441\u044f \u0442\u0440\u0438 \u0410\u0433\u043d\u0446\u0456 \u0434\u043b\u044f \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0439 \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432 \u0443 \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a, \u0441\u0435\u0440\u0435\u0434\u0443 \u0456 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a8\u000d\u000a3-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443. 40 \u043c\u0447\u0447., \u044f\u043a\u0456 \u0432 \u0421\u0435\u0432\u0430\u0441\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u043c\u0443 \u000d\u000a\u043e\u0437\u0435\u0440\u0456 \u043c\u0443\u0447\u0438\u043b\u0438\u0441\u044f: \u041a\u0456\u0440\u0456\u043e\u043d\u0430, \u041a\u0430\u043d\u0434\u0438\u0434\u0430, \u0414\u043e\u043c\u043d\u0430, \u0406\u0441\u0438\u0445\u0456\u044f, \u0406\u0440\u0430\u043a\u043b\u0456\u044f, \u0421\u043c\u0430\u0440\u0430\u0433\u0434\u0430, \u000d\u000a\u0404\u0432\u043d\u043e\u0457\u043a\u0430, \u0412\u0430\u043b\u0435\u043d\u0442\u0430, \u0412\u0438\u0432\u0456\u0430\u043d\u0430, \u041a\u043b\u0430\u0432\u0434\u0456\u044f, \u041f\u0440\u0456\u0441\u043a\u0430, \u0424\u0435\u043e\u0434\u0443\u043b\u0430, \u0404\u0432\u0442\u0438\u0445\u0456\u044f, \u0406\u043e\u0430\u043d\u0430, \u000d\u000a\u041a\u0441\u0430\u043d\u0444\u0456\u044f, \u0406\u043b\u0456\u0430\u043d\u0430, \u0421\u0438\u0441\u0438\u043d\u0456\u044f, \u0410\u043d\u0433\u0456\u044f, \u0410\u0435\u0442\u0456\u044f, \u0424\u043b\u0430\u0432\u0456\u044f, \u0410\u043a\u0430\u043a\u0456\u044f, \u0415\u043a\u0434\u0438\u043a\u0456\u044f (\u0415\u043a\u0434\u0438\u0442\u0430), \u000d\u000a\u041b\u0456\u0441\u0438\u043c\u0430\u0445\u0430, \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430, \u0406\u043b\u0456\u044f, \u0413\u043e\u0440\u0433\u043e\u043d\u0456\u044f, \u0424\u0435\u043e\u0444\u0456\u043b\u0430, \u0414\u043e\u043c\u0435\u0442\u0456\u0430\u043d\u0430, \u0413\u0430\u044f, \u041b\u0435\u043e\u043d\u0442\u0456\u044f, \u0410\u0444\u0430\u043d\u0430\u0441\u0456\u044f, \u041a\u0438\u0440\u0438\u043b\u0430, \u0421\u0430\u043a\u0435\u0440\u0434\u043e\u043d\u0430, \u041c\u0438\u043a\u043e\u043b\u0430\u044f, \u0412\u0430\u043b\u0435\u0440\u0456\u044f, \u0424\u0456\u043b\u043e\u043a\u0442\u0438\u043c\u043e\u043d\u0430, \u000d\u000a\u0421\u0435\u0432\u0435\u0440\u0456\u0430\u043d\u0430, \u0425\u0443\u0434\u0456\u043e\u043d\u0430, \u041c\u0435\u043b\u0456\u0442\u043e\u043d\u0430 \u0456 \u0410\u0433\u043b\u0430\u0457\u044f (\u0431\u043b. 320). \u041c\u0447. \u0423\u0440\u043f\u0430\u0441\u0456\u0430\u043d\u0430 (\u0431\u043b. 295). \u000d\u000a\u0421\u0432. \u041a\u0435\u0441\u0430\u0440\u0456\u044f, \u0431\u0440\u0430\u0442\u0430 \u0441\u0432\u0442. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f \u0411\u043e\u0433\u043e\u0441\u043b\u043e\u0432\u0430 (\u0431\u043b. 369). \u041f\u0440\u0430\u0432. \u0422\u0430\u0440\u0430\u0441\u0456\u044f \u041b\u0456\u043a\u0430\u043e\u043d\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e.\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432.\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 106 \u0437\u0430\u0447., XXI, 12 \u2013 19. \u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. VIII, 13 \u2013 IX, 7. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. VI, 9 \u2013 22. \u041f\u0440\u0438\u0442\u0447. VIII, 1 \u2013 21.\u000d\u000a\u041b\u0456\u0442. \u2013 \u041c\u0447\u0447.: \u0404\u0432\u0440., 331 \u0437\u0430\u0447., XII, 1 \u2013 10. \u041c\u0444., 80 \u0437\u0430\u0447., XX, 1 \u2013 16.\u000d\u000a\u0417\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f \u0412\u0435\u0447\u0456\u0440\u043d\u044f. \u041d\u0430 \u043c\u0430\u043b\u043e\u043c\u0443 \u043f\u043e\u0432\u0435\u0447\u0456\u0440\u2019\u0457 \u043a\u043e\u043d\u0434\u0430\u043a \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430\u043c, \u0433\u043b\u0430\u0441 \u000d\u000a6-\u0439. \u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u043d\u0430 \u00ab\u0411\u043e\u0433 \u0413\u043e\u0441\u043f\u043e\u0434\u044c\u2026\u00bb \u2013 \u0442\u0440\u043e\u043f\u0430\u0440 \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430\u043c (\u0434\u0432\u0456\u0447\u0456), \u00ab\u0421\u043b\u0430\u0432\u0430 \u0456 \u000d\u000a\u043d\u0438\u043d\u0456\u2026\u00bb \u2013 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0447\u043d\u0438\u0439. \u041f\u0456\u0441\u043b\u044f 1-\u043e\u0457 \u0442\u0430 2-\u043e\u0457 \u043a\u0430\u0444\u0438\u0437\u043c\u0438 \u043c\u0430\u043b\u043e\u0457 \u0435\u043a\u0442\u0435\u043d\u0456\u0457 \u043d\u0435\u043c\u0430\u0454, \u000d\u000a\u0430 \u0432\u0456\u0434\u0440\u0430\u0437\u0443 \u0441\u0456\u0434\u0430\u043b\u044c\u043d\u0456 \u0437 \u0422\u0440\u0456\u043e\u0434\u0456. \u041f\u0456\u0441\u043b\u044f 3-\u043e\u0457 \u043a\u0430\u0444\u0438\u0437\u043c\u0438 \u2013 \u043c\u0430\u043b\u0430 \u0435\u043a\u0442\u0435\u043d\u0456\u044f \u0456 \u0441\u0456\u0434\u0430\u043b\u044c\u043d\u0456 \u000d\u000a\u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430\u043c. \u041f\u043e\u043b\u0456\u0454\u043b\u0435\u0439 \u0456 \u0441\u0456\u0434\u0430\u043b\u044c\u043d\u0456 \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430\u043c, \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f, \u0441\u0442\u0435\u043f\u0435\u043d\u043d\u0456 \u0430\u043d\u0442\u0438\u0444\u043e\u043d\u0438 4-\u0433\u043e \u0433\u043b\u0430\u0441\u0443, \u043f\u0440\u043e\u043a\u0438\u043c\u0435\u043d, \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454 \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430\u043c. \u041a\u0430\u043d\u043e\u043d \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430\u043c \u0437 \u0456\u0440\u043c\u043e\u0441\u043e\u043c \u043d\u0430 8, \u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f \u00ab\u0412\u0456\u0434\u043a\u0440\u0438\u044e \u0443\u0441\u0442\u0430 \u043c\u043e\u0457...\u00bb. \u0423 \u043f\u0456\u0441\u043d\u044f\u0445 \u0437 \u0442\u0440\u0438\u0441\u043f\u0456\u0441\u043d\u0446\u0435\u043c \u043a\u0430\u043d\u043e\u043d \u000d\u000a\u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430\u043c \u0437 \u0456\u0440\u043c\u043e\u0441\u043e\u043c \u043d\u0430 6 \u0456 \u0442\u0440\u0438\u043f\u0456\u0441\u043d\u0435\u0446\u044c \u0422\u0440\u0456\u043e\u0434\u0456 \u043d\u0430 8; \u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f \u2013 \u0456\u0440\u043c\u043e\u0441 2-\u0433\u043e \u000d\u000a\u0442\u0440\u0438\u043f\u0456\u0441\u043d\u0446\u044f. \u041f\u0456\u0441\u043b\u044f 3-\u043e\u0457 \u043f\u0456\u0441\u043d\u0456 \u0441\u0456\u0434\u0430\u043b\u044c\u043d\u0438\u0439 \u0456 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0447\u043d\u0438\u0439 \u0437 \u041c\u0456\u043d\u0435\u0457, \u043f\u0456\u0441\u043b\u044f 6-\u043e\u0457 \u000d\u000a\u043f\u0456\u0441\u043d\u0456 \u043a\u043e\u043d\u0434\u0430\u043a \u0442\u0430 \u0456\u043a\u043e\u0441 \u0437 \u041c\u0456\u043d\u0435\u0457. \u041f\u0456\u0441\u043b\u044f 9-\u043e\u0457 \u043f\u0456\u0441\u043d\u0456 \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u0432\u0435\u043b\u0438\u043a\u043e\u043f\u0456\u0441\u043d\u0438\u0445 \u0441\u0432\u0456\u0442\u0438\u043b\u044c\u043d\u0438\u0445 \u2013 \u0441\u0432\u0456\u0442\u0438\u043b\u044c\u043d\u0438\u0439 \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430\u043c (\u0434\u0432\u0456\u0447\u0456), \u00ab\u0421\u043b\u0430\u0432\u0430 \u0456 \u043d\u0438\u043d\u0456\u2026\u00bb \u2013 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0447\u043d\u0438\u0439. \u041d\u0430 \u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a9","21\u000d\u000a\u0445\u0432\u0430\u043b\u0456\u0442\u043d\u0438\u0445 \u0441\u0442\u0438\u0445\u0438\u0440\u0438 \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430\u043c \u043d\u0430 4, \u00ab\u0421\u043b\u0430\u0432\u0430...\u00bb \u2013 \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430\u043c, \u00ab\u0406 \u043d\u0438\u043d\u0456...\u00bb \u000d\u000a\u2013 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0447\u043d\u0438\u0439. \u0427\u0438\u0442\u0430\u0454\u0442\u044c\u0441\u044f \u043f\u043e\u0432\u0441\u044f\u043a\u0434\u0435\u043d\u043d\u0435 \u0441\u043b\u0430\u0432\u043e\u0441\u043b\u0456\u0432\u2019\u044f. \u041d\u0430 \u0441\u0442\u0438\u0445\u043e\u0432\u043d\u0456 \u0441\u0442\u0438\u0445\u0438\u0440\u0438 \u0437 \u0422\u0440\u0456\u043e\u0434\u0456 (\u0441\u0430\u043c\u043e\u0433\u043b\u0430\u0441\u043d\u0438\u0439 \u0434\u043d\u044f \u0434\u0432\u0456\u0447\u0456 \u0456 \u043c\u0443\u0447\u0435\u043d\u0438\u0447\u043d\u0438\u0439), \u00ab\u0421\u043b\u0430\u0432\u0430...\u00bb \u2013 \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430\u043c, \u00ab\u0406 \u043d\u0438\u043d\u0456...\u00bb \u2013 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0447\u043d\u0438\u0439. \u00ab\u0411\u043b\u0430\u0433\u043e \u0454\u2026\u00bb (\u043e\u0434\u0438\u043d \u0440\u0430\u0437), \u0442\u0440\u0438\u0441\u0432\u044f\u0442\u0435, \u000d\u000a\u0442\u0440\u043e\u043f\u0430\u0440 \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430\u043c, \u00ab\u0421\u043b\u0430\u0432\u0430 \u0456 \u043d\u0438\u043d\u0456\u2026\u00bb \u2013 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0447\u043d\u0438\u0439, \u043f\u043e\u0442\u0440\u0456\u0439\u043d\u0430 \u0435\u043a\u0442\u0435\u043d\u0456\u044f \u000d\u000a\u00ab\u041f\u043e\u043c\u0438\u043b\u0443\u0439 \u043d\u0430\u0441, \u0411\u043e\u0436\u0435...\u00bb, \u043c\u043e\u043b\u0438\u0442\u0432\u0430 \u043f\u0440\u043f. \u0404\u0444\u0440\u0435\u043c\u0430 \u0421\u0438\u0440\u0456\u043d\u0430 \u0437 \u0442\u0440\u044c\u043e\u043c\u0430 \u0432\u0435\u043b\u0438\u043a\u0438\u043c\u0438 \u043f\u043e\u043a\u043b\u043e\u043d\u0430\u043c\u0438, 1-\u0439 \u0447\u0430\u0441 \u0456 \u0432\u0456\u0434\u043f\u0443\u0441\u0442. \u041d\u0430 \u0432\u0441\u0456\u0445 \u0447\u0430\u0441\u0430\u0445 \u043a\u0430\u0444\u0438\u0437\u043c\u0438, \u0442\u0440\u043e\u043f\u0430\u0440 \u0456 \u000d\u000a\u043a\u043e\u043d\u0434\u0430\u043a \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430\u043c; \u0432 \u043a\u0456\u043d\u0446\u0456 \u043a\u043e\u0436\u043d\u043e\u0433\u043e \u0447\u0430\u0441\u0443 \u043c\u043e\u043b\u0438\u0442\u0432\u0430 \u043f\u0440\u043f. \u0404\u0444\u0440\u0435\u043c\u0430 \u0421\u0438\u0440\u0456\u043d\u0430 \u000d\u000a\u0437 \u0442\u0440\u044c\u043e\u043c\u0430 \u0432\u0435\u043b\u0438\u043a\u0438\u043c\u0438 \u043f\u043e\u043a\u043b\u043e\u043d\u0430\u043c\u0438. \u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456 \u043f\u0430\u0440\u0435\u043c\u0456\u044f. \u00ab\u0411\u043b\u0430\u0436\u0435\u043d\u043d\u0456\u00bb \u0447\u0438\u0442\u0430\u044e\u0442\u044c\u0441\u044f. \u041d\u0430 \u0432\u0435\u043b\u0438\u043a\u0456\u0439 \u0432\u0435\u0447\u0456\u0440\u043d\u0456 \u043f\u043e\u0447\u0430\u0442\u043e\u043a \u0442\u0430\u043a\u0438\u0439, \u044f\u043a \u043f\u0435\u0440\u0435\u0434 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0454\u044e \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432. \u041a\u0430\u0444\u0438\u0437\u043c\u0430 \u0447\u0435\u0440\u0433\u043e\u0432\u0430. \u041d\u0430 \u00ab\u0413\u043e\u0441\u043f\u043e\u0434\u0438, \u0432\u0437\u0438\u0432\u0430\u044e\u2026\u00bb \u0441\u0442\u0438\u0445\u0438\u0440\u0438 \u000d\u000a\u0437 \u0422\u0440\u0456\u043e\u0434\u0456 \u2013 6 \u0456 \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430\u043c \u2013 4, \u00ab\u0421\u043b\u0430\u0432\u0430...\u00bb \u2013 \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430\u043c, \u00ab\u0406 \u043d\u0438\u043d\u0456...\u00bb \u2013 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0447\u043d\u0438\u0439 \u0434\u043e\u0433\u043c\u0430\u0442\u0438\u043a. \u0412\u0445\u0456\u0434 \u0456\u0437 \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454\u043c. \u041f\u0430\u0440\u0435\u043c\u0456\u0457 \u0422\u0440\u0456\u043e\u0434\u0456, \u00ab\u041d\u0435\u0445\u0430\u0439 \u043f\u0456\u0434\u043d\u0435\u0441\u0435\u0442\u044c\u0441\u044f \u043c\u043e\u043b\u0438\u0442\u0432\u0430 \u043c\u043e\u044f\u2026\u00bb, \u043c\u043e\u043b\u0438\u0442\u0432\u0430 \u043f\u0440\u043f. \u0404\u0444\u0440\u0435\u043c\u0430 \u0421\u0438\u0440\u0456\u043d\u0430 \u0437 \u0442\u0440\u044c\u043e\u043c\u0430 \u0432\u0435\u043b\u0438\u043a\u0438\u043c\u0438 \u000d\u000a\u043f\u043e\u043a\u043b\u043e\u043d\u0430\u043c\u0438 \u0439 \u0432\u0456\u0434\u0440\u0430\u0437\u0443, \u0431\u0435\u0437 \u043c\u0430\u043b\u043e\u0457 \u0435\u043a\u0442\u0435\u043d\u0456\u0457, \u043f\u0440\u043e\u043a\u0438\u043c\u0435\u043d, \u0410\u043f\u043e\u0441\u0442\u043e\u043b, \u0430\u043b\u0438\u043b\u0443\u0430\u0440\u0456\u0439 \u0456 \u000d\u000a\u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454 \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430\u043c. \u0414\u0430\u043b\u0456 \u0437\u0432\u0438\u0447\u0430\u0439\u043d\u0435 \u043f\u043e\u0441\u043b\u0456\u0434\u0443\u0432\u0430\u043d\u043d\u044f \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432. \u041f\u0440\u0438\u0447\u0430\u0441\u043d\u0438\u0439 \u00ab\u0421\u043f\u043e\u0436\u0438\u0439\u0442\u0435...\u00bb \u0456 \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430\u043c.\u000d\u000a\u041c\u0447\u0447. \u041a\u043e\u0434\u0440\u0430\u0442\u0430 \u0442\u0430 \u0437 \u043d\u0438\u043c \u041a\u0438\u043f\u0440\u0456\u0430\u043d\u0430, \u0414\u0456\u043e\u043d\u0456\u0441\u0456\u044f, \u0410\u043d\u0435\u043a\u0442\u0430, \u041f\u0430\u0432\u043b\u0430, \u041a\u0440\u0438\u0441\u043a\u0435\u043d\u0442\u0430, \u0414\u0456\u043e\u043d\u0456\u0441\u0456\u044f (\u0456\u043d\u0448\u043e\u0433\u043e), \u0412\u0456\u043a\u0442\u043e\u0440\u0438\u043d\u0430, \u0412\u0456\u043a\u0442\u043e\u0440\u0430, \u041d\u0438\u043a\u0438\u0444\u043e\u0440\u0430, \u041a\u043b\u0430\u0432\u0434\u0456\u044f, \u0414\u0456\u043e\u0434\u043e\u0440\u0430, \u0421\u0435\u0440\u0430\u0444\u0456\u043e\u043d\u0430, \u041f\u0430\u043f\u0456\u044f, \u041b\u0435\u043e\u043d\u0456\u0434\u0430 \u0456 \u043c\u0446\u0446. \u0425\u0430\u0440\u0456\u0454\u0441\u0438, \u041d\u0443\u043d\u0435\u0445\u0456\u0457, \u0412\u0430\u0441\u0438\u043b\u0456\u0441\u0438, \u000d\u000a\u041d\u0456\u043a\u0438, \u0413\u0430\u043b\u0456, \u0413\u0430\u043b\u0438\u043d\u0438, \u0424\u0435\u043e\u0434\u043e\u0440\u0438 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 \u0431\u0430\u0433\u0430\u0442\u044c\u043e\u0445 (\u0431\u043b. 258). \u041c\u0447\u0447. \u041a\u043e\u0434\u0440\u0430\u0442\u0430 \u041d\u0456\u043a\u043e\u043c\u0438\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0421\u0430\u0442\u043e\u0440\u0438\u043d\u0430, \u0420\u0443\u0444\u0438\u043d\u0430 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 (\u0406\u0406\u0406). \u041f\u0440\u043f. \u0410\u043d\u0430\u0441\u0442\u0430\u0441\u0456\u0457 (567 \u2013 568).\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. IX, 9 \u2013 X, 4. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. VII, 1 \u2013 5. \u041f\u0440\u0438\u0442\u0447. VIII, 32 \u2013 IX, 11.\u000d\u000a\u0421\u0432\u0442. \u0421\u043e\u0444\u0440\u043e\u043d\u0456\u044f, \u043f\u0430\u0442\u0440. \u0404\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (639). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430 \u041c\u043e\u0441\u0445\u0430 \u000d\u000a(622). \u041f\u0440\u043f. \u0421\u043e\u0444\u0440\u043e\u043d\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u000d\u000a\u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406). \u0421\u0449\u043c\u0447. \u041f\u0456\u043e\u043d\u0456\u044f, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 \u0421\u043c\u0438\u0440\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u000d\u000a\u0442\u0430 \u0456\u043d\u0448\u0438\u0445 \u0437 \u043d\u0438\u043c (250). \u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u043c\u0447. \u0415\u043f\u0438\u043c\u0430\u0445\u0430. \u0421\u0432\u0442. \u0421\u043e\u0444\u0440\u043e\u043d\u0456\u044f, \u0454\u043f. \u0412\u0440\u0430\u0447\u0430\u043d\u0441\u044c\u043a\u043e\u0433\u043e (1813, \u0411\u043e\u043b\u0433.). \u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. X, 12 \u2013 20. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. VII, 6 \u2013 9. \u041f\u0440\u0438\u0442\u0447. IX, 12 \u2013 18.\u000d\u000a\u041f\u0440\u043f. \u0424\u0435\u043e\u0444\u0430\u043d\u0430, \u0441\u043f\u043e\u0432., \u0421\u0438\u0433\u0440\u0456\u0430\u043d\u0441\u044c\u043a\u043e\u0433\u043e (818). \u041f\u0440\u0430\u0432. \u0424\u0456\u043d\u0435\u0454\u0441\u0430 (\u0431\u043b. 1500 \u000d\u000a\u0440. \u0434\u043e \u0420. \u0425.). \u0421\u0432\u0442. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f \u0414\u0432\u043e\u0454\u0441\u043b\u043e\u0432\u0430, \u043f\u0430\u043f\u0438 \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (604). \u041f\u0440\u043f. \u0421\u0438\u043c\u0435\u043e\u043d\u0430 \u041d\u043e\u0432\u043e\u0433\u043e \u0411\u043e\u0433\u043e\u0441\u043b\u043e\u0432\u0430 (1021).\u000d\u000a\u041b\u0456\u0434\u0434\u0441\u044c\u043a\u043e\u0457 [\u043d\u0435\u0440\u0443\u043a\u043e\u0442\u0432\u043e\u0440\u043d\u043e\u0457] (\u0432 \u041b\u0456\u0434\u0434\u0456 \u043d\u0430 \u0441\u0442\u043e\u0432\u043f\u0456) \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (\u0406).\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. XI, 10 \u2013 XII, 2. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. VII, 11 \u2013 VIII, 3. \u041f\u0440\u0438\u0442\u0447. X, 1 \u2013 22.\u000d\u000a\u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u0441\u0432\u0442. \u041d\u0438\u043a\u0438\u0444\u043e\u0440\u0430, \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (846). \u041c\u0447. \u0421\u0430\u0432\u0438\u043d\u0430 (287). \u041c\u0447\u0447. \u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0430, \u041f\u0443\u0431\u043b\u0456\u044f \u0456 \u0422\u0435\u0440\u0435\u043d\u0442\u0456\u044f (\u0406\u0406\u0406). \u000d\u000a\u041c\u0447. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 (305 \u2013 311). \u041c\u0446. \u0425\u0440\u0438\u0441\u0442\u0438\u043d\u0438 \u041f\u0435\u0440\u0441\u044c\u043a\u043e\u0457 (\u0406V). \u041f\u0440\u043f. \u0410\u043d\u0456\u043d\u0430 \u000d\u000a\u0425\u0430\u043b\u043a\u0456\u0434\u043e\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430.\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. XIII, 2 \u2013 13. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. VIII, 4 \u2013 21. \u041f\u0440\u0438\u0442\u0447. X, 31 \u2013 XI, 12.\u000d\u000a10\u000d\u000a11\u000d\u000a12\u000d\u000a13\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f","22\u000d\u000a\u041f\u0440\u043f. \u0412\u0435\u043d\u0435\u0434\u0438\u043a\u0442\u0430 \u041d\u0443\u0440\u0441\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (543). \u0421\u0432\u0442. \u0424\u0435\u043e\u0433\u043d\u043e\u0441\u0442\u0430, \u043c\u0438\u0442\u0440. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0432\u0441\u0456\u0454\u0457 \u0420\u0443\u0441\u0438 (1353). \u0411\u043b\u0433\u0432. \u0432\u0435\u043b. \u043a\u043d. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0420\u043e\u0441\u0442\u0438\u0441\u043b\u0430\u0432\u0430, \u0443 \u0445\u0440\u0435\u0449\u0435\u043d\u043d\u0456 \u041c\u0438\u0445\u0430\u0457\u043b\u0430 (1167). \u0421\u0432\u0442. \u0404\u0432\u0441\u0445\u0438\u043c\u043e\u043d\u0430, \u0441\u043f\u043e\u0432., \u0454\u043f. \u041b\u0430\u043c\u043f\u0441\u0430\u043a\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0425). \u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 \u0417\u043e\u043b\u043e\u0442\u043e\u0443\u0441\u0442\u043e\u0433\u043e.\u000d\u000a\u041f\u043e\u043c\u0438\u043d\u0430\u043d\u043d\u044f \u043f\u043e\u043c\u0435\u0440\u043b\u0438\u0445.\u000d\u000a\u0417\u0430\u0443\u043f\u043e\u043a\u0456\u0439\u043d\u0435: 1 \u0421\u043e\u043b., 270 \u0437\u0430\u0447., IV, 13 \u2013 17. \u0406\u043d., 16 \u0437\u0430\u0447., V, 24 \u2013 30.\u000d\u000a\u0420\u044f\u0434.: \u0404\u0432\u0440., 325 \u0437\u0430\u0447., X, 32 \u2013 38. \u041c\u043a., 8 \u0437\u0430\u0447., II, 14 \u2013 17.\u000d\u000a\u041d\u0430 \u0432\u0435\u0447\u0456\u0440\u043d\u0456 \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u043f\u0440\u043e\u043a\u0438\u043c\u043d\u0430 \u0456 \u043d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0411\u043e\u0433 \u0413\u043e\u0441\u043f\u043e\u0434\u044c...\u00bb \u2013 \u000d\u000a\u00ab\u0410\u043b\u0438\u043b\u0443\u044f\u00bb. \u0412 \u0446\u044e \u0442\u0430 \u043d\u0430\u0441\u0442\u0443\u043f\u043d\u0443 \u0441\u0443\u0431\u043e\u0442\u0438 \u0437\u0430\u0443\u043f\u043e\u043a\u0456\u0439\u043d\u0430 \u0441\u043b\u0443\u0436\u0431\u0430 \u0437\u0430 \u0422\u0440\u0456\u043e\u0434\u0434\u044e \u043f\u043e\u0454\u0434\u043d\u0443\u0454\u0442\u044c\u0441\u044f \u0437\u0456 \u0441\u043b\u0443\u0436\u0431\u043e\u044e \u041c\u0456\u043d\u0435\u0457 \u0442\u0430 \u041e\u043a\u0442\u043e\u0457\u0445\u0430.\u000d\u000a4-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443. \u0410\u043f. \u0410\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u043b\u0430, \u0454\u043f. \u0412\u0440\u0438\u0442\u0430\u043d\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(\u0411\u0440\u0438\u0442\u0430\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u0406). \u041c\u0447. \u0421\u0430\u0432\u0438\u043d\u0430 (287). \u041c\u0447. \u041f\u0430\u043f\u0438 (305 \u2013 311). \u0421\u0449\u043c\u0447.\u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430, \u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0430 \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (119). \u041c\u0447. \u042e\u043b\u0456\u0430\u043d\u0430 \u0410\u043d\u0430\u0437\u0430\u0432\u0440\u0441\u044c\u043a\u043e\u0433\u043e (305 \u2013 \u000d\u000a311). \u0421\u0449\u043c\u0447\u0447. \u0422\u0440\u043e\u0444\u0438\u043c\u0430 \u0456 \u0424\u0430\u043b\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0456\u0432 \u041b\u0430\u043e\u0434\u0438\u043a\u0456\u0439\u0441\u044c\u043a\u0438\u0445 (\u0431\u043b. 300).\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. XIV, 24 \u2013 32. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. VIII, 21 \u2013 IX, 7. \u041f\u0440\u0438\u0442\u0447. XI, 19 \u2013 \u000d\u000aXII, 6.\u000d\u000a\u041d\u0430 1-\u043c\u0443 \u0447\u0430\u0441\u0456 \u043f\u043e\u043a\u043b\u043e\u043d\u0456\u043d\u043d\u044f \u0425\u0440\u0435\u0441\u0442\u0443. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0421\u0442\u043e\u043f\u0438 \u043c\u043e\u0457...\u00bb \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u000d\u000a\u00ab\u0425\u0440\u0435\u0441\u0442\u0443 \u0422\u0432\u043e\u0454\u043c\u0443...\u00bb \u0456 \u0441\u0442\u0438\u0445\u0438\u0440\u0438 \u043d\u0430 \u0446\u0456\u043b\u0443\u0432\u0430\u043d\u043d\u044f \u0425\u0440\u0435\u0441\u0442\u0430 (\u044f\u043a \u0443 \u043d\u0435\u0434\u0456\u043b\u044e \u0445\u0440\u0435\u0441\u0442\u043e\u043f\u043e\u043a\u043b\u043e\u043d\u043d\u0443). \u041f\u043e\u0434\u0456\u0431\u043d\u0438\u043c \u0447\u0438\u043d\u043e\u043c \u043f\u043e\u043a\u043b\u043e\u043d\u0456\u043d\u043d\u044f \u0425\u0440\u0435\u0441\u0442\u0443 \u043d\u0430 1-\u043c\u0443 \u0447\u0430\u0441\u0456 \u0431\u0443\u0434\u0435 \u0432 \u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0443. \u041d\u0430 \u0432\u0441\u0456\u0445 \u0447\u0430\u0441\u0430\u0445 \u0442\u0430 \u0437\u043e\u0431\u0440\u0430\u0436\u0430\u043b\u044c\u043d\u0438\u0445 \u0443 \u0434\u043d\u0456 \u0446\u044c\u043e\u0433\u043e \u0442\u0438\u0436\u043d\u044f \u043f\u0456\u0441\u043b\u044f \u00ab\u041e\u0442\u0447\u0435 \u000d\u000a\u043d\u0430\u0448\u2026\u00bb \u2013 \u043a\u043e\u043d\u0434\u0430\u043a \u00ab\u0417\u0431\u0440\u043e\u044f \u0432\u043e\u0433\u043d\u0435\u043d\u043d\u0430...\u00bb.\u000d\u000a\u041f\u0440\u043f. \u041e\u043b\u0435\u043a\u0441\u0456\u044f, \u043b\u044e\u0434\u0438\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 (411). \u0421\u0432\u0442. \u041f\u0430\u0442\u0440\u0438\u043a\u0456\u044f, \u043f\u0440\u043e\u0441\u0432\u0456\u0442\u0438\u0442\u0435\u043b\u044f \u000d\u000a\u0406\u0440\u043b\u0430\u043d\u0434\u0456\u0457 (\u043f\u0456\u0441\u043b\u044f 460). \u041c\u0447. \u041c\u0430\u0440\u0438\u043d\u0430.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. XXV, 1 \u2013 9. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. IX, 8 \u2013 17. \u041f\u0440\u0438\u0442\u0447. XII, 8 \u2013 22.\u000d\u000a\u0421\u0432\u0442. \u041a\u0438\u0440\u0438\u043b\u0430, \u0430\u0440\u0445\u0456\u0454\u043f. \u0404\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (386). \u041c\u0447\u0447. \u0422\u0440\u043e\u0444\u0438\u043c\u0430 \u0456 \u0404\u0432\u043a\u0430\u0440\u043f\u0456\u044f \u000d\u000a(\u0431\u043b. 300). \u041f\u0440\u043f. \u0410\u043d\u0456\u043d\u0430, \u0447\u0435\u043d\u0446\u044f. \u0411\u043b\u0433\u0432. \u0456 \u043c\u0447. \u0415\u0434\u0443\u0430\u0440\u0434\u0430, \u043a\u043e\u0440\u043e\u043b\u044f \u0410\u043d\u0433\u043b\u0456\u0457 (978/979)\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. XXVI, 21 \u2013 XXVII, 9. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. IX, 18 \u2013 X, 1. \u041f\u0440\u0438\u0442\u0447. XII, \u000d\u000a23 \u2013 XIII, 9.\u000d\u000a\u041d\u0430 1-\u043c\u0443 \u0447\u0430\u0441\u0456 \u043f\u043e\u043a\u043b\u043e\u043d\u0456\u043d\u043d\u044f \u0425\u0440\u0435\u0441\u0442\u0443.\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a14\u000d\u000a16\u000d\u000a17\u000d\u000a18\u000d\u000a3-\u0442\u044f \u043d\u0435\u0434\u0456\u043b\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443, \u0425\u0440\u0435\u0441\u0442\u043e\u043f\u043e\u043a\u043b\u043e\u043d\u043d\u0430. \u0413\u043b\u0430\u0441 7-\u0439.\u000d\u000a\u041c\u0447. \u0410\u0433\u0430\u043f\u0456\u044f \u0442\u0430 \u0437 \u043d\u0438\u043c \u0441\u0435\u043c\u0438 \u043c\u0447\u0447.: \u041f\u0443\u0431\u043b\u0456\u044f, \u0422\u0438\u043c\u043e\u043b\u0430\u044f, \u0420\u043e\u043c\u0438\u043b\u0430, \u0434\u0432\u043e\u0445 \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0432 \u0442\u0430 \u0434\u0432\u043e\u0445 \u0414\u0456\u043e\u043d\u0456\u0441\u0456\u0457\u0432 (303). \u0421\u0449\u043c\u0447. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 \u0432 \u0421\u0438\u0434\u0456 \u000d\u000a(270 \u2013 275). \u041c\u0447. \u041d\u0438\u043a\u0430\u043d\u0434\u0440\u0430 (\u0431\u043b. 302).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e.\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 7-\u0435, \u0406\u043d., 63 \u0437\u0430\u0447., XX, 1 \u2013 10.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0404\u0432\u0440., 311 \u0437\u0430\u0447., IV, 14 \u2013 V, 6. \u041c\u043a., 37 \u0437\u0430\u0447., VIII, 34 \u2013 IX, 1.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u043f\u043e\u043b\u0456\u0454\u043b\u0435\u0439 \u0437\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f \u0443 \u0432\u0456\u0432\u0442\u0430\u0440\u0456. \u041f\u0456\u0441\u043b\u044f \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u0441\u043b\u0430\u0432\u043e\u0441\u043b\u0456\u0432\u2019\u044f \u000d\u000a\u0432\u0438\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u0425\u0440\u0435\u0441\u0442\u0430 \u0456 \u043f\u043e\u043a\u043b\u043e\u043d\u0456\u043d\u043d\u044f \u0439\u043e\u043c\u0443. \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0430\u043d\u0442\u0438\u0444\u043e\u043d\u0438 \u0441\u0432\u044f\u0442\u043a\u043e\u0432\u0456 \u000d\u000a(\u0434\u0438\u0432. \u0443 \u0434\u043e\u0434\u0430\u0442\u043a\u0443 \u0441. 87), \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u0422\u0440\u0438\u0441\u0432\u044f\u0442\u043e\u0433\u043e \u2013 \u00ab\u0425\u0440\u0435\u0441\u0442\u0443 \u0422\u0432\u043e\u0454\u043c\u0443...\u00bb. \u000d\u000a\u0423 \u0446\u0435\u0439 \u0434\u0435\u043d\u044c \u043d\u0430 \u043b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0437\u0430\u0433\u043e\u0442\u043e\u0432\u043b\u044e\u044e\u0442\u044c\u0441\u044f \u0434\u0432\u0430 \u0410\u0433\u043d\u0446\u0456 \u0434\u043b\u044f \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0439 \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432 \u0443 \u0441\u0435\u0440\u0435\u0434\u0443 \u0456 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a15","23\u000d\u000a\u041c\u0447. \u0425\u0440\u0438\u0441\u0430\u043d\u0444\u0430 \u0456 \u043c\u0446. \u0414\u0430\u0440\u0456\u0457 (283) \u0456 \u0437 \u043d\u0438\u043c\u0438 \u043c\u0447\u0447. \u041a\u043b\u0430\u0432\u0434\u0456\u044f, \u0442\u0440\u0438\u0431\u0443\u043d\u0430, \u0406\u043b\u0430\u0440\u0456\u0457, \u000d\u000a\u0434\u0440\u0443\u0436\u0438\u043d\u0438 \u0439\u043e\u0433\u043e, \u042f\u0441\u043e\u043d\u0430 \u0456 \u041c\u0430\u0432\u0440\u0430, \u0441\u0438\u043d\u0456\u0432 \u0457\u0445\u043d\u0456\u0445, \u0441\u0449\u043c\u0447\u0447. \u0414\u0456\u043e\u0434\u043e\u0440\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u0456 \u041c\u0430\u0440\u2019\u044f\u043d\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0430. \u041c\u0447. \u041f\u0430\u043d\u0445\u0430\u0440\u0456\u044f (\u0431\u043b. 302).\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. XXVIII, 14 \u2013 22. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. X, 32 \u2013 XI, 9. \u041f\u0440\u0438\u0442\u0447. XIII, \u000d\u000a20 \u2013 XIV, 6.\u000d\u000a\u041f\u0440\u043c\u0447\u0447. \u0406\u043e\u0430\u043d\u0430, \u0421\u0435\u0440\u0433\u0456\u044f, \u041f\u0430\u0442\u0440\u0438\u043a\u0456\u044f \u0442\u0430 \u0456\u043d\u0448\u0438\u0445, \u044f\u043a\u0456 \u0432 \u043e\u0431\u0438\u0442\u0435\u043b\u0456 \u0441\u0432. \u0421\u0430\u0432\u0438 \u0431\u0443\u043b\u0438 \u000d\u000a\u0432\u0431\u0438\u0442\u0456 (796). \u041c\u0446. \u0424\u043e\u0442\u0438\u043d\u0438 (\u0421\u0432\u0456\u0442\u043b\u0430\u043d\u0438), \u0441\u0430\u043c\u0430\u0440\u044f\u043d\u043a\u0438, \u0457\u0457 \u0441\u0438\u043d\u0456\u0432 \u043c\u0447\u0447. \u0412\u0456\u043a\u0442\u043e\u0440\u0430, \u000d\u000a\u043d\u0430\u0437\u0432\u0430\u043d\u043e\u0433\u043e \u0424\u043e\u0442\u0438\u043d\u043e\u043c, \u0442\u0430 \u0406\u043e\u0441\u0456\u0457 (\u0406). \u041c\u0446\u0446. \u0410\u043d\u0430\u0442\u043e\u043b\u0456\u0457, \u0424\u043e\u0442\u043e, \u0424\u043e\u0442\u0438\u0434\u0438, \u041f\u0430\u0440\u0430\u0441\u043a\u0435\u0432\u0438, \u041a\u0438\u0440\u0456\u0430\u043a\u0456\u0457, \u0414\u043e\u043c\u043d\u0456\u043d\u0438 \u0456 \u043c\u0447. \u0421\u0435\u0432\u0430\u0441\u0442\u0456\u0430\u043d\u0430 (\u0431\u043b. 66). \u041c\u0446\u0446. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0438, \u041a\u043b\u0430\u0432\u0434\u0456\u0457, \u0404\u0432\u0444\u0440\u0430\u0441\u0456\u0457, \u041c\u043e\u0442\u0440\u043e\u043d\u0438, \u042e\u043b\u0456\u0430\u043d\u0456\u0457, \u0404\u0432\u0444\u0438\u043c\u0456\u0457 \u0456 \u0424\u0435\u043e\u0434\u043e\u0441\u0456\u0457 (310). \u000d\u000a\u0421\u0432\u0442. \u041c\u0438\u043a\u0438\u0442\u0438, \u0441\u043f\u043e\u0432., \u0430\u0440\u0445\u0456\u0454\u043f. \u0410\u043f\u043e\u043b\u043e\u043d\u0456\u0430\u0434\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 813 \u2013 820).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. XXIX, 13 \u2013 23. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. XII, 1 \u2013 7. \u041f\u0440\u0438\u0442\u0447. XIV, 15 \u2013 26.\u000d\u000a\u041f\u0456\u0441\u043b\u044f \u0437\u043e\u0431\u0440\u0430\u0436\u0430\u043b\u044c\u043d\u0438\u0445 \u0437\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f \u043f\u043e\u043a\u043b\u043e\u043d\u0456\u043d\u043d\u044f \u0425\u0440\u0435\u0441\u0442\u0443. \u041f\u0456\u0441\u043b\u044f \u043a\u0430\u0434\u0456\u043d\u043d\u044f \u000d\u000a\u0442\u0440\u0438\u0447\u0456 \u043d\u0430\u0432\u043a\u043e\u043b\u043e \u0430\u043d\u0430\u043b\u043e\u044f \u2013 \u0425\u0440\u0435\u0441\u0442, \u043f\u0440\u0438 \u0441\u043f\u0456\u0432\u0456 \u0442\u0440\u043e\u043f\u0430\u0440\u044f \u0456 \u043a\u043e\u043d\u0434\u0430\u043a\u0430, \u0447\u0435\u0440\u0435\u0437 \u0426\u0430\u0440\u0441\u044c\u043a\u0456 \u0432\u0440\u0430\u0442\u0430 \u0432\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u0443 \u0432\u0456\u0432\u0442\u0430\u0440.\u000d\u000a\u041f\u0440\u043f. \u042f\u043a\u043e\u0432\u0430, \u0454\u043f. \u041a\u0430\u0442\u0430\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u0441\u043f\u043e\u0432. (V\u0406\u0406\u0406). \u0421\u0432\u0442. \u041a\u0438\u0440\u0438\u043b\u0430, \u0454\u043f. \u041a\u0430\u0442\u0430\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(\u0406 \u2013 \u0406\u0406). \u0421\u0432\u0442. \u0424\u043e\u043c\u0438, \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (610).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 \u0417\u043e\u043b\u043e\u0442\u043e\u0443\u0441\u0442\u043e\u0433\u043e.\u000d\u000a\u041f\u043e\u043c\u0438\u043d\u0430\u043d\u043d\u044f \u043f\u043e\u043c\u0435\u0440\u043b\u0438\u0445.\u000d\u000a\u0417\u0430\u0443\u043f\u043e\u043a\u0456\u0439\u043d\u0435: 1 \u041a\u043e\u0440., 163 \u0437\u0430\u0447., \u0425V, 47 \u2013 57. \u0406\u043d., 16 \u0437\u0430\u0447., V, 24 \u2013 30.\u000d\u000a\u0420\u044f\u0434.: \u0404\u0432\u0440., 313 \u0437\u0430\u0447., VI, 9 \u2013 12. \u041c\u043a., 31 \u0437\u0430\u0447., VII, 31 \u2013 37.\u000d\u000a\u041d\u0430 \u0432\u0435\u0447\u0456\u0440\u043d\u0456 \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u043f\u0440\u043e\u043a\u0438\u043c\u043d\u0430 \u0456 \u043d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0411\u043e\u0433 \u0413\u043e\u0441\u043f\u043e\u0434\u044c...\u00bb \u2013 \u000d\u000a\u00ab\u0410\u043b\u0438\u043b\u0443\u044f\u00bb. \u0412 \u0446\u044e \u0441\u0443\u0431\u043e\u0442\u0443 \u0437\u0430\u0443\u043f\u043e\u043a\u0456\u0439\u043d\u0430 \u0441\u043b\u0443\u0436\u0431\u0430 \u0437\u0430 \u0422\u0440\u0456\u043e\u0434\u0434\u044e \u043f\u043e\u0454\u0434\u043d\u0443\u0454\u0442\u044c\u0441\u044f \u0437\u0456 \u000d\u000a\u0441\u043b\u0443\u0436\u0431\u043e\u044e \u041c\u0456\u043d\u0435\u0457 \u0442\u0430 \u041e\u043a\u0442\u043e\u0457\u0445\u0430.\u000d\u000a5-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443. \u041f\u0440\u043c\u0447. \u041d\u0438\u043a\u043e\u043d\u0430 \u0421\u0438\u0446\u0438\u043b\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0454\u043f., \u000d\u000a\u0456 \u043c\u0447\u0447. 199 \u0443\u0447\u043d\u0456\u0432 \u0439\u043e\u0433\u043e (251). \u041f\u0440\u043f. \u041d\u0438\u043a\u043e\u043d\u0430, \u0456\u0433\u0443\u043c\u0435\u043d\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e (1088). \u041c\u0447\u0447. \u0424\u0456\u043b\u0438\u0442\u0430, \u041b\u0456\u0434\u0456\u0457, \u0434\u0440\u0443\u0436\u0438\u043d\u0438 \u0439\u043e\u0433\u043e, \u041c\u0430\u043a\u0435\u0434\u043e\u043d\u0430, \u0424\u0435\u043e\u043f\u0440\u0435\u043f\u0456\u044f, \u041a\u0440\u043e\u043d\u0456\u0434\u0430 \u0456 \u0410\u043c\u0444\u0456\u043b\u043e\u0445\u0456\u044f (117 \u2013 138).\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. XXXVII, 33 \u2013 XXXVIII, 6. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. XIII, 12 \u2013 18. \u041f\u0440\u0438\u0442\u0447. \u000d\u000aXIV, 27 \u2013 XV, 4.\u000d\u000a19\u000d\u000a20\u000d\u000a21\u000d\u000a23\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a4-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443. \u0413\u043b\u0430\u0441 8-\u0439.\u000d\u000a\u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430 \u041b\u0456\u0441\u0442\u0432\u0438\u0447\u043d\u0438\u043a\u0430 (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 4-\u0442\u0443 \u043d\u0435\u0434\u0456\u043b\u044e \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443). \u0421\u0449\u043c\u0447. \u0412\u0430\u0441\u0438\u043b\u0456\u044f, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 \u0410\u043d\u043a\u0438\u0440\u0441\u044c\u043a\u043e\u0433\u043e (362 \u2013 363). \u000d\u000a\u041c\u0446. \u0414\u0440\u043e\u0441\u0438\u0434\u0438, \u0434\u043e\u0447\u043a\u0438 \u0446\u0430\u0440\u044f \u0422\u0440\u0430\u044f\u043d\u0430 (104 \u2013 117). \u041f\u0440\u043f. \u0406\u0441\u0430\u0430\u043a\u0456\u044f \u0414\u0430\u043b\u043c\u0430\u0442\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e.\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 8-\u0435, \u0406\u043d., 64 \u0437\u0430\u0447., XX, 11 \u2013 18.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0404\u0432\u0440., 314 \u0437\u0430\u0447., VI, 13 \u2013 20. \u041c\u043a., 40 \u0437\u0430\u0447., IX, 17 \u2013 31.\u000d\u000a\u041f\u0440\u043f.: \u0415\u0444., 229 \u0437\u0430\u0447., V, 8 \u2013 19. \u041c\u0444., 10 \u0437\u0430\u0447., IV, 25 \u2013 V, 12.\u000d\u000a\u0423 \u0446\u0435\u0439 \u0434\u0435\u043d\u044c \u043d\u0430 \u043b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0437\u0430\u0433\u043e\u0442\u043e\u0432\u043b\u044e\u0454\u0442\u044c\u0441\u044f \u0410\u0433\u043d\u0435\u0446\u044c \u0434\u043b\u044f \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432 \u0443 \u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a22","24\u000d\u000a\u041d\u0430 \u0432\u0435\u0447\u0456\u0440\u043d\u0456 \u043d\u0430 \u00ab\u0413\u043e\u0441\u043f\u043e\u0434\u0438 \u0432\u0437\u0438\u0432\u0430\u044e\u00bb \u0434\u043e\u0434\u0430\u044e\u0442\u044c\u0441\u044f 24 \u043f\u043e\u043a\u0430\u044f\u043d\u043d\u0456 \u0441\u0442\u0438\u0445\u0438\u0440\u0438 \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043a\u0430\u043d\u043e\u043d\u0443. \u0422\u0430\u043a\u043e\u0436 \u0443 \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a \u0434\u043e\u0434\u0430\u0454\u043c\u043e \u0441\u043b\u0443\u0436\u0431\u0443 \u043f\u0435\u0440\u0435\u0434\u0441\u0432\u044f\u0442\u0430 \u0411\u043b\u0430\u0433\u043e\u0432\u0456\u0449\u0435\u043d\u043d\u044f \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456.\u000d\u000a\u041f\u0435\u0440\u0435\u0434\u0441\u0432\u044f\u0442\u043e \u0411\u043b\u0430\u0433\u043e\u0432\u0456\u0449\u0435\u043d\u043d\u044f \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456. \u041f\u0440\u043f. \u0417\u0430\u0445\u0430\u0440\u0456\u0457, \u0447\u0435\u043d\u0446\u044f. \u0421\u0432\u0442. \u0410\u0440\u0442\u0435\u043c\u0456\u044f (\u0410\u0440\u0442\u0435\u043c\u043e\u043d\u0430), \u0454\u043f. \u0421\u043e\u043b\u0443\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0421\u0435\u043b\u0435\u0432\u043a\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0406 \u2013 \u0406\u0406). \u000d\u000a\u041f\u0440\u043f. \u0417\u0430\u0445\u0430\u0440\u0456\u0457, \u043f\u043e\u0441\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 \u000d\u000a(\u0425\u0406\u0406\u0406 \u2013 \u0425\u0406V). \u041f\u0440\u043f. \u042f\u043a\u043e\u0432\u0430, \u0454\u043f. \u041a\u0430\u0442\u0430\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u0441\u043f\u043e\u0432. (V\u0406\u0406\u0406 \u2013 \u0406\u0425).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. XL, 18 \u2013 31. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. XV, 1 \u2013 15. \u041f\u0440\u0438\u0442\u0447. XV, 7 \u2013 19.\u000d\u000a\u0411\u043b\u0430\u0433\u043e\u0432\u0456\u0449\u0435\u043d\u043d\u044f: \u0411\u0443\u0442. \u0425XV\u0406\u0406\u0406, 10 \u2013 17; \u0404\u0437\u0435\u043a. XL\u0406\u0406\u0406, 27 \u2013 44; \u041f\u0440\u0438\u0442\u0447. I\u0425, 1 \u2013 11.\u000d\u000a\u0417\u0430\u0443\u0432\u0430\u0436\u0435\u043d\u043d\u044f \u0422\u0438\u043f\u0456\u043a\u043e\u043d\u0443 \u0441\u0442\u043e\u0441\u043e\u0432\u043d\u043e \u0437\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u044f \u0441\u043b\u0443\u0436\u0431\u0438 \u043f\u0435\u0440\u0435\u0434\u0441\u0432\u044f\u0442\u0430 \u000d\u000a\u0411\u043b\u0430\u0433\u043e\u0432\u0456\u0449\u0435\u043d\u043d\u044f: \u00ab\u2026\u044f\u043a\u0449\u043e \u0442\u0440\u0430\u043f\u0438\u0442\u044c\u0441\u044f \u0441\u0432\u044f\u0442\u043e \u0411\u043b\u0430\u0433\u043e\u0432\u0456\u0449\u0435\u043d\u043d\u044f \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456 \u0443 \u0441\u0435\u0440\u0435\u0434\u0443 5-\u0433\u043e \u0442\u0438\u0436\u043d\u044f \u043f\u043e\u0441\u0442\u0443, \u0442\u043e \u0441\u043b\u0443\u0436\u0431\u0443 \u043f\u0435\u0440\u0435\u0434\u0441\u0432\u044f\u0442\u0430 \u0411\u043b\u0430\u0433\u043e\u0432\u0456\u0449\u0435\u043d\u043d\u044f (\u0441\u0442\u0438\u0445\u0438\u0440\u0438, \u043a\u0430\u043d\u043e\u043d) \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0443 \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a \u043d\u0430 \u0440\u044f\u0434\u0443; \u0441\u043b\u0443\u0436\u0431\u0443 \u0441\u0432\u044f\u0442\u043e\u0433\u043e \u000d\u000a\u041c\u0456\u043d\u0435\u0457 \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u043d\u0430 \u043f\u043e\u0432\u0435\u0447\u0456\u0440\u2019\u0457. \u0412\u0435\u043b\u0438\u043a\u0438\u0439 \u041a\u0430\u043d\u043e\u043d \u0437 \u0440\u0430\u043d\u043d\u044c\u043e\u0457 \u0447\u0435\u0442\u0432\u0435\u0440\u0433\u0430 \u043f\u0435\u0440\u0435\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u043d\u0430 \u0440\u0430\u043d\u043d\u044e \u0432\u0456\u0432\u0442\u043e\u0440\u043a\u0430\u00bb.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0447\u0438\u0442\u0430\u043d\u043d\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u043a\u0430\u044f\u043d\u043d\u043e\u0433\u043e \u043a\u0430\u043d\u043e\u043d\u0443 \u043f\u0440\u043f. \u0410\u043d\u0434\u0440\u0456\u044f \u041a\u0440\u0438\u0442\u0441\u044c\u043a\u043e\u0433\u043e (\u00ab\u041c\u0430\u0440\u0456\u0457\u043d\u0435 \u0441\u0442\u043e\u044f\u043d\u043d\u044f\u00bb) \u0456\u0437 \u0442\u0440\u0438\u043f\u0456\u0441\u043d\u0446\u0435\u043c \u0432\u0456\u0432\u0442\u043e\u0440\u043a\u0430. \u0427\u0438\u0442\u0430\u0454\u0442\u044c\u0441\u044f \u0436\u0438\u0442\u0456\u0454 \u000d\u000a\u043f\u0440\u043f. \u041c\u0430\u0440\u0456\u0457 \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0457. 1-\u0448\u0430 \u0447\u0430\u0441\u0442\u0438\u043d\u0430 \u2013 \u043f\u0456\u0441\u043b\u044f \u043a\u0430\u0444\u0438\u0437\u043c\u0438 \u0456 \u0441\u0456\u0434\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u000d\u000a(\u043f\u0435\u0440\u0435\u0434 50-\u043c \u043f\u0441\u0430\u043b\u043c\u043e\u043c), 2-\u0433\u0430 \u0447\u0430\u0441\u0442\u0438\u043d\u0430 \u2013 \u043f\u0456\u0441\u043b\u044f 3-\u0457 \u043f\u0456\u0441\u043d\u0456 \u043a\u0430\u043d\u043e\u043d\u0443. \u0417\u0430\u043a\u0456\u043d\u0447\u0435\u043d\u043d\u044f \u0440\u0430\u043d\u043d\u044c\u043e\u0457 \u0437\u0432\u0438\u0447\u0430\u0439\u043d\u0435, \u0432\u0435\u043b\u0438\u043a\u043e\u043f\u043e\u0441\u0442\u043e\u0432\u0435. 1-\u0439 \u0447\u0430\u0441 \u0431\u0435\u0437 \u043a\u0430\u0444\u0438\u0437\u043c\u0438. \u0423 \u043a\u0456\u043d\u0446\u0456 \u000d\u000a\u0440\u0430\u043d\u043d\u044c\u043e\u0457 \u0456 \u043a\u043e\u0436\u043d\u043e\u0433\u043e \u0447\u0430\u0441\u0443 \u043c\u043e\u043b\u0438\u0442\u0432\u0430 \u0404\u0444\u0440\u0435\u043c\u0430 \u0421\u0438\u0440\u0456\u043d\u0430 \u0437 \u0442\u0440\u044c\u043e\u043c\u0430 \u0432\u0435\u043b\u0438\u043a\u0438\u043c\u0438 \u000d\u000a\u043f\u043e\u043a\u043b\u043e\u043d\u0430\u043c\u0438.\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a24\u000d\u000a\u0411\u041b\u0410\u0413\u041e\u0412\u0406\u0429\u0415\u041d\u041d\u042f \u041f\u0420\u0415\u0421\u0412\u042f\u0422\u041e\u0407 \u0412\u041b\u0410\u0414\u0418\u0427\u0418\u0426\u0406 \u041d\u0410\u0428\u041e\u0407 \u0411\u041e\u0413\u041e\u0420\u041e\u0414\u0418\u0426\u0406 \u000d\u000a\u0406 \u041f\u0420\u0418\u0421\u041d\u041e\u0414\u0406\u0412\u0418 \u041c\u0410\u0420\u0406\u0407.\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043b\u0430\u0433\u043e\u0432\u0456\u0449\u0435\u043d\u043d\u044f \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (\u0425V\u0406).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 \u0417\u043e\u043b\u043e\u0442\u043e\u0443\u0441\u0442\u043e\u0433\u043e.\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 4 \u0437\u0430\u0447., I, 39 \u2013 49, 56.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. XLI, 4 \u2013 14. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. XVII, 1 \u2013 9. \u041f\u0440\u0438\u0442\u0447. XV, 20 \u2013 XVI, 9.\u000d\u000a\u0411\u043b\u0430\u0433\u043e\u0432\u0456\u0449\u0435\u043d\u043d\u044f: \u0412\u0438\u0445. III, 1 \u2013 8. \u041f\u0440\u0438\u0442\u0447. VIII, 22 \u2013 30.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0404\u0432\u0440., 306 \u0437\u0430\u0447., II, 11 \u2013 18. \u041b\u043a., 3 \u0437\u0430\u0447., I, 24 \u2013 38.\u000d\u000a\u041d\u0430 \u0442\u0440\u0430\u043f\u0435\u0437\u0456 \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454\u0442\u044c\u0441\u044f \u0440\u0438\u0431\u0430.\u000d\u000a\u0412\u0441\u0435\u043d\u0456\u0447\u043d\u0430 \u043f\u043e\u0447\u0438\u043d\u0430\u0454\u0442\u044c\u0441\u044f \u0437 \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0432\u0435\u0447\u0456\u0440\u2019\u044f. \u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u043d\u0430 \u00ab\u0411\u043e\u0433 \u0413\u043e\u0441\u043f\u043e\u0434\u044c\u00bb \u0442\u0440\u043e\u043f\u0430\u0440 \u0441\u0432\u044f\u0442\u0430 \u0442\u0440\u0438\u0447\u0456. \u041f\u043e\u043b\u0456\u0454\u043b\u0435\u0439, \u0441\u0456\u0434\u0430\u043b\u044c\u043d\u0438\u0439 \u0441\u0432\u044f\u0442\u0430, \u0441\u0442\u0435\u043f\u0435\u043d\u043d\u0456 \u2013 1-\u0439 \u000d\u000a\u0430\u043d\u0442\u0438\u0444\u043e\u043d 4 \u0433\u043b\u0430\u0441\u0443 \u0456 \u0434\u0430\u043b\u0456 \u0432\u0441\u0435 \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u044f\u0442\u0430. \u0412\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0430: \u00ab\u0410\u0440\u0445\u0430\u043d\u0433\u0435\u043b\u044c\u0441\u044c\u043a\u0438\u0439 \u0433\u043b\u0430\u0441 \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456, \u0427\u0438\u0441\u0442\u0430\u044f: \u201c\u0420\u0430\u0434\u0443\u0439\u0441\u044f, \u0411\u043b\u0430\u0433\u043e\u0434\u0430\u0442\u043d\u0430, \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u0437 \u0422\u043e\u0431\u043e\u044e\u201d\u00bb. \u0423 \u043a\u0430\u043d\u043e\u043d\u0456 \u043d\u0430 \u0442\u0440\u0435\u0442\u0456\u0439, \u0432\u043e\u0441\u044c\u043c\u0456\u0439 \u0456 \u0434\u0435\u0432\u2019\u044f\u0442\u0456\u0439 \u000d\u000a\u043f\u0456\u0441\u043d\u044f\u0445 \u043f\u0456\u0441\u043b\u044f \u043a\u0430\u043d\u043e\u043d\u0443 \u0441\u0432\u044f\u0442\u0430 \u0442\u0440\u0438\u043f\u0456\u0441\u043d\u0435\u0446\u044c \u0422\u0440\u0456\u043e\u0434\u0456 \u0456 \u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f \u0422\u0440\u0456\u043e\u0434\u0456. \u0412\u0435\u043b\u0438\u043a\u0435 \u000d\u000a\u0421\u043b\u0430\u0432\u043e\u0441\u043b\u0456\u0432'\u044f \u0447\u0438\u0442\u0430\u0454\u0442\u044c\u0441\u044f. \u041f\u0456\u0441\u043b\u044f \u0441\u043b\u0430\u0432\u043e\u0441\u043b\u0456\u0432\u2019\u044f \u0435\u043a\u0442\u0435\u043d\u0456\u044f \u00ab\u0414\u043e\u043f\u043e\u0432\u043d\u0438\u043c\u043e \u0440\u0430\u043d\u043d\u044e \u000d\u000a\u043c\u043e\u043b\u0438\u0442\u0432\u0443\u00bb, \u0434\u0430\u043b\u0456 \u0441\u0442\u0438\u0445\u0438\u0440\u0438 \u0441\u0442\u0438\u0445\u043e\u0432\u043d\u0456, \u0447\u0438\u0442\u0430\u0454\u0442\u044c\u0441\u044f \u00ab\u0411\u043b\u0430\u0433\u043e \u0454\u00bb \u043e\u0434\u0438\u043d \u0440\u0430\u0437, \u0422\u0440\u0438\u0441\u0432\u044f\u0442\u0435 \u0434\u043e \u041e\u0442\u0447\u0435 \u043d\u0430\u0448, \u0442\u0440\u043e\u043f\u0430\u0440 \u0441\u0432\u044f\u0442\u0430, \u0435\u043a\u0442\u0435\u043d\u0456\u044f \u00ab\u041f\u043e\u043c\u0438\u043b\u0443\u0439 \u043d\u0430\u0441 \u0411\u043e\u0436\u0435\u00bb, \u00ab\u041f\u0440\u0435\u043c\u0443\u0434\u0440\u0456\u0441\u0442\u044c\u00bb, \u0445\u043e\u0440: \u00ab\u0411\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0438\u00bb, \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0438\u043a: \u00ab\u0421\u0443\u0449\u0438\u0439 \u0431\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0435\u043d\u043d\u0438\u0439\u2026\u00bb, \u000d\u000a\u0445\u043e\u0440 \u00ab\u0410\u043c\u0456\u043d\u044c\u00bb, \u0447\u0438\u0442\u0435\u0446\u044c: \u00ab\u041d\u0435\u0431\u0435\u0441\u043d\u0438\u0439 \u0426\u0430\u0440\u044e\u2026\u00bb, \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0438\u043a \u0447\u0438\u0442\u0430\u0454 \u043c\u043e\u043b\u0438\u0442\u0432\u0443 \u000d\u000a\u043f\u0440\u043f. \u0404\u0444\u0440\u0435\u043c\u0430 \u0421\u0438\u0440\u0456\u043d\u0430 \u0437 \u0442\u0440\u044c\u043e\u043c\u0430 \u043f\u043e\u043a\u043b\u043e\u043d\u0430\u043c\u0438 \u0456 \u0432\u0456\u0434\u0440\u0430\u0437\u0443 \u043f\u0435\u0440\u0448\u0438\u0439 \u0447\u0430\u0441. \u041d\u0430\u043f\u0440\u0438\u043a\u0456\u043d\u0446\u0456 1-\u0433\u043e \u0447\u0430\u0441\u0443 \u2013 \u043c\u043e\u043b\u0438\u0442\u0432\u0430 \u043f\u0440\u043f. \u0404\u0444\u0440\u0435\u043c\u0430 \u0421\u0438\u0440\u0456\u043d\u0430 \u0437 \u0442\u0440\u044c\u043e\u043c\u0430 \u0432\u0435\u043b\u0438\u043a\u0438\u043c\u0438 \u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a25","25\u000d\u000a\u043f\u043e\u043a\u043b\u043e\u043d\u0430\u043c\u0438 \u0456 \u0432\u0456\u0434\u043f\u0443\u0441\u0442. 3-\u0439, 6-\u0439, 9-\u0439 \u0447\u0430\u0441\u0438 \u0437 \u043a\u0430\u0444\u0438\u0437\u043c\u0430\u043c\u0438, \u0430\u043b\u0435 \u0431\u0435\u0437 \u043f\u043e\u043a\u043b\u043e\u043d\u0456\u0432. \u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456 \u043f\u0430\u0440\u0435\u043c\u0456\u044f. \u041d\u0430 \u0437\u043e\u0431\u0440\u0430\u0436\u0430\u043b\u044c\u043d\u0438\u0445 \u00ab\u0411\u043b\u0430\u0436\u0435\u043d\u043d\u0456\u2026\u00bb \u0447\u0438\u0442\u0430\u044e\u0442\u044c\u0441\u044f, \u000d\u000a\u043f\u0456\u0441\u043b\u044f \u00ab\u041e\u0442\u0447\u0435 \u043d\u0430\u0448\u2026\u00bb \u2013 \u043a\u043e\u043d\u0434\u0430\u043a \u0441\u0432\u044f\u0442\u0430, \u0432 \u043a\u0456\u043d\u0446\u0456 \u0437\u043e\u0431\u0440\u0430\u0436\u0430\u043b\u044c\u043d\u0438\u0445 \u2013 \u043c\u043e\u043b\u0438\u0442\u0432\u0430 \u000d\u000a\u043f\u0440\u043f. \u0404\u0444\u0440\u0435\u043c\u0430 \u0421\u0438\u0440\u0456\u043d\u0430 \u0437 \u0442\u0440\u044c\u043e\u043c\u0430 \u0432\u0435\u043b\u0438\u043a\u0438\u043c\u0438 \u043f\u043e\u043a\u043b\u043e\u043d\u0430\u043c\u0438 \u0456 \u0432\u0456\u0434\u043f\u0443\u0441\u0442. \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u043f\u043e\u0447\u0438\u043d\u0430\u0454\u0442\u044c\u0441\u044f \u0437 \u0432\u0435\u0447\u0456\u0440\u043d\u0456. \u0412\u0445\u0456\u0434 \u0437 \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454\u043c. \u041f\u0430\u0440\u0435\u043c\u0456\u0457 \u0422\u0440\u0456\u043e\u0434\u0456 \u2013 2 \u000d\u000a\u0456 \u0441\u0432\u044f\u0442\u0430 \u2013 2. \u041c\u0430\u043b\u0430 \u0435\u043a\u0442\u0435\u043d\u0456\u044f, \u0432\u0438\u0433\u043e\u043b\u043e\u0441 \u00ab\u0411\u043e \u0422\u0438 \u0421\u0432\u044f\u0442\u0438\u0439...\u00bb, \u0442\u0440\u0438\u0441\u0432\u044f\u0442\u0435, \u0434\u0430\u043b\u0456 \u000d\u000a\u2013 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 \u0417\u043e\u043b\u043e\u0442\u043e\u0443\u0441\u0442\u043e\u0433\u043e. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0414\u043e\u0441\u0442\u043e\u0439\u043d\u043e \u0454\u2026\u00bb \u000d\u000a\u2013 \u00ab\u0411\u043b\u0430\u0433\u043e\u0432\u0456\u0441\u0442\u0438, \u0437\u0435\u043c\u043b\u0435... \u042f\u043a \u0434\u043e \u043e\u0434\u0443\u0445\u043e\u0442\u0432\u043e\u0440\u0435\u043d\u043e\u0433\u043e \u0411\u043e\u0436\u043e\u0433\u043e \u043a\u0438\u0432\u043e\u0442\u0443...\u00bb. \u000d\u000a\u0423 \u0446\u0435\u0439 \u0434\u0435\u043d\u044c \u043d\u0430 \u043b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0437\u0430\u0433\u043e\u0442\u043e\u0432\u043b\u044e\u0454\u0442\u044c\u0441\u044f \u0410\u0433\u043d\u0435\u0446\u044c \u0434\u043b\u044f \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432 \u0443 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e.\u000d\u000a\u0427\u0435\u0442\u0432\u0435\u0440 \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043a\u0430\u043d\u043e\u043d\u0443. \u0421\u043e\u0431\u043e\u0440 \u0430\u0440\u0445\u0430\u043d\u0433\u0435\u043b\u0430 \u0413\u0430\u0432\u0440\u0438\u0457\u043b\u0430. \u0412\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0430 \u0411\u043b\u0430\u0433\u043e\u0432\u0456\u0449\u0435\u043d\u043d\u044f \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456. \u0421\u0449\u043c\u0447. \u0406\u0440\u0438\u043d\u0435\u044f, \u000d\u000a\u0454\u043f. \u0421\u0438\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (304). \u041c\u0447\u0447. \u0412\u0430\u0444\u0443\u0441\u0456\u044f \u0456 \u0412\u0435\u0440\u043a\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0456\u0432, \u0410\u0440\u043f\u0438\u043b\u0438, \u000d\u000a\u0447\u0435\u043d\u0446\u044f, \u0410\u0432\u0456\u0432\u0430, \u0410\u0433\u043d\u0430, \u0420\u0435\u0430\u0441\u0430, \u0406\u0433\u0430\u0444\u0440\u0430\u043a\u0441\u0430, \u0406\u0441\u043a\u043e\u044f, \u0421\u0438\u043b\u0438, \u0421\u0438\u0433\u0456\u0446\u044f, \u0421\u043e\u043d\u0438\u0440\u0438\u043b\u0430, \u0421\u0443\u0457\u043c\u0432\u043b\u0430, \u0424\u0435\u0440\u043c\u0430, \u0424\u0456\u043b\u0430 \u0442\u0430 \u043c\u0446\u0446. \u0410\u043d\u043d\u0438, \u0410\u043b\u043b\u0438, \u041b\u0430\u0440\u0438\u0441\u0438, \u041c\u043e\u0457\u043a\u043e, \u041c\u0430\u043c\u0456\u043a\u0438, \u0423\u0457\u0440\u043a\u043e, \u0410\u043d\u0456\u043c\u0430\u0457\u0441\u0438 (\u0410\u043d\u0456\u043c\u0430\u0457\u0434\u0438), \u0413\u0430\u0430\u0444\u0438, \u0446\u0430\u0440\u0438\u0446\u0456 \u0413\u043e\u0442\u0441\u044c\u043a\u043e\u0457, \u0456 \u0414\u0443\u043a\u043b\u0456\u0434\u0438 (\u0431\u043b. \u000d\u000a375). \u041f\u0440\u043f. \u041c\u0430\u043b\u0445\u0430 \u0421\u0438\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u041f\u0440\u043f. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u041d\u043e\u0432\u043e\u0433\u043e, \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 944).\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. XLII, 5 \u2013 16. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. XVIII, 20 \u2013 33. \u041f\u0440\u0438\u0442\u0447. XVI, 17 \u000d\u000a\u2013 XVII, 17.\u000d\u000a\u0427\u0438\u0442\u0430\u043d\u043d\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u043a\u0430\u044f\u043d\u043d\u043e\u0433\u043e \u043a\u0430\u043d\u043e\u043d\u0443 \u043f\u0440\u043f. \u0410\u043d\u0434\u0440\u0456\u044f \u041a\u0440\u0438\u0442\u0441\u044c\u043a\u043e\u0433\u043e \u043f\u0435\u0440\u0435\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u043d\u0430 \u0440\u0430\u043d\u043d\u044e \u0432\u0456\u0432\u0442\u043e\u0440\u043a\u0430 (\u0443 \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a \u0432\u0432\u0435\u0447\u0435\u0440\u0456).\u000d\u000a\u041c\u0446. \u041c\u043e\u0442\u0440\u043e\u043d\u0438 \u0421\u043e\u043b\u0443\u043d\u0441\u044c\u043a\u043e\u0457 (\u0406\u0406\u0406 \u2013 \u0406V). \u041c\u0447\u0447. \u041c\u0430\u043d\u0443\u0457\u043b\u0430 \u0456 \u0424\u0435\u043e\u0434\u043e\u0441\u0456\u044f (304). \u000d\u000a\u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430, \u043f\u0440\u043e\u0437\u043e\u0440\u043b\u0438\u0432\u043e\u0433\u043e, \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 395).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. XLV, 11 \u2013 17. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. XXII, 1 \u2013 18. \u041f\u0440\u0438\u0442\u0447. XVII, 17 \u000d\u000a\u2013 XVIII, 5.\u000d\u000a\u041f\u043e\u0445\u0432\u0430\u043b\u0430 \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456 (\u0441\u0443\u0431\u043e\u0442\u0430 \u0430\u043a\u0430\u0444\u0456\u0441\u0442\u0443). \u041f\u0440\u043f. \u0406\u043b\u0430\u0440\u0456\u043e\u043d\u0430 \u041d\u043e\u0432\u043e\u0433\u043e, \u0456\u0433\u0443\u043c. \u041f\u0435\u043b\u0456\u043a\u0456\u0442\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 754). \u041f\u0440\u043f. \u0421\u0442\u0435\u0444\u0430\u043d\u0430 \u0427\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f, \u000d\u000a\u0441\u043f\u043e\u0432., \u0456\u0433\u0443\u043c. \u0422\u0440\u0438\u0433\u043b\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 815). \u041c\u0447\u0447. \u0406\u043e\u043d\u0438, \u0412\u0430\u0440\u0430\u0445\u0438\u0441\u0456\u044f \u0442\u0430 \u0456\u043d. \u0437 \u043d\u0438\u043c\u0438 \u000d\u000a(\u0431\u043b. 330). \u041c\u0447. \u0411\u043e\u044f\u043d\u0430, \u043a\u043d. \u0411\u043e\u043b\u0433\u0430\u0440\u0441\u044c\u043a\u043e\u0433\u043e (830). \u041f\u0440\u043c\u0447. \u0404\u0432\u0441\u0442\u0440\u0430\u0442\u0456\u044f \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (1097).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 \u0417\u043e\u043b\u043e\u0442\u043e\u0443\u0441\u0442\u043e\u0433\u043e.\u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456: \u0404\u0432\u0440., 320 \u0437\u0430\u0447., IX, 1 \u2013 7. \u041b\u043a., 54 \u0437\u0430\u0447., X, 38 \u2013 42; XI, 27 \u2013 28.\u000d\u000a\u0420\u044f\u0434.: \u0404\u0432\u0440., 322 \u0437\u0430\u0447., IX, 24 \u2013 28. \u041c\u043a., 35 \u0437\u0430\u0447., VIII, 27 \u2013 31.\u000d\u000a\u0421\u043b\u0443\u0436\u0431\u0430 \u0437 \u0422\u0440\u0456\u043e\u0434\u0456. \u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u043f\u0456\u0441\u043b\u044f 1-\u043e\u0457 \u0442\u0430 2-\u043e\u0457 \u043a\u0430\u0444\u0438\u0437\u043c \u0456 \u043f\u0456\u0441\u043b\u044f 3-\u043e\u0457 \u0442\u0430 \u000d\u000a6-\u043e\u0457 \u043f\u0456\u0441\u0435\u043d\u044c \u043a\u0430\u043d\u043e\u043d\u0443 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0430\u043a\u0430\u0444\u0456\u0441\u0442 \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u0456\u0439 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456. \u0421\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0432\u0435\u043b\u0438\u043a\u0435 \u0441\u043b\u0430\u0432\u043e\u0441\u043b\u0456\u0432\u2019\u044f.\u000d\u000a26\u000d\u000a27\u000d\u000a28\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a5-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443. \u0413\u043b\u0430\u0441 1-\u0439.\u000d\u000a\u041f\u0440\u043f. \u041c\u0430\u0440\u0456\u0457 \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0457 (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 5-\u0442\u0443 \u043d\u0435\u0434\u0456\u043b\u044e \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443). \u0421\u0449\u043c\u0447\u0447. \u041c\u0430\u0440\u043a\u0430, \u0454\u043f. \u0410\u0440\u0435\u0444\u0443\u0441\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u041a\u0438\u0440\u0438\u043b\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0430, \u0442\u0430 \u000d\u000a\u0456\u043d\u0448\u0438\u0445 \u0431\u0430\u0433\u0430\u0442\u044c\u043e\u0445 (\u0431\u043b. 364). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430, \u043f\u0443\u0441\u0442\u0435\u043b\u044c\u043d\u0438\u043a\u0430 (\u0406V). \u0421\u0432\u0442. \u0404\u0432\u0441\u0442\u0430\u0444\u0456\u044f, \u0441\u043f\u043e\u0432., \u0454\u043f. \u0412\u0438\u0444\u0438\u043d\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0425).\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a29","26\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e.\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 9-\u0435, \u0406\u043d., 65 \u0437\u0430\u0447., XX, 19 \u2013 31.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0404\u0432\u0440., 321 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), IX, 11 \u2013 14. \u041c\u043a., 47 \u0437\u0430\u0447., X, 32 \u2013 45.\u000d\u000a\u041f\u0440\u043f.: \u0413\u0430\u043b., 208 \u0437\u0430\u0447., III, 23 \u2013 29. \u041b\u043a., 33 \u0437\u0430\u0447., VII, 36 \u2013 50.\u000d\u000a\u0423 \u0446\u0435\u0439 \u0434\u0435\u043d\u044c \u043d\u0430 \u043b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0437\u0430\u0433\u043e\u0442\u043e\u0432\u043b\u044e\u044e\u0442\u044c\u0441\u044f \u0434\u0432\u0430 \u0410\u0433\u043d\u0446\u0456 \u0434\u043b\u044f \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0439 \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432 \u0443 \u0441\u0435\u0440\u0435\u0434\u0443 \u0456 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e.\u000d\u000a6-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443 (\u0432\u0435\u0440\u0431\u043d\u0438\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430 \u041b\u0456\u0441\u0442\u0432\u0438\u0447\u043d\u0438\u043a\u0430 (649). \u041f\u0440\u043e\u0440. \u0406\u043e\u0430\u0434\u0430 (\u0425 \u0441\u0442. \u0434\u043e \u0420. \u0425.). \u0410\u043f\u043f. \u0421\u043e\u0441\u0444\u0435\u043d\u0430, \u0410\u043f\u043e\u043b\u043e\u0441\u0430, \u000d\u000a\u041a\u0438\u0444\u0438, \u041a\u0435\u0441\u0430\u0440\u044f \u0456 \u0415\u043f\u0430\u0444\u0440\u043e\u0434\u0438\u0442\u0430. \u0421\u0432. \u0404\u0432\u0443\u043b\u0438, \u043c\u0430\u0442\u0435\u0440\u0456 \u0432\u043c\u0447. \u041f\u0430\u043d\u0442\u0435\u043b\u0435\u0439\u043c\u043e\u043d\u0430 \u000d\u000a(\u0431\u043b. 303). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430, \u0431\u0435\u0437\u043c\u043e\u0432\u043d\u0438\u043a\u0430 (V\u0406). \u041f\u0440\u043f. \u0417\u043e\u0441\u0438\u043c\u0438, \u0454\u043f. \u0421\u0438\u0440\u0430\u043a\u0443\u0437\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 662). \u0421\u0432\u0442. \u0421\u043e\u0444\u0440\u043e\u043d\u0456\u044f (\u041a\u0440\u0438\u0448\u0442\u0430\u043b\u0435\u0432\u0441\u044c\u043a\u043e\u0433\u043e), \u0454\u043f. \u0406\u0440\u043a\u0443\u0442\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(1771).\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. XLVIII, 17 \u2013 XLIX, 4. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. XXVII, 1 \u2013 41. \u041f\u0440\u0438\u0442\u0447. XIX, \u000d\u000a16 \u2013 25.\u000d\u000a\u0421\u0449\u043c\u0447. \u0406\u043f\u0430\u0442\u0456\u044f, \u0454\u043f. \u0413\u0430\u043d\u0433\u0440\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 326). \u041f\u0440\u043f. \u0406\u043f\u0430\u0442\u0456\u044f, \u0446\u0456\u043b\u0438\u0442\u0435\u043b\u044f \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406V). \u041f\u0440\u043f. \u0410\u043f\u043e\u043b\u043e\u043d\u0456\u044f \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u0421\u0449\u043c\u0447\u0447. \u0410\u0432\u0434\u0438, \u0454\u043f. \u041f\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u0412\u0435\u043d\u0456\u0430\u043c\u0456\u043d\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0430 (418 \u2013 \u000d\u000a424). \u041f\u0440\u043f. \u0406\u043f\u0430\u0442\u0456\u044f, \u0456\u0433\u0443\u043c\u0435\u043d\u0430 \u0432 \u0420\u0443\u0444\u0456\u044f\u043d\u0430\u0445 (\u0431\u043b. 446). \u041f\u0440\u043c\u0446. \u041c\u0430\u0440\u0456\u0457 \u041f\u0430\u0440\u0438\u0437\u044c\u043a\u043e\u0457 \u000d\u000a(1945).\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. XLIX, 6 \u2013 10. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. XXXI, 3 \u2013 16. \u041f\u0440\u0438\u0442\u0447. XXI, 3 \u2013 21.\u000d\u000a\u041f\u0440\u043f. \u0422\u0438\u0442\u0430, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (\u0406\u0425). \u041c\u0447\u0447. \u0410\u043c\u0444\u0456\u0430\u043d\u0430 \u0456 \u0415\u0434\u0435\u0441\u0456\u044f (306). \u041c\u0447. \u041f\u043e\u043b\u0456\u043a\u0430\u0440\u043f\u0430 \u000d\u000a\u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u0421\u0432\u0442. \u0421\u0430\u0432\u0438, \u0430\u0440\u0445\u0456\u0454\u043f. \u0421\u0443\u0440\u043e\u0437\u044c\u043a\u043e\u0433\u043e (\u0425\u0406\u0406).\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. LXV, 8 \u2013 16. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. XLVI, 1 \u2013 7. \u041f\u0440\u0438\u0442\u0447. XXIII, 15 \u2013 \u000d\u000aXXIV, 5.\u000d\u000a\u041f\u0440\u043f. \u041c\u0438\u043a\u0438\u0442\u0438, \u0441\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u043a\u0430, \u0456\u0433\u0443\u043c. \u043e\u0431\u0438\u0442\u0435\u043b\u0456 \u041c\u0438\u0434\u0438\u043a\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (824). \u041c\u0446. \u0424\u0435\u043e\u0434\u043e\u0441\u0456\u0457, \u0434\u0456\u0432\u0438 (307 \u2013 308). \u041f\u0440\u043f. \u0406\u043b\u0456\u0440\u0438\u043a\u0430. \u041c\u0447\u0447. \u0415\u043b\u043f\u0456\u0434\u043e\u0444\u043e\u0440\u0430, \u0414\u0456\u044f, \u0412\u0456\u0444\u043e\u043d\u0456\u044f \u0456 \u000d\u000a\u0413\u0430\u043b\u0438\u043a\u0430.\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u041d\u0435\u0432\u2019\u044f\u043d\u0443\u0447\u0438\u0439 \u0446\u0432\u0456\u0442\u00bb.\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. XLVI, 10 \u2013 24. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. XLIX, 33 \u2013 L, 26. \u041f\u0440\u0438\u0442\u0447. XXXI, \u000d\u000a8 \u2013 32.\u000d\u000a\u041f\u0440\u043f. \u041c\u0430\u0440\u0456\u0457 \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0457 (522). \u041f\u0440\u043f. \u0413\u0435\u0440\u043e\u043d\u0442\u0456\u044f, \u043a\u0430\u043d\u043e\u043d\u0430\u0440\u0445\u0430 \u041a\u0438\u0454\u0432\u043e\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406V). \u041f\u0440\u043f. \u041c\u0430\u043a\u0430\u0440\u0456\u044f, \u0456\u0433\u0443\u043c\u0435\u043d\u0430 \u041f\u0435\u043b\u0456\u043a\u0438\u0442\u0441\u044c\u043a\u043e\u0457 \u043e\u0431\u0438\u0442\u0435\u043b\u0456 (\u0431\u043b. 830). \u041c\u0447\u0447. \u0413\u0435\u0440\u043e\u043d\u0442\u0456\u044f \u0456 \u0412\u0430\u0441\u0438\u043b\u0456\u0434\u0430 (\u0406\u0406\u0406). \u041f\u0440\u0430\u0432. \u0410\u0445\u0430\u0437\u0430.\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0406\u0441. LVIII, 1 \u2013 11. \u041d\u0430 \u0432\u0435\u0447.: \u0411\u0443\u0442. XLIII, 26 \u2013 31; XLV, 1 \u2013 16. \u000d\u000a\u041f\u0440\u0438\u0442\u0447. XXI, 23 \u2013 XXII, 4.\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a30\u000d\u000a31\u000d\u000a2\u000d\u000a3\u000d\u000a1","27\u000d\u000a\u041b\u0430\u0437\u0430\u0440\u0435\u0432\u0430 \u0441\u0443\u0431\u043e\u0442\u0430. \u0412\u043e\u0441\u043a\u0440\u0435\u0448\u0435\u043d\u043d\u044f \u043f\u0440\u0430\u0432. \u041b\u0430\u0437\u0430\u0440\u044f. \u041f\u0440\u043f. \u0419\u043e\u0441\u0438\u0444\u0430 \u000d\u000a\u041f\u0456\u0441\u043d\u0435\u043f\u0438\u0441\u0446\u044f (883). \u041f\u0440\u043f. \u0413\u0435\u043e\u0440\u0433\u0456\u044f, \u0449\u043e \u0432 \u041c\u0430\u043b\u0435\u0457 (\u0406\u0425). \u041f\u0440\u043f. \u0419\u043e\u0441\u0438\u0444\u0430 \u0411\u0430\u0433\u0430\u0442\u043e\u0445\u0432\u043e\u0440\u043e\u0431\u043b\u0438\u0432\u043e\u0433\u043e, \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 \u000d\u000a(\u0425\u0406V). \u041f\u0440\u043f. \u0417\u043e\u0441\u0438\u043c\u0438 (\u0431\u043b. 560). \u041c\u0446\u0446. \u0424\u0435\u0440\u0432\u0443\u0444\u0438, \u0434\u0456\u0432\u0438, \u0441\u0435\u0441\u0442\u0440\u0438 \u0442\u0430 \u0440\u0430\u0431\u0438\u043d\u0456 \u000d\u000a\u0457\u0457 (341 \u2013 343).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456, \u0437\u0432\u0430\u043d\u043e\u0457 \u00ab\u0413\u0435\u0440\u043e\u043d\u0434\u0438\u0441\u0430\u00bb.\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 \u0417\u043e\u043b\u043e\u0442\u043e\u0443\u0441\u0442\u043e\u0433\u043e.\u000d\u000a\u0404\u0432\u0440., 333 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), XII, 28 \u2013 XIII, 8. \u0406\u043d., 39 \u0437\u0430\u0447., XI, 1 \u2013 45.\u000d\u000a\u041d\u0430 \u0442\u0440\u0430\u043f\u0435\u0437\u0456 \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454\u0442\u044c\u0441\u044f \u0432\u0436\u0438\u0432\u0430\u043d\u043d\u044f \u0440\u0438\u0431\u043d\u043e\u0457 \u0456\u043a\u0440\u0438.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u043f\u0456\u0441\u043b\u044f 2-\u0457 \u043a\u0430\u0444\u0438\u0437\u043c\u0438 \u2013 \u00ab\u0410\u043d\u0433\u0435\u043b\u044c\u0441\u044c\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440...\u00bb (\u0437\u0434\u0456\u0439\u0441\u043d\u044e\u0454\u0442\u044c\u0441\u044f \u000d\u000a\u043a\u0430\u0434\u0456\u043d\u043d\u044f \u0432\u0441\u044c\u043e\u0433\u043e \u0445\u0440\u0430\u043c\u0443), \u043c\u0430\u043b\u0430 \u0435\u043a\u0442\u0435\u043d\u0456\u044f, \u0441\u0456\u0434\u0430\u043b\u044c\u043d\u0438\u0439 (\u0434\u0432\u0456\u0447\u0456), \u00ab\u0412\u043e\u0441\u043a\u0440\u0435\u0441\u0456\u043d\u043d\u044f \u000d\u000a\u0425\u0440\u0438\u0441\u0442\u043e\u0432\u0435 \u0431\u0430\u0447\u0438\u0432\u0448\u0438\u2026\u00bb. \u041d\u0430 9-\u0439 \u043f\u0456\u0441\u043d\u0456 \u00ab\u0427\u0435\u0441\u043d\u0456\u0448\u0443...\u00bb \u043d\u0435 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0434\u043e \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043a\u0430 \u043f\u0456\u0441\u043b\u044f \u0424\u043e\u043c\u0438\u043d\u043e\u0457 \u043d\u0435\u0434\u0456\u043b\u0456. \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u043f\u0456\u0441\u043b\u044f \u0432\u0445\u043e\u0434\u0443 \u00ab\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u000d\u000a\u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, \u0443 \u0441\u0432\u044f\u0442\u0438\u0445 \u0434\u0438\u0432\u043d\u0438\u0439 \u0422\u0438...\u00bb. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u0442\u0440\u0438\u0441\u0432\u044f\u0442\u043e\u0433\u043e \u2013 \u00ab\u0412\u0441\u0456 \u0432\u0438, \u000d\u000a\u0449\u043e \u0432 \u0425\u0440\u0438\u0441\u0442\u0430 \u0445\u0440\u0435\u0441\u0442\u0438\u043b\u0438\u0441\u044f\u2026\u00bb. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0414\u043e\u0441\u0442\u043e\u0439\u043d\u043e \u0454\u2026\u00bb \u2013 \u0456\u0440\u043c\u043e\u0441 9-\u0457 \u043f\u0456\u0441\u043d\u0456 \u000d\u000a\u043a\u0430\u043d\u043e\u043d\u0443 \u00ab\u0427\u0438\u0441\u0442\u0443 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u044e...\u00bb. \u0412\u0456\u0434\u043f\u0443\u0441\u0442 \u0440\u0430\u043d\u043d\u044c\u043e\u0457 \u0456 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u2013 \u00ab\u0425\u0440\u0438\u0441\u0442\u043e\u0441, \u000d\u000a\u0456\u0441\u0442\u0438\u043d\u043d\u0438\u0439 \u0411\u043e\u0433 \u043d\u0430\u0448...\u00bb \u0437\u0456 \u0437\u0433\u0430\u0434\u0443\u0432\u0430\u043d\u043d\u044f\u043c \u0456\u043c\u0435\u043d\u0456 \u0441\u0432\u044f\u0442\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u0435\u0434\u043d\u043e\u0433\u043e \u041b\u0430\u0437\u0430\u0440\u044f. \u0417 \u0446\u044c\u043e\u0433\u043e \u0434\u043d\u044f \u041c\u0456\u043d\u0435\u044f \u043d\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0454\u0442\u044c\u0441\u044f \u0434\u043e \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043a\u0430 \u0424\u043e\u043c\u0438\u043d\u043e\u0433\u043e \u000d\u000a\u0442\u0438\u0436\u043d\u044f, \u043a\u0440\u0456\u043c \u0441\u043b\u0443\u0436\u0431 \u0432\u0435\u043b\u0438\u043a\u0438\u043c \u0441\u0432\u044f\u0442\u0438\u043c.\u000d\u000a4\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a6-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443, \u0432\u0430\u0457\u0439, \u0446\u0432\u0456\u0442\u043e\u043d\u043e\u0441\u043d\u0430, \u0432\u0435\u0440\u0431\u043d\u0430.\u000d\u000a\u0412\u0425\u0406\u0414 \u0413\u041e\u0421\u041f\u041e\u0414\u041d\u0406\u0419 \u0412 \u0404\u0420\u0423\u0421\u0410\u041b\u0418\u041c.\u000d\u000a\u0421\u0449\u043c\u0447. \u0410\u0433\u0430\u0444\u043e\u043f\u043e\u0434\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0430, \u043c\u0447\u0447. \u0424\u0435\u043e\u0434\u0443\u043b\u0430, \u0447\u0438\u0442\u0446\u044f, \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 \u0437 \u043d\u0438\u043c\u0438 \u000d\u000a(\u0431\u043b. 303). \u041f\u0440\u043f. \u041f\u0443\u043f\u043b\u0456\u044f \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u041f\u0440\u043f\u043f. \u0424\u0435\u043e\u043d\u0438, \u0421\u0438\u043c\u0435\u043e\u043d\u0430 \u000d\u000a\u0456 \u0424\u043e\u0440\u0432\u0438\u043d\u0430 (\u0406V). \u041f\u0440\u043f. \u041c\u0430\u0440\u043a\u0430 \u0410\u0444\u0456\u043d\u0441\u044c\u043a\u043e\u0433\u043e (400). \u041f\u0440\u043f. \u041f\u043b\u0430\u0442\u043e\u043d\u0430, \u0441\u043f\u043e\u0432., \u000d\u000a\u0421\u0442\u0443\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (814). \u041f\u0440\u043f. \u0424\u0435\u043e\u0434\u043e\u0440\u0438 \u0421\u043e\u043b\u0443\u043d\u0441\u044c\u043a\u043e\u0457 (892).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 \u0417\u043e\u043b\u043e\u0442\u043e\u0443\u0441\u0442\u043e\u0433\u043e.\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u0444., 83 \u0437\u0430\u0447., XXI, 1 \u2013 11, 15 \u2013 17.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0424\u043b\u043f., 247 \u0437\u0430\u0447., IV, 4 \u2013 9. \u0406\u043d., 41 \u0437\u0430\u0447., XII, 1 \u2013 18.\u000d\u000a\u041d\u0430 \u0442\u0440\u0430\u043f\u0435\u0437\u0456 \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454\u0442\u044c\u0441\u044f \u0457\u0441\u0442\u0438 \u0440\u0438\u0431\u0443.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0422\u0435\u0431\u0435, \u0416\u0438\u0442\u0442\u0454\u0434\u0430\u0432\u0447\u0435 \u0425\u0440\u0438\u0441\u0442\u0435, \u043e\u0441\u0430\u043d\u043d\u0430 \u000d\u000a\u0443 \u0432\u0438\u0448\u043d\u0456\u0445 \u0456 \u043c\u0438 \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: \u0411\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0435\u043d\u043d\u0438\u0439, \u0425\u0442\u043e \u0439\u0434\u0435 \u0432 \u0456\u043c\u2019\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0454\u00bb. \u041f\u0456\u0441\u043b\u044f \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u044f \u0432\u0456\u0434\u0440\u0430\u0437\u0443 \u0447\u0438\u0442\u0430\u0454\u0442\u044c\u0441\u044f 50-\u0439 \u043f\u0441\u0430\u043b\u043e\u043c (\u0432 \u0446\u0435\u0439 \u0447\u0430\u0441 \u043a\u0430\u0434\u0438\u043c\u043e \u0432\u0435\u0440\u0431\u0443), \u043f\u043e\u0442\u0456\u043c \u0447\u0438\u0442\u0430\u0454\u043c\u043e \u043c\u043e\u043b\u0438\u0442\u0432\u0443 \u043d\u0430 \u043e\u0441\u0432\u044f\u0447\u0435\u043d\u043d\u044f \u0432\u0435\u0440\u0431\u0438, \u0456 \u043e\u043a\u0440\u043e\u043f\u043b\u044e\u0454\u043c\u043e \u000d\u000a\u0457\u0457 \u0441\u0432\u044f\u0442\u043e\u044e \u0432\u043e\u0434\u043e\u044e. \u00ab\u0427\u0435\u0441\u043d\u0456\u0448\u0443\u2026\u00bb \u043d\u0435 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f. \u041f\u0456\u0441\u043b\u044f \u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u0457 9-\u043e\u0457 \u043f\u0456\u0441\u043d\u0456 \u043c\u0430\u043b\u0430 \u0435\u043a\u0442\u0435\u043d\u0456\u044f \u0456 \u0432\u0456\u0434\u0440\u0430\u0437\u0443 \u0432\u0438\u0433\u043e\u043b\u043e\u0448\u0443\u0454\u043c\u043e \u00ab\u0421\u0432\u044f\u0442 \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u0411\u043e\u0433 \u043d\u0430\u0448\u2026\u00bb. \u041d\u0430 \u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0430\u043d\u0442\u0438\u0444\u043e\u043d\u0438 \u0441\u0432\u044f\u0442\u043a\u043e\u0432\u0456. \u0412\u0445\u0456\u0434\u043d\u0438\u0439 \u0441\u0442\u0438\u0445: \u00ab\u0411\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0435\u043d\u043d\u0438\u0439, \u0425\u0442\u043e \u000d\u000a\u0439\u0434\u0435 \u0432 \u0456\u043c\u2019\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0454, \u0431\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u043b\u044f\u0454\u043c\u043e \u0432\u0430\u0441 \u0456\u0437 \u0434\u043e\u043c\u0443 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e, \u0411\u043e\u0433 \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u0456 \u044f\u0432\u0438\u0432\u0441\u044f \u043d\u0430\u043c\u00bb. \u0417\u0430\u0434\u043e\u0441\u0442\u043e\u0439\u043d\u0438\u043a \u0441\u0432\u044f\u0442\u0430. \u0412\u0456\u0434\u043f\u0443\u0441\u0442 \u0441\u0432\u044f\u0442\u0430.\u000d\u000a\u0423 \u0446\u0435\u0439 \u0434\u0435\u043d\u044c \u043d\u0430 \u043b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0437\u0430\u0433\u043e\u0442\u043e\u0432\u043b\u044e\u044e\u0442\u044c\u0441\u044f \u0442\u0440\u0438 \u0410\u0433\u043d\u0446\u0456 \u0434\u043b\u044f \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0439 \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432 \u0443 \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a, \u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a \u0456 \u0441\u0435\u0440\u0435\u0434\u0443.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a5\u000d\u000a\u0421\u0442\u0440\u0430\u0441\u043d\u0438\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c. \u0412\u0435\u043b\u0438\u043a\u0438\u0439 \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a. \u0421\u0432\u0442. \u0404\u0432\u0442\u0438\u0445\u0456\u044f, \u0430\u0440\u0445\u0456\u0454\u043f. \u000d\u000a\u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (582). \u0421\u0432\u0442. \u041c\u0435\u0444\u043e\u0434\u0456\u044f, \u0430\u0440\u0445\u0456\u0454\u043f. \u041c\u043e\u0440\u0430\u0432\u0441\u044c\u043a\u043e\u0433\u043e (885). \u041f\u0440\u043f. \u041f\u043b\u0430\u0442\u043e\u043d\u0456\u0434\u0438 (308). \u041c\u0447\u0447. 120 \u043f\u0435\u0440\u0441\u044c\u043a\u0438\u0445 (344 \u2013 347). \u000d\u000a\u041c\u0447. \u0404\u0440\u0435\u043c\u0456\u044f \u0442\u0430 \u0441\u0449\u043c\u0447. \u0410\u0440\u0445\u0438\u043b\u0456\u044f, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 (\u0406\u0406\u0406).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432.\u000d\u000a6\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a","28\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u0444., 84 \u0437\u0430\u0447., XXI, 18 \u2013 43.\u000d\u000a\u041b\u0456\u0442. \u2013 \u041c\u0444., 98 \u0437\u0430\u0447., XXIV, 3 \u2013 35.\u000d\u000a\u0423 \u043d\u0435\u0434\u0456\u043b\u044e \u0437\u0430\u043a\u0456\u043d\u0447\u0435\u043d\u043d\u044f \u0432\u0435\u0447\u0456\u0440\u043d\u0456 \u0437\u0430 \u0437\u0440\u0430\u0437\u043a\u043e\u043c \u043d\u0435\u0434\u0456\u043b\u044c \u0427\u043e\u0442\u0438\u0440\u0438\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0412\u0456\u0434\u043f\u0443\u0441\u0442: \u00ab\u0413\u043e\u0441\u043f\u043e\u0434\u044c, \u0449\u043e \u0439\u0434\u0435 \u043d\u0430 \u0434\u043e\u0431\u0440\u043e\u0432\u0456\u043b\u044c\u043d\u0456 \u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043d\u043d\u044f, \u0437\u0430\u0440\u0430\u0434\u0438 \u043d\u0430\u0448\u043e\u0433\u043e \u0441\u043f\u0430\u0441\u0456\u043d\u043d\u044f, \u0425\u0440\u0438\u0441\u0442\u043e\u0441, \u0456\u0441\u0442\u0438\u043d\u043d\u0438\u0439 \u0411\u043e\u0433 \u043d\u0430\u0448...\u00bb. \u041d\u0430\u043f\u0440\u0438\u043a\u0456\u043d\u0446\u0456 \u0440\u0430\u043d\u043d\u044c\u043e\u0457 \u000d\u000a\u0456 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 (\u043a\u0440\u0456\u043c \u0437\u043e\u0431\u0440\u0430\u0436\u0430\u043b\u044c\u043d\u0438\u0445) \u0443 \u0412\u0435\u043b\u0438\u043a\u0438\u0439 \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a, \u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a, \u0441\u0435\u0440\u0435\u0434\u0443 \u000d\u000a\u0432\u0456\u0434\u043f\u0443\u0441\u0442 \u0446\u0435\u0439 \u0441\u0430\u043c\u0438\u0439 (\u0441\u0432\u044f\u0442\u0456 \u0445\u0440\u0430\u043c\u0443 \u0456 \u0434\u043d\u044f \u043d\u0435 \u0437\u0433\u0430\u0434\u0443\u044e\u0442\u044c\u0441\u044f). \u041d\u0430\u043f\u0440\u0438\u043a\u0456\u043d\u0446\u0456 \u0456\u043d\u0448\u0438\u0445 \u000d\u000a\u0441\u043b\u0443\u0436\u0431 \u0432\u0456\u0434\u043f\u0443\u0441\u0442 \u043c\u0430\u043b\u0438\u0439.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u043f\u0456\u0441\u043b\u044f \u043a\u0430\u0444\u0438\u0437\u043c \u2013 \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454 \u0434\u043d\u044f, 50-\u0439 \u043f\u0441\u0430\u043b\u043e\u043c, \u00ab\u0421\u043f\u0430\u0441\u0438, \u0411\u043e\u0436\u0435, \u000d\u000a\u043b\u044e\u0434\u0435\u0439 \u0422\u0432\u043e\u0457\u0445...\u00bb. \u0427\u0430\u0441\u0438 \u043f\u043e\u0441\u0442\u043e\u0432\u0456. \u0423 \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a, \u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a \u0456 \u0441\u0435\u0440\u0435\u0434\u0443 \u0421\u0442\u0440\u0430\u0441\u043d\u043e\u0433\u043e \u000d\u000a\u0442\u0438\u0436\u043d\u044f \u043d\u0430 3-\u043c\u0443, 6-\u043c\u0443 \u0456 9-\u043c\u0443 \u0447\u0430\u0441\u0430\u0445 \u0447\u0438\u0442\u0430\u0454\u043c\u043e \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454. \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432 \u0432\u0445\u0456\u0434 \u0456\u0437 \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454\u043c \u0456 \u0447\u0438\u0442\u0430\u043d\u043d\u044f \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u044f. \u000d\u000a\u0412\u0435\u043b\u0438\u043a\u0438\u0439 \u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a. \u041f\u0440\u043f. \u0413\u0435\u043e\u0440\u0433\u0456\u044f, \u0441\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u043a\u0430, \u043c\u0438\u0442\u0440. \u041c\u0456\u0442\u0438\u043b\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(\u043f\u0456\u0441\u043b\u044f 820). \u041c\u0447. \u041a\u0430\u043b\u0456\u043e\u043f\u0456\u044f (304). \u0421\u0449\u043c\u0447. \u0420\u0443\u0444\u0438\u043d\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0430, \u043c\u0446. \u0410\u043a\u0438\u043b\u0438\u043d\u0438 \u0456 \u0437 \u000d\u000a\u043d\u0438\u043c\u0438 200 \u0432\u043e\u0457\u043d\u0456\u0432 (\u0431\u043b. 310). \u041f\u0440\u043f. \u0421\u0435\u0440\u0430\u043f\u0456\u043e\u043d\u0430, \u0447\u0435\u043d\u0446\u044f. \u041f\u0440\u043f. \u042e\u0441\u0442\u0438\u043d\u0430 (\u041f\u043e\u043f\u043e\u0432\u0438\u0447\u0430), \u0427\u0435\u043b\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (1978, \u0421\u0435\u0440\u0431.).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432.\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u0444., 90 \u0437\u0430\u0447., XXII, 15 \u2013 XXIII, 39.\u000d\u000a\u041b\u0456\u0442. \u2013 \u041c\u0444., 102 \u0437\u0430\u0447., XXIV, 36 \u2013 XXVI, 2.\u000d\u000a\u041f\u043e\u0440\u044f\u0434\u043e\u043a \u0441\u043b\u0443\u0436\u0431\u0438, \u044f\u043a \u0443 \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a.\u000d\u000a\u0412\u0435\u043b\u0438\u043a\u0430 \u0441\u0435\u0440\u0435\u0434\u0430. \u0410\u043f\u043f. \u0406\u0440\u043e\u0434\u0456\u043e\u043d\u0430, \u0410\u0433\u0430\u0432\u0430, \u0410\u0441\u0438\u043d\u043a\u0440\u0438\u0442\u0430, \u0420\u0443\u0444\u0430, \u0424\u043b\u0435\u0433\u043e\u043d\u0442\u0430, \u0404\u0440\u043c\u0430 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 \u0437 \u043d\u0438\u043c\u0438 (\u0406). \u041f\u0440\u043f. \u0420\u0443\u0444\u0430, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406V). \u041c\u0447. \u041f\u0430\u0432\u0441\u0438\u043b\u0438\u043f\u0430 (117 \u2013 138). \u000d\u000a\u0421\u0432\u0442. \u0426\u0435\u043b\u0435\u0441\u0442\u0438\u043d\u0430, \u043f\u0430\u043f\u0438 \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (432). \u0421\u0432\u0442. \u041d\u0438\u0444\u043e\u043d\u0442\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0454\u043f. \u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\u0441\u044c\u043a\u043e\u0433\u043e (1156).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0420\u0430\u043d\u0456\u0448\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u0438\u0445 \u0414\u0430\u0440\u0456\u0432.\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 41 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), XII, 17 \u2013 50.\u000d\u000a\u041b\u0456\u0442. \u2013 \u041c\u0444., 108 \u0437\u0430\u0447., XXVI, 6 \u2013 16.\u000d\u000a\u041f\u043e\u0440\u044f\u0434\u043e\u043a \u0441\u043b\u0443\u0436\u0431\u0438, \u044f\u043a \u0443 \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a. \u041d\u0430 \u0437\u043e\u0431\u0440\u0430\u0436\u0430\u043b\u044c\u043d\u0438\u0445 \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u0432\u0456\u0434\u043f\u0443\u0441\u0442\u0443 \u2013 \u043c\u043e\u043b\u0438\u0442\u0432\u0430 \u00ab\u0412\u043b\u0430\u0434\u0438\u043a\u043e \u041c\u043d\u043e\u0433\u043e\u043c\u0438\u043b\u043e\u0441\u0442\u0438\u0432\u0438\u0439...\u00bb (\u0434\u0438\u0432\u0438\u0441\u044c \u043d\u0430 \u0412\u0435\u043b\u0438\u043a\u043e\u043c\u0443 \u043f\u043e\u0432\u0435\u0447\u0456\u0440\u2019\u0457). \u000d\u000a\u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u043f\u0456\u0441\u043b\u044f \u00ab\u041d\u0435\u0445\u0430\u0439 \u0431\u0443\u0434\u0435 \u0456\u043c\u2019\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0454...\u00bb \u043c\u043e\u043b\u0438\u0442\u0432\u0430 \u043f\u0440\u043f. \u0404\u0444\u0440\u0435\u043c\u0430 \u000d\u000a\u0421\u0438\u0440\u0456\u043d\u0430 \u0437 \u0442\u0440\u044c\u043e\u043c\u0430 \u0432\u0435\u043b\u0438\u043a\u0438\u043c\u0438 \u043f\u043e\u043a\u043b\u043e\u043d\u0430\u043c\u0438, \u043f\u0456\u0441\u043b\u044f \u0447\u043e\u0433\u043e \u0437\u0435\u043c\u043d\u0456 \u043f\u043e\u043a\u043b\u043e\u043d\u0438 \u0432 \u0445\u0440\u0430\u043c\u0456 \u000d\u000a\u043f\u0440\u0438\u043f\u0438\u043d\u044f\u044e\u0442\u044c\u0441\u044f \u0434\u043e \u0434\u043d\u044f \u0421\u0432\u044f\u0442\u043e\u0457 \u0422\u0440\u043e\u0439\u0446\u0456 (\u043a\u0440\u0456\u043c \u043f\u043e\u043a\u043b\u043e\u043d\u0456\u0432 \u0431\u0456\u043b\u044f \u0441\u0432\u044f\u0442\u043e\u0457 \u041f\u043b\u0430\u0449\u0430\u043d\u0438\u0446\u0456). \u0412\u0456\u0434\u043f\u0443\u0441\u0442 \u2013 \u00ab\u0413\u043e\u0441\u043f\u043e\u0434\u044c, \u0449\u043e \u0439\u0434\u0435 \u043d\u0430 \u0434\u043e\u0431\u0440\u043e\u0432\u0456\u043b\u044c\u043d\u0456 \u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043d\u043d\u044f, \u000d\u000a\u0437\u0430\u0440\u0430\u0434\u0438 \u043d\u0430\u0448\u043e\u0433\u043e \u0441\u043f\u0430\u0441\u0456\u043d\u043d\u044f, \u0425\u0440\u0438\u0441\u0442\u043e\u0441, \u0456\u0441\u0442\u0438\u043d\u043d\u0438\u0439 \u0411\u043e\u0433 \u043d\u0430\u0448...\u00bb.\u000d\u000a\u0412\u0435\u043b\u0438\u043a\u0438\u0439 \u0447\u0435\u0442\u0432\u0435\u0440. \u0421\u043f\u043e\u043c\u0438\u043d \u0422\u0430\u0454\u043c\u043d\u043e\u0457 \u0432\u0435\u0447\u0435\u0440\u0456. \u041c\u0447. \u0404\u0432\u043f\u0441\u0438\u0445\u0456\u044f (362). \u000d\u000a\u0421\u0449\u043c\u0447\u0447. \u0414\u0456\u0441\u0430\u043d\u0430, \u0454\u043f., \u041c\u0430\u0440\u0456\u0430\u0432\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442., \u043c\u0447\u0447. \u0410\u0432\u0434\u0456\u0454\u0441\u0430 \u0442\u0430 \u0456\u043d. 270-\u0445 (362 \u2013 \u000d\u000a364). \u041f\u0440\u043c\u0447. \u0412\u0430\u0434\u0438\u043c\u0430, \u0430\u0440\u0445\u0456\u043c. (376).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e.\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 108 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b.), \u0425\u0425\u0406\u0406, 1 \u2013 39.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u041a\u043e\u0440., 149 \u0437\u0430\u0447., \u0425\u0406, 23 \u2013 32. \u0404\u0432. (\u0441\u043a\u043b\u0430\u0434\u0435\u043d\u0435): \u041c\u0444., 107 \u0437\u0430\u0447., \u0425\u0425V\u0406, \u000d\u000a1 \u2013 20. \u0406\u043d., \u0425\u0406\u0406\u0406, 3 \u2013 17; \u041c\u0444. \u0425\u0425V\u0406, 21 \u2013 39; \u041b\u043a., \u0425\u0425\u0406\u0406, 43 \u2013 45; \u041c\u0444., \u0425\u0425V\u0406, \u000d\u000a40 \u2013 \u0425\u0425V\u0406\u0406, 2.\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a7\u000d\u000a8\u000d\u000a9","29\u000d\u000a\u0427\u0438\u043d \u043e\u0431\u043c\u0438\u0432\u0430\u043d\u043d\u044f \u043d\u0456\u0433 \u0437\u0434\u0456\u0439\u0441\u043d\u044e\u0454\u0442\u044c\u0441\u044f \u043f\u0440\u0438 \u0430\u0440\u0445\u0456\u0454\u0440\u0435\u0439\u0441\u044c\u043a\u043e\u043c\u0443 \u0441\u043b\u0443\u0436\u0456\u043d\u043d\u0456 \u043d\u0430 \u0440\u043e\u0437\u0441\u0443\u0434 \u0430\u0440\u0445\u0456\u0454\u0440\u0435\u044f.\u000d\u000a\u041d\u0430 \u043e\u0431\u043c\u0438\u0432\u0430\u043d\u043d\u0456 \u043d\u0456\u0433 \u2013 \u0406\u043d., 44 \u0437\u0430\u0447., \u0425\u0406\u0406\u0406, 1 \u2013 11. \u041f\u0456\u0441\u043b\u044f \u043e\u0431\u043c\u0438\u0432\u0430\u043d\u043d\u044f \u043d\u0456\u0433: \u0406\u043d., 45 \u000d\u000a\u0437\u0430\u0447., \u0425\u0406\u0406\u0406, 12 \u2013 17.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u043a\u0430\u0444\u0438\u0437\u043c \u043d\u0435\u043c\u0430\u0454, \u00ab\u0421\u043f\u0430\u0441\u0438, \u0411\u043e\u0436\u0435, \u043b\u044e\u0434\u0435\u0439 \u0422\u0432\u043e\u0457\u0445...\u00bb \u043d\u0435 \u043f\u0440\u043e\u043c\u043e\u0432\u043b\u044f\u0454\u0442\u044c\u0441\u044f. \u041f\u0456\u0441\u043b\u044f 50-\u0433\u043e \u043f\u0441\u0430\u043b\u043c\u0430 \u043a\u0430\u043d\u043e\u043d. \u041d\u0430 \u0447\u0430\u0441\u0430\u0445 \u0447\u0438\u0442\u0430\u0454\u043c\u043e \u0442\u0440\u043e\u043f\u0430\u0440 \u0456 \u000d\u000a\u043a\u043e\u043d\u0434\u0430\u043a \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u0447\u0435\u0442\u0432\u0435\u0440\u0433\u0430, \u0430 \u043d\u0435 \u0442\u0440\u043e\u043f\u0430\u0440\u0456 \u0447\u0430\u0441\u0443; \u0430 \u043d\u0430 1-\u043c\u0443 \u0447\u0430\u0441\u0456 \u2013 \u0442\u0440\u043e\u043f\u0430\u0440 \u000d\u000a\u043f\u0440\u043e\u0440\u043e\u0446\u0442\u0432\u0430, \u043f\u0440\u043e\u043a\u0438\u043c\u0435\u043d \u0456 \u043f\u0430\u0440\u0438\u043c\u0456\u044f. \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u043f\u043e\u0447\u0438\u043d\u0430\u0454\u0442\u044c\u0441\u044f \u0432\u0435\u0447\u0456\u0440\u043d\u0435\u044e. \u000d\u000a\u0412\u0445\u0456\u0434 \u0437 \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454\u043c. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u0425\u0435\u0440\u0443\u0432\u0438\u043c\u0441\u044c\u043a\u043e\u0457 \u043f\u0456\u0441\u043d\u0456 \u0456 \u043f\u0440\u0438\u0447\u0430\u0441\u043d\u043e\u0433\u043e \u0441\u0442\u0438\u0445\u0430, \u000d\u000a\u043f\u0456\u0434 \u0447\u0430\u0441 \u043f\u0440\u0438\u0447\u0430\u0449\u0430\u043d\u043d\u044f \u0442\u0430 \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u041d\u0435\u0445\u0430\u0439 \u043d\u0430\u043f\u043e\u0432\u043d\u044f\u0442\u044c\u0441\u044f \u0443\u0441\u0442\u0430 \u043d\u0430\u0448\u0456...\u00bb \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u00ab\u0412\u0435\u0447\u0435\u0440\u0456 \u0422\u0432\u043e\u0454\u0457 \u0442\u0430\u0439\u043d\u043e\u0457...\u00bb. \u0417\u0430\u0434\u043e\u0441\u0442\u043e\u0439\u043d\u0438\u043a \u2013 \u0456\u0440\u043c\u043e\u0441 9-\u043e\u0457 \u043f\u0456\u0441\u043d\u0456 \u043a\u0430\u043d\u043e\u043d\u0443 \u00ab\u041f\u0440\u0438\u0439\u0434\u0456\u0442\u044c, \u0432\u0456\u0440\u043d\u0456...\u00bb. \u0412\u0456\u0434\u043f\u0443\u0441\u0442 \u0440\u0430\u043d\u043d\u044c\u043e\u0457 \u0456 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u2013 \u00ab\u0425\u0440\u0438\u0441\u0442\u043e\u0441, \u0449\u043e \u0437\u0430\u0440\u0430\u0434\u0438 \u043d\u0430\u0441, \u043b\u044e\u0434\u0435\u0439...\u00bb. \u0412\u0456\u0434\u043f\u0443\u0441\u0442 \u043f\u0456\u0441\u043b\u044f \u043f\u043e\u0432\u0435\u0447\u0456\u0440\u2019\u044f \u0456 \u0437\u043e\u0431\u0440\u0430\u0436\u0430\u043b\u044c\u043d\u0438\u0445 \u043c\u0430\u043b\u0438\u0439 \u000d\u000a\u00ab\u0425\u0440\u0438\u0441\u0442\u043e\u0441, \u0456\u0441\u0442\u0438\u043d\u043d\u0438\u0439 \u0411\u043e\u0433 \u043d\u0430\u0448, \u043c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438...\u00bb. \u0422\u0430\u043a\u043e\u0436 \u0437\u0430 \u0442\u0440\u0430\u0434\u0438\u0446\u0456\u0454\u044e, \u0443 \u000d\u000a\u0412\u0435\u043b\u0438\u043a\u0438\u0439 \u0447\u0435\u0442\u0432\u0435\u0440 \u0437\u0430\u0433\u043e\u0442\u043e\u0432\u043b\u044f\u044e\u0442\u044c\u0441\u044f \u0437\u0430\u043f\u0430\u0441\u043d\u0456 \u0421\u0432\u044f\u0442\u0456 \u0414\u0430\u0440\u0438 \u043d\u0430 \u0432\u0435\u0441\u044c \u0440\u0456\u043a \u0434\u043b\u044f \u000d\u000a\u043f\u0440\u0438\u0447\u0430\u0449\u0430\u043d\u043d\u044f \u0445\u0432\u043e\u0440\u0438\u0445. \u000d\u000a\u0412\u0435\u043b\u0438\u043a\u0430 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044f. \u0421\u043f\u043e\u043c\u0438\u043d \u0441\u0432\u044f\u0442\u0438\u0445 \u0441\u043f\u0430\u0441\u0438\u0442\u0435\u043b\u044c\u043d\u0438\u0445 \u0441\u0442\u0440\u0430\u0441\u0442\u0435\u0439 \u000d\u000a\u0413\u043e\u0441\u043f\u043e\u0434\u0430 \u043d\u0430\u0448\u043e\u0433\u043e \u0406\u0441\u0443\u0441\u0430 \u0425\u0440\u0438\u0441\u0442\u0430. \u041c\u0447\u0447. \u0422\u0435\u0440\u0435\u043d\u0442\u0456\u044f, \u041f\u043e\u043c\u043f\u0456\u044f, \u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0430, \u000d\u000a\u041c\u0430\u043a\u0441\u0438\u043c\u0430, \u0417\u0438\u043d\u043e\u043d\u0430, \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430, \u0424\u0435\u0434\u043e\u0440\u0430 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 33 (\u0431\u043b. 249 \u2013 251). \u000d\u000a\u0421\u0449\u043c\u0447\u0447. \u042f\u043a\u043e\u0432\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u0410\u0437\u0430\u0434\u0430\u043d\u0430 \u0456 \u0410\u0432\u0434\u0438\u043a\u0456\u044f, \u0434\u0438\u044f\u043a\u043e\u043d\u0456\u0432 \u041f\u0435\u0440\u0441\u044c\u043a\u0438\u0445 \u000d\u000a(\u0431\u043b. 380). \u0411\u043b\u0433\u0432. \u0433\u0435\u0442\u044c\u043c\u0430\u043d\u0430 \u041f\u0435\u0442\u0440\u0430 (\u041a\u043e\u043d\u0430\u0448\u0435\u0432\u0438\u0447\u0430-\u0421\u0430\u0433\u0430\u0439\u0434\u0430\u0447\u043d\u043e\u0433\u043e) \u000d\u000a(1622). \u041f\u0440\u043c\u0447\u0447. \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u0457 \u043e\u0431\u0438\u0442\u0435\u043b\u0456 \u041f\u0430\u043d\u0442\u043e\u043a\u0440\u0430\u0442\u043e\u0440\u0430, \u044f\u043a\u0456 \u0432 \u0414\u0430\u0443 \u041f\u0435\u043d\u0434\u0435\u043b\u0456 \u000d\u000a(\u0410\u0442\u0442\u0438\u043a\u0430) \u043f\u043e\u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043b\u0438 (\u0431\u043b. 1680). \u0421\u0449\u043c\u0447. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f V, \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0433\u043e (1821).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u044f \u0441\u0432\u044f\u0442\u0438\u0445 \u0441\u0442\u0440\u0430\u0441\u0442\u0435\u0439 \u0413\u043e\u0441\u043f\u043e\u0434\u0430 \u043d\u0430\u0448\u043e\u0433\u043e \u0406\u0441\u0443\u0441\u0430 \u0425\u0440\u0438\u0441\u0442\u0430: \u000d\u000a1-\u0435: \u0406\u043d., 46 \u0437\u0430\u0447., XIII, 31 \u2013 XVIII, 1. \u000d\u000a2-\u0435: \u0406\u043d., 58 \u0437\u0430\u0447., XVIII, 1 \u2013 28. \u000d\u000a3-\u0454: \u041c\u0444., 109 \u0437\u0430\u0447., XXVI, 57 \u2013 75.\u000d\u000a4-\u0435: \u0406\u043d., 59 \u0437\u0430\u0447., XVIII, 28 \u2013 XIX, 16. \u000d\u000a5-\u0435: \u041c\u0444., 111 \u0437\u0430\u0447., XXVII, 3 \u2013 32. \u000d\u000a6-\u0435: \u041c\u043a., 67 \u0437\u0430\u0447., XV, 16 \u2013 32. \u000d\u000a7-\u0435: \u041c\u0444., 113 \u0437\u0430\u0447., XXVII, 33 \u2013 54. \u000d\u000a8-\u0435: \u041b\u043a., 111 \u0437\u0430\u0447., XXIII, 32 \u2013 49. \u000d\u000a9-\u0435: \u0406\u043d., 61 \u0437\u0430\u0447., XIX, 25 \u2013 37. \u000d\u000a10-\u0435: \u041c\u043a., 69 \u0437\u0430\u0447., XV, 43 \u2013 47. \u000d\u000a11-\u0435: \u0406\u043d., 62 \u0437\u0430\u0447., XIX, 38 \u2013 42. \u000d\u000a12-\u0435: \u041c\u0444., 114 \u0437\u0430\u0447., XXVII, 62 \u2013 66.\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u043d\u0435 \u0437\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f.\u000d\u000a\u041d\u0430 1-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0413\u0430\u043b., 215 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b.), VI, 14 \u2013 18. \u041c\u0444., 110 \u0437\u0430\u0447., XXVII, \u000d\u000a1 \u2013 56.\u000d\u000a\u041d\u0430 3-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0420\u0438\u043c., 88 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b.), V, 6 \u2013 11. \u041c\u043a., 67 \u0437\u0430\u0447., XV, 16 \u2013 41.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0404\u0432\u0440., 306 \u0437\u0430\u0447., II, 11 \u2013 18. \u041b\u043a., 111 \u0437\u0430\u0447., XXIII, 32 \u2013 49.\u000d\u000a\u041d\u0430 9-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0404\u0432\u0440., 324 \u0437\u0430\u0447., X, 19 \u2013 31. \u0406\u043d., 59 \u0437\u0430\u0447., XVIII, 28 \u2013 XIX, 37.\u000d\u000a\u041d\u0430 \u0432\u0435\u0447.: 1 \u041a\u043e\u0440., 125 \u0437\u0430\u0447., I, 18 \u2013 II, 2. \u0404\u0432. \u0441\u043a\u043b\u0430\u0434\u0435\u043d\u0435: \u041c\u0444., 110 \u0437\u0430\u0447., \u000d\u000aXXVII, 1 \u2013 44; \u041b\u043a., XXIII, 39 \u2013 43; \u041c\u0444., XXVII, 45 \u2013 54; \u0406\u043d., XIX, 31 \u2013 37; \u000d\u000a\u041c\u0444., XXVII, 55 \u2013 61.\u000d\u000a\u0421\u0443\u0432\u043e\u0440\u0438\u0439 \u043f\u0456\u0441\u0442.\u000d\u000a10\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f","30\u000d\u000a\u0423 \u0447\u0435\u0442\u0432\u0435\u0440 \u0443\u0432\u0435\u0447\u0435\u0440\u0456 \u0441\u043b\u0443\u0436\u0438\u043c\u043e \u0440\u0430\u043d\u043d\u044e \u0437 \u0447\u0438\u0442\u0430\u043d\u043d\u044f\u043c 12-\u0442\u0438 \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0439 \u0441\u0432\u044f\u0442\u0438\u0445 \u000d\u000a\u0441\u0442\u0440\u0430\u0441\u0442\u0435\u0439 \u0413\u043e\u0441\u043f\u043e\u0434\u0430 \u043d\u0430\u0448\u043e\u0433\u043e \u0406\u0441\u0443\u0441\u0430 \u0425\u0440\u0438\u0441\u0442\u0430. 1-\u0439 \u0447\u0430\u0441 \u0434\u043e \u0440\u0430\u043d\u043d\u044c\u043e\u0457 \u043d\u0435 \u043f\u0440\u0438\u0454\u0434\u043d\u0443\u0454\u0442\u044c\u0441\u044f. \u0423 \u043a\u0456\u043d\u0446\u0456 \u0440\u0430\u043d\u043d\u044c\u043e\u0457 \u2013 \u0432\u0456\u0434\u043f\u0443\u0441\u0442 \u0412\u0435\u043b\u0438\u043a\u043e\u0457 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u0456. \u0412\u0440\u0430\u043d\u0446\u0456 \u0443 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e \u000d\u000a\u0432\u0456\u0434\u043f\u0440\u0430\u0432\u043b\u044f\u0454\u043c\u043e \u043f\u043e\u0441\u043b\u0456\u0434\u0443\u0432\u0430\u043d\u043d\u044f \u0426\u0430\u0440\u0441\u044c\u043a\u0438\u0445 \u0447\u0430\u0441\u0456\u0432 \u0412\u0435\u043b\u0438\u043a\u043e\u0457 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u0456 \u0456\u0437 \u0437\u043e\u0431\u0440\u0430\u0436\u0430\u043b\u044c\u043d\u0438\u043c\u0438. \u0423 \u0434\u0440\u0443\u0433\u0456\u0439 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0456 \u0434\u043d\u044f \u0437\u0432\u0435\u0440\u0448\u0443\u0454\u043c\u043e \u0432\u0435\u0447\u0456\u0440\u043d\u044e \u0412\u0435\u043b\u0438\u043a\u043e\u0457 \u0441\u0443\u0431\u043e\u0442\u0438, \u043d\u0430\u043f\u0440\u0438\u043a\u0456\u043d\u0446\u0456 \u044f\u043a\u043e\u0457 \u043f\u0456\u0434 \u0447\u0430\u0441 \u0441\u043f\u0456\u0432\u0443 \u0442\u0440\u043e\u043f\u0430\u0440\u0456\u0432 \u043f\u0456\u0441\u043b\u044f \u00ab\u041d\u0438\u043d\u0456 \u0432\u0456\u0434\u043f\u0443\u0441\u043a\u0430\u0454\u0448...\u00bb \u0437 \u000d\u000a\u0432\u0456\u0432\u0442\u0430\u0440\u044f \u0447\u0435\u0440\u0435\u0437 \u043f\u0456\u0432\u043d\u0456\u0447\u043d\u0456 \u0434\u0432\u0435\u0440\u0456 \u0432\u0438\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u0441\u0432\u044f\u0442\u0430 \u041f\u043b\u0430\u0449\u0430\u043d\u0438\u0446\u044f. \u0412\u0456\u0434\u043f\u0443\u0441\u0442 \u0447\u0430\u0441\u0456\u0432 \u0456\u0437 \u0437\u043e\u0431\u0440\u0430\u0436\u0430\u043b\u044c\u043d\u0438\u043c\u0438 \u0456 \u0432\u0435\u0447\u0456\u0440\u043d\u0456 \u2013 \u00ab\u0425\u0440\u0438\u0441\u0442\u043e\u0441, \u0449\u043e \u0437\u0430\u0440\u0430\u0434\u0438 \u043d\u0430\u0441, \u043b\u044e\u0434\u0435\u0439...\u00bb. \u000d\u000a\u041f\u0456\u0441\u043b\u044f \u0432\u0438\u043d\u043e\u0441\u0443 \u041f\u043b\u0430\u0449\u0430\u043d\u0438\u0446\u0456 \u2013 \u043c\u0430\u043b\u0435 \u043f\u043e\u0432\u0435\u0447\u0456\u0440\u2019\u044f \u0437 \u043a\u0430\u043d\u043e\u043d\u043e\u043c \u00ab\u0420\u043e\u0437\u043f\u2019\u044f\u0442\u0442\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0454 \u0439 \u043d\u0430 \u043f\u043b\u0430\u0447 \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456\u00bb. \u0412\u0456\u0434\u043f\u0443\u0441\u0442 \u043f\u043e\u0432\u0435\u0447\u0456\u0440\u2019\u044f \u0437\u0432\u0438\u0447\u0430\u0439\u043d\u0438\u0439. \u000d\u000a\u041f\u0456\u0434 \u0447\u0430\u0441 \u0446\u0456\u043b\u0443\u0432\u0430\u043d\u043d\u044f \u041f\u043b\u0430\u0449\u0430\u043d\u0438\u0446\u0456 \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0442\u0440\u043e\u043f\u0430\u0440: \u00ab\u041f\u0440\u0438\u0439\u0434\u0456\u0442\u044c, \u0432\u0448\u0430\u043d\u0443\u0439\u043c\u043e \u000d\u000a\u0419\u043e\u0441\u0438\u0444\u0430...\u00bb.\u000d\u000a\u0412\u0435\u043b\u0438\u043a\u0430 \u0441\u0443\u0431\u043e\u0442\u0430. \u0421\u0449\u043c\u0447. \u0410\u043d\u0442\u0438\u043f\u0438, \u0454\u043f. \u041f\u0435\u0440\u0433\u0430\u043c\u0430 \u0410\u0441\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 68). \u041c\u0447\u0447. \u000d\u000a\u041f\u0440\u043e\u043a\u0435\u0441\u0430 \u0456 \u041c\u0430\u0440\u0442\u0438\u043d\u0456\u0430\u043d\u0430 (\u0431\u043b. 67). \u041f\u0440\u043f. \u0424\u0430\u0440\u043c\u0443\u0444\u0456\u044f (\u0406V). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430, \u0443\u0447\u043d\u044f \u000d\u000a\u043f\u0440\u043f. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f \u0414\u0435\u043a\u0430\u043f\u043e\u043b\u0456\u0442\u0430 (820 \u2013 850). \u0421\u0432\u0442. \u041a\u0430\u043b\u0438\u043d\u0438\u043a\u0430 \u0427\u0435\u0440\u043d\u0438\u043a\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(1868, \u0420\u0443\u043c.).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e.\u000d\u000a\u0420\u0430\u043d. \u2013 \u0410\u043f. \u0441\u043a\u043b\u0430\u0434\u0435\u043d\u0438\u0439: 1 \u041a\u043e\u0440., 133 \u0437\u0430\u0447., V, 6 \u2013 8; \u0413\u0430\u043b., 206 \u0437\u0430\u0447., III, 13 \u2013 14. \u000d\u000a\u041c\u0444., 114 \u0437\u0430\u0447., XXVII, 62 \u2013 66.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0420\u0438\u043c., 91 \u0437\u0430\u0447., VI, 3 \u2013 11. \u041c\u0444., 115 \u0437\u0430\u0447., XXVIII, 1 \u2013 20.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u2013 \u043f\u043e\u0445\u0432\u0430\u043b\u0438 \u0437\u0456 \u0441\u0442\u0438\u0445\u0430\u043c\u0438 17-\u043e\u0457 \u043a\u0430\u0444\u0438\u0437\u043c\u0438 \u043d\u0430 \u0442\u0440\u0438 \u0441\u0442\u0430\u0442\u0442\u0456. \u041f\u0456\u0441\u043b\u044f 9-\u043e\u0457 \u000d\u000a\u043f\u0456\u0441\u043d\u0456 \u043a\u0430\u043d\u043e\u043d\u0443 \u0456 \u043c\u0430\u043b\u043e\u0457 \u0435\u043a\u0442\u0435\u043d\u0456\u0457 \u2013 \u00ab\u0421\u0432\u044f\u0442 \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u0411\u043e\u0433 \u043d\u0430\u0448\u00bb \u0456 \u0432\u0456\u0434\u0440\u0430\u0437\u0443 \u00ab\u0412\u0441\u0435, \u0449\u043e \u000d\u000a\u0434\u0438\u0448\u0435...\u00bb \u0442\u0430 \u0445\u0432\u0430\u043b\u0456\u0442\u043d\u0456 \u0441\u0442\u0438\u0445\u0438\u0440\u0438. \u041f\u0456\u0441\u043b\u044f \u0441\u043f\u0456\u0432\u0443 \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u0441\u043b\u0430\u0432\u043e\u0441\u043b\u0456\u0432\u2019\u044f \u043e\u0431\u043d\u043e\u0441\u044f\u0442\u044c \u0441\u0432\u044f\u0442\u0443 \u041f\u043b\u0430\u0449\u0430\u043d\u0438\u0446\u044e \u0434\u043e\u0432\u043a\u043e\u043b\u0430 \u0445\u0440\u0430\u043c\u0443, \u0441\u043f\u0456\u0432\u0430\u044e\u0447\u0438 \u043f\u043e\u0445\u043e\u0432\u0430\u043b\u044c\u043d\u0435 \u00ab\u0421\u0432\u044f\u0442\u0438\u0439 \u000d\u000a\u0411\u043e\u0436\u0435...\u00bb. \u0414\u0430\u043b\u0456 \u043f\u0430\u0440\u0435\u043c\u0456\u044f, \u0410\u043f\u043e\u0441\u0442\u043e\u043b \u0456 \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454. \u041f\u0456\u0441\u043b\u044f \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u044f \u043f\u043e\u0442\u0440\u0456\u0439\u043d\u0430 \u000d\u000a\u00ab\u041f\u0440\u043e\u043c\u043e\u0432\u043c\u043e \u0432\u0441\u0456...\u00bb \u0456 \u043f\u0440\u043e\u0445\u0430\u043b\u044c\u043d\u0430 \u0435\u043a\u0442\u0435\u043d\u0456\u0457. \u0412\u0456\u0434\u043f\u0443\u0441\u0442 \u0440\u0430\u043d\u043d\u044c\u043e\u0457 \u2013 \u00ab\u0425\u0440\u0438\u0441\u0442\u043e\u0441, \u0449\u043e \u000d\u000a\u0437\u0430\u0440\u0430\u0434\u0438 \u043d\u0430\u0441 \u043b\u044e\u0434\u0435\u0439...\u00bb \u0456 1-\u0439 \u0447\u0430\u0441.\u000d\u000a\u041d\u0430 \u0437\u043e\u0431\u0440\u0430\u0436\u0430\u043b\u044c\u043d\u0438\u0445 \u00ab\u0411\u043b\u0430\u0436\u0435\u043d\u043d\u0456\u2026\u00bb \u0447\u0438\u0442\u0430\u044e\u0442\u044c\u0441\u044f. \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u043e\u0447\u0438\u043d\u0430\u0454\u0442\u044c\u0441\u044f \u0432\u0435\u0447\u0456\u0440\u043d\u0435\u044e. \u0412\u0445\u0456\u0434 \u0437 \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454\u043c. \u041f\u0440\u043e\u043a\u0438\u043c\u043d\u0430 \u000d\u000a\u043d\u0435\u043c\u0430\u0454, \u0430\u043b\u0435 \u0432\u0456\u0434\u0440\u0430\u0437\u0443 \u0447\u0438\u0442\u0430\u043d\u043d\u044f 15 \u043f\u0430\u0440\u0435\u043c\u0456\u0439 \u0456\u0437 \u0437\u0430\u0441\u043f\u0456\u0432\u0430\u043c\u0438 \u043f\u0456\u0441\u043b\u044f 6-\u043e\u0457: \u00ab\u0421\u043b\u0430\u0432\u043d\u043e, \u000d\u000a\u0431\u043e \u043f\u0440\u043e\u0441\u043b\u0430\u0432\u0438\u0432\u0441\u044f\u00bb \u0442\u0430 \u043e\u0441\u0442\u0430\u043d\u043d\u044c\u043e\u0457: \u00ab\u0413\u043e\u0441\u043f\u043e\u0434\u0430 \u043e\u0441\u043f\u0456\u0432\u0443\u0439\u0442\u0435 \u0456 \u043f\u0440\u043e\u0441\u043b\u0430\u0432\u043b\u044f\u0439\u0442\u0435 \u043f\u043e \u000d\u000a\u0432\u0441\u0456 \u0432\u0456\u043a\u0438\u00bb. \u0414\u0430\u043b\u0456 \u043c\u0430\u043b\u0430 \u0435\u043a\u0442\u0435\u043d\u0456\u044f, \u0432\u0438\u0433\u043e\u043b\u043e\u0441: \u00ab\u0411\u043e \u0422\u0438 \u0421\u0432\u044f\u0442\u0438\u0439 \u0411\u043e\u0436\u0435...\u00bb. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u000d\u000a\u0442\u0440\u0438\u0441\u0432\u044f\u0442\u043e\u0433\u043e \u2013 \u00ab\u0412\u0441\u0456 \u0432\u0438, \u0449\u043e \u0432 \u0425\u0440\u0438\u0441\u0442\u0430 \u0445\u0440\u0435\u0441\u0442\u0438\u043b\u0438\u0441\u044f...\u00bb. \u041f\u0456\u0441\u043b\u044f \u0410\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u0441\u043f\u0456\u0432\u0446\u0456 \u000d\u000a\u0437\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0410\u043b\u0438\u043b\u0443\u044f\u00bb \u0441\u043f\u0456\u0432\u0430\u044e\u0442\u044c \u00ab\u0412\u043e\u0441\u043a\u0440\u0435\u0441\u043d\u0438, \u0411\u043e\u0436\u0435...\u00bb. \u0421\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u0441\u043b\u0443\u0436\u0438\u0442\u0435\u043b\u0456 \u000d\u000a\u0432 \u0446\u0435\u0439 \u0447\u0430\u0441 \u043f\u0435\u0440\u0435\u043e\u0434\u044f\u0433\u0430\u044e\u0442\u044c\u0441\u044f \u0443 \u0431\u0456\u043b\u0456 \u043e\u0431\u043b\u0430\u0447\u0435\u043d\u043d\u044f. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u0425\u0435\u0440\u0443\u0432\u0438\u043c\u0441\u044c\u043a\u043e\u0457 \u043f\u0456\u0441\u043d\u0456 \u000d\u000a\u2013 \u00ab\u041d\u0435\u0445\u0430\u0439 \u043c\u043e\u0432\u0447\u0438\u0442\u044c \u0432\u0441\u044f\u043a\u0430 \u043f\u043b\u043e\u0442\u044c...\u00bb. \u0417\u0430\u0434\u043e\u0441\u0442\u043e\u0439\u043d\u0438\u043a \u2013 \u00ab\u041d\u0435 \u0440\u0438\u0434\u0430\u0439 \u0437\u0430 \u041c\u043d\u043e\u044e, \u000d\u000a\u041c\u0430\u0442\u0438...\u00bb. \u041f\u0456\u0441\u043b\u044f \u0437\u0430\u0430\u043c\u0432\u043e\u043d\u043d\u043e\u0457 \u043c\u043e\u043b\u0438\u0442\u0432\u0438 \u0441\u043f\u0456\u0432\u0430\u044e\u0442\u044c\u0441\u044f \u0442\u0440\u043e\u043f\u0430\u0440\u0456 \u00ab\u0411\u043b\u0430\u0433\u043e\u043e\u0431\u0440\u0430\u0437\u043d\u0438\u0439 \u0419\u043e\u0441\u0438\u0444...\u00bb, \u00ab\u0421\u043b\u0430\u0432\u0430...\u00bb \u2013 \u00ab\u041a\u043e\u043b\u0438 \u0437\u0456\u0439\u0448\u043e\u0432 \u0422\u0438 \u0434\u043e \u0441\u043c\u0435\u0440\u0442\u0456...\u00bb, \u00ab\u0406 \u043d\u0438\u043d\u0456...\u00bb \u2013 \u000d\u000a\u00ab\u041c\u0438\u0440\u043e\u043d\u043e\u0441\u0438\u0446\u044f\u043c \u0436\u043e\u043d\u0430\u043c...\u00bb, \u043c\u043e\u043b\u0438\u0442\u0432\u0430 \u043d\u0430 \u0431\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0435\u043d\u043d\u044f \u0445\u043b\u0456\u0431\u0456\u0432, \u0430\u043b\u0435 \u0431\u0435\u0437 \u000d\u000a\u0437\u0433\u0430\u0434\u043a\u0438 \u043f\u0440\u043e \u043f\u0448\u0435\u043d\u0438\u0446\u044e \u0442\u0430 \u0454\u043b\u0435\u0439, \u043f\u043e\u0442\u0456\u043c \u00ab\u041d\u0435\u0445\u0430\u0439 \u0431\u0443\u0434\u0435 \u0456\u043c\u2019\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0454\u2026\u00bb, 33-\u0439 \u000d\u000a\u043f\u0441\u0430\u043b\u043e\u043c \u0456 \u0432\u0456\u0434\u043f\u0443\u0441\u0442 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u2013 \u00ab\u0425\u0440\u0438\u0441\u0442\u043e\u0441, \u0456\u0441\u0442\u0438\u043d\u043d\u0438\u0439 \u0411\u043e\u0433 \u043d\u0430\u0448...\u00bb.\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a11\u000d\u000a\u0421\u0412\u0406\u0422\u041b\u0415 \u0425\u0420\u0418\u0421\u0422\u041e\u0412\u0415 \u0412\u041e\u0421\u041a\u0420\u0415\u0421\u0406\u041d\u041d\u042f. \u041f\u0410\u0421\u0425\u0410. \u0412\u0415\u041b\u0418\u041a\u0414\u0415\u041d\u042c.\u000d\u000a\u041f\u0440\u043f. \u0412\u0430\u0441\u0438\u043b\u0456\u044f, \u0441\u043f\u043e\u0432., \u0454\u043f. \u041f\u0430\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u043f\u0456\u0441\u043b\u044f 754). \u0421\u0449\u043c\u0447. \u0417\u0438\u043d\u043e\u043d\u0430, \u0454\u043f. \u000d\u000a\u0412\u0435\u0440\u043e\u043d\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 260). \u041f\u0440\u043f. \u0406\u0441\u0430\u0430\u043a\u0430 \u0421\u0438\u0440\u0456\u043d\u0430, \u0443 \u0421\u043f\u043e\u043b\u0435\u0442\u0456 \u0406\u0442\u0430\u043b\u0456\u0439\u0441\u044c\u043a\u043e\u043c\u0443 \u000d\u000a(550). \u041f\u0440\u043c\u0447\u0447. \u041c\u0438\u043d\u0438, \u0414\u0430\u0432\u0438\u0434\u0430 \u0442\u0430 \u0406\u043e\u0430\u043d\u0430 (\u043f\u0456\u0441\u043b\u044f 636). \u041f\u0440\u043f. \u0410\u043d\u0444\u0443\u0441\u0438, \u0434\u0456\u0432\u0438 \u000d\u000a(801). \u041f\u0440\u043f. \u0410\u0444\u0430\u043d\u0430\u0441\u0456\u0457, \u0456\u0433\u0443\u043c\u0435\u043d\u0456 (860).\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a12","31\u000d\u000a\u0411\u0454\u043b\u0438\u043d\u0438\u0446\u044c\u043a\u043e\u0457 (\u0425\u0406\u0406\u0406) \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456.\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 \u0417\u043e\u043b\u043e\u0442\u043e\u0443\u0441\u0442\u043e\u0433\u043e.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 1 \u0437\u0430\u0447., I, 1 \u2013 8. \u0406\u043d., 1 \u0437\u0430\u0447., I, 1 \u2013 17. \u000d\u000a\u041d\u0430 \u0432\u0435\u0447.: \u0406\u043d., 65 \u0437\u0430\u0447., XX, 19 \u2013 25.\u000d\u000a\u041f\u0456\u0441\u043b\u044f \u0447\u0438\u0442\u0430\u043d\u043d\u044f \u0414\u0456\u044f\u043d\u044c \u0441\u0432\u044f\u0442\u0438\u0445 \u0430\u043f\u043e\u0441\u0442\u043e\u043b\u0456\u0432 \u0441\u043b\u0443\u0436\u0438\u043c\u043e \u043f\u043e\u043b\u0443\u043d\u043e\u0448\u043d\u0438\u0446\u044e. \u000d\u000a\u041d\u0430 9-\u0439 \u043f\u0456\u0441\u043d\u0456 \u043a\u0430\u043d\u043e\u043d\u0443, \u043a\u043e\u043b\u0438 \u0441\u043f\u0456\u0432\u0430\u044e\u0442\u044c \u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044e \u00ab\u041d\u0435 \u0440\u0438\u0434\u0430\u0439 \u0437\u0430 \u041c\u043d\u043e\u044e, \u000d\u000a\u041c\u0430\u0442\u0438\u2026\u00bb, \u0441\u0432\u044f\u0442\u0443 \u041f\u043b\u0430\u0449\u0430\u043d\u0438\u0446\u044e \u043a\u0430\u0434\u0438\u043c\u043e \u0456 \u043f\u043e\u0442\u0456\u043c \u043d\u0430 \u0441\u043b\u043e\u0432\u0430\u0445 \u00ab...\u0432\u0441\u0442\u0430\u043d\u0443 \u0456 \u043f\u0440\u043e\u0441\u043b\u0430\u0432\u043b\u044e\u0441\u044f...\u00bb \u043f\u0456\u0434\u0456\u0439\u043c\u0430\u0454\u043c\u043e \u0456 \u0432\u043d\u043e\u0441\u0438\u043c\u043e \u0446\u0430\u0440\u0441\u044c\u043a\u0438\u043c\u0438 \u0432\u0440\u0430\u0442\u0430\u043c\u0438 \u0443 \u0432\u0456\u0432\u0442\u0430\u0440, \u0456 \u000d\u000a\u043a\u043b\u0430\u0434\u0435\u043c\u043e \u043d\u0430 \u043f\u0440\u0435\u0441\u0442\u0456\u043b, \u0432\u0440\u0430\u0442\u0430 \u0437\u0430\u0447\u0438\u043d\u044f\u044e\u0442\u044c\u0441\u044f, \u043f\u043e\u043b\u0443\u043d\u043e\u0448\u043d\u0438\u0446\u044f \u043f\u0440\u043e\u0434\u043e\u0432\u0436\u0443\u0454\u0442\u044c\u0441\u044f. \u0412\u0456\u0434\u043f\u0443\u0441\u0442 \u043a\u043e\u0440\u043e\u0442\u043a\u0438\u0439 \u00ab\u0425\u0440\u0438\u0441\u0442\u043e\u0441, \u0456\u0441\u0442\u0438\u043d\u043d\u0438\u0439 \u0411\u043e\u0433 \u043d\u0430\u0448...\u00bb. \u041e\u043f\u0456\u0432\u043d\u043e\u0447\u0456 \u000d\u000a\u043f\u043e\u0447\u0438\u043d\u0430\u0454\u0442\u044c\u0441\u044f \u0445\u0440\u0435\u0441\u043d\u0438\u0439 \u0445\u0456\u0434 \u043d\u0430\u0432\u043a\u043e\u043b\u043e \u0445\u0440\u0430\u043c\u0443 \u0437\u0456 \u0441\u043f\u0456\u0432\u043e\u043c \u0441\u0442\u0438\u0445\u0438\u0440\u0438 \u00ab\u0412\u043e\u0441\u043a\u0440\u0435\u0441\u0456\u043d\u043d\u044f \u0422\u0432\u043e\u0454, \u0425\u0440\u0438\u0441\u0442\u0435 \u0421\u043f\u0430\u0441\u0435\u2026\u00bb. \u041f\u0430\u0441\u0445\u0430\u043b\u044c\u043d\u0430 \u0440\u0430\u043d\u043d\u044f \u043f\u043e\u0447\u0438\u043d\u0430\u0454\u0442\u044c\u0441\u044f \u043f\u0435\u0440\u0435\u0434 \u0437\u0430\u0447\u0438\u043d\u0435\u043d\u0438\u043c\u0438 \u0437\u0430\u0445\u0456\u0434\u043d\u0438\u043c\u0438 (\u0432\u0445\u0456\u0434\u043d\u0438\u043c\u0438) \u0434\u0432\u0435\u0440\u0438\u043c\u0430 \u0445\u0440\u0430\u043c\u0443 \u0432\u0438\u0433\u043e\u043b\u043e\u0441\u043e\u043c \u000d\u000a\u00ab\u0421\u043b\u0430\u0432\u0430 \u0421\u0432\u044f\u0442\u0456\u0439\u2026\u00bb, \u043f\u0456\u0434 \u0447\u0430\u0441 \u0446\u044c\u043e\u0433\u043e \u0432\u0438\u0433\u043e\u043b\u043e\u0441\u0443 \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0438\u043a \u0442\u0440\u0438\u0441\u0432\u0456\u0447\u043d\u0438\u043a\u043e\u043c \u000d\u000a\u0456 \u0445\u0440\u0435\u0441\u0442\u043e\u043c \u0437\u043e\u0431\u0440\u0430\u0436\u0443\u0454 \u0445\u0440\u0435\u0441\u043d\u0435 \u0437\u043d\u0430\u043c\u0435\u043d\u043d\u044f \u043d\u0435 \u043e\u0434\u0438\u043d, \u044f\u043a \u0437\u0430 \u0437\u0432\u0438\u0447\u0430\u0439, \u0430 \u0442\u0440\u0438\u0447\u0456 \u000d\u000a\u0456 \u0434\u0430\u043b\u0456 \u0437\u0430 \u043f\u0430\u0441\u0445\u0430\u043b\u044c\u043d\u0438\u043c \u0447\u0438\u043d\u043e\u043c. \u041a\u0430\u0434\u0456\u043d\u043d\u044f \u043d\u0430 \u043a\u043e\u0436\u043d\u0456\u0439 \u043f\u0456\u0441\u043d\u0456 \u043a\u0430\u043d\u043e\u043d\u0443 \u0456 \u043c\u0430\u043b\u0430 \u000d\u000a\u0435\u043a\u0442\u0435\u043d\u0456\u044f. \u041f\u0456\u0441\u043b\u044f \u0441\u0442\u0438\u0445\u0438\u0440 \u041f\u0430\u0441\u0445\u0438 \u0447\u0438\u0442\u0430\u0454\u0442\u044c\u0441\u044f \u043f\u043e\u0432\u0447\u0430\u043b\u044c\u043d\u0435 \u0441\u043b\u043e\u0432\u043e \u0441\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 \u000d\u000a\u0417\u043e\u043b\u043e\u0442\u043e\u0443\u0441\u0442\u043e\u0433\u043e \u0456 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0439\u043e\u043c\u0443 \u0442\u0440\u043e\u043f\u0430\u0440. \u0427\u0430\u0441\u0438 \u0441\u043f\u0456\u0432\u0430\u044e\u0442\u044c\u0441\u044f \u043f\u0430\u0441\u0445\u0430\u043b\u044c\u043d\u0456. \u000d\u000a\u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u2013 \u0430\u043d\u0442\u0438\u0444\u043e\u043d\u0438 \u041f\u0430\u0441\u0445\u0438. \u0412\u0445\u0456\u0434\u043d\u0438\u0439 \u0441\u0442\u0438\u0445: \u00ab\u0412 \u0446\u0435\u0440\u043a\u0432\u0430\u0445 \u0431\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0456\u0442\u0435 \u0411\u043e\u0433\u0430, \u0413\u043e\u0441\u043f\u043e\u0434\u0430 \u0432\u0456\u0434 \u0434\u0436\u0435\u0440\u0435\u043b \u0406\u0437\u0440\u0430\u0457\u043b\u0435\u0432\u0438\u0445\u00bb. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u0442\u0440\u0438\u0441\u0432\u044f\u0442\u043e\u0433\u043e \u2013 \u00ab\u0412\u0441\u0456 \u0432\u0438, \u0449\u043e \u0432 \u0425\u0440\u0438\u0441\u0442\u0430 \u0445\u0440\u0435\u0441\u0442\u0438\u043b\u0438\u0441\u044f\u2026\u00bb. \u0417\u0430\u0434\u043e\u0441\u0442\u043e\u0439\u043d\u0438\u043a \u2013 \u00ab\u0410\u043d\u0433\u0435\u043b \u0437\u0432\u0456\u0441\u0442\u0438\u0432\u2026\u00bb, \u00ab\u0421\u0432\u0456\u0442\u0438\u0441\u044f, \u0441\u0432\u0456\u0442\u0438\u0441\u044f\u2026\u00bb. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0411\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0435\u043d\u043d\u0438\u0439, \u0425\u0442\u043e \u000d\u000a\u0439\u0434\u0435\u2026\u00bb, \u00ab\u0422\u0456\u043b\u043e \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u0435 \u043f\u0440\u0438\u0439\u043c\u0456\u0442\u044c\u2026\u00bb, \u00ab\u041c\u0438 \u0431\u0430\u0447\u0438\u043b\u0438 \u0421\u0432\u0456\u0442\u043b\u043e \u0456\u0441\u0442\u0438\u043d\u043d\u0435\u2026\u00bb, \u000d\u000a\u00ab\u041d\u0435\u0445\u0430\u0439 \u043d\u0430\u043f\u043e\u0432\u043d\u044f\u0442\u044c\u0441\u044f \u0443\u0441\u0442\u0430 \u043d\u0430\u0448\u0456\u2026\u00bb \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u00ab\u0425\u0440\u0438\u0441\u0442\u043e\u0441 \u0432\u043e\u0441\u043a\u0440\u0435\u0441 \u0456\u0437 \u000d\u000a\u043c\u0435\u0440\u0442\u0432\u0438\u0445\u2026\u00bb (\u043e\u0434\u0438\u043d \u0440\u0430\u0437), \u0430 \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u041d\u0435\u0445\u0430\u0439 \u0431\u0443\u0434\u0435 \u0456\u043c\u2019\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0454\u2026\u00bb \u0456 33-\u000d\u000a\u0433\u043e \u043f\u0441\u0430\u043b\u043c\u0430 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u00ab\u0425\u0440\u0438\u0441\u0442\u043e\u0441 \u0432\u043e\u0441\u043a\u0440\u0435\u0441 \u0456\u0437 \u043c\u0435\u0440\u0442\u0432\u0438\u0445\u2026\u00bb (\u0431\u0430\u0433\u0430\u0442\u043e \u0440\u0430\u0437\u0456\u0432). \u000d\u000a\u041f\u0456\u0441\u043b\u044f \u0437\u0430\u0430\u043c\u0432\u043e\u043d\u043d\u043e\u0457 \u043c\u043e\u043b\u0438\u0442\u0432\u0438 \u043e\u0441\u0432\u044f\u0447\u0443\u0454\u0442\u044c\u0441\u044f \u0430\u0440\u0442\u043e\u0441. \u0412\u0456\u0434\u043f\u0443\u0441\u0442 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u043f\u0430\u0441\u0445\u0430\u043b\u044c\u043d\u0438\u0439, \u0431\u0435\u0437 \u0437\u0433\u0430\u0434\u043a\u0438 \u0441\u0432\u044f\u0442\u0438\u0445. \u041d\u0430 \u0432\u0435\u0447\u0456\u0440\u043d\u0456: \u0441\u043b\u0443\u0436\u0438\u043c\u043e \u0443 \u043f\u043e\u0432\u043d\u043e\u043c\u0443 \u043e\u0431\u043b\u0430\u0447\u0435\u043d\u043d\u0456, \u0432\u0445\u0456\u0434 \u0456\u0437 \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454\u043c. \u041f\u0456\u0441\u043b\u044f \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043f\u0440\u043e\u043a\u0438\u043c\u043d\u0430 \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0438\u043a \u0447\u0438\u0442\u0430\u0454 \u000d\u000a\u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454 \u0432 \u0446\u0430\u0440\u0441\u044c\u043a\u0438\u0445 \u0432\u0440\u0430\u0442\u0430\u0445 \u043e\u0431\u043b\u0438\u0447\u0447\u044f\u043c \u0434\u043e \u043d\u0430\u0440\u043e\u0434\u0443.\u000d\u000a\u041f\u0430\u0441\u0445\u0430\u043b\u044c\u043d\u0438\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c. \u0417\u0430\u0433\u0430\u043b\u044c\u043d\u0438\u0446\u044f. \u0421\u0432\u0456\u0442\u043b\u0438\u0439 \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a. \u0421\u0449\u043c\u0447. \u000d\u000a\u0410\u0440\u0442\u0435\u043c\u043e\u043d\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 \u041b\u0430\u043e\u0434\u0438\u043a\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (303). \u041c\u0447. \u041a\u0440\u0438\u0441\u043a\u0435\u043d\u0442\u0430 \u0437 \u041c\u0438\u0440 \u000d\u000a\u041b\u0456\u043a\u0456\u0439\u0441\u044c\u043a\u0438\u0445. \u041c\u0446. \u0424\u043e\u043c\u0430\u0457\u0434\u0438 \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0457 (476).\u000d\u000a\u0414\u0456\u044f\u043d., 2 \u0437\u0430\u0447., I, 12 \u2013 17, 21 \u2013 26. \u0406\u043d., 2 \u0437\u0430\u0447., I, 18 \u2013 28.\u000d\u000a\u041f\u043e\u0440\u044f\u0434\u043e\u043a \u0441\u043b\u0443\u0436\u0431\u0438, \u044f\u043a \u0443 \u043f\u0435\u0440\u0448\u0438\u0439 \u0434\u0435\u043d\u044c \u041f\u0430\u0441\u0445\u0438. \u041f\u043e\u0447\u0430\u0442\u043e\u043a \u0440\u0430\u043d\u043d\u044c\u043e\u0457 \u0443 \u0432\u0456\u0432\u0442\u0430\u0440\u0456. \u041d\u0430 \u043a\u0430\u043d\u043e\u043d\u0456 \u0434\u043e\u0434\u0430\u044e\u0442\u044c\u0441\u044f \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0447\u043d\u0456. \u0415\u043a\u0442\u0435\u043d\u0456\u044f \u043f\u0456\u0441\u043b\u044f 3-\u043e\u0457, 6-\u043e\u0457 \u0456 9-\u043e\u0457 \u043f\u0456\u0441\u0435\u043d\u044c. \u041a\u0430\u0434\u0456\u043d\u043d\u044f \u2013 \u043d\u0430 1-\u0456\u0439, 4-\u0456\u0439, 7-\u0456\u0439 \u0456 9-\u0456\u0439 \u043f\u0456\u0441\u043d\u044f\u0445 \u043a\u0430\u043d\u043e\u043d\u0443. \u0427\u0430\u0441\u0438 \u043f\u0430\u0441\u0445\u0430\u043b\u044c\u043d\u0456. \u000d\u000a\u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0430\u043d\u0442\u0438\u0444\u043e\u043d\u0438 \u041f\u0430\u0441\u0445\u0438, \u0412\u0445\u0456\u0434\u043d\u0438\u0439 \u0441\u0442\u0438\u0445: \u00ab\u0412 \u0446\u0435\u0440\u043a\u0432\u0430\u0445 \u0431\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0456\u0442\u0435 \u0411\u043e\u0433\u0430, \u0413\u043e\u0441\u043f\u043e\u0434\u0430 \u0432\u0456\u0434 \u0434\u0436\u0435\u0440\u0435\u043b \u0406\u0437\u0440\u0430\u0457\u043b\u0435\u0432\u0438\u0445\u00bb, \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u0422\u0440\u0438\u0441\u0432\u044f\u0442\u043e\u0433\u043e \u2013 \u00ab\u0412\u0441\u0456 \u0432\u0438, \u0449\u043e \u0432 \u0425\u0440\u0438\u0441\u0442\u0430 \u0445\u0440\u0435\u0441\u0442\u0438\u043b\u0438\u0441\u044f\u2026\u00bb, \u0437\u0430\u0434\u043e\u0441\u0442\u043e\u0439\u043d\u0438\u043a \u041f\u0430\u0441\u0445\u0438. \u0417\u0430\u043a\u0456\u043d\u0447\u0435\u043d\u043d\u044f \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u2013 \u044f\u043a \u0443 \u043f\u0435\u0440\u0448\u0438\u0439 \u0434\u0435\u043d\u044c \u041f\u0430\u0441\u0445\u0438. \u0417 \u0442\u0430\u043a\u0438\u043c\u0438 \u0436 \u043e\u0441\u043e\u0431\u043b\u0438\u0432\u043e\u0441\u0442\u044f\u043c\u0438 \u000d\u000a\u0437\u0432\u0435\u0440\u0448\u0443\u044e\u0442\u044c\u0441\u044f \u0441\u043b\u0443\u0436\u0431\u0438 \u0432 \u0443\u0441\u0456 \u0434\u043d\u0456 \u0441\u0432\u0456\u0442\u043b\u043e\u0433\u043e \u0442\u0438\u0436\u043d\u044f.\u000d\u000a\u0421\u0432\u0456\u0442\u043b\u0438\u0439 \u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a. \u0406\u0432\u0435\u0440\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u000d\u000a\u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0443 \u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a \u0421\u0432\u0456\u0442\u043b\u043e\u0433\u043e \u0442\u0438\u0436\u043d\u044f). \u0421\u0432\u0442. \u041c\u0430\u0440\u0442\u0438\u043d\u0430, \u0441\u043f\u043e\u0432., \u043f\u0430\u043f\u0438 \u000d\u000a\u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (655). \u041c\u0447\u0447. \u0410\u043d\u0442\u043e\u043d\u0456\u044f, \u0406\u043e\u0430\u043d\u0430 \u0456 \u0404\u0432\u0441\u0442\u0430\u0444\u0456\u044f \u041b\u0438\u0442\u043e\u0432\u0441\u044c\u043a\u0438\u0445 \u000d\u000a(1347). \u041c\u0447. \u0410\u0440\u0434\u0430\u043b\u0456\u043e\u043d\u0430 (305 \u2013 311). \u041c\u0447\u0447. 1000 \u043f\u0435\u0440\u0441\u044c\u043a\u0438\u0445 \u0456 \u0410\u0437\u0430\u0442\u0430, \u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a13\u000d\u000a14","\u0441\u043a\u043e\u043f\u0446\u044f (\u0431\u043b. 341). \u041c\u0447\u0447. \u0425\u0440\u0438\u0441\u0442\u043e\u0434\u0443\u043b\u0430 \u0439 \u0410\u043d\u0430\u0441\u0442\u0430\u0441\u0456\u0457 \u041f\u0430\u0442\u0440\u0441\u044c\u043a\u0438\u0445, \u0432\u0431\u0438\u0442\u0438\u0445 \u0432 \u000d\u000a\u0410\u0445\u0430\u0457 (1821). \u041f\u0440\u043c\u0447\u0447. \u043e\u0442\u0446\u0456\u0432 \u0414\u0430\u0432\u0438\u0434\u043e-\u0413\u0430\u0440\u0435\u0434\u0436\u0438\u0439\u0441\u044c\u043a\u0438\u0445 (\u0425V\u0406\u0406, \u0413\u0440\u0443\u0437.) (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0443 \u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a \u0421\u0432\u0456\u0442\u043b\u043e\u0433\u043e \u0442\u0438\u0436\u043d\u044f).\u000d\u000a\u0414\u0456\u044f\u043d., 4 \u0437\u0430\u0447., II, 14 \u2013 21. \u041b\u043a., 113 \u0437\u0430\u0447., XXIV, 12 \u2013 35.\u000d\u000a\u0421\u0432\u0456\u0442\u043b\u0430 \u0441\u0435\u0440\u0435\u0434\u0430. \u0412\u0438\u0448\u0433\u043e\u0440\u043e\u0434\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (\u0406). \u0410\u043f\u043f. \u0432\u0456\u0434 \u000d\u000a70-\u0445 \u0410\u0440\u0438\u0441\u0442\u0430\u0440\u0445\u0430, \u041f\u0443\u0434\u0430 \u0456 \u0422\u0440\u043e\u0444\u0438\u043c\u0430 (\u0431\u043b. 67). \u041c\u0446\u0446. \u0412\u0430\u0441\u0438\u043b\u0456\u0441\u0438 \u0439 \u0410\u043d\u0430\u0441\u0442\u0430\u0441\u0456\u0457 \u000d\u000a(\u0431\u043b. 68). \u041c\u0447\u0447. \u041c\u0435\u0441\u0443\u043a\u0435\u0432\u0456\u0439\u0441\u044c\u043a\u0438\u0445 \u0421\u0443\u0445\u0456\u044f \u0456 \u0432\u043e\u0457\u043d\u0456\u0432 \u0439\u043e\u0433\u043e: \u0410\u043d\u0434\u0440\u0456\u044f, \u0410\u043d\u0430\u0441\u0442\u0430\u0441\u0456\u044f, \u000d\u000a\u0422\u0430\u043b\u0430\u043b\u0435, \u0424\u0435\u043e\u0434\u043e\u0440\u0438\u0442\u0430, \u0406\u0432\u0445\u0438\u0440\u0456\u043e\u043d\u0430, \u0419\u043e\u0440\u0434\u0430\u043d\u0430, \u041a\u0456\u043d\u0434\u0440\u0430\u0442\u0430, \u041b\u0443\u043a\u0456\u0430\u043d\u0430, \u041c\u0438\u043c\u043d\u0435\u043d\u043e\u0441\u0430, \u041d\u0435\u0440\u0430\u043d\u0433\u0456\u043e\u0441\u0430, \u041f\u043e\u043b\u0456\u0454\u0432\u043a\u0442\u0430, \u042f\u043a\u043e\u0432\u0430, \u0424\u043e\u043a\u0438, \u0414\u043e\u043c\u0435\u043d\u0442\u0456\u0430\u043d\u0430, \u0412\u0456\u043a\u0442\u043e\u0440\u0430, \u0417\u043e\u0441\u0438\u043c\u0438 (100 \u2013 130, \u0413\u0440\u0443\u0437.). \u041c\u0447. \u0421\u0430\u0432\u0438 \u0413\u043e\u0442\u0441\u044c\u043a\u043e\u0433\u043e (372). \u0411\u043b\u0433\u0432. \u043a\u043d. \u041c\u0441\u0442\u0438\u0441\u043b\u0430\u0432\u0430 \u0412\u043e\u043b\u043e\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u0438\u0447\u0430 (1132). \u0421\u043e\u0431\u043e\u0440 \u043f\u0440\u0435\u043f\u043e\u0434\u043e\u0431\u043d\u0438\u0445 \u043e\u0442\u0446\u0456\u0432, \u044f\u043a\u0456 \u043d\u0430 \u000d\u000a\u0433\u043e\u0440\u0456 \u0421\u0438\u043d\u0430\u0439 \u043f\u043e\u0434\u0432\u0438\u0437\u0430\u043b\u0438\u0441\u044f (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 \u0441\u0435\u0440\u0435\u0434\u0443 \u0421\u0432\u0456\u0442\u043b\u043e\u0433\u043e \u000d\u000a\u0442\u0438\u0436\u043d\u044f).\u000d\u000a\u0412\u0456\u043b\u0435\u043d\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456. \u041a\u0430\u0441\u043f\u0435\u0440\u0456\u0432\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 \u0441\u0435\u0440\u0435\u0434\u0443 \u0421\u0432\u0456\u0442\u043b\u043e\u0433\u043e \u0442\u0438\u0436\u043d\u044f).\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 5 \u0437\u0430\u0447., II, 22 \u2013 36. \u0406\u043d., 4 \u0437\u0430\u0447., I, 35 \u2013 51.\u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456: \u0424\u043b\u043f., 240 \u0437\u0430\u0447., II, 5 \u2013 11. \u041b\u043a., 54 \u0437\u0430\u0447., X, 38 \u2013 42; XI, 27 \u2013 28.\u000d\u000a\u0414\u043e \u041f\u0430\u0441\u0445\u0430\u043b\u044c\u043d\u043e\u0457 \u0432\u0456\u0434\u043f\u0440\u0430\u0432\u0438 \u0434\u043e\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0441\u043b\u0443\u0436\u0431\u0430 \u0412\u0438\u0448\u0433\u043e\u0440\u043e\u0434\u0441\u044c\u043a\u0456\u0439 \u0456\u043a\u043e\u043d\u0456 \u0411\u043e\u0436\u043e\u0457 \u000d\u000a\u041c\u0430\u0442\u0435\u0440\u0456 \u0437 \u041c\u0456\u043d\u0435\u0457.\u000d\u000a\u0421\u0432\u0456\u0442\u043b\u0438\u0439 \u0447\u0435\u0442\u0432\u0435\u0440. \u041c\u0446\u0446. \u0410\u0433\u0430\u0444\u0456\u0457, \u0406\u0440\u0438\u043d\u0438 \u0442\u0430 \u0425\u0456\u043e\u043d\u0456\u0457 (304). \u041c\u0447. \u041b\u0435\u043e\u043d\u0456\u0434\u0430 \u0456 \u043c\u0446\u0446. \u000d\u000a\u0425\u0430\u0440\u0456\u0454\u0441\u0438, \u041d\u0456\u043a\u0438, \u0413\u0430\u043b\u0438\u043d\u0438, \u041a\u0430\u043b\u0456\u0441\u0438, \u041d\u0443\u043d\u0435\u0445\u0456\u0457, \u0412\u0430\u0441\u0438\u043b\u0456\u0441\u0438, \u0424\u0435\u043e\u0434\u043e\u0440\u0438, \u0406\u0440\u0438\u043d\u0438 \u0442\u0430 \u000d\u000a\u0456\u043d\u0448\u0438\u0445 (258).\u000d\u000a\u0406\u043b\u043b\u0456\u043d\u0441\u044c\u043a\u043e-\u0427\u0435\u0440\u043d\u0456\u0433\u0456\u0432\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (1658).\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 6 \u0437\u0430\u0447., II, 38 \u2013 43. \u0406\u043d., 8 \u0437\u0430\u0447., III, 1 \u2013 15.\u000d\u000a\u0421\u0432\u0456\u0442\u043b\u0430 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044f. \u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u0416\u0438\u0432\u043e\u043d\u043e\u0441\u043d\u0435 \u0434\u0436\u0435\u0440\u0435\u043b\u043e\u00bb \u000d\u000a(\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0443 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e \u0421\u0432\u0456\u0442\u043b\u043e\u0433\u043e \u0442\u0438\u0436\u043d\u044f). \u0421\u0449\u043c\u0447\u0447. \u0421\u0438\u043c\u0435\u043e\u043d\u0430, \u000d\u000a\u0454\u043f. \u041f\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u0437 \u043d\u0438\u043c \u0410\u0432\u0434\u0435\u043b\u0430\u044f \u0456 \u0410\u043d\u0430\u043d\u0456\u0457, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0456\u0432, \u043c\u0447\u0447. \u0425\u0443\u0441\u0434\u0430\u0437\u0430\u0442\u0430 \u000d\u000a(\u0423\u0441\u0444\u0430\u0437\u0430\u043d\u0430), \u0454\u0432\u043d\u0443\u0445\u0430, \u0424\u0443\u0441\u0438\u043a\u0430, \u0410\u0437\u0430\u0442\u0430, \u043c\u0446. \u0410\u0441\u043a\u0438\u0442\u0440\u0435\u0457 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 \u0431\u0430\u0433\u0430\u0442\u044c\u043e\u0445 \u000d\u000a(344). \u041f\u0440\u043f. \u0410\u043a\u0430\u043a\u0456\u044f, \u0454\u043f. \u041c\u0435\u043b\u0456\u0442\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 435). \u041c\u0447. \u0410\u0434\u0440\u0456\u0430\u043d\u0430 (251). \u000d\u000a\u0421\u0432\u0442. \u0410\u0433\u0430\u043f\u0456\u0442\u0430, \u043f\u0430\u043f\u0438 \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (536).\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 7 \u0437\u0430\u0447., III, 1 \u2013 8. \u0406\u043d., 7 \u0437\u0430\u0447., II, 12 \u2013 22.\u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456: \u0424\u043b\u043f., 240 \u0437\u0430\u0447., II, 5 \u2013 11. \u041b\u043a., 54 \u0437\u0430\u0447., X, 38 \u2013 42; XI, 27 \u2013 28.\u000d\u000a\u0414\u043e \u041f\u0430\u0441\u0445\u0430\u043b\u044c\u043d\u043e\u0457 \u0432\u0456\u0434\u043f\u0440\u0430\u0432\u0438 \u0434\u043e\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0441\u043b\u0443\u0436\u0431\u0430 \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u0456\u0439 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456 \u043d\u0430 \u000d\u000a\u0447\u0435\u0441\u0442\u044c \u0457\u0457 \u0456\u043a\u043e\u043d\u0438 \u00ab\u0416\u0438\u0432\u043e\u043d\u043e\u0441\u043d\u0435 \u0434\u0436\u0435\u0440\u0435\u043b\u043e\u00bb (\u0432 \u0422\u0440\u0456\u043e\u0434\u0456 \u043a\u0432\u0456\u0442\u043d\u0456\u0439). \u041f\u0456\u0441\u043b\u044f \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457, \u0437\u0430 \u000d\u000a\u0437\u0432\u0438\u0447\u0430\u0454\u043c, \u0437\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f \u043c\u0430\u043b\u0435 \u043e\u0441\u0432\u044f\u0447\u0435\u043d\u043d\u044f \u0432\u043e\u0434\u0438. \u000d\u000a\u0421\u0432\u0456\u0442\u043b\u0430 \u0441\u0443\u0431\u043e\u0442\u0430. \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430, \u0443\u0447\u043d\u044f \u043f\u0440\u043f. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f \u0414\u0435\u043a\u0430\u043f\u043e\u043b\u0456\u0442\u0430 (820 \u2013 850). \u000d\u000a\u041c\u0447\u0447. \u0412\u0456\u043a\u0442\u043e\u0440\u0430, \u0417\u043e\u0442\u0438\u043a\u0430, \u0417\u0438\u043d\u043e\u043d\u0430, \u0410\u043a\u0438\u043d\u0434\u0438\u043d\u0430 \u0456 \u0421\u0435\u0432\u0435\u0440\u0456\u0430\u043d\u0430 (303). \u0421\u0432\u0442. \u041a\u043e\u0441\u043c\u0438, \u0441\u043f\u043e\u0432., \u0454\u043f. \u0425\u0430\u043b\u043a\u0456\u0434\u043e\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u043f\u0440\u043f. \u0410\u0432\u043a\u0441\u0435\u043d\u0442\u0456\u044f (815 \u2013 820). \u041c\u0447. \u0406\u043e\u0430\u043d\u0430 \u000d\u000a\u041d\u043e\u0432\u043e\u0433\u043e \u0437 \u042f\u043d\u0456\u043d\u0438 (1526).\u000d\u000a\u041c\u0430\u043a\u0441\u0438\u043c\u0456\u0432\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (1299).\u000d\u000a\u0414\u0456\u044f\u043d., 8 \u0437\u0430\u0447., III, 11 \u2013 16. \u0406\u043d., 11 \u0437\u0430\u0447., III, 22 \u2013 33.\u000d\u000a\u041f\u0456\u0441\u043b\u044f \u0437\u0430\u0430\u043c\u0432\u043e\u043d\u043d\u043e\u0457 \u043c\u043e\u043b\u0438\u0442\u0432\u0438 \u043d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0447\u0438\u0442\u0430\u0454\u0442\u044c\u0441\u044f \u043c\u043e\u043b\u0438\u0442\u0432\u0430 \u043d\u0430 \u0440\u043e\u0437\u0434\u0440\u043e\u0431\u043b\u0435\u043d\u043d\u044f \u0430\u0440\u0442\u043e\u0441\u0430, \u0456 \u0432\u0456\u0434\u0431\u0443\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0440\u043e\u0437\u0434\u0440\u043e\u0431\u043b\u0435\u043d\u043d\u044f \u0442\u0430 \u0440\u043e\u0437\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0430\u0440\u0442\u043e\u0441 \u0432\u0456\u0440\u043d\u0438\u043c. \u041f\u0435\u0440\u0435\u0434 9-\u043c \u0447\u0430\u0441\u043e\u043c \u0437\u0430\u0447\u0438\u043d\u044f\u044e\u0442\u044c\u0441\u044f \u0446\u0430\u0440\u0441\u044c\u043a\u0456 \u0432\u0440\u0430\u0442\u0430.\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a15\u000d\u000a16\u000d\u000a17\u000d\u000a18\u000d\u000a32","33\u000d\u000a\u0410\u043d\u0442\u0438\u043f\u0430\u0441\u0445\u0430. 2-\u0433\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u0430\u0441\u0445\u0438, \u0430\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u0424\u043e\u043c\u0438.\u000d\u000a\u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430 \u0414\u0430\u0432\u043d\u044c\u043e\u043f\u0435\u0447\u0435\u0440\u043d\u0438\u043a\u0430 (V\u0406\u0406\u0406). \u041c\u0447\u0447. \u0424\u0435\u043e\u043d\u0438, \u0425\u0440\u0438\u0441\u0442\u043e\u0444\u043e\u0440\u0430 \u0439 \u0410\u043d\u0442\u043e\u043d\u0456\u043d\u0430 (303). \u0421\u0449\u043c\u0447. \u041f\u0430\u0444\u043d\u0443\u0442\u0456\u044f, \u0454\u043f. \u0404\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e. \u0421\u0432\u0442. \u0413\u0435\u043e\u0440\u0433\u0456\u044f, \u0441\u043f\u043e\u0432., \u000d\u000a\u0454\u043f. \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0457 \u041f\u0456\u0441\u0456\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (813 \u2013 820). \u0421\u0432\u0442. \u0422\u0440\u0438\u0444\u043e\u043d\u0430, \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (933). \u041f\u0440\u043f. \u041d\u0438\u043a\u0438\u0444\u043e\u0440\u0430, \u0456\u0433\u0443\u043c\u0435\u043d\u0430.\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 1-\u0435, \u041c\u0444., 116 \u0437\u0430\u0447., XXVIII, 16 \u2013 20.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 14 \u0437\u0430\u0447., V, 12 \u2013 20. \u0406\u043d., 65 \u0437\u0430\u0447., XX, 19 \u2013 31.\u000d\u000a\u0412\u0456\u0434 \u0441\u044c\u043e\u0433\u043e\u0434\u043d\u0456 \u0449\u043e\u0434\u043d\u044f \u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u041f\u0430\u0441\u0445\u0438 \u0431\u043e\u0433\u043e\u0441\u043b\u0443\u0436\u0456\u043d\u043d\u044f \u043f\u0456\u0441\u043b\u044f \u0432\u0438\u0433\u043e\u043b\u043e\u0441\u0443 \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0438\u043a\u0430 \u043f\u043e\u0447\u0438\u043d\u0430\u0454\u0442\u044c\u0441\u044f \u0442\u0440\u0438\u0440\u0430\u0437\u043e\u0432\u0438\u043c \u0447\u0438\u0442\u0430\u043d\u043d\u044f\u043c \u0430\u0431\u043e \u0441\u043f\u0456\u0432\u043e\u043c \u000d\u000a\u00ab\u0425\u0440\u0438\u0441\u0442\u043e\u0441 \u0432\u043e\u0441\u043a\u0440\u0435\u0441 \u0456\u0437 \u043c\u0435\u0440\u0442\u0432\u0438\u0445\u2026\u00bb. \u0412 \u0443\u0441\u0456 \u043d\u0435\u0434\u0456\u043b\u044c\u043d\u0456 \u0434\u043d\u0456 \u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u041f\u0430\u0441\u0445\u0438 \u00ab\u0427\u0435\u0441\u043d\u0456\u0448\u0443..\u00bb \u043d\u0435 \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e. \u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0422\u0435\u0431\u0435, \u000d\u000a\u0416\u0438\u0442\u0442\u0454\u0434\u0430\u0432\u0447\u0435 \u0425\u0440\u0438\u0441\u0442\u0435, \u0449\u043e \u0437\u0430\u0440\u0430\u0434\u0438 \u043d\u0430\u0441 \u0443 \u043f\u0435\u043a\u043b\u043e \u0437\u0456\u0439\u0448\u043e\u0432 \u0456 \u0437 \u0421\u043e\u0431\u043e\u044e \u0432\u0441\u0456\u0445 \u0432\u043e\u0441\u043a\u0440\u0435\u0441\u0438\u0432\u00bb. \u041f\u0456\u0441\u043b\u044f \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u044f \u0443 \u0432\u0441\u0456 \u043d\u0435\u0434\u0456\u043b\u0456 \u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u041f\u0430\u0441\u0445\u0438 \u2013 \u00ab\u0412\u043e\u0441\u043a\u0440\u0435\u0441\u0456\u043d\u043d\u044f \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u0435 \u0431\u0430\u0447\u0438\u0432\u0448\u0438\u2026\u00bb \u2013 (\u0442\u0440\u0438\u0447\u0456). \u041f\u0430\u0441\u0445\u0430\u043b\u044c\u043d\u0438\u0439 \u043a\u0430\u043d\u043e\u043d \u0432 \u0446\u044e \u043d\u0435\u0434\u0456\u043b\u044e \u000d\u000a\u043d\u0435 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f. \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0437\u0430\u0434\u043e\u0441\u0442\u043e\u0439\u043d\u0438\u043a \u00ab\u0410\u043d\u0433\u0435\u043b \u0437\u0432\u0456\u0441\u0442\u0438\u0432\u2026\u00bb, \u00ab\u0421\u0432\u0456\u0442\u0438\u0441\u044f, \u000d\u000a\u0441\u0432\u0456\u0442\u0438\u0441\u044f\u2026\u00bb (\u0442\u0430\u043a \u0449\u043e\u0434\u043d\u044f, \u043a\u0440\u0456\u043c \u041f\u0435\u0440\u0435\u043f\u043e\u043b\u043e\u0432\u0435\u043d\u043d\u044f \u0456 \u0439\u043e\u0433\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f). \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u000d\u000a\u00ab\u041c\u0438 \u0431\u0430\u0447\u0438\u043b\u0438 \u0421\u0432\u0456\u0442\u043b\u043e \u0456\u0441\u0442\u0438\u043d\u043d\u0435\u2026\u00bb \u2013 \u00ab\u0425\u0440\u0438\u0441\u0442\u043e\u0441 \u0432\u043e\u0441\u043a\u0440\u0435\u0441\u2026\u00bb (\u043e\u0434\u0438\u043d \u0440\u0430\u0437), \u0430 \u000d\u000a\u043f\u0435\u0440\u0435\u0434 \u0432\u0456\u0434\u043f\u0443\u0441\u0442\u043e\u043c \u043f\u0456\u0441\u043b\u044f \u00ab\u0421\u043b\u0430\u0432\u0430 \u0422\u043e\u0431\u0456, \u0425\u0440\u0438\u0441\u0442\u0435 \u0411\u043e\u0436\u0435, \u043d\u0430\u0434\u0456\u0454 \u043d\u0430\u0448\u0430, \u0441\u043b\u0430\u0432\u0430 \u000d\u000a\u0422\u043e\u0431\u0456\u00bb \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0442\u0440\u0438\u0447\u0456. \u0412\u0456\u0434\u043f\u0443\u0441\u0442 \u0432\u043e\u0441\u043a\u0440\u0435\u0441\u043d\u0438\u0439: \u00ab\u0425\u0440\u0438\u0441\u0442\u043e\u0441, \u0449\u043e \u0432\u043e\u0441\u043a\u0440\u0435\u0441 \u0456\u0437 \u000d\u000a\u043c\u0435\u0440\u0442\u0432\u0438\u0445, \u0456\u0441\u0442\u0438\u043d\u043d\u0438\u0439 \u0411\u043e\u0433 \u043d\u0430\u0448...\u00bb (\u0442\u0430\u043a \u0456 \u0443 \u0432\u0441\u0456 \u0434\u043d\u0456 \u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u041f\u0430\u0441\u0445\u0438 \u0432\u043a\u043b\u044e\u0447\u043d\u043e). \u0412\u0435\u0447\u0456\u0440\u043d\u044f \u0432 \u043d\u0435\u0434\u0456\u043b\u044e \u0410\u043d\u0442\u0438\u043f\u0430\u0441\u0445\u0438 \u0456\u0437 \u0432\u0445\u043e\u0434\u043e\u043c \u0456 \u0432\u0435\u043b\u0438\u043a\u0438\u043c \u043f\u0440\u043e\u043a\u0438\u043c\u043d\u043e\u043c.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a19\u000d\u000a2-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u0430\u0441\u0445\u0438 (\u041f\u0440\u043e\u0432\u043e\u0434\u0438). \u041f\u0440\u0430\u0432. \u0417\u0430\u043a\u0445\u0435\u044f, \u0454\u043f. \u041a\u0435\u0441\u0430\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u043a\u043e\u043b\u0438\u0448\u043d\u044c\u043e\u0433\u043e \u043c\u0438\u0442\u0430\u0440\u044f (\u0406). \u041f\u0440\u043f. \u0424\u0435\u0434\u043e\u0440\u0430 \u0422\u0440\u0438\u0445\u0456\u043d\u0438. \u0421\u0432\u0442\u0442. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f \u000d\u000a(593) \u0456 \u0410\u043d\u0430\u0441\u0442\u0430\u0441\u0456\u044f \u0421\u0438\u043d\u0430\u0457\u0442\u0430 (599), \u043f\u0430\u0442\u0440\u0456\u0430\u0440\u0445\u0456\u0432 \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u0438\u0445. \u041f\u0440\u043f. \u0410\u043d\u0430\u0441\u0442\u0430\u0441\u0456\u044f, \u0456\u0433\u0443\u043c. \u0421\u0438\u043d\u0430\u0439\u0441\u044c\u043a\u043e\u0457 \u0433\u043e\u0440\u0438 (695). \u041c\u0447. \u0434\u0438\u0442\u044f\u0442\u0438 \u0413\u0430\u0432\u0440\u0438\u0457\u043b\u0430 \u0411\u0456\u043b\u043e\u0441\u0442\u043e\u0446\u044c\u043a\u043e\u0433\u043e (1690). \u000d\u000a\u041a\u0456\u043f\u0440\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (392).\u000d\u000a\u0414\u0456\u044f\u043d., 9 \u0437\u0430\u0447., III, 19\u201326. \u0406\u043d., 6 \u0437\u0430\u0447., II, 1\u201311.\u000d\u000a\u0412\u0456\u0434 \u0441\u044c\u043e\u0433\u043e\u0434\u043d\u0456 \u0443 \u0431\u0443\u0434\u043d\u0456 \u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u041f\u0430\u0441\u0445\u0438 \u043f\u0435\u0440\u0435\u0434 \u043a\u0430\u043d\u043e\u043d\u043e\u043c \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u000d\u000a\u00ab\u0412\u043e\u0441\u043a\u0440\u0435\u0441\u0456\u043d\u043d\u044f \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u0435 \u0431\u0430\u0447\u0438\u0432\u0448\u0438\u2026\u00bb (\u043e\u0434\u0438\u043d \u0440\u0430\u0437). \u0421\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u00ab\u0427\u0435\u0441\u043d\u0456\u0448\u0443...\u00bb. \u041a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f, \u043a\u043e\u043b\u0438 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0432\u0435\u043b\u0438\u043a\u0435 \u0441\u043b\u0430\u0432\u043e\u0441\u043b\u0456\u0432\u2019\u044f, \u2013 \u00ab\u0412\u043e\u0441\u043a\u0440\u0435\u0441\u0456\u043d\u043d\u044f \u000d\u000a\u0434\u0435\u043d\u044c\u2026\u00bb. \u00ab\u0426\u0430\u0440\u044e \u041d\u0435\u0431\u0435\u0441\u043d\u0438\u0439\u2026\u00bb \u043d\u0435 \u0447\u0438\u0442\u0430\u0454\u0442\u044c\u0441\u044f \u0434\u043e \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0423 \u043f\u0435\u0440\u0456\u043e\u0434 \u000d\u000a\u0422\u0440\u0456\u043e\u0434\u0456 \u043a\u0432\u0456\u0442\u043d\u043e\u0457 \u043d\u0430 \u043b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0443 \u0432\u0441\u0456 \u0434\u043d\u0456 \u0410\u043f\u043e\u0441\u0442\u043e\u043b \u0456 \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454 \u0434\u043d\u044f \u0447\u0438\u0442\u0430\u0454\u0442\u044c\u0441\u044f \u000d\u000a\u043f\u0435\u0440\u0448\u0438\u043c, \u043f\u043e\u0442\u0456\u043c \u0447\u0438\u0442\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0438\u043c.\u000d\u000a\u0426\u044c\u043e\u0433\u043e \u0442\u0438\u0436\u043d\u044f \u0437\u0430 \u0442\u0440\u0430\u0434\u0438\u0446\u0456\u0454\u044e \u0437\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f \u043f\u043e\u043c\u0438\u043d\u0430\u043d\u043d\u044f \u043f\u043e\u043c\u0435\u0440\u043b\u0438\u0445.\u000d\u000a\u0421\u0449\u043c\u0447. \u042f\u043d\u0443\u0430\u0440\u0456\u044f, \u0454\u043f., \u0456 \u0437 \u043d\u0438\u043c \u0441\u0449\u043c\u0447\u0447. \u041f\u0440\u043e\u043a\u0443\u043b\u0430, \u0421\u043e\u0441\u0441\u0456\u044f \u0456 \u0424\u0430\u0432\u0441\u0442\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0456\u0432, \u043c\u0447\u0447. \u0414\u0438\u0441\u0438\u0434\u0435\u0440\u0456\u044f, \u0447\u0438\u0442\u0446\u044f, \u0404\u0432\u0442\u0438\u0445\u0456\u044f \u0456 \u0410\u043a\u0443\u0442\u0456\u043e\u043d\u0430 (\u0431\u043b. 305). \u041c\u0447\u0447. \u0424\u0435\u0434\u043e\u0440\u0430, \u000d\u000a\u0449\u043e \u0432 \u041f\u0435\u0440\u0433\u0456\u0457, \u043c\u0430\u0442\u0435\u0440\u0456 \u0439\u043e\u0433\u043e \u0424\u0438\u043b\u0438\u043f\u0456\u0457, \u0414\u0456\u043e\u0441\u043a\u043e\u0440\u0430, \u0421\u043e\u043a\u0440\u0430\u0442\u0430 \u0456 \u0414\u0456\u043e\u043d\u0456\u0441\u0456\u044f (138 \u2013 \u000d\u000a161). \u041c\u0447\u0447. \u0406\u0441\u0430\u0430\u043a\u0456\u044f, \u0410\u043f\u043e\u043b\u043e\u0441\u0430 \u0456 \u041a\u0456\u043d\u0434\u0440\u0430\u0442\u0430 (303). \u0421\u0432\u0442. \u041c\u0430\u043a\u0441\u0438\u043c\u0456\u0430\u043d\u0430, \u043f\u0430\u0442\u0440\u0456\u0430\u0440\u0445\u0430 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (434).\u000d\u000a\u0414\u0456\u044f\u043d., 10 \u0437\u0430\u0447., IV, 1 \u2013 10. \u0406\u043d., 10 \u0437\u0430\u0447., III, 16 \u2013 21.\u000d\u000a\u0410\u043f\u043f. \u041d\u0430\u0444\u0430\u043d\u0430\u0457\u043b\u0430, \u041b\u0443\u043a\u0438 \u0442\u0430 \u041a\u043b\u0438\u043c\u0435\u043d\u0442\u0430 (\u0406). \u041f\u0440\u043f. \u0424\u0435\u0434\u043e\u0440\u0430 \u0421\u0438\u043a\u0435\u043e\u0442\u0430, \u000d\u000a\u0454\u043f. \u0410\u043d\u0430\u0441\u0442\u0430\u0441\u0456\u0443\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (613). \u041f\u0440\u043f. \u0412\u0456\u0442\u0430\u043b\u0456\u044f (609 \u2013 620). \u000d\u000a\u0414\u0456\u044f\u043d., 11 \u0437\u0430\u0447., IV, 13 \u2013 22. \u0406\u043d., 15 \u0437\u0430\u0447., V, 17 \u2013 24.\u000d\u000a20\u000d\u000a21\u000d\u000a22\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430","34\u000d\u000a\u0412\u043c\u0447. \u042e\u0440\u0456\u044f \u041f\u0435\u0440\u0435\u043c\u043e\u0436\u0446\u044f (303). \u041c\u0446. \u0446\u0430\u0440\u0438\u0446\u0456 \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0438 (303). \u000d\u000a\u041c\u0447\u0447. \u0410\u043d\u0430\u0442\u043e\u043b\u0456\u044f \u0456 \u041f\u0440\u043e\u0442\u043e\u043b\u0435\u043e\u043d\u0430 (303).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 63 \u0437\u0430\u0447., XII, 2 \u2013 12.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 12 \u0437\u0430\u0447., IV, 23 \u2013 31. \u0406\u043d., 16 \u0437\u0430\u0447., V, 24 \u2013 30.\u000d\u000a\u0412\u043c\u0447.: \u0414\u0456\u044f\u043d., 29 \u0437\u0430\u0447., XII, 1 \u2013 11. \u0406\u043d., 52 \u0437\u0430\u0447., XV, 17 \u2013 XVI, 2.\u000d\u000a\u041c\u0447\u0447. \u0421\u0430\u0432\u0438 \u0421\u0442\u0440\u0430\u0442\u0438\u043b\u0430\u0442\u0430 \u0456 \u0437 \u043d\u0438\u043c 70-\u0445 \u0432\u043e\u0457\u043d\u0456\u0432 (272). \u041f\u0440\u043f. \u0421\u0430\u0432\u0438 \u041a\u0438\u0454\u0432\u043e\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406). \u041f\u0440\u043f. \u041e\u043b\u0435\u043a\u0441\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406). \u041c\u0447\u0447. \u041f\u0430\u0441\u0438\u043a\u0440\u0430\u0442\u0430 \u0456 \u0412\u0430\u043b\u0435\u043d\u0442\u0438\u043d\u0430 (228). \u041c\u0447\u0447. \u0404\u0432\u0441\u0435\u0432\u0456\u044f, \u041d\u0435\u043e\u043d\u0430, \u041b\u0435\u043e\u043d\u0442\u0456\u044f, \u041b\u043e\u043d\u0433\u0438\u043d\u0430 \u0442\u0430 \u000d\u000a\u0456\u043d\u0448\u0438\u0445 (303). \u041f\u0440\u043f. \u0424\u043e\u043c\u0438, \u044e\u0440\u043e\u0434\u0438\u0432\u043e\u0433\u043e (546 \u2013 560). \u041f\u0440\u043f. \u0404\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u0438, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0438\u0446\u0456 (V\u0406 \u2013 V\u0406\u0406\u0406). \u000d\u000a\u041c\u043e\u043b\u0447\u0435\u043d\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (1405). \u000d\u000a\u0414\u0456\u044f\u043d., 13 \u0437\u0430\u0447., V, 1 \u2013 11. \u0406\u043d., 17 \u0437\u0430\u0447., V, 30 \u2013 VI, 2.\u000d\u000a\u0410\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u0456 \u0454\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0441\u0442\u0430 \u041c\u0430\u0440\u043a\u0430 (63).\u000d\u000a\u0426\u0430\u0440\u0433\u043e\u0440\u043e\u0434\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (1071).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 50 \u0437\u0430\u0447., X, 1 \u2013 15.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 15 \u0437\u0430\u0447., V, 21 \u2013 33. \u0406\u043d., 19 \u0437\u0430\u0447., VI, 14 \u2013 27.\u000d\u000a\u0410\u043f.: 1 \u041f\u0435\u0442., 63 \u0437\u0430\u0447., V, 6 \u2013 14. \u041c\u043a., 23 \u0437\u0430\u0447., VI, 7 \u2013 13.\u000d\u000a3-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u0430\u0441\u0445\u0438. \u0410\u043f. \u0432\u0456\u0434 70-\u0445 \u0456 \u0441\u0449\u043c\u0447. \u0421\u0438\u043c\u0435\u043e\u043d\u0430, \u0440\u043e\u0434\u0438\u0447\u0430 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e (107). \u041f\u0440\u043f. \u0421\u0442\u0435\u0444\u0430\u043d\u0430, \u0456\u0433\u0443\u043c. \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0454\u043f. \u0412\u043e\u043b\u043e\u0434\u0438\u043c\u0438\u0440\u0441\u044c\u043a\u043e\u0433\u043e (1094). \u041f\u0440\u0430\u0432. \u0404\u0432\u043b\u043e\u0433\u0456\u044f, \u0433\u043e\u0441\u0442\u0438\u043d\u043d\u043e\u0433\u043e (\u0406V).\u000d\u000a\u0414\u0456\u044f\u043d., 17 \u0437\u0430\u0447., VI, 8 \u2013 VII, 5, 47 \u2013 60. \u0406\u043d., 13 \u0437\u0430\u0447., IV, 46 \u2013 54.\u000d\u000a\u0410\u043f.: 1 \u041a\u043e\u0440., 131 \u0437\u0430\u0447., IV, 9 \u2013 16. \u041c\u0444., 56 \u0437\u0430\u0447., XIII, 54 \u2013 58.\u000d\u000a\u0410\u043f\u043f. \u0432\u0456\u0434 70-\u0445 \u042f\u0441\u043e\u043d\u0430 \u0456 \u0421\u043e\u0441\u0438\u043f\u0430\u0442\u0440\u0430, \u043c\u0446. \u041a\u0435\u0440\u043a\u0438\u0440\u0438, \u0434\u0456\u0432\u0438, \u0442\u0430 \u0456\u043d\u0448\u0438\u0445, \u044f\u043a\u0456 \u0437 \u043d\u0438\u043c\u0438 \u000d\u000a\u043f\u043e\u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043b\u0438 (\u0406). \u041c\u0447\u0447. \u0414\u0430\u0434\u0438, \u041c\u0430\u043a\u0441\u0438\u043c\u0430 \u0456 \u041a\u0432\u0438\u043d\u0442\u0438\u043b\u0456\u0430\u043d\u0430 (286). \u041c\u0447\u0447. \u0421\u0430\u0442\u043e\u0440\u043d\u0456\u044f, \u042f\u043a\u0438\u0441\u0445\u043e\u043b\u0430, \u0424\u0430\u0432\u0441\u0442\u0456\u0430\u043d\u0430, \u042f\u043d\u0443\u0430\u0440\u0456\u044f, \u041c\u0430\u0440\u0441\u0430\u043b\u0456\u044f, \u0404\u0444\u0440\u0430\u0441\u0456\u044f, \u041c\u0430\u043c\u043c\u0456\u044f, \u041c\u0443\u0440\u0438\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a23\u000d\u000a24\u000d\u000a25\u000d\u000a27\u000d\u000a28\u000d\u000a3-\u0442\u044f \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u0430\u0441\u0445\u0438, \u0441\u0432\u044f\u0442\u0438\u0445 \u0436\u0456\u043d\u043e\u043a-\u043c\u0438\u0440\u043e\u043d\u043e\u0441\u0438\u0446\u044c.\u000d\u000a\u0421\u0432\u0432. \u0436\u0456\u043d\u043e\u043a-\u043c\u0438\u0440\u043e\u043d\u043e\u0441\u0438\u0446\u044c: \u041c\u0430\u0440\u0456\u0457 \u041c\u0430\u0433\u0434\u0430\u043b\u0438\u043d\u0438, \u041c\u0430\u0440\u0456\u0457 \u041a\u043b\u0435\u043e\u043f\u043e\u0432\u043e\u0457, \u000d\u000a\u0421\u043e\u043b\u043e\u043c\u0456\u0457, \u0406\u043e\u0430\u043d\u043d\u0438, \u041c\u0430\u0440\u0444\u0438 \u0456 \u041c\u0430\u0440\u0456\u0457, \u0421\u0443\u0441\u0430\u043d\u043d\u0438 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445; \u043f\u0440\u0430\u0432\u0435\u0434\u043d\u0438\u0445 \u000d\u000a\u0419\u043e\u0441\u0438\u0444\u0430 \u0410\u0440\u0438\u043c\u0430\u0444\u0435\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u041d\u0438\u043a\u043e\u0434\u0438\u043c\u0430 (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 \u000d\u000a3-\u0442\u044e \u043d\u0435\u0434\u0456\u043b\u044e \u043f\u0456\u0441\u043b\u044f \u041f\u0430\u0441\u0445\u0438). \u0421\u0449\u043c\u0447. \u0412\u0430\u0441\u0438\u043b\u0456\u044f, \u0454\u043f. \u0410\u043c\u0430\u0441\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e. \u041f\u0440\u0430\u0432. \u0413\u043b\u0430\u0444\u0456\u0440\u0438, \u0434\u0456\u0432\u0438 (322). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0438\u043a\u0456\u044f \u0414\u0456\u0432\u0438\u0447\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0425\u0406\u0406\u0406, \u0421\u0435\u0440\u0431.). \u0411\u043b\u0433\u0432. \u0422\u0430\u043c\u0430\u0440\u0438, \u000d\u000a\u0446\u0430\u0440\u0438\u0446\u0456 \u0413\u0440\u0443\u0437\u0438\u043d\u0441\u044c\u043a\u043e\u0457 (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 3-\u0442\u044e \u043d\u0435\u0434\u0456\u043b\u044e \u043f\u0456\u0441\u043b\u044f \u041f\u0430\u0441\u0445\u0438).\u000d\u000a\u041b\u044c\u0432\u0456\u0432\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 \u043d\u0435\u0434\u0456\u043b\u044e \u043f\u0456\u0441\u043b\u044f 23 \u043a\u0432\u0456\u0442\u043d\u044f).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 3-\u0454, \u041c\u043a., 71 \u0437\u0430\u0447., XVI, 9 \u2013 20.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 16 \u0437\u0430\u0447., VI, 1 \u2013 7. \u041c\u043a., 69 \u0437\u0430\u0447., XV, 43 \u2013 XVI, 8.\u000d\u000a\u0417 \u0446\u044c\u043e\u0433\u043e \u0434\u043d\u044f \u0443 \u0432\u0441\u0456 \u043d\u0435\u0434\u0456\u043b\u044c\u043d\u0456 \u0434\u043d\u0456 \u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u041f\u0430\u0441\u0445\u0438 \u043a\u0430\u043d\u043e\u043d\u0430\u043c \u043d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u000d\u000a\u043f\u0435\u0440\u0435\u0434\u0443\u0454 \u0441\u043f\u0456\u0432 \u043f\u0430\u0441\u0445\u0430\u043b\u044c\u043d\u043e\u0433\u043e (\u0431\u0435\u0437 \u043f\u0440\u0438\u0441\u043f\u0456\u0432\u0456\u0432 \u043d\u0430 9-\u0456\u0439 \u043f\u0456\u0441\u043d\u0456) \u0456 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0447\u043d\u043e\u0433\u043e \u000d\u000a\u043a\u0430\u043d\u043e\u043d\u0456\u0432.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a26","35\u000d\u000a\u043d\u0430, \u0417\u0438\u043d\u043e\u043d\u0430, \u0404\u0432\u0441\u0435\u0432\u0456\u044f, \u041d\u0435\u043e\u043d\u0430 \u0456 \u0412\u0456\u0442\u0430\u043b\u0456\u044f (\u0431\u043b. 63). \u0421\u0432\u0442. \u041a\u0438\u0440\u0438\u043b\u0430, \u0454\u043f. \u0422\u0443\u0440\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1183). \u000d\u000a\u0414\u0456\u044f\u043d., 18 \u0437\u0430\u0447., VIII, 5 \u2013 17. \u0406\u043d., 20 \u0437\u0430\u0447., VI, 27 \u2013 33.\u000d\u000a\u0414\u0435\u0432\u2019\u044f\u0442\u044c\u043e\u0445 \u043c\u0447\u0447. \u041a\u0438\u0437\u0438\u0446\u044c\u043a\u0438\u0445: \u0424\u0435\u043e\u0433\u043d\u0438\u0434\u0430, \u0420\u0443\u0444\u0430, \u0410\u043d\u0442\u0438\u043f\u0430\u0442\u0440\u0430, \u0424\u0435\u043e\u0441\u0442\u0438\u0445\u0430, \u0410\u0440\u0442\u0435\u043c\u0438, \u041c\u0430\u0433\u043d\u0430, \u0424\u0435\u043e\u0434\u043e\u0442\u0430, \u0424\u0430\u0432\u043c\u0430\u0441\u0456\u044f \u0456 \u0424\u0438\u043b\u0438\u043c\u043e\u043d\u0430 (286 \u2013 299). \u000d\u000a\u041f\u0440\u043f. \u041c\u0435\u043c\u043d\u043e\u043d\u0430, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f. \u041c\u0447\u0447. \u0414\u0456\u043e\u0434\u043e\u0440\u0430 \u0456 \u0420\u043e\u0434\u043e\u043f\u0456\u0430\u043d\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0430 (284 \u000d\u000a\u2013 305). \u0421\u0432\u0442. \u0412\u0430\u0441\u0438\u043b\u0456\u044f, \u0454\u043f. \u0417\u0430\u0445\u043e\u043b\u043c\u0441\u044c\u043a\u043e\u0433\u043e (\u0425V\u0406, \u0421\u0435\u0440\u0431.). \u041c\u0447. \u0406\u043e\u0430\u043d\u0430 \u0412\u0430\u043b\u0430\u0445\u0430 (\u0420\u0443\u043c\u0443\u043d.).\u000d\u000a\u0414\u0456\u044f\u043d., 19 \u0437\u0430\u0447., VIII, 18 \u2013 25. \u0406\u043d., 21 \u0437\u0430\u0447., VI, 35 \u2013 39.\u000d\u000a\u0410\u043f. \u042f\u043a\u043e\u0432\u0430 \u0417\u0435\u0432\u0435\u0434\u0435\u0454\u0432\u0430 (44). \u0421\u0432\u0442. \u0414\u043e\u043d\u0430\u0442\u0430, \u0454\u043f. \u0404\u0432\u0440\u0456\u0457 (\u0431\u043b. 387). \u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u0441\u0449\u043c\u0447. \u0412\u0430\u0441\u0438\u043b\u0456\u044f, \u0454\u043f. \u0410\u043c\u0430\u0441\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u000d\u000a\u043c\u043e\u0449\u0456\u0432 \u0441\u0432\u0442. \u041c\u0438\u043a\u0438\u0442\u0438 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0454\u043f. \u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(1558). \u041c\u0447. \u041c\u0430\u043a\u0441\u0438\u043c\u0430.\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 67 \u0437\u0430\u0447., XXI, 15 \u2013 25.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 20 \u0437\u0430\u0447., VIII, 26 \u2013 39. \u0406\u043d., 22 \u0437\u0430\u0447., VI, 40 \u2013 44.\u000d\u000a\u0410\u043f.: \u0414\u0456\u044f\u043d., 29 \u0437\u0430\u0447., XII, 1 \u2013 11. \u041b\u043a., 17 \u0437\u0430\u0447., V, 1 \u2013 11.\u000d\u000a\u041f\u0440\u043e\u0440. \u0404\u0440\u0435\u043c\u0456\u0457 (V\u0406 \u0441\u0442. \u0434\u043e \u0420. \u0425.). \u0421\u0449\u043c\u0447. \u041c\u0430\u043a\u0430\u0440\u0456\u044f, \u043c\u0438\u0442\u0440. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0432\u0441\u0456\u0454\u0457 \u0420\u0443\u0441\u0438 (1497). \u041f\u0440\u043c\u0447\u0447. \u0410\u0444\u043e\u043d\u0441\u044c\u043a\u0438\u0445: \u0404\u0432\u0444\u0438\u043c\u0456\u044f (1814), \u0406\u0433\u043d\u0430\u0442\u0456\u044f \u000d\u000a(1814) \u0442\u0430 \u0410\u043a\u0430\u043a\u0456\u044f (1816). \u041f\u0440\u043c\u0447. \u0412\u0430\u0442\u0438 \u041f\u0435\u0440\u0441\u044f\u043d\u0438\u043d\u0430 (\u0406V). \u0411\u043b\u0433\u0432. \u0422\u0430\u043c\u0430\u0440\u0438, \u0446\u0430\u0440\u0438\u0446\u0456 \u0413\u0440\u0443\u0437\u0438\u043d\u0441\u044c\u043a\u043e\u0457 (1213).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456, \u0437\u0432\u0430\u043d\u043e\u0457 \u00ab\u041d\u0435\u0441\u043f\u043e\u0434\u0456\u0432\u0430\u043d\u0430 \u0440\u0430\u0434\u0456\u0441\u0442\u044c\u00bb.\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 35 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), X, 1 \u2013 9.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 21 \u0437\u0430\u0447., VIII, 40 \u2013 IX, 19. \u0406\u043d., 23 \u0437\u0430\u0447., VI, 48 \u2013 54.\u000d\u000a\u0421\u0449\u043c\u0447.: \u0404\u0432\u0440., 334 \u0437\u0430\u0447., \u0425\u0406\u0406\u0406, 7 \u2013 16. \u0406\u043d., 36., \u0425, 9 \u2013 16.\u000d\u000a\u0421\u0432\u0442. \u0410\u0444\u0430\u043d\u0430\u0441\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e, \u0430\u0440\u0445\u0456\u0454\u043f. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (373). \u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u0431\u043b\u0433\u0432\u0432. \u043a\u043d\u044f\u0437\u0456\u0432 \u0441\u0442\u0440\u0430\u0441\u0442\u043e\u0442\u0435\u0440\u043f\u0446\u0456\u0432 \u0411\u043e\u0440\u0438\u0441\u0430 \u0456 \u0413\u043b\u0456\u0431\u0430, \u000d\u000a\u0443 \u0441\u0432. \u0445\u0440\u0435\u0449\u0435\u043d\u043d\u0456 \u0420\u043e\u043c\u0430\u043d\u0430 \u0456 \u0414\u0430\u0432\u0438\u0434\u0430 (1072 \u0456 1115). \u0421\u0432\u0442. \u0410\u0444\u0430\u043d\u0430\u0441\u0456\u044f, \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e, \u041b\u0443\u0431\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (1654). \u041c\u0447\u0447. \u0415\u0441\u043f\u0435\u0440\u0430 \u0456 \u0417\u043e\u0457 \u0442\u0430 \u0434\u0456\u0442\u0435\u0439 \u0457\u0445 \u041a\u0438\u0440\u0456\u0430\u043a\u0430 \u0456 \u0424\u0435\u043e\u0434\u0443\u043b\u0430 (\u0406\u0406). \u0411\u043b\u0433\u0432. \u000d\u000a\u0456 \u0440\u0456\u0432\u043d\u043e\u0430\u043f. \u0446\u0430\u0440\u044f \u0411\u043e\u0440\u0438\u0441\u0430, \u0443 \u0441\u0432. \u0445\u0440\u0435\u0449\u0435\u043d\u043d\u0456 \u041c\u0438\u0445\u0430\u0457\u043b\u0430, \u043f\u0440\u043e\u0441\u0432\u0456\u0442\u0438\u0442\u0435\u043b\u044f \u0431\u043e\u043b\u0433\u0430\u0440 \u000d\u000a(907, \u0411\u043e\u043b\u0433.).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 106 \u0437\u0430\u0447., XXI, 12 \u2013 19.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 22 \u0437\u0430\u0447., IX, 19 \u2013 31. \u0406\u043d., 52 \u0437\u0430\u0447., XV, 17 \u2013 XVI, 2.\u000d\u000a\u0411\u043b\u0433\u0432\u0432. \u043a\u043d\u043d.: \u0420\u0438\u043c., 99 \u0437\u0430\u0447., VIII, 28 \u2013 39. \u0406\u043d., 52 \u0437\u0430\u0447., XV, 17 \u2013 XVI, 2.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0432\u0430\u0441, \u0441\u0432\u044f\u0442\u0456 \u0441\u0442\u0440\u0430\u0441\u0442\u043e\u0442\u0435\u0440\u043f\u0446\u0456 \u0411\u043e\u0440\u0438\u0441\u0435 \u0456 \u000d\u000a\u0413\u043b\u0456\u0431\u0435, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u0447\u0435\u0441\u043d\u0456 \u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043d\u043d\u044f \u0432\u0430\u0448\u0456, \u0431\u043e \u0432\u0438 \u043c\u043e\u043b\u0438\u0442\u0435 \u0437\u0430 \u043d\u0430\u0441 \u0425\u0440\u0438\u0441\u0442\u0430 \u000d\u000a\u0411\u043e\u0433\u0430 \u043d\u0430\u0448\u043e\u0433\u043e\u00bb.\u000d\u000a29\u000d\u000a30\u000d\u000a1\u000d\u000a2\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430","36\u000d\u000a4-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u0430\u0441\u0445\u0438, \u043f\u0440\u043e \u043f\u0430\u0440\u0430\u043b\u0456\u0437\u043e\u0432\u0430\u043d\u043e\u0433\u043e.\u000d\u000a\u041c\u0447\u0447. \u0422\u0438\u043c\u043e\u0444\u0456\u044f \u0456 \u041c\u0430\u0432\u0440\u0438 (\u0431\u043b. 286). \u041f\u0440\u043f. \u0424\u0435\u043e\u0434\u043e\u0441\u0456\u044f, \u0456\u0433\u0443\u043c. \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e (1074). \u041f\u0440\u043f. \u041f\u0435\u0442\u0440\u0430, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f, \u0454\u043f. \u0410\u0440\u0433\u043e\u0441\u044c\u043a\u043e\u0433\u043e (\u0425). \u000d\u000a\u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u043c\u0447. \u0410\u0432\u0440\u0430\u0430\u043c\u0456\u044f \u0411\u043e\u043b\u0433\u0430\u0440\u0441\u044c\u043a\u043e\u0433\u043e (1230) (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u000d\u000a\u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 4-\u0442\u0443 \u043d\u0435\u0434\u0456\u043b\u044e \u043f\u0456\u0441\u043b\u044f \u041f\u0430\u0441\u0445\u0438). \u041f\u0440\u0430\u0432. \u0422\u0430\u0432\u0438\u0444\u0438 (\u0406) (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u000d\u000a\u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 4-\u0442\u0443 \u043d\u0435\u0434\u0456\u043b\u044e \u043f\u0456\u0441\u043b\u044f \u041f\u0430\u0441\u0445\u0438).\u000d\u000a\u0406\u043a\u043e\u043d \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456: \u0423\u0441\u043f\u0456\u043d\u043d\u044f \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0457, \u043f\u0440\u0438\u043d\u0435\u0441\u0435\u043d\u043e\u0457 \u0437 \u000d\u000a\u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044f (1073), \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0457 (\u0437 \u0410\u043d\u0442\u043e\u043d\u0456\u0454\u043c \u0456 \u0424\u0435\u043e\u0434\u043e\u0441\u0456\u0454\u043c) (1085).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 4-\u0435, \u041b\u043a., 112 \u0437\u0430\u0447., XXIV, 1 \u2013 12.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 23 \u0437\u0430\u0447., IX, 32 \u2013 42. \u0406\u043d., 14 \u0437\u0430\u0447., V, 1 \u2013 15.\u000d\u000a\u041f\u0440\u043f.: \u0404\u0432\u0440., 334 \u0437\u0430\u0447., XIII, 7 \u2013 16. \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a3\u000d\u000a4-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u0430\u0441\u0445\u0438. \u000d\u000a\u041c\u0446. \u041f\u0435\u043b\u0430\u0433\u0456\u0457, \u0434\u0456\u0432\u0438 \u0422\u0430\u0440\u0441\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (\u0431\u043b. 290). \u0421\u0449\u043c\u0447. \u0415\u0440\u0430\u0437\u043c\u0430, \u0454\u043f. \u0424\u043e\u0440\u043c\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (303). \u0421\u0449\u043c\u0447. \u0410\u043b\u044c\u0432\u0456\u0430\u043d\u0430, \u0454\u043f. \u0410\u043d\u0435\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0442\u0430 \u0443\u0447\u043d\u0456\u0432 \u0439\u043e\u0433\u043e (304). \u000d\u000a\u0421\u0449\u043c\u0447. \u0421\u0438\u043b\u044c\u0432\u0430\u043d\u0430, \u0454\u043f. \u0413\u0430\u0437\u044c\u043a\u043e\u0433\u043e, \u0456 \u0437 \u043d\u0438\u043c 40 \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0456\u0432 (311). \u041f\u0440\u0430\u0432. \u041c\u043e\u043d\u0456\u043a\u0438, \u043c\u0430\u0442\u0435\u0440\u0456 \u0441\u0432\u0442. \u0410\u0432\u0433\u0443\u0441\u0442\u0438\u043d\u0430 \u0411\u043b\u0430\u0436\u0435\u043d\u043d\u043e\u0433\u043e, \u0454\u043f. \u0406\u043f\u043e\u043d\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (387)\u000d\u000a\u0414\u0456\u044f\u043d., 24 \u0437\u0430\u0447., X, 1 \u2013 16. \u0406\u043d., 24 \u0437\u0430\u0447., VI, 56 \u2013 69.\u000d\u000a\u0412\u043c\u0446. \u0406\u0440\u0438\u043d\u0438 (\u0406 \u2013 \u0406\u0406).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u041d\u0435\u0432\u0438\u043f\u0438\u0432\u0430\u043d\u0430 \u0447\u0430\u0448\u0430\u00bb (1878).\u000d\u000a\u0414\u0456\u044f\u043d., 25 \u0437\u0430\u0447., X, 21 \u2013 33. \u0406\u043d., 25 \u0437\u0430\u0447., VII, 1 \u2013 13.\u000d\u000a\u0417\u0433\u0430\u0434\u0443\u0432\u0430\u043d\u043d\u044f \u043f\u043e\u044f\u0432\u0438 \u043d\u0430 \u043d\u0435\u0431\u0456 \u0425\u0440\u0435\u0441\u0442\u0430 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e \u0432 \u0404\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0456 (351). \u000d\u000a\u041c\u0447. \u0410\u043a\u0430\u043a\u0456\u044f, \u0441\u043e\u0442\u043d\u0438\u043a\u0430 (303). \u041f\u0440\u043f\u043f. \u0406\u043e\u0430\u043d\u0430 \u0417\u0435\u0434\u0430\u0437\u043d\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u0442\u0430 \u0443\u0447\u043d\u0456\u0432 \u0439\u043e\u0433\u043e: \u000d\u000a\u0410\u0432\u0456\u0432\u0430, \u0454\u043f. \u041d\u0435\u043a\u0440\u0435\u0441\u044c\u043a\u043e\u0433\u043e, \u0410\u043d\u0442\u043e\u043d\u0456\u044f \u041c\u0430\u0440\u0442\u043a\u043e\u0431\u0441\u044c\u043a\u043e\u0433\u043e, \u0414\u0430\u0432\u0438\u0434\u0430 \u0413\u0430\u0440\u0435\u0434\u0436\u0438\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0417\u0438\u043d\u043e\u043d\u0430 \u0406\u043b\u043a\u0430\u0442\u0441\u044c\u043a\u043e\u0433\u043e, \u0424\u0430\u0434\u0435\u044f \u0421\u0442\u0435\u043f\u0430\u043d\u0446\u043c\u0438\u0434\u0441\u044c\u043a\u043e\u0433\u043e, \u0406\u0441\u0435 (\u0406\u0454\u0441\u0435\u044f), \u0454\u043f. \u000d\u000a\u0426\u0438\u043b\u043a\u0430\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u0419\u043e\u0441\u0438\u0444\u0430, \u0454\u043f. \u0410\u043b\u0430\u0432\u0435\u0440\u0434\u0441\u044c\u043a\u043e\u0433\u043e, \u0406\u0441\u0438\u0434\u043e\u0440\u0430 \u0421\u0430\u043c\u0442\u0430\u0432\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u000d\u000a\u041c\u0438\u0445\u0430\u0457\u043b\u0430 \u0423\u043b\u0443\u043c\u0431\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u041f\u0456\u0440\u0440\u0430 \u0411\u0440\u0435\u0442\u0441\u044c\u043a\u043e\u0433\u043e, \u0421\u0442\u0435\u0444\u0430\u043d\u0430 \u0425\u0438\u0440\u0441\u044c\u043a\u043e\u0433\u043e \u0442\u0430 \u000d\u000a\u0428\u0456\u043e \u041c\u0433\u0432\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406, \u0413\u0440\u0443\u0437.). \u041f\u0440\u043c\u0447. \u041f\u0430\u0445\u043e\u043c\u0456\u044f \u0420\u0443\u0441\u0438\u043d\u0430 \u0410\u0444\u043e\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u000d\u000a\u041f\u0430\u0442\u043c\u043e\u0441\u044c\u043a\u043e\u0433\u043e (1730).\u000d\u000a\u041b\u044e\u0431\u0435\u0446\u044c\u043a\u043e\u0457 (\u0425\u0406) \u0442\u0430 \u0416\u0438\u0440\u043e\u0432\u0438\u0446\u044c\u043a\u043e\u0457 (1470) \u0456\u043a\u043e\u043d \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456.\u000d\u000a\u0414\u0456\u044f\u043d., 26 \u0437\u0430\u0447., X, 34 \u2013 43. \u0406\u043d., 29 \u0437\u0430\u0447., VIII, 12 \u2013 20.\u000d\u000a\u041f\u0435\u0440\u0435\u043f\u043e\u043b\u043e\u0432\u0435\u043d\u043d\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u041f\u0440\u0430\u0432. \u0406\u043e\u0432\u0430 \u0411\u0430\u0433\u0430\u0442\u043e\u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u000d\u000a(\u0431\u043b. 2000 \u2013 1500 \u0434\u043e \u0420. \u0425.). \u041f\u0440\u043f. \u0406\u043e\u0432\u0430 \u041f\u043e\u0447\u0430\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1651). \u041c\u0447\u0447. \u0412\u0430\u0440\u0432\u0430\u0440\u0430, \u0432\u043e\u0457\u043d\u0430, \u0412\u0430\u043a\u0445\u0430, \u041a\u0430\u043b\u0438\u043c\u0430\u0445\u0430 \u0442\u0430 \u0414\u0456\u043e\u043d\u0456\u0441\u0456\u044f (\u0431\u043b. 362). \u041c\u0447. \u041f\u0430\u0440\u0444\u0435\u043d\u0456\u044f. \u000d\u000a\u041c\u0447. \u0412\u0430\u0440\u0432\u0430\u0440\u0430, \u043a\u043e\u043b\u0438\u0448\u043d\u044c\u043e\u0433\u043e \u0440\u043e\u0437\u0431\u0456\u0439\u043d\u0438\u043a\u0430.\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 34 \u0437\u0430\u0447., XIV, 6 \u2013 18. \u0406\u043d., 26 \u0437\u0430\u0447., VII, 14 \u2013 30.\u000d\u000a\u041f\u0440\u0430\u0432.: \u042f\u043a., 54 \u0437\u0430\u0447., III, 1\u201310. \u041c\u0444., 10 \u0437\u0430\u0447., \u0406V, 25 \u2013 V, 12.\u000d\u000a\u041f\u0440\u043f.: \u0404\u0432\u0440., 334 \u0437\u0430\u0447., XIII, 7 \u2013 16. \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30 (\u043f\u0456\u0434 \u0437\u0430\u0447\u0430\u043b\u043e).\u000d\u000a\u0426\u044c\u043e\u0433\u043e \u0434\u043d\u044f, \u0442\u0440\u0430\u0434\u0438\u0446\u0456\u0439\u043d\u043e, \u0437\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f \u043c\u0430\u043b\u0435 \u043e\u0441\u0432\u044f\u0447\u0435\u043d\u043d\u044f \u0432\u043e\u0434\u0438.\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a4\u000d\u000a5\u000d\u000a7\u000d\u000a6","37\u000d\u000a\u0410\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u0456 \u0454\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0441\u0442\u0430 \u0406\u043e\u0430\u043d\u0430 \u0411\u043e\u0433\u043e\u0441\u043b\u043e\u0432\u0430 (98 \u2013 117). \u041f\u0440\u043f. \u0410\u0440\u0441\u0435\u043d\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e (449 \u2013 450). \u041f\u0440\u043f\u043f. \u0410\u0440\u0441\u0435\u043d\u0456\u044f \u041f\u0440\u0430\u0446\u0435\u043b\u044e\u0431\u043d\u043e\u0433\u043e (\u0425\u0406V) \u000d\u000a\u0442\u0430 \u041f\u0438\u043c\u0435\u043d\u0430, \u043f\u043e\u0441\u043d\u0438\u043a\u0430, (\u0425\u0406\u0406) \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u0438\u0445, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445. \u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 67 \u0437\u0430\u0447., XXI, 15 \u2013 25.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 27 \u0437\u0430\u0447., X, 44 \u2013 XI, 10. \u0406\u043d., 30 \u0437\u0430\u0447., VIII, 21 \u2013 30.\u000d\u000a\u0410\u043f.: 1 \u0406\u043d., 68 \u0437\u0430\u0447., I, 1 \u2013 7. \u0406\u043d., 61 \u0437\u0430\u0447., XIX, 25 \u2013 27; XXI, 24 \u2013 25.\u000d\u000a\u041f\u043e\u043c\u0438\u043d\u0430\u043d\u043d\u044f \u0437\u0430\u0433\u0438\u0431\u043b\u0438\u0445 \u0443 \u0406\u0406 \u0421\u0432\u0456\u0442\u043e\u0432\u0456\u0439 \u0432\u0456\u0439\u043d\u0456.\u000d\u000a\u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u0441\u0432\u044f\u0442\u0438\u0442\u0435\u043b\u044f \u0456 \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f \u041c\u0438\u043a\u043e\u043b\u0430\u044f \u0437 \u041c\u0438\u0440 \u000d\u000a\u041b\u0456\u043a\u0456\u0439\u0441\u044c\u043a\u0438\u0445 \u0443 \u043c. \u0411\u0430\u0440 (1087). \u041f\u0440\u043e\u0440. \u0406\u0441\u0430\u0457 (V\u0406\u0406\u0406 \u0441\u0442. \u0434\u043e \u0420. \u0425.). \u041c\u0447. \u0425\u0440\u0438\u0441\u0442\u043e\u0444\u043e\u0440\u0430 (\u0431\u043b. 250). \u041f\u0440\u043f. \u0428\u0456\u043e \u041c\u0433\u0432\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406, \u0413\u0440\u0443\u0437.). \u041f\u0440\u043f. \u0419\u043e\u0441\u0438\u0444\u0430 \u000d\u000a\u041e\u043f\u0442\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e (1911).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 35 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), X, 1 \u2013 9.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 29 \u0437\u0430\u0447., XII, 1 \u2013 11. \u0406\u043d., 31 \u0437\u0430\u0447., VIII, 31 \u2013 42.\u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 335 \u0437\u0430\u0447., XIII, 17 \u2013 21. \u041c\u0444., 11 \u0437\u0430\u0447., V, 14 \u2013 19.\u000d\u000a\u0421\u0432\u0442. \u0415\u043f\u0456\u0444\u0430\u043d\u0456\u044f, \u0454\u043f. \u041a\u0456\u043f\u0440\u0441\u044c\u043a\u043e\u0433\u043e (403). \u0421\u0432\u0442. \u0413\u0435\u0440\u043c\u0430\u043d\u0430, \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (740). \u0421\u0432\u0442\u0442. \u0421\u0430\u0432\u0438\u043d\u0430, \u0430\u0440\u0445\u0456\u0454\u043f. \u041a\u0456\u043f\u0440\u0441\u044c\u043a\u043e\u0433\u043e (V), \u0456 \u000d\u000a\u041f\u043e\u043b\u0443\u0432\u0456\u044f, \u0454\u043f. \u0420\u0438\u043d\u043e\u043a\u0438\u0440\u0441\u044c\u043a\u043e\u0433\u043e (V). \u041f\u0440\u043f. \u0410\u043c\u0444\u0456\u043b\u043e\u0445\u0456\u044f \u041f\u043e\u0447\u0430\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u000d\u000a\u043c\u0430\u043b\u0456\u0439 \u0441\u0445\u0438\u043c\u0456 \u0419\u043e\u0441\u0438\u0444\u0430, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f \u0406\u043b\u043e\u0432\u0435\u0446\u044c\u043a\u043e\u0433\u043e (1971).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 31 \u0437\u0430\u0447., XII, 25 \u2013 XIII, 12. \u0406\u043d., 33 \u0437\u0430\u0447., VIII, 51 \u2013 59.\u000d\u000a\u041f\u0440\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30.\u000d\u000a\u0414\u0435\u043d\u044c \u0442\u0435\u0437\u043e\u0456\u043c\u0435\u043d\u0438\u0442\u0441\u0442\u0432\u0430 \u0411\u043b\u0430\u0436\u0435\u043d\u043d\u0456\u0439\u0448\u043e\u0433\u043e \u041c\u0438\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0430 \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0432\u0441\u0456\u0454\u0457 \u0423\u043a\u0440\u0430\u0457\u043d\u0438 \u0415\u043f\u0456\u0444\u0430\u043d\u0456\u044f.\u000d\u000a5-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u0430\u0441\u0445\u0438, \u043f\u0440\u043e \u0441\u0430\u043c\u0430\u0440\u044f\u043d\u043a\u0443.\u000d\u000a\u0410\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u0421\u0438\u043c\u043e\u043d\u0430 \u0417\u0438\u043b\u043e\u0442\u0430 (\u0406). \u0421\u0432\u0442. \u0421\u0438\u043c\u043e\u043d\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0454\u043f. \u0412\u043e\u043b\u043e\u0434\u0438\u043c\u0438\u0440\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0421\u0443\u0437\u0434\u0430\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e, \u0443 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (1226). \u041c\u0447\u0447. \u0410\u043b\u0444\u0456\u044f, \u0424\u0456\u043b\u0430\u0434\u0435\u043b\u044c\u0444\u0430, \u041a\u0438\u043f\u0440\u0456\u0430\u043d\u0430, \u041e\u043d\u0438\u0441\u0438\u043c\u0430, \u0415\u0440\u0430\u0437\u043c\u0430 \u000d\u000a\u0442\u0430 \u0456\u043d\u0448\u0438\u0445 (251). \u041c\u0447. \u0406\u0441\u0438\u0445\u0456\u044f \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u041f\u0440\u043f. \u0406\u0441\u0438\u0434\u043e\u0440\u0438, \u044e\u0440\u043e\u0434\u0438\u0432\u043e\u0457 \u000d\u000a(\u0406V). \u0411\u043b\u0436. \u0422\u0430\u0457\u0441\u0456\u0457 \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0457 (V).\u000d\u000a\u041a\u0438\u0454\u0432\u043e-\u0411\u0440\u0430\u0442\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (1654).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 7-\u0435, \u0406\u043d., 63 \u0437\u0430\u0447., XX, 1 \u2013 10.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 28 \u0437\u0430\u0447., XI, 19 \u2013 26, 29 \u2013 30. \u0406\u043d., 12 \u0437\u0430\u0447., IV, 5 \u2013 42.\u000d\u000a\u0410\u043f.: 1 \u041a\u043e\u0440., 131 \u0437\u0430\u0447., IV, 9 \u2013 16. \u041c\u0444., 56 \u0437\u0430\u0447., XIII, 54 \u2013 58.\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a8\u000d\u000a9\u000d\u000a12\u000d\u000a10\u000d\u000a5-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u0430\u0441\u0445\u0438. \u0421\u0449\u043c\u0447. \u041c\u043e\u043a\u0456\u044f (\u0431\u043b. 295). \u0420\u0456\u0432\u043d\u043e\u0430\u043f\u043f. \u041a\u0438\u0440\u0438\u043b\u0430 (869) \u0442\u0430 \u041c\u0435\u0444\u043e\u0434\u0456\u044f (885), \u0432\u0447\u0438\u0442\u0435\u043b\u0456\u0432 \u0441\u043b\u043e\u0432\u2019\u044f\u043d\u0441\u044c\u043a\u0438\u0445. \u000d\u000a\u041f\u0440\u043f. \u0421\u043e\u0444\u0440\u043e\u043d\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u000d\u000a\u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406). \u0421\u0432\u0442. \u041d\u0438\u043a\u043e\u0434\u0438\u043c\u0430, \u0430\u0440\u0445\u0456\u0454\u043f. \u0421\u0435\u0440\u0431\u0441\u044c\u043a\u043e\u0433\u043e (1325).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 35 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), X, 1 \u2013 9.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 30 \u0437\u0430\u0447., XII, 12 \u2013 17. \u0406\u043d., 32 \u0437\u0430\u0447., VIII, 42 \u2013 51.\u000d\u000a\u0420\u0456\u0432\u043d\u043e\u0430\u043f\u043f.: \u0404\u0432\u0440., 318 \u0437\u0430\u0447., VII, 26 \u2013 VIII, 2. \u041c\u0444., 11 \u0437\u0430\u0447., V, 14 \u2013 19.\u000d\u000a11\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a","38\u000d\u000a\u0412\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0430 \u041f\u0435\u0440\u0435\u043f\u043e\u043b\u043e\u0432\u0435\u043d\u043d\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u041c\u0446. \u0413\u043b\u0456\u043a\u0435\u0440\u0456\u0457, \u0434\u0456\u0432\u0438, \u000d\u000a\u0456 \u0437 \u043d\u0435\u044e \u043c\u0447. \u041b\u0430\u043e\u0434\u0438\u043a\u0456\u044f, \u0441\u0442\u043e\u0440\u043e\u0436\u0430 \u0432\u2019\u044f\u0437\u043d\u0438\u0447\u043d\u043e\u0433\u043e (\u0431\u043b. 117). \u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u000d\u000a\u043c\u043e\u0449\u0456\u0432 \u043f\u0440\u043c\u0447. \u041c\u0430\u043a\u0430\u0440\u0456\u044f, \u0430\u0440\u0445\u0456\u043c. \u041a\u0430\u043d\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u0456\u0433\u0443\u043c. \u041f\u0456\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u041f\u0435\u0440\u0435\u044f\u0441\u043b\u0430\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (1688). \u041c\u0447. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(284 \u2013 305). \u0421\u0432\u0442. \u041f\u0430\u0432\u0441\u0438\u043a\u0430\u043a\u0456\u044f, \u0454\u043f. \u0421\u0438\u043d\u0430\u0434\u0441\u044c\u043a\u043e\u0433\u043e (606). \u0421\u0432\u0432. \u0413\u0435\u043e\u0440\u0433\u0456\u044f, \u0441\u043f\u043e\u0432., \u000d\u000a\u0437 \u0434\u0440\u0443\u0436\u0438\u043d\u043e\u044e \u0406\u0440\u0438\u043d\u043e\u044e \u0456 \u0434\u0456\u0442\u044c\u043c\u0438 (\u0406\u0425). \u041f\u0440\u043f. \u0404\u0432\u0444\u0438\u043c\u0456\u044f \u0406\u0432\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e (1028, \u0413\u0440\u0443\u0437.).\u000d\u000a\u0414\u0456\u044f\u043d., 32 \u0437\u0430\u0447., XIII, 13 \u2013 24. \u0406\u043d., 18 \u0437\u0430\u0447., VI, 5 \u2013 14.\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a13\u000d\u000a\u041c\u0447. \u0406\u0441\u0438\u0434\u043e\u0440\u0430 (251). \u041f\u0440\u043f. \u041c\u0438\u043a\u0438\u0442\u0438, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0454\u043f. \u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\u0441\u044c\u043a\u043e\u0433\u043e (1108). \u041c\u0447. \u041c\u0430\u043a\u0441\u0438\u043c\u0430 (\u0431\u043b. 250). \u041f\u0440\u043f. \u0421\u0435\u0440\u0430\u043f\u0456\u043e\u043d\u0430 \u0421\u0438\u043d\u0434\u043e\u043d\u0456\u0442\u0430 (V). \u0421\u0432\u0442. \u041b\u0435\u043e\u043d\u0442\u0456\u044f, \u043f\u0430\u0442\u0440. \u0404\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (1175).\u000d\u000a\u0414\u0456\u044f\u043d., 35 \u0437\u0430\u0447., XIV, 20 \u2013 27. \u0406\u043d., 35 \u0437\u0430\u0447., IX, 39 \u2013 X, 9.\u000d\u000a\u0417 \u0446\u044c\u043e\u0433\u043e \u0434\u043d\u044f \u0434\u043e \u0441\u0443\u0431\u043e\u0442\u0438 \u2013 \u043f\u0456\u0441\u043b\u044f\u0441\u0432\u044f\u0442\u043e \u041d\u0435\u0434\u0456\u043b\u0456 \u043f\u0440\u043e \u0441\u0430\u043c\u0430\u0440\u044f\u043d\u043a\u0443.\u000d\u000a\u041f\u0440\u043f. \u041f\u0430\u0445\u043e\u043c\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e (348). \u0421\u0432\u0442. \u0406\u0441\u0430\u0457 \u041a\u0438\u0454\u0432\u043e-\u041c\u0438\u0445\u0430\u0439\u043b\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u000d\u000a\u0454\u043f. \u0420\u043e\u0441\u0442\u043e\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (1090). \u041f\u0440\u043f. \u0406\u0441\u0430\u0457 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e (1115). \u041f\u0440\u043f. \u0410\u0445\u0438\u043b\u0456\u044f, \u0454\u043f. \u041b\u0430\u0440\u0438\u0441\u0441\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0406).\u000d\u000a\u0414\u0456\u044f\u043d., 36 \u0437\u0430\u0447., XV, 5 \u2013 34. \u0406\u043d., 37 \u0437\u0430\u0447., X, 17 \u2013 28.\u000d\u000a\u041f\u0440\u043f.: 2 \u041a\u043e\u0440., 176 \u0437\u0430\u0447., \u0406V, 6 \u2013 15. \u041b\u043a., 77 \u0437\u0430\u0447., X\u0406V, 25 \u2013 35.\u000d\u000a\u041f\u0440\u043f. \u0424\u0435\u0434\u043e\u0440\u0430 \u041e\u0441\u0432\u044f\u0447\u0435\u043d\u043e\u0433\u043e (368). \u041f\u0440\u043f\u043f. \u043e\u0442\u0446\u0456\u0432, \u044f\u043a\u0456 \u0432 \u043b\u0430\u0432\u0440\u0456 \u0441\u0432. \u0421\u0430\u0432\u0438 \u0431\u0443\u043b\u0438 \u000d\u000a\u0432\u0431\u0438\u0442\u0456 (614). \u0421\u0432\u0442. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430, \u0454\u043f. \u0404\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (213 \u2013 250). \u041c\u0447\u0447. \u000d\u000a\u0412\u0456\u0442\u0430, \u041c\u043e\u0434\u0435\u0441\u0442\u0430 \u0456 \u043c\u0446. \u041a\u0440\u0438\u0441\u043a\u0435\u043d\u0442\u0456\u0457 (\u0431\u043b. 303). \u0421\u0432. \u043e\u0442\u0440\u043e\u043a\u043e\u0432\u0438\u0446\u0456 \u041c\u0443\u0437\u0438 (V). \u0421\u0432\u0442. \u000d\u000a\u0413\u0435\u043e\u0440\u0433\u0456\u044f \u0406\u0406, \u0454\u043f. \u041c\u0456\u0442\u0438\u043b\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0425).\u000d\u000a\u0414\u0456\u044f\u043d., 37 \u0437\u0430\u0447., XV, 35 \u2013 41. \u0406\u043d., 38 \u0437\u0430\u0447., X, 27 \u2013 38.\u000d\u000a6-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u0430\u0441\u0445\u0438. \u041f\u0430\u043c\u2019\u044f\u0442\u044c \u0441\u0432\u0432. \u043e\u0442\u0446\u0456\u0432 \u0441\u0456\u043c\u043e\u0445 \u0412\u0441\u0435\u043b\u0435\u043d\u0441\u044c\u043a\u0438\u0445 \u000d\u000a\u0441\u043e\u0431\u043e\u0440\u0456\u0432. \u041c\u0447\u0447. \u0424\u0435\u043e\u0434\u043e\u0442\u0430 \u0410\u043d\u043a\u0438\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u041f\u0435\u0442\u0440\u0430, \u0414\u0456\u043e\u043d\u0456\u0441\u0456\u044f, \u0410\u043d\u0434\u0440\u0456\u044f, \u041f\u0430\u0432\u043b\u0430, \u000d\u000a\u043c\u0446. \u0425\u0440\u0438\u0441\u0442\u0438\u043d\u0438 (249 \u2013 251) \u0456 \u043c\u0446\u0446. \u0441\u0456\u043c\u043e\u0445 \u0434\u0456\u0432: \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0438, \u0422\u0435\u043a\u0443\u0441\u0438, \u041a\u043b\u0430\u0432\u0434\u0456\u0457, \u0424\u0430\u0457\u043d\u0438, \u0404\u0432\u0444\u0440\u0430\u0441\u0456\u0457, \u041c\u043e\u0442\u0440\u043e\u043d\u0438 \u0456 \u042e\u043b\u0456\u0457 (303). \u041c\u0447\u0447. \u0421\u0438\u043c\u0435\u043e\u043d\u0430, \u0406\u0441\u0430\u0430\u043a\u0430 \u0456 \u0412\u0430\u0445\u0442\u0438\u0441\u0456\u044f (\u0406V), \u0406\u0440\u0430\u043a\u043b\u0456\u044f, \u041f\u0430\u0432\u043b\u0438\u043d\u0430, \u0412\u0435\u043d\u0435\u0434\u0438\u043c\u0430, \u0414\u0430\u0432\u0438\u0434\u0430 \u0456 \u0422\u0430\u0440\u0438\u0447\u0430\u043d\u0430 (693, \u0413\u0440\u0443\u0437.).\u000d\u000a\u0414\u0456\u044f\u043d., 39 \u0437\u0430\u0447., XVII, 1 \u2013 15. \u0406\u043d., 40 \u0437\u0430\u0447., XI, 47 \u2013 57.\u000d\u000a\u0421\u0449\u043c\u0447\u0447. \u041f\u0430\u0442\u0440\u0438\u043a\u0456\u044f, \u0454\u043f. \u041f\u0440\u0443\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u0437 \u043d\u0438\u043c \u0442\u0440\u044c\u043e\u0445 \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0456\u0432: \u0410\u043a\u0430\u043a\u0456\u044f, \u000d\u000a\u041c\u0435\u043d\u0430\u043d\u0434\u0440\u0430 \u0456 \u041f\u043e\u043b\u0456\u0454\u043d\u0430 (\u0431\u043b. 100). \u041c\u0447. \u041f\u0430\u0440\u0444\u0435\u043d\u0456\u044f \u0416\u043e\u0432\u043a\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (250). \u041c\u0447. \u041a\u0430\u043b\u0443\u0444\u0430 \u0404\u0433\u0438\u043f\u0442\u044f\u043d\u0438\u043d\u0430 (284 \u2013 303). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430, \u0454\u043f. \u000d\u000a\u0413\u043e\u0442\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406\u0406\u0406). \u000d\u000a\u0414\u0456\u044f\u043d., 40 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), XVII, 19 \u2013 28. \u0406\u043d., 42 \u0437\u0430\u0447., XII, 19 \u2013 36.\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a14\u000d\u000a15\u000d\u000a16\u000d\u000a18\u000d\u000a19\u000d\u000a6-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u0430\u0441\u0445\u0438, \u043f\u0440\u043e \u0441\u043b\u0456\u043f\u043e\u0433\u043e.\u000d\u000a\u0410\u043f. \u0410\u043d\u0434\u0440\u043e\u043d\u0456\u043a\u0430 \u0456 \u0441\u0432. \u042e\u043d\u0456\u0457 (\u0406). \u041c\u0447\u0447. \u0421\u043e\u043b\u043e\u0445\u043e\u043d\u0430, \u041f\u0430\u043c\u0444\u0430\u043c\u0438\u0440\u0430 \u0456 \u041f\u0430\u043c\u0444\u0430\u043b\u043e\u043d\u0430, \u000d\u000a\u0432\u043e\u0457\u043d\u0456\u0432 (284 \u2013 305). \u0421\u0432\u0442. \u0421\u0442\u0435\u0444\u0430\u043d\u0430, \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (893).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 8-\u0435, \u0406\u043d., 64 \u0437\u0430\u0447., XX, 11 \u2013 18.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 38 \u0437\u0430\u0447., XVI, 16 \u2013 34. \u0406\u043d., 34 \u0437\u0430\u0447., IX, 1 \u2013 38.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f \u00ab\u0421\u043f\u0430\u0441\u0438\u0442\u0435\u043b\u044e \u0411\u043e\u0433\u0443...\u00bb.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a17","39\u000d\u000a\u0412\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0430 \u041f\u0430\u0441\u0445\u0438. \u041c\u0447\u0447. \u0424\u0430\u043b\u0430\u043b\u0435\u044f, \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u0456 \u0410\u0441\u0442\u0435\u0440\u0456\u044f (\u0431\u043b. \u000d\u000a284). \u041f\u0440\u0430\u0432. \u041b\u0456\u0434\u0456\u0457 \u0424\u0438\u043b\u0438\u043f\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (\u0406). \u041c\u0447. \u0410\u0441\u043a\u0430\u043b\u043e\u043d\u0430 (\u0431\u043b. 287). \u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u0441\u0432\u0442. \u041e\u043b\u0435\u043a\u0441\u0456\u044f, \u043c\u0438\u0442\u0440. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0432\u0441\u0456\u0454\u0457 \u0420\u0443\u0441\u0438, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (1431).\u000d\u000a\u0414\u0456\u044f\u043d., 41 \u0437\u0430\u0447., XVIII, 22 \u2013 28. \u0406\u043d., 43 \u0437\u0430\u0447., XII, 36 \u2013 47.\u000d\u000a\u041f\u043e\u0447\u0430\u0442\u043e\u043a \u0432\u0435\u0447\u0456\u0440\u043d\u0456, \u0440\u0430\u043d\u043d\u044c\u043e\u0457 \u0456 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u2013 \u043f\u0430\u0441\u0445\u0430\u043b\u044c\u043d\u0438\u0439. \u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f \u000d\u000a\u00ab\u0421\u043f\u0430\u0441\u0438\u0442\u0435\u043b\u044e \u0411\u043e\u0433\u0443...\u00bb. \u0427\u0430\u0441\u0438 \u0437\u0432\u0438\u0447\u0430\u0439\u043d\u0456. \u0417\u0430\u043a\u0456\u043d\u0447\u0435\u043d\u043d\u044f \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0442\u0430 \u0432\u0456\u0434\u043f\u0443\u0441\u0442 \u2013 \u000d\u000a\u043f\u0430\u0441\u0445\u0430\u043b\u044c\u043d\u0456. \u0406\u0441\u043d\u0443\u0454 \u0442\u0430\u043a\u043e\u0436 \u0442\u0440\u0430\u0434\u0438\u0446\u0456\u044f \u0437\u0432\u0435\u0440\u0448\u0443\u0432\u0430\u0442\u0438 \u0432\u0435\u0447\u0456\u0440\u043d\u044e \u0439 \u0440\u0430\u043d\u043d\u044e \u0437\u0430 \u043f\u0430\u0441\u0445\u0430\u043b\u044c\u043d\u0438\u043c \u0447\u0438\u043d\u043e\u043c.\u000d\u000a\u041c\u0447. \u0412\u0430\u0441\u0438\u043b\u0456\u0441\u043a\u0430 (\u0431\u043b. 308). \u041f\u0430\u043c\u2019\u044f\u0442\u044c \u0406\u0406 \u0412\u0441\u0435\u043b\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u0441\u043e\u0431\u043e\u0440\u0443 (381). \u041c\u0447. \u0406\u043e\u0430\u043d\u0430-\u0412\u043e\u043b\u043e\u0434\u0438\u043c\u0438\u0440\u0430, \u043a\u043d. \u0421\u0435\u0440\u0431\u0441\u044c\u043a\u043e\u0433\u043e (1015). \u041f\u0440\u0430\u0432. \u041c\u0435\u043b\u0445\u0438\u0441\u0435\u0434\u0435\u043a\u0430, \u0446\u0430\u0440\u044f \u000d\u000a\u0421\u0430\u043b\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (2000 \u0440. \u0434\u043e \u0420. \u0425\u0440.)\u000d\u000a\u0414\u0456\u044f\u043d., 42 \u0437\u0430\u0447., XIX, 1 \u2013 8. \u0406\u043d., 47 \u0437\u0430\u0447., XIV, 1 \u2013 11.\u000d\u000a\u0417 \u0446\u044c\u043e\u0433\u043e \u0434\u043d\u044f \u043d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439, \u043a\u043e\u043b\u0438 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0432\u0435\u043b\u0438\u043a\u0435 \u0441\u043b\u0430\u0432\u043e\u0441\u043b\u0456\u0432\u2019\u044f, \u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f \u000d\u000a\u00ab\u0421\u043f\u0430\u0441\u0438\u0442\u0435\u043b\u044e \u0411\u043e\u0433\u0443...\u00bb, \u043a\u0440\u0456\u043c 7-\u043e\u0457 \u043d\u0435\u0434\u0456\u043b\u0456 \u043f\u0456\u0441\u043b\u044f \u041f\u0430\u0441\u0445\u0438 \u0456 \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0412\u043e\u0437\u043d\u0435\u0441\u0456\u043d\u043d\u044f. \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u043f\u0456\u0441\u043b\u044f \u0432\u0445\u043e\u0434\u0443 \u0443 \u0431\u0443\u0434\u043d\u0456 \u0434\u043d\u0456 \u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f: \u00ab\u041f\u0440\u0438\u0439\u0434\u0456\u0442\u044c, \u043f\u043e\u043a\u043b\u043e\u043d\u0456\u043c\u043e\u0441\u044c... \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, \u0449\u043e \u0432\u043e\u0437\u043d\u0456\u0441\u0441\u044f \u0443 \u0441\u043b\u0430\u0432\u0456...\u00bb. \u041f\u0440\u043e\u043a\u0438\u043c\u0435\u043d, \u000d\u000a\u0430\u043b\u0438\u043b\u0443\u0430\u0440\u0456\u0439 \u0456 \u043f\u0440\u0438\u0447\u0430\u0441\u043d\u0438\u0439 \u0441\u0432\u044f\u0442\u0430 (\u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f).\u000d\u000a20\u000d\u000a22\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0412\u041e\u0417\u041d\u0415\u0421\u0406\u041d\u041d\u042f \u0413\u041e\u0421\u041f\u041e\u0414\u041d\u0404.\u000d\u000a\u0420\u0456\u0432\u043d\u043e\u0430\u043f\u043f. \u0456\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 \u041a\u043e\u0441\u0442\u044f\u043d\u0442\u0438\u043d\u0430 (337) \u0456 \u043c\u0430\u0442\u0435\u0440\u0456 \u0439\u043e\u0433\u043e \u0456\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u0456 \u041e\u043b\u0435\u043d\u0438 (327). \u0411\u043b\u0433\u0432. \u043a\u043d. \u041a\u043e\u0441\u0442\u044f\u043d\u0442\u0438\u043d\u0430 (1129) \u0442\u0430 \u0434\u0456\u0442\u0435\u0439 \u0439\u043e\u0433\u043e \u000d\u000a\u041c\u0438\u0445\u0430\u0457\u043b\u0430 \u0456 \u0424\u0435\u0434\u043e\u0440\u0430, \u0427\u0435\u0440\u043d\u0456\u0433\u0456\u0432\u0441\u044c\u043a\u0438\u0445 \u0456 \u041c\u0443\u0440\u043e\u043c\u0441\u044c\u043a\u0438\u0445 \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u0456\u0432. \u041c\u0443\u0447\u0435\u043d\u0438\u043a\u0456\u0432, \u044f\u043a\u0456 \u0432 \u0434\u043e\u043b\u0438\u043d\u0456 \u0424\u0435\u0440\u0435\u0439\u0434\u0430\u043d (\u0406\u0440\u0430\u043d) \u0432\u0456\u0434 \u043f\u0435\u0440\u0441\u0456\u0432 \u043f\u043e\u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043b\u0438 (XVII) \u000d\u000a(\u0413\u0440\u0443\u0437.) (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043e \u0432 \u0434\u0435\u043d\u044c \u0412\u043e\u0437\u043d\u0435\u0441\u0456\u043d\u043d\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u043a., 71 \u0437\u0430\u0447., XVI, 9 \u2013 20.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 1 \u0437\u0430\u0447., I, 1 \u2013 12. \u041b\u043a., 114 \u0437\u0430\u0447., XXIV, 36 \u2013 53.\u000d\u000a\u0420\u0456\u0432\u043d\u043e\u0430\u043f\u043f.: \u0413\u0430\u043b., 200 \u0437\u0430\u0447., I, 11 \u2013 19. \u0406\u043d., 35 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), X, 1 \u2013 \u000d\u000a9 (\u0430\u043f\u043e\u0441\u0442\u043e\u043b \u0456 \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454 \u0440\u0456\u0432\u043d\u043e\u0430\u043f\u043e\u0441\u0442\u043e\u043b\u044c\u043d\u0438\u043c \u0447\u0438\u0442\u0430\u0454\u0442\u044c\u0441\u044f \u043b\u0438\u0448\u0435 \u0443 \u0445\u0440\u0430\u043c\u0430\u0445 \u043d\u0430 \u000d\u000a\u0447\u0435\u0441\u0442\u044c \u0446\u0438\u0445 \u0441\u0432\u044f\u0442\u0438\u0445). \u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0422\u0435\u0431\u0435, \u0416\u0438\u0442\u0442\u0454\u0434\u0430\u0432\u0447\u0435 \u0425\u0440\u0438\u0441\u0442\u0435, \u0456 \u000d\u000a\u0448\u0430\u043d\u0443\u0454\u043c\u043e \u043d\u0430 \u043d\u0435\u0431\u0435\u0441\u0430 \u0437 \u043f\u0440\u0435\u0447\u0438\u0441\u0442\u043e\u044e \u0422\u0432\u043e\u0454\u044e \u043f\u043b\u043e\u0442\u0442\u044e \u0411\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0435 \u0432\u043e\u0437\u043d\u0435\u0441\u0456\u043d\u043d\u044f\u00bb. \u041f\u0456\u0441\u043b\u044f \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u044f \u2013 \u00ab\u0412\u043e\u0441\u043a\u0440\u0435\u0441\u0456\u043d\u043d\u044f \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u0435 \u0431\u0430\u0447\u0438\u0432\u0448\u0438\u2026\u00bb. \u000d\u000a\u0417\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0427\u0435\u0441\u043d\u0456\u0448\u0443...\u00bb \u0441\u043f\u0456\u0432\u0430\u044e\u0442\u044c\u0441\u044f \u043f\u0440\u0438\u0441\u043f\u0456\u0432\u0438 \u0441\u0432\u044f\u0442\u0430. 1-\u0439 \u043f\u0440\u0438\u0441\u043f\u0456\u0432: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0439, \u0434\u0443\u0448\u0435 \u043c\u043e\u044f, \u0425\u0440\u0438\u0441\u0442\u0430 \u0416\u0438\u0442\u0442\u0454\u0434\u0430\u0432\u0446\u044f, \u042f\u043a\u0438\u0439 \u0432\u043e\u0437\u043d\u0456\u0441\u0441\u044f \u0432\u0456\u0434 \u0437\u0435\u043c\u043b\u0456 \u043d\u0430 \u000d\u000a\u041d\u0435\u0431\u043e\u00bb. \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0430\u043d\u0442\u0438\u0444\u043e\u043d\u0438 \u0441\u0432\u044f\u0442\u0430. \u0412\u0445\u0456\u0434\u043d\u0438\u0439 \u0441\u0442\u0438\u0445: \u00ab\u0417\u0456\u0439\u0448\u043e\u0432 \u0411\u043e\u0433 \u000d\u000a\u043f\u0440\u0438 \u043e\u043a\u043b\u0438\u043a\u0430\u0445 \u0440\u0430\u0434\u043e\u0441\u0442\u0456, \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u2013 \u043f\u0440\u0438 \u0437\u0432\u0443\u043a\u0430\u0445 \u0441\u0443\u0440\u043c\u043d\u0438\u0445\u00bb. \u041f\u0456\u0441\u043b\u044f \u0432\u0445\u0456\u0434\u043d\u043e\u0433\u043e \u0441\u0442\u0438\u0445\u0430 \u0432\u0456\u0434\u0440\u0430\u0437\u0443 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0442\u0440\u043e\u043f\u0430\u0440 \u0441\u0432\u044f\u0442\u0430, \u00ab\u0421\u043b\u0430\u0432\u0430 \u0456 \u043d\u0438\u043d\u0456\u00bb \u000d\u000a\u2013 \u043a\u043e\u043d\u0434\u0430\u043a \u0441\u0432\u044f\u0442\u0430, \u0430 \u043d\u0430 \u0430\u0440\u0445\u0456\u0454\u0440\u0435\u0439\u0441\u044c\u043a\u0456\u0439 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u043f\u0456\u0441\u043b\u044f \u0432\u0445\u0456\u0434\u043d\u043e\u0433\u043e \u0441\u0442\u0438\u0445\u0430 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f: \u00ab\u041f\u0440\u0438\u0439\u0434\u0456\u0442\u044c, \u043f\u043e\u043a\u043b\u043e\u043d\u0456\u043c\u043e\u0441\u044c\u2026 \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, \u0449\u043e \u0432\u043e\u0437\u043d\u0456\u0441\u0441\u044f \u0443 \u0441\u043b\u0430\u0432\u0456\u2026\u00bb, \u0430 \u0442\u043e\u0434\u0456 \u0442\u0440\u043e\u043f\u0430\u0440 \u0456 \u043a\u043e\u043d\u0434\u0430\u043a. \u0421\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0422\u0440\u0438\u0441\u0432\u044f\u0442\u0435. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0414\u043e\u0441\u0442\u043e\u0439\u043d\u043e\u2026\u00bb \u2013 \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0439, \u0434\u0443\u0448\u0435 \u043c\u043e\u044f... \u0422\u0435\u0431\u0435, \u0432\u0438\u0449\u0443 \u0440\u043e\u0437\u0443\u043c\u0443...\u00bb. \u000d\u000a\u0417\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u041c\u0438 \u0431\u0430\u0447\u0438\u043b\u0438 \u0421\u0432\u0456\u0442\u043b\u043e \u0456\u0441\u0442\u0438\u043d\u043d\u0435...\u00bb \u2013 \u00ab\u0412\u043e\u0437\u043d\u0456\u0441\u0441\u044f \u0442\u0438 \u0443 \u0441\u043b\u0430\u0432\u0456...\u00bb (\u0434\u043e \u000d\u000a\u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f). \u0423\u0432\u0435\u0447\u0435\u0440\u0456 \u043d\u0430 \u0441\u0432\u044f\u0442\u043e \u0432\u0456\u0434\u043f\u0440\u0430\u0432\u043b\u044f\u0454\u0442\u044c\u0441\u044f \u0432\u0435\u0447\u0456\u0440\u043d\u044f \u0456\u0437 \u0432\u0445\u043e\u0434\u043e\u043c \u0456 \u0432\u0435\u043b\u0438\u043a\u0438\u043c \u043f\u0440\u043e\u043a\u0438\u043c\u043d\u043e\u043c.\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a21","40\u000d\u000a\u041f\u0440\u0430\u0432. \u041c\u0430\u0440\u0456\u0457 \u041a\u043b\u0435\u043e\u043f\u043e\u0432\u043e\u0457, \u043c\u0438\u0440\u043e\u043d\u043e\u0441\u0438\u0446\u0456 (\u0406). \u041f\u0440\u043f. \u041c\u0438\u0445\u0430\u0439\u043b\u0430, \u0441\u043f\u043e\u0432., \u0454\u043f. \u0421\u0438\u043d\u0430\u0434\u0441\u044c\u043a\u043e\u0433\u043e (821). \u041f\u0440\u043c\u0447. \u041c\u0438\u0445\u0430\u0457\u043b\u0430, \u0447\u0435\u043d\u0446\u044f (\u0406\u0425). \u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u0441\u0432\u0442. \u000d\u000a\u041b\u0435\u043e\u043d\u0442\u0456\u044f \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0454\u043f. \u0420\u043e\u0441\u0442\u043e\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1164). \u041f\u0440\u043f. \u000d\u000a\u0404\u0444\u0440\u043e\u0441\u0438\u043d\u0456\u0457, \u0456\u0433\u0443\u043c. \u041f\u043e\u043b\u043e\u0446\u044c\u043a\u043e\u0457 (1173). \u000d\u000a\u0414\u0456\u044f\u043d., 43 \u0437\u0430\u0447., XX, 7 \u2013 12. \u0406\u043d., 48 \u0437\u0430\u0447., XIV, 10 \u2013 21.\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a23\u000d\u000a7-\u043c\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u0430\u0441\u0445\u0438, \u0441\u0432\u044f\u0442\u0438\u0445 \u043e\u0442\u0446\u0456\u0432 \u0406 \u0412\u0441\u0435\u043b\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u0441\u043e\u0431\u043e\u0440\u0443. \u0413\u043b\u0430\u0441 6-\u0439.\u000d\u000a\u041f\u0440\u043f. \u0421\u0438\u043c\u0435\u043e\u043d\u0430 \u0441\u0442\u043e\u0432\u043f\u043d\u0438\u043a\u0430 \u043d\u0430 \u0414\u0438\u0432\u043d\u0456\u0439 \u0433\u043e\u0440\u0456 (596). \u041c\u0447\u0447. \u041c\u0435\u043b\u0435\u0442\u0456\u044f \u0421\u0442\u0440\u0430\u0442\u0438\u043b\u0430\u0442\u0430, \u0421\u0442\u0435\u0444\u0430\u043d\u0430, \u0406\u043e\u0430\u043d\u0430, \u0421\u0435\u0440\u0430\u043f\u0456\u043e\u043d\u0430, \u0454\u0433\u0438\u043f\u0442\u044f\u043d\u0438\u043d\u0430, \u041a\u0430\u043b\u0438\u043d\u0438\u043a\u0430, \u0432\u043e\u043b\u0445\u0432\u0430, \u0424\u0435\u0434\u043e\u0440\u0430 \u0456 \u0424\u0430\u0432\u0441\u0442\u0430 \u0442\u0430 \u0437 \u043d\u0438\u043c\u0438 1218 \u0432\u043e\u0457\u043d\u0456\u0432 \u0437 \u0434\u0440\u0443\u0436\u0438\u043d\u0430\u043c\u0438 \u0456 \u0434\u0456\u0442\u044c\u043c\u0438 (218).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 10-\u0435, \u0406\u043d., 66 \u0437\u0430\u0447., XXI, 1 \u2013 14.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 44 \u0437\u0430\u0447., XX, 16 \u2013 18, 28 \u2013 36. \u0406\u043d., 56 \u0437\u0430\u0447., XVII, 1 \u2013 13.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f \u00ab\u0411\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0438\u043c \u043f\u043e\u043a\u0440\u0438\u0442\u0438\u0439...\u00bb, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u00ab\u0427\u0435\u0441\u043d\u0456\u0448\u0443\u00bb. \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u043f\u0456\u0441\u043b\u044f \u0432\u0445\u043e\u0434\u0443 \u0442\u0440\u043e\u043f\u0430\u0440 \u0432\u043e\u0441\u043a\u0440\u0435\u0441\u043d\u0438\u0439, \u0412\u043e\u0437\u043d\u0435\u0441\u0456\u043d\u043d\u044f \u0456 \u043e\u0442\u0446\u044f\u043c, \u000d\u000a\u00ab\u0421\u043b\u0430\u0432\u0430\u2026\u00bb \u043a\u043e\u043d\u0434\u0430\u043a \u043e\u0442\u0446\u044f\u043c, \u00ab\u0406 \u043d\u0438\u043d\u0456\u2026\u00bb \u2013 \u043a\u043e\u043d\u0434\u0430\u043a \u0412\u043e\u0437\u043d\u0435\u0441\u0456\u043d\u043d\u044f. \u041f\u0440\u043e\u043a\u0438\u043c\u0435\u043d, \u000d\u000a\u0410\u043f\u043e\u0441\u0442\u043e\u043b, \u0430\u043b\u0438\u043b\u0443\u0430\u0440\u0456\u0439 \u0456 \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454 \u043e\u0442\u0446\u044f\u043c. \u0417\u0430\u0434\u043e\u0441\u0442\u043e\u0439\u043d\u0438\u043a \u0441\u0432\u044f\u0442\u0430. \u041f\u0440\u0438\u0447\u0430\u0441\u043d\u0438\u0439 \u000d\u000a\u00ab\u0425\u0432\u0430\u043b\u0456\u0442\u044c \u0413\u043e\u0441\u043f\u043e\u0434\u0430\u2026\u00bb \u0456 \u00ab\u0420\u0430\u0434\u0443\u0439\u0442\u0435\u0441\u044f, \u043f\u0440\u0430\u0432\u0435\u0434\u043d\u0456\u2026\u00bb.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a24\u000d\u000a7-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u0430\u0441\u0445\u0438. \u0422\u0440\u0435\u0442\u0454 \u0437\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u0433\u043b\u0430\u0432\u0438 \u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456 \u000d\u000a\u0456 \u0425\u0440\u0435\u0441\u0442\u0438\u0442\u0435\u043b\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e \u0406\u043e\u0430\u043d\u0430 (\u0431\u043b. 850). \u0421\u0449\u043c\u0447. \u0424\u0435\u0440\u0430\u043f\u043e\u043d\u0442\u0430, \u000d\u000a\u0454\u043f. \u041a\u0456\u043f\u0440\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u0421\u0432\u0442. \u0406\u043d\u043e\u043a\u0435\u043d\u0442\u0456\u044f, \u0430\u0440\u0445\u0456\u0454\u043f. \u0425\u0435\u0440\u0441\u043e\u043d\u0441\u044c\u043a\u043e\u0433\u043e (1857).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 31 \u0437\u0430\u0447., VII, 17 \u2013 30.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 45 \u0437\u0430\u0447., XXI, 8 \u2013 14. \u0406\u043d., 49 \u0437\u0430\u0447., XIV, 27 \u2013 XV, 7.\u000d\u000a\u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456: 2 \u041a\u043e\u0440., 176 \u0437\u0430\u0447., IV, 6 \u2013 15. \u041c\u0444., 40 \u0437\u0430\u0447., XI, 2 \u2013 15.\u000d\u000a\u0410\u043f\u043f. \u0432\u0456\u0434 70-\u0445 \u041a\u0430\u0440\u043f\u0430 \u0439 \u0410\u043b\u0444\u0435\u044f (\u0406). \u041c\u0447. \u0410\u0432\u0435\u0440\u043a\u0456\u044f \u0442\u0430 \u043c\u0446. \u041e\u043b\u0435\u043d\u0438 (\u0406). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430 \u000d\u000a\u041f\u0441\u0438\u0445\u0430\u0457\u0442\u0430, \u0441\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u043a\u0430 (\u0406\u0425). \u041c\u0447. \u0413\u0435\u043e\u0440\u0433\u0456\u044f \u041d\u043e\u0432\u043e\u0433\u043e (1515). \u000d\u000a\u0414\u0456\u044f\u043d., 46 \u0437\u0430\u0447., XXI, 26 \u2013 32. \u0406\u043d., 53 \u0437\u0430\u0447., XVI, 2 \u2013 13.\u000d\u000a\u041f\u0440\u043f. \u041c\u0438\u043a\u0438\u0442\u0438, \u0441\u043f\u043e\u0432., \u0454\u043f. \u0425\u0430\u043b\u043a\u0456\u0434\u043e\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0425). \u0421\u0449\u043c\u0447. \u0404\u0432\u0442\u0438\u0445\u0456\u044f, \u0454\u043f. \u041c\u0435\u043b\u0456\u0442\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0406), \u041c\u0446. \u0404\u043b\u0438\u043a\u043e\u043d\u0438\u0434\u0438 (244). \u0421\u0449\u043c\u0447. \u0415\u043b\u043b\u0430\u0434\u0456\u044f, \u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0430 (V\u0406 \u2013 V\u0406\u0406).\u000d\u000a\u0414\u0456\u044f\u043d., 48 \u0437\u0430\u0447., XXV, 13 \u2013 19. \u0406\u043d., 55 \u0437\u0430\u0447., XVI, 23 \u2013 33.\u000d\u000a\u0412\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0430 \u0412\u043e\u0437\u043d\u0435\u0441\u0456\u043d\u043d\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e. \u041c\u0446. \u0424\u0435\u043e\u0434\u043e\u0441\u0456\u0457, \u0434\u0456\u0432\u0438 \u000d\u000a\u0422\u0438\u0440\u0441\u044c\u043a\u043e\u0457 (307 \u2013 308). \u041f\u0430\u043c\u2019\u044f\u0442\u044c \u0406 \u0412\u0441\u0435\u043b\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u0441\u043e\u0431\u043e\u0440\u0443 (325). \u041f\u0440\u043c\u0447. \u0424\u0435\u043e\u0434\u043e\u0441\u0456\u0457, \u0434\u0456\u0432\u0438 (726 \u2013 730). \u000d\u000a\u0421\u0449\u043c\u0447. \u0424\u0435\u0440\u0430\u043f\u043e\u043d\u0442\u0430, \u0454\u043f. \u0421\u0430\u0440\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0406\u0406). \u041c\u0446. \u0424\u0435\u043e\u0434\u043e\u0440\u0438, \u0434\u0456\u0432\u0438, \u0456 \u043c\u0447. \u0414\u0438\u0434\u0438\u043c\u0430, \u0432\u043e\u0457\u043d\u0430 (304). \u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u0441\u0432\u0442\u0442. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u0438\u0445: \u041a\u0438\u043f\u0440\u0456\u0430\u043d\u0430 \u0442\u0430 \u0424\u043e\u0442\u0456\u044f (1472). \u041f\u0440\u0430\u0432. \u0406\u043e\u0430\u043d\u0430 \u0420\u0443\u0441\u0438\u043d\u0430, \u0441\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u043a\u0430 (1730).\u000d\u000a\u041f\u0440\u043f. \u0414\u043e\u0434\u043e \u0414\u0430\u0432\u0438\u0434\u043e-\u0413\u0430\u0440\u0435\u0434\u0436\u0438\u0439\u0441\u044c\u043a\u043e\u0433\u043e (596, \u0413\u0440\u0443\u0437.) (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 \u0441\u0435\u0440\u0435\u0434\u0443 \u043f\u0456\u0441\u043b\u044f \u0412\u043e\u0437\u043d\u0435\u0441\u0456\u043d\u043d\u044f).\u000d\u000a\u0414\u0456\u044f\u043d., 47 \u0437\u0430\u0447., XXIII, 1 \u2013 11. \u0406\u043d., 54 \u0437\u0430\u0447., XVI, 15 \u2013 23.\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a25\u000d\u000a26\u000d\u000a28\u000d\u000a29\u000d\u000a27","41\u000d\u000a\u0406\u043a\u043e\u043d \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456, \u0437\u0432\u0430\u043d\u0438\u0445 \u00ab\u0421\u043f\u043e\u0440\u0443\u0447\u043d\u0438\u0446\u044f \u0433\u0440\u0456\u0448\u043d\u0438\u0445\u00bb \u0442\u0430 \u00ab\u041d\u0435\u0432\u0442\u043e\u043c\u043d\u0435 \u041e\u043a\u043e\u00bb.\u000d\u000a\u0414\u0456\u044f\u043d., 50 \u0437\u0430\u0447., XXVII, 1 \u2013 44. \u0406\u043d., 57 \u0437\u0430\u0447., XVII, 18 \u2013 26.\u000d\u000a\u0421\u043b\u0443\u0436\u0431\u0430 \u0437\u0430 \u0422\u0440\u0456\u043e\u0434\u0434\u044e. \u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f \u00ab\u0411\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0438\u043c \u043f\u043e\u043a\u0440\u0438\u0442\u0438\u0439...\u00bb. \u00ab\u0427\u0435\u0441\u043d\u0456\u0448\u0443...\u00bb \u043d\u0435 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f, \u0430 \u043f\u0440\u0438\u0441\u043f\u0456\u0432\u0438 \u0441\u0432\u044f\u0442\u0430. \u0421\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0432\u0435\u043b\u0438\u043a\u0435 \u0441\u043b\u0430\u0432\u043e\u0441\u043b\u0456\u0432\u2019\u044f.\u000d\u000a\u0422\u0440\u043e\u0457\u0446\u044c\u043a\u0430 \u043f\u043e\u043c\u0438\u043d\u0430\u043b\u044c\u043d\u0430 \u0441\u0443\u0431\u043e\u0442\u0430. \u0417\u0432\u0435\u0440\u0448\u0443\u0454\u043c\u043e \u043f\u0430\u043c\u2019\u044f\u0442\u044c \u0432\u0441\u0456\u0445 \u0432\u0456\u0434 \u0432\u0456\u043a\u0443 \u000d\u000a\u0441\u043f\u043e\u0447\u0438\u043b\u0438\u0445 \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u0438\u0445 \u0445\u0440\u0438\u0441\u0442\u0438\u044f\u043d \u2013 \u043e\u0442\u0446\u0456\u0432, \u043c\u0430\u0442\u0435\u0440\u0456\u0432, \u0431\u0440\u0430\u0442\u0456\u0432 \u0456 \u0441\u0435\u0441\u0442\u0435\u0440 \u043d\u0430\u0448\u0438\u0445. \u041f\u0440\u043f. \u0406\u0441\u0430\u0430\u043a\u0456\u044f, \u0441\u043f\u043e\u0432., \u0456\u0433\u0443\u043c\u0435\u043d\u0430 \u043e\u0431\u0438\u0442\u0435\u043b\u0456 \u0414\u0430\u043b\u043c\u0430\u0442\u0441\u044c\u043a\u043e\u0457 (383).\u000d\u000a\u0420\u044f\u0434.: \u0414\u0456\u044f\u043d., 51 \u0437\u0430\u0447., XXVIII, 1 \u2013 31. \u0406\u043d., 67 \u0437\u0430\u0447., XXI, 15 \u2013 25. \u000d\u000a\u0417\u0430\u0443\u043f\u043e\u043a\u0456\u0439\u043d\u0435: 1 \u041a\u043e\u0440., 163 \u0437\u0430\u0447., XV, 47 \u2013 57. \u0406\u043d., 16 \u0437\u0430\u0447., V, 24 \u2013 30.\u000d\u000a\u0421\u043b\u0443\u0436\u0431\u0430 \u0442\u0456\u043b\u044c\u043a\u0438 \u0437 \u0422\u0440\u0456\u043e\u0434\u0456. \u041d\u0430 \u0432\u0435\u0447\u0456\u0440\u043d\u0456 \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u043f\u0440\u043e\u043a\u0438\u043c\u043d\u0430 \u2013 \u00ab\u0410\u043b\u0438\u043b\u0443\u044f\u00bb \u0456\u0437 \u0437\u0430\u0443\u043f\u043e\u043a\u0456\u0439\u043d\u0438\u043c\u0438 \u0441\u0442\u0438\u0445\u0430\u043c\u0438. \u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0411\u043e\u0433 \u0413\u043e\u0441\u043f\u043e\u0434\u044c..\u00bb \u2013 \u00ab\u0410\u043b\u0438\u043b\u0443\u044f\u00bb \u0456\u0437 \u000d\u000a\u0437\u0430\u0443\u043f\u043e\u043a\u0456\u0439\u043d\u0438\u043c\u0438 \u0441\u0442\u0438\u0445\u0430\u043c\u0438. \u041a\u0430\u043d\u043e\u043d \u0445\u0440\u0430\u043c\u0443 \u0456 \u0422\u0440\u0456\u043e\u0434\u0456 (\u0437 2-\u044e \u043f\u0456\u0441\u043d\u0435\u044e). \u041a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f \u000d\u000a\u0422\u0440\u0456\u043e\u0434\u0456. \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u00ab\u0414\u043e\u0441\u0442\u043e\u0439\u043d\u043e \u0454\u2026\u00bb. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u041c\u0438 \u0431\u0430\u0447\u0438\u043b\u0438 \u0441\u0432\u0456\u0442\u043b\u043e \u0456\u0441\u0442\u0438\u043d\u043d\u0435...\u00bb \u2013 \u0442\u0440\u043e\u043f\u0430\u0440 \u00ab\u0413\u043b\u0438\u0431\u0438\u043d\u043e\u044e \u043c\u0443\u0434\u0440\u043e\u0441\u0442\u0456...\u00bb.\u000d\u000a30\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a8-\u043c\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u0430\u0441\u0445\u0438.\u000d\u000a\u0414\u0415\u041d\u042c \u0421\u0412\u042f\u0422\u041e\u0407 \u0422\u0420\u041e\u0419\u0426\u0406, \u041f\u2019\u042f\u0422\u0414\u0415\u0421\u042f\u0422\u041d\u0418\u0426\u042f.\u000d\u000a\u0410\u043f. \u0432\u0456\u0434 70-\u0445 \u0404\u0440\u043c\u0430 (\u0406). \u041c\u0447. \u0404\u0440\u043c\u0456\u044f (\u0406\u0406). \u041c\u0447. \u0424\u0456\u043b\u043e\u0441\u043e\u0444\u0430 (\u0406\u0406\u0406). \u0421\u0432\u0442. \u0424\u0456\u043b\u043e\u0444\u0435\u044f \u041b\u0456\u0449\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u043c\u0438\u0442\u0440. \u0422\u043e\u0431\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (1727) \u000d\u000a\u0421\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432\u0456\u0434\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u041c\u0438\u0445\u0430\u0439\u043b\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0417\u043e\u043b\u043e\u0442\u043e\u0432\u0435\u0440\u0445\u043e\u0433\u043e \u000d\u000a\u0441\u043e\u0431\u043e\u0440\u0443 (2000) \u0432 \u043c\u0456\u0441\u0442\u0456 \u041a\u0438\u0454\u0432\u0456 (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 \u043e\u0441\u0442\u0430\u043d\u043d\u044e \u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044e \u0442\u0440\u0430\u0432\u043d\u044f).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 65 \u0437\u0430\u0447., XX, 19 \u2013 23. \u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 3 \u0437\u0430\u0447., II, 1 \u2013 11. \u0406\u043d., 27 \u0437\u0430\u0447., VII, 37 \u2013 52; VIII, 12.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0422\u0435\u0431\u0435, \u0416\u0438\u0442\u0442\u0454\u0434\u0430\u0432\u0447\u0435 \u0425\u0440\u0438\u0441\u0442\u0435, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u0412\u0441\u0435\u0441\u0432\u044f\u0442\u043e\u0433\u043e \u0414\u0443\u0445\u0430 \u0422\u0432\u043e\u0433\u043e, \u0449\u043e \u0419\u043e\u0433\u043e \u0432\u0456\u0434 \u041e\u0442\u0446\u044f \u043f\u043e\u0441\u043b\u0430\u0432 \u0422\u0438 \u0431\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0438\u043c \u0443\u0447\u043d\u044f\u043c \u0422\u0432\u043e\u0457\u043c\u00bb. \u00ab\u0412\u043e\u0441\u043a\u0440\u0435\u0441\u0456\u043d\u043d\u044f \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u0435 \u0431\u0430\u0447\u0438\u0432\u0448\u0438\u2026\u00bb \u043d\u0435 \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e. \u000d\u000a\u0423 \u0422\u0440\u0456\u043e\u0434\u0456 \u0434\u043b\u044f 9-\u043e\u0457 \u043f\u0456\u0441\u043d\u0456 \u043a\u0430\u043d\u043e\u043d\u0443 \u043f\u0440\u0438\u0441\u043f\u0456\u0432\u0456\u0432 \u043d\u0435\u043c\u0430\u0454, \u0430\u043b\u0435 \u0432 \u0422\u0440\u0456\u043e\u0434\u0456 \u043d\u043e\u0442\u043d\u043e\u0433\u043e \u000d\u000a\u0441\u043f\u0456\u0432\u0443 \u0434\u043b\u044f \u0437\u0430\u0434\u043e\u0441\u0442\u043e\u0439\u043d\u0438\u043a\u0430 \u0432 \u0434\u0435\u043d\u044c \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456 \u0432\u043a\u0430\u0437\u0443\u0454\u0442\u044c\u0441\u044f \u0442\u0430\u043a\u0438\u0439 \u043f\u0440\u0438\u0441\u043f\u0456\u0432: \u00ab\u0410\u043f\u043e\u0441\u0442\u043e\u043b\u0438, \u0437\u0456\u0448\u0435\u0441\u0442\u044f \u0423\u0442\u0456\u0448\u0438\u0442\u0435\u043b\u044f \u0431\u0430\u0447\u0438\u0432\u0448\u0438, \u0437\u0434\u0438\u0432\u0443\u0432\u0430\u043b\u0438\u0441\u044f, \u044f\u043a \u0443 \u0432\u0438\u0433\u043b\u044f\u0434\u0456 \u0432\u043e\u0433\u043d\u044f\u043d\u0438\u0445 \u044f\u0437\u0438\u043a\u0456\u0432 \u044f\u0432\u0438\u0432\u0441\u044f \u0414\u0443\u0445 \u0421\u0432\u044f\u0442\u0438\u0439\u00bb. \u00ab\u0421\u0432\u044f\u0442 \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u0411\u043e\u0433 \u043d\u0430\u0448\u00bb \u000d\u000a\u043d\u0435 \u043f\u0440\u043e\u043c\u043e\u0432\u043b\u044f\u0454\u0442\u044c\u0441\u044f. \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u2013 \u0430\u043d\u0442\u0438\u0444\u043e\u043d\u0438 \u0441\u0432\u044f\u0442\u0430. \u0412\u0445\u0456\u0434\u043d\u0438\u0439 \u0441\u0442\u0438\u0445: \u000d\u000a\u00ab\u041f\u0456\u0434\u043d\u0435\u0441\u0438\u0441\u044f, \u0413\u043e\u0441\u043f\u043e\u0434\u0438, \u0441\u0438\u043b\u043e\u044e \u0422\u0432\u043e\u0454\u044e! \u0411\u0443\u0434\u0435\u043c\u043e \u0441\u043f\u0456\u0432\u0430\u0442\u0438 \u0439 \u043f\u0440\u043e\u0441\u043b\u0430\u0432\u043b\u044f\u0442\u0438 \u043c\u043e\u0433\u0443\u0442\u043d\u0456\u0441\u0442\u044c \u0422\u0432\u043e\u044e\u00bb. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u0442\u0440\u0438\u0441\u0432\u044f\u0442\u043e\u0433\u043e \u2013 \u00ab\u0412\u0441\u0456 \u0432\u0438, \u0449\u043e \u0432 \u000d\u000a\u0425\u0440\u0438\u0441\u0442\u0430 \u0445\u0440\u0435\u0441\u0442\u0438\u043b\u0438\u0441\u044f...\u00bb, \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0414\u043e\u0441\u0442\u043e\u0439\u043d\u043e \u0454\u2026\u00bb \u2013 \u00ab\u0420\u0430\u0434\u0443\u0439\u0441\u044f, \u0426\u0430\u0440\u0438\u0446\u0435...\u00bb. \u041f\u0456\u0441\u043b\u044f \u00ab\u0421\u043f\u0430\u0441\u0438, \u0411\u043e\u0436\u0435...\u00bb \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u00ab\u041c\u0438 \u0431\u0430\u0447\u0438\u043b\u0438 \u0441\u0432\u0456\u0442\u043b\u043e \u0456\u0441\u0442\u0438\u043d\u043d\u0435...\u00bb. \u041f\u0456\u0441\u043b\u044f \u0432\u0456\u0434\u043f\u0443\u0441\u0442\u0443 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0446\u0430\u0440\u0441\u044c\u043a\u0456 \u0432\u0440\u0430\u0442\u0430 \u0437\u0430\u0447\u0438\u043d\u044f\u044e\u0442\u044c\u0441\u044f, \u0437\u0432\u0435\u0440\u0448\u0443\u0454\u043c\u043e 9-\u0439 \u0447\u0430\u0441 \u0456 \u043f\u043e\u0447\u0438\u043d\u0430\u0454\u043c\u043e \u0432\u0435\u0447\u0456\u0440\u043d\u044e \u0437 \u0432\u0438\u0433\u043e\u043b\u043e\u0441\u0443 \u00ab\u0411\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0435\u043d\u043d\u0438\u0439 \u0411\u043e\u0433 \u000d\u000a\u043d\u0430\u0448...\u00bb. \u00ab\u0426\u0430\u0440\u044e \u041d\u0435\u0431\u0435\u0441\u043d\u0438\u0439\u2026\u00bb, \u044f\u043a \u043f\u0440\u0430\u0432\u0438\u043b\u043e, \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u043d\u0430\u0440\u043e\u0434\u043e\u043c. \u041d\u0430 \u000d\u000a\u0432\u0435\u0447\u0456\u0440\u043d\u0456 \u043f\u0456\u0441\u043b\u044f 103 \u043f\u0441\u0430\u043b\u043c\u0430 \u2013 \u0432\u0435\u043b\u0438\u043a\u0430 \u0435\u043a\u0442\u0435\u043d\u0456\u044f \u0437 \u0434\u043e\u0434\u0430\u0432\u0430\u043d\u043d\u044f\u043c \u043e\u0441\u043e\u0431\u043b\u0438\u0432\u0438\u0445 \u000d\u000a\u043f\u0440\u043e\u0445\u0430\u043d\u044c, \u0432\u0445\u0456\u0434 \u0437 \u043a\u0430\u0434\u0438\u043b\u043e\u043c, \u0432\u0435\u043b\u0438\u043a\u0438\u0439 \u043f\u0440\u043e\u043a\u0438\u043c\u0435\u043d \u0456 \u0447\u0438\u0442\u0430\u043d\u043d\u044f \u043a\u043e\u043b\u0456\u043d\u043e\u0432\u043a\u043b\u043e\u043d\u043d\u0438\u0445 \u043c\u043e\u043b\u0438\u0442\u043e\u0432. \u0412\u0456\u0434\u043f\u0443\u0441\u0442 \u0432\u0435\u0447\u0456\u0440\u043d\u0456 \u043f\u0440\u0438 \u0432\u0456\u0434\u0447\u0438\u043d\u0435\u043d\u0438\u0445 \u0446\u0430\u0440\u0441\u044c\u043a\u0438\u0445 \u0432\u0440\u0430\u0442\u0430\u0445 \u00ab\u0425\u0440\u0438\u0441\u0442\u043e\u0441, \u0449\u043e \u0437 \u041e\u0442\u0447\u043e\u0433\u043e \u0456 \u0411\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u043b\u043e\u043d\u0430...\u00bb. \u0417 \u0446\u044c\u043e\u0433\u043e \u0434\u043d\u044f \u0456 \u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u000d\u000a\u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456 \u043d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439, \u043a\u043e\u043b\u0438 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0432\u0435\u043b\u0438\u043a\u0435 \u0441\u043b\u0430\u0432\u043e\u0441\u043b\u0456\u0432\u2019\u044f, \u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f \u00ab\u0411\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0438\u043c \u043f\u043e\u043a\u0440\u0438\u0442\u0438\u0439...\u00bb. \u041f\u0456\u0441\u043b\u044f \u0441\u0432\u044f\u0442\u0430 \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456 \u0442\u0438\u0436\u043d\u0456 \u000d\u000a\u043f\u043e\u0447\u0438\u043d\u0430\u044e\u0442\u044c\u0441\u044f \u0437 \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043a\u0430, \u0430 \u0437\u0430\u043a\u0456\u043d\u0447\u0443\u044e\u0442\u044c\u0441\u044f \u043d\u0435\u0434\u0456\u043b\u0435\u044e.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a31","42\u000d\u000a1-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0417\u0430\u0433\u0430\u043b\u044c\u043d\u0438\u0446\u044f. \u000d\u000a\u0414\u0435\u043d\u044c \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u0414\u0443\u0445\u0430. \u041c\u0447\u0447. \u042e\u0441\u0442\u0438\u043d\u0430 \u0424\u0456\u043b\u043e\u0441\u043e\u0444\u0430 \u0442\u0430 \u0456\u043d\u0448\u043e\u0433\u043e \u042e\u0441\u0442\u0438\u043d\u0430, \u0456 \u0437 \u000d\u000a\u043d\u0438\u043c\u0438 \u0425\u0430\u0440\u0438\u0442\u043e\u043d\u0430, \u0425\u0430\u0440\u0438\u0442\u0438, \u0404\u0432\u0435\u043b\u043f\u0456\u0441\u0442\u0430, \u0406\u0454\u0440\u0430\u043a\u0441\u0430, \u041f\u0435\u043e\u043d\u0430 \u0456 \u0412\u0430\u043b\u0435\u0440\u0456\u0430\u043d\u0430 (166). \u000d\u000a\u041f\u0440\u043f. \u0410\u0433\u0430\u043f\u0456\u0442\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u043b\u0456\u043a\u0430\u0440\u044f \u0431\u0435\u0437\u0432\u0456\u0434\u043f\u043b\u0430\u0442\u043d\u043e\u0433\u043e, \u0432 \u000d\u000a\u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0431\u043b. 1095). \u000d\u000a\u041a\u0456\u043f\u0440\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 \u0414\u0435\u043d\u044c \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u000d\u000a\u0414\u0443\u0445\u0430).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0415\u0444., 229 \u0437\u0430\u0447., V, 8 \u2013 19. \u041c\u0444., 75 \u0437\u0430\u0447., XVIII, 10 \u2013 20.\u000d\u000a\u041f\u0440\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0427\u0435\u0441\u043d\u0456\u0448\u0443...\u00bb \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0456\u0440\u043c\u043e\u0441 \u00ab\u0420\u0430\u0434\u0443\u0439\u0441\u044f, \u0426\u0430\u0440\u0438\u0446\u0435...\u00bb. \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0432\u0445\u0456\u0434\u043d\u0438\u0439 \u0441\u0442\u0438\u0445: \u00ab\u041f\u0456\u0434\u043d\u0435\u0441\u0438\u0441\u044f, \u0413\u043e\u0441\u043f\u043e\u0434\u0438, \u0441\u0438\u043b\u043e\u044e \u000d\u000a\u0422\u0432\u043e\u0454\u044e! \u0411\u0443\u0434\u0435\u043c\u043e \u0441\u043f\u0456\u0432\u0430\u0442\u0438 \u0439 \u043f\u0440\u043e\u0441\u043b\u0430\u0432\u043b\u044f\u0442\u0438 \u043c\u043e\u0433\u0443\u0442\u043d\u0456\u0441\u0442\u044c \u0422\u0432\u043e\u044e\u00bb. \u0421\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0442\u0440\u0438\u0441\u0432\u044f\u0442\u0435. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0414\u043e\u0441\u0442\u043e\u0439\u043d\u043e \u0454\u2026\u00bb \u2013 \u00ab\u0420\u0430\u0434\u0443\u0439\u0441\u044f, \u0426\u0430\u0440\u0438\u0446\u0435...\u00bb \u000d\u000a(\u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f). \u0412\u0456\u0434\u043f\u0443\u0441\u0442 \u0432\u0435\u0447\u0456\u0440\u043d\u0456, \u0440\u0430\u043d\u043d\u044c\u043e\u0457 \u0442\u0430 \u043b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0443 \u0432\u0441\u0456 \u0434\u043d\u0456 \u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u000d\u000a\u2013 \u00ab\u0425\u0440\u0438\u0441\u0442\u043e\u0441, \u0449\u043e \u0443 \u0432\u0438\u0433\u043b\u044f\u0434\u0456 \u0432\u043e\u0433\u043d\u044f\u043d\u0438\u0445 \u044f\u0437\u0438\u043a\u0456\u0432...\u00bb.\u000d\u000a\u0423 \u0441\u0435\u0440\u0435\u0434\u0443 \u0456 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e \u043f\u043e\u0441\u0442\u0443 \u043d\u0435\u043c\u0430\u0454.\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a1\u000d\u000a\u0421\u0432\u0442. \u041d\u0438\u043a\u0438\u0444\u043e\u0440\u0430, \u0441\u043f\u043e\u0432., \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (828). \u0412\u043c\u0447. \u0406\u043e\u0430\u043d\u0430 \u041d\u043e\u0432\u043e\u0433\u043e, \u0421\u0443\u0447\u0430\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1330 \u2013 1340). \u0421\u0449\u043c\u0447. \u041f\u043e\u0444\u0438\u043d\u0430, \u0454\u043f. \u041b\u0456\u043e\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u0442\u0438\u0445, \u044f\u043a\u0456 \u0437 \u043d\u0438\u043c \u043f\u043e\u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043b\u0438 (177). \u041c\u0446. \u0411\u043b\u0430\u043d\u0434\u0438\u043d\u0438 \u0456 \u043c\u0447. \u041f\u043e\u043d\u0442\u0438\u043a\u0430 \u000d\u000a\u041b\u0456\u043e\u043d\u0441\u044c\u043a\u0438\u0445 (177).\u000d\u000a\u041a\u0438\u0454\u0432\u043e-\u0411\u0440\u0430\u0442\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (1654).\u000d\u000a\u0420\u0438\u043c., 79 \u0437\u0430\u0447., I, 1 \u2013 7, 13 \u2013 17. \u041c\u0444., 10 \u0437\u0430\u0447., IV, 25 \u2013 V, 13.\u000d\u000a\u0417 \u0446\u044c\u043e\u0433\u043e \u0434\u043d\u044f \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u00ab\u0427\u0435\u0441\u043d\u0456\u0448\u0443...\u00bb (\u043a\u0440\u0456\u043c \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456).\u000d\u000a\u041c\u0447\u0447. \u041b\u0443\u043a\u0438\u043b\u0456\u0430\u043d\u0430, \u041a\u043b\u0430\u0432\u0434\u0456\u044f, \u0406\u043f\u0430\u0442\u0456\u044f, \u041f\u0430\u0432\u043b\u0430, \u0414\u0456\u043e\u043d\u0456\u0441\u0456\u044f \u0456 \u043c\u0446. \u041f\u0430\u0432\u043b\u0438, \u0434\u0456\u0432\u0438 (270 \u000d\u000a\u2013 275). \u0421\u0449\u043c\u0447\u0447. \u041b\u0443\u043a\u0456\u0430\u043d\u0430, \u0454\u043f., \u041c\u0430\u043a\u0441\u0456\u0430\u043d\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u042e\u043b\u0456\u0430\u043d\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0430, \u000d\u000a\u043c\u0447\u0447. \u041c\u0430\u0440\u043a\u0435\u043b\u0456\u0430\u043d\u0430 \u0456 \u0421\u0430\u0442\u0443\u0440\u043d\u0438\u043d\u0430 \u0432 \u0411\u0435\u043b\u044c\u0433\u0456\u0457 (81 \u2013 96).\u000d\u000a\u0420\u0438\u043c., 80 \u0437\u0430\u0447., I, 18 \u2013 27. \u041c\u0444., 12 \u0437\u0430\u0447., V, 20 \u2013 26.\u000d\u000a\u041f\u0440\u0430\u0432. \u041c\u0430\u0440\u0444\u0438 \u0456 \u041c\u0430\u0440\u0456\u0457, \u043c\u0438\u0440\u043e\u043d\u043e\u0441\u0438\u0446\u044c, \u0441\u0435\u0441\u0442\u0435\u0440 \u043f\u0440\u0430\u0432. \u041b\u0430\u0437\u0430\u0440\u044f \u0427\u043e\u0442\u0438\u0440\u0438\u0434\u0435\u043d\u043d\u043e\u0433\u043e, \u0454\u043f. \u041a\u0438\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406). \u0421\u0432\u0442. \u041c\u0438\u0442\u0440\u043e\u0444\u0430\u043d\u0430, \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 326). \u041c\u0447\u0447. \u0424\u0440\u043e\u043d\u0442\u0430\u0441\u0456\u044f, \u0421\u0435\u0432\u0435\u0440\u0438\u043d\u0430, \u0421\u0435\u0432\u0435\u0440\u0456\u0430\u043d\u0430 \u0456 \u0421\u0438\u043b\u0430\u043d\u0430 (\u0406). \u000d\u000a\u041c\u0447. \u041a\u043e\u043d\u043a\u043e\u0440\u0434\u0456\u044f (\u0431\u043b. 175). \u0421\u0449\u043c\u0447. \u0410\u0441\u0442\u0456\u044f, \u0454\u043f. \u0414\u0438\u0440\u0440\u0430\u0445\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0406). \u041f\u0440\u043f. \u0417\u043e\u0441\u0438\u043c\u0438, \u0454\u043f. \u0412\u0430\u0432\u0438\u043b\u043e\u043d\u0430 \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406). \u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u0421\u043f\u043e\u0440\u0443\u0447\u043d\u0438\u0446\u044f \u0433\u0440\u0456\u0448\u043d\u0438\u0445\u00bb, \u041a\u043e\u0440\u0435\u0446\u044c\u043a\u043e\u0457 (1622) \u000d\u000a(\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 \u0447\u0435\u0442\u0432\u0435\u0440 1-\u0433\u043e \u0442\u0438\u0436\u043d\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456).\u000d\u000a\u0420\u0438\u043c., 81 \u0437\u0430\u0447., I, 28 \u2013 II, 9. \u041c\u0444., 13 \u0437\u0430\u0447., V, 27\u201332.\u000d\u000a\u0421\u0449\u043c\u0447. \u0414\u043e\u0440\u043e\u0444\u0435\u044f, \u0454\u043f. \u0422\u0438\u0440\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 362). \u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u000d\u000a\u0431\u043b\u0433\u0432. \u0406\u0433\u043e\u0440\u044f, \u043a\u043d. \u0427\u0435\u0440\u043d\u0456\u0433\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1150). \u0421\u0432\u0442. \u041a\u043e\u0441\u0442\u044f\u043d\u0442\u0438\u043d\u0430, \u043c\u0438\u0442\u0440. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0432\u0441\u0456\u0454\u0457 \u0420\u0443\u0441\u0438 (1159). \u041c\u0447\u0447. \u041c\u0430\u0440\u043a\u0456\u0430\u043d\u0430, \u000d\u000a\u041d\u0438\u043a\u0430\u043d\u0434\u0440\u0430, \u0406\u043f\u0435\u0440\u0435\u0445\u0456\u044f, \u0410\u043f\u043e\u043b\u043e\u043d\u0430, \u041b\u0435\u043e\u043d\u0456\u0434\u0430, \u0410\u0440\u0456\u044f, \u0413\u043e\u0440\u0433\u0456\u044f, \u0421\u0435\u043b\u0456\u043d\u0456\u044f, \u0406\u0440\u0438\u043d\u0456\u044f \u0456 \u000d\u000a\u041f\u0430\u043c\u0432\u043e\u043d\u0430 (305 \u2013 311). \u041f\u0440\u043f. \u0424\u0435\u0434\u043e\u0440\u0430, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (\u0431\u043b. V\u0406). \u041f\u0440\u043f. \u0410\u043d\u0443\u0432\u0456\u044f, \u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a2\u000d\u000a3\u000d\u000a4\u000d\u000a5","43\u000d\u000a\u043f\u0443\u0441\u0442\u0435\u043b\u044c\u043d\u0438\u043a\u0430 \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V \u2013 V). \u041f\u0440\u043f. \u0414\u043e\u0440\u043e\u0444\u0435\u044f, \u0437 \u043e\u0431\u0438\u0442\u0435\u043b\u0456 \u0430\u0432\u0432\u0438 \u0421\u0435\u0440\u0438\u0434\u0430 (620).\u000d\u000a\u0406\u0433\u043e\u0440\u0456\u0432\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (1147).\u000d\u000a\u0420\u0438\u043c., 82 \u0437\u0430\u0447., II, 14 \u2013 29. \u041c\u0444., 14 \u0437\u0430\u0447., V, 33 \u2013 41.\u000d\u000a\u0412\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0430 \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u041f\u0440\u043f. \u0412\u0456\u0441\u0441\u0430\u0440\u0456\u043e\u043d\u0430, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u041f\u0440\u043f. \u0406\u043b\u0430\u0440\u0456\u043e\u043d\u0430 \u041d\u043e\u0432\u043e\u0433\u043e (845). \u041f\u0440\u043c\u0446\u0446. \u0434\u0456\u0432 \u0410\u0440\u0445\u0435\u043b\u0430\u0457, \u0424\u0435\u043a\u043b\u0438 \u000d\u000a\u0456 \u0421\u0443\u0441\u0430\u043d\u043d\u0438 (293).\u000d\u000a\u0420\u0438\u043c., 79 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), I, 7 \u2013 12. \u041c\u0444., 15 \u0437\u0430\u0447., V, 42 \u2013 48.\u000d\u000a\u0423\u0441\u044f \u0441\u043b\u0443\u0436\u0431\u0430 \u0437\u0430 \u0422\u0440\u0456\u043e\u0434\u0434\u044e. \u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0427\u0435\u0441\u043d\u0456\u0448\u0443...\u00bb \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0456\u0440\u043c\u043e\u0441 \u00ab\u0420\u0430\u0434\u0443\u0439\u0441\u044f, \u0426\u0430\u0440\u0438\u0446\u0435...\u00bb. \u0421\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0432\u0435\u043b\u0438\u043a\u0435 \u0441\u043b\u0430\u0432\u043e\u0441\u043b\u0456\u0432\u2019\u044f.\u000d\u000a2-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0412\u043c\u0447. \u0424\u0435\u0434\u043e\u0440\u0430 \u0421\u0442\u0440\u0430\u0442\u0438\u043b\u0430\u0442\u0430 (319). \u000d\u000a\u041f\u0440\u043f. \u0404\u0444\u0440\u0435\u043c\u0430, \u043f\u0430\u0442\u0440. \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (545). \u041f\u0440\u043f. \u0417\u043e\u0441\u0438\u043c\u0438 \u0424\u0456\u043d\u0456\u043a\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(V\u0406). \u0421\u0432\u0442. \u0424\u0435\u0434\u043e\u0440\u0430, \u0454\u043f. \u0421\u0443\u0437\u0434\u0430\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (1023).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u0414\u0430\u043b\u0435\u0448\u0456\u0432\u0441\u044c\u043a\u0430\u00bb.\u000d\u000a\u0420\u0438\u043c., 83 \u0437\u0430\u0447., II, 28 \u2013 III, 18. \u041c\u0444., 19 \u0437\u0430\u0447., VI, 31 \u2013 34; VII, 9\u201311.\u000d\u000a\u0412\u043c\u0447.: 2 \u0422\u0438\u043c., 292 \u0437\u0430\u0447., II, 1 \u2013 10. \u041c\u0444., 36 \u0437\u0430\u0447., \u0425, 16 \u2013 22.\u000d\u000a\u041f\u043e\u0447\u0430\u0442\u043e\u043a \u041f\u0435\u0442\u0440\u043e\u0432\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443.\u000d\u000a\u0421\u0432\u0442. \u041a\u0438\u0440\u0438\u043b\u0430, \u0430\u0440\u0445\u0456\u0454\u043f. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (444). \u041c\u0446\u0446. \u0424\u0435\u043a\u043b\u0438, \u000d\u000a\u041c\u0430\u0440\u0444\u0438 \u0456 \u041c\u0430\u0440\u0456\u0457 \u0432 \u041f\u0435\u0440\u0441\u0456\u0457 (346).\u000d\u000a\u0420\u0438\u043c., 86 \u0437\u0430\u0447., IV, 4\u201312. \u041c\u0444., 22 \u0437\u0430\u0447., VII, 15\u201321.\u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 334 \u0437\u0430\u0447., XIII, 7 \u2013 16. \u041c\u0444., 11 \u0437\u0430\u0447., V, 14 \u2013 19.\u000d\u000a\u0421\u0449\u043c\u0447. \u0422\u0438\u043c\u043e\u0444\u0456\u044f, \u0454\u043f. \u041f\u0440\u0443\u0441\u044c\u043a\u043e\u0433\u043e (361 \u2013 363). \u0421\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 (\u041c\u0430\u043a\u0441\u0438\u043c\u043e\u0432\u0438\u0447\u0430), \u043c\u0438\u0442\u0440. \u0422\u043e\u0431\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (1715). \u041f\u0440\u043f. \u0421\u0438\u043b\u0443\u0430\u043d\u0430, \u0441\u0445\u0438\u043c\u043d\u0438\u043a\u0430 \u000d\u000a\u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406 \u2013 \u0425\u0406V). \u041c\u0447\u0447. \u041e\u043b\u0435\u043a6\u000d\u000a8\u000d\u000a9\u000d\u000a10\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a1-\u0448\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0412\u0441\u0456\u0445 \u0441\u0432\u044f\u0442\u0438\u0445. \u0413\u043b\u0430\u0441 8-\u0439.\u000d\u000a\u041c\u0447. \u0424\u0435\u043e\u0434\u043e\u0442\u0430 \u0410\u043d\u043a\u0438\u0440\u0441\u044c\u043a\u043e\u0433\u043e (303). \u0421\u0449\u043c\u0447. \u041c\u0430\u0440\u043a\u0435\u043b\u0456\u0430\u043d\u0430, \u0454\u043f. \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u043c\u0447\u0447. \u041a\u043b\u0430\u0432\u0434\u0456\u044f, \u041a\u0438\u0440\u0438\u043d\u0430 \u0456 \u0410\u043d\u0442\u043e\u043d\u0456\u043d\u0430 (304). \u0421\u0449\u043c\u0447\u0447. \u041c\u0430\u0440\u043a\u0435\u043b\u0430, \u0454\u043f. \u000d\u000a\u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e, \u0421\u0438\u0441\u0438\u043d\u0456\u044f \u0456 \u041a\u0438\u0440\u0456\u0430\u043a\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0456\u0432, \u043c\u0447\u0447. \u0421\u043c\u0430\u0440\u0430\u0433\u0434\u0430, \u041b\u0430\u0440\u0433\u0456\u044f, \u000d\u000a\u0410\u043f\u0440\u043e\u043d\u0456\u0430\u043d\u0430, \u0421\u0430\u0442\u0443\u0440\u043d\u0456\u043d\u0430, \u041f\u0430\u043f\u0456\u044f \u0456 \u041c\u0430\u0432\u0440\u0430, \u0432\u043e\u0457\u043d\u0456\u0432, \u0456 \u041a\u0440\u0438\u0441\u043a\u0435\u043d\u0442\u0456\u0430\u043d\u0430, \u043c\u0446\u0446. \u000d\u000a\u041f\u0440\u0438\u0441\u043a\u0456\u043b\u0438, \u041b\u0443\u043a\u0438\u043d\u0438 \u0456 \u0410\u0440\u0442\u0435\u043c\u0456\u0457, \u0446\u0430\u0440\u0456\u0432\u043d\u0438 (304 \u2013 310). \u041c\u0446\u0446. \u041a\u0430\u043b\u0435\u0440\u0456\u0457 (\u0412\u0430\u043b\u0435\u0440\u0456\u0457), \u041a\u0438\u0440\u0456\u0430\u043a\u0456\u0457 \u0456 \u041c\u0430\u0440\u0456\u0457 \u0432 \u041a\u0435\u0441\u0430\u0440\u0456\u0457 \u041f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0441\u044c\u043a\u0456\u0439 (\u0406V).\u000d\u000a\u0406\u043a\u043e\u043d \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u0422\u0435\u0440\u043d\u043e\u043f\u0456\u043b\u044c\u0441\u044c\u043a\u043e\u0457 \u0442\u0430 \u00ab\u041f\u043e\u043c\u2019\u044f\u043a\u0448\u0435\u043d\u043d\u044f \u0437\u043b\u0438\u0445 \u0441\u0435\u0440\u0434\u0435\u0446\u044c\u00bb (\u0421\u0435\u043c\u0438\u0441\u0442\u0440\u0456\u043b\u044c\u043d\u0430) (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0456 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 \u043d\u0435\u0434\u0456\u043b\u044e \u0432\u0441\u0456\u0445 \u0441\u0432\u044f\u0442\u0438\u0445).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 1-\u0435, \u041c\u0444., 116 \u0437\u0430\u0447., XXVIII, 16 \u2013 20.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0404\u0432\u0440., 330 \u0437\u0430\u0447., XI, 33 \u2013 XII, 2. \u041c\u0444., 38 \u0437\u0430\u0447., X, 32 \u2013 33, 37 \u2013 38; \u000d\u000aXIX, 27 \u2013 30.\u000d\u000a\u0417\u0430\u0433\u043e\u0432\u0438\u043d\u0438 \u043d\u0430 \u041f\u0435\u0442\u0440\u0456\u0432 \u043f\u0456\u0441\u0442.\u000d\u000a\u0412\u0441\u044f \u0441\u043b\u0443\u0436\u0431\u0430 \u0437 \u0422\u0440\u0456\u043e\u0434\u0456. \u0417 \u0446\u044c\u043e\u0433\u043e \u0434\u043d\u044f \u0456 \u0434\u043e 1-\u0433\u043e \u0441\u0435\u0440\u043f\u043d\u044f \u043d\u0430 \u0441\u0432\u044f\u0442\u043a\u043e\u0432\u0438\u0445 \u0440\u0430\u043d\u043d\u0456\u0445 \u000d\u000a(\u043a\u043e\u043b\u0438 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0432\u0435\u043b\u0438\u043a\u0435 \u0441\u043b\u0430\u0432\u043e\u0441\u043b\u0456\u0432\u2019\u044f) \u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f \u00ab\u0412\u0456\u0434\u043a\u0440\u0438\u044e \u0443\u0441\u0442\u0430 \u043c\u043e\u0457...\u00bb.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a7","44\u000d\u000a\u0441\u0430\u043d\u0434\u0440\u0430, \u0410\u043d\u0442\u043e\u043d\u0456\u043d\u0438, \u0434\u0456\u0432\u0438 (\u0431\u043b. 313). \u041f\u0440\u043f. \u0424\u0435\u043e\u0444\u0430\u043d\u0430 \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (369). \u000d\u000a\u0421\u0432\u0442. \u0412\u0430\u0441\u0441\u0456\u0430\u043d\u0430, \u0454\u043f. \u041b\u0430\u0432\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (409).\u000d\u000a\u0420\u0438\u043c., 87 \u0437\u0430\u0447., IV, 13 \u2013 25. \u041c\u0444., 23 \u0437\u0430\u0447., VII, 21 \u2013 23.\u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 335 \u0437\u0430\u0447., XIII, 17 \u2013 21. \u0406\u043d., 36 \u0437\u0430\u0447., X, 9 \u2013 16.\u000d\u000a\u0410\u043f\u043f. \u0412\u0430\u0440\u0444\u043e\u043b\u043e\u043c\u0456\u044f \u0456 \u0412\u0430\u0440\u043d\u0430\u0432\u0438 (\u0406). \u0421\u0432\u0442. \u041b\u0443\u043a\u0438, \u0430\u0440\u0445\u0456\u0454\u043f. \u0421\u0456\u043c\u0444\u0435\u0440\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e, \u0441\u043f\u043e\u0432. (1961).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u0414\u043e\u0441\u0442\u043e\u0439\u043d\u043e \u0454\u00bb (\u00ab\u041c\u0438\u043b\u0443\u044e\u0447\u0430\u00bb) (\u0425).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 67 \u0437\u0430\u0447., XXI, 15 \u2013 25.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0420\u0438\u043c., 89 \u0437\u0430\u0447., V, 10 \u2013 16. \u041c\u0444., 27 \u0437\u0430\u0447., VIII, 23 \u2013 27.\u000d\u000a\u0410\u043f\u043f.: \u0414\u0456\u044f\u043d., 28 \u0437\u0430\u0447., XI, 19 \u2013 26, 29 \u2013 30. \u041b\u043a., 51 \u0437\u0430\u0447., X, 16 \u2013 21.\u000d\u000a\u041f\u0440\u043f. \u041e\u043d\u0443\u0444\u0440\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e (\u0406V). \u041f\u0440\u043f. \u041f\u0435\u0442\u0440\u0430 \u0410\u0444\u043e\u043d\u0441\u044c\u043a\u043e\u0433\u043e (734). \u041f\u0440\u043f\u043f. \u0406\u043e\u0430\u043d\u0430, \u000d\u000a\u0410\u043d\u0434\u0440\u0456\u044f, \u0406\u0440\u0430\u043a\u043b\u0435\u043c\u043e\u043d\u0430 \u0456 \u0424\u0435\u043e\u0444\u0456\u043b\u0430 (\u0406V).\u000d\u000a\u0420\u0438\u043c., 90 \u0437\u0430\u0447., V, 17 \u2013 VI, 2. \u041c\u0444., 31 \u0437\u0430\u0447., IX, 14 \u2013 17.\u000d\u000a\u041f\u0440\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30.\u000d\u000a\u041c\u0446. \u0410\u043a\u0438\u043b\u0438\u043d\u0438 (293). \u0421\u0432\u0442. \u0422\u0440\u0438\u0444\u0438\u043b\u0456\u044f, \u0454\u043f. \u041b\u0435\u0432\u043a\u0443\u0441\u0456\u0457 \u041a\u0456\u043f\u0440\u0441\u044c\u043a\u043e\u0457 (\u0431\u043b. 370). \u000d\u000a\u041c\u0446. \u0410\u043d\u0442\u043e\u043d\u0456\u043d\u0438 \u041d\u0456\u043a\u0435\u0439\u0441\u044c\u043a\u043e\u0457 (284 \u2013 305). \u041f\u0440\u043f. \u0410\u043d\u043d\u0438 (826) \u0456 \u0441\u0438\u043d\u0430 \u0457\u0457 \u0406\u043e\u0430\u043d\u0430. \u000d\u000a\u0420\u0438\u043c., 84 \u0437\u0430\u0447., III, 19 \u2013 26. \u041c\u0444., 20 \u0437\u0430\u0447., VII, 1 \u2013 8.\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a11\u000d\u000a12\u000d\u000a13\u000d\u000a2-\u0433\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0412\u0441\u0456\u0445 \u0441\u0432\u044f\u0442\u0438\u0445 \u0437\u0435\u043c\u043b\u0456 \u0423\u043a\u0440\u0430\u0457\u043d\u0441\u044c\u043a\u043e\u0457. \u0413\u043b\u0430\u0441 1-\u0439.\u000d\u000a\u041d\u043e\u0432\u043e\u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0456\u0432 \u0442\u0430 \u0441\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u043a\u0456\u0432, \u044f\u043a\u0456 \u0432 \u0423\u043a\u0440\u0430\u0457\u043d\u0456 \u0442\u0430 \u0432 \u0456\u043d\u0448\u0438\u0445 \u0437\u0435\u043c\u043b\u044f\u0445 \u0443 \u0425\u0425 \u0441\u0442. \u0437\u0430 \u0425\u0440\u0438\u0441\u0442\u0430 \u0456 \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u0443 \u0432\u0456\u0440\u0443 \u043f\u043e\u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043b\u0438 (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 2-\u0433\u0443 \u043d\u0435\u0434\u0456\u043b\u044e \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456). \u041f\u0440\u043e\u0440 \u0404\u043b\u0438\u0441\u0435\u044f \u000d\u000a(\u0406X \u0441\u0442. \u0434\u043e \u0420. \u0425.). \u0421\u0432\u0442. \u041c\u0435\u0444\u043e\u0434\u0456\u044f, \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (847). \u000d\u000a\u0411\u043b\u0433\u0432. \u043a\u043d. \u041c\u0441\u0442\u0438\u0441\u043b\u0430\u0432\u0430, \u0443 \u0441\u0432. \u0445\u0440\u0435\u0449\u0435\u043d\u043d\u0456 \u0413\u0435\u043e\u0440\u0433\u0456\u044f, \u0425\u043e\u0440\u043e\u0431\u0440\u043e\u0433\u043e (1180). \u041f\u0440\u043f. \u000d\u000a\u0404\u043b\u0438\u0441\u0435\u044f \u0421\u0443\u043c\u0441\u044c\u043a\u043e\u0433\u043e (\u0425V \u2013 \u0425V\u0406). \u0412\u0441\u0456\u0445 \u043f\u0440\u0435\u043f\u043e\u0434\u043e\u0431\u043d\u0438\u0445 \u0456 \u0431\u043e\u0433\u043e\u043d\u043e\u0441\u043d\u0438\u0445 \u043e\u0442\u0446\u0456\u0432, \u000d\u000a\u044f\u043a\u0456 \u043d\u0430 \u0421\u0432\u044f\u0442\u0456\u0439 \u0413\u043e\u0440\u0456 \u0410\u0444\u043e\u043d\u0441\u044c\u043a\u0456\u0439 \u043f\u0440\u043e\u0441\u044f\u044f\u043b\u0438 (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 2-\u0433\u0443 \u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044e \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 2-\u0435, \u041c\u043a., 70 \u0437\u0430\u0447., XVI, 1 \u2013 8.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0420\u0438\u043c., 81 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), II, 10 \u2013 16. \u041c\u0444., 9 \u0437\u0430\u0447., IV, 18 \u2013 23.\u000d\u000a\u0421\u0432\u0432.: \u0404\u0432\u0440., 330 \u0437\u0430\u0447., XI, 33 \u2013 XII, 2. \u041c\u0444., 10 \u0437\u0430\u0447., IV, 25 \u2013 V, 12.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f \u00ab\u0423\u0431\u043b\u0430\u0436\u0430\u0454\u043c\u043e \u0432\u0430\u0441, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u0456 \u043d\u0430\u0448\u0456 \u0441\u043b\u0430\u0432\u043d\u0456, \u0449\u043e \u000d\u000a\u0437\u0435\u043c\u043b\u044e \u0443\u043a\u0440\u0430\u0457\u043d\u0441\u044c\u043a\u0443 \u0447\u0435\u0441\u043d\u043e\u0442\u0430\u043c\u0438 \u0432\u0430\u0448\u0438\u043c\u0438 \u043e\u0441\u044f\u044f\u043b\u0438 \u0456 \u043e\u0431\u0440\u0430\u0437 \u0441\u043f\u0430\u0441\u0456\u043d\u043d\u044f \u043d\u0430\u043c \u000d\u000a\u044f\u0441\u043d\u043e \u043f\u043e\u043a\u0430\u0437\u0430\u043b\u0438\u00bb.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a14\u000d\u000a3-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u041f\u0440\u043e\u0440. \u0410\u043c\u043e\u0441\u0430 (V\u0406\u0406\u0406 \u0441\u0442. \u0434\u043e \u0420. \u0425.). \u000d\u000a\u0410\u043f\u043f. \u0432\u0456\u0434 70-\u0445 \u0410\u0445\u0430\u0457\u043a\u0430 \u0442\u0430 \u0424\u043e\u0440\u0442\u0443\u043d\u0430\u0442\u0430 (\u0406). \u0421\u0432\u0442. \u041c\u0438\u0445\u0430\u0457\u043b\u0430, \u043f\u0435\u0440\u0448\u043e\u0433\u043e \u043c\u0438\u0442\u0440. \u000d\u000a\u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0432\u0441\u0456\u0454\u0457 \u0420\u0443\u0441\u0438 (992). \u041c\u0447\u0447. \u0412\u0456\u0442\u0430, \u041c\u043e\u0434\u0435\u0441\u0442\u0430 \u0456 \u041a\u0440\u0438\u0441\u043a\u0435\u043d\u0442\u0456\u0457, \u0433\u043e\u0434\u0443\u0432\u0430\u043b\u044c\u043d\u0438\u0446\u0456 (\u0431\u043b. 303). \u041c\u0447. \u0414\u0443\u043b\u0438 \u041a\u0438\u043b\u0456\u043a\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (305 \u2013 313). \u041f\u0440\u043f. \u0414\u0443\u043b\u0438, \u000d\u000a\u0441\u0442\u0440\u0430\u0441\u0442\u043e\u0442\u0435\u0440\u043f\u0446\u044f, \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0433\u043e. \u041f\u0440\u043f. \u0406\u0454\u0440\u043e\u043d\u0456\u043c\u0430 \u0411\u043b\u0430\u0436\u0435\u043d\u043d\u043e\u0433\u043e \u0421\u0442\u0440\u0438\u0434\u043e\u043d\u0441\u044c\u043a\u043e\u0433\u043e (420). \u0421\u0432\u0442. \u0410\u0432\u0433\u0443\u0441\u0442\u0438\u043d\u0430 \u0411\u043b\u0430\u0436\u0435\u043d\u043d\u043e\u0433\u043e, \u0454\u043f. \u0406\u043f\u043e\u043d\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (430). \u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a15","45\u000d\u000a\u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u043f\u0440\u043f. \u0424\u0435\u0434\u043e\u0440\u0430 \u0421\u0438\u043a\u0435\u043e\u0442\u0430, \u0454\u043f. \u0410\u043d\u0430\u0441\u0442\u0430\u0441\u0456\u0443\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. \u0406\u0425). \u0411\u043b\u0433\u0432. \u043a\u043d. \u041b\u0430\u0437\u0430\u0440\u044f \u0421\u0435\u0440\u0431\u0441\u044c\u043a\u043e\u0433\u043e (1389). \u0421\u0432\u0442. \u0404\u0444\u0440\u0435\u043c\u0430 \u0406\u0406, \u000d\u000a\u043f\u0430\u0442\u0440. \u0421\u0435\u0440\u0431\u0441\u044c\u043a\u043e\u0433\u043e (\u0425\u0406V). \u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 35 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), X, 1 \u2013 9.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0420\u0438\u043c., 94 \u0437\u0430\u0447., VII, 1 \u2013 13. \u041c\u0444., 34 \u0437\u0430\u0447., IX, 36 \u2013 X, 8.\u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 318 \u0437\u0430\u0447., VII, 26 \u2013 VIII, 2. \u0406\u043d., 36 \u0437\u0430\u0447., X, 9 \u2013 16.\u000d\u000a\u0421\u0432\u0442. \u0422\u0438\u0445\u043e\u043d\u0430, \u0454\u043f. \u0410\u043c\u0430\u0444\u0443\u043d\u0442\u0441\u044c\u043a\u043e\u0433\u043e (425). \u0421\u0449\u043c\u0447. \u0422\u0438\u0433\u0440\u0456\u044f, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u0456 \u000d\u000a\u043c\u0447. \u0404\u0432\u0442\u0440\u043e\u043f\u0456\u044f, \u0447\u0438\u0442\u0446\u044f (\u0431\u043b. 404).\u000d\u000a\u0420\u0438\u043c., 95 \u0437\u0430\u0447., VII, 14 \u2013 VIII, 2. \u041c\u0444., 35 \u0437\u0430\u0447., X, 9 \u2013 15.\u000d\u000a\u041c\u0447\u0447. \u041c\u0430\u043d\u0443\u0457\u043b\u0430, \u0421\u0430\u0432\u0435\u043b\u0430 \u0442\u0430 \u0406\u0441\u043c\u0430\u0457\u043b\u0430 (362). \u041f\u0440\u0430\u0432. \u0421\u043e\u043b\u043e\u043c\u043e\u043d\u0430, \u0446\u0430\u0440\u044f (928\u2013\u000d\u000a933 \u0440. \u0434\u043e \u0420. \u0425\u0440.)\u000d\u000a\u0420\u0438\u043c., 96 \u0437\u0430\u0447., VIII, 2 \u2013 13. \u041c\u0444., 36 \u0437\u0430\u0447., X, 16 \u2013 22.\u000d\u000a\u041c\u0447\u0447.: \u0415\u0444., 233 \u0437\u0430\u0447., VI, 10 \u2013 17. \u041b\u043a., 106 \u0437\u0430\u0447., XXI, 12 \u2013 19.\u000d\u000a\u041c\u0447\u0447. \u041b\u0435\u043e\u043d\u0442\u0456\u044f, \u0406\u043f\u0430\u0442\u0456\u044f \u0442\u0430 \u0424\u0435\u043e\u0434\u0443\u043b\u0430 (70 \u2013 79). \u041f\u0440\u043f. \u041b\u0435\u043e\u043d\u0442\u0456\u044f, \u043a\u0430\u043d\u043e\u043d\u0430\u0440\u0445\u0430 \u000d\u000a\u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406V).\u000d\u000a\u0420\u0438\u043c., 98 \u0437\u0430\u0447., VIII, 22 \u2013 27. \u041c\u0444., 37 \u0437\u0430\u0447., X, 23 \u2013 31.\u000d\u000a4-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0421\u0449\u043c\u0447. \u0404\u0432\u0441\u0435\u0432\u0456\u044f, \u0454\u043f. \u0421\u0430\u043c\u043e\u0441\u0430\u0442\u0441\u044c\u043a\u043e\u0433\u043e (380). \u041c\u0447\u0447. \u0417\u0438\u043d\u043e\u043d\u0430 \u0442\u0430 \u0417\u0456\u043d\u0438 (304). \u041c\u0447\u0447. \u0413\u0430\u043b\u0430\u043a\u0442\u0456\u043e\u043d\u0430 \u0442\u0430 \u042e\u043b\u0456\u0430\u043d\u0456\u0457. \u000d\u000a\u0420\u0438\u043c., 102 \u0437\u0430\u0447., IX, 18 \u2013 33. \u041c\u0444., 40 \u0437\u0430\u0447., XI, 2 \u2013 15.\u000d\u000a\u0410\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u0406\u0443\u0434\u0438, \u0431\u0440\u0430\u0442\u0430 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e \u043f\u043e \u043f\u043b\u043e\u0442\u0456 (\u0431\u043b. 80). \u041c\u0447. \u0417\u043e\u0441\u0438\u043c\u0438 (\u0406\u0406). \u041f\u0440\u043f. \u041f\u0430\u0457\u0441\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e (V). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430 \u041f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u043f\u0443\u0441\u0442\u0435\u043b\u044c\u043d\u0438\u043a\u0430 (V\u0406). \u041f\u0440\u043f. \u041f\u0430\u0457\u0441\u0456\u044f \u0425\u0456\u043b\u0430\u043d\u0434\u0430\u0440\u0441\u044c\u043a\u043e\u0433\u043e (\u0425V\u0406\u0406\u0406, \u0411\u043e\u043b\u0433.). \u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 67 \u0437\u0430\u0447., XXI, 15 \u2013 25.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0420\u0438\u043c., 101 \u0437\u0430\u0447., IX, 6 \u2013 19. \u041c\u0444., 38 \u0437\u0430\u0447., X, 32 \u2013 36; XI, 1.\u000d\u000a\u0410\u043f.: \u0406\u0443\u0434., 77 \u0437\u0430\u0447., I, 1 \u2013 10. \u0406\u043d., 48 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), XIV, 21 \u2013 24.\u000d\u000a\u0421\u0449\u043c\u0447. \u041c\u0435\u0444\u043e\u0434\u0456\u044f, \u0454\u043f. \u041f\u0430\u0442\u0430\u0440\u0441\u044c\u043a\u043e\u0433\u043e (312). \u041c\u0447\u0447. \u0406\u043d\u043d\u0438, \u041f\u0456\u043d\u043d\u0438 \u0442\u0430 \u0420\u0438\u043c\u043c\u0438 \u000d\u000a(\u0406 \u2013 \u0406\u0406). \u0421\u0449\u043c\u0447\u0447. \u0410\u0440\u0438\u0441\u0442\u043e\u043a\u043b\u0456\u044f, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u0414\u0438\u043c\u0438\u0442\u0440\u0456\u0430\u043d\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0430, \u0456 \u043c\u0447. \u000d\u000a\u0410\u0444\u0430\u043d\u0430\u0441\u0456\u044f, \u0447\u0438\u0442\u0446\u044f (\u0431\u043b. 306). \u0421\u0432\u0442. \u041b\u0435\u0432\u043a\u0456\u044f, \u0441\u043f\u043e\u0432., \u0454\u043f. \u0412\u0440\u0443\u043d\u0442\u0438\u0441\u0456\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (V). \u0421\u0432\u0442. \u041c\u0438\u043d\u0438 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0454\u043f. \u041f\u043e\u043b\u043e\u0446\u044c\u043a\u043e\u0433\u043e (1116). \u000d\u000a\u041f\u0440\u0430\u0432. \u041c\u0438\u043a\u043e\u043b\u0430\u044f \u041a\u0430\u0432\u0430\u0441\u0438\u043b\u0438 (1397/98).\u000d\u000a\u0420\u0438\u043c., 85 \u0437\u0430\u0447., III, 28 \u2013 IV, 3. \u041c\u0444., 24 \u0437\u0430\u0447., VII, 24 \u2013 VIII, 4.\u000d\u000a16\u000d\u000a17\u000d\u000a18\u000d\u000a22\u000d\u000a19\u000d\u000a20\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a3-\u0442\u044f \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 2-\u0439.\u000d\u000a\u041c\u0447. \u042e\u043b\u0456\u0430\u043d\u0430 \u0422\u0430\u0440\u0441\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 305). \u0421\u0449\u043c\u0447. \u0422\u0435\u0440\u0435\u043d\u0442\u0456\u044f, \u0454\u043f. \u0406\u043a\u043e\u043d\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(\u0406). \u041f\u0440\u043f\u043f. \u042e\u043b\u0456\u044f, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u0456 \u042e\u043b\u0456\u0430\u043d\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0430 (V). \u041c\u0447\u0447. \u0410\u0440\u0447\u0438\u043b\u0430 \u0406\u0406, \u0446\u0430\u0440\u044f \u000d\u000a\u0406\u0432\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e (744), \u0456 \u041b\u0443\u0430\u0440\u0441\u0430\u0431\u0430 \u0406\u0406, \u0446\u0430\u0440\u044f \u041a\u0430\u0440\u0442\u0430\u043b\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e (1622, \u0413\u0440\u0443\u0437.).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 3-\u0454, \u041c\u043a., 71 \u0437\u0430\u0447., XVI, 9 \u2013 20.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0420\u0438\u043c., 88 \u0437\u0430\u0447., V, 1 \u2013 10. \u041c\u0444., 18 \u0437\u0430\u0447., VI, 22 \u2013 33.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a21","46\u000d\u000a\u041c\u0446. \u0410\u0433\u0440\u0438\u043f\u0438\u043d\u0438 \u0420\u0438\u043c\u043b\u044f\u043d\u043a\u0438 (\u0406\u0406\u0406). \u0421\u0449\u043c\u0447. \u0404\u0432\u0441\u0442\u043e\u0445\u0456\u044f, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u043c\u0447\u0447. \u0413\u0430\u044f, \u000d\u000a\u041f\u0440\u043e\u0432\u0456\u044f, \u041b\u043e\u043b\u0456\u044f, \u0423\u0440\u0432\u0430\u043d\u0430 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 (\u0406V).\u000d\u000a\u0420\u0438\u043c., 104 \u0437\u0430\u0447., X, 11 \u2013 XI, 2. \u041c\u0444., 41 \u0437\u0430\u0447., XI, 16 \u2013 20 (\u0437\u0430 \u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a). \u000d\u000a\u0420\u0438\u043c., 105 \u0437\u0430\u0447., XI, 2 \u2013 12. \u041c\u0444., 42 \u0437\u0430\u0447., XI, 20 \u2013 26 (\u0437\u0430 \u0441\u0435\u0440\u0435\u0434\u0443).\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a23\u000d\u000a\u0420\u0456\u0437\u0434\u0432\u043e \u0447\u0435\u0441\u043d\u043e\u0433\u043e \u0441\u043b\u0430\u0432\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0440\u043e\u043a\u0430, \u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456 \u0442\u0430 \u0425\u0440\u0435\u0441\u0442\u0438\u0442\u0435\u043b\u044f \u000d\u000a\u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e \u0406\u043e\u0430\u043d\u0430. \u041c\u0447\u0447. \u0441\u0456\u043c\u043e\u0445 \u0431\u0440\u0430\u0442\u0456\u0432: \u041e\u0440\u0435\u043d\u0442\u0456\u044f, \u0424\u0430\u0440\u043d\u0430\u043a\u0456\u044f, \u0404\u0440\u043e\u0441\u0430, \u000d\u000a\u0424\u0456\u0440\u043c\u043e\u0441\u0430, \u0424\u0456\u0440\u043c\u0438\u043d\u0430, \u041a\u0438\u0440\u0456\u0430\u043a\u0430 \u0456 \u041b\u043e\u043d\u0433\u0438\u043d\u0430 (\u0406V).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 3 \u0437\u0430\u0447., I, 24 \u2013 25, 57 \u2013 68, 76, 80.\u000d\u000a\u041b\u0456\u0442. \u2013 \u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456: \u0420\u0438\u043c., 112 \u0437\u0430\u0447., XIII, 11 \u2013 XIV, 4. \u041b\u043a., 2 \u0437\u0430\u0447., I, 5 \u2013 25, \u000d\u000a57 \u2013 68, 76, 80.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f \u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0442\u0435\u0431\u0435, \u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0435 \u0421\u043f\u0430\u0441\u0456\u0432 \u000d\u000a\u0406\u043e\u0430\u043d\u0435, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u0432\u0456\u0434 \u043d\u0435\u043f\u043b\u0456\u0434\u043d\u043e\u0457 \u043f\u0440\u0435\u0441\u043b\u0430\u0432\u043d\u0435 \u043d\u0430\u0440\u043e\u0434\u0436\u0435\u043d\u043d\u044f \u0442\u0432\u043e\u0454\u00bb.\u000d\u000a4-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 3-\u0439.\u000d\u000a\u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u043c\u0447\u0447., \u0431\u0435\u0437\u0441\u0440\u0440. \u0442\u0430 \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u0456\u0432 \u041a\u0438\u0440\u0430 \u0442\u0430 \u0406\u043e\u0430\u043d\u0430 (412). \u000d\u000a\u041f\u0440\u043f. \u041a\u0441\u0435\u043d\u043e\u0444\u043e\u043d\u0442\u0430 \u0420\u043e\u0431\u0435\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0456\u0433\u0443\u043c\u0435\u043d\u0430 (1262). \u041f\u0440\u043f. \u041f\u0430\u0432\u043b\u0430, \u043b\u0456\u043a\u0430\u0440\u044f (VII).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 4-\u0435, \u041b\u043a., 112 \u0437\u0430\u0447., XXIV, 1 \u2013 12.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0420\u0438\u043c., 93 \u0437\u0430\u0447., VI, 18 \u2013 23. \u041c\u0444., 25 \u0437\u0430\u0447., VIII, 5 \u2013 13.\u000d\u000a\u0411\u0435\u0437\u0441\u0440\u0456\u0431\u043d.: 1 \u041a\u043e\u0440., 153 \u0437\u0430\u0447., XII, 27 \u2013 XIII, 8. \u041c\u0444., 34 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), \u000d\u000aX, 1, 5 \u2013 8.\u000d\u000a5-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0421\u043b\u0430\u0432\u043d\u0438\u0445 \u0456 \u0432\u0441\u0435\u0445\u0432\u0430\u043b\u044c\u043d\u0438\u0445 \u000d\u000a\u043f\u0435\u0440\u0448\u043e\u0432\u0435\u0440\u0445\u043e\u0432\u043d\u0438\u0445 \u0430\u043f\u043e\u0441\u0442\u043e\u043b\u0456\u0432 \u041f\u0435\u0442\u0440\u0430 \u0456 \u041f\u0430\u0432\u043b\u0430 (\u0431\u043b. 67). \u0421\u0432\u0442. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f, \u043c\u0438\u0442\u0440. \u0406\u0440\u0430\u043a\u043b\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (1925). \u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a24\u000d\u000a28\u000d\u000a29\u000d\u000a\u041f\u0440\u043c\u0446. \u0424\u0435\u0432\u0440\u043e\u043d\u0456\u0457, \u0434\u0456\u0432\u0438 (\u0431\u043b. 304).\u000d\u000a\u041c\u0430\u043d\u044f\u0432\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u0412\u0438\u0437\u0432\u043e\u043b\u0438\u0442\u0435\u043b\u044c\u043a\u0430\u00bb (1788).\u000d\u000a\u0420\u0438\u043c., 106 \u0437\u0430\u0447., XI, 13 \u2013 24. \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30.\u000d\u000a\u041f\u0440\u043c\u0446.: 2 \u041a\u043e\u0440., 181 \u0437\u0430\u0447., VI, 1 \u2013 10. \u041b\u043a., 33 \u0437\u0430\u0447., VII, 36 \u2013 50.\u000d\u000a\u041f\u0440\u043f. \u0414\u0430\u0432\u0438\u0434\u0430 \u0421\u043e\u043b\u0443\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 540). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430, \u0454\u043f. \u0413\u043e\u0442\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(V\u0406\u0406\u0406). \u0421\u0432\u0442. \u0414\u0456\u043e\u043d\u0456\u0441\u0456\u044f \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0430\u0440\u0445\u0456\u0454\u043f. \u0421\u0443\u0437\u0434\u0430\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(1385).\u000d\u000a\u041b\u0456\u0434\u0434\u0441\u044c\u043a\u043e\u0457 (\u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0457) (\u0406), \u0422\u0438\u0445\u0432\u0438\u043d\u0441\u044c\u043a\u043e\u0457 (1383) \u0442\u0430 \u041d\u044f\u043c\u0435\u0446\u044c\u043a\u043e\u0457 (1399) \u0456\u043a\u043e\u043d \u000d\u000a\u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456.\u000d\u000a\u0420\u0438\u043c., 107 \u0437\u0430\u0447., XI, 25 \u2013 36. \u041c\u0444., 44 \u0437\u0430\u0447., XII, 1 \u2013 8.\u000d\u000a\u041f\u0440\u043f. \u0421\u0430\u043c\u0441\u043e\u043d\u0430, \u0433\u043e\u0441\u0442\u0438\u043d\u043d\u043e\u0433\u043e (\u0431\u043b. 530). \u041f\u0440\u0430\u0432. \u0406\u043e\u0430\u043d\u0438, \u043c\u0438\u0440\u043e\u043d\u043e\u0441\u0438\u0446\u0456 (\u0406). \u000d\u000a\u041f\u0440\u043f. \u0421\u0435\u0432\u0456\u0440\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 (V\u0406). \u041f\u0440\u043f. \u0413\u0435\u043e\u0440\u0433\u0456\u044f \u0406\u0432\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e \u0421\u0432\u044f\u0442\u043e\u0433\u043e\u0440\u0446\u044f (1065, \u000d\u000a\u0413\u0440\u0443\u0437.). \u041f\u0440\u043f. \u041c\u0430\u0440\u0442\u0438\u043d\u0430 \u0422\u0443\u0440\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1150). \u0421\u0449\u043c\u0447. \u041a\u0438\u0440\u0438\u043b\u0430 (\u041b\u0443\u043a\u0430\u0440\u0456\u0441\u0430), \u000d\u000a\u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (1638).\u000d\u000a\u041f\u0440\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041b\u043a., 67 \u0437\u0430\u0447., XII, 32 \u2013 40.\u000d\u000a\u0420\u044f\u0434.: \u0420\u0438\u043c., 92 \u0437\u0430\u0447., VI, 11 \u2013 17. \u041c\u0444., 26 \u0437\u0430\u0447., VIII, 14 \u2013 23.\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a25\u000d\u000a26\u000d\u000a27","47\u000d\u000a\u041a\u0430\u0441\u043f\u0435\u0440\u0456\u0432\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (\u0425\u0406\u0425).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 67 \u0437\u0430\u0447., XXI, 15 \u2013 25.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0410\u043f\u043f.: 2 \u041a\u043e\u0440., 193 \u0437\u0430\u0447., XI, 21 \u2013 XII, 9. \u041c\u0444., 67 \u0437\u0430\u0447., XVI, 13 \u2013 19.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0432\u0430\u0441, \u0441\u0432\u044f\u0442\u0456 \u043f\u0435\u0440\u0448\u043e\u0432\u0435\u0440\u0445\u043e\u0432\u043d\u0456 \u0430\u043f\u043e\u0441\u0442\u043e\u043b\u0438 \u041f\u0435\u0442\u0440\u0435 i \u041f\u0430\u0432\u043b\u0435, \u0449\u043e \u0432\u0435\u0441\u044c \u0441\u0432\u0456\u0442 \u0443\u0447\u0435\u043d\u043d\u044f\u043c \u0441\u0432\u043e\u0457\u043c \u043f\u0440\u043e\u0441\u0432i\u0442\u0438\u043b\u0438 \u0456 \u0432\u0441\u0456 \u043a\u0440\u0430\u0457 \u000d\u000a\u0437\u0435\u043c\u043b\u0456 \u0434\u043e \u0425\u0440\u0438\u0441\u0442\u0430 \u043f\u0440\u0438\u0432\u0435\u043b\u0438\u00bb.\u000d\u000a\u0421\u043e\u0431\u043e\u0440 \u0441\u043b\u0430\u0432\u043d\u0438\u0445 \u0456 \u0432\u0441\u0435\u0445\u0432\u0430\u043b\u044c\u043d\u0438\u0445 12-\u043e\u0445 \u0430\u043f\u043e\u0441\u0442\u043e\u043b\u0456\u0432: \u041f\u0435\u0442\u0440\u0430, \u0410\u043d\u0434\u0440\u0456\u044f \u000d\u000a\u041f\u0435\u0440\u0448\u043e\u0437\u0432\u0430\u043d\u043d\u043e\u0433\u043e, \u042f\u043a\u043e\u0432\u0430 \u0417\u0435\u0432\u0435\u0434\u0435\u0454\u0432\u043e\u0433\u043e, \u0406\u043e\u0430\u043d\u0430 \u0411\u043e\u0433\u043e\u0441\u043b\u043e\u0432\u0430, \u0424\u0438\u043b\u0438\u043f\u0430, \u0412\u0430\u0440\u0444\u043e\u043b\u043e\u043c\u0456\u044f, \u0424\u043e\u043c\u0438, \u041c\u0430\u0442\u0444\u0435\u044f, \u042f\u043a\u043e\u0432\u0430 \u0410\u043b\u0444\u0435\u0454\u0432\u043e\u0433\u043e, \u0406\u0443\u0434\u0438 \u042f\u043a\u043e\u0432\u043e\u0433\u043e, \u0421\u0438\u043c\u043e\u043d\u0430 \u0417\u0438\u043b\u043e\u0442\u0430 \u0456 \u041c\u0430\u0442\u0444\u0456\u044f. \u000d\u000a\u0412\u043e\u043b\u0438\u043d\u0441\u044c\u043a\u043e\u0457 (\u0425\u0425 \u0441\u0442.), \u0411\u0430\u043b\u0438\u043a\u0456\u043d\u0441\u044c\u043a\u043e\u0457 (1711) \u0442\u0430 \u0413\u043e\u0440\u0431\u0430\u043d\u0456\u0432\u0441\u044c\u043a\u043e\u0457 (1786) \u000d\u000a\u0456\u043a\u043e\u043d \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456.\u000d\u000a\u0420\u0438\u043c., 109 \u0437\u0430\u0447., XII, 4 \u2013 5, 15 \u2013 21. \u041c\u0444., 45 \u0437\u0430\u0447., XII, 9 \u2013 13 (\u0437\u0430 \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a, \u000d\u000a\u043f\u0456\u0434 \u0437\u0430\u0447\u0430\u043b\u043e).\u000d\u000a\u0420\u0438\u043c., 114 \u0437\u0430\u0447., XIV, 9 \u2013 18. \u041c\u0444., 46 \u0437\u0430\u0447., XII, 14 \u2013 16, 22 \u2013 30 (\u0437\u0430 \u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a).\u000d\u000a\u0410\u043f\u043f.: 1 \u041a\u043e\u0440., 131 \u0437\u0430\u0447., IV, 9 \u2013 16. \u041c\u043a., 12 \u0437\u0430\u0447., III, 13 \u2013 19.\u000d\u000a30\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0411\u0435\u0437\u0441\u0440\u0440. \u041a\u043e\u0441\u043c\u0438 \u0442\u0430 \u0414\u0430\u043c\u0456\u0430\u043d\u0430, \u044f\u043a\u0456 \u0432 \u0420\u0438\u043c\u0456 \u043f\u043e\u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043b\u0438 (284). \u041c\u0447. \u041f\u043e\u0442\u0438\u0442\u0430 \u000d\u000a(\u0406\u0406). \u041f\u0440\u043f. \u041f\u0435\u0442\u0440\u0430, \u043f\u0430\u0442\u0440\u0438\u043a\u0456\u044f (854). \u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u043f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430 \u0420\u0438\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (1469). \u041f\u0440\u043f. \u041d\u0438\u043a\u043e\u0434\u0438\u043c\u0430 \u0421\u0432\u044f\u0442\u043e\u0433\u043e\u0440\u0446\u044f (1809). \u000d\u000a\u0420\u0438\u043c., 117 \u0437\u0430\u0447., XV, 7 \u2013 16. \u041c\u0444., 48 \u0437\u0430\u0447., XII, 38 \u2013 45.\u000d\u000a\u0411\u0435\u0437\u0441\u0440\u0456\u0431\u043d.: 1 \u041a\u043e\u0440., 153 \u0437\u0430\u0447., XII, 27 \u2013 XIII, 8. \u041c\u0444., 34 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), \u000d\u000aX, 1, 5 \u2013 8.\u000d\u000a1\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u041f\u043e\u043a\u043b\u0430\u0434\u0435\u043d\u043d\u044f \u0447\u0435\u0441\u043d\u043e\u0457 \u0440\u0438\u0437\u0438 \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456 \u0443 \u0412\u043b\u0430\u0445\u0435\u0440\u043d\u0456 \u000d\u000a(V). \u0421\u0432\u0442. \u042e\u0432\u0435\u043d\u0430\u043b\u0456\u044f, \u043f\u0430\u0442\u0440. \u0404\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 458). \u0421\u0432\u0442. \u0424\u043e\u0442\u0456\u044f, \u000d\u000a\u043c\u0438\u0442\u0440. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0432\u0441\u0456\u0454\u0457 \u0420\u0443\u0441\u0438 (1431). \u0421\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 (\u041c\u0430\u043a\u0441\u0438\u043c\u043e\u0432\u0438\u0447\u0430), \u0430\u0440\u0445\u0456\u0454\u043f. \u0428\u0430\u043d\u0445\u0430\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0421\u0430\u043d-\u0424\u0440\u0430\u043d\u0446\u0438\u0441\u044c\u043a\u043e\u0433\u043e, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f \u000d\u000a(1966).\u000d\u000a\u041e\u0445\u0442\u0438\u0440\u0441\u044c\u043a\u043e\u0457 (1739) \u0442\u0430 \u041f\u043e\u0436\u0430\u0439\u0441\u044c\u043a\u043e\u0457 (\u0425V\u0406\u0406) \u0456\u043a\u043e\u043d \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456.\u000d\u000a\u0420\u0438\u043c., 118 \u0437\u0430\u0447., XV, 17 \u2013 29. \u041c\u0444., 49 \u0437\u0430\u0447., XII, 46 \u2013 XIII, 3. \u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456: \u0404\u0432\u0440., 320 \u0437\u0430\u0447., IX, 1 \u2013 7. \u041b\u043a., 54 \u0437\u0430\u0447., X, 38 \u2013 42; XI, 27 \u2013 28.\u000d\u000a\u041c\u0447. \u042f\u043a\u0438\u043d\u0444\u0430 (108). \u041c\u0447\u0447. \u0414\u0456\u043e\u043c\u0438\u0434\u0430, \u0404\u0432\u043b\u0430\u043c\u043f\u0456\u044f, \u0410\u0441\u043a\u043b\u0456\u043f\u0456\u043e\u0434\u043e\u0442\u0430 \u0456 \u043c\u0446. \u0413\u043e\u043b\u0456\u043d\u0434\u0443\u0445\u0438 (\u0406\u0406). \u041f\u0440\u043f\u043f. \u0410\u043d\u0430\u0442\u043e\u043b\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430, \u0443 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406), \u000d\u000a\u0442\u0430 \u0456\u043d\u0448\u043e\u0433\u043e \u0410\u043d\u0430\u0442\u043e\u043b\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430, \u0443 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406). \u041c\u0447\u0447. \u000d\u000a\u041c\u043e\u043a\u0456\u044f \u0456 \u041c\u0430\u0440\u043a\u0430 (\u0406V). \u041f\u0440\u043f. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430, \u0437\u0430\u0441\u043d\u043e\u0432\u043d\u0438\u043a\u0430 \u043e\u0431\u0438\u0442\u0435\u043b\u0456 \u00ab\u041d\u0435\u0432\u0441\u0438\u043f\u0443\u0449\u0438\u0445\u00bb (\u0431\u043b. 430). \u0421\u0432\u0442. \u0410\u043d\u0430\u0442\u043e\u043b\u0456\u044f, \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (458).\u000d\u000a\u0420\u0438\u043c., 120 \u0437\u0430\u0447., XVI, 1 \u2013 16. \u041c\u0444., 50 \u0437\u0430\u0447., XIII, 3 \u2013 9.\u000d\u000a2\u000d\u000a3\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f","48\u000d\u000a\u0421\u0432\u0442. \u0410\u043d\u0434\u0440\u0456\u044f, \u0430\u0440\u0445\u0456\u0454\u043f. \u041a\u0440\u0438\u0442\u0441\u044c\u043a\u043e\u0433\u043e (740). \u041f\u0440\u043f. \u041c\u0430\u0440\u0444\u0438, \u043c\u0430\u0442\u0435\u0440\u0456 \u0421\u0438\u043c\u0435\u043e\u043d\u0430 \u000d\u000a\u0414\u0438\u0432\u043d\u043e\u0433\u043e\u0440\u0446\u044f (551). \u041c\u0447\u0447. \u0424\u0435\u043e\u0434\u043e\u0442\u0430 \u0456 \u0424\u0435\u043e\u0434\u043e\u0442\u0456\u0457 (108). \u0421\u0449\u043c\u0447. \u0424\u0435\u0434\u043e\u0440\u0430, \u000d\u000a\u0454\u043f. \u041a\u0438\u0440\u0438\u043d\u0435\u0439\u0441\u044c\u043a\u043e\u0433\u043e (310).\u000d\u000a\u0413\u0430\u043b\u0430\u0442\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456.\u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 318 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b.), VIII, 3 \u2013 6. \u041c\u0444., 21 \u0437\u0430\u0447., VII, 12 \u2013 21.\u000d\u000a\u0420\u044f\u0434.: \u0420\u0438\u043c., 97 \u0437\u0430\u0447., VIII, 14 \u2013 21. \u041c\u0444., 30 \u0437\u0430\u0447., IX, 9 \u2013 13.\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a4\u000d\u000a5-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 4-\u0439.\u000d\u000a\u041f\u0440\u043f. \u0410\u0444\u0430\u043d\u0430\u0441\u0456\u044f \u0410\u0444\u043e\u043d\u0441\u044c\u043a\u043e\u0433\u043e (1000). \u041c\u0446\u0446. \u0410\u0433\u043d\u0456\u0457 (\u0410\u043d\u043d\u0438) \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0457 \u0456 \u000d\u000a\u041a\u0438\u0440\u0438\u043b\u043b\u0438 (304). \u041f\u0440\u043f. \u041b\u0430\u043c\u043f\u0430\u0434\u0430 \u0406\u0440\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (\u0425).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456, \u0437\u0432\u0430\u043d\u043e\u0457 \u00ab\u0415\u043a\u043e\u043d\u043e\u043c\u0456\u0441\u0441\u0430\u00bb.\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 5-\u0435, \u041b\u043a., 113 \u0437\u0430\u0447., XXIV, 12 \u2013 35.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0420\u0438\u043c., 103 \u0437\u0430\u0447., X, 1 \u2013 10. \u041c\u0444., 28 \u0437\u0430\u0447., VIII, 28 \u2013 IX, 1.\u000d\u000a\u041f\u0440\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a5\u000d\u000a6-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u041f\u0440\u043f. \u0421\u0438\u0441\u043e\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e (429). \u000d\u000a\u041f\u0440\u043f. \u0421\u0438\u0441\u043e\u044f, \u0441\u0445\u0438\u043c\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0443 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 \u000d\u000a(\u0425V\u0406). \u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u043f\u0440\u0430\u0432. \u0434\u0456\u0432\u0438 \u042e\u043b\u0456\u0430\u043d\u0456\u0457, \u043a\u043d. \u041e\u043b\u044c\u0448\u0430\u043d\u0441\u044c\u043a\u043e\u0457 \u000d\u000a(\u0425\u0406\u0406\u0406). \u041c\u0447\u0447. \u041c\u0430\u0440\u0438\u043d\u0430, \u041c\u0430\u0440\u0444\u0438, \u0410\u0432\u0434\u0438\u0444\u0430\u043a\u0441\u0430, \u0410\u0432\u0430\u043a\u0443\u043c\u0430, \u041a\u0438\u0440\u0438\u043d\u0430, \u0412\u0430\u043b\u0435\u043d\u0442\u0438\u043d\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u0410\u0441\u0442\u0435\u0440\u0456\u044f \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 \u0431\u0430\u0433\u0430\u0442\u044c\u043e\u0445 \u0443 \u0420\u0438\u043c\u0456 (269). \u0421\u0449\u043c\u0447. \u0406\u0441\u0430\u0432\u0440\u0430, \u000d\u000a\u0434\u0438\u044f\u043a\u043e\u043d\u0430, \u043c\u0447\u0447. \u0406\u043d\u043e\u043a\u0435\u043d\u0442\u0456\u044f, \u0424\u0435\u043b\u0456\u043a\u0441\u0430, \u0404\u0440\u043c\u0456\u044f, \u0412\u0430\u0441\u0438\u043b\u0456\u044f, \u041f\u0435\u0440\u0435\u0433\u0440\u0438\u043d\u0430, \u0420\u0443\u0444\u0430 \u0442\u0430 \u000d\u000a\u0420\u0443\u0444\u0438\u043d\u0430 (\u0406\u0406\u0406). \u041c\u0447. \u041a\u043e\u0457\u043d\u0442\u0430 \u0424\u0440\u0438\u0433\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 283). \u041c\u0446. \u041b\u0443\u043a\u0456\u0457, \u0434\u0456\u0432\u0438, \u0456 \u0437 \u043d\u0435\u044e \u000d\u000a\u043c\u0447\u0447. \u0420\u0438\u043a\u0441\u0430, \u0410\u043d\u0442\u043e\u043d\u0456\u044f, \u041b\u0443\u043a\u0456\u0430\u043d\u0430, \u0406\u0441\u0438\u0434\u043e\u0440\u0430, \u0414\u0456\u043e\u043d\u0430, \u0414\u0456\u043e\u0434\u043e\u0440\u0430, \u041a\u0443\u0442\u043e\u043d\u0456\u044f, \u0410\u0440\u043e\u043d\u043e\u0441\u0430, \u041a\u0430\u043f\u0438\u043a\u0430 \u0456 \u0421\u0430\u0442\u0443\u0440\u0430 (301).\u000d\u000a\u0420\u0438\u043c., 121 \u0437\u0430\u0447., XVI, 17 \u2013 24. \u041c\u0444., 51 \u0437\u0430\u0447., XIII, 10 \u2013 23.\u000d\u000a\u041f\u0440\u0430\u0432. \u0434\u0456\u0432\u0438: \u0413\u0430\u043b., 208 \u0437\u0430\u0447., III, 23 \u2013 IV, 5. \u041c\u0444., 104 \u0437\u0430\u0447., XXV, 1 \u2013 13.\u000d\u000a\u041f\u0440\u043f\u043f. \u0406\u043e\u0432\u0430 (1621) \u0442\u0430 \u0424\u0435\u043e\u0434\u043e\u0441\u0456\u044f (1629) \u041c\u0430\u043d\u044f\u0432\u0441\u044c\u043a\u0438\u0445. \u041f\u0440\u043f. \u0424\u043e\u043c\u0438, \u000d\u000a\u0437 \u041c\u0430\u043b\u0435\u0457 (\u0425). \u041f\u0440\u043f. \u0421\u0435\u0432\u0435\u0440\u0438, \u0456\u0433\u0443\u043c\u0435\u043d\u0456 \u0422\u0440\u0456\u0440\u0441\u044c\u043a\u043e\u0457 (\u0431\u043b. 646). \u041f\u0440\u043f. \u0410\u043a\u0430\u043a\u0456\u044f, \u043f\u0440\u043e \u000d\u000a\u044f\u043a\u043e\u0433\u043e \u0440\u043e\u0437\u043f\u043e\u0432\u0456\u0434\u0430\u0454\u0442\u044c\u0441\u044f \u0432 \u041b\u0456\u0441\u0442\u0432\u0438\u0446\u0456 (V\u0406). \u041c\u0447\u0447. \u041f\u0435\u0440\u0435\u0433\u0440\u0438\u043d\u0430, \u041b\u0443\u043a\u0456\u0430\u043d\u0430, \u041f\u043e\u043c\u043f\u0435\u044f, \u0406\u0441\u0438\u0445\u0456\u044f, \u041f\u0430\u043f\u0456\u044f, \u0421\u0430\u0442\u043e\u0440\u043d\u0438\u043d\u0430 \u0456 \u0413\u0435\u0440\u043c\u0430\u043d\u0430 (\u0406\u0406). \u0421\u0449\u043c\u0447. \u0415\u043f\u0456\u043a\u0442\u0435\u0442\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u0456 \u043f\u0440\u043c\u0447. \u0410\u0441\u0442\u0456\u043e\u043d\u0430, \u0447\u0435\u043d\u0446\u044f (290). \u041c\u0447. \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0430 (\u0406\u0406\u0406 \u2013 \u0406V). \u041c\u0446. \u041a\u0438\u0440\u0456\u0430\u043a\u0456\u0457 \u000d\u000a\u041d\u0456\u043a\u043e\u043c\u0438\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (\u0406V). \u000d\u000a\u0412\u043b\u0430\u0445\u0435\u0440\u043d\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456.\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u041a\u043e\u0440., 122 \u0437\u0430\u0447., I, 1 \u2013 9. \u041c\u0444., 52 \u0437\u0430\u0447., XIII, 24 \u2013 30.\u000d\u000a\u041f\u0440\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u0412\u043c\u0447. \u041f\u0440\u043e\u043a\u043e\u043f\u0456\u044f (303).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u041e\u0434\u0438\u0433\u0456\u0442\u0440\u0456\u044f \u0412\u043b\u0430\u0445\u0435\u0440\u043d\u0441\u044c\u043a\u0430-\u041a\u0430\u0437\u0430\u043d\u0441\u044c\u043a\u0430\u00bb (1579).\u000d\u000a1 \u041a\u043e\u0440., 127 \u0437\u0430\u0447., II, 9 \u2013 III, 8. \u041c\u0444., 53 \u0437\u0430\u0447., XIII, 31 \u2013 36.\u000d\u000a\u0412\u043c\u0447.: 2 \u0422\u0438\u043c., 292 \u0437\u0430\u0447., II, 1 \u2013 10. \u041c\u0444., 39 \u0437\u0430\u0447., \u0425, 37 \u2013 \u0425\u0406, 1.\u000d\u000a\u0421\u0449\u043c\u0447. \u041f\u0430\u043d\u043a\u0440\u0430\u0442\u0456\u044f, \u0454\u043f. \u0422\u0430\u0432\u0440\u043e\u043c\u0435\u043d\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406). \u0421\u0449\u043c\u0447. \u041a\u0438\u0440\u0438\u043b\u0430, \u0454\u043f. \u0413\u043e\u0440\u0442\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0406\u0406 \u2013 \u0406V). \u041f\u0440\u043c\u0447\u0447. \u041f\u0430\u0442\u0435\u0440\u043c\u0443\u0444\u0456\u044f, \u041a\u043e\u043f\u0440\u0456\u044f \u0456 \u043c\u0447. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 (\u0406V). \u000d\u000a\u0421\u0432\u0442. \u0424\u0435\u0434\u043e\u0440\u0430, \u0454\u043f. \u0415\u0434\u0435\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0425).\u000d\u000a1 \u041a\u043e\u0440., 129 \u0437\u0430\u0447., III, 18 \u2013 23. \u041c\u0444., 54 \u0437\u0430\u0447., XIII, 36 \u2013 43.\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a6\u000d\u000a7\u000d\u000a8\u000d\u000a9","49\u000d\u000a\u041c\u0447\u0447. 45-\u043e\u0445 \u0432 \u041d\u0456\u043a\u043e\u043f\u043e\u043b\u0456 \u0412\u0456\u0440\u043c\u0435\u043d\u0441\u044c\u043a\u043e\u043c\u0443: \u041b\u0435\u043e\u043d\u0442\u0456\u044f, \u041c\u0430\u0432\u0440\u0438\u043a\u0456\u044f, \u0414\u0430\u043d\u0438\u0457\u043b\u0430, \u000d\u000a\u0410\u043d\u0442\u043e\u043d\u0456\u044f, \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430, \u042f\u043d\u0438\u043a\u0438\u0442\u0430, \u0421\u0438\u0441\u0438\u043d\u0456\u044f, \u041c\u0435\u043d\u0435\u044f, \u0412\u0438\u0440\u0438\u043b\u0430\u0434\u0430 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 \u000d\u000a(\u0431\u043b. 319). \u041f\u0440\u043f. \u0410\u043d\u0442\u043e\u043d\u0456\u044f \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0437\u0430\u0441\u043d\u043e\u0432\u043d\u0438\u043a\u0430 \u0443\u043a\u0440\u0430\u0457\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u0447\u0435\u0440\u043d\u0435\u0446\u0442\u0432\u0430 (1073). \u041f\u0440\u043f. \u0421\u0438\u043b\u0443\u0430\u043d\u0430, \u0441\u0445\u0438\u043c\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406 \u2013 \u0425\u0406V). \u041c\u0447. \u0410\u043f\u043e\u043b\u043b\u043e\u043d\u0456\u044f (\u0406\u0406\u0406). \u000d\u000a\u041c\u0447\u0447. \u0412\u0456\u0430\u043d\u043e\u0440\u0430 \u0439 \u0421\u0438\u043b\u0443\u0430\u043d\u0430 (\u0406V). \u041f\u0440\u043c\u0447\u0447. \u043f\u0443\u0441\u0442\u0435\u043b\u044c\u043d\u0438\u043a\u0456\u0432 \u0454\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u0438\u0445, \u0432\u043e\u0433\u043d\u0435\u043c \u0456 \u0434\u0438\u043c\u043e\u043c \u0437\u0430\u043a\u0430\u0442\u043e\u0432\u0430\u043d\u0438\u0445 (\u0431\u043b. 398).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u041a\u043e\u0440., 130 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), IV, 5 \u2013 8. \u041c\u0444., 55 \u0437\u0430\u0447., XIII, 44 \u2013 54.\u000d\u000a\u041f\u0440\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041c\u0444., 10 \u0437\u0430\u0447., IV, 25 \u2013 V, 12.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f \u00ab\u0423\u0431\u043b\u0430\u0436\u0430\u0454\u043c\u043e \u0442\u0435\u0431\u0435, \u043f\u0440\u0435\u043f\u043e\u0434\u043e\u0431\u043d\u0438\u0439 \u043e\u0442\u0447\u0435 \u043d\u0430\u0448 \u0410\u043d\u0442\u043e\u043d\u0456\u044e \u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u0438\u0439, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u0441\u0432\u044f\u0442\u0443 \u043f\u0430\u043c\u2019\u044f\u0442\u044c \u0442\u0432\u043e\u044e, \u043d\u0430\u0441\u0442\u0430\u0432\u043d\u0438\u043a\u0443 \u043c\u043e\u043d\u0430\u0445\u0456\u0432 \u000d\u000a\u0456 \u0441\u043f\u0456\u0432\u0440\u043e\u0437\u043c\u043e\u0432\u043d\u0438\u043a\u0443 \u0430\u043d\u0433\u0435\u043b\u0456\u0432\u00bb.\u000d\u000a\u0417\u0433\u0430\u0434\u0443\u0432\u0430\u043d\u043d\u044f \u0447\u0443\u0434\u0430 \u0432\u043c\u0446. \u0404\u0432\u0444\u0438\u043c\u0456\u0457 \u0412\u0441\u0435\u0445\u0432\u0430\u043b\u044c\u043d\u043e\u0457, \u0447\u0435\u0440\u0435\u0437 \u044f\u043a\u0435 \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u2019\u044f \u000d\u000a\u0443\u0442\u0432\u0435\u0440\u0434\u0438\u043b\u043e\u0441\u044c (451). \u0420\u0456\u0432\u043d\u043e\u0430\u043f. \u041e\u043b\u044c\u0433\u0438, \u043a\u043d\u044f\u0433\u0438\u043d\u0456 \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0457, \u0443 \u0441\u0432\u044f\u0442\u043e\u043c\u0443 \u000d\u000a\u0445\u0440\u0435\u0449\u0435\u043d\u043d\u0456 \u041e\u043b\u0435\u043d\u0438 (969). \u0421\u0449\u043c\u0447. \u041a\u0456\u043d\u0434\u0435\u044f, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 (\u0406\u0406\u0406 \u2013 \u0406V).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u0444., 104 \u0437\u0430\u0447., \u0425\u0425V, 1 \u2013 13.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0420\u0438\u043c., 100 \u0437\u0430\u0447., IX, 1 \u2013 5. \u041c\u0444., 32 \u0437\u0430\u0447., IX, 18 \u2013 26.\u000d\u000a\u0420\u0456\u0432\u043d\u043e\u0430\u043f.: \u0414\u0456\u044f\u043d., 39 \u0437\u0430\u0447., \u0425V\u0406, 1 \u2013 15. \u041b\u043a., 33 \u0437\u0430\u0447., VII, 36 \u2013 50.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0442\u0435\u0431\u0435, \u0441\u0432\u044f\u0442\u0430 \u0440\u0456\u0432\u043d\u043e\u0430\u043f\u043e\u0441\u0442\u043e\u043b\u044c\u043d\u0430 \u043a\u043d\u044f\u0433\u0438\u043d\u0435 \u041e\u043b\u044c\u0433\u043e, \u044f\u043a \u0437\u043e\u0440\u044e \u0440\u0430\u043d\u043d\u044e, \u0449\u043e \u043d\u0430 \u0437\u0435\u043c\u043b\u0456 \u043d\u0430\u0448\u0456\u0439 \u0437\u0430\u0441\u044f\u044f\u043b\u0430 \u0456 \u0441\u0432\u0456\u0442\u043b\u043e \u0432\u0456\u0440\u0438 \u000d\u000a\u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u043e\u0457 \u043d\u0430\u0440\u043e\u0434\u0443 \u0441\u0432\u043e\u0454\u043c\u0443 \u0441\u043f\u043e\u0432\u0456\u0441\u0442\u0438\u043b\u0430\u00bb.\u000d\u000a7-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0421\u043e\u0431\u043e\u0440 \u0430\u0440\u0445\u0430\u043d\u0433\u0435\u043b\u0430 \u0413\u0430\u0432\u0440\u0438\u0457\u043b\u0430. \u000d\u000a\u041f\u0440\u043f. \u0421\u0442\u0435\u0444\u0430\u043d\u0430 \u0421\u0430\u0432\u0430\u0457\u0442\u0430 (794). \u0421\u0432\u0442. \u042e\u043b\u0456\u0430\u043d\u0430, \u0454\u043f. \u041a\u0435\u043d\u043e\u043c\u0430\u043d\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406). \u000d\u000a\u041c\u0447. \u0421\u0435\u0440\u0430\u043f\u0456\u043e\u043d\u0430 (\u0406\u0406 \u2013 \u0406\u0406\u0406). \u041c\u0447. \u041c\u0430\u0440\u043a\u0456\u0430\u043d\u0430 (258). \u041f\u0440\u043e\u0441\u043b\u0430\u0432\u043b\u0435\u043d\u043d\u044f \u0441\u0432\u0442. \u0421\u043e\u0444\u0440\u043e\u043d\u0456\u044f (\u041a\u0440\u0438\u0448\u0442\u0430\u043b\u0435\u0432\u0441\u044c\u043a\u043e\u0433\u043e), \u0454\u043f. \u0406\u0440\u043a\u0443\u0442\u0441\u044c\u043a\u043e\u0433\u043e (1918).\u000d\u000a1 \u041a\u043e\u0440., 134 \u0437\u0430\u0447., V, 9 \u2013 VI, 11. \u041c\u0444., 56 \u0437\u0430\u0447., XIII, 54 \u2013 58.\u000d\u000a\u0410\u0440\u0445\u0430\u043d\u0433.: \u0404\u0432\u0440., 315 \u0437\u0430\u0447., V\u0406\u0406, 1 \u2013 6. \u041b\u043a., 51 \u0437\u0430\u0447., X, 16 \u2013 21. \u000d\u000a\u0410\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u0432\u0456\u0434 70-\u0445 \u0410\u043a\u0438\u043b\u0438 (\u0406). \u041c\u0447. \u042e\u0441\u0442\u0430 \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (\u0406). \u041f\u0440\u043f. \u0415\u043b\u0456\u044f, \u0447\u0435\u043d\u0446\u044f \u000d\u000a(\u0406V). \u041f\u0440\u043f. \u041e\u043d\u0438\u0441\u0438\u043c\u0430 \u041c\u0430\u0433\u043d\u0435\u0437\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (\u0406V). \u0411\u043b\u0433\u0432. \u041e\u0441\u043a\u043e\u043b\u044c\u0434\u0430, \u043f\u0435\u0440\u0448\u043e\u043c\u0443\u0447. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u0443 \u0441\u0432. \u0445\u0440\u0435\u0449\u0435\u043d\u043d\u0456 \u041c\u0438\u043a\u043e\u043b\u0430\u044f (882). \u000d\u000a\u041f\u0440\u043f. \u0421\u0442\u0435\u0444\u0430\u043d\u0430 \u041c\u0430\u0445\u0440\u0438\u0446\u044c\u043a\u043e\u0433\u043e (1406). \u000d\u000a1 \u041a\u043e\u0440., 136 \u0437\u0430\u0447., VI, 20 \u2013 VII, 12. \u041c\u0444., 57 \u0437\u0430\u0447., XIV, 1 \u2013 13.\u000d\u000a\u0411\u043b\u0433\u0432.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041c\u0444., 10 \u0437\u0430\u0447., IV, 25 \u2013 V, 12.\u000d\u000a10\u000d\u000a11\u000d\u000a13\u000d\u000a14\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a6-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 5-\u0439.\u000d\u000a\u041c\u0447\u0447. \u041f\u0440\u043e\u043a\u043b\u0430 \u0442\u0430 \u0406\u043b\u0430\u0440\u0456\u044f (\u0406\u0406). \u041f\u0440\u0430\u0432. \u0412\u0435\u0440\u043e\u043d\u0456\u043a\u0438 \u0404\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0441\u044c\u043a\u043e\u0457 (\u0406). \u041f\u0440\u043f. \u041c\u0438\u0445\u0430\u0457\u043b\u0430 \u041c\u0430\u043b\u0435\u0457\u043d\u0430, \u0456\u0433\u0443\u043c\u0435\u043d\u0430 (962). \u041c\u0447\u0447. \u0424\u0435\u0434\u043e\u0440\u0430, \u0432\u0430\u0440\u044f\u0433\u0430, \u0456 \u0441\u0438\u043d\u0430 \u0439\u043e\u0433\u043e \u000d\u000a\u0406\u043e\u0430\u043d\u0430, \u0432 \u041a\u0438\u0454\u0432\u0456 (983). \u041c\u0446. \u0413\u043e\u043b\u0456\u043d\u0434\u0443\u0445\u0438 \u041f\u0435\u0440\u0441\u044c\u043a\u043e\u0457, \u0443 \u0441\u0432. \u0445\u0440\u0435\u0449\u0435\u043d\u043d\u0456 \u041c\u0430\u0440\u0456\u0457 \u000d\u000a(591). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430 (1005) \u0456 \u0413\u0430\u0432\u0440\u0438\u0457\u043b\u0430 (\u0425) \u0421\u0432\u044f\u0442\u043e\u0433\u043e\u0440\u0446\u0456\u0432 (\u0413\u0440\u0443\u0437.). \u041f\u0440\u043f. \u041f\u0430\u0457\u0441\u0456\u044f \u0421\u0432\u044f\u0442\u043e\u0433\u043e\u0440\u0446\u044f (1994).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u0422\u0440\u043e\u0454\u0440\u0443\u0447\u0438\u0446\u044f\u00bb (V\u0406\u0406\u0406). \u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 6-\u0435, \u041b\u043a., 114 \u0437\u0430\u0447., XXIV, 36 \u2013 53.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0420\u0438\u043c., 110 \u0437\u0430\u0447., XII, 6 \u2013 14. \u041c\u0444., 29 \u0437\u0430\u0447., IX, 1 \u2013 8.\u000d\u000a\u041f\u0440\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a12","50\u000d\u000a\u0420\u0456\u0432\u043d\u043e\u0430\u043f. \u043a\u043d\u044f\u0437\u044f \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0412\u043e\u043b\u043e\u0434\u0438\u043c\u0438\u0440\u0430, \u0443 \u0441\u0432. \u0445\u0440\u0435\u0449\u0435\u043d\u043d\u0456 \u0412\u0430\u0441\u0438\u043b\u0456\u044f (1015). \u041c\u0447\u0447. \u041a\u0438\u0440\u0438\u043a\u0430 \u0456 \u043c\u0430\u0442\u0435\u0440\u0456 \u0439\u043e\u0433\u043e \u0423\u043b\u0438\u0442\u0438 (\u0431\u043b. 305). \u041c\u0447. \u0410\u0432\u0443\u0434\u0438\u043c\u0430 \u0422\u0435\u043d\u0435\u0434\u043e\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 36 \u0437\u0430\u0447., X, 9 \u2013 16. \u000d\u000a\u041b\u0456\u0442. \u2013 \u0420\u0456\u0432\u043d\u043e\u0430\u043f.: \u0413\u0430\u043b., 200 \u0437\u0430\u0447., I, 11 \u2013 19. \u0406\u043d., 35 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), X, 1 \u2013 9.\u000d\u000a\u0414\u0435\u043d\u044c \u0445\u0440\u0435\u0449\u0435\u043d\u043d\u044f \u0420\u0443\u0441\u0438\u2013\u0423\u043a\u0440\u0430\u0457\u043d\u0438.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0442\u0435\u0431\u0435, \u0441\u0432\u044f\u0442\u0438\u0439 \u0440\u0456\u0432\u043d\u043e\u0430\u043f\u043e\u0441\u0442\u043e\u043b\u044c\u043d\u0438\u0439 \u000d\u000a\u043a\u043d\u044f\u0436\u0435 \u0412\u043e\u043b\u043e\u0434\u0438\u043c\u0438\u0440\u0435, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u0441\u0432\u044f\u0442\u0443 \u043f\u0430\u043c\u2019\u044f\u0442\u044c \u0442\u0432\u043e\u044e, \u0456\u0434\u043e\u043b\u0456\u0432 \u0442\u0438 \u0437\u043d\u0438\u0449\u0438\u0432 \u0456 \u000d\u000a\u0432\u0441\u044e \u043d\u0430\u0448\u0443 \u0437\u0435\u043c\u043b\u044e \u0441\u0432\u044f\u0442\u0438\u043c \u0445\u0440\u0435\u0449\u0435\u043d\u043d\u044f\u043c \u043f\u0440\u043e\u0441\u0432\u0456\u0442\u0438\u0432\u00bb. \u041d\u0430 \u043b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0432\u0445\u0456\u0434\u043d\u0438\u0439 \u000d\u000a\u0441\u0442\u0438\u0445: \"\u0414\u0438\u0432\u043d\u0438\u0439 \u0411\u043e\u0433 \u0443 \u0441\u0432\u044f\u0442\u0438\u0445 \u0421\u0432\u043e\u0457\u0445, \u0411\u043e\u0433 \u0406\u0437\u0440\u0430\u0457\u043b\u0456\u0432; \u0412\u0456\u043d \u0434\u0430\u0454 \u0441\u0438\u043b\u0443 \u0439 \u043c\u043e\u0433\u0443\u0442\u043d\u0456\u0441\u0442\u044c \u043d\u0430\u0440\u043e\u0434\u0443 \u0421\u0432\u043e\u0454\u043c\u0443. \u0411\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0435\u043d\u043d\u0438\u0439 \u0411\u043e\u0433!\"\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a15\u000d\u000a\u0421\u0449\u043c\u0447. \u0410\u0444\u0456\u043d\u043e\u0433\u0435\u043d\u0430 \u0421\u0435\u0432\u0430\u0441\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0454\u043f., \u0456 \u0434\u0435\u0441\u044f\u0442\u044c\u043e\u0445 \u0443\u0447\u043d\u0456\u0432 \u0439\u043e\u0433\u043e (\u0431\u043b. 311). \u000d\u000a\u041c\u0447. \u041f\u0430\u0432\u043b\u0430 \u0456 \u043c\u0446\u0446. \u0410\u043b\u0435\u0432\u0442\u0438\u043d\u0438 (\u0412\u0430\u043b\u0435\u043d\u0442\u0438\u043d\u0438) \u0442\u0430 \u0425\u0456\u043e\u043d\u0456\u0457 (308). \u041c\u0447. \u0410\u043d\u0442\u0456\u043e\u0445\u0430 \u000d\u000a\u0421\u0435\u0432\u0430\u0441\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u043b\u0456\u043a\u0430\u0440\u044f (\u0406V). \u041c\u0446. \u042e\u043b\u0456\u0457, \u0434\u0456\u0432\u0438 (\u0431\u043b. 440 \u0430\u0431\u043e 613). \u041f\u0430\u043c\u2019\u044f\u0442\u044c \u000d\u000a\u0441\u0432\u0432. \u043e\u0442\u0446\u0456\u0432 IV \u0412\u0441\u0435\u043b\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u0441\u043e\u0431\u043e\u0440\u0443 (451). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430 \u0412\u0438\u0448\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u000d\u000a\u0421\u0432\u044f\u0442\u043e\u0433\u043e\u0440\u0446\u044f (\u043f\u0456\u0441\u043b\u044f 1620). \u000d\u000a1 \u041a\u043e\u0440., 137 \u0437\u0430\u0447., VII, 12 \u2013 24. \u041c\u0444., 60 \u0437\u0430\u0447., XIV, 35 \u2013 XV, 11 (\u0437\u0430 \u0441\u0435\u0440\u0435\u0434\u0443).\u000d\u000a1 \u041a\u043e\u0440., 138 \u0437\u0430\u0447., VII, 24 \u2013 35. \u041c\u0444., 61 \u0437\u0430\u0447., XV, 12 \u2013 21 (\u0437\u0430 \u0447\u0435\u0442\u0432\u0435\u0440).\u000d\u000a\u0412\u043c\u0446. \u041c\u0430\u0440\u0438\u043d\u0438 (\u041c\u0430\u0440\u0433\u0430\u0440\u0438\u0442\u0438) \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (\u0406V). \u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u043f\u0440\u043f. \u000d\u000a\u041b\u0430\u0437\u0430\u0440\u044f \u0413\u0430\u043b\u0438\u0441\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e.\u000d\u000a1 \u041a\u043e\u0440., 139 \u0437\u0430\u0447., VII, 35 \u2013 VIII, 7. \u041c\u0444., 63 \u0437\u0430\u0447., XV, 29 \u2013 31.\u000d\u000a\u041c\u0447. \u0415\u043c\u0456\u043b\u0456\u0430\u043d\u0430 (363). \u041c\u0447. \u042f\u043a\u0438\u043d\u0444\u0430 \u0410\u043c\u0430\u0441\u0442\u0440\u0438\u0434\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430 \u000d\u000a\u0411\u0430\u0433\u0430\u0442\u043e\u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043b\u044c\u043d\u043e\u0433\u043e, \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (1160). \u041f\u0440\u043f. \u041f\u0430\u043c\u0432\u0438, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u000d\u000a\u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (1241). \u041f\u0440\u043f. \u041f\u0430\u043c\u0432\u0438 \u041d\u0456\u0442\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u043f\u0443\u0441\u0442\u0435\u043b\u044c\u043d\u0438\u043a\u0430 (\u0406V).\u000d\u000a\u0420\u0438\u043c., 108 \u0437\u0430\u0447., XII, 1 \u2013 3. \u041c\u0444., 39 \u0437\u0430\u0447., X, 37 \u2013 XI, 1.\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a16\u000d\u000a17\u000d\u000a18\u000d\u000a7-\u043c\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 6-\u0439.\u000d\u000a\u041f\u0430\u043c\u2019\u044f\u0442\u044c \u0441\u0432\u044f\u0442\u0438\u0445 \u043e\u0442\u0446\u0456\u0432 \u0448\u0456\u0441\u0442\u044c\u043e\u0445 \u0412\u0441\u0435\u043b\u0435\u043d\u0441\u044c\u043a\u0438\u0445 \u0441\u043e\u0431\u043e\u0440\u0456\u0432 (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u000d\u000a\u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 \u043d\u0435\u0434\u0456\u043b\u044e, \u043d\u0430\u0439\u0431\u043b\u0438\u0436\u0447\u0443 \u0434\u043e 16 \u043b\u0438\u043f\u043d\u044f). \u041f\u0440\u043f. \u041c\u0430\u043a\u0440\u0438\u043d\u0438, \u0441\u0435\u0441\u0442\u0440\u0438 \u000d\u000a\u0441\u0432\u0442. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e (380). \u041f\u0440\u043f. \u0414\u0456\u044f \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e, \u0456\u0433\u0443\u043c. \u000d\u000a(\u0431\u043b. 430). \u041f\u0440\u043f. \u041f\u0430\u0457\u0441\u0456\u044f \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 \u000d\u000a(\u0425\u0406V). \u0411\u043b\u0433\u0432\u0432. \u043a\u043d. \u0421\u0442\u0435\u0444\u0430\u043d\u0430 (1427) \u0456 \u043c\u0430\u0442\u0435\u0440\u0456 \u0439\u043e\u0433\u043e \u043a\u043d. \u041c\u0438\u043b\u0438\u0446\u0456 (1405), \u000d\u000a\u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u0456\u0432 \u0421\u0435\u0440\u0431\u0441\u044c\u043a\u0438\u0445. \u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u043f\u0440\u043f. \u0421\u0435\u0440\u0430\u0444\u0438\u043c\u0430, \u0421\u0430\u0440\u043e\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (1903).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 7-\u0435, \u0406\u043d., 63 \u0437\u0430\u0447., XX, 1 \u2013 10.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0420\u0438\u043c., 116 \u0437\u0430\u0447., XV, 1 \u2013 7. \u041c\u0444., 33 \u0437\u0430\u0447., IX, 27 \u2013 35.\u000d\u000a\u0421\u0432\u0432. \u043e\u0442\u0446\u0456\u0432: \u0404\u0432\u0440., 334 \u0437\u0430\u0447., XIII, 7 \u2013 16. \u0406\u043d., 56 \u0437\u0430\u0447., XVII, 1 \u2013 13.\u000d\u000a\u0412\u043e\u0441\u043a\u0440\u0435\u0441\u043d\u0430 \u0441\u043b\u0443\u0436\u0431\u0430 \u0437 \u041e\u043a\u0442\u043e\u0457\u0445\u0430 \u043f\u043e\u0454\u0434\u043d\u0443\u0454\u0442\u044c\u0441\u044f \u0437\u0456 \u0441\u043b\u0443\u0436\u0431\u043e\u044e \u0441\u0432\u044f\u0442\u0438\u043c \u043e\u0442\u0446\u044f\u043c \u000d\u000a(\u0443 \u041c\u0456\u043d\u0435\u0457 \u043f\u0456\u0434 16 \u043b\u0438\u043f\u043d\u044f). \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u043f\u0440\u043e\u043a\u0438\u043c\u0435\u043d, \u0410\u043f\u043e\u0441\u0442\u043e\u043b, \u0430\u043b\u0438\u043b\u0443\u0430\u0440\u0456\u0439, \u000d\u000a\u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454 \u0456 \u043f\u0440\u0438\u0447\u0430\u0441\u043d\u0438\u0439 \u0432\u043e\u0441\u043a\u0440\u0435\u0441\u043d\u0438\u0439 \u0456 \u043e\u0442\u0446\u044f\u043c. \u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a19","51\u000d\u000a8-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u041f\u0440\u043e\u0440. \u0406\u043b\u043b\u0456 (\u0406\u0425 \u0441\u0442. \u0434\u043e \u0420. \u0425.). \u000d\u000a\u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u043f\u0440\u043c\u0447. \u0410\u0444\u0430\u043d\u0430\u0441\u0456\u044f \u0411\u0435\u0440\u0435\u0441\u0442\u0435\u0439\u0441\u044c\u043a\u043e\u0433\u043e (1649). \u000d\u000a\u041f\u0440\u0430\u0432. \u0410\u0430\u0440\u043e\u043d\u0430, \u043f\u0435\u0440\u0448\u043e\u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0438\u043a\u0430 (1451 \u0440. \u0434\u043e \u0420. \u0425\u0440.)\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 14 \u0437\u0430\u0447., IV, 22 \u2013 30.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u041a\u043e\u0440., 142 \u0437\u0430\u0447., IX, 13 \u2013 18. \u041c\u0444., 65 \u0437\u0430\u0447., XVI, 1 \u2013 6.\u000d\u000a\u041f\u0440\u043e\u0440.: \u042f\u043a., 57 \u0437\u0430\u0447., V, 10 \u2013 20. \u041b\u043a., 14 \u0437\u0430\u0447., IV, 22 \u2013 30.\u000d\u000a\u041f\u0440\u043e\u0440. \u0404\u0437\u0435\u043a\u0438\u0457\u043b\u044f (V\u0406 \u0441\u0442. \u0434\u043e \u0420. \u0425.). \u041f\u0440\u043f\u043f. \u0421\u0438\u043c\u0435\u043e\u043d\u0430, \u044e\u0440\u043e\u0434\u0438\u0432\u043e\u0433\u043e \u0437\u0430\u0440\u0430\u0434\u0438 \u000d\u000a\u0425\u0440\u0438\u0441\u0442\u0430, \u0442\u0430 \u0406\u043e\u0430\u043d\u0430, \u0441\u043f\u0456\u0432\u043f\u043e\u0441\u043d\u0438\u043a\u0430 \u0439\u043e\u0433\u043e (\u0431\u043b. 590). \u041f\u0440\u043f\u043f. \u041e\u043d\u0443\u0444\u0440\u0456\u044f \u041c\u043e\u0432\u0447\u0430\u0437\u043d\u043e\u0433\u043e \u0439 \u041e\u043d\u0438\u0441\u0438\u043c\u0430, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430, \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u0438\u0445, \u0443 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406 \u2013 \u0425\u0406\u0406\u0406).\u000d\u000a1 \u041a\u043e\u0440., 144 \u0437\u0430\u0447., X, 5 \u2013 12. \u041c\u0444., 66 \u0437\u0430\u0447., XVI, 6 \u2013 12.\u000d\u000a\u041c\u0438\u0440\u043e\u043d\u043e\u0441\u0438\u0446\u0456 \u0440\u0456\u0432\u043d\u043e\u0430\u043f. \u041c\u0430\u0440\u0456\u0457 \u041c\u0430\u0433\u0434\u0430\u043b\u0438\u043d\u0438 (\u0406). \u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u000d\u000a\u0441\u0449\u043c\u0447. \u0424\u043e\u043a\u0438, \u0454\u043f. \u0421\u0438\u043d\u043e\u043f\u0441\u044c\u043a\u043e\u0433\u043e (403 \u2013 404).\u000d\u000a1 \u041a\u043e\u0440., 145 \u0437\u0430\u0447., X, 12 \u2013 22. \u041c\u0444., 68 \u0437\u0430\u0447., XVI, 20 \u2013 24.\u000d\u000a\u0420\u0456\u0432\u043d\u043e\u0430\u043f.: 1 \u041a\u043e\u0440., 141 \u0437\u0430\u0447., IX, 2 \u2013 12. \u0406\u043d., 64 \u0437\u0430\u0447., \u0425\u0425, 11 \u2013 18 \u0430\u0431\u043e \u041b\u043a., 34 \u000d\u000a\u0437\u0430\u0447., VI\u0406\u0406, 1\u20133.\u000d\u000a\u041f\u043e\u0447\u0430\u0457\u0432\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (1675). \u0421\u0449\u043c\u0447. \u0410\u043f\u043e\u043b\u043b\u0456\u043d\u0430\u0440\u0456\u044f, \u000d\u000a\u0454\u043f. \u0420\u0430\u0432\u0435\u043d\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 75). \u041c\u0447\u0447. \u0422\u0440\u043e\u0444\u0438\u043c\u0430, \u0424\u0435\u043e\u0444\u0456\u043b\u0430 \u0456 \u0437 \u043d\u0438\u043c\u0438 13 \u000d\u000a\u043c\u0447\u0447. (\u0406V). \u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 4 \u0437\u0430\u0447., I, 39 \u2013 49, 56.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u041a\u043e\u0440., 147 \u0437\u0430\u0447., X, 28 \u2013 XI, 7. \u041c\u0444., 69 \u0437\u0430\u0447., XVI, 24 \u2013 28.\u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456: \u0404\u0432\u0440., 320 \u0437\u0430\u0447., IX, 1 \u2013 7. \u041b\u043a., 54 \u0437\u0430\u0447., X, 38 \u2013 42; XI, 27 \u2013 28.\u000d\u000a\u041f\u0440\u0430\u0432. \u0410\u0444\u0456\u043d\u0430\u0433\u043e\u0440\u0430 \u0410\u0444\u0456\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u0430\u043f\u043e\u043b\u043e\u0433\u0435\u0442\u0430 (\u0406\u0406). \u0412\u043c\u0446. \u0425\u0440\u0438\u0441\u0442\u0438\u043d\u0438 (\u0431\u043b. \u000d\u000a300). \u041c\u0447\u0447. \u0431\u043b\u0433\u0432\u0432. \u043a\u043d\u043d. \u0411\u043e\u0440\u0438\u0441\u0430 \u0456 \u0413\u043b\u0456\u0431\u0430, \u0443 \u0441\u0432. \u0445\u0440\u0435\u0449\u0435\u043d\u043d\u0456 \u0420\u043e\u043c\u0430\u043d\u0430 \u0456 \u0414\u0430\u0432\u0438\u0434\u0430 (1015). \u041f\u0440\u043f. \u041f\u043e\u043b\u0456\u043a\u0430\u0440\u043f\u0430, \u0430\u0440\u0445\u0456\u043c. \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e (1182). \u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 106 \u0437\u0430\u0447., XXI, 12 \u2013 19.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u041a\u043e\u0440., 148 \u0437\u0430\u0447., XI, 8 \u2013 22. \u041c\u0444., 71 \u0437\u0430\u0447., XVII, 10 \u2013 18. \u000d\u000a\u0411\u043b\u0433\u0432\u0432. \u043a\u043d\u043d.: \u0420\u0438\u043c., 99 \u0437\u0430\u0447., VIII, 28 \u2013 39. \u0406\u043d., 52 \u0437\u0430\u0447., XV, 17 \u2013 XVI, 2.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0432\u0430\u0441, \u0441\u0432\u044f\u0442\u0456 \u0441\u0442\u0440\u0430\u0441\u0442\u043e\u0442\u0435\u0440\u043f\u0446\u0456 \u0411\u043e\u0440\u0438\u0441\u0435 \u0456 \u0413\u043b\u0456\u0431\u0435, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u0447\u0435\u0441\u043d\u0456 \u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043d\u043d\u044f \u0432\u0430\u0448\u0456, \u0431\u043e \u0432\u0438 \u043c\u043e\u043b\u0438\u0442\u0435 \u0437\u0430 \u000d\u000a\u043d\u0430\u0441 \u0425\u0440\u0438\u0441\u0442\u0430 \u0411\u043e\u0433\u0430 \u043d\u0430\u0448\u043e\u0433\u043e\u00bb.\u000d\u000a\u0423\u0441\u043f\u0456\u043d\u043d\u044f \u043f\u0440\u0430\u0432. \u0410\u043d\u043d\u0438, \u043c\u0430\u0442\u0435\u0440\u0456 \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456. \u0421\u0432\u0432. \u0436\u0456\u043d\u043e\u043a \u041e\u043b\u0456\u043c\u043f\u0456\u0430\u0434\u0438, \u0434\u0438\u044f\u043a\u043e\u043d\u0438\u0441\u0438 (408 \u2013 410), \u0442\u0430 \u0404\u0432\u043f\u0440\u0430\u043a\u0441\u0456\u0457, \u0434\u0456\u0432\u0438 \u0422\u0430\u0432\u0435\u043d\u0441\u044c\u043a\u043e\u0457 (413). \u041f\u0430\u043c\u2019\u044f\u0442\u044c V \u0412\u0441\u0435\u043b\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u0441\u043e\u0431\u043e\u0440\u0443 (553).\u000d\u000a\u041f\u0440\u0430\u0432.: \u0413\u0430\u043b., 210 \u0437\u0430\u0447., IV, 22 \u2013 31. \u041b\u043a., 36 \u0437\u0430\u0447., VIII, 16 \u2013 21.\u000d\u000a\u0420\u044f\u0434.: \u0420\u0438\u043c., 111 \u0437\u0430\u0447., XIII, 1 \u2013 10. \u041c\u0444., 47 \u0437\u0430\u0447., XII, 30 \u2013 37.\u000d\u000a20\u000d\u000a21\u000d\u000a22\u000d\u000a23\u000d\u000a24\u000d\u000a25\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430","52\u000d\u000a8-\u043c\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 7-\u0439.\u000d\u000a\u0421\u0449\u043c\u0447\u0447. \u0404\u0440\u043c\u043e\u043b\u0430\u044f, \u0404\u0440\u043c\u0438\u043f\u0430 \u0456 \u0404\u0440\u043c\u043e\u043a\u0440\u0430\u0442\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0456\u0432 \u041d\u0456\u043a\u043e\u043c\u0438\u0434\u0456\u0439\u0441\u044c\u043a\u0438\u0445 \u000d\u000a(\u0431\u043b. 305). \u041f\u0440\u043c\u0446. \u041f\u0430\u0440\u0430\u0441\u043a\u0435\u0432\u0438 \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0457 (\u0406\u0406). \u041f\u0440\u043f. \u041c\u043e\u0439\u0441\u0435\u044f \u0423\u0433\u0440\u0438\u043d\u0430, \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0431\u043b. 1043). \u041f\u0440\u043f. \u041c\u043e\u0439\u0441\u0435\u044f, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406 \u000d\u000a\u2013 \u0425\u0406V). \u0421\u0432\u0442. \u0419\u043e\u0441\u0438\u0444\u0430 (\u041d\u0435\u043b\u044e\u0431\u043e\u0432\u0438\u0447\u0430-\u0422\u0443\u043a\u0430\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e), \u043c\u0438\u0442\u0440. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u0413\u0430\u043b\u0438\u0446\u044c\u043a\u043e\u0433\u043e \u0456 \u0432\u0441\u0456\u0454\u0457 \u0420\u0443\u0441\u0438 (1675).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 8-\u0435, \u0406\u043d., 64 \u0437\u0430\u0447., XX, 11 \u2013 18.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u041a\u043e\u0440., 124 \u0437\u0430\u0447., I, 10 \u2013 18. \u041c\u0444., 58 \u0437\u0430\u0447., XIV, 14 \u2013 22.\u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 335 \u0437\u0430\u0447., \u0425\u0406\u0406\u0406, 17 \u2013 21. \u0406\u043d., 36 \u0437\u0430\u0447., \u0425, 9 \u2013 16.\u000d\u000a9-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0412\u043c\u0447. \u0456 \u0446\u0456\u043b\u0438\u0442\u0435\u043b\u044f \u041f\u0430\u043d\u0442\u0435\u043b\u0435\u0439\u043c\u043e\u043d\u0430 (305). \u041f\u0440\u043f\u043f. \u0410\u043d\u0444\u0456\u0441\u0438, \u0456\u0433\u0443\u043c\u0435\u043d\u0456, \u0456 90 \u0441\u0435\u0441\u0442\u0435\u0440 \u0457\u0457 (V\u0406\u0406\u0406). \u0420\u0456\u0432\u043d\u043e\u0430\u043f\u043f. \u041a\u043b\u0438\u043c\u0435\u043d\u0442\u0430, \u0454\u043f. \u041e\u0445\u0440\u0438\u0434\u0441\u044c\u043a\u043e\u0433\u043e (916), \u041d\u0430\u0443\u043c\u0430, \u0421\u0430\u0432\u0438, \u0413\u043e\u0440\u0430\u0437\u0434\u0430 \u0439 \u0410\u043d\u0433\u0435\u043b\u044f\u0440\u0430 (\u0406\u0425-\u0425, \u000d\u000a\u0411\u043e\u043b\u0433.). \u041f\u0440\u043f. \u0413\u0435\u0440\u043c\u0430\u043d\u0430 \u0410\u043b\u044f\u0441\u043a\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e (1837).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 106 \u0437\u0430\u0447., X\u0425\u0406, 12 \u2013 19.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u041a\u043e\u0440., 150 \u0437\u0430\u0447., XI, 31 \u2013 XII, 6. \u041c\u0444., 74 \u0437\u0430\u0447., XVIII, 1 \u2013 11.\u000d\u000a\u0412\u043c\u0447.: 2 \u0422\u0438\u043c., 292 \u0437\u0430\u0447., II, 1 \u2013 10. \u0406\u043d., 52 \u0437\u0430\u0447., XV, 17 \u2013 XVI, 2.\u000d\u000a\u0410\u043f\u043f. \u0432\u0456\u0434 70-\u0445: \u041f\u0440\u043e\u0445\u043e\u0440\u0430, \u041d\u0438\u043a\u0430\u043d\u043e\u0440\u0430, \u0422\u0438\u043c\u043e\u043d\u0430 \u0456 \u041f\u0430\u0440\u043c\u0435\u043d\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0456\u0432 (\u0406). \u000d\u000a\u041c\u0447\u0447. \u042e\u043b\u0456\u0430\u043d\u0430 (\u0406), \u0404\u0432\u0441\u0442\u0430\u0444\u0456\u044f (\u0431\u043b. 316) \u0442\u0430 \u0410\u043a\u0430\u043a\u0456\u044f (\u0431\u043b. 321). \u041f\u0440\u043f. \u0406\u043e\u0432\u0430 \u000d\u000a\u0423\u0433\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (1985).\u000d\u000a\u0421\u043c\u043e\u043b\u0435\u043d\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u041e\u0434\u0438\u0433\u0456\u0442\u0440\u0456\u044f\u00bb (\u00ab\u041f\u0440\u043e\u0432\u0456\u0434\u043d\u0438\u0446\u044f\u00bb, \u043f\u0440\u0438\u043d\u0435\u0441\u0435\u043d\u0430 \u0437 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044f \u0443 1046 \u0440\u043e\u0446\u0456).\u000d\u000a1 \u041a\u043e\u0440., 152 \u0437\u0430\u0447., XII, 12 \u2013 26. \u041c\u0444., 76 \u0437\u0430\u0447., XVIII, 18 \u2013 22; XIX, 1 \u2013 2, 13 \u2013 15.\u000d\u000a\u041c\u0447. \u041a\u0430\u043b\u0438\u043d\u0438\u043a\u0430 \u041a\u0456\u043b\u0456\u043a\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0406\u0406 \u2013 \u0406V). \u041c\u0446. \u0421\u0435\u0440\u0430\u0444\u0438\u043c\u0438, \u0434\u0456\u0432\u0438 (\u0406\u0406). \u041c\u0446. \u000d\u000a\u0424\u0435\u043e\u0434\u043e\u0442\u0456\u0457 \u0456 \u0442\u0440\u044c\u043e\u0445 \u0434\u0456\u0442\u0435\u0439 \u0457\u0457 (\u0431\u043b. 304). \u041f\u0440\u043c\u0447. \u041c\u0438\u0445\u0430\u0457\u043b\u0430 \u0415\u0434\u0435\u0441\u044c\u043a\u043e\u0433\u043e, \u0447\u0435\u043d\u0446\u044f \u000d\u000a(\u0406\u0425). \u041c\u0447. \u0404\u0432\u0441\u0442\u0430\u0444\u0456\u044f \u041c\u0446\u0445\u0435\u0442\u0441\u044c\u043a\u043e\u0433\u043e (589, \u0413\u0440\u0443\u0437.). \u041c\u0447. \u0414\u0430\u043d\u0438\u0457\u043b\u0430 (\u041a\u0443\u0448\u043d\u0456\u0440\u0430), \u041c\u043b\u0456\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1766).\u000d\u000a1 \u041a\u043e\u0440., 154 \u0437\u0430\u0447., XIII, 4 \u2013 XIV, 5. \u041c\u0444., 80 \u0437\u0430\u0447., XX, 1 \u2013 16.\u000d\u000a\u041f\u0435\u0440\u0435\u0434\u0441\u0432\u044f\u0442\u043e \u0432\u0438\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u0434\u0440\u0435\u0432 \u0447\u0435\u0441\u043d\u043e\u0433\u043e \u0456 \u0436\u0438\u0432\u043e\u0442\u0432\u043e\u0440\u0447\u043e\u0433\u043e \u0425\u0440\u0435\u0441\u0442\u0430 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e. \u041f\u0440\u0430\u0432. \u0419\u043e\u0441\u0438\u0444\u0430 \u0410\u0440\u0438\u043c\u0430\u0444\u0435\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406). \u041f\u0440\u0430\u0432. \u0404\u0432\u0434\u043e\u043a\u0438\u043c\u0430 \u041a\u0430\u043f\u0430\u0434\u043e\u043a\u0456\u0439\u0446\u044f (\u0406\u0425). \u041c\u0446. \u042e\u043b\u0438\u0442\u0438 \u041a\u0435\u0441\u0430\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (304 \u2013 305). \u000d\u000a1 \u041a\u043e\u0440., 157 \u0437\u0430\u0447., XIV, 26 \u2013 40. \u041c\u0444., 83 \u0437\u0430\u0447. (\u0434\u0440\u0443\u0433\u0435), XXI, 12 \u2013 14, 17 \u2013 20.\u000d\u000a\u041f\u0440\u0430\u0432.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30.\u000d\u000a\u0417\u0430\u0433\u043e\u0432\u0438\u043d\u0438 \u043d\u0430 \u0423\u0441\u043f\u0435\u043d\u0441\u044c\u043a\u0438\u0439 \u043f\u0456\u0441\u0442.\u000d\u000a\u0410\u043f\u043f. \u0432\u0456\u0434 70-\u0445: \u0421\u0438\u043b\u0438, \u0421\u0438\u043b\u0443\u0430\u043d\u0430, \u041a\u0440\u0438\u0441\u043a\u0435\u043d\u0442\u0430, \u0415\u043f\u0435\u043d\u0435\u0442\u0430 \u0456 \u0410\u043d\u0434\u0440\u043e\u043d\u0456\u043a\u0430 (\u0406). \u000d\u000a\u041c\u0447. \u0406\u043e\u0430\u043d\u0430 \u0412\u043e\u0457\u043d\u0430 (\u0406V). \u0421\u0449\u043c\u0447\u0447. \u041f\u043e\u043b\u0456\u0445\u0440\u043e\u043d\u0456\u044f, \u0454\u043f. \u0412\u0430\u0432\u0438\u043b\u043e\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u041f\u0430\u0440\u043c\u0435\u043d\u0456\u044f, \u0404\u043b\u0438\u043c\u0438 \u0456 \u0425\u0440\u0438\u0441\u043e\u0442\u0435\u043b\u044f, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0456\u0432, \u041b\u0443\u043a\u0438 \u0456 \u041c\u0443\u043a\u043e, \u0434\u0438\u044f\u043a\u043e\u043d\u0456\u0432, \u043c\u0447\u0447. \u0410\u0432\u0434\u043e\u043d\u0430 \u0456 \u0421\u0435\u043d\u0456\u0441\u0430, \u043a\u043d\u044f\u0437\u0456\u0432 \u041f\u0435\u0440\u0441\u044c\u043a\u0438\u0445, \u0442\u0430 \u041e\u043b\u0456\u043c\u043f\u0456\u044f \u0456 \u041c\u0430\u043a\u0441\u0438\u043c\u0430 (\u0431\u043b. 251). \u0421\u0449\u043c\u0447. \u000d\u000a\u0412\u0430\u043b\u0435\u043d\u0442\u0438\u043d\u0430 (\u0423\u0430\u043b\u0435\u043d\u0442\u0438\u043d\u0430), \u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0430 \u0406\u0442\u0430\u043b\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u0442\u0440\u044c\u043e\u0445 \u0443\u0447\u043d\u0456\u0432 \u0439\u043e\u0433\u043e \u2013 \u000d\u000a\u043c\u0447\u0447. \u041f\u0440\u043e\u043a\u0443\u043b\u0438, \u0404\u0444\u0438\u0432\u0430 \u0442\u0430 \u0410\u043f\u043e\u043b\u043b\u043e\u043d\u0456\u044f \u0456 \u043f\u0440\u0430\u0432. \u0410\u0432\u0443\u043d\u0434\u0456\u044f (\u0431\u043b. 273). \u041f\u0440\u043f. \u0410\u043d\u0433\u0435\u043b\u0456\u043d\u0438, \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u043a\u0438 \u0421\u0435\u0440\u0431\u0441\u044c\u043a\u043e\u0457 (1520)\u000d\u000a1 \u041a\u043e\u0440., 155 \u0437\u0430\u0447., XIV, 6 \u2013 19. \u041c\u0444., 81 \u0437\u0430\u0447., XX, 17 \u2013 28.\u000d\u000a\u041c\u0447.: \u0420\u0438\u043c., 116 \u0437\u0430\u0447., XV, 1 \u2013 7. \u041c\u0444., 69 \u0437\u0430\u0447., \u0425V\u0406, 24 \u2013 28.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a26\u000d\u000a27\u000d\u000a28\u000d\u000a29\u000d\u000a31\u000d\u000a30","53\u000d\u000a\u0412\u0438\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u0447\u0435\u0441\u043d\u0438\u0445 \u0434\u0440\u0435\u0432 \u0436\u0438\u0432\u043e\u0442\u0432\u043e\u0440\u0447\u043e\u0433\u043e \u0425\u0440\u0435\u0441\u0442\u0430 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e. \u000d\u000a\u0421\u0456\u043c\u043e\u0445 \u043c\u0447\u0447. \u041c\u0430\u043a\u043a\u0430\u0432\u0435\u0454\u0432\u0438\u0445: \u0410\u0432\u0438\u043c\u0430, \u0410\u043d\u0442\u043e\u043d\u0456\u043d\u0430, \u0413\u0443\u0440\u0456\u044f, \u0404\u043b\u0435\u0430\u0437\u0430\u0440\u0430, \u000d\u000a\u0404\u0432\u0441\u0435\u0432\u043e\u043d\u0430, \u0410\u043b\u0456\u043c\u0430 \u0456 \u041c\u0430\u0440\u043a\u0435\u043b\u0430, \u043c\u0430\u0442\u0435\u0440\u0456 \u0457\u0445\u043d\u044c\u043e\u0457 \u043c\u0446. \u0421\u043e\u043b\u043e\u043c\u043e\u043d\u0456\u0457 \u0442\u0430 \u000d\u000a\u0432\u0447\u0438\u0442\u0435\u043b\u044f \u0457\u0445\u043d\u044c\u043e\u0433\u043e \u043c\u0447. \u0404\u043b\u0435\u0430\u0437\u0430\u0440\u0430 (166 \u0440. \u0434\u043e \u0420. \u0425.). \u041c\u0447\u0447. \u0432 \u041f\u0435\u0440\u0433\u0456\u0457 \u000d\u000a\u041f\u0430\u043c\u0444\u0456\u043b\u0456\u0439\u0441\u044c\u043a\u0456\u0439: \u041b\u0435\u043e\u043d\u0442\u0456\u044f, \u0410\u0442\u0456\u044f, \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430, \u041a\u0438\u043d\u0434\u0435\u044f, \u041c\u0438\u043d\u0441\u0438\u0444\u0435\u044f, \u041a\u0438\u0440\u0456\u0430\u043a\u0430, \u041c\u0438\u043d\u0435\u043e\u043d\u0430, \u041a\u0430\u0442\u0443\u043d\u0430 \u0456 \u0415\u0432\u043a\u043b\u0435\u044f (\u0406\u0406\u0406).\u000d\u000a\u0425\u0440\u0435\u0441\u0442\u0430: 1 \u041a\u043e\u0440., 125 \u0437\u0430\u0447., I, 18 \u2013 24. \u0406\u043d., 60 \u0437\u0430\u0447., XIX, 6 \u2013 11, 13 \u2013 20, \u000d\u000a25 \u2013 28, 30 \u2013 35.\u000d\u000a\u0420\u044f\u0434. (\u043f\u0456\u0434 \u0437\u0430\u0447\u0430\u043b\u043e): \u0420\u0438\u043c., 113 \u0437\u0430\u0447., XIV, 6 \u2013 9. \u041c\u0444., 64 \u0437\u0430\u0447., XV, 32 \u2013 39.\u000d\u000a\u041c\u0447\u0447.: \u0404\u0432\u0440., 330 \u0437\u0430\u0447., XI, 33 \u2013 XII, 2. \u041c\u0444., 38 \u0437\u0430\u0447., X, 32 \u2013 36; XI, 1.\u000d\u000a\u041d\u0430 \u0432\u043e\u0434\u043e\u0441\u0432\u044f\u0442\u0442\u0456: \u0404\u0432\u0440., 306 \u0437\u0430\u0447., II, 11 \u2013 18. \u0406\u043d., 14 \u0437\u0430\u0447., V, 1 \u2013 4.\u000d\u000a\u041f\u043e\u0447\u0430\u0442\u043e\u043a \u0423\u0441\u043f\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f \u00ab\u0425\u0440\u0435\u0441\u0442 \u043d\u0430\u043a\u0440\u0435\u0441\u043b\u0438\u0432 \u041c\u043e\u0439\u0441\u0435\u0439...\u00bb, \u043f\u0456\u0441\u043b\u044f \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u000d\u000a\u0441\u043b\u0430\u0432\u043e\u0441\u043b\u0456\u0432\u2019\u044f \u0432\u0438\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u0425\u0440\u0435\u0441\u0442\u0430 \u0442\u0430 \u043f\u043e\u043a\u043b\u043e\u043d\u0456\u043d\u043d\u044f \u0439\u043e\u043c\u0443 \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0425\u0440\u0435\u0441\u0442\u043e\u043f\u043e\u043a\u043b\u043e\u043d\u043d\u043e\u0457 \u043d\u0435\u0434\u0456\u043b\u0456. \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0442\u0440\u0438\u0441\u0432\u044f\u0442\u0435. \u041f\u0456\u0441\u043b\u044f \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u000d\u000a\u0441\u043b\u0443\u0436\u0438\u043c\u043e \u043c\u0430\u043b\u0435 \u043e\u0441\u0432\u044f\u0447\u0435\u043d\u043d\u044f \u0432\u043e\u0434\u0438. \u0425\u0440\u0435\u0441\u0442 \u0437\u0430\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u0443 \u0432\u0456\u0432\u0442\u0430\u0440 \u0443\u0432\u0435\u0447\u0435\u0440\u0456 \u000d\u000a\u043f\u0456\u0441\u043b\u044f \u0432\u0456\u0434\u043f\u0443\u0441\u0442\u0443 \u0432\u0435\u0447\u0456\u0440\u043d\u0456.\u000d\u000a\u0417 \u0446\u044c\u043e\u0433\u043e \u0434\u043d\u044f \u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0412\u043e\u0437\u0434\u0432\u0438\u0436\u0435\u043d\u043d\u044f \u043d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439, \u043a\u043e\u043b\u0438 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u000d\u000a\u0441\u043b\u0430\u0432\u043e\u0441\u043b\u0456\u0432\u2019\u044f, \u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f \u00ab\u0425\u0440\u0435\u0441\u0442 \u043d\u0430\u043a\u0440\u0435\u0441\u043b\u0438\u0432 \u041c\u043e\u0439\u0441\u0435\u0439...\u00bb. \u0417\u0430 \u0432\u0438\u043d\u044f\u0442\u043a\u043e\u043c \u000d\u000a\u043f\u0456\u0441\u043b\u044f\u0441\u0432\u044f\u0442\u0430 \u041f\u0440\u0435\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u043d\u044f \u2013 \u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f \u041f\u0440\u0435\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u043d\u044f: \u00ab\u0417\u0456\u0431\u0440\u0430\u043d\u043d\u044f \u0456\u0437\u0440\u0430\u0457\u043b\u044c\u0442\u044f\u043d\u2026\u00bb, \u0430 \u0432 \u043f\u0435\u0440\u0456\u043e\u0434 \u043f\u0435\u0440\u0435\u0434\u0441\u0432\u044f\u0442\u0430 \u0423\u0441\u043f\u0456\u043d\u043d\u044f, \u043d\u0430 \u0441\u0432\u044f\u0442\u043e \u0423\u0441\u043f\u0456\u043d\u043d\u044f \u0456 \u0432 \u0434\u043d\u0456 \u000d\u000a\u043f\u0456\u0441\u043b\u044f\u0441\u0432\u044f\u0442\u0430 \u0456 \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0423\u0441\u043f\u0456\u043d\u043d\u044f \u2013 \u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f \u0423\u0441\u043f\u0456\u043d\u043d\u044f: \u00ab\u041f\u0440\u0438\u043a\u0440\u0430\u0448\u0435\u043d\u0430 \u0431\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u044e \u0441\u043b\u0430\u0432\u043e\u044e\u2026\u00bb.\u000d\u000a1\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a9-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 8-\u0439.\u000d\u000a\u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u0437 \u0404\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0430 \u0434\u043e \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044f \u043c\u043e\u0449\u0456\u0432 \u043f\u0435\u0440\u0448\u043e\u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430 \u0430\u0440\u0445\u0456\u0434\u0438\u044f\u043a. \u0421\u0442\u0435\u0444\u0430\u043d\u0430 (\u0431\u043b. 428) \u0456 \u0437\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u043f\u0440\u0430\u0432\u0432. \u041d\u0438\u043a\u043e\u0434\u0438\u043c\u0430, \u000d\u000a\u0413\u0430\u043c\u0430\u043b\u0456\u0457\u043b\u0430 \u0456 \u0441\u0438\u043d\u0430 \u0439\u043e\u0433\u043e \u0410\u0432\u0456\u0432\u0430. \u0421\u0449\u043c\u0447. \u0421\u0442\u0435\u0444\u0430\u043d\u0430, \u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0430 \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e, \u0442\u0430 \u000d\u000a\u0456\u043d\u0448\u0438\u0445 \u0437 \u043d\u0438\u043c (257).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 9-\u0435, \u0406\u043d., 65 \u0437\u0430\u0447., XX, 19 \u2013 31.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u041a\u043e\u0440., 128 \u0437\u0430\u0447., III, 9 \u2013 17. \u041c\u0444., 59 \u0437\u0430\u0447., XIV, 22 \u2013 34.\u000d\u000a\u041f\u0435\u0440\u0448\u043e\u043c\u0447.: \u0414\u0456\u044f\u043d., 17 \u0437\u0430\u0447., VI, 8 \u2013 15; VII, 1\u20135, 47 \u2013 60. \u041c\u0444., 87 \u0437\u0430\u0447., XXI, \u000d\u000a33 \u2013 42.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a2\u000d\u000a10-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u041f\u0440\u0430\u0432. \u0421\u043e\u043b\u043e\u043c\u0456\u0457, \u043c\u0438\u0440\u043e\u043d\u043e\u0441\u0438\u0446\u0456 (\u0406). \u041f\u0440\u043f\u043f. \u0406\u0441\u0430\u0430\u043a\u0456\u044f, \u0414\u0430\u043b\u043c\u0430\u0442\u0430 \u0456 \u0424\u0430\u0432\u0441\u0442\u0430 (\u0406V \u2013 V). \u041c\u0447. \u0420\u0430\u0436\u0434\u0435\u043d\u0430, \u043f\u0435\u0440\u0441\u0430 \u000d\u000a(457, \u0413\u0440\u0443\u0437.). \u041f\u0440\u043f. \u041a\u043e\u0441\u043c\u0438, \u043f\u0443\u0441\u0442\u0435\u043b\u044c\u043d\u0438\u043a\u0430 (V\u0406). \u000d\u000a1 \u041a\u043e\u0440., 159 \u0437\u0430\u0447., XV, 12 \u2013 19. \u041c\u0444., 84 \u0437\u0430\u0447., XXI, 18 \u2013 22.\u000d\u000a\u0421\u0456\u043c\u043e\u0445 \u043e\u0442\u0440\u043e\u043a\u0456\u0432 \u0443 \u0415\u0444\u0435\u0441\u0456: \u041c\u0430\u043a\u0441\u0438\u043c\u0456\u043b\u0456\u0430\u043d\u0430, \u042f\u043c\u0432\u043b\u0438\u0445\u0430, \u041c\u0430\u0440\u0442\u0438\u043d\u0456\u0430\u043d\u0430, \u0406\u043e\u0430\u043d\u0430, \u0414\u0456\u043e\u043d\u0456\u0441\u0456\u044f, \u0415\u043a\u0441\u0430\u043a\u0443\u0441\u0442\u043e\u0434\u0456\u0430\u043d\u0430 (\u041a\u043e\u0441\u0442\u044f\u043d\u0442\u0438\u043d\u0430) \u0442\u0430 \u0410\u043d\u0442\u043e\u043d\u0456\u043d\u0430 (\u0431\u043b. 250; \u000d\u000a408 \u2013 450). \u041f\u0440\u043c\u0446. \u0404\u0432\u0434\u043e\u043a\u0456\u0457 (362 \u2013 364). \u041c\u0447. \u0404\u043b\u0435\u0432\u0444\u0435\u0440\u0456\u044f (\u0406V).\u000d\u000a1 \u041a\u043e\u0440., 161 \u0437\u0430\u0447., XV, 29 \u2013 38. \u041c\u0444., 85 \u0437\u0430\u0447., XXI, 23 \u2013 27.\u000d\u000a3\u000d\u000a4\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a","54\u000d\u000a\u041f\u0435\u0440\u0435\u0434\u0441\u0432\u044f\u0442\u043e \u041f\u0440\u0435\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u043d\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e. \u041c\u0447. \u0404\u0432\u0441\u0438\u0433\u043d\u0456\u044f \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (362). \u0421\u0449\u043c\u0447\u0447. \u0410\u043d\u0444\u0456\u0440\u0430 (236) \u0456 \u0424\u0430\u0431\u0456\u0430\u043d\u0430 (250), \u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0456\u0432 \u0420\u0438\u043c\u0441\u044c\u043a\u0438\u0445. \u041c\u0447. \u041f\u043e\u043d\u0442\u0456\u044f \u0420\u0438\u043c\u043b\u044f\u043d\u0438\u043d\u0430 (\u0431\u043b. 257). \u041c\u0447\u0447. \u041a\u0430\u043d\u0442\u0438\u0434\u0456\u044f, \u041a\u0430\u043d\u0442\u0438\u0434\u0456\u0430\u043d\u0430 \u000d\u000a\u0456 \u0421\u0438\u0432\u0435\u043b\u0430, \u0432 \u0404\u0433\u0438\u043f\u0442\u0456. \u041f\u0440\u0430\u0432. \u041d\u043e\u043d\u043d\u0438, \u0434\u0438\u044f\u043a\u043e\u043d\u0438\u0441\u0438, \u043c\u0430\u0442\u0435\u0440\u0456 \u0441\u0432\u0442. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f \u000d\u000a\u0411\u043e\u0433\u043e\u0441\u043b\u043e\u0432\u0430 (374). \u041f\u0440\u043f. \u0424\u0435\u043e\u043a\u0442\u0438\u0441\u0442\u0430 \u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0454\u043f. \u0427\u0435\u0440\u043d\u0456\u0433\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1123).\u000d\u000a1 \u041a\u043e\u0440., 165 \u0437\u0430\u0447., XVI, 4 \u2013 12. \u041c\u0444., 86 \u0437\u0430\u0447., XXI, 28 \u2013 32 (\u0437\u0430 \u0441\u0435\u0440\u0435\u0434\u0443).\u000d\u000a2 \u041a\u043e\u0440., 167 \u0437\u0430\u0447., I, 1 \u2013 7. \u041c\u0444., 88 \u0437\u0430\u0447., XXI, 43 \u2013 46 (\u0437\u0430 \u0447\u0435\u0442\u0432\u0435\u0440).\u000d\u000a\u041f\u0456\u0441\u043b\u044f\u0441\u0432\u044f\u0442\u043e \u041f\u0440\u0435\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u043d\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e. \u041f\u0440\u043c\u0447\u0447. \u0414\u043e\u043c\u0435\u0442\u0456\u044f \u041f\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0456\u0454\u0440\u043e\u0434\u0438\u044f\u043a. \u0442\u0430 \u0434\u0432\u043e\u0445 \u0443\u0447\u043d\u0456\u0432 \u0439\u043e\u0433\u043e (363). \u041f\u0440\u043f. \u041f\u0438\u043c\u0435\u043d\u0430 \u0411\u0430\u0433\u0430\u0442\u043e\u0445\u0432\u043e\u0440\u043e\u0431\u043b\u0438\u0432\u043e\u0433\u043e, \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (1110). \u000d\u000a\u041f\u0440\u043f. \u041f\u0438\u043c\u0435\u043d\u0430, \u043f\u043e\u0441\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406 \u2013 \u0425\u0406V). \u041f\u0440\u043f. \u041c\u0435\u0440\u043a\u0443\u0440\u0456\u044f \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0454\u043f. \u0421\u043c\u043e\u043b\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (1239). \u041c\u0447\u0447. \u041c\u0430\u0440\u0438\u043d\u0430 \u0456 \u0410\u0441\u0442\u0435\u0440\u0456\u044f \u000d\u000a(260). \u041f\u0440\u043f. \u041e\u0440\u0430 \u0424\u0456\u0432\u0430\u0457\u0434\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 390). \u041f\u0440\u043c\u0446. \u041f\u043e\u0442\u0430\u043c\u0456\u0457, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0438\u0446\u0456. \u000d\u000a\u041f\u0440\u043f. \u0424\u0435\u043e\u0434\u043e\u0441\u0456\u044f \u041d\u043e\u0432\u043e\u0433\u043e, \u043b\u0456\u043a\u0430\u0440\u044f (IX\u2013X). \u0421\u0432\u0442. \u0406\u0454\u0440\u043e\u0444\u0435\u044f, \u0454\u043f. \u0423\u0433\u043e\u0440\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(X). \u0421\u0432. \u0421\u0442\u0435\u0444\u0430\u043d\u0430 I, \u043a\u043e\u0440\u043e\u043b\u044f \u0423\u0433\u043e\u0440\u0449\u0438\u043d\u0438 (1038). \u041f\u0440\u043f. \u0424\u0435\u043e\u0434\u043e\u0440\u0438 \u0421\u0438\u0445\u043b\u0456\u0432\u0441\u044c\u043a\u043e\u0457 (XVIII, \u0420\u0443\u043c.).\u000d\u000a2 \u041a\u043e\u0440., 169 \u0437\u0430\u0447., I, 12 \u2013 20. \u041c\u0444., 91 \u0437\u0430\u0447., XXII, 23 \u2013 33.\u000d\u000a\u041f\u0440\u043c\u0447\u0447.: \u0415\u0444., 233 \u0437\u0430\u0447., VI, 10 \u2013 17. \u0406\u043d., 52 \u0437\u0430\u0447., XV, 17 \u2013 XVI, 2.\u000d\u000a\u0417 \u0446\u044c\u043e\u0433\u043e \u0434\u043d\u044f \u043d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0432 \u0431\u0443\u0434\u043d\u0456 \u0434\u043d\u0456, \u043f\u0456\u0441\u043b\u044f \u0432\u0445\u043e\u0434\u0443, \u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0430 \u000d\u000a\u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f: \u00ab\u041f\u0440\u0438\u0439\u0434\u0456\u0442\u044c, \u043f\u043e\u043a\u043b\u043e\u043d\u0456\u043c\u043e\u0441\u044c\u2026\u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, \u0449\u043e \u000d\u000a\u043f\u0440\u0435\u043e\u0431\u0440\u0430\u0437\u0438\u0432\u0441\u044f \u043d\u0430 \u0433\u043e\u0440\u0456\u2026\u00bb.\u000d\u000a5\u000d\u000a7\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u041f\u0420\u0415\u041e\u0411\u0420\u0410\u0416\u0415\u041d\u041d\u042f \u0413\u041e\u0421\u041f\u041e\u0414\u0410 \u0411\u041e\u0413\u0410 \u0406 \u0421\u041f\u0410\u0421\u0418\u0422\u0415\u041b\u042f \u041d\u0410\u0428\u041e\u0413\u041e \u0406\u0421\u0423\u0421\u0410 \u000d\u000a\u0425\u0420\u0418\u0421\u0422\u0410.\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 45 \u0437\u0430\u0447., IX, 28 \u2013 36.\u000d\u000a\u041b\u0456\u0442. \u2013 2 \u041f\u0435\u0442., 65 \u0437\u0430\u0447., I, 10 \u2013 19. \u041c\u0444., 70 \u0437\u0430\u0447., XVII, 1 \u2013 9.\u000d\u000a\u041d\u0430 \u0442\u0440\u0430\u043f\u0435\u0437\u0456 \u0434\u043e\u0437\u0432\u043e\u043b\u044f\u0454\u0442\u044c\u0441\u044f \u0440\u0438\u0431\u0430.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0422\u0435\u0431\u0435, \u0416\u0438\u0442\u0442\u0454\u0434\u0430\u0432\u0447\u0435 \u0425\u0440\u0438\u0441\u0442\u0435, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u043f\u0440\u0435\u0447\u0438\u0441\u0442\u043e\u0457 \u0422\u0432\u043e\u0454\u0457 \u041f\u043b\u043e\u0442\u0456 \u043f\u0440\u0435\u0441\u043b\u0430\u0432\u043d\u0435 \u043f\u0440\u0435\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u043d\u044f\u00bb. \u041d\u0430 \u043a\u0430\u043d\u043e\u043d\u0456 \u000d\u000a\u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f \u00ab\u0425\u0440\u0435\u0441\u0442 \u043d\u0430\u043a\u0440\u0435\u0441\u043b\u0438\u0432 \u041c\u043e\u0439\u0441\u0435\u0439...\u00bb. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0427\u0435\u0441\u043d\u0456\u0448\u0443...\u00bb \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u043f\u0440\u0438\u0441\u043f\u0456\u0432\u0438 \u0441\u0432\u044f\u0442\u0430 \u2013 1-\u0439 \u043f\u0440\u0438\u0441\u043f\u0456\u0432 \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0439, \u0434\u0443\u0448\u0435 \u043c\u043e\u044f, \u0413\u043e\u0441\u043f\u043e\u0434\u0430, \u042f\u043a\u0438\u0439 \u043f\u0440\u0435\u043e\u0431\u0440\u0430\u0437\u0438\u0432\u0441\u044f \u043d\u0430 \u0424\u0430\u0432\u043e\u0440\u0456\u00bb. \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u2013 \u0430\u043d\u0442\u0438\u0444\u043e\u043d\u0438 \u0441\u0432\u044f\u0442\u0430.\u000d\u000a\u0412\u0445\u0456\u0434\u043d\u0438\u0439 \u0441\u0442\u0438\u0445: \u00ab\u0413\u043e\u0441\u043f\u043e\u0434\u0438, \u043f\u043e\u0448\u043b\u0438 \u0441\u0432\u0456\u0442\u043b\u043e \u0422\u0432\u043e\u0454 \u0439 \u0456\u0441\u0442\u0438\u043d\u0443 \u0422\u0432\u043e\u044e, \u000d\u000a\u043d\u0435\u0445\u0430\u0439 \u0432\u043e\u043d\u0438 \u0432\u0435\u0434\u0443\u0442\u044c \u043c\u0435\u043d\u0435 \u0456 \u0432\u0438\u0432\u0435\u0434\u0443\u0442\u044c \u043d\u0430 \u0441\u0432\u044f\u0442\u0443 \u0433\u043e\u0440\u0443 \u0422\u0432\u043e\u044e\u00bb. \u041f\u0456\u0441\u043b\u044f \u0432\u0445\u0456\u0434\u043d\u043e\u0433\u043e \u0441\u0442\u0438\u0445\u0430 \u0432\u0456\u0434\u0440\u0430\u0437\u0443 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0442\u0440\u043e\u043f\u0430\u0440 \u0441\u0432\u044f\u0442\u0430, \u00ab\u0421\u043b\u0430\u0432\u0430 \u0456 \u043d\u0438\u043d\u0456\u00bb \u000d\u000a\u2013 \u043a\u043e\u043d\u0434\u0430\u043a \u0441\u0432\u044f\u0442\u0430, \u0430 \u043d\u0430 \u0430\u0440\u0445\u0456\u0454\u0440\u0435\u0439\u0441\u044c\u043a\u0456\u0439 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u043f\u0456\u0441\u043b\u044f \u0432\u0445\u0456\u0434\u043d\u043e\u0433\u043e \u0441\u0442\u0438\u0445\u0430 \u000d\u000a\u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f: \u00ab\u041f\u0440\u0438\u0439\u0434\u0456\u0442\u044c, \u043f\u043e\u043a\u043b\u043e\u043d\u0456\u043c\u043e\u0441\u044c\u2026 \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, \u0449\u043e \u000d\u000a\u043f\u0440\u0435\u043e\u0431\u0440\u0430\u0437\u0438\u0432\u0441\u044f \u043d\u0430 \u0433\u043e\u0440\u0456\u2026\u00bb, \u0430 \u0442\u043e\u0434\u0456 \u0442\u0440\u043e\u043f\u0430\u0440 \u0456 \u043a\u043e\u043d\u0434\u0430\u043a. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0414\u043e\u0441\u0442\u043e\u0439\u043d\u043e \u0454\u2026\u00bb \u2013 \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0439, \u0434\u0443\u0448\u0435 \u043c\u043e\u044f...\u00bb, \u00ab\u0420\u0456\u0437\u0434\u0432\u043e \u0422\u0432\u043e\u0454 \u043d\u0435\u0442\u043b\u0456\u043d\u043d\u0435 \u044f\u0432\u0438\u043b\u043e\u0441\u044f...\u00bb \u000d\u000a(\u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f). \u041f\u0456\u0441\u043b\u044f \u0437\u0430\u043a\u0456\u043d\u0447\u0435\u043d\u043d\u044f \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0437\u0434\u0456\u0439\u0441\u043d\u044e\u0454\u0442\u044c\u0441\u044f \u043e\u0441\u0432\u044f\u0447\u0435\u043d\u043d\u044f \u000d\u000a\u0432\u0438\u043d\u043e\u0433\u0440\u0430\u0434\u0443 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 \u043f\u043b\u043e\u0434\u0456\u0432. \u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a6","55\u000d\u000a\u0421\u0432\u0442. \u0415\u043c\u0456\u043b\u0456\u0430\u043d\u0430, \u0441\u043f\u043e\u0432., \u0454\u043f. \u041a\u0438\u0437\u0438\u0446\u044c\u043a\u043e\u0433\u043e (815 \u2013 820). \u041f\u0440\u043f. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f, \u000d\u000a\u0456\u043a\u043e\u043d\u043e\u043f\u0438\u0441\u0446\u044f \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406).\u000d\u000a\u0421\u0432\u0442. \u041c\u0438\u0440\u043e\u043d\u0430, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f, \u0454\u043f. \u041a\u0440\u0438\u0442\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 350). \u041c\u0447\u0447. \u0404\u043b\u0435\u0432\u0444\u0435\u0440\u0456\u044f \u000d\u000a\u0442\u0430 \u041b\u0435\u043e\u043d\u0456\u0434\u0430. \u041f\u0440\u043f. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f \u0421\u0438\u043d\u0430\u0457\u0442\u0430 (\u0425\u0406V).\u000d\u000a\u0420\u0438\u043c., 119 \u0437\u0430\u0447., XV, 30 \u2013 33. \u041c\u0444., 73 \u0437\u0430\u0447., XVII, 24 \u2013 XVIII, 4.\u000d\u000a11-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0421\u0449\u043c\u0447\u0447. \u041b\u0430\u0432\u0440\u0435\u043d\u0442\u0456\u044f, \u0430\u0440\u0445\u0456\u0434\u0438\u044f\u043a\u043e\u043d\u0430, \u0421\u0438\u043a\u0441\u0442\u0430 \u0406\u0406, \u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0430, \u0424\u0435\u043b\u0456\u043a\u0438\u0441\u0438\u043c\u0430 \u0439 \u0410\u0433\u0430\u043f\u0456\u0442\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0456\u0432, \u043c\u0447. \u0420\u043e\u043c\u0430\u043d\u0430, \u0420\u0438\u043c\u0441\u044c\u043a\u0438\u0445 (258).\u000d\u000a2 \u041a\u043e\u0440., 171 \u0437\u0430\u0447., II, 3 \u2013 15. \u041c\u0444., 94 \u0437\u0430\u0447., XXIII, 13 \u2013 22.\u000d\u000a\u0421\u0449\u043c\u0447. \u0404\u0432\u043f\u043b\u0430, \u0430\u0440\u0445\u0456\u0434\u0438\u044f\u043a\u043e\u043d\u0430 (304). \u041f\u0440\u043c\u0447\u0447. \u0424\u0435\u0434\u043e\u0440\u0430 \u0456 \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u0438\u0445, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (1098). \u041f\u0440\u043f. \u0424\u0435\u0434\u043e\u0440\u0430, \u000d\u000a\u043a\u043d. \u041e\u0441\u0442\u0440\u043e\u0437\u044c\u043a\u043e\u0433\u043e, \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 \u000d\u000a(\u0431\u043b. 1438). \u041c\u0446. \u0421\u0443\u0441\u0430\u043d\u043d\u0438, \u0434\u0456\u0432\u0438, \u0456 \u0437 \u043d\u0435\u044e \u0441\u0449\u043c\u0447\u0447. \u0413\u0430\u044f, \u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0430 \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e, \u0413\u0430\u0432\u0438\u043d\u0456\u044f, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u043c\u0447\u0447. \u041a\u043b\u0430\u0432\u0434\u0456\u044f, \u041c\u0430\u043a\u0441\u0438\u043c\u0430, \u041f\u0440\u0435\u043f\u0435\u0434\u0438\u0433\u043d\u0438, \u000d\u000a\u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u0456 \u041a\u0443\u0444\u0456\u044f (295 \u2013 296).\u000d\u000a2 \u041a\u043e\u0440., 172 \u0437\u0430\u0447., II, 14 \u2013 III, 3. \u041c\u0444., 95 \u0437\u0430\u0447., XXIII, 23 \u2013 28.\u000d\u000a\u041c\u0447\u0447. \u0424\u043e\u0442\u0456\u044f \u0439 \u0410\u043d\u0438\u043a\u0438\u0442\u0438 \u0442\u0430 \u0431\u0430\u0433\u0430\u0442\u044c\u043e\u0445 \u0456\u0437 \u043d\u0438\u043c\u0438 (305 \u2013 306). \u0421\u0449\u043c\u0447. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430, \u0454\u043f. \u041a\u043e\u043c\u0430\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0406\u0406). \u041c\u0447\u0447. \u041f\u0430\u043c\u0444\u0456\u043b\u0430 \u0439 \u041a\u0430\u043f\u0456\u0442\u043e\u043d\u0430.\u000d\u000a2 \u041a\u043e\u0440., 173 \u0437\u0430\u0447., III, 4 \u2013 11. \u041c\u0444., 96 \u0437\u0430\u0447., XXIII, 29 \u2013 39.\u000d\u000a\u0412\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0430 \u041f\u0440\u0435\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u043d\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e. \u041f\u0440\u043f. \u041c\u0430\u043a\u0441\u0438\u043c\u0430 \u000d\u000a\u0421\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u043a\u0430 (662). \u041c\u0447\u0447. \u0406\u043f\u043e\u043b\u0438\u0442\u0430, \u0406\u0440\u0438\u043d\u0435\u044f, \u0410\u0432\u0443\u043d\u0434\u0456\u044f \u0456 \u043c\u0446. \u041a\u043e\u043d\u043a\u043e\u0440\u0434\u0456\u0457 \u0432 \u000d\u000a\u0420\u0438\u043c\u0456 (258).\u000d\u000a2 \u041a\u043e\u0440., 175 \u0437\u0430\u0447., IV, 1 \u2013 6. \u041c\u0444., 99 \u0437\u0430\u0447., XXIV, 13 \u2013 28.\u000d\u000a\u041f\u0435\u0440\u0435\u0434\u0441\u0432\u044f\u0442\u043e \u0423\u0441\u043f\u0456\u043d\u043d\u044f \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456. \u041f\u0440\u043e\u0440. \u041c\u0438\u0445\u0435\u044f (V\u0406\u0406\u0406 \u0441\u0442. \u0434\u043e \u000d\u000a\u0420. \u0425.). \u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u043f\u0440\u043f. \u0424\u0435\u043e\u0434\u043e\u0441\u0456\u044f \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e (1091). \u0421\u0449\u043c\u0447. \u041c\u0430\u0440\u043a\u0435\u043b\u0430, \u0454\u043f. \u0410\u043f\u0430\u043c\u0435\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 389).\u000d\u000a2 \u041a\u043e\u0440., 177 \u0437\u0430\u0447., IV, 13 \u2013 18. \u041c\u0444., 100 \u0437\u0430\u0447., XXIV, 27 \u2013 33, 42 \u2013 51 (\u0437\u0430 \u000d\u000a\u043f\u02bc\u044f\u0442\u043d\u0438\u0446\u044e).\u000d\u000a1 \u041a\u043e\u0440., 123 \u0437\u0430\u0447., I, 3 \u2013 9. \u041c\u0444., 78 \u0437\u0430\u0447., XIX, 3 \u2013 12 (\u0437\u0430 \u0441\u0443\u0431\u043e\u0442\u0443, \u043f\u0456\u0434 \u0437\u0430\u0447\u0430\u043b\u043e).\u000d\u000a\u041f\u0440\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a8\u000d\u000a10\u000d\u000a11\u000d\u000a12\u000d\u000a13\u000d\u000a14\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a10-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 1-\u0439.\u000d\u000a\u0410\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u041c\u0430\u0442\u0444\u0456\u044f (\u0431\u043b. 63). \u041c\u0447. \u0410\u043d\u0442\u043e\u043d\u0456\u044f \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e. \u000d\u000a\u041f\u0440\u043f. \u041f\u0441\u043e\u044f \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u041c\u0447\u0447. \u042e\u043b\u0456\u0430\u043d\u0430, \u041c\u0430\u0440\u043a\u0456\u0430\u043d\u0430, \u0406\u043e\u0430\u043d\u0430, \u042f\u043a\u043e\u0432\u0430, \u000d\u000a\u041e\u043b\u0435\u043a\u0441\u0456\u044f, \u0414\u0438\u043c\u0438\u0442\u0440\u0456\u044f, \u0424\u043e\u0442\u0456\u044f, \u041f\u0435\u0442\u0440\u0430, \u041b\u0435\u043e\u043d\u0442\u0456\u044f, \u041c\u0430\u0440\u0456\u0457, \u043f\u0430\u0442\u0440\u0438\u043a\u0456\u0457, \u0442\u0430 \u0456\u043d. (730).\u000d\u000a\u0421\u0432\u0442 \u0424\u0456\u043b\u0430\u0440\u0435\u0442\u0430, \u0430\u0440\u0445\u0456\u0454\u043f. \u0427\u0435\u0440\u043d\u0456\u0433\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u041d\u0456\u0436\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e (1866).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 10-\u0435, \u0406\u043d., 66 \u0437\u0430\u0447., XXI, 1 \u2013 14.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u041a\u043e\u0440., 131 \u0437\u0430\u0447., IV, 9 \u2013 16. \u041c\u0444., 72 \u0437\u0430\u0447., XVII, 14 \u2013 23.\u000d\u000a\u0410\u043f.: \u0414\u0456\u044f\u043d., 2 \u0437\u0430\u0447., I, 12\u201317, 21 \u2013 26. \u041b\u043a., 40 \u0437\u0430\u0447., IX, 1 \u2013 6.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a9","56\u000d\u000a\u0423\u0421\u041f\u0406\u041d\u041d\u042f \u041f\u0420\u0415\u0421\u0412\u042f\u0422\u041e\u0407 \u0412\u041b\u0410\u0414\u0418\u0427\u0418\u0426\u0406 \u041d\u0410\u0428\u041e\u0407 \u0411\u041e\u0413\u041e\u0420\u041e\u0414\u0418\u0426\u0406 \u0406 \u041f\u0420\u0418\u0421\u041d\u041e\u0414\u0406\u0412\u0418 \u041c\u0410\u0420\u0406\u0407.\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0423\u0441\u043f\u0456\u043d\u043d\u044f \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0457 (1073). \u0410\u0446\u043a\u0443\u0440\u0441\u044c\u043a\u043e\u0457 (\u0406), \u0426\u0438\u043b\u043a\u0430\u043d\u0441\u044c\u043a\u043e\u0457 (\u0406V), \u0412\u043b\u0430\u0445\u0435\u0440\u043d\u0441\u044c\u043a\u043e\u0457 (\u0413\u0440\u0443\u0437.), \u0411\u0430\u0445\u0447\u0438\u0441\u0430\u0440\u0430\u0439\u0441\u044c\u043a\u043e\u0457 \u000d\u000a\u0456\u043a\u043e\u043d \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456.\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 4 \u0437\u0430\u0447., I, 39 \u2013 49, 56.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456: \u0424\u043b\u043f., 240 \u0437\u0430\u0447., II, 5 \u2013 11. \u041b\u043a., 54 \u0437\u0430\u0447., X, 38 \u2013 42; \u000d\u000aXI, 27 \u2013 28.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0422\u0435\u0431\u0435, \u041f\u0440\u0435\u043d\u0435\u043f\u043e\u0440\u043e\u0447\u043d\u0430 \u041c\u0430\u0442\u0438 \u0425\u0440\u0438\u0441\u0442\u0430 \u000d\u000a\u0411\u043e\u0433\u0430 \u043d\u0430\u0448\u043e\u0433\u043e, \u0456 \u0432\u0441\u0435\u0441\u043b\u0430\u0432\u043d\u0435 \u0441\u043b\u0430\u0432\u0438\u043c\u043e \u0423\u0441\u043f\u0456\u043d\u043d\u044f \u0422\u0432\u043e\u0454\u00bb. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0427\u0435\u0441\u043d\u0456\u0448\u0443...\u00bb \u000d\u000a\u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u043f\u0440\u0438\u0441\u043f\u0456\u0432\u0438 \u0441\u0432\u044f\u0442\u0430. 1-\u0439 \u043f\u0440\u0438\u0441\u043f\u0456\u0432: \u00ab\u0410\u043d\u0433\u0435\u043b\u0438, \u0423\u0441\u043f\u0456\u043d\u043d\u044f \u041f\u0440\u0435\u0447\u0438\u0441\u0442\u043e\u0457 \u0431\u0430\u0447\u0438\u0432\u0448\u0438, \u0437\u0434\u0438\u0432\u0443\u0432\u0430\u043b\u0438\u0441\u044f: \u044f\u043a \u0414\u0456\u0432\u0430 \u0432\u043e\u0437\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u0432\u0456\u0434 \u0437\u0435\u043c\u043b\u0456 \u043d\u0430 \u043d\u0435\u0431\u043e\u00bb. \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0430\u043d\u0442\u0438\u0444\u043e\u043d\u0438 \u0441\u0432\u044f\u0442\u043a\u043e\u0432\u0456 (\u0434\u0438\u0432. \u0443 \u0434\u043e\u0434\u0430\u0442\u043a\u0443 \u0441. 88), \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0414\u043e\u0441\u0442\u043e\u0439\u043d\u043e \u0454\u2026\u00bb \u2013 \u000d\u000a\u00ab\u0410\u043d\u0433\u0435\u043b\u0438 \u0423\u0441\u043f\u0456\u043d\u043d\u044f\u2026\u00bb, \u00ab\u041f\u0435\u0440\u0435\u043c\u0430\u0433\u0430\u044e\u0442\u044c\u0441\u044f \u0437\u0430\u043a\u043e\u043d\u0438 \u043f\u0440\u0438\u0440\u043e\u0434\u0438...\u00bb (\u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f).\u000d\u000a\u0417 \u0446\u044c\u043e\u0433\u043e \u0434\u043d\u044f \u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0423\u0441\u043f\u0456\u043d\u043d\u044f \u043d\u0430 \u043b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u043f\u0456\u0441\u043b\u044f \u0432\u0445\u043e\u0434\u0443 \u0432 \u0441\u0435\u0434\u043c\u0438\u0447\u043d\u0456 \u0434\u043d\u0456 \u000d\u000a\u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f: \u00ab\u041f\u0440\u0438\u0439\u0434\u0456\u0442\u044c, \u043f\u043e\u043a\u043b\u043e\u043d\u0456\u043c\u043e\u0441\u044c... \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, \u043c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456...\u00bb.\u000d\u000a11-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 2-\u0439.\u000d\u000a\u041f\u0456\u0441\u043b\u044f\u0441\u0432\u044f\u0442\u043e \u0423\u0441\u043f\u0456\u043d\u043d\u044f. \u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u0437 \u0415\u0434\u0435\u0441\u0438 \u0434\u043e \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044f \u000d\u000a\u041d\u0435\u0440\u0443\u043a\u043e\u0442\u0432\u043e\u0440\u043d\u043e\u0433\u043e \u043e\u0431\u0440\u0430\u0437\u0430 (\u0443\u0431\u0440\u0443\u0441\u0430) \u0413\u043e\u0441\u043f\u043e\u0434\u0430 \u0406\u0441\u0443\u0441\u0430 \u0425\u0440\u0438\u0441\u0442\u0430 (944). \u000d\u000a\u041c\u0447. \u0414\u0456\u043e\u043c\u0438\u0434\u0430, \u043b\u0456\u043a\u0430\u0440\u044f (298). \u041c\u0447\u0447. 33-\u043e\u0445 \u043f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0441\u044c\u043a\u0438\u0445. \u041f\u0440\u043f. \u0425\u0435\u0440\u0438\u043c\u043e\u043d\u0430 \u000d\u000a\u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u041c\u0447. \u043a\u043d. \u041a\u043e\u0441\u0442\u044f\u043d\u0442\u0438\u043d\u0430 (1714, \u0420\u0443\u043c.). \u041f\u0440\u043f. \u0419\u043e\u0441\u0438\u0444\u0430 \u0406\u0441\u0438\u0445\u0430\u0441\u0442\u0430 (1959).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456, \u043d\u0430\u0437\u0432\u0430\u043d\u043e\u0457 \u00ab\u0414\u043e\u0434\u0430\u043d\u043d\u044f \u0440\u043e\u0437\u0443\u043c\u0443\u00bb (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 \u043f\u0435\u0440\u0448\u0443 \u043d\u0435\u0434\u0456\u043b\u044e \u043f\u0456\u0441\u043b\u044f 15 \u0441\u0435\u0440\u043f\u043d\u044f).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 11-\u0435, \u0406\u043d., 67 \u0437\u0430\u0447., XXI, 15 \u2013 25.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u041a\u043e\u0440., 141 \u0437\u0430\u0447., IX, 2 \u2013 12. \u041c\u0444., 77 \u0437\u0430\u0447., XVIII, 23 \u2013 35.\u000d\u000a\u041e\u0431\u0440\u0430\u0437\u0443: \u041a\u043e\u043b., 250 \u0437\u0430\u0447., I, 12 \u2013 18. \u041b\u043a., 48 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), IX, 51 \u2013 56; \u000d\u000aX, 22 \u2013 24. \u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a15\u000d\u000a16\u000d\u000a12-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0421\u0449\u043c\u0447. \u041c\u0438\u0440\u043e\u043d\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 \u000d\u000a(250). \u041f\u0440\u043f. \u0410\u043b\u0456\u043f\u0456\u044f, \u0456\u043a\u043e\u043d\u043e\u043f\u0438\u0441\u0446\u044f \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0431\u043b. 1114). \u041c\u0447. \u041f\u0430\u0432\u043b\u0430, \u043c\u0446. \u042e\u043b\u0456\u0430\u043d\u0456\u0457 \u0442\u0430 \u0456\u043d. (\u0431\u043b. 273). \u000d\u000a\u041c\u0447\u0447. \u0424\u0456\u0440\u0441\u0430, \u041b\u0435\u0432\u043a\u0456\u044f, \u041a\u043e\u0440\u043e\u043d\u0430\u0442\u0430 \u0456 \u0432\u043e\u0457\u043d\u0456\u0432 \u0457\u0445\u043d\u0456\u0445 (249 \u2013 251). \u041c\u0447. \u041f\u0430\u0442\u0440\u043e\u043a\u043b\u0430 \u000d\u000a(270 \u2013 275). \u041c\u0447\u0447. \u0421\u0442\u0440\u0430\u0442\u043e\u043d\u0430, \u0424\u0438\u043b\u0438\u043f\u0430, \u0404\u0432\u0442\u0438\u0445\u0456\u0430\u043d\u0430 \u0456 \u041a\u0438\u043f\u0440\u0456\u0430\u043d\u0430 (\u0431\u043b. 303).\u000d\u000a2 \u041a\u043e\u0440., 179 \u0437\u0430\u0447., V, 10 \u2013 15. \u041c\u043a., 2 \u0437\u0430\u0447., I, 9 \u2013 15.\u000d\u000a\u041c\u0447\u0447. \u0424\u043b\u043e\u0440\u0430 \u0456 \u041b\u0430\u0432\u0440\u0430 (\u0406\u0406). \u041c\u0447\u0447. \u0404\u0440\u043c\u0430, \u0421\u0435\u0440\u0430\u043f\u0456\u043e\u043d\u0430 \u0456 \u041f\u043e\u043b\u0456\u0454\u043d\u0430 (\u0406\u0406). \u0421\u0449\u043c\u0447\u0447. \u000d\u000a\u0415\u043c\u0456\u043b\u0456\u0430\u043d\u0430, \u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0430, \u0456 \u0437 \u043d\u0438\u043c \u0406\u043b\u0430\u0440\u0456\u043e\u043d\u0430, \u0456\u0454\u0440\u043e\u043c., \u043c\u0447\u0447. \u0414\u0456\u043e\u043d\u0456\u0441\u0456\u044f \u0456 \u0404\u0440\u043c\u0438\u043f\u0430 \u000d\u000a(\u0431\u043b. 300). \u0421\u0432\u0442\u0442. \u0406\u043e\u0430\u043d\u0430 (674) \u0442\u0430 \u0413\u0435\u043e\u0440\u0433\u0456\u044f (683), \u043f\u0430\u0442\u0440\u0456\u0430\u0440\u0445\u0456\u0432 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u0438\u0445. \u041f\u0440\u043f. \u041c\u0430\u043a\u0430\u0440\u0456\u044f, \u0456\u0433\u0443\u043c\u0435\u043d\u0430 \u041f\u0435\u043b\u0456\u043a\u0438\u0442\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 830). \u041f\u0440\u043f. \u000d\u000a\u0406\u043e\u0430\u043d\u0430 \u0420\u0438\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (946, \u0411\u043e\u043b\u0433.).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456, \u043d\u0430\u0437\u0432\u0430\u043d\u043e\u0457 \u00ab\u0412\u0441\u0435\u0446\u0430\u0440\u0438\u0446\u044f\u00bb (XVII). \u000d\u000a2 \u041a\u043e\u0440., 180 \u0437\u0430\u0447., V, 15 \u2013 21. \u041c\u043a., 3 \u0437\u0430\u0447., I, 16 \u2013 22.\u000d\u000a\u041c\u0447\u0447.: \u0415\u0444., 233 \u0437\u0430\u0447., VI, 10 \u2013 17. \u041b\u043a., 63 \u0437\u0430\u0447., XII, 2 \u2013 12.\u000d\u000a17\u000d\u000a18\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a","57\u000d\u000a\u041c\u0447. \u0410\u043d\u0434\u0440\u0456\u044f \u0421\u0442\u0440\u0430\u0442\u0438\u043b\u0430\u0442\u0430 \u0456 \u0437 \u043d\u0438\u043c 2593 \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0456\u0432 (284 \u2013 305). \u000d\u000a\u041c\u0447\u0447. \u0422\u0438\u043c\u043e\u0444\u0456\u044f, \u0410\u0433\u0430\u043f\u0456\u044f \u0456 \u043c\u0446. \u0424\u0435\u043a\u043b\u0438 (\u0431\u043b. 304).\u000d\u000a2 \u041a\u043e\u0440., 182 \u0437\u0430\u0447., VI, 11 \u2013 16. \u041c\u043a., 4 \u0437\u0430\u0447., I, 23 \u2013 28.\u000d\u000a\u041c\u0447.: \u0415\u0444., 233 \u0437\u0430\u0447., VI, 10 \u2013 17. \u041b\u043a., 106 \u0437\u0430\u0447., XXI, 12 \u2013 19.\u000d\u000a19\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u041f\u0440\u043e\u0440. \u0421\u0430\u043c\u0443\u0457\u043b\u0430 (\u0425\u0406 \u0441\u0442. \u0434\u043e \u0420. \u0425.). \u0421\u0449\u043c\u0447. \u0421\u0435\u0432\u0438\u0440\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 \u0456 \u043c\u0447. \u041c\u0435\u043c\u043d\u043e\u043d\u0430 \u0442\u0430 \u0437 \u043d\u0438\u043c\u0438 37 \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0456\u0432 (304).\u000d\u000a2 \u041a\u043e\u0440., 183 \u0437\u0430\u0447., VII, 1 \u2013 10. \u041c\u043a., 5 \u0437\u0430\u0447., I, 29 \u2013 35.\u000d\u000a\u0410\u043f. \u0432\u0456\u0434 70-\u0445 \u0424\u0430\u0434\u0435\u044f (\u0431\u043b. 44). \u041c\u0446. \u0412\u0430\u0441\u0441\u0438 \u0442\u0430 \u0457\u0457 \u0434\u0456\u0442\u0435\u0439: \u043c\u0447\u0447. \u0424\u0435\u043e\u0433\u043d\u0456\u044f, \u0410\u0433\u0430\u043f\u0456\u044f \u000d\u000a\u0456 \u041f\u0456\u0441\u0442\u0430 (305 \u2013 311). \u041f\u0440\u043f. \u0410\u0432\u0440\u0430\u0430\u043c\u0456\u044f \u041f\u0440\u0430\u0446\u0435\u043b\u044e\u0431\u043d\u043e\u0433\u043e, \u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406 \u2013 \u0425\u0406\u0406\u0406).\u000d\u000a2 \u041a\u043e\u0440., 184 \u0437\u0430\u0447., VII, 10 \u2013 16. \u041c\u043a., 9 \u0437\u0430\u0447., II, 18 \u2013 22.\u000d\u000a\u041c\u0447\u0447. \u0410\u0433\u0430\u0444\u043e\u043d\u0438\u043a\u0430, \u0417\u043e\u0442\u0438\u043a\u0430, \u0424\u0435\u043e\u043f\u0440\u0435\u043f\u0456\u044f (\u0411\u043e\u0433\u043e\u043b\u0456\u043f\u0430), \u0410\u043a\u0438\u043d\u0434\u0438\u043d\u0430, \u0421\u0435\u0432\u0435\u0440\u0456\u0430\u043d\u0430 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 (305 \u2013 311). \u0421\u0449\u043c\u0447. \u0410\u0444\u0430\u043d\u0430\u0441\u0456\u044f, \u0454\u043f. \u0422\u0430\u0440\u0441\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (270 \u2013 \u000d\u000a275), \u043f\u0440\u043f. \u0410\u043d\u0444\u0443\u0441\u0438 (\u0431\u043b. 298) \u0442\u0430 \u0457\u0457 \u0441\u043b\u0443\u0433: \u043c\u0447\u0447. \u0425\u0430\u0440\u0438\u0441\u0438\u043c\u0430 \u0456 \u041d\u0435\u043e\u0444\u0456\u0442\u0430 (270 \u000d\u000a\u2013 275). \u041c\u0446. \u0404\u0432\u043b\u0430\u043b\u0456\u0457, \u0434\u0456\u0432\u0438 (\u0431\u043b. 303). \u0421\u0449\u043c\u0447. \u0413\u043e\u0440\u0430\u0437\u0434\u0430, \u0454\u043f. \u0411\u043e\u0433\u0435\u043c\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u000d\u000a\u041c\u043e\u0440\u0430\u0432\u043e-\u0421\u0438\u043b\u0435\u0437\u044c\u043a\u043e\u0433\u043e (1942, \u0427\u0435\u0445.).\u000d\u000a\u0413\u0440\u0443\u0437\u0438\u043d\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (1650).\u000d\u000a1 \u041a\u043e\u0440., 125 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), I, 26 \u2013 29. \u041c\u0444., 82 \u0437\u0430\u0447., XX, 29 \u2013 34.\u000d\u000a13-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0421\u0449\u043c\u0447. \u0404\u0432\u0442\u0438\u0445\u0456\u044f, \u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0430, \u000d\u000a\u0443\u0447\u043d\u044f \u0430\u043f. \u0406\u043e\u0430\u043d\u0430 \u0411\u043e\u0433\u043e\u0441\u043b\u043e\u0432\u0430 (\u0406). \u041c\u0447. \u0422\u0430\u0442\u0456\u043e\u043d\u0430 (305). \u041c\u0446. \u0421\u0456\u0440\u0438, \u0434\u0456\u0432\u0438 \u041f\u0435\u0440\u0441\u044c\u043a\u043e\u0457 (558). \u041f\u0440\u043f. \u0413\u0435\u043e\u0440\u0433\u0456\u044f \u041b\u0438\u043c\u043d\u0456\u043e\u0442\u0430 (\u0431\u043b. 716). \u0420\u0456\u0432\u043d\u043e\u0430\u043f. \u043f\u0440\u043c\u0447. \u041a\u043e\u0441\u043c\u0438 \u000d\u000a\u0415\u0442\u043e\u043b\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0456\u0454\u0440\u043e\u043c. (1779).\u000d\u000a2 \u041a\u043e\u0440., 186 \u0437\u0430\u0447., VIII, 7 \u2013 15. \u041c\u043a., 11 \u0437\u0430\u0447., III, 6 \u2013 12.\u000d\u000a\u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u0430\u043f. \u0412\u0430\u0440\u0444\u043e\u043b\u043e\u043c\u0456\u044f (V\u0406). \u0410\u043f. \u0432\u0456\u0434 70-\u0445 \u0422\u0438\u0442\u0430, \u0454\u043f. \u041a\u0440\u0438\u0442\u0441\u044c\u043a\u043e\u0433\u043e (\u0406). \u0421\u0432\u0442\u0442. \u0412\u0430\u0440\u0441\u0438\u0441\u0430 \u0456 \u0404\u0432\u043b\u043e\u0433\u0456\u044f, \u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0456\u0432 \u0415\u0434\u0435\u0441\u044c\u043a\u0438\u0445, \u0456 \u041f\u0440\u043e\u0442\u043e\u0433\u0435\u043d\u0430, \u000d\u000a\u0454\u043f. \u041a\u0430\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0441\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u043a\u0430 (\u0406V). \u0421\u0432\u0442. \u041c\u0438\u043d\u0438, \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (536 \u2013 552).\u000d\u000a2 \u041a\u043e\u0440., 187 \u0437\u0430\u0447., VIII, 16 \u2013 IX, 5. \u041c\u043a., 12 \u0437\u0430\u0447., III, 13 \u2013 19.\u000d\u000a\u0410\u043f\u043f.: \u0422\u0438\u0442., 300 \u0437\u0430\u0447., I, 1 \u2013 4; II, 15 \u2013 III, 3, 12 \u2013 13, 15. \u041c\u0444., 11 \u0437\u0430\u0447., V, \u000d\u000a14 \u2013 19.\u000d\u000a20\u000d\u000a21\u000d\u000a22\u000d\u000a24\u000d\u000a25\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a12-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 3-\u0439.\u000d\u000a\u0412\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0430 \u0423\u0441\u043f\u0456\u043d\u043d\u044f \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456. \u0421\u0449\u043c\u0447. \u0406\u0440\u0438\u043d\u0435\u044f, \u000d\u000a\u0454\u043f. \u041b\u0456\u043e\u043d\u0441\u044c\u043a\u043e\u0433\u043e (202). \u041c\u0447. \u041b\u0443\u043f\u043f\u0430 \u0421\u0430\u043b\u043e\u043d\u0456\u043a\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u041f\u0440\u043f\u043f. \u0404\u0432\u0442\u0438\u0445\u0456\u044f, \u000d\u000a\u0456\u0433\u0443\u043c\u0435\u043d\u0430 (\u0431\u043b. 540) \u0442\u0430 \u0424\u043b\u043e\u0440\u0435\u043d\u0442\u0456\u044f (547). \u0421\u0432\u0442. \u041a\u0430\u043b\u0438\u043d\u0438\u043a\u0430, \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (705).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 1-\u0435, \u041c\u0444., 116 \u0437\u0430\u0447., XXVIII, 16 \u2013 20.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u041a\u043e\u0440., 158 \u0437\u0430\u0447., XV, 1 \u2013 11. \u041c\u0444., 79 \u0437\u0430\u0447., XIX, 16 \u2013 26.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a23","58\u000d\u000a\u041c\u0447\u0447. \u0410\u0434\u0440\u0456\u0430\u043d\u0430 \u0456 \u041d\u0430\u0442\u0430\u043b\u0456\u0457 (305 \u2013 311).\u000d\u000a2 \u041a\u043e\u0440., 189 \u0437\u0430\u0447., IX, 12 \u2013 X, 7. \u041c\u043a., 13 \u0437\u0430\u0447., III, 20 \u2013 27.\u000d\u000a\u041f\u0440\u043f. \u041f\u0438\u043c\u0435\u043d\u0430 \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e (\u0431\u043b. 450). \u041f\u0440\u043f\u043f. \u0441\u0449\u043c\u0447. \u041a\u0443\u043a\u0448\u0456 \u0439 \u0443\u0447\u043d\u044f \u0439\u043e\u0433\u043e \u000d\u000a\u043c\u0447. \u041d\u0438\u043a\u043e\u043d\u0430, \u041f\u0438\u043c\u0435\u043d\u0430, \u043f\u043e\u0441\u043d\u0438\u043a\u0430, \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u0438\u0445, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u043f\u0456\u0441\u043b\u044f 1114). \u0421\u0432\u0442. \u041e\u0441\u0456\u0457, \u0441\u043f\u043e\u0432., \u0454\u043f. \u041a\u043e\u0440\u0434\u043e\u0432\u0441\u044c\u043a\u043e\u0433\u043e (359). \u000d\u000a\u0421\u0432\u0442. \u041b\u0456\u0432\u0435\u0440\u0456\u044f, \u0441\u043f\u043e\u0432., \u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0430 \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (366). \u041f\u0440\u043f. \u041f\u0438\u043c\u0435\u043d\u0430 \u041f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 602). \u041c\u0446. \u0410\u043d\u0444\u0456\u0441\u0438 \u041d\u043e\u0432\u043e\u0457. \u041f\u0440\u043f. \u0421\u0430\u0432\u0438 \u0412\u0435\u043d\u0435\u0444\u0430\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e.\u000d\u000a2 \u041a\u043e\u0440., 190 \u0437\u0430\u0447., X, 7 \u2013 18. \u041c\u043a., 14 \u0437\u0430\u0447., III, 28 \u2013 35.\u000d\u000a\u041f\u0440\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041c\u0444., 10 \u0437\u0430\u0447., IV, 25 \u2013 V, 12.\u000d\u000a\u041f\u0440\u043f. \u041c\u043e\u0439\u0441\u0435\u044f \u041c\u0443\u0440\u0438\u043d\u0430 (\u0431\u043b. 400). \u0421\u043e\u0431\u043e\u0440 \u043f\u0440\u043f\u043f. \u043e\u0442\u0446\u0456\u0432 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u0438\u0445, \u044f\u043a\u0456 \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u043f\u0440\u043f. \u0424\u0435\u043e\u0434\u043e\u0441\u0456\u044f) \u0441\u043f\u043e\u0447\u0438\u0432\u0430\u044e\u0442\u044c:\u000d\u000a\u0424\u0435\u043e\u0434\u043e\u0441\u0456\u044f (1074), \u041c\u043e\u0439\u0441\u0435\u044f, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (\u0425\u0406\u0406\u0406 \u2013 \u0425\u0406V), \u041b\u0430\u0432\u0440\u0435\u043d\u0442\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. \u000d\u000a(\u0425\u0406\u0406\u0406 \u2013 \u0425\u0406V), \u0406\u043b\u0430\u0440\u0456\u043e\u043d\u0430, \u0441\u0445\u0438\u043c\u043d. (1066), \u041f\u0430\u0444\u043d\u0443\u0442\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. (\u0425\u0406\u0406\u0406), \u041c\u0430\u0440\u0442\u0438\u0440\u0456\u044f, \u000d\u000a\u0434\u0438\u044f\u043a. (\u0425\u0406V), \u0424\u0435\u0434\u043e\u0440\u0430, \u043a\u043d. \u041e\u0441\u0442\u0440\u043e\u0437\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 1438), \u0410\u0444\u0430\u043d\u0430\u0441\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. \u000d\u000a(\u0425\u0406\u0406\u0406), \u0414\u0456\u043e\u043d\u0456\u0441\u0456\u044f, \u0456\u0454\u0440\u043e\u043c., \u0437\u0430\u0442\u0432\u043e\u0440\u043d. (\u0425V), \u0424\u0435\u043e\u0444\u0456\u043b\u0430, \u0454\u043f. \u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(\u0431\u043b. 1482), \u0417\u0438\u043d\u043e\u043d\u0430, \u043f\u043e\u0441\u043d. (\u0425\u0406V), \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. (\u0425\u0406V), \u0406\u043f\u0430\u0442\u0456\u044f, \u0446\u0456\u043b\u0438\u0442\u0435\u043b\u044f (\u0425\u0406V), \u0441\u0449\u043c\u0447. \u041b\u0443\u043a\u0456\u0430\u043d\u0430 (1243), \u0419\u043e\u0441\u0438\u0444\u0430 \u0411\u0430\u0433\u0430\u0442\u043e\u0445\u0432\u043e\u0440\u043e\u0431\u043b\u0438\u0432\u043e\u0433\u043e (\u0425\u0406V), \u000d\u000a\u041f\u0430\u0432\u043b\u0430 \u041f\u043e\u0441\u043b\u0443\u0448\u043d\u043e\u0433\u043e (\u0425\u0406\u0406\u0406), \u0421\u0438\u0441\u043e\u044f, \u0441\u0445\u0438\u043c\u043d. (\u0425\u0406\u0406\u0406), \u041d\u0435\u0441\u0442\u043e\u0440\u0430, \u043d\u0435\u043a\u043d\u0438\u0436\u043d. (\u0425\u0406V), \u000d\u000a\u041f\u0430\u043c\u0432\u0438, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. (1241), \u0424\u0435\u0434\u043e\u0440\u0430, \u043c\u043e\u0432\u0447\u0430\u043b\u044c\u043d. (\u0425\u0406\u0406\u0406), \u0421\u043e\u0444\u0440\u043e\u043d\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. \u000d\u000a(\u0425\u0406\u0406\u0406), \u041f\u0430\u043d\u043a\u0440\u0430\u0442\u0456\u044f, \u0456\u0454\u0440\u043e\u043c\u043e\u043d., \u0437\u0430\u0442\u0432\u043e\u0440\u043d. (\u0425\u0406\u0406\u0406), \u0410\u043d\u0430\u0442\u043e\u043b\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. (\u0425\u0406\u0406\u0406), \u0410\u043c\u043c\u043e\u043d\u0430, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. (\u0425\u0406\u0406\u0406), \u041c\u0430\u0440\u0434\u0430\u0440\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. (\u0425\u0406\u0406\u0406), \u041f\u0456\u043e\u0440\u0430, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. (\u0425\u0406\u0406\u0406), \u000d\u000a\u041c\u0430\u0440\u0442\u0438\u0440\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. (\u0425\u0406\u0406\u0406 \u2013 \u0425\u0406V), \u0420\u0443\u0444\u0430, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. (\u0425\u0406V), \u0412\u0435\u043d\u0456\u0430\u043c\u0438\u043d\u0430, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. (\u0425\u0406V), \u041a\u0430\u0441\u0456\u044f\u043d\u0430, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. (\u0425\u0406\u0406\u0406 \u2013 \u0425\u0406V), \u0410\u0440\u0441\u0435\u043d\u0456\u044f \u041f\u0440\u0430\u0446\u0435\u043b\u044e\u0431\u043d\u043e\u0433\u043e (\u0425\u0406V), \u000d\u000a\u0404\u0432\u0444\u0438\u043c\u0456\u044f, \u0441\u0445\u0438\u043c\u043d. (\u0425\u0406V), \u0422\u0438\u0442\u0430, \u043a\u043e\u043b\u0438\u0448\u043d\u044c\u043e\u0433\u043e \u0432\u043e\u0457\u043d\u0430 (\u0425\u0406V), \u0410\u0445\u0438\u043b\u0438, \u0434\u0438\u044f\u043a. (\u0425\u0406V), \u000d\u000a\u041f\u0430\u0457\u0441\u0456\u044f (\u0425\u0406V), \u041c\u0435\u0440\u043a\u0443\u0440\u0456\u044f, \u043f\u043e\u0441\u043d. (\u0425\u0406V), \u041c\u0430\u043a\u0430\u0440\u0456\u044f, \u0434\u0438\u044f\u043a. (\u0425\u0406V), \u041f\u0438\u043c\u0435\u043d\u0430, \u043f\u043e\u0441\u043d. \u000d\u000a(\u0425\u0406\u0406), \u041b\u0435\u043e\u043d\u0442\u0456\u044f \u0456 \u0413\u0435\u0440\u043e\u043d\u0442\u0456\u044f, \u043a\u0430\u043d\u043e\u043d\u0430\u0440\u0445\u0456\u0432 (\u0425\u0406V), \u0417\u0430\u0445\u0430\u0440\u0456\u0457, \u043f\u043e\u0441\u043d. (\u0425\u0406\u0406\u0406 \u2013 \u0425\u0406V), \u0421\u0438\u043b\u0443\u0430\u043d\u0430, \u0441\u0445\u0438\u043c\u043d. (\u0425\u0406\u0406\u0406 \u2013 \u0425\u0406V), \u0410\u0433\u0430\u0444\u043e\u043d\u0430, \u0447\u0443\u0434\u043e\u0442\u0432. (\u0425\u0406\u0406\u0406 \u2013 \u0425\u0406V), \u0406\u0433\u043d\u0430\u0442\u0456\u044f, \u0430\u0440\u0445\u0456\u043c. \u000d\u000a(1435) \u0456 \u041b\u043e\u043d\u0433\u0438\u043d\u0430, \u0432\u043e\u0440\u043e\u0442\u0430\u0440\u044f (\u0425\u0406\u0406\u0406 \u2013 \u0425\u0406V), \u0410\u043a\u0438\u043d\u0434\u0438\u043d\u0430, \u0430\u0440\u0445\u0456\u043c. (1235), \u0410\u043c\u0444\u0456\u043b\u043e\u0445\u0456\u044f, \u0454\u043f. (1122), \u0414\u0430\u043d\u0438\u0457\u043b\u0430, \u0441\u0442\u0430\u0440\u0446\u044f (\u0425\u0406V), \u0414\u043e\u0441\u0438\u0444\u0435\u044f, \u0430\u0440\u0445\u0456\u043c. (1218), \u0404\u0432\u043b\u043e\u0433\u0456\u044f, \u0441\u0442\u0430\u0440\u0446\u044f (\u0425\u0406V), \u0406\u0441\u0438\u0434\u043e\u0440\u0430, \u0437\u0430\u0442\u0432. (\u0425\u0406\u0406 \u2013 \u0425\u0406\u0406\u0406), \u0422\u0438\u043c\u043e\u0444\u0456\u044f, \u0456\u0433\u0443\u043c\u0435\u043d\u0430 (1132), \u000d\u000a\u0441\u0432\u0442. \u0424\u0456\u043b\u0430\u0440\u0435\u0442\u0430, \u043c\u0438\u0442\u0440. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1857). \u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u043f\u0440\u043f. \u0406\u043e\u0432\u0430 \u000d\u000a\u041f\u043e\u0447\u0430\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1659). \u041f\u0440\u0430\u0432. \u0410\u043d\u043d\u0438, \u043f\u0440\u043e\u0440\u043e\u0447\u0438\u0446\u0456, \u0434\u043e\u0447\u043a\u0438 \u0424\u0430\u043d\u0443\u0457\u043b\u043e\u0432\u043e\u0457, \u044f\u043a\u0430 \u000d\u000a\u0437\u0443\u0441\u0442\u0440\u0456\u043b\u0430 \u0413\u043e\u0441\u043f\u043e\u0434\u0430 \u0406\u0441\u0443\u0441\u0430 \u0425\u0440\u0438\u0441\u0442\u0430 \u0432 \u0445\u0440\u0430\u043c\u0456 \u0404\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0441\u044c\u043a\u043e\u043c\u0443 (\u0406). \u0412\u043c\u0446. \u0428\u0443\u0448\u0430\u043d\u0456\u043a\u0438 (\u0421\u0443\u0441\u0430\u043d\u043d\u0438), \u0446\u0430\u0440\u0438\u0446\u0456 \u0420\u0430\u043d\u0441\u044c\u043a\u043e\u0457 (V, \u0413\u0440\u0443\u0437.).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u0444., 10 \u0437\u0430\u0447., IV, 25 \u2013 V, 12.\u000d\u000a\u041b\u0456\u0442. \u2013 2 \u041a\u043e\u0440., 192 \u0437\u0430\u0447., XI, 5 \u2013 21. \u041c\u043a., 15 \u0437\u0430\u0447., IV, 1 \u2013 9 (\u0437\u0430 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e).\u000d\u000a1 \u041a\u043e\u0440., 126 \u0437\u0430\u0447., II, 6 \u2013 9. \u041c\u0444., 90 \u0437\u0430\u0447., XXII, 15 \u2013 22 (\u0437\u0430 \u0441\u0443\u0431\u043e\u0442\u0443, \u043f\u0456\u0434 \u0437\u0430\u0447\u0430\u043b\u043e).\u000d\u000a\u041f\u0440\u043f\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a26\u000d\u000a27\u000d\u000a28\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0423\u0441\u0456\u043a\u043d\u043e\u0432\u0435\u043d\u043d\u044f \u0433\u043e\u043b\u043e\u0432\u0438 \u043f\u0440\u043e\u0440\u043e\u043a\u0430, \u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456 \u0456 \u0425\u0440\u0435\u0441\u0442\u0438\u0442\u0435\u043b\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e \u0406\u043e\u0430\u043d\u0430.\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u0444., 57 \u0437\u0430\u0447., XIV, 1 \u2013 13.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0414\u0456\u044f\u043d., 33 \u0437\u0430\u0447., XIII, 25 \u2013 32. \u041c\u043a., 24 \u0437\u0430\u0447., VI, 14 \u2013 30.\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a29","59\u000d\u000a\u041f\u0456\u0441\u043d\u0438\u0439 \u0434\u0435\u043d\u044c. \u041f\u043e\u043c\u0438\u043d\u0430\u043d\u043d\u044f \u0437\u0430\u0433\u0438\u0431\u043b\u0438\u0445 \u0437\u0430\u0445\u0438\u0441\u043d\u0438\u043a\u0456\u0432 \u0423\u043a\u0440\u0430\u0457\u043d\u0438.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0442\u0435\u0431\u0435, \u0425\u0440\u0435\u0441\u0442\u0438\u0442\u0435\u043b\u044e \u0421\u043f\u0430\u0441\u0456\u0432 \u000d\u000a\u0406\u043e\u0430\u043d\u0435, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u0432\u0441\u0456 \u0447\u0435\u0441\u043d\u043e\u0457 \u0442\u0432\u043e\u0454\u0457 \u0433\u043b\u0430\u0432\u0438 \u0443\u0441\u0456\u043a\u043d\u043e\u0432\u0435\u043d\u043d\u044f\u00bb.\u000d\u000a13-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 4-\u0439.\u000d\u000a\u0421\u0432\u0442\u0442. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 (340), \u0406\u043e\u0430\u043d\u0430 \u041f\u043e\u0441\u043d\u0438\u043a\u0430 (595) \u0456 \u041f\u0430\u0432\u043b\u0430 \u041d\u043e\u0432\u043e\u0433\u043e (784), \u043f\u0430\u0442\u0440\u0456\u0430\u0440\u0445\u0456\u0432 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u0438\u0445. \u041f\u0440\u043f. \u0425\u0440\u0438\u0441\u0442\u043e\u0444\u043e\u0440\u0430 \u0420\u0438\u043c\u043b\u044f\u043d\u0438\u043d\u0430 (V\u0406). \u041f\u0440\u043f. \u000d\u000a\u0424\u0430\u043d\u0442\u0438\u043d\u0430 \u0421\u043e\u043b\u0443\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (\u0406\u0425 \u2013 \u0425). \u0421\u0432\u0442\u0442. \u0421\u0435\u0440\u0431\u0441\u044c\u043a\u0438\u0445: \u0421\u0430\u0432\u0438 \u0406 \u000d\u000a(1237), \u0410\u0440\u0441\u0435\u043d\u0456\u044f (1266), \u0421\u0430\u0432\u0438 \u0406\u0406 (1271), \u0404\u0432\u0441\u0442\u0430\u0444\u0456\u044f (\u0431\u043b. 1285), \u042f\u043a\u043e\u0432\u0430 (1292), \u000d\u000a\u041d\u0438\u043a\u043e\u0434\u0438\u043c\u0430 (1325), \u0414\u0430\u043d\u0438\u0457\u043b\u0430 (1338), \u0430\u0440\u0445\u0456\u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0456\u0432; \u0406\u043e\u0430\u043d\u0438\u043a\u0456\u044f (1354), \u0404\u0444\u0440\u0435\u043c\u0430 (\u043f\u0456\u0441\u043b\u044f 1395), \u0421\u043f\u0438\u0440\u0438\u0434\u043e\u043d\u0430 (1388), \u041c\u0430\u043a\u0430\u0440\u0456\u044f (1574), \u0413\u0430\u0432\u0440\u0438\u0457\u043b\u0430 (1659), \u043f\u0430\u0442\u0440\u0456\u0430\u0440\u0445\u0456\u0432, \u0456 \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f, \u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0430. \u041f\u0440\u043f. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u0421\u0432\u0456\u0440\u0441\u044c\u043a\u043e\u0433\u043e (1533). \u0421\u0432\u0442. \u000d\u000a\u0412\u0430\u0440\u043b\u0430\u0430\u043c\u0430, \u043c\u0438\u0442\u0440. \u041c\u043e\u043b\u0434\u043e\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1657, \u0420\u0443\u043c.).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 2-\u0435, \u041c\u043a., 70 \u0437\u0430\u0447., XVI, 1 \u2013 8.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u041a\u043e\u0440., 166 \u0437\u0430\u0447., XVI, 13 \u2013 24. \u041c\u0444., 87 \u0437\u0430\u0447., XXI, 33 \u2013 42.\u000d\u000a\u041f\u0440\u043f\u043f. \u0410\u043d\u0442\u043e\u043d\u0456\u044f (1073) \u0456 \u0424\u0435\u043e\u0434\u043e\u0441\u0456\u044f (1074) \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u0438\u0445. \u000d\u000a\u041c\u0447. \u041c\u0430\u043c\u0430\u043d\u0442\u0430 (275), \u0431\u0430\u0442\u044c\u043a\u0430 \u0439\u043e\u0433\u043e \u0424\u0435\u043e\u0434\u043e\u0442\u0430 \u0456 \u043c\u0430\u0442\u0435\u0440\u0456 \u0420\u0443\u0444\u0456\u043d\u0438 (\u0406\u0406\u0406). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430 \u041f\u043e\u0441\u043d\u0438\u043a\u0430, \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (595). \u041c\u0447\u0447. 3628 \u0432 \u041d\u0456\u043a\u043e\u043c\u0438\u0434\u0456\u0457 (\u0406\u0406\u0406 \u2013 \u0406V). \u000d\u000a\u041f\u0440\u0430\u0432. \u0404\u043b\u0435\u0430\u0437\u0430\u0440\u0430, \u043f\u0435\u0440\u0448\u043e\u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0438\u043a\u0430, \u0441\u0438\u043d\u0430 \u043f\u0440\u0430\u0432. \u0410\u0430\u0440\u043e\u043d\u0430 (1400 \u0440. \u0434\u043e \u0420. \u0425\u0440.)\u000d\u000a\u0420\u0430\u043d.: \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f \u00ab\u0423\u0431\u043b\u0430\u0436\u0430\u0454\u043c\u043e \u0432\u0430\u0441, \u043f\u0440\u0435\u043f\u043e\u0434\u043e\u0431\u043d\u0456 \u043e\u0442\u0446\u0456 \u043d\u0430\u0448\u0456 \u0410\u043d\u0442\u043e\u043d\u0456\u044e \u0456 \u000d\u000a\u0424\u0435\u043e\u0434\u043e\u0441\u0456\u044e \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u0456, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u0441\u0432\u044f\u0442\u0443 \u043f\u0430\u043c\u2019\u044f\u0442\u044c \u0432\u0430\u0448\u0443, \u043d\u0430\u0441\u0442\u0430\u0432\u043d\u0438\u043a\u0438 \u000d\u000a\u043c\u043e\u043d\u0430\u0445\u0456\u0432 \u0456 \u0441\u043f\u0456\u0432\u0440\u043e\u0437\u043c\u043e\u0432\u043d\u0438\u043a\u0438 \u0430\u043d\u0433\u0435\u043b\u0456\u0432\u00bb.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a30\u000d\u000a2\u000d\u000a14-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u041f\u043e\u043a\u043b\u0430\u0434\u0435\u043d\u043d\u044f \u0447\u0435\u0441\u043d\u043e\u0433\u043e \u043f\u043e\u044f\u0441\u0430 \u000d\u000a\u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456 (395 \u2013 408). \u0421\u0449\u043c\u0447. \u041a\u0438\u043f\u0440\u0456\u0430\u043d\u0430, \u0454\u043f. \u041a\u0430\u0440\u0444\u0430\u0433\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e (258). \u0421\u0432\u0442. \u0413\u0435\u043d\u043d\u0430\u0434\u0456\u044f, \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (471). \u000d\u000a\u0421\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 \u0406\u0406, \u043c\u0438\u0442\u0440. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0432\u0441\u0456\u0454\u0457 \u0420\u0443\u0441\u0438 (1089). \u041f\u0430\u043c'\u044f\u0442\u044c \u000d\u000a\u0432\u0456\u0434\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u043e\u0457 \u0456\u0454\u0440\u0430\u0440\u0445\u0456\u0457 \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0457 \u041c\u0438\u0442\u0440\u043e\u043f\u043e\u043b\u0456\u0457 \u000d\u000a(1620).\u000d\u000a2 \u041a\u043e\u0440., 195 \u0437\u0430\u0447., XII, 10 \u2013 19. \u041c\u043a., 16 \u0437\u0430\u0447., IV, 10 \u2013 23.\u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456: \u0424\u043b\u043f., 240 \u0437\u0430\u0447., II, 5 \u2013 11. \u041b\u043a., 54 \u0437\u0430\u0447., X, 38 \u2013 42; XI, 27 \u2013 28.\u000d\u000a\u041f\u043e\u0447\u0430\u0442\u043e\u043a \u0456\u043d\u0434\u0438\u043a\u0442\u0443 \u2013 \u0446\u0435\u0440\u043a\u043e\u0432\u043d\u0435 \u043d\u043e\u0432\u043e\u043b\u0456\u0442\u0442\u044f. \u041f\u0440\u043f. \u0421\u0438\u043c\u0435\u043e\u043d\u0430 \u0421\u0442\u043e\u0432\u043f\u043d\u0438\u043a\u0430 (459) \u0456 \u043c\u0430\u0442\u0435\u0440\u0456 \u0439\u043e\u0433\u043e \u041c\u0430\u0440\u0444\u0438 (\u0431\u043b. 428). \u0421\u043e\u0431\u043e\u0440 \u0412\u0456\u043d\u043d\u0438\u0446\u044c\u043a\u0438\u0445 \u0441\u0432\u044f\u0442\u0438\u0445. \u0421\u0449\u043c\u0447. \u0410\u0457\u0444\u0430\u043b\u0430 \u041f\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0434\u0438\u044f\u043a\u043e\u043d\u0430 (380). \u041c\u0446\u0446. 40 \u0434\u0456\u0432, \u043f\u043e\u0441\u043d\u0438\u0446\u044c, \u000d\u000a\u0456 \u0441\u0449\u043c\u0447. \u0410\u043c\u0443\u043d\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0430, \u0457\u0445\u043d\u044c\u043e\u0433\u043e \u0432\u0447\u0438\u0442\u0435\u043b\u044f (\u0406V). \u041c\u0446. \u041a\u0430\u043b\u0456\u0441\u0442\u0438 \u0442\u0430 \u0431\u0440\u0430\u0442\u0456\u0432 \u0457\u0457, \u000d\u000a\u043c\u0447\u0447. \u0404\u0432\u043e\u0434\u0430 \u0442\u0430 \u0404\u0440\u043c\u043e\u0433\u0435\u043d\u0430 (309). \u041f\u0440\u0430\u0432. \u0406\u0441\u0443\u0441\u0430 \u041d\u0430\u0432\u0438\u043d\u0430 (\u0425V\u0406 \u0441\u0442. \u0434\u043e \u0420. \u0425.). \u000d\u000a\u0421\u043e\u0431\u043e\u0440 \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456 \u0432 \u041c\u0456\u0430\u0441\u0438\u043d\u0441\u044c\u043a\u0456\u0439 \u043e\u0431\u0438\u0442\u0435\u043b\u0456 (\u0432 \u043f\u0430\u043c\u2019\u044f\u0442\u044c \u0437\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u0407\u0457 \u0456\u043a\u043e\u043d\u0438, 864).\u000d\u000a2 \u041a\u043e\u0440., 196 \u0437\u0430\u0447., XII, 20 \u2013 XIII, 2. \u041c\u043a., 17 \u0437\u0430\u0447., IV, 24 \u2013 34. \u000d\u000a\u041d\u043e\u0432\u043e\u043b\u0456\u0442\u0442\u044e: 1 \u0422\u0438\u043c., 282 \u0437\u0430\u0447., II, 1 \u2013 7. \u041b\u043a., 13 \u0437\u0430\u0447., IV, 16 \u2013 22.\u000d\u000a\u041f\u0440\u043f.: \u041a\u043e\u043b., 258 \u0437\u0430\u0447., \u0406\u0406\u0406, 12 \u2013 16. \u041c\u0444. 43, \u0425I, 27 \u2013 30.\u000d\u000a31\u000d\u000a1\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a","60\u000d\u000a\u0421\u0449\u043c\u0447. \u0410\u043d\u0444\u0456\u043c\u0430, \u0454\u043f. \u041d\u0456\u043a\u043e\u043c\u0438\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u0437 \u043d\u0438\u043c \u0441\u0449\u043c\u0447. \u0424\u0435\u043e\u0444\u0456\u043b\u0430 \u0442\u0430 \u041c\u0438\u0433\u0434\u043e\u043d\u0456\u044f, \u0434\u0438\u044f\u043a\u043e\u043d\u0456\u0432, \u043c\u0447\u0447. \u0414\u043e\u0440\u043e\u0444\u0435\u044f, \u041c\u0430\u0440\u0434\u043e\u043d\u0456\u044f, \u041f\u0435\u0442\u0440\u0430, \u0406\u043d\u0434\u0438\u0441\u0430, \u0413\u043e\u0440\u0433\u043e\u043d\u0456\u044f, \u0417\u0438\u043d\u043e\u043d\u0430, \u0404\u0432\u0444\u0438\u043c\u0456\u044f \u0456 \u043c\u0446. \u0414\u043e\u043c\u043d\u0438, \u0434\u0456\u0432\u0438 (302). \u041f\u0440\u043f. \u0424\u0435\u043e\u043a\u0442\u0438\u0441\u0442\u0430 \u041f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u000d\u000a\u0456\u0433\u0443\u043c., \u0441\u043f\u0456\u0432\u043f\u043e\u0441\u043d\u0438\u043a\u0430 \u043f\u0440\u043f. \u0404\u0432\u0444\u0438\u043c\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e (467). \u0421\u0432. \u0424\u0456\u0432\u0438 \u041a\u043e\u0440\u0438\u043d\u0444\u0441\u044c\u043a\u043e\u0457, \u000d\u000a\u0434\u0438\u044f\u043a\u043e\u043d\u0438\u0441\u0438 (\u0406). \u041c\u0446. \u0412\u0430\u0441\u0438\u043b\u0456\u0441\u0438 \u041d\u0456\u043a\u043e\u043c\u0438\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (309). \u0421\u0449\u043c\u0447. \u0410\u0440\u0438\u0441\u0442\u0456\u043e\u043d\u0430, \u000d\u000a\u0454\u043f. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e. \u0421\u0432\u0442. \u0406\u043e\u0430\u043d\u0438\u043a\u0456\u044f, \u043f\u0430\u0442\u0440. \u0421\u0435\u0440\u0431\u0441\u044c\u043a\u043e\u0433\u043e (1354).\u000d\u000a\u041f\u0456\u0441\u0438\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0457 \u041c\u0438\u0440\u043e\u0442\u043e\u0447\u0438\u0432\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (VI).\u000d\u000a2 \u041a\u043e\u0440., 197 \u0437\u0430\u0447., XIII, 3 \u2013 13. \u041c\u043a., 18 \u0437\u0430\u0447., IV, 35 \u2013 41 (\u0437\u0430 \u0441\u0435\u0440\u0435\u0434\u0443, \u043f\u0456\u0434 \u000d\u000a\u0437\u0430\u0447\u0430\u043b\u043e).\u000d\u000a\u0413\u0430\u043b., 198 \u0437\u0430\u0447., I, 1 \u2013 10, 20 \u2013 II, 5. \u041c\u043a., 19 \u0437\u0430\u0447., V, 1 \u2013 20 (\u0437\u0430 \u0447\u0435\u0442\u0432\u0435\u0440).\u000d\u000a\u0421\u0449\u043c\u0447.: \u0404\u0432\u0440., 334 \u0437\u0430\u0447., XIII, 7 \u2013 16. \u0406\u043d., 36 \u0437\u0430\u0447., X, 9 \u2013 16.\u000d\u000a3\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u0421\u0449\u043c\u0447. \u0412\u0430\u0432\u0438\u043b\u0438, \u0454\u043f. \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u0437 \u043d\u0438\u043c \u0442\u0440\u044c\u043e\u0445 \u043e\u0442\u0440\u043e\u043a\u0456\u0432: \u0423\u0440\u0432\u0430\u043d\u0430, \u041f\u0440\u0438\u043b\u0456\u0434\u0456\u0430\u043d\u0430, \u0415\u043f\u043e\u043b\u043e\u043d\u0456\u044f \u0442\u0430 \u043c\u0430\u0442\u0435\u0440\u0456 \u0457\u0445\u043d\u044c\u043e\u0457 \u0425\u0440\u0438\u0441\u0442\u043e\u0434\u0443\u043b\u0438 (\u0431\u043b. 251). \u041f\u0440\u043e\u0440. \u041c\u043e\u0439\u0441\u0435\u044f \u0411\u043e\u0433\u043e\u0432\u0438\u0434\u0446\u044f (1531 \u0434\u043e \u0420. \u0425.). \u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u0441\u0432\u0442. \u0406\u043e\u0430\u0441\u0430\u0444\u0430 (\u0413\u043e\u0440\u043b\u0435\u043d\u043a\u0430), \u0454\u043f. \u0411\u0456\u043b\u0433\u043e\u0440\u043e\u0434\u0441\u044c\u043a\u043e\u0433\u043e (1911). \u041c\u0446. \u0404\u0440\u043c\u0456\u043e\u043d\u0456\u0457, \u0434\u043e\u0447\u043a\u0438 \u000d\u000a\u0430\u043f. \u0424\u0438\u043b\u0438\u043f\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0430 (\u0431\u043b. 117). \u041c\u0447. \u0412\u0430\u0432\u0438\u043b\u0438 \u041d\u0456\u043a\u043e\u043c\u0438\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0437 \u043d\u0438\u043c 84 \u000d\u000a\u0443\u0447\u043d\u0456\u0432 (\u0406V). \u041c\u0447\u0447. \u0424\u0435\u0434\u043e\u0440\u0430, \u041c\u0456\u0430\u043d\u0430, \u042e\u043b\u0456\u0430\u043d\u0430 \u0442\u0430 \u041a\u0456\u043e\u043d\u0430 (305 \u2013 311).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u041d\u0435\u043e\u043f\u0430\u043b\u0438\u043c\u0430 \u043a\u0443\u043f\u0438\u043d\u0430\u00bb.\u000d\u000a\u0413\u0430\u043b., 201 \u0437\u0430\u0447., II, 6 \u2013 10. \u041c\u043a., 20 \u0437\u0430\u0447., V, 22 \u2013 24, 35 \u2013 VI, 1.\u000d\u000a\u041f\u0440\u043e\u0440.: \u042f\u043a., 57 \u0437\u0430\u0447., V, 10 \u2013 20. \u041b\u043a., 14 \u0437\u0430\u0447., IV, 22 \u2013 30.\u000d\u000a\u041f\u0440\u043e\u0440. \u0417\u0430\u0445\u0430\u0440\u0456\u0457 \u0456 \u043f\u0440\u0430\u0432. \u0404\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u0438, \u0431\u0430\u0442\u044c\u043a\u0456\u0432 \u0441\u0432. \u0406\u043e\u0430\u043d\u0430 \u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456 (\u0406).\u000d\u000a\u041f\u0440\u043c\u0447. \u0410\u0444\u0430\u043d\u0430\u0441\u0456\u044f, \u0456\u0433\u0443\u043c. \u0411\u0435\u0440\u0435\u0441\u0442\u0435\u0439\u0441\u044c\u043a\u043e\u0433\u043e (1648). \u041a\u043e\u043d\u0447\u0438\u043d\u0430 \u000d\u000a\u0431\u043b\u0433\u0432. \u043a\u043d. \u0413\u043b\u0456\u0431\u0430, \u0432 \u0445\u0440\u0435\u0449\u0435\u043d\u043d\u0456 \u0414\u0430\u0432\u0438\u0434\u0430 (1015). \u041c\u0447\u0447. \u0424\u0438\u0444\u0430\u0457\u043b\u0430 \u0456 \u0441\u0435\u0441\u0442\u0440\u0438 \u0439\u043e\u0433\u043e \u0424\u0456\u0432\u0435\u0457 (\u0412\u0438\u0432\u0435\u0457) (98 \u2013 138). \u041c\u0447. \u0421\u0430\u0440\u0432\u0438\u043b\u0430. \u041c\u0446. \u0420\u0430\u0457\u0441\u0438 (\u0406\u0440\u0430\u0457\u0434\u0438) \u000d\u000a(\u0431\u043b. 308). \u041c\u0447\u0447. \u042e\u0432\u0435\u043d\u0442\u0438\u043d\u0430 \u0456 \u041c\u0430\u043a\u0441\u0438\u043c\u0430, \u0432\u043e\u0457\u043d\u0456\u0432 (361 \u2013 363). \u041c\u0447\u0447. \u0423\u0440\u0432\u0430\u043d\u0430, \u000d\u000a\u0424\u0435\u0434\u043e\u0440\u0430, \u041c\u0435\u0434\u0438\u043c\u043d\u0430 \u0456 \u0437 \u043d\u0438\u043c\u0438 77 \u0447\u043e\u043b\u043e\u0432\u0456\u043a\u0456\u0432 \u0437 \u0446\u0435\u0440\u043a\u043e\u0432\u043d\u043e\u0433\u043e \u0447\u0438\u043d\u0443, \u044f\u043a\u0456 \u0432 \u041d\u0456\u043a\u043e\u043c\u0438\u0434\u0456\u0457 \u043f\u043e\u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043b\u0438 (370). \u041c\u0447. \u0410\u0432\u0434\u0456\u044f (\u0410\u0432\u0438\u0434\u0430) \u041f\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e (V).\u000d\u000a1 \u041a\u043e\u0440., 130 \u0437\u0430\u0447., IV, 1 \u2013 5. \u041c\u0444., 93 \u0437\u0430\u0447., XXIII, 1 \u2013 12.\u000d\u000a\u041f\u0440\u043e\u0440.: \u0404\u0432\u0440., 314 \u0437\u0430\u0447., VI, 13 \u2013 20. \u041c\u0444., 96 \u0437\u0430\u0447., XXIII, 29 \u2013 39 \u0430\u0431\u043e \u041b\u043a., 2 \u000d\u000a\u0437\u0430\u0447., \u0406, 5 \u2013 25, 57 \u2013 68, 76, 80.\u000d\u000a4\u000d\u000a5\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a14-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 5-\u0439.\u000d\u000a\u0421\u043f\u043e\u043c\u0438\u043d \u0447\u0443\u0434\u0430 \u0430\u0440\u0445\u0456\u0441\u0442\u0440\u0430\u0442\u0438\u0433\u0430 \u041c\u0438\u0445\u0430\u0457\u043b\u0430 \u0432 \u0425\u043e\u043d\u0430\u0445 (\u041a\u043e\u043b\u043e\u0441\u0430\u0445) (\u0406V). \u041c\u0447\u0447. \u0404\u0432\u0434\u043e\u043a\u0441\u0456\u044f, \u0417\u0438\u043d\u043e\u043d\u0430 \u0456 \u041c\u0430\u043a\u0430\u0440\u0456\u044f (311 \u2013 312). \u041f\u0440\u043f. \u0410\u0440\u0445\u0438\u043f\u0430 \u0432 \u0425\u043e\u043d\u0430\u0445 (\u0406V). \u041c\u0447\u0447. \u0420\u043e\u043c\u0438\u043b\u0430 \u000d\u000a\u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0437 \u043d\u0438\u043c \u0431\u0430\u0433\u0430\u0442\u044c\u043e\u0445 \u0456\u043d\u0448\u0438\u0445 (105 \u2013 115). \u0421\u0449\u043c\u0447. \u041a\u0438\u0440\u0438\u043b\u0430, \u0454\u043f. \u0413\u043e\u0440\u0442\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0406\u0406 \u2013 \u0406V). \u0421\u0449\u043c\u0447\u0447. \u0424\u0430\u0432\u0441\u0442\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u0410\u0432\u0456\u0432\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0430, \u0456 \u0437 \u043d\u0438\u043c\u0438 11 \u000d\u000a\u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0456\u0432: \u041a\u0438\u0440\u0456\u0430\u043a\u0430 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 (\u0431\u043b. 250). \u041f\u0440\u043f. \u0414\u0430\u0432\u0438\u0434\u0430 \u0413\u0435\u0440\u043c\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406). \u000d\u000a\u0421\u0432\u0442\u0442. \u041c\u0438\u0445\u0430\u0457\u043b\u0430 (\u0431\u043b. 1073) \u0456 \u041c\u0430\u0440\u0438\u043d\u0430 (\u0431\u043b. 1095), \u0454\u043f\u043f. \u042e\u0440\u2019\u0457\u0432\u0441\u044c\u043a\u0438\u0445. \u000d\u000a\u0421\u0432\u0442\u0442. \u041b\u0430\u0437\u0430\u0440\u044f (1117) \u0442\u0430 \u0421\u0438\u043b\u044c\u0432\u0435\u0441\u0442\u0440\u0430 (1123), \u0454\u043f\u043f. \u041f\u0435\u0440\u0435\u044f\u0441\u043b\u0430\u0432\u0441\u044c\u043a\u0438\u0445, \u000d\u000a\u0456\u0433\u0443\u043c\u043c. \u0412\u0438\u0434\u0443\u0431\u0438\u0446\u044c\u043a\u0438\u0445.\u000d\u000a\u041a\u0438\u0454\u0432\u043e-\u0411\u0440\u0430\u0442\u0441\u044c\u043a\u043e\u0457 (1654) \u0439 \u0410\u0440\u0430\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0457 (\u0410\u0440\u0430\u0432\u0456\u0439\u0441\u044c\u043a\u043e\u0457) \u0456\u043a\u043e\u043d \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456.\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 3-\u0454, \u041c\u043a., 71 \u0437\u0430\u0447., XVI, 9 \u2013 20.\u000d\u000a\u041b\u0456\u0442. \u2013 2 \u041a\u043e\u0440., 170 \u0437\u0430\u0447., I, 21 \u2013 II, 4. \u041c\u0444., 89 \u0437\u0430\u0447., XXII, 1 \u2013 14.\u000d\u000a\u0410\u0440\u0445\u0430\u043d\u0433\u0435\u043b\u0430: \u0404\u0432\u0440., 305 \u0437\u0430\u0447., II, 2 \u2013 10. \u041b\u043a., 51 \u0437\u0430\u0447., X, 16 \u2013 21.\u000d\u000a\u041f\u0456\u0441\u043b\u044f \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0437\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f \u043c\u043e\u043b\u0435\u0431\u0435\u043d\u044c \u0437\u0430 \u0437\u0431\u0435\u0440\u0435\u0436\u0435\u043d\u043d\u044f \u0434\u043e\u0432\u043a\u0456\u043b\u043b\u044f.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a6","61\u000d\u000a15-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u041f\u0435\u0440\u0435\u0434\u0441\u0432\u044f\u0442\u043e \u0420\u0456\u0437\u0434\u0432\u0430 \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456. \u041c\u0447. \u0421\u043e\u0437\u043e\u043d\u0442\u0430 (\u0431\u043b. 304). \u041f\u0440\u043c\u0447. \u041c\u0430\u043a\u0430\u0440\u0456\u044f, \u0430\u0440\u0445\u0456\u043c. \u041a\u0430\u043d\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u041e\u0432\u0440\u0443\u0446\u044c\u043a\u043e\u0433\u043e, \u041f\u0435\u0440\u0435\u044f\u0441\u043b\u0430\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (1678). \u000d\u000a\u0410\u043f\u043f. \u0432\u0456\u0434 70-\u0445 \u0404\u0432\u043e\u0434\u0430 (66) \u0439 \u041e\u043d\u0438\u0441\u0438\u0444\u043e\u0440\u0430 (\u043f\u0456\u0441\u043b\u044f 67). \u041c\u0447. \u0404\u0432\u043f\u0441\u0438\u0445\u0456\u044f \u041a\u0435\u0441\u0430\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0406). \u041f\u0440\u043f. \u041b\u0443\u043a\u0438 \u041a\u0430\u043f\u043f\u0430\u0434\u043e\u043a\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0425).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u0412\u0456\u043d\u0438\u0446\u044c\u043a\u0430\u00bb (\u00ab\u0412\u0456\u043d\u043d\u0438\u0446\u044c\u043a\u043e-\u0420\u0456\u0436\u0435\u0446\u044c\u043a\u0430\u00bb) (XVIII).\u000d\u000a\u0413\u0430\u043b., 202 \u0437\u0430\u0447., II, 11 \u2013 16. \u041c\u043a., 21 \u0437\u0430\u0447., V, 24 \u2013 34 (\u0437\u0430 \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a).\u000d\u000a\u0413\u0430\u043b., 204 \u0437\u0430\u0447., II, 21 \u2013 III, 7. \u041c\u043a., 22 \u0437\u0430\u0447., VI, 1 \u2013 7 (\u0437\u0430 \u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a).\u000d\u000a\u041f\u0440\u043c\u0447.: \u0415\u0444., 233 \u0437\u0430\u0447., VI, 10 \u2013 17. \u0406\u043d., 52 \u0437\u0430\u0447., XV, 17 \u2013 XVI, 2.\u000d\u000a\u041f\u0456\u0441\u043b\u044f\u0441\u0432\u044f\u0442\u043e \u0420\u0456\u0437\u0434\u0432\u0430 \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456. \u041f\u0440\u0430\u0432\u0432. \u0411\u043e\u0433\u043e\u043e\u0442\u0446\u0456\u0432 \u0406\u043e\u0430\u043a\u0438\u043c\u0430 \u0439 \u0410\u043d\u043d\u0438. \u041c\u0447. \u0421\u0435\u0432\u0435\u0440\u0456\u0430\u043d\u0430 \u0421\u0435\u0432\u0430\u0441\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (320). \u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u0456 \u000d\u000a\u043f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u0441\u0432\u0442. \u0424\u0435\u043e\u0434\u043e\u0441\u0456\u044f, \u0430\u0440\u0445\u0456\u0454\u043f. \u0427\u0435\u0440\u043d\u0456\u0433\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(1896). \u041f\u0440\u043f. \u0424\u0435\u043e\u0444\u0430\u043d\u0430, \u0441\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u043a\u0430 \u0456 \u043f\u043e\u0441\u043d\u0438\u043a\u0430 (\u0431\u043b. 300). \u041c\u0447\u0447. \u0425\u0430\u0440\u0438\u0442\u043e\u043d\u0430 \u0456 \u0421\u0442\u0440\u0430\u0442\u043e\u0440\u0430 (\u0421\u0442\u0440\u0430\u0442\u043e\u043d\u0456\u043a\u0430). \u0421\u0432. \u041c\u0438\u043a\u0438\u0442\u0438 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u043a\u043e\u0433\u043e (\u0425\u0406\u0406). \u000d\u000a\u041f\u0430\u043c\u2019\u044f\u0442\u044c \u0406\u0406\u0406 \u0412\u0441\u0435\u043b\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u0441\u043e\u0431\u043e\u0440\u0443 (431).\u000d\u000a\u0413\u0430\u043b., 207 \u0437\u0430\u0447., III, 15 \u2013 22. \u041c\u043a., 23 \u0437\u0430\u0447., VI, 7 \u2013 13.\u000d\u000a\u0411\u043e\u0433\u043e\u043e\u0442\u0446\u0456\u0432: \u0413\u0430\u043b., 210 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), IV, 22 \u2013 31. \u041b\u043a., 36 \u0437\u0430\u0447., VIII, 16 \u2013 21.\u000d\u000a\u041f\u0456\u0441\u043b\u044f \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0437\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f \u043c\u043e\u043b\u0435\u0431\u0435\u043d\u044c \u0437\u0430 \u0441\u0456\u043c\u2019\u044e.\u000d\u000a\u041c\u0446\u0446. \u041c\u0438\u043d\u043e\u0434\u043e\u0440\u0438, \u041c\u0438\u0442\u0440\u043e\u0434\u043e\u0440\u0438 \u0439 \u041d\u0456\u043c\u0444\u043e\u0434\u043e\u0440\u0438 (305 \u2013 311). \u041f\u0440\u043f. \u041f\u0430\u0432\u043b\u0430 \u000d\u000a\u041f\u043e\u0441\u043b\u0443\u0448\u043d\u043e\u0433\u043e, \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406 \u2013 \u000d\u000a\u0425\u0406V). \u0410\u043f\u043f. \u0432\u0456\u0434 70-\u0445: \u0410\u043f\u043e\u043b\u043e\u0441\u0430 (\u0410\u043f\u0435\u043b\u0456\u044f), \u041b\u0443\u043a\u0456\u044f \u0456 \u041a\u043b\u0438\u043c\u0435\u043d\u0442\u0430 (\u0406). \u041c\u0447. \u0412\u0430\u0440\u0438\u043f\u0441\u0430\u0432\u0430 (\u0406\u0406). \u0411\u043b\u0433\u0432. \u041f\u0443\u043b\u044c\u0445\u0435\u0440\u0456\u0457, \u0456\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u0456 \u0412\u0456\u0437\u0430\u043d\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (453). \u0421\u0432\u0442\u0442. \u000d\u000a\u041f\u0435\u0442\u0440\u0430 \u0456 \u041f\u0430\u0432\u043b\u0430, \u0454\u043f\u043f. \u041d\u0456\u043a\u0435\u0439\u0441\u044c\u043a\u0438\u0445 (\u0406\u0425).\u000d\u000a\u0413\u0430\u043b., 208 \u0437\u0430\u0447., III, 23 \u2013 IV, 5. \u041c\u043a., 25 \u0437\u0430\u0447., VI, 30 \u2013 45.\u000d\u000a\u041f\u0440\u043f. \u0424\u0435\u043e\u0434\u043e\u0440\u0438 \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (474 \u2013 491). \u041c\u0447\u0447. \u0414\u0438\u043c\u0438\u0442\u0440\u0456\u044f, \u0404\u0432\u0430\u043d\u0444\u0456\u0457, \u0434\u0440\u0443\u0436\u0438\u043d\u0438 \u0439\u043e\u0433\u043e, \u0456 \u0414\u0438\u043c\u0438\u0442\u0440\u0456\u0430\u043d\u0430, \u0441\u0438\u043d\u0430 \u0457\u0445\u043d\u044c\u043e\u0433\u043e (\u0406). \u041c\u0447\u0447. \u0414\u0456\u043e\u0434\u043e\u0440\u0430 \u0456 \u0414\u0438\u0434\u0438\u043c\u0430, \u0421\u0438\u0440\u0456\u0439\u0441\u044c\u043a\u0438\u0445. \u041c\u0446. \u0404\u0432\u0434\u043e\u043a\u0456\u0457 (\u0406\u0457) \u0420\u0438\u043c\u043b\u044f\u043d\u043a\u0438 (362 \u2013 364). \u041f\u0440\u043f. \u0404\u0444\u0440\u043e\u0441\u0438\u043d\u0430 \u041f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0425).\u000d\u000a\u0413\u0430\u043b., 210 \u0437\u0430\u0447., IV, 8 \u2013 21. \u041c\u043a., 26 \u0437\u0430\u0447., VI, 45 \u2013 53.\u000d\u000a\u041f\u0440\u043f.: \u0413\u0430\u043b., 208 \u0437\u0430\u0447., III, 23 \u2013 29. \u0406\u043d., 28 \u0437\u0430\u0447., VI\u0406\u0406, 3 \u2013 11.\u000d\u000a7\u000d\u000a9\u000d\u000a10\u000d\u000a11\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0420\u0406\u0417\u0414\u0412\u041e \u041f\u0420\u0415\u0421\u0412\u042f\u0422\u041e\u0407 \u0412\u041b\u0410\u0414\u0418\u0427\u0418\u0426\u0406 \u041d\u0410\u0428\u041e\u0407 \u0411\u041e\u0413\u041e\u0420\u041e\u0414\u0418\u0426\u0406 \u0406 \u041f\u0420\u0418\u0421\u041d\u041e\u0414\u0406\u0412\u0418 \u041c\u0410\u0420\u0406\u0407.\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0421\u043e\u0444\u0456\u0457 \u2013 \u041f\u0440\u0435\u043c\u0443\u0434\u0440\u043e\u0441\u0442\u0456 \u0411\u043e\u0436\u043e\u0457 (\u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0457). \u041f\u043e\u0447\u0430\u0457\u0432\u0441\u044c\u043a\u043e\u0457 (1559), \u0414\u043e\u043c\u043d\u0438\u0446\u044c\u043a\u043e\u0457 (1696), \u0425\u043e\u043b\u043c\u0441\u044c\u043a\u043e\u0457, \u041b\u0456\u0441\u043d\u0438\u043d\u0441\u044c\u043a\u043e\u0457 \u0442\u0430 \u000d\u000a\u041a\u0430\u043c\u2019\u044f\u043d\u043a\u0430-\u0421\u0442\u0440\u0443\u043c\u0438\u043b\u043e\u0432\u043e\u0457 (XVII) \u0456\u043a\u043e\u043d \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456.\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 4 \u0437\u0430\u0447., I, 39 \u2013 49, 56.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0424\u043b\u043f., 240 \u0437\u0430\u0447., II, 5 \u2013 11. \u041b\u043a., 54 \u0437\u0430\u0447., X, 38 \u2013 42; XI, 27 \u2013 28.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0422\u0435\u0431\u0435, \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u0430\u044f \u0414\u0456\u0432\u043e, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u000d\u000a\u0441\u0432\u044f\u0442\u0438\u0445 \u0422\u0432\u043e\u0457\u0445 \u0431\u0430\u0442\u044c\u043a\u0456\u0432, \u0456 \u0432\u0441\u0435\u0441\u043b\u0430\u0432\u043d\u0435 \u0441\u043b\u0430\u0432\u0438\u043c\u043e \u0440\u0456\u0437\u0434\u0432\u043e \u0422\u0432\u043e\u0454\u00bb. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \"\u0427\u0435\u0441\u043d\u0456\u0448\u0443...\" \u2013 \u043f\u0440\u0438\u0441\u043f\u0456\u0432\u0438 \u0441\u0432\u044f\u0442\u0430 1-\u0439 \u043f\u0440\u0438\u0441\u043f\u0456\u0432: \"\u0412\u0435\u043b\u0438\u0447\u0430\u0439, \u0434\u0443\u0448\u0435 \u043c\u043e\u044f, \u043f\u0440\u0435\u0441\u043b\u0430\u0432\u043d\u0435 \u000d\u000a\u043d\u0430\u0440\u043e\u0434\u0436\u0435\u043d\u043d\u044f \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456\". \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0430\u043d\u0442\u0438\u0444\u043e\u043d\u0438 \u0441\u0432\u044f\u0442\u043a\u043e\u0432\u0456 (\u0434\u0438\u0432. \u0443 \u0434\u043e\u0434\u0430\u0442\u043a\u0443 \u0441. 84). \u0414\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u043d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 (\u043a\u0440\u0456\u043c \u043d\u0435\u0434\u0456\u043b\u044c\u043d\u0438\u0445 \u0434\u043d\u0456\u0432) \u043f\u0456\u0441\u043b\u044f \u0432\u0445\u043e\u0434\u0443 \u000d\u000a\u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f: \u00ab\u041f\u0440\u0438\u0439\u0434\u0456\u0442\u044c, \u043f\u043e\u043a\u043b\u043e\u043d\u0456\u043c\u043e\u0441\u044c... \u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, \u043c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456\u2026\u00bb. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0414\u043e\u0441\u0442\u043e\u0439\u043d\u043e\u2026\u00bb \u2013 \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0439, \u0434\u0443\u0448\u0435... \u0427\u0443\u0436\u0435 \u000d\u000a\u043c\u0430\u0442\u0435\u0440\u044f\u043c...\u00bb (\u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f).\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a8","62\u000d\u000a\u0421\u0443\u0431\u043e\u0442\u0430 \u043f\u0435\u0440\u0435\u0434 \u0412\u043e\u0437\u0434\u0432\u0438\u0436\u0435\u043d\u043d\u044f\u043c. \u0412\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0430 \u0420\u0456\u0437\u0434\u0432\u0430 \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456. \u0421\u0449\u043c\u0447. \u0410\u0432\u0442\u043e\u043d\u043e\u043c\u0430, \u0454\u043f. \u0406\u0442\u0430\u043b\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (313). \u0421\u0449\u043c\u0447. \u042e\u043b\u0456\u0430\u043d\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 \u0456 \u0437 \u043d\u0438\u043c 40 \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0456\u0432 (\u0406V). \u0421\u0449\u043c\u0447. \u0424\u0435\u0434\u043e\u0440\u0430, \u0454\u043f. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e. \u0421\u0449\u043c\u0447. \u041a\u043e\u0440\u043d\u0443\u0442\u0430, \u0454\u043f. \u041d\u0456\u043a\u043e\u043c\u0438\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (249 \u2013 259).\u000d\u000a\u0421\u0443\u0431\u043e\u0442\u0438 \u043f\u0435\u0440\u0435\u0434 \u0412\u043e\u0437\u0434\u0432\u0438\u0436\u0435\u043d\u043d\u044f\u043c: 1 \u041a\u043e\u0440., 126 \u0437\u0430\u0447., II, 6 \u2013 9. \u041c\u0444., 39 \u0437\u0430\u0447., X, \u000d\u000a37 \u2013 XI, 1.\u000d\u000a\u0420\u044f\u0434.: 1 \u041a\u043e\u0440., 132 \u0437\u0430\u0447., IV, 17 \u2013 V, 5. \u041c\u0444., 97 \u0437\u0430\u0447., XXIV, 1 - 13.\u000d\u000a\u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u043e\u0441\u043e\u0431\u043b\u0438\u0432\u0438\u0439 \u043f\u0440\u043e\u043a\u0438\u043c\u0435\u043d: \u00ab\u0421\u043f\u0456\u0432\u0430\u0439\u0442\u0435 \u0411\u043e\u0433\u0443 \u043d\u0430\u0448\u043e\u043c\u0443, \u0441\u043f\u0456\u0432\u0430\u0439\u0442\u0435\u2026\u00bb.\u000d\u000a\u041f\u0456\u0441\u043b\u044f\u0441\u0432\u044f\u0442\u043e \u0412\u043e\u0437\u0434\u0432\u0438\u0436\u0435\u043d\u043d\u044f. \u0412\u043c\u0447. \u041c\u0438\u043a\u0438\u0442\u0438 (\u0431\u043b. 372). \u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u000d\u000a\u0441\u0432\u0442. \u0410\u043a\u0430\u043a\u0456\u044f, \u0441\u043f\u043e\u0432., \u0454\u043f. \u041c\u0435\u043b\u0456\u0442\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0406\u0406). \u041c\u0447\u0447. \u041c\u0430\u043a\u0441\u0438\u043c\u0430, \u0424\u0435\u043e\u0434\u043e\u0442\u0430, \u043c\u0446. \u000d\u000a\u0410\u0441\u043a\u043b\u0456\u0430\u0434\u0438 (\u0410\u0441\u043a\u043b\u0456\u043f\u0456\u043e\u0434\u043e\u0442\u0438) (305 \u2013 311). \u041c\u0447. \u041f\u043e\u0440\u0444\u0438\u0440\u0456\u044f \u0415\u0444\u0435\u0441\u044c\u043a\u043e\u0433\u043e (361). \u000d\u000a\u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u043f\u0435\u0440\u0448\u043e\u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430 \u0430\u0440\u0445\u0456\u0434\u0438\u044f\u043a. \u0421\u0442\u0435\u0444\u0430\u043d\u0430 (415). \u041f\u0440\u043f. \u0424\u045612\u000d\u000a15\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a15-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456, \u043f\u0435\u0440\u0435\u0434 \u0412\u043e\u0437\u0434\u0432\u0438\u0436\u0435\u043d\u043d\u044f\u043c. \u0413\u043b\u0430\u0441 6-\u0439.\u000d\u000a\u041f\u0435\u0440\u0435\u0434\u0441\u0432\u044f\u0442\u043e \u0412\u043e\u0437\u0434\u0432\u0438\u0436\u0435\u043d\u043d\u044f \u0427\u0435\u0441\u043d\u043e\u0433\u043e \u0425\u0440\u0435\u0441\u0442\u0430 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e. \u041f\u0430\u043c\u2019\u044f\u0442\u044c \u000d\u000a\u043e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f (\u043e\u0441\u0432\u044f\u0447\u0435\u043d\u043d\u044f) \u0445\u0440\u0430\u043c\u0443 \u0412\u043e\u0441\u043a\u0440\u0435\u0441\u0456\u043d\u043d\u044f \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u043e\u0433\u043e \u0432 \u0404\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0456 \u000d\u000a(335). \u0421\u0449\u043c\u0447. \u041a\u043e\u0440\u043d\u0438\u043b\u0456\u044f \u0421\u043e\u0442\u043d\u0438\u043a\u0430, \u0454\u043f. (\u0406). \u041c\u0447\u0447. \u041a\u0440\u043e\u043d\u0456\u0434\u0430, \u041b\u0435\u043e\u043d\u0442\u0456\u044f \u0456 \u0421\u0435\u0440\u0430\u043f\u0456\u043e\u043d\u0430 (\u0431\u043b. 237). \u041c\u0447\u0447. \u0421\u0435\u043b\u0435\u0432\u043a\u0430 \u0456 \u0421\u0442\u0440\u0430\u0442\u043e\u043d\u0456\u043a\u0430 (\u0406\u0406\u0406). \u041c\u0447\u0447. \u041c\u0430\u043a\u0440\u043e\u0432\u0456\u044f \u0456 \u0413\u043e\u0440\u0434\u0456\u0430\u043d\u0430 \u000d\u000a(320). \u0421\u0449\u043c\u0447. \u042e\u043b\u0456\u0430\u043d\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 (\u0406V). \u041c\u0447\u0447. \u0406\u043b\u043b\u0456, \u0417\u043e\u0442\u0438\u043a\u0430, \u041b\u0443\u043a\u0456\u0430\u043d\u0430 \u0456 \u0412\u0430\u043b\u0435\u0440\u0456\u0430\u043d\u0430 (320). \u041f\u0440\u043f. \u041f\u0435\u0442\u0440\u0430 \u0432 \u0410\u0442\u0440\u043e\u0457 (\u0406\u0425). \u0412\u043c\u0446. \u041a\u0435\u0442\u0435\u0432\u0430\u043d\u0456, \u0446\u0430\u0440\u0438\u0446\u0456 \u041a\u0430\u0445\u0435\u0442\u0438\u043d\u0441\u044c\u043a\u043e\u0457 (1624, \u0413\u0440\u0443\u0437.).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 4-\u0435, \u041b\u043a., 112 \u0437\u0430\u0447., XXIV, 1 \u2013 12.\u000d\u000a\u041b\u0456\u0442. \u2013 \u043d\u0435\u0434\u0456\u043b\u0456 \u043f\u0435\u0440\u0435\u0434 \u0412\u043e\u0437\u0434\u0432\u0438\u0436\u0435\u043d\u043d\u044f\u043c: \u0413\u0430\u043b., 215 \u0437\u0430\u0447., VI, 11 \u2013 18. \u0406\u043d., 9 \u0437\u0430\u0447., \u000d\u000aIII, 13 \u2013 17.\u000d\u000a\u041e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044e: \u0404\u0432\u0440., 307 \u0437\u0430\u0447., III, 1 \u2013 4. \u041c\u0444., 67 \u0437\u0430\u0447., XVI, 13 \u2013 18.\u000d\u000a16-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456.\u000d\u000a\u0412\u041e\u0417\u0414\u0412\u0418\u0416\u0415\u041d\u041d\u042f \u0427\u0415\u0421\u041d\u041e\u0413\u041e \u0406 \u0416\u0418\u0412\u041e\u0422\u0412\u041e\u0420\u0427\u041e\u0413\u041e \u0425\u0420\u0415\u0421\u0422\u0410 \u0413\u041e\u0421\u041f\u041e\u0414\u041d\u042c\u041e\u0413\u041e. \u0423\u043f\u043e\u043a\u043e\u0454\u043d\u043d\u044f \u0441\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 \u0417\u043e\u043b\u043e\u0442\u043e\u0443\u0441\u0442\u043e\u0433\u043e (407).\u000d\u000a\u041b\u0456\u0441\u043d\u0438\u043d\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (1683).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 42 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), XII, 28 \u2013 36.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u041a\u043e\u0440., 125 \u0437\u0430\u0447., I, 18 \u2013 24. \u0406\u043d., 60 \u0437\u0430\u0447., XIX, 6 \u2013 11, 13 \u2013 20, 25 \u2013 28, \u000d\u000a30 \u2013 35.\u000d\u000a\u041f\u0456\u0441\u043d\u0438\u0439 \u0434\u0435\u043d\u044c.\u000d\u000a\u041f\u0435\u0440\u0435\u0434 \u0432\u0441\u0435\u043d\u0456\u0447\u043d\u043e\u044e \u043f\u0440\u0438\u043a\u0440\u0430\u0448\u0435\u043d\u0438\u0439 \u043a\u0432\u0456\u0442\u0430\u043c\u0438 \u0425\u0440\u0435\u0441\u0442 \u043f\u0435\u0440\u0435\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u0437 \u0436\u0435\u0440\u0442\u043e\u0432\u043d\u0438\u043a\u0430 \u043d\u0430 \u043f\u0440\u0435\u0441\u0442\u043e\u043b (\u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0425\u0440\u0435\u0441\u0442\u043e\u043f\u043e\u043a\u043b\u043e\u043d\u043d\u043e\u0457 \u043d\u0435\u0434\u0456\u043b\u0456). \u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0422\u0435\u0431\u0435, \u0416\u0438\u0442\u0442\u0454\u0434\u0430\u0432\u0447\u0435 \u0425\u0440\u0438\u0441\u0442\u0435, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u0425\u0440\u0435\u0441\u0442 \u0422\u0432\u0456\u0439 \u000d\u000a\u0441\u0432\u044f\u0442\u0438\u0439, \u043d\u0438\u043c \u0436\u0435 \u0441\u043f\u0430\u0441 \u043d\u0430\u0441 \u0432\u0456\u0434 \u043d\u0435\u0432\u043e\u043b\u0456 \u0432\u043e\u0440\u043e\u0436\u043e\u0457\u00bb. \u041f\u043e\u043b\u0456\u0454\u043b\u0435\u0439 \u0437\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f \u0443 \u000d\u000a\u0432\u0456\u0432\u0442\u0430\u0440\u0456. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \"\u0427\u0435\u0441\u043d\u0456\u0448\u0443...\" \u2013 \u043f\u0440\u0438\u0441\u043f\u0456\u0432\u0438 \u0441\u0432\u044f\u0442\u0430. 1-\u0439 \u043f\u0440\u0438\u0441\u043f\u0456\u0432: \"\u0412\u0435\u043b\u0438\u0447\u0430\u0439, \u000d\u000a\u0434\u0443\u0448\u0435 \u043c\u043e\u044f, \u043f\u0440\u0435\u0447\u0435\u0441\u043d\u0438\u0439 \u0425\u0440\u0435\u0441\u0442 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0456\u0439\". \u041f\u0456\u0441\u043b\u044f \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u0441\u043b\u0430\u0432\u043e\u0441\u043b\u0456\u0432\u2019\u044f \u000d\u000a\u0425\u0440\u0435\u0441\u0442 \u0432\u0438\u043d\u043e\u0441\u0438\u0442\u044c\u0441\u044f \u043d\u0430 \u0441\u0435\u0440\u0435\u0434\u0438\u043d\u0443 \u0445\u0440\u0430\u043c\u0443. \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u2013 \u0430\u043d\u0442\u0438\u0444\u043e\u043d\u0438 \u0441\u0432\u044f\u0442\u0430. \u000d\u000a\u0412\u0445\u0456\u0434\u043d\u0438\u0439 \u0441\u0442\u0438\u0445: \u00ab\u0412\u043e\u0437\u043d\u043e\u0441\u044c\u0442\u0435 \u0413\u043e\u0441\u043f\u043e\u0434\u0430 \u0411\u043e\u0433\u0430 \u043d\u0430\u0448\u043e\u0433\u043e \u0456 \u043f\u043e\u043a\u043b\u043e\u043d\u044f\u0439\u0442\u0435\u0441\u044f \u000d\u000a\u043f\u0456\u0434\u043d\u0456\u0436\u0436\u044e \u043d\u0456\u0433 \u0419\u043e\u0433\u043e, \u0431\u043e \u0412\u0456\u043d \u0421\u0432\u044f\u0442\u0438\u0439\u00bb. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u0442\u0440\u0438\u0441\u0432\u044f\u0442\u043e\u0433\u043e \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u000d\u000a\u00ab\u0425\u0440\u0435\u0441\u0442\u0443 \u0422\u0432\u043e\u0454\u043c\u0443...\u00bb. \u0417 \u0446\u044c\u043e\u0433\u043e \u0434\u043d\u044f \u043d\u0430 \u0430\u0440\u0445\u0456\u0454\u0440\u0435\u0439\u0441\u044c\u043a\u0456\u0439 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0442\u0430 \u0432 \u0441\u0435\u0434\u043c\u0438\u0447\u043d\u0456 \u000d\u000a\u0434\u043d\u0456 \u043f\u0456\u0441\u043b\u044f \u0432\u0445\u043e\u0434\u0443 \u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0430 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f: \u00ab\u041f\u0440\u0438\u0439\u0434\u0456\u0442\u044c, \u043f\u043e\u043a\u043b\u043e\u043d\u0456\u043c\u043e\u0441\u044c\u2026 \u000d\u000a\u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, \u0449\u043e \u043f\u043b\u043e\u0442\u0442\u044e \u0440\u043e\u0437\u0456\u043f\u2019\u044f\u0432\u0441\u044f\u2026\u00bb. \u0425\u0440\u0435\u0441\u0442 \u0437\u0430\u043b\u0438\u0448\u0430\u0454\u0442\u044c\u0441\u044f \u000d\u000a\u043f\u043e\u0441\u0435\u0440\u0435\u0434 \u0445\u0440\u0430\u043c\u0443 \u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0430.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a13\u000d\u000a14","63\u000d\u000a\u043b\u043e\u0444\u0435\u044f, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u0432 \u041c\u0430\u043b\u0456\u0439 \u0410\u0437\u0456\u0457 (\u0425). \u0421\u0432\u0442. \u0419\u043e\u0441\u0438\u0444\u0430, \u0454\u043f. \u0410\u043b\u0430\u0432\u0435\u0440\u0434\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(570, \u0413\u0440\u0443\u0437.). \u0421\u0432\u0442. \u0421\u0438\u043c\u0435\u043e\u043d\u0430, \u0430\u0440\u0445\u0456\u0454\u043f. \u0421\u043e\u043b\u0443\u043d\u0441\u044c\u043a\u043e\u0433\u043e (1429).\u000d\u000a\u041d\u043e\u0432\u043e\u043c\u0438\u043a\u0438\u0442\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (372).\u000d\u000a\u0413\u0430\u043b., 211 \u0437\u0430\u0447., IV, 28 \u2013 V, 10. \u041c\u043a., 27 \u0437\u0430\u0447., VI, 54 \u2013 VII, 8 (\u0437\u0430 \u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a, \u000d\u000a\u043f\u0456\u0434 \u0437\u0430\u0447\u0430\u043b\u043e).\u000d\u000a\u0413\u0430\u043b., 212 \u0437\u0430\u0447., V, 11 \u2013 21. \u041c\u043a., 28 \u0437\u0430\u0447., VII, 5 \u2013 16 (\u0437\u0430 \u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a).\u000d\u000a\u0412\u043c\u0447.: 2 \u0422\u0438\u043c., 292 \u0437\u0430\u0447., II, 1 \u2013 10. \u041c\u0444., 36 \u0437\u0430\u0447., \u0425, 16 \u2013 22.\u000d\u000a\u0412\u043c\u0446. \u0404\u0432\u0444\u0438\u043c\u0456\u0457 \u0412\u0441\u0435\u0445\u0432\u0430\u043b\u044c\u043d\u043e\u0457 (304). \u041c\u0446. \u0421\u0435\u0432\u0430\u0441\u0442\u0456\u0430\u043d\u0438 (\u0406). \u041c\u0446. \u041c\u0435\u043b\u0456\u0442\u0438\u043d\u0438 \u000d\u000a(\u0406\u0406). \u041c\u0447\u0447. \u0412\u0456\u043a\u0442\u043e\u0440\u0430 \u0456 \u0421\u043e\u0441\u0444\u0435\u043d\u0430 (\u0431\u043b. 304). \u041f\u0440\u043f. \u0414\u043e\u0440\u043e\u0444\u0435\u044f, \u043f\u0443\u0441\u0442\u0435\u043b\u044c\u043d\u0438\u043a\u0430 \u000d\u000a\u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u041c\u0446. \u041b\u044e\u0434\u043c\u0438\u043b\u0438, \u043a\u043d. \u0427\u0435\u0441\u044c\u043a\u043e\u0457 (927). \u041c\u0447\u0447. \u0431\u0440\u0430\u0442\u0456\u0432 \u0419\u043e\u0441\u0438\u0444\u0430 \u0442\u0430 \u0406\u0441\u0430\u043a\u0430 (808, \u0413\u0440\u0443\u0437.). \u0421\u0432\u0442. \u041a\u0438\u043f\u0440\u0456\u0430\u043d\u0430, \u043c\u0438\u0442\u0440. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0432\u0441\u0456\u0454\u0457 \u0420\u0443\u0441\u0438, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (1406).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456, \u0437\u0432\u0430\u043d\u043e\u0457 \u00ab\u0417\u0433\u043b\u044f\u043d\u044c\u0441\u044f \u043d\u0430 \u0441\u043c\u0438\u0440\u0435\u043d\u043d\u044f\u00bb (1420).\u000d\u000a\u0413\u0430\u043b., 214 \u0437\u0430\u0447., VI, 2 \u2013 10. \u041c\u043a., 29 \u0437\u0430\u0447., VII, 14 \u2013 24.\u000d\u000a\u0412\u043c\u0446.: 2 \u041a\u043e\u0440., 181 \u0437\u0430\u0447., VI, 1 \u2013 10. \u041b\u043a., 33 \u0437\u0430\u0447., VII, 36 \u2013 50.\u000d\u000a\u041c\u0446\u0446. \u0412\u0456\u0440\u0438, \u041d\u0430\u0434\u0456\u0457, \u041b\u044e\u0431\u043e\u0432\u0456 \u0442\u0430 \u043c\u0430\u0442\u0435\u0440\u0456 \u0457\u0445 \u0421\u043e\u0444\u0456\u0457 (\u0431\u043b. 137). \u041c\u0446\u0446. \u0424\u0435\u043e\u0434\u043e\u0442\u0456\u0457 (\u0431\u043b. 230) \u0456 \u0410\u0433\u0430\u0444\u043e\u043a\u043b\u0456\u0457. \u041c\u0447\u0447. 156: \u0441\u0449\u043c\u0447\u0447. \u041f\u0435\u043b\u0456\u044f \u0442\u0430 \u041d\u0456\u043b\u0430, \u0454\u043f\u043f. \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u0438\u0445, \u0417\u0438\u043d\u043e\u043d\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u043c\u0447\u0447. \u041f\u0430\u0442\u0435\u0440\u043c\u0443\u0444\u0456\u044f, \u0406\u043b\u043b\u0456 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 (310). \u000d\u000a\u0421\u0432\u0442. \u0406\u043e\u0430\u043a\u0438\u043c\u0430 (\u041f\u0430\u043d\u0456), \u043f\u0430\u0442\u0440. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (1567).\u000d\u000a\u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (1071).\u000d\u000a\u0415\u0444., 216 \u0437\u0430\u0447., I, 1 \u2013 9. \u041c\u043a., 30 \u0437\u0430\u0447., VII, 24 \u2013 30. \u000d\u000a\u041c\u0446\u0446.: 2 \u041a\u043e\u0440, 182 \u0437\u0430\u0447., VI, 1 \u2013 10. \u041c\u0444., 62 \u0437\u0430\u0447., \u0425V, 21 \u2013 28.\u000d\u000a\u041f\u0440\u043f. \u0404\u0432\u043c\u0435\u043d\u0456\u044f, \u0454\u043f. \u0413\u043e\u0440\u0442\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406\u0406). \u041c\u0446. \u0410\u0440\u0456\u0430\u0434\u043d\u0438 \u0424\u0440\u0438\u0433\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (\u0406\u0406). \u000d\u000a\u041c\u0446\u0446. \u0421\u043e\u0444\u0456\u0457 \u0442\u0430 \u0406\u0440\u0438\u043d\u0438 (\u0406\u0406\u0406). \u041c\u0447. \u041a\u0430\u0441\u0442\u043e\u0440\u0430. \u041c\u0447\u0447. \u0411\u0438\u0434\u0437\u0438\u043d\u0438, \u0428\u0430\u043b\u0432\u0438 \u0456 \u0415\u043b\u0456\u0437\u0431\u0430\u0440\u0430, \u043a\u043d\u044f\u0437\u0456\u0432 \u041a\u0441\u0430\u043d\u0441\u044c\u043a\u0438\u0445 (1660, \u0413\u0440\u0443\u0437.).\u000d\u000a\u041c\u043e\u043b\u0447\u0435\u043d\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (1405).\u000d\u000a\u0415\u0444., 217 \u0437\u0430\u0447., I, 7 \u2013 17. \u041c\u043a., 32 \u0437\u0430\u0447., VIII, 1 \u2013 10.\u000d\u000a\u0421\u0443\u0431\u043e\u0442\u0430 \u043f\u0456\u0441\u043b\u044f \u0412\u043e\u0437\u0434\u0432\u0438\u0436\u0435\u043d\u043d\u044f. \u041c\u0447\u0447. \u0422\u0440\u043e\u0444\u0438\u043c\u0430, \u0421\u0430\u0432\u0430\u0442\u0456\u044f \u0456 \u0414\u043e\u0440\u0438\u043c\u0435\u0434\u043e\u043d\u0442\u0430 (276). \u041f\u0440\u043c\u0447. \u0417\u043e\u0441\u0438\u043c\u0438, \u043f\u0443\u0441\u0442\u0435\u043b\u044c\u043d\u0438\u043a\u0430 (\u0406V). \u0411\u043b\u0433\u0432. \u043a\u043d. \u0406\u0433\u043e\u0440\u044f \u0427\u0435\u0440\u043d\u0456\u0433\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0442\u0430 \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1147).\u000d\u000a\u0421\u0443\u0431\u043e\u0442\u0438 \u043f\u0456\u0441\u043b\u044f \u0412\u043e\u0437\u0434\u0432\u0438\u0436\u0435\u043d\u043d\u044f: 1 \u041a\u043e\u0440., 125 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), I, 26 \u2013 29. \u000d\u000a\u0406\u043d., 30 \u0437\u0430\u0447., VIII, 21 \u2013 30.\u000d\u000a\u0411\u043b\u0433\u0432.: \u0414\u0456\u044f\u043d., 17 \u0437\u0430\u0447., V\u0406, 8 \u2013 V\u0406\u0406, 5, 58 \u201360. \u0406\u043d., 52 \u0437\u0430\u0447., XV, 17 \u2013 XVI, 2.\u000d\u000a\u0420\u044f\u0434.: 1 \u041a\u043e\u0440., 146 \u0437\u0430\u0447., X, 23 \u2013 28. \u041c\u0444., 101 \u0437\u0430\u0447., XXIV, 34 \u2013 44 (\u043f\u0456\u0434 \u0437\u0430\u0447\u0430\u043b\u043e).\u000d\u000a16\u000d\u000a17\u000d\u000a18\u000d\u000a19\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a16-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456, \u043f\u0456\u0441\u043b\u044f \u0412\u043e\u0437\u0434\u0432\u0438\u0436\u0435\u043d\u043d\u044f. \u0413\u043b\u0430\u0441 7-\u0439.\u000d\u000a\u0412\u043c\u0447. \u0404\u0432\u0441\u0442\u0430\u0444\u0456\u044f \u041f\u043b\u0430\u043a\u0438\u0434\u0438, \u0434\u0440\u0443\u0436\u0438\u043d\u0438 \u0439\u043e\u0433\u043e \u0424\u0435\u043e\u043f\u0456\u0441\u0442\u0456\u0457 \u0442\u0430 \u0441\u0438\u043d\u0456\u0432 \u0457\u0445\u043d\u0456\u0445 \u0410\u0433\u0430\u043f\u0456\u044f \u0442\u0430 \u0424\u0435\u043e\u043f\u0456\u0441\u0442\u0430 (\u0431\u043b. 118). \u041c\u0447\u0447. \u0442\u0430 \u0441\u043f\u043e\u0432\u0432. \u041c\u0438\u0445\u0430\u0457\u043b\u0430, \u043a\u043d. \u0427\u0435\u0440\u043d\u0456\u0433\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u0431\u043e\u044f\u0440\u0438\u043d\u0430 \u0439\u043e\u0433\u043e \u0424\u0435\u0434\u043e\u0440\u0430, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u0456\u0432 (1245). \u041f\u0440\u043f. \u0456 \u000d\u000a\u0431\u043b\u0433\u0432. \u043a\u043d. \u0427\u0435\u0440\u043d\u0456\u0433\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u041e\u043b\u0435\u0433\u0430 \u0420\u043e\u043c\u0430\u043d\u043e\u0432\u0438\u0447\u0430 (\u0431\u043b. 1285). \u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u043c\u0447. \u041f\u0430\u0440\u0444\u0435\u043d\u0456\u044f \u0416\u043e\u0432\u043a\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e \u043d\u0430 \u000d\u000a\u0413\u0430\u043b\u0438\u0447\u0438\u043d\u0443 (1784) (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043e \u0443 \u043d\u0435\u0434\u0456\u043b\u044e \u043f\u0456\u0441\u043b\u044f \u0412\u043e\u0437\u0434\u0432\u0438\u0436\u0435\u043d\u043d\u044f).\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a20","64\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 5-\u0435, \u041b\u043a., 113 \u0437\u0430\u0447., XXIV, 12 \u2013 35.\u000d\u000a\u041b\u0456\u0442. \u2013 \u043d\u0435\u0434\u0456\u043b\u0456 \u043f\u0456\u0441\u043b\u044f \u0412\u043e\u0437\u0434\u0432\u0438\u0436\u0435\u043d\u043d\u044f: \u0413\u0430\u043b., 203 \u0437\u0430\u0447., II, 16 \u2013 20. \u041c\u043a., 37 \u0437\u0430\u0447., \u000d\u000aVIII, 34 \u2013 IX, 1.\u000d\u000a\u0412\u043c\u0447.: \u0415\u0444., 233 \u0437\u0430\u0447., VI, 10 \u2013 17. \u041b\u043a., 106 \u0437\u0430\u0447., XXI, 12 \u2013 19.\u000d\u000a17-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0412\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0430 \u0412\u043e\u0437\u0434\u0432\u0438\u0436\u0435\u043d\u043d\u044f \u0416\u0438\u0432\u043e\u0442\u0432\u043e\u0440\u0447\u043e\u0433\u043e \u0425\u0440\u0435\u0441\u0442\u0430 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e. \u0410\u043f. \u0432\u0456\u0434 70-\u0445 \u041a\u043e\u0434\u0440\u0430\u0442\u0430 \u000d\u000a(\u0431\u043b. 130). \u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u0441\u0432\u0442. \u0414\u0438\u043c\u0438\u0442\u0440\u0456\u044f (\u0422\u0443\u043f\u0442\u0430\u043b\u0430), \u043c\u0438\u0442\u0440. \u0420\u043e\u0441\u0442\u043e\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1752). \u0421\u0449\u043c\u0447\u0447. \u0406\u043f\u0430\u0442\u0456\u044f, \u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0430, \u0442\u0430 \u0410\u043d\u0434\u0440\u0456\u044f, \u043f\u0440\u0435\u0441\u0432\u0456\u0442. (\u0431\u043b.730 \u000d\u000a\u2013 735). \u0421\u0432\u0442\u0442. \u0406\u0441\u0430\u043a\u0456\u044f \u0456 \u041c\u0435\u043b\u0435\u0442\u0456\u044f, \u0454\u043f\u043f. \u041a\u0456\u043f\u0440\u0441\u044c\u043a\u0438\u0445. \u041c\u0447\u0447. \u0404\u0432\u0441\u0435\u0432\u0456\u044f \u0456 \u041f\u0440\u0438\u0441\u043a\u0430. \u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 35 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b.), X, 1 \u2013 9. \u000d\u000a\u041b\u0456\u0442. \u2013 \u0415\u0444., 219 \u0437\u0430\u0447., I, 22 \u2013 II, 3. \u041c\u043a., 48 \u0437\u0430\u0447., X, 46 \u2013 52.\u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 318 \u0437\u0430\u0447., VII, 26 \u2013 VIII, 2. \u0406\u043d., 36 \u0437\u0430\u0447., X, 9 \u2013 16. \u000d\u000a\u041f\u0456\u0441\u043b\u044f \u0432\u0456\u0434\u043f\u0443\u0441\u0442\u0443 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0438\u043a \u0447\u0435\u0440\u0435\u0437 \u0426\u0430\u0440\u0441\u044c\u043a\u0456 \u0432\u0440\u0430\u0442\u0430 \u0432\u0438\u0445\u043e\u0434\u0438\u0442\u044c \u0434\u043e \u000d\u000a\u0430\u043d\u0430\u043b\u043e\u044f, \u043d\u0430 \u044f\u043a\u043e\u043c\u0443 \u043b\u0435\u0436\u0438\u0442\u044c \u0425\u0440\u0435\u0441\u0442, \u0456, \u043e\u0431\u043a\u0430\u0434\u0438\u0432\u0448\u0438 \u0439\u043e\u0433\u043e \u0442\u0440\u0438\u0447\u0456, \u0432 \u0441\u0443\u043f\u0440\u043e\u0432\u043e\u0434\u0456 \u000d\u000a\u0434\u0438\u044f\u043a\u043e\u043d\u0430 \u0447\u0438 \u0441\u0432\u0456\u0447\u043a\u043e\u043d\u043e\u0441\u0446\u044f \u043f\u0456\u0434 \u0447\u0430\u0441 \u0441\u043f\u0456\u0432\u0443 \u0442\u0440\u043e\u043f\u0430\u0440\u044f \u0456 \u043a\u043e\u043d\u0434\u0430\u043a\u0430 \u0437\u0430\u043d\u043e\u0441\u0438\u0442\u044c \u0425\u0440\u0435\u0441\u0442 \u000d\u000a\u0443 \u0432\u0456\u0432\u0442\u0430\u0440, \u043f\u043e\u043a\u043b\u0430\u0434\u0430\u0454 \u0439\u043e\u0433\u043e \u043d\u0430 \u043f\u0440\u0435\u0441\u0442\u0456\u043b \u0456 \u043d\u0430 \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u044f \u043a\u0430\u0434\u0438\u0442\u044c.\u000d\u000a\u041f\u0440\u043e\u0440. \u0406\u043e\u043d\u0438 (V\u0406\u0406\u0406 \u0441\u0442. \u0434\u043e \u0420. \u0425.). \u0421\u0449\u043c\u0447. \u0424\u043e\u043a\u0438, \u0454\u043f. \u0421\u0438\u043d\u043e\u043f\u0441\u044c\u043a\u043e\u0433\u043e (117). \u000d\u000a\u041f\u0440\u043f. \u0406\u043e\u043d\u0438, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 (\u0406\u0425), \u0431\u0430\u0442\u044c\u043a\u0430 \u0441\u0449\u043c\u0447. \u0424\u0435\u043e\u0444\u0430\u043d\u0430, \u0454\u043f., \u0442\u0432\u043e\u0440\u0446\u044f \u043a\u0430\u043d\u043e\u043d\u0456\u0432, \u0456 \u043f\u0440\u043c\u0447. \u0424\u0435\u0434\u043e\u0440\u0430, \u041d\u0430\u043a\u0440\u0435\u0441\u043b\u0435\u043d\u0438\u0445. \u041c\u0447. \u0424\u043e\u043a\u0438 \u0421\u0438\u043d\u043e\u043f\u0441\u044c\u043a\u043e\u0433\u043e, \u0441\u0430\u0434\u0456\u0432\u043d\u0438\u043a\u0430 \u000d\u000a(\u0431\u043b. 320). \u041f\u0440\u0430\u0432. \u041f\u0435\u0442\u0440\u0430, \u043a\u043e\u043b\u0438\u0448\u043d\u044c\u043e\u0433\u043e \u043c\u0438\u0442\u0430\u0440\u044f (V\u0406).\u000d\u000a\u0415\u0444., 222 \u0437\u0430\u0447., II, 19 \u2013 III, 7. \u041c\u043a., 50 \u0437\u0430\u0447., XI, 11 \u2013 23.\u000d\u000a\u0421\u0449\u043c\u0447.: \u0404\u0432\u0440., 311 \u0437\u0430\u0447., IV, 14 \u2013 V, 6. \u0406\u043d., 36 \u0437\u0430\u0447., X, 9 \u2013 16.\u000d\u000a\u0417\u0430\u0447\u0430\u0442\u0442\u044f \u0447\u0435\u0441\u043d\u043e\u0433\u043e \u0441\u043b\u0430\u0432\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0440\u043e\u043a\u0430, \u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456 \u0456 \u0425\u0440\u0435\u0441\u0442\u0438\u0442\u0435\u043b\u044f \u0406\u043e\u0430\u043d\u0430. \u041f\u0440\u043f\u043f. \u0436\u0456\u043d\u043e\u043a \u041a\u0441\u0430\u043d\u0444\u0438\u043f\u0438 \u0442\u0430 \u041f\u043e\u043b\u0456\u043a\u0441\u0435\u043d\u0456\u0457 (109). \u041c\u0446. \u0406\u0440\u0430\u0457\u0434\u0438 (\u0420\u0430\u0457\u0441\u0438), \u0434\u0456\u0432\u0438 \u000d\u000a(\u0431\u043b. 308). \u041c\u0447\u0447. \u0410\u043d\u0434\u0440\u0456\u044f, \u0406\u043e\u0430\u043d\u0430 \u0456 \u0441\u0438\u043d\u0456\u0432 \u0406\u043e\u0430\u043d\u043e\u0432\u0438\u0445 \u041f\u0435\u0442\u0440\u0430 \u0442\u0430 \u0410\u043d\u0442\u043e\u043d\u0456\u043d\u0430 (\u0406\u0425).\u000d\u000a\u0415\u0444., 223 \u0437\u0430\u0447., III, 8 \u2013 21. \u041c\u043a., 51 \u0437\u0430\u0447., XI, 23 \u2013 26.\u000d\u000a\u041f\u0440\u0435\u0434\u0442\u0435\u0447\u0456: \u0413\u0430\u043b., 210 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), IV, 22 \u2013 31. \u041b\u043a., 2 \u0437\u0430\u0447., I, 5 \u2013 25.\u000d\u000a\u0420\u0456\u0432\u043d\u043e\u0430\u043f. \u0424\u0435\u043a\u043b\u0438, \u043f\u0435\u0440\u0448\u043e\u043c\u0446. (\u0406). \u041f\u0440\u043f. \u0424\u0435\u043e\u0434\u043e\u0441\u0456\u044f \u041c\u0430\u043d\u044f\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1629).\u000d\u000a\u041f\u0440\u043f. \u041a\u043e\u043f\u0440\u0456\u044f \u041f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e (530). \u0421\u0432. \u043a\u043d. \u0421\u0442\u0435\u0444\u0430\u043d\u0430 \u0421\u0435\u0440\u0431\u0441\u044c\u043a\u043e\u0433\u043e (1224) \u000d\u000a\u0442\u0430 \u0441\u0438\u043d\u0430 \u0439\u043e\u0433\u043e \u0441\u0432. \u043a\u043d. \u0412\u043b\u0430\u0434\u0438\u0441\u043b\u0430\u0432\u0430 \u0421\u0435\u0440\u0431\u0441\u044c\u043a\u043e\u0433\u043e (1230 \u2013 1239). \u041f\u0440\u043f. \u0421\u0438\u043b\u0443\u0430\u043d\u0430 \u0410\u0444\u043e\u043d\u0441\u044c\u043a\u043e\u0433\u043e (1938).\u000d\u000a\u0415\u0444., 225 \u0437\u0430\u0447., IV, 14 \u2013 19. \u041c\u043a., 52 \u0437\u0430\u0447., XI, 27 \u2013 33.\u000d\u000a\u041f\u0440\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u041f\u0440\u043f. \u0404\u0444\u0440\u043e\u0441\u0438\u043d\u0456\u0457 \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (V). \u041f\u0440\u043f. \u0421\u0435\u0440\u0433\u0456\u044f, \u0456\u0433\u0443\u043c. \u0420\u0430\u0434\u043e\u043d\u0435\u0437\u044c\u043a\u043e\u0433\u043e, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (1392). \u041f\u0440\u043c\u0447. \u041f\u0430\u0444\u043d\u0443\u0442\u0456\u044f \u0454\u0433\u0438\u043f\u0442\u044f\u043d\u0438\u043d\u0430 \u0456 \u0437 \u043d\u0438\u043c 546 \u043c\u0447\u0447. (\u0406\u0406\u0406). \u000d\u000a\u041f\u0440\u043f. \u0404\u0444\u0440\u043e\u0441\u0438\u043d\u0456\u0457, \u043a\u043d\u044f\u0436\u043d\u0438 \u0427\u0435\u0440\u043d\u0456\u0433\u0456\u0432\u0441\u044c\u043a\u043e\u0457, \u0456\u0433\u0443\u043c. \u0421\u0443\u0437\u0434\u0430\u043b\u044c\u0441\u044c\u043a\u043e\u0457 \u000d\u000a(1250).\u000d\u000a\u0415\u0444., 226 \u0437\u0430\u0447., IV, 17 \u2013 25. \u041c\u043a., 53 \u0437\u0430\u0447., XII, 1 \u2013 12 (\u0437\u0430 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e).\u000d\u000a1 \u041a\u043e\u0440., 156 \u0437\u0430\u0447., XIV, 20 \u2013 25. \u041c\u0444., 104 \u0437\u0430\u0447., XXV, 1 \u2013 13 (\u0437\u0430 \u0441\u0443\u0431\u043e\u0442\u0443).\u000d\u000a21\u000d\u000a22\u000d\u000a23\u000d\u000a24\u000d\u000a25\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f","65\u000d\u000a\u0410\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u0456 \u0454\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0441\u0442\u0430 \u0406\u043e\u0430\u043d\u0430 \u0411\u043e\u0433\u043e\u0441\u043b\u043e\u0432\u0430 (\u043f\u043e\u0447\u0430\u0442\u043e\u043a \u0406\u0406).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 67 \u0437\u0430\u0447., XXI, 15 \u2013 25.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0410\u043f.: 1 \u0406\u043d., 73 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), IV, 12 \u2013 19. \u0406\u043d., 61 \u0437\u0430\u0447., XIX, 25 \u2013 \u000d\u000a27; XXI, 24 \u2013 25.\u000d\u000a17-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 8-\u0439.\u000d\u000a\u041c\u0447\u0447. \u041a\u0430\u043b\u0456\u0441\u0442\u0440\u0430\u0442\u0430 \u0456 \u0432\u043e\u0457\u043d\u0456\u0432 \u0439\u043e\u0433\u043e: \u0413\u0456\u043c\u043d\u0430\u0441\u0456\u044f \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 (304). \u0410\u043f\u043f. \u0432\u0456\u0434 70-\u0445: \u000d\u000a\u041c\u0430\u0440\u043a\u0430, \u0410\u0440\u0438\u0441\u0442\u0430\u0440\u0445\u0430 \u0456 \u0417\u0456\u043d\u0438 (\u0406). \u041c\u0446. \u0404\u043f\u0438\u0445\u0430\u0440\u0456\u0457 \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0457 (\u0406\u0406\u0406). \u041f\u0440\u043f. \u0406\u0433\u043d\u0430\u0442\u0456\u044f \u000d\u000a\u041a\u0430\u043f\u043f\u0430\u0434\u043e\u043a\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0456\u0433\u0443\u043c. (\u0425).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 6-\u0435, \u041b\u043a., 114 \u0437\u0430\u0447., XXIV, 36 \u2013 53.\u000d\u000a\u041b\u0456\u0442. \u2013 2 \u041a\u043e\u0440., 182 \u0437\u0430\u0447., VI, 16 \u2013 VII,1. \u041c\u0444., 62 \u0437\u0430\u0447., XV, 21 \u2013 28.\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a26\u000d\u000a27\u000d\u000a18-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u041f\u0440\u043f. \u0425\u0430\u0440\u0438\u0442\u043e\u043d\u0430 \u0421\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u043a\u0430 \u000d\u000a(\u0431\u043b. 350). \u0421\u043e\u0431\u043e\u0440 \u043f\u0440\u0435\u043f\u043e\u0434\u043e\u0431\u043d\u0438\u0445 \u043e\u0442\u0446\u0456\u0432 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u0438\u0445, \u044f\u043a\u0456 \u0432 \u000d\u000a\u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u043f\u0440\u043f. \u0410\u043d\u0442\u043e\u043d\u0456\u044f) \u0441\u043f\u043e\u0447\u0438\u0432\u0430\u044e\u0442\u044c: \u0410\u043d\u0442\u043e\u043d\u0456\u044f, \u0437\u0430\u0441\u043d\u043e\u0432\u043d\u0438\u043a\u0430 \u041b\u0430\u0432\u0440\u0438 (1073), \u041f\u0440\u043e\u0445\u043e\u0440\u0430, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (1107), \u0406\u043e\u0430\u043d\u0430, \u043f\u043e\u0441\u043d\u0438\u043a\u0430 \u000d\u000a(\u0425\u0406\u0406), \u042e\u043b\u0456\u0430\u043d\u0456\u0457, \u0434\u0456\u0432\u0438, \u043a\u043d. \u041e\u043b\u044c\u0448\u0430\u043d\u0441\u044c\u043a\u043e\u0457 (\u0431\u043b. 1550), \u043f\u0440\u043c\u0447\u0447. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0456 \u0424\u0435\u0434\u043e\u0440\u0430 (1098), \u041f\u043e\u043b\u0456\u043a\u0430\u0440\u043f\u0430, \u0430\u0440\u0445\u0456\u043c. \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e (1182), \u0412\u0430\u0440\u043b\u0430\u0430\u043c\u0430, \u000d\u000a\u0456\u0433\u0443\u043c. \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e (1065), \u041d\u0438\u043a\u043e\u043d\u0430, \u0456\u0433\u0443\u043c. \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(1088), \u0414\u0430\u043c\u0456\u0430\u043d\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442., \u0446\u0456\u043b\u0438\u0442\u0435\u043b\u044f (1071), \u041d\u0438\u043a\u043e\u0434\u0438\u043c\u0430, \u043f\u0440\u043e\u0441\u0444\u043e\u0440\u043d\u0438\u043a\u0430 (\u0425\u0406\u0406), \u041b\u0430\u0432\u0440\u0435\u043d\u0442\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d., \u0454\u043f. \u0422\u0443\u0440\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e (\u0425\u0406\u0406), \u0410\u0444\u0430\u043d\u0430\u0441\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. \u000d\u000a(\u0431\u043b. 1176), \u0415\u0440\u0430\u0437\u043c\u0430 (\u0431\u043b. 1160), \u041b\u0443\u043a\u0438, \u0456\u043a\u043e\u043d\u043e\u043c\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(\u0425\u0406\u0406\u0406), \u0410\u0433\u0430\u043f\u0456\u0442\u0430, \u043b\u0456\u043a\u0430\u0440\u044f \u0431\u0435\u0437\u0432\u0456\u0434\u043f\u043b\u0430\u0442\u043d\u043e\u0433\u043e (\u0431\u043b. 1095), \u0424\u0435\u043e\u0444\u0456\u043b\u0430, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 (\u0425\u0406\u0406 \u2013 \u0425\u0406\u0406\u0406), \u0424\u0435\u043e\u0444\u0456\u043b\u0430 \u0442\u0430 \u0406\u043e\u0430\u043d\u0430 (\u0425\u0406\u0406), \u041d\u0435\u043a\u0442\u0430\u0440\u0456\u044f (\u0425\u0406\u0406), \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f, \u0456\u043a\u043e\u043d\u043e\u043f\u0438\u0441\u0446\u044f (\u0425\u0406\u0406), \u0441\u0449\u043c\u0447. \u041a\u0443\u043a\u0448\u0456 (\u0425\u0406\u0406), \u0404\u0432\u0441\u0442\u0440\u0430\u0442\u0456\u044f (\u0425\u0406\u0406\u0406), \u0404\u0444\u0440\u0435\u043c\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 \u000d\u000a(\u0425\u0406\u0406\u0406), \u0406\u0454\u0440\u043e\u043d\u0456\u043c\u0430, \u0437\u0430\u0442\u0432., \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (\u0425\u0406\u0406\u0406), \u0406\u043b\u0430\u0440\u0456\u043e\u043d\u0430, \u043c\u0438\u0442\u0440. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(\u0431\u043b\u0438\u0437\u044c\u043a\u043e 1053), \u0406\u043e\u0430\u043d\u0430, \u043e\u0442\u0440\u043e\u043a\u0430 \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u0441\u0438\u043d\u0430 \u043c\u0447. \u0424\u0435\u0434\u043e\u0440\u0430 \u0412\u0430\u0440\u044f\u0433\u0430 \u000d\u000a(983), \u041c\u0435\u043b\u0430\u0434\u0456\u044f, \u0441\u0442\u0430\u0440\u0446\u044f \u0447\u0443\u0434\u043e\u0442\u0432. (\u0425\u0406\u0406\u0406), \u041f\u0430\u0432\u043b\u0430 \u041f\u043e\u0441\u043b\u0443\u0448\u043d\u043e\u0433\u043e (\u0425\u0406\u0406\u0406), \u0413\u0435\u043e\u0440\u0433\u0456\u044f (\u0425\u0406\u0406\u0406), \u0421\u0438\u043c\u0435\u043e\u043d\u0430, \u0441\u0449\u043c\u0447. \u0454\u043f. \u041f\u0435\u0440\u0435\u044f\u0441\u043b\u0430\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1230), \u0424\u0435\u043e\u043a\u0442\u0438\u0441\u0442\u0430, \u000d\u000a\u0454\u043f. \u0427\u0435\u0440\u043d\u0456\u0433\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1123). \u041e\u043b\u0435\u043a\u0441\u0456\u044f (\u0425\u0406\u0406\u0406), \u0421\u0430\u0432\u0438 (\u0425\u0406\u0406\u0406), \u0421\u0435\u0440\u0433\u0456\u044f \u041f\u043e\u0441\u043b\u0443\u0448\u043d\u043e\u0433\u043e (\u0425\u0406\u0406\u0406), \u041c\u0435\u0440\u043a\u0443\u0440\u0456\u044f, \u0454\u043f. \u0421\u043c\u043e\u043b\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e (1239), \u041f\u0438\u043c\u0435\u043d\u0430 \u0411\u0430\u0433\u0430\u0442\u043e\u0445\u0432\u043e\u0440\u043e\u0431\u043b\u0438\u0432\u043e\u0433\u043e (1110), \u041d\u0435\u0441\u0442\u043e\u0440\u0430 \u041b\u0456\u0442\u043e\u043f\u0438\u0441\u0446\u044f (\u0431\u043b. 1114), \u043f\u0440\u043c\u0447. \u0404\u0432\u0441\u0442\u0440\u0430\u0442\u0456\u044f \u000d\u000a(1097), \u0415\u043b\u043b\u0430\u0434\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. (\u0425\u0406\u0406 \u2013 \u0425\u0406\u0406\u0406), \u0404\u0440\u0435\u043c\u0456\u0457, \u043f\u0440\u043e\u0437\u043e\u0440\u043b\u0438\u0432\u043e\u0433\u043e (\u0431\u043b. 1070), \u000d\u000a\u043f\u0440\u043c\u0447. \u041c\u043e\u0439\u0441\u0435\u044f \u0423\u0433\u0440\u0438\u043d\u0430 (1031 \u2013 1043), \u0406\u043e\u0430\u043d\u0430 \u0411\u0430\u0433\u0430\u0442\u043e\u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u000d\u000a(1160), \u041c\u0430\u0440\u043a\u0430, \u0433\u0440\u043e\u0431\u043e\u043a\u043e\u043f\u0430\u0447\u0430 (\u0425\u0406\u0406), \u041c\u0438\u043a\u043e\u043b\u0438 \u0421\u0432\u044f\u0442\u043e\u0448\u0456, \u043a\u043d. \u0427\u0435\u0440\u043d\u0456\u0433\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (1143), \u043c\u0447. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (1093), \u041e\u043d\u0438\u0441\u0438\u043c\u0430, \u000d\u000a\u0437\u0430\u0442\u0432\u043e\u0440\u043d. (\u0425\u0406\u0406 \u2013 \u0425\u0406\u0406\u0406), \u041c\u0430\u0442\u0444\u0435\u044f, \u043f\u0440\u043e\u0437\u043e\u0440\u043b\u0438\u0432\u043e\u0433\u043e (\u0431\u043b. 1085), \u0406\u0441\u0430\u0457, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (1115), \u0410\u0432\u0440\u0430\u0430\u043c\u0456\u044f \u041f\u0440\u0430\u0446\u0435\u043b\u044e\u0431\u043d\u043e\u0433\u043e (\u0425\u0406\u0406 \u2013 \u0425\u0406\u0406\u0406), \u041d\u0438\u0444\u043e\u043d\u0442\u0430, \u0454\u043f. \u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\u0441\u044c\u043a\u043e\u0433\u043e (1156), \u0421\u0438\u043b\u044c\u0432\u0435\u0441\u0442\u0440\u0430 (\u0425\u0406\u0406), \u041f\u0438\u043c\u0435\u043d\u0430, \u043f\u043e\u0441\u043d\u0438\u043a\u0430 (\u0425\u0406\u0406), \u041e\u043d\u0443\u0444\u0440\u0456\u044f \u000d\u000a\u043c\u043e\u0432\u0447\u0430\u0437\u043d\u043e\u0433\u043e (\u0425\u0406\u0406), \u0410\u043d\u0430\u0442\u043e\u043b\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. (\u0425\u0406\u0406), \u0410\u043b\u0456\u043f\u0456\u044f, \u0456\u043a\u043e\u043d\u043e\u043f\u0438\u0441\u0446\u044f (1114), \u000d\u000a\u0421\u0438\u0441\u043e\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. (\u0425\u0406\u0406 \u2013 \u0425\u0406\u0406\u0406), \u0410\u0440\u0435\u0444\u0438, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. (\u0431\u043b. 1195), \u0421\u043f\u0438\u0440\u0438\u0434\u043e\u043d\u0430, \u000d\u000a\u043f\u0440\u043e\u0441\u0444\u043e\u0440\u043d\u0438\u043a\u0430 (\u0425\u0406\u0406), \u041e\u043d\u0438\u0441\u0438\u0444\u043e\u0440\u0430, \u0441\u043f\u043e\u0432. (1148), \u0421\u0438\u043c\u043e\u043d\u0430, \u0454\u043f. \u0421\u0443\u0437\u0434\u0430\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (\u0425\u0406\u0406), \u0424\u0435\u043e\u0444\u0430\u043d\u0430, \u043f\u043e\u0441\u043d\u0438\u043a\u0430 (\u0425\u0406\u0406). \u041c\u0430\u043a\u0430\u0440\u0456\u044f (\u0425\u0406\u0406), \u043f\u0440\u043c\u0447. \u0410\u043d\u0430\u0441\u0442\u0430\u0441\u0456\u044f, \u000d\u000a\u0434\u0438\u044f\u043a. (\u0425\u0406\u0406), \u0434\u0432\u0430\u043d\u0430\u0434\u0446\u044f\u0442\u044c\u043e\u0445 \u043c\u0430\u0439\u0441\u0442\u0440\u0456\u0432 \u0437\u043e\u0434\u0447\u0438\u0445 (\u0425\u0406), \u0410\u0432\u0440\u0430\u0430\u043c\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. \u000d\u000a(\u0425\u0406\u0406 \u2013 \u0425\u0406\u0406\u0406), \u0406\u0441\u0430\u043a\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d. (\u0431\u043b. 1090), \u0406\u043b\u043b\u0456 \u041c\u0443\u0440\u043e\u043c\u0446\u044f (\u0431\u043b. 1188), \u041d\u0438\u043a\u043e\u043d\u0430 \u0421\u0443\u0445\u043e\u0433\u043e (\u0425\u0406\u0406), \u0404\u0444\u0440\u0435\u043c\u0430, \u0454\u043f. \u041f\u0435\u0440\u0435\u044f\u0441\u043b\u0430\u0432\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 1098), \u0422\u0438\u0442\u0430, \u000d\u000a\u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 (1190). \u041f\u0440\u043e\u0440. \u0412\u0430\u0440\u0443\u0445\u0430 (V\u0406 \u0441\u0442. \u0434\u043e \u0420. \u0425.). \u041c\u0447\u0447. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430, \u000d\u000a28\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a","66\u000d\u000a\u0410\u043b\u0444\u0435\u044f, \u0417\u043e\u0441\u0438\u043c\u0438, \u041c\u0430\u0440\u043a\u0430, \u043f\u0430\u0441\u0442\u0443\u0445\u0430, \u041d\u0438\u043a\u043e\u043d\u0430, \u041d\u0435\u043e\u043d\u0430, \u0406\u043b\u0456\u043e\u0434\u043e\u0440\u0430 \u0442\u0430 \u0456\u043d. (\u0406V). \u000d\u000a\u0411\u043b\u0433\u0432. \u043a\u043d. \u0412\u2019\u044f\u0447\u0435\u0441\u043b\u0430\u0432\u0430 \u0427\u0435\u0441\u044c\u043a\u043e\u0433\u043e (935).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0415\u0444., 227 \u0437\u0430\u0447., IV, 25 \u2013 32. \u041b\u043a., 10 \u0437\u0430\u0447., III, 19 \u2013 22.\u000d\u000a\u041f\u0440\u043f\u043f.: 2 \u041a\u043e\u0440., 176 \u0437\u0430\u0447., IV, 6 \u2013 15. \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u041f\u0440\u043f. \u041a\u0438\u0440\u0456\u0430\u043a\u0430, \u043f\u0443\u0441\u0442\u0435\u043b\u044c\u043d\u0438\u043a\u0430 (556). \u041c\u0447\u0447. \u0414\u0430\u0434\u0438, \u0413\u0430\u0432\u0435\u0434\u0434\u0430\u044f \u0456 \u041a\u0430\u0437\u0434\u043e\u0457 (\u0406V). \u000d\u000a\u041f\u0440\u043f. \u0424\u0435\u043e\u0444\u0430\u043d\u0430 \u041c\u0438\u043b\u043e\u0441\u0442\u0438\u0432\u043e\u0433\u043e.\u000d\u000a\u0415\u0444., 230 \u0437\u0430\u0447., V, 20 \u2013 26. \u041b\u043a., 11 \u0437\u0430\u0447., III, 23 \u2013 IV, 1.\u000d\u000a\u0421\u0449\u043c\u0447. \u041a\u0438\u043f\u0440\u0456\u0430\u043d\u0430, \u0454\u043f., \u043c\u0446. \u042e\u0441\u0442\u0438\u043d\u0438 \u0442\u0430 \u043c\u0447. \u0424\u0435\u043e\u043a\u0442\u0438\u0441\u0442\u0430 (304). \u041f\u0440\u0430\u0432. \u0410\u043d\u0434\u0440\u0456\u044f \u000d\u000a\u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e, \u044e\u0440\u043e\u0434\u0438\u0432\u043e\u0433\u043e \u0437\u0430\u0440\u0430\u0434\u0438 \u0425\u0440\u0438\u0441\u0442\u0430 (936). \u041c\u0447\u0447. \u0414\u0430\u0432\u0438\u0434\u0430 \u0456 \u000d\u000a\u041a\u043e\u0441\u0442\u044f\u043d\u0442\u0438\u043d\u0430, \u043a\u043d\u044f\u0437\u0456\u0432 \u0410\u0440\u0430\u0433\u0432\u0435\u0442\u0441\u044c\u043a\u0438\u0445 (740, \u0413\u0440\u0443\u0437.).\u000d\u000a\u0415\u0444., 232 \u0437\u0430\u0447., V, 33 \u2013 VI, 9. \u041b\u043a., 13 \u0437\u0430\u0447., IV, 16 \u2013 22 (\u0437\u0430 \u0447\u0435\u0442\u0432\u0435\u0440, \u043f\u0456\u0434 \u0437\u0430\u0447\u0430\u043b\u043e).\u000d\u000a\u0415\u0444., 234 \u0437\u0430\u0447., VI, 18 \u2013 24. \u041b\u043a., 14 \u0437\u0430\u0447., IV, 22 \u2013 30 (\u0437\u0430 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e).\u000d\u000a\u0421\u0432\u0432.: 1 \u0422\u0438\u043c., 280 \u0437\u0430\u0447., I, 12 \u2013 17. \u0406\u043d., 36 \u0437\u0430\u0447., X, 9 \u2013 16.\u000d\u000a\u0421\u0449\u043c\u0447\u0447. \u0414\u0456\u043e\u043d\u0456\u0441\u0456\u044f \u0410\u0440\u0435\u043e\u043f\u0430\u0433\u0456\u0442\u0430, \u0454\u043f. \u0410\u0444\u0456\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u0420\u0443\u0441\u0442\u0438\u043a\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u000d\u000a\u0442\u0430 \u0404\u043b\u0435\u0432\u0444\u0435\u0440\u0456\u044f, \u0434\u0438\u044f\u043a\u043e\u043d\u0430 (96). \u041f\u0440\u043f. \u0414\u0456\u043e\u043d\u0456\u0441\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425V). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430 \u0425\u043e\u0437\u0435\u0432\u0456\u0442\u0430, \u0454\u043f. \u041a\u0435\u0441\u0430\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406). \u0421\u0432. \u0406\u0441\u0438\u0445\u0456\u044f \u0425\u043e\u0440\u0438\u0432\u0456\u0442\u0430 (V\u0406).\u000d\u000a\u0421\u0449\u043c\u0447\u0447.: \u0414\u0456\u044f\u043d., 40 \u0437\u0430\u0447., XVII, 16 \u2013 34. \u041c\u0444., 55 \u0437\u0430\u0447., XIII, 44 \u2013 54.\u000d\u000a\u0420\u044f\u0434.: 1 \u041a\u043e\u0440., 162 \u0437\u0430\u0447., XV, 39 \u2013 45. \u041b\u043a., 15 \u0437\u0430\u0447., IV, 31 \u2013 36.\u000d\u000a\u0421\u0449\u043c\u0447. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f, \u0454\u043f., \u043f\u0440\u043e\u0441\u0432\u0456\u0442\u0438\u0442\u0435\u043b\u044f \u0412\u0456\u0440\u043c\u0435\u043d\u0456\u0457 (\u0431\u043b. 335). \u0421\u0432\u0442. \u041c\u0438\u0445\u0430\u0457\u043b\u0430, \u000d\u000a\u043f\u0435\u0440\u0448\u043e\u0433\u043e \u043c\u0438\u0442\u0440. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0432\u0441\u0456\u0454\u0457 \u0420\u0443\u0441\u0438 (992). \u041c\u0446\u0446. \u0420\u0438\u043f\u0441\u0438\u043c\u0456\u0457, \u0413\u0430\u044f\u043d\u0456\u0457 \u0456 \u000d\u000a\u0437 \u043d\u0438\u043c\u0438 35 \u0441\u0432\u044f\u0442\u0438\u0445 \u0434\u0456\u0432 (\u043f\u043e\u0447. \u0406V).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 35 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b.), X, 1 \u2013 9. \u000d\u000a\u041b\u0456\u0442. \u2013 \u0415\u0444., 231 \u0437\u0430\u0447., V, 25\u201333. \u041b\u043a., 12 \u0437\u0430\u0447., IV, 1\u201315.\u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 318 \u0437\u0430\u0447., VII, 26 \u2013 VIII, 2. \u0406\u043d., 36 \u0437\u0430\u0447., X, 9 \u2013 16.\u000d\u000a29\u000d\u000a2\u000d\u000a3\u000d\u000a30\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u041f\u043e\u043a\u0440\u043e\u0432\u0430 \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0412\u043b\u0430\u0434\u0438\u0447\u0438\u0446\u0456 \u043d\u0430\u0448\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456 \u0456 \u041f\u0440\u0438\u0441\u043d\u043e\u0434\u0456\u0432\u0438 \u041c\u0430\u0440\u0456\u0457. \u0410\u043f. \u0432\u0456\u0434 70-\u0445 \u0410\u043d\u0430\u043d\u0456\u0457 (\u0406). \u041f\u0440\u043f. \u0420\u043e\u043c\u0430\u043d\u0430 \u0421\u043e\u043b\u043e\u0434\u043a\u043e\u0441\u043f\u0456\u0432\u0446\u044f, \u0434\u0438\u044f\u043a. \u000d\u000a(\u0431\u043b. 556). \u041c\u0447. \u0414\u043e\u043c\u043d\u0456\u043d\u0430 \u0421\u043e\u043b\u0443\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u041f\u0440\u043c\u0447. \u041c\u0438\u0445\u0430\u0457\u043b\u0430, \u0456\u0433\u0443\u043c\u0435\u043d\u0430 \u0417\u043e\u0432\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u0437 \u043d\u0438\u043c 36 \u043f\u0440\u043c\u0447\u0447. (780 \u2013 790). \u0421\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u043d\u0430 \u0447\u0435\u0441\u0442\u044c \u0445\u0456\u0442\u043e\u043d\u0430 \u000d\u000a\u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e \u0456 \u0421\u0442\u043e\u0432\u043f\u0430 \u0416\u0438\u0432\u043e\u0442\u0432\u043e\u0440\u0447\u043e\u0433\u043e (\u0413\u0440\u0443\u0437.). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430 \u041a\u0443\u043a\u0443\u0437\u0435\u043b\u044f, \u043f\u0456\u0441\u043d\u0435\u043f\u0438\u0441\u0446\u044f (\u0431\u043b. 1360).\u000d\u000a\u041b\u044e\u0431\u043b\u0456\u043d\u0441\u044c\u043a\u043e\u0457, \u041a\u0430\u0441\u043f\u0435\u0440\u0456\u0432\u0441\u044c\u043a\u043e\u0457, \u0413\u0435\u0440\u0431\u043e\u0432\u0435\u0446\u044c\u043a\u043e\u0457, \u0411\u0430\u0440\u0441\u044c\u043a\u043e\u0457 \u0442\u0430 \u00ab\u041b\u0430\u0441\u043a\u0430\u0432\u0430 \u000d\u000a\u0421\u0442\u0430\u043d\u0456\u0441\u043b\u0430\u0432\u0441\u044c\u043a\u0430\u00bb \u0456\u043a\u043e\u043d \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456. \u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 4 \u0437\u0430\u0447., I, 39 \u2013 49, 56.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456: \u0404\u0432\u0440., 320 \u0437\u0430\u0447., IX, 1 \u2013 7. \u041b\u043a., 54 \u0437\u0430\u0447., X, 38 \u2013 42; XI, 27 \u2013 28.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0422\u0435\u0431\u0435, \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u0430\u044f \u0414\u0456\u0432\u043e, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u000d\u000a\u043f\u043e\u043a\u0440\u043e\u0432 \u0422\u0432\u0456\u0439 \u0447\u0435\u0441\u043d\u0438\u0439, \u0422\u0435\u0431\u0435 \u0431\u043e \u0441\u0432\u044f\u0442\u0438\u0439 \u0410\u043d\u0434\u0440\u0456\u0439 \u0431\u0430\u0447\u0438\u0432 \u0443 \u043f\u043e\u0432\u0456\u0442\u0440\u0456, \u044f\u043a \u0422\u0438 \u0437\u0430 \u000d\u000a\u043d\u0430\u0441 \u0425\u0440\u0438\u0441\u0442\u0443 \u043c\u043e\u043b\u0438\u043b\u0430\u0441\u044f\u00bb. \u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a1","67\u000d\u000a18-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 1-\u0439.\u000d\u000a\u0421\u0449\u043c\u0447. \u0406\u0454\u0440\u043e\u0444\u0435\u044f, \u0454\u043f. \u0410\u0444\u0456\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0406). \u0421\u0449\u043c\u0447\u0447. \u0413\u0430\u044f, \u0424\u0430\u0432\u0441\u0442\u0430, \u0404\u0432\u0441\u0435\u0432\u0456\u044f \u0456 \u0425\u0435\u0440\u0438\u043c\u043e\u043d\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0456\u0432 (\u0406\u0406\u0406). \u0421\u0449\u043c\u0447. \u041f\u0435\u0442\u0440\u0430 \u041a\u0430\u043f\u0456\u0442\u043e\u043b\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u043f\u0440\u0435\u0441\u0432\u0456\u0442. (\u0406\u0406\u0406 \u2013 \u0406V). \u000d\u000a\u041c\u0446\u0446. \u0414\u043e\u043c\u043d\u0456\u043d\u0438 \u0442\u0430 \u0434\u043e\u0447\u043e\u043a \u0457\u0457 \u0412\u0456\u0440\u0438\u043d\u0435\u0457 (\u0412\u0435\u0440\u043e\u043d\u0456\u043a\u0438) \u0456 \u041f\u0440\u043e\u0441\u043a\u0443\u0434\u0456\u0457 (\u041f\u0440\u043e\u0441\u0434\u043e\u043a\u0438) \u000d\u000a(305 \u2013 306). \u041f\u0440\u043f. \u0410\u043c\u043e\u043d\u0430 \u041d\u0456\u0442\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 350). \u041f\u0440\u043f. \u041f\u0430\u0432\u043b\u0430 \u041f\u0440\u0435\u043f\u0440\u043e\u0441\u0442\u043e\u0433\u043e (\u0406V). \u041c\u0447. \u0414\u0430\u0432\u0438\u043a\u0442\u0430 (\u0410\u0434\u0430\u0432\u043a\u0442\u0430) \u0456 \u0434\u043e\u0447\u043a\u0438 \u0439\u043e\u0433\u043e \u0441\u0432. \u041a\u0430\u043b\u0456\u0441\u0444\u0435\u043d\u0456\u0457 (\u0406V). \u0411\u043b\u0433\u0432. \u000d\u000a\u043a\u043d. \u0412\u043e\u043b\u043e\u0434\u0438\u043c\u0438\u0440\u0430 \u042f\u0440\u043e\u0441\u043b\u0430\u0432\u043e\u0432\u0438\u0447\u0430, \u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\u0441\u044c\u043a\u043e\u0433\u043e \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (1052). \u000d\u000a\u041f\u0440\u043f\u043f. \u0415\u043b\u043b\u0430\u0434\u0456\u044f \u0439 \u041e\u043d\u0438\u0441\u0438\u043c\u0430, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0456\u0432 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u0438\u0445, \u0432 \u000d\u000a\u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406 \u2013 \u0425\u0406\u0406\u0406). \u041f\u0440\u043f. \u0410\u043c\u043c\u043e\u043d\u0430, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406). \u0421\u0432. \u0421\u0442\u0435\u0444\u0430\u043d\u0430 \u0429\u0438\u043b\u044f\u043d\u043e\u0432\u0438\u0447\u0430 \u000d\u000a(1515, \u0421\u0435\u0440\u0431.).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 7-\u0435, \u0406\u043d., 63 \u0437\u0430\u0447., XX, 1 \u2013 10.\u000d\u000a\u041b\u0456\u0442. \u2013 2 \u041a\u043e\u0440., 188 \u0437\u0430\u0447., IX, 6 \u2013 11. \u041b\u043a., 17 \u0437\u0430\u0447., V, 1 \u2013 11.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a4\u000d\u000a19-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u041c\u0446. \u0425\u0430\u0440\u0438\u0442\u0438\u043d\u0438 (304). \u000d\u000a\u041f\u0440\u043f\u043f. \u0414\u0430\u043c\u0456\u0430\u043d\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442., \u0446\u0456\u043b\u0438\u0442\u0435\u043b\u044f (1071), \u0404\u0440\u0435\u043c\u0456\u0457 (\u0431\u043b. 1070) \u000d\u000a\u0456 \u041c\u0430\u0442\u0444\u0435\u044f (\u0431\u043b. 1085) \u043f\u0440\u043e\u0437\u043e\u0440\u043b\u0438\u0432\u0438\u0445, \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u0438\u0445, \u0432 \u000d\u000a\u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445. \u0421\u0449\u043c\u0447. \u0414\u0456\u043e\u043d\u0456\u0441\u0456\u044f, \u0454\u043f. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (264 \u2013 \u000d\u000a265). \u041c\u0446. \u041c\u0430\u043c\u0435\u043b\u0445\u0432\u0438 \u041f\u0435\u0440\u0441\u044c\u043a\u043e\u0457 (\u0431\u043b. 344). \u041f\u0440\u043f. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f \u0425\u0430\u043d\u0434\u0437\u043e\u0439\u0441\u044c\u043a\u043e\u0433\u043e (861, \u0413\u0440\u0443\u0437.).\u000d\u000a\u0424\u043b\u043f., 235 \u0437\u0430\u0447., I, 1 \u2013 7. \u041b\u043a., 16 \u0437\u0430\u0447., IV, 37 \u2013 44. \u000d\u000a\u0410\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u0424\u043e\u043c\u0438 (\u0406). \u0421\u0449\u043c\u0447. \u041d\u0438\u043a\u0438\u0444\u043e\u0440\u0430, \u0430\u0440\u0445\u0456\u0434\u0438\u044f\u043a., \u0435\u043a\u0437\u0430\u0440\u0445\u0430 \u000d\u000a\u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e \u043f\u0430\u0442\u0440\u0456\u0430\u0440\u0445\u0430 \u0432 \u0423\u043a\u0440\u0430\u0457\u043d\u0456 (1599).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 67 \u0437\u0430\u0447., XXI, 15 \u2013 25.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0424\u043b\u043f., 236 \u0437\u0430\u0447., I, 8 \u2013 14. \u041b\u043a., 18 \u0437\u0430\u0447., V, 12 \u2013 16.\u000d\u000a\u0410\u043f.: 1 \u041a\u043e\u0440., 131 \u0437\u0430\u0447., IV, 9 \u2013 16. \u0406\u043d., 65 \u0437\u0430\u0447., XX, 19 \u2013 31.\u000d\u000a\u0410\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u042f\u043a\u043e\u0432\u0430 \u0410\u043b\u0444\u0435\u0454\u0432\u043e\u0433\u043e (\u0406). \u041f\u0440\u043f\u043f. \u0410\u043d\u0434\u0440\u043e\u043d\u0456\u043a\u0430 \u0442\u0430 \u0434\u0440\u0443\u0436\u0438\u043d\u0438 \u0439\u043e\u0433\u043e \u000d\u000a\u0410\u0444\u0430\u043d\u0430\u0441\u0456\u0457 (V). \u041f\u0440\u0430\u0432. \u0410\u0432\u0440\u0430\u0430\u043c\u0430, \u043f\u0440\u0430\u043e\u0442\u0446\u044f, \u0456 \u043f\u043b\u0435\u043c\u0456\u043d\u043d\u0438\u043a\u0430 \u0439\u043e\u0433\u043e \u041b\u043e\u0442\u0430 (2000 \u000d\u000a\u0434\u043e \u0420. \u0425.). \u041c\u0447\u0447. \u0404\u0432\u0435\u043d\u0442\u0456\u044f (\u042e\u0432\u0435\u043d\u0442\u0438\u043d\u0430) \u0456 \u041c\u0430\u043a\u0441\u0438\u043c\u0430, \u0432\u043e\u0457\u043d\u0456\u0432 (361 \u2013 363). \u000d\u000a\u041c\u0446. \u041f\u043e\u043f\u043b\u0456\u0457 (\u041f\u0443\u0431\u043b\u0456\u0457), \u0441\u043f\u043e\u0432., \u0434\u0438\u044f\u043a\u043e\u043d\u0438\u0441\u0438 \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (\u0431\u043b. 361 \u2013 363). \u000d\u000a\u041f\u0440\u043f. \u041f\u0435\u0442\u0440\u0430 \u0413\u0430\u043b\u0430\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0425).\u000d\u000a\u041c\u0447\u0447. \u0421\u0435\u0440\u0433\u0456\u044f \u0456 \u0412\u0430\u043a\u0445\u0430 (290 \u2013 303). \u041f\u0440\u043f. \u0421\u0435\u0440\u0433\u0456\u044f \u041f\u043e\u0441\u043b\u0443\u0448\u043d\u043e\u0433\u043e, \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0431\u043b. \u0425\u0406\u0406\u0406). \u0421\u0449\u043c\u0447\u0447. \u042e\u043b\u0456\u0430\u043d\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u0456 \u041a\u0435\u0441\u0430\u0440\u0456\u044f, \u0434\u0438\u044f\u043a\u043e\u043d\u0430 (\u0406). \u041c\u0446. \u041f\u0435\u043b\u0430\u0433\u0435\u0457, \u0434\u0456\u0432\u0438 \u0422\u0430\u0440\u0441\u0456\u0439\u0441\u044c\u043a\u043e\u0457 \u000d\u000a(290). \u0421\u0449\u043c\u0447. \u041f\u043e\u043b\u0456\u0445\u0440\u043e\u043d\u0456\u044f, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 (\u0406V).\u000d\u000a\u0424\u043b\u043f., 237 \u0437\u0430\u0447., I, 12 \u2013 20. \u041b\u043a., 21 \u0437\u0430\u0447., V, 33 \u2013 39.\u000d\u000a\u041c\u0447\u0447.: \u0404\u0432\u0440., 330 \u0437\u0430\u0447., XI, 33 \u2013 XII, 2. \u041b\u043a., 106 \u0437\u0430\u0447., XXI, 12 \u2013 19.\u000d\u000a\u041f\u0440\u043f. \u041f\u0435\u043b\u0430\u0433\u0435\u0457 \u041f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0441\u044c\u043a\u043e\u0457 (457). \u041f\u0440\u043f. \u0422\u0430\u0457\u0441\u0456\u0457 \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0457 (\u0406V). \u000d\u000a\u041c\u0446. \u041f\u0435\u043b\u0430\u0433\u0456\u0457, \u0434\u0456\u0432\u0438 \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (303).\u000d\u000a\u0424\u043b\u043f., 238 \u0437\u0430\u0447., I, 20 \u2013 27. \u041b\u043a., 23 \u0437\u0430\u0447., VI, 12 \u2013 19.\u000d\u000a5\u000d\u000a6\u000d\u000a9\u000d\u000a7\u000d\u000a8\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440","68\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 67 \u0437\u0430\u0447., XXI, 15 \u2013 25.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0424\u043b\u043f., 239 \u0437\u0430\u0447., I, 27 \u2013 II, 4. \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u0410\u043f.: 1 \u041a\u043e\u0440., 131 \u0437\u0430\u0447., IV, 9 \u2013 16. \u041b\u043a., 51 \u0437\u0430\u0447., X, 16 \u2013 21.\u000d\u000a\u041c\u0447. \u0404\u0432\u043b\u0430\u043c\u043f\u0456\u044f \u0442\u0430 \u043c\u0446. \u0404\u0432\u043b\u0430\u043c\u043f\u0456\u0457 (IV). \u0421\u0432\u0442. \u0410\u043c\u0444\u0456\u043b\u043e\u0445\u0456\u044f \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0454\u043f. \u0412\u043e\u043b\u043e\u0434\u0438\u043c\u0438\u0440\u0441\u044c\u043a\u043e\u0433\u043e (1122). \u0421\u043e\u0431\u043e\u0440 \u0412\u043e\u043b\u0438\u043d\u0441\u044c\u043a\u0438\u0445 \u0441\u0432\u044f\u0442\u0438\u0445. \u041c\u0447. \u0424\u0435\u043e\u0442\u0435\u043a\u043d\u0430 \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0406\u0406 \u2013 \u0406V). \u041f\u0440\u043f. \u0412\u0430\u0441\u0441\u0456\u0430\u043d\u0430 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e, \u0456\u0433\u0443\u043c. (V). \u041f\u0440\u043f. \u0424\u0435\u043e\u0444\u0456\u043b\u0430, \u0441\u043f\u043e\u0432. (V\u0406\u0406\u0406).\u000d\u000a\u0411\u0440\u0430\u0457\u043b\u0456\u0432\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456.\u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 318 \u0437\u0430\u0447., VII, 26 \u2013 VIII, 2. \u0406\u043d., 36 \u0437\u0430\u0447., X, 9 \u2013 16.\u000d\u000a\u0420\u044f\u0434.: 1 \u041a\u043e\u0440., 164 \u0437\u0430\u0447., XV, 58 \u2013 XVI, 3. \u041b\u043a., 19 \u0437\u0430\u0447., V, 17 \u2013 26. \u000d\u000a20-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u041c\u0447\u0447. \u041f\u0440\u043e\u0432\u0430, \u0422\u0430\u0440\u0430\u0445\u0430 \u0456 \u0410\u043d\u0434\u0440\u043e\u043d\u0456\u043a\u0430 \u000d\u000a(304). \u041f\u0440\u043f. \u041a\u043e\u0441\u043c\u0438, \u0454\u043f. \u041c\u0430\u044e\u043c\u0441\u044c\u043a\u043e\u0433\u043e, \u0442\u0432\u043e\u0440\u0446\u044f \u043a\u0430\u043d\u043e\u043d\u0456\u0432 (\u0431\u043b. 787). \u041c\u0446. \u0414\u043e\u043c\u043d\u0456\u043a\u0438 (286). \u0421\u0432\u0442. \u041c\u0430\u0440\u0442\u0438\u043d\u0430 \u041c\u0438\u043b\u043e\u0441\u0442\u0438\u0432\u043e\u0433\u043e, \u0454\u043f. \u0422\u0443\u0440\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 400).\u000d\u000a\u0404\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0441\u044c\u043a\u043e\u0457 (48), \u0420\u0443\u0434\u043d\u0435\u043d\u0441\u044c\u043a\u043e\u0457 (1687) \u0456\u043a\u043e\u043d \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456.\u000d\u000a\u0424\u043b\u043f., 241 \u0437\u0430\u0447., II, 12 \u2013 16. \u041b\u043a., 25 \u0437\u0430\u0447., VI, 24 \u2013 30.\u000d\u000a\u0421\u0449\u043c\u0447\u0447. \u041a\u0430\u0440\u043f\u0430, \u0454\u043f. \u0424\u0456\u0430\u0442\u0438\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u041f\u0430\u043f\u0438\u043b\u0438, \u0434\u0438\u044f\u043a\u043e\u043d\u0430, \u043c\u0447. \u0410\u0433\u0430\u0444\u043e\u0434\u043e\u0440\u0430 \u0456 \u000d\u000a\u043c\u0446. \u0410\u0433\u0430\u0444\u043e\u043d\u0456\u043a\u0438 (\u0431\u043b. 251). \u041f\u0440\u043f. \u0412\u0435\u043d\u0456\u0430\u043c\u0456\u043d\u0430, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406V). \u041c\u0447. \u0424\u043b\u043e\u0440\u0435\u043d\u0442\u0456\u044f \u0421\u043e\u043b\u0443\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(\u0406 \u2013 \u0406\u0406). \u0421\u0449\u043c\u0447. \u0412\u0435\u043d\u0456\u0430\u043c\u0456\u043d\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0430 (421 \u2013 424). \u041f\u0440\u043f. \u041c\u0438\u043a\u0438\u0442\u0438, \u0441\u043f\u043e\u0432. \u000d\u000a(\u0431\u043b. 838).\u000d\u000a\u00ab\u0406\u0432\u0435\u0440\u0441\u044c\u043a\u043e-\u041c\u0438\u0440\u043d\u0435\u043d\u0441\u044c\u043a\u043e\u0457 (\u041c\u0438\u0440\u043e\u0442\u043e\u0447\u0438\u0432\u043e\u0457)\u00bb \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456.\u000d\u000a\u0424\u043b\u043f., 242 \u0437\u0430\u0447., II, 16 \u2013 23. \u041b\u043a., 27 \u0437\u0430\u0447., VI, 37 \u2013 45.\u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456: \u0424\u043b\u043f., 240 \u0437\u0430\u0447., II, 5 \u2013 11. \u041b\u043a., 54 \u0437\u0430\u0447., X, 38 \u2013 42; XI, 27 \u2013 28.\u000d\u000a\u0412\u0438\u0448\u0433\u043e\u0440\u043e\u0434\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (\u0406). \u041c\u0447\u0447. \u041d\u0430\u0437\u0430\u0440\u0456\u044f, \u0413\u0435\u0440\u0432\u0430\u0441\u0456\u044f, \u041f\u0440\u043e\u0442\u0430\u0441\u0456\u044f, \u041a\u0435\u043b\u0441\u0456\u044f (\u0406). \u041f\u0440\u043f. \u041f\u0430\u0440\u0430\u0441\u043a\u0435\u0432\u0438 \u0421\u0435\u0440\u0431\u0441\u044c\u043a\u043e\u0457 (\u0425\u0406). \u041f\u0440\u043f. \u041c\u0438\u043a\u043e\u043b\u0438 \u0421\u0432\u044f\u0442\u043e\u0448\u0456, \u000d\u000a\u043a\u043d. \u0427\u0435\u0440\u043d\u0456\u0433\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u000d\u000a\u043f\u0435\u0447\u0435\u0440\u0430\u0445 (1143). \u0421\u0449\u043c\u0447. \u0421\u0438\u043b\u044c\u0432\u0430\u043d\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 \u0413\u0430\u0437\u044c\u043a\u043e\u0433\u043e (\u0406V). \u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 4 \u0437\u0430\u0447., I, 39 \u2013 49, 56.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0424\u043b\u043f., 243 \u0437\u0430\u0447., II, 24 \u2013 30. \u041b\u043a., 28 \u0437\u0430\u0447., VI, 46 \u2013 VII, 1.\u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456: \u0404\u0432\u0440., 320 \u0437\u0430\u0447., IX, 1 \u2013 7. \u041b\u043a., 54 \u0437\u0430\u0447., X, 38 \u2013 42; XI, 27 \u2013 28.\u000d\u000a10\u000d\u000a12\u000d\u000a13\u000d\u000a14\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a19-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 2-\u0439.\u000d\u000a\u041f\u0430\u043c\u2019\u044f\u0442\u044c \u0441\u0432\u044f\u0442\u0438\u0445 \u043e\u0442\u0446\u0456\u0432 V\u0406\u0406 \u0412\u0441\u0435\u043b\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u0441\u043e\u0431\u043e\u0440\u0443 (787) (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u000d\u000a\u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0432 \u043d\u0435\u0434\u0456\u043b\u044e, \u043d\u0430\u0439\u0431\u043b\u0438\u0436\u0447\u0443 \u0434\u043e 11 \u0436\u043e\u0432\u0442\u043d\u044f). \u0410\u043f. \u0424\u0438\u043b\u0438\u043f\u0430, \u043e\u0434\u043d\u043e\u0433\u043e \u0437 \u000d\u000a7-\u043c\u0438 \u0434\u0438\u044f\u043a\u043e\u043d\u0456\u0432 (\u0406). \u041f\u0440\u043f. \u0424\u0435\u043e\u0444\u0430\u043d\u0430, \u0441\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u043a\u0430, \u0442\u0432\u043e\u0440\u0446\u044f \u043a\u0430\u043d\u043e\u043d\u0456\u0432, \u0454\u043f. \u041d\u0456\u043a\u0435\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 850). \u041f\u0440\u043f. \u0424\u0435\u043e\u0444\u0430\u043d\u0430, \u043f\u043e\u0441\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406). \u041c\u0446\u0446. \u0417\u0456\u043d\u0430\u0457\u0434\u0438 \u0456 \u0424\u0456\u043b\u043e\u043d\u0456\u043b\u0438 (\u0406).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 8-\u0435, \u0406\u043d., 64 \u0437\u0430\u0447., XX, 11 \u2013 18.\u000d\u000a\u041b\u0456\u0442. \u2013 2 \u041a\u043e\u0440., 194 \u0437\u0430\u0447., XI, 31 \u2013 XII, 9. \u041b\u043a., 26 \u0437\u0430\u0447., VI, 31 \u2013 36.\u000d\u000a\u0421\u0432\u0432. \u043e\u0442\u0446\u0456\u0432: \u0404\u0432\u0440., 334 \u0437\u0430\u0447., XIII, 7 \u2013 16. \u0406\u043d., 56 \u0437\u0430\u0447., XVII, 1 \u2013 13.\u000d\u000a\u041d\u0435\u0434\u0456\u043b\u044c\u043d\u0430 \u0441\u043b\u0443\u0436\u0431\u0430 \u043f\u043e\u0454\u0434\u043d\u0443\u0454\u0442\u044c\u0441\u044f \u0437\u0456 \u0441\u043b\u0443\u0436\u0431\u043e\u044e \u043e\u0442\u0446\u044f\u043c VII \u0412\u0441\u0435\u043b\u0435\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u0421\u043e\u0431\u043e\u0440\u0443 (\u0434\u0438\u0432. 11 \u0436\u043e\u0432\u0442\u043d\u044f \u0432 \u041c\u0456\u043d\u0435\u0457).\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a11","69\u000d\u000a\u041c\u0447. \u041b\u043e\u043d\u0433\u0438\u043d\u0430, \u0441\u043e\u0442\u043d\u0438\u043a\u0430, \u044f\u043a\u0438\u0439 \u0431\u0443\u0432 \u0431\u0456\u043b\u044f \u0425\u0440\u0435\u0441\u0442\u0430 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e (\u0406). \u000d\u000a\u041f\u0440\u043f. \u041b\u043e\u043d\u0433\u0438\u043d\u0430, \u0432\u043e\u0440\u043e\u0442\u0430\u0440\u044f \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406 \u2013 \u0425\u0406V).\u000d\u000a\u0424\u043b\u043f., 245 \u0437\u0430\u0447., III, 8 \u2013 19. \u041b\u043a., 32 \u0437\u0430\u0447., VII, 31 \u2013 35.\u000d\u000a\u041c\u0447.: 2 \u0422\u0438\u043c., 292 \u0437\u0430\u0447., II, 1 \u2013 10. \u041c\u0444., 113 \u0437\u0430\u0447., XXVII, 33 \u2013 54.\u000d\u000a\u041f\u0440\u043e\u0440. \u041e\u0441\u0456\u0457 (820 \u0434\u043e \u0420. \u0425.). \u041f\u0440\u043c\u0447. \u0410\u043d\u0434\u0440\u0456\u044f \u041a\u0440\u0438\u0442\u0441\u044c\u043a\u043e\u0433\u043e (767). \u041c\u0447\u0447.,\u0431\u0435\u0437\u0441\u0440\u0440. \u000d\u000a\u041a\u043e\u0441\u043c\u0438 \u0456 \u0414\u0430\u043c\u0456\u0430\u043d\u0430 \u0410\u0440\u0430\u0432\u0456\u0439\u0441\u044c\u043a\u0438\u0445 \u0456 \u0431\u0440\u0430\u0442\u0456\u0432 \u0457\u0445\u043d\u0456\u0445 \u043c\u0447\u0447. \u041b\u0435\u043e\u043d\u0442\u0456\u044f, \u0410\u043d\u0444\u0456\u043c\u0430 \u0456 \u0404\u0432\u0442\u0440\u043e\u043f\u0456\u044f (287 \u0430\u0431\u043e 303). \u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u043f\u0440\u0430\u0432. \u041b\u0430\u0437\u0430\u0440\u044f \u0427\u043e\u0442\u0438\u0440\u0438\u0434\u0435\u043d\u043d\u043e\u0433\u043e, \u0454\u043f. \u041a\u0438\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (898).\u000d\u000a\u0406\u043a\u043e\u043d \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456, \u0437\u0432\u0430\u043d\u0438\u0445 \u00ab\u0414\u043e \u0420\u0456\u0437\u0434\u0432\u0430 \u0456 \u043f\u0456\u0441\u043b\u044f \u0420\u0456\u0437\u0434\u0432\u0430 \u0414\u0456\u0432\u0430\u00bb (1827) \u0442\u0430 \u000d\u000a\u00ab\u0412\u0438\u0437\u0432\u043e\u043b\u0438\u0442\u0435\u043b\u044c\u043a\u0430\u00bb (\u0431\u0456\u043b\u044f 1889).\u000d\u000a2 \u041a\u043e\u0440., 168 \u0437\u0430\u0447., I, 8 \u2013 11. \u041b\u043a., 20 \u0437\u0430\u0447., V, 27 \u2013 32.\u000d\u000a21-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u041f\u0440\u043e\u0440. \u0406\u043e\u0457\u043b\u044f (800 \u0434\u043e \u0420. \u0425.). \u000d\u000a\u041c\u0447\u0447. \u0423\u0430\u0440\u0430 \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0437 \u043d\u0438\u043c 7-\u043e\u0445 \u0443\u0447\u0438\u0442\u0435\u043b\u0456\u0432 \u0445\u0440\u0438\u0441\u0442\u0438\u044f\u043d\u0441\u044c\u043a\u0438\u0445 (\u0431\u043b.307). \u000d\u000a\u0421\u0432\u0432. \u041a\u043b\u0435\u043e\u043f\u0430\u0442\u0440\u0438 (327) \u0442\u0430 \u0457\u0457 \u0441\u0438\u043d\u0430 \u0406\u043e\u0430\u043d\u0430 (320). \u0421\u0449\u043c\u0447. \u0421\u0430\u0434\u043e\u043a\u0430, \u0454\u043f. \u041f\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u0437 \u043d\u0438\u043c 128 \u043c\u0447\u0447. (342). \u041f\u0440\u043f. \u0413\u0430\u0432\u0440\u0438\u0457\u043b\u0430 \u0410\u0444\u043e\u043d\u0441\u044c\u043a\u043e\u0433\u043e (1901). \u000d\u000a\u0424\u043b\u043f., 248 \u0437\u0430\u0447., IV, 10 \u2013 23. \u041b\u043a., 33 \u0437\u0430\u0447., VII, 36 \u2013 50.\u000d\u000a\u0412\u043c\u0447. \u0410\u0440\u0442\u0435\u043c\u0456\u044f (362). \u000d\u000a\u041a\u043e\u043b., 249 \u0437\u0430\u0447., I, 1 \u2013 2, 7 \u2013 11. \u041b\u043a., 34 \u0437\u0430\u0447., VIII, 1 \u2013 3.\u000d\u000a\u0412\u043c\u0447.: 2 \u0422\u0438\u043c., 292 \u0437\u0430\u0447., II, 1 \u2013 10. \u0406\u043d., 52 \u0437\u0430\u0447., XV, 17 \u2013 XVI, 2.\u000d\u000a\u041f\u0440\u043f. \u0406\u043b\u0430\u0440\u0456\u043e\u043d\u0430 \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e (371 \u2013 372). \u041c\u0447\u0447. \u0414\u0430\u0441\u0456\u044f, \u0413\u0430\u044f \u0456 \u0417\u043e\u0442\u0438\u043a\u0430 (303). \u000d\u000a\u0421\u0432\u0442. \u0406\u043b\u0430\u0440\u0456\u043e\u043d\u0430, \u043c\u0438\u0442\u0440. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e (\u0425\u0406). \u041f\u0440\u043f. \u0406\u043b\u0430\u0440\u0456\u043e\u043d\u0430, \u0441\u0445\u0438\u043c\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406). \u041f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u043d\u044f \u000d\u000a\u043c\u043e\u0449\u0456\u0432 \u0441\u0432\u0442. \u0406\u043b\u0430\u0440\u0456\u043e\u043d\u0430, \u0454\u043f. \u041c\u0435\u0433\u043b\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e (1206). \u000d\u000a\u041a\u043e\u043b., 251 \u0437\u0430\u0447., I, 18 \u2013 23. \u041b\u043a., 37 \u0437\u0430\u0447., VIII, 22 \u2013 25.\u000d\u000a\u041f\u0440\u043f.: 2 \u041a\u043e\u0440., 188 \u0437\u0430\u0447., IX, 6 \u2013 11. \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u041f\u0440\u043f. \u0404\u0432\u0444\u0438\u043c\u0456\u044f \u041d\u043e\u0432\u043e\u0433\u043e, \u0421\u043e\u043b\u0443\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u0456\u0454\u0440\u043e\u0434\u0438\u044f\u043a. (898). \u041f\u0440\u043c\u0447. \u041b\u0443\u043a\u0456\u0430\u043d\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (312). \u0421\u0449\u043c\u0447. \u041b\u0443\u043a\u0456\u0430\u043d\u0430, \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (1243). \u041c\u0447. \u0421\u0430\u0440\u0432\u0438\u043b\u0430 \u0442\u0430 \u000d\u000a\u043c\u0446. \u0412\u0435\u0432\u0435\u0457 (\u0406\u0406). \u0421\u0432\u0442. \u0421\u0430\u0432\u0438\u043d\u0430, \u0454\u043f. \u041a\u0430\u0442\u0430\u043d\u0441\u044c\u043a\u043e\u0433\u043e (760).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u041f\u0440\u0438\u043c\u043d\u043e\u0436\u0435\u043d\u043d\u044f \u0445\u043b\u0456\u0431\u0456\u0432\u00bb (\u0425\u0406\u0425).\u000d\u000a\u0424\u043b\u043f., 244 \u0437\u0430\u0447., III, 1 \u2013 8. \u041b\u043a., 31 \u0437\u0430\u0447., VII, 17 \u2013 30.\u000d\u000a16\u000d\u000a17\u000d\u000a19\u000d\u000a20\u000d\u000a21\u000d\u000a15\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a20-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 3-\u0439.\u000d\u000a\u0410\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u0456 \u0454\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0441\u0442\u0430 \u041b\u0443\u043a\u0438 (\u0406). \u041c\u0447. \u041c\u0430\u0440\u0438\u043d\u0430 \u0410\u043d\u0430\u0437\u0430\u0440\u0432\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u000d\u000a\u041f\u0440\u043f. \u042e\u043b\u0456\u0430\u043d\u0430 \u041f\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u0412\u043c\u0446. \u0417\u043b\u0430\u0442\u0438 (\u0425\u0440\u0438\u0441\u0438) \u041c\u0435\u0433\u043b\u0435\u043d\u0441\u044c\u043a\u043e\u0457 (1795, \u000d\u000a\u0411\u043e\u043b\u0433.). \u0421\u043e\u0431\u043e\u0440 \u0441\u0432\u044f\u0442\u0438\u0445 \u0446\u0456\u043b\u0438\u0442\u0435\u043b\u0456\u0432 (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0443 \u043d\u0435\u0434\u0456\u043b\u044e, \u000d\u000a\u043d\u0430\u0439\u0431\u043b\u0438\u0436\u0447\u0443 \u0434\u043e 17 \u2013 18 \u0436\u043e\u0432\u0442\u043d\u044f).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 9-\u0435, \u0406\u043d., 65 \u0437\u0430\u0447., XX, 19 \u2013 31.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0413\u0430\u043b., 200 \u0437\u0430\u0447., I, 11 \u2013 19. \u041b\u043a., 30 \u0437\u0430\u0447., VII, 11 \u2013 16.\u000d\u000a\u0410\u043f.: \u041a\u043e\u043b., 260 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), IV, 5 \u2013 9, 14, 18. \u041b\u043a., 51 \u0437\u0430\u0447., X, 16 \u2013 21.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a18","70\u000d\u000a\u0420\u0456\u0432\u043d\u043e\u0430\u043f. \u0410\u0432\u0435\u0440\u043a\u0456\u044f, \u0454\u043f. \u0406\u0454\u0440\u0430\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (\u0431\u043b. 167). \u0421\u0432\u0442. \u0420\u0430\u0444\u0430\u0457\u043b\u0430 (\u0417\u0430\u0431\u043e\u0440\u043e\u0432\u0441\u044c\u043a\u043e\u0433\u043e), \u043c\u0438\u0442\u0440. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u0413\u0430\u043b\u0438\u0446\u044c\u043a\u043e\u0433\u043e \u0456 \u0432\u0441\u0456\u0454\u0457 \u000d\u000a\u0420\u0443\u0441\u0438 (1747). \u0421\u0456\u043c\u043e\u0445 \u043e\u0442\u0440\u043e\u043a\u0456\u0432 \u0443 \u0415\u0444\u0435\u0441\u0456: \u041c\u0430\u043a\u0441\u0438\u043c\u0456\u043b\u0456\u0430\u043d\u0430, \u042f\u043c\u0432\u043b\u0438\u0445\u0430, \u041c\u0430\u0440\u0442\u0438\u043d\u0456\u0430\u043d\u0430, \u0406\u043e\u0430\u043d\u0430, \u0414\u0456\u043e\u043d\u0456\u0441\u0456\u044f, \u0415\u043a\u0441\u0430\u043a\u0443\u0441\u0442\u043e\u0434\u0456\u0430\u043d\u0430 (\u041a\u043e\u0441\u0442\u044f\u043d\u0442\u0438\u043d\u0430) \u0442\u0430 \u0410\u043d\u0442\u043e\u043d\u0456\u043d\u0430 (\u0431\u043b. 250; \u000d\u000a408 \u2013 450). \u0421\u0449\u043c\u0447. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430, \u0454\u043f. \u0410\u0434\u0440\u0456\u0430\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e, \u043c\u0447. \u0406\u0440\u0430\u043a\u043b\u0456\u044f, \u0432\u043e\u0457\u043d\u0430, \u0442\u0430 \u043c\u0446\u0446. \u0410\u043d\u043d\u0438, \u0404\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u0438, \u0424\u0435\u043e\u0434\u043e\u0440\u0438 \u0442\u0430 \u0413\u043b\u0456\u043a\u0435\u0440\u0456\u0457 (\u0406\u0406 \u2013 \u0406\u0406\u0406). \u000d\u000a\u0410\u043d\u0434\u0440\u043e\u043d\u0438\u043a\u0456\u0432\u0441\u044c\u043a\u043e\u0457 (1281 \u2013 1332) \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456.\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 35 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b.), X, 1 \u2013 9. \u000d\u000a\u041b\u0456\u0442. \u2013 \u041a\u043e\u043b., 252 \u0437\u0430\u0447., I, 24 \u2013 29. \u041b\u043a., 41 \u0437\u0430\u0447., IX, 7 \u2013 11.\u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 318 \u0437\u0430\u0447., VII, 26 \u2013 VIII, 2. \u0406\u043d., 36 \u0437\u0430\u0447., X, 9 \u2013 16.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0438\u0442\u0435\u043b\u044e: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0442\u0435\u0431\u0435, \u0441\u0432\u044f\u0442\u0438\u0442\u0435\u043b\u044e \u043e\u0442\u0447\u0435 \u000d\u000a\u043d\u0430\u0448 \u0420\u0430\u0444\u0430\u0457\u043b\u0435, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u0441\u0432\u044f\u0442\u0443 \u043f\u0430\u043c\u2019\u044f\u0442\u044c \u0442\u0432\u043e\u044e, \u0431\u043e \u0442\u0438 \u043c\u043e\u043b\u0438\u0448 \u0437\u0430 \u043d\u0430\u0441 \u0425\u0440\u0438\u0441\u0442\u0430 \u0411\u043e\u0433\u0430 \u043d\u0430\u0448\u043e\u0433\u043e\u00bb.\u000d\u000a\u0410\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u0437 70-\u0445 \u042f\u043a\u043e\u0432\u0430, \u0431\u0440\u0430\u0442\u0430 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e \u0437\u0430 \u043f\u043b\u043e\u0442\u0442\u044e (\u0431\u043b. 63).\u000d\u000a\u0421\u0432\u0442. \u0406\u0433\u043d\u0430\u0442\u0456\u044f, \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (877 \u2013 878).\u000d\u000a\u041a\u043e\u043b., 253 \u0437\u0430\u0447., II, 1 \u2013 7. \u041b\u043a., 42 \u0437\u0430\u0447., IX, 12 \u2013 18.\u000d\u000a\u0410\u043f.: \u0413\u0430\u043b., 200 \u0437\u0430\u0447., I, 11 \u2013 19. \u041c\u0444., 56 \u0437\u0430\u0447., XIII, 54 \u2013 58.\u000d\u000a\u0414\u0438\u043c\u0438\u0442\u0440\u0456\u0432\u0441\u044c\u043a\u0430 \u043f\u043e\u043c\u0438\u043d\u0430\u043b\u044c\u043d\u0430 \u0441\u0443\u0431\u043e\u0442\u0430. \u041c\u0447. \u0410\u0440\u0435\u0444\u0438 \u0456 \u0437 \u043d\u0438\u043c 4299 \u043c\u0447\u0447. \u000d\u000a(523). \u041f\u0440\u043f\u043f. \u0410\u0440\u0435\u0444\u0438 (\u0431\u043b. 1195), \u0421\u0438\u0441\u043e\u044f (\u0425\u0406\u0406 \u2013 \u0425\u0406\u0406\u0406) \u0456 \u0424\u0435\u043e\u0444\u0456\u043b\u0430 (\u0425\u0406\u0406 \u000d\u000a\u2013 \u0425\u0406\u0406\u0406), \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0456\u0432 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u0438\u0445, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445. \u000d\u000a\u0421\u0432. \u0415\u043b\u0435\u0437\u0432\u043e\u044f, \u0437\u0430\u0442\u0432., \u0446\u0430\u0440\u044f \u0415\u0444\u0456\u043e\u043f\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 553 \u2013 555). \u041c\u0446\u0446. \u0421\u0438\u043d\u043a\u043b\u0438\u0442\u0456\u043a\u0456\u0457 \u0442\u0430 \u0434\u0432\u043e\u0445 \u0434\u043e\u0447\u043e\u043a \u0457\u0457 (V\u0406). \u0421\u0432\u0442. \u0410\u0444\u0430\u043d\u0430\u0441\u0456\u044f, \u043f\u0430\u0442\u0440. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(1311).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u0412\u0441\u0456\u0445 \u0441\u043a\u043e\u0440\u0431\u043e\u0442\u043d\u0438\u0445 \u0440\u0430\u0434\u0456\u0441\u0442\u044c\u00bb (1688).\u000d\u000a\u0417\u0430\u0443\u043f\u043e\u043a\u0456\u0439\u043d\u0435: 1 \u0421\u043e\u043b., 270 \u0437\u0430\u0447., IV, 13 \u2013 17. \u0406\u043d., 16 \u0437\u0430\u0447., V, 24 \u2013 30.\u000d\u000a\u0420\u044f\u0434.: 2 \u041a\u043e\u0440., 174 \u0437\u0430\u0447., III, 12 \u2013 18. \u041b\u043a., 22 \u0437\u0430\u0447., VI, 1 \u2013 10.\u000d\u000a\u041f\u043e\u043c\u0438\u043d\u0430\u043d\u043d\u044f \u043f\u043e\u043c\u0435\u0440\u043b\u0438\u0445.\u000d\u000a22-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0412\u043c\u0447. \u0414\u0438\u043c\u0438\u0442\u0440\u0456\u044f \u0421\u043e\u043b\u0443\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 306). \u041f\u0440\u043f. \u0424\u0435\u043e\u0444\u0456\u043b\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0454\u043f. \u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0431\u043b. 1482). \u041c\u0447. \u041b\u0443\u043f\u0430 \u0421\u043e\u043b\u0443\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(\u0431\u043b. 306). \u041f\u0440\u043f. \u0410\u0444\u0430\u043d\u0430\u0441\u0456\u044f \u041c\u0438\u0434\u0456\u043a\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 814). \u041f\u0440\u043f. \u0414\u0438\u043c\u0438\u0442\u0440\u0456\u044f \u0411\u0430\u0441\u0430\u0440\u0431\u043e\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1685, \u0411\u043e\u043b\u0433.).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u0444., 36 \u0437\u0430\u0447., X, 16 \u2013 22.\u000d\u000a\u041b\u0456\u0442. \u2013 \u041a\u043e\u043b., 255 \u0437\u0430\u0447., II, 13 \u2013 20. \u041b\u043a., 43 \u0437\u0430\u0447., IX, 18 \u2013 22.\u000d\u000a\u0412\u043c\u0447.: 2 \u0422\u0438\u043c., 292 \u0437\u0430\u0447., II, 1 \u2013 10. \u0406\u043d., 52 \u0437\u0430\u0447., XV, 17 \u2013 XVI, 2.\u000d\u000a22\u000d\u000a23\u000d\u000a24\u000d\u000a26\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a21-\u0448\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 4-\u0439.\u000d\u000a\u041c\u0447\u0447. \u041c\u0430\u0440\u043a\u0456\u0430\u043d\u0430, \u0447\u0438\u0442\u0446\u044f \u0456 \u041c\u0430\u0440\u0442\u0438\u0440\u0456\u044f, \u0456\u043f\u043e\u0434\u0438\u044f\u043a\u043e\u043d\u0430 (\u0431\u043b. 355). \u041f\u0440\u043f\u043f. \u041c\u0430\u0440\u0442\u0438\u0440\u0456\u044f, \u0434\u0438\u044f\u043a\u043e\u043d\u0430, \u0456 \u041c\u0430\u0440\u0442\u0438\u0440\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430, \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u0438\u0445, \u000d\u000a\u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406 \u2013 \u0425\u0406V). \u041c\u0447. \u0410\u043d\u0430\u0441\u0442\u0430\u0441\u0456\u044f \u0410\u043a\u0432\u0456\u043b\u0435\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0406\u0406). \u000d\u000a\u041f\u0440\u0430\u0432. \u0422\u0430\u0432\u0456\u0444\u0438 \u0406\u043e\u043f\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (\u0406).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 10-\u0435, \u0406\u043d., 66 \u0437\u0430\u0447., XXI, 1 \u2013 14.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0413\u0430\u043b., 203 \u0437\u0430\u0447., II, 16 \u2013 20. \u041b\u043a., 35 \u0437\u0430\u0447., VIII, 5 \u2013 15.\u000d\u000a\u041c\u0447\u0447.: \u0415\u0444., 224 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), IV, 7 \u2013 13. \u041c\u0444., 34 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), X, 1 \u2013 8.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a25","71\u000d\u000a\u041c\u0447. \u041d\u0435\u0441\u0442\u043e\u0440\u0430 \u0421\u043e\u043b\u0443\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 306). \u041f\u0440\u043f. \u041d\u0435\u0441\u0442\u043e\u0440\u0430 \u041b\u0456\u0442\u043e\u043f\u0438\u0441\u0446\u044f, \u000d\u000a\u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0431\u043b. 1114). \u041f\u0440\u043f. \u041d\u0435\u0441\u0442\u043e\u0440\u0430, \u043d\u0435\u043a\u043d\u0438\u0436\u043d\u043e\u0433\u043e, \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 \u000d\u000a(\u0425\u0406V). \u041c\u0446\u0446. \u041a\u0430\u043f\u0456\u0442\u043e\u043b\u0456\u043d\u0438 \u0442\u0430 \u0404\u0440\u043e\u0442\u0438\u0457\u0434\u0438 (304). \u041c\u0447. \u041c\u0430\u0440\u043a\u0430 \u0424\u0456\u0432\u0430\u0457\u0434\u0441\u044c\u043a\u043e\u0433\u043e \u0442\u0430 \u000d\u000a\u0456\u043d\u0448\u0438\u0445 \u0437 \u043d\u0438\u043c.\u000d\u000a\u041a\u043e\u043b., 256 \u0437\u0430\u0447., II, 20 \u2013 III, 3. \u041b\u043a., 44 \u0437\u0430\u0447., IX, 23 \u2013 27.\u000d\u000a\u041f\u0440\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u0412\u043c\u0446. \u041f\u0430\u0440\u0430\u0441\u043a\u0435\u0432\u0438-\u041f\u2019\u044f\u0442\u043d\u0438\u0446\u0456 (\u0406\u0406\u0406). \u041f\u0440\u043f. \u0406\u043e\u0432\u0430, \u0456\u0433\u0443\u043c. \u041f\u043e\u0447\u0430\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(1651). \u0421\u0432\u0442. \u0414\u0438\u043c\u0438\u0442\u0440\u0456\u044f (\u0422\u0443\u043f\u0442\u0430\u043b\u0430), \u043c\u0438\u0442\u0440. \u0420\u043e\u0441\u0442\u043e\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1709).\u000d\u000a\u041c\u0447. \u0422\u0435\u0440\u0435\u043d\u0442\u0456\u044f, \u043c\u0446. \u041d\u0435\u043e\u043d\u0456\u043b\u0438 \u0456 \u0434\u0456\u0442\u0435\u0439 \u0457\u0445\u043d\u0456\u0445 \u0421\u0430\u0440\u0432\u0438\u043b\u0430, \u0424\u043e\u0442\u0430, \u0424\u0435\u043e\u0434\u0443\u043b\u0430, \u0406\u0454\u0440\u0430\u043a\u0441\u0430, \u041d\u0438\u0442\u0430, \u0412\u0438\u043b\u0430 \u0442\u0430 \u0404\u0432\u043d\u0438\u043a\u0456\u0457 (\u0431\u043b. 249 \u2013 250). \u041f\u0440\u043f. \u0421\u0442\u0435\u0444\u0430\u043d\u0430 \u0421\u0430\u0432\u0430\u0457\u0442\u0430, \u000d\u000a\u0442\u0432\u043e\u0440\u0446\u044f \u043a\u0430\u043d\u043e\u043d\u0456\u0432 (\u0406\u0425). \u0421\u0432\u0442. \u0410\u0440\u0441\u0435\u043d\u0456\u044f, \u0430\u0440\u0445\u0456\u0454\u043f. \u0421\u0435\u0440\u0431\u0441\u044c\u043a\u043e\u0433\u043e (1266). \u041c\u0447\u0447. \u0410\u0444\u0440\u0438\u043a\u0430\u043d\u0430, \u0422\u0435\u0440\u0435\u043d\u0442\u0456\u044f, \u041c\u0430\u043a\u0441\u0438\u043c\u0430, \u041f\u043e\u043c\u043f\u0456\u044f \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 36-\u0442\u0438 (\u0406\u0406\u0406). \u0421\u0449\u043c\u0447. \u041a\u0438\u0440\u0456\u0430\u043a\u0430, \u000d\u000a\u043f\u0430\u0442\u0440. \u0404\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (363). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430 \u0425\u043e\u0437\u0435\u0432\u0456\u0442\u0430, \u0454\u043f. \u041a\u0435\u0441\u0430\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(V\u0406). \u0421\u0449\u043c\u0447. \u041d\u0435\u043e\u0444\u0456\u0442\u0430, \u0454\u043f. \u0423\u0440\u0431\u043d\u0438\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406\u0406, \u0413\u0440\u0443\u0437.). \u041f\u0440\u043f. \u0424\u0435\u043e\u0444\u0456\u043b\u0430 \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u044e\u0440\u043e\u0434\u0438\u0432\u043e\u0433\u043e \u0437\u0430\u0440\u0430\u0434\u0438 \u0425\u0440\u0438\u0441\u0442\u0430 (1853).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u0444., 104 \u0437\u0430\u0447., \u0425\u0425V, 1 \u2013 13. \u000d\u000a\u041b\u0456\u0442. \u2013 \u041a\u043e\u043b., 259 \u0437\u0430\u0447., III, 17 \u2013 IV, 1. \u041b\u043a., 47 \u0437\u0430\u0447., IX, 44 \u2013 50.\u000d\u000a\u0412\u043c\u0446.: 2 \u041a\u043e\u0440., 181 \u0437\u0430\u0447., VI, 1 \u2013 10. \u041b\u043a, 33 \u0437\u0430\u0447., VII, 36 \u2013 50.\u000d\u000a\u042f\u043a\u0449\u043e \u0437\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f \u043f\u043e\u043b\u0456\u0454\u043b\u0435\u0439\u043d\u0430 \u0441\u043b\u0443\u0436\u0431\u0430 \u0441\u0432\u044f\u0442\u0438\u0442\u0435\u043b\u044e \u0414\u0438\u043c\u0438\u0442\u0440\u0456\u044e, \u0442\u043e \u043d\u0430 \u000d\u000a\u0440\u0430\u043d\u043d\u0456\u0439 \u0447\u0438\u0442\u0430\u043d\u043d\u044f: \u0406\u043d., 35 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), \u0425, 1 \u2013 9, \u043d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457: \u0404\u0432\u0440., \u000d\u000a318 \u0437\u0430\u0447., VII, 26 \u2013 VIII, 2. \u0406\u043d., 36 \u0437\u0430\u0447., X, 9 \u2013 16. \u042f\u043a\u0449\u043e \u0436 \u043f\u0440\u0435\u043f\u043e\u0434\u043e\u0431\u043d\u043e\u043c\u0443 \u000d\u000a\u0406\u043e\u0432\u0443, \u0442\u043e \u043d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0447\u0438\u0442\u0430\u043d\u043d\u044f: \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30, \u043d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457: \u0413\u0430\u043b., \u000d\u000a213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u041f\u0440\u043c\u0447. \u0410\u043d\u0430\u0441\u0442\u0430\u0441\u0456\u0457 \u0420\u0438\u043c\u043b\u044f\u043d\u043a\u0438 (\u0421\u043e\u043b\u0443\u043d\u0441\u044c\u043a\u043e\u0457) (\u0406\u0406\u0406). \u041f\u0440\u043f. \u0410\u0432\u0440\u0430\u0430\u043c\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442. \u0456 \u0441\u0432. \u041c\u0430\u0440\u0456\u0457, \u043f\u043b\u0435\u043c\u0456\u043d\u043d\u0438\u0446\u0456 \u0439\u043e\u0433\u043e (\u0431\u043b. 360). \u041c\u0447\u0447. \u041a\u043b\u0430\u0432\u0434\u0456\u044f, \u0410\u0441\u0442\u0435\u0440\u0456\u044f, \u041d\u0435\u043e\u043d\u0430 \u0456 \u0424\u0435\u043e\u043d\u0456\u043b\u0438 (285). \u041f\u0440\u043f. \u0410\u043d\u043d\u0438 (826).\u000d\u000a\u041a\u043e\u043b., 260 \u0437\u0430\u0447., IV, 2 \u2013 9. \u041b\u043a., 48 \u0437\u0430\u0447., IX, 49 \u2013 56.\u000d\u000a\u041f\u0440\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041b\u043a., 60 \u0437\u0430\u0447., XI, 34 \u2013 41.\u000d\u000a\u0410\u043f. \u0432\u0456\u0434 70-\u0445 \u041a\u043b\u0435\u043e\u043f\u0438 (\u0406). \u0421\u0449\u043c\u0447. \u0417\u0438\u043d\u043e\u0432\u0456\u044f, \u0454\u043f. \u0415\u0433\u0435\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u0441\u0435\u0441\u0442\u0440\u0438 \u0439\u043e\u0433\u043e \u000d\u000a\u043c\u0446. \u0417\u0438\u043d\u043e\u0432\u0456\u0457 (285). \u0410\u043f\u043f. \u0432\u0456\u0434 70-\u0445: \u0422\u0435\u0440\u0442\u0456\u044f (\u0422\u0435\u0440\u0435\u043d\u0442\u0456\u044f), \u041c\u0430\u0440\u043a\u0430, \u042e\u0441\u0442\u0430 (\u0412\u0430\u0440\u0441\u0430\u0432\u0438) \u0456 \u0410\u0440\u0442\u0435\u043c\u0438 (\u0406). \u0421\u0449\u043c\u0447. \u041c\u0430\u0440\u043a\u0456\u0430\u043d\u0430, \u0454\u043f. \u0421\u0438\u0440\u0430\u043a\u0443\u0437\u044c\u043a\u043e\u0433\u043e (\u0406\u0406). \u041c\u0446. \u0404\u0432\u0442\u0440\u043e\u043f\u0456\u0457 \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (\u0431\u043b. 250). \u0421\u0432\u0432. \u0421\u0442\u0435\u0444\u0430\u043d\u0430 \u041c\u0438\u043b\u044e\u0442\u0438\u043d\u0430, \u043a\u043e\u0440\u043e\u043b\u044f \u000d\u000a\u0421\u0435\u0440\u0431\u0441\u044c\u043a\u043e\u0433\u043e (1320), \u0431\u0440\u0430\u0442\u0430 \u0439\u043e\u0433\u043e \u0414\u0440\u0430\u0433\u0443\u0442\u0438\u043d\u0430 (1316) \u0456 \u043c\u0430\u0442\u0435\u0440\u0456 \u0457\u0445\u043d\u044c\u043e\u0457 \u041e\u043b\u0435\u043d\u0438 (1306, \u0421\u0435\u0440\u0431.).\u000d\u000a\u041e\u0437\u0435\u0440\u044f\u043d\u0441\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (\u0425V\u0406).\u000d\u000a\u041a\u043e\u043b., 261 \u0437\u0430\u0447., IV, 10 \u2013 18. \u041b\u043a., 50 \u0437\u0430\u0447., X, 1 \u2013 15.\u000d\u000a\u0410\u043f\u043f. \u0432\u0456\u0434 70-\u0445: \u0421\u0442\u0430\u0445\u0456\u044f, \u0410\u043c\u043f\u043b\u0456\u044f, \u0423\u0440\u0432\u0430\u043d\u0430, \u041d\u0430\u0440\u043a\u0438\u0441\u0430, \u0410\u043f\u0435\u043b\u0456\u044f \u0442\u0430 \u0410\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u043b\u0430 (\u0406). \u041c\u0447. \u0415\u043f\u0438\u043c\u0430\u0445\u0430 (\u0431\u043b. 250). \u041f\u0440\u043f\u043f. \u0421\u043f\u0438\u0440\u0438\u0434\u043e\u043d\u0430 \u0456 \u041d\u0438\u043a\u043e\u0434\u0438\u043c\u0430, \u000d\u000a\u043f\u0440\u043e\u0441\u0444\u043e\u0440\u043d\u0438\u043a\u0456\u0432 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u0438\u0445, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406).\u000d\u000a\u041f\u0440\u043f. \u041c\u0430\u0432\u0440\u0438 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0457, \u0434\u0438\u044f\u043a\u043e\u043d\u0438\u0441\u0438 (V). \u041f\u0440\u0430\u0432. \u041f\u0435\u0442\u0440\u0430 \u000d\u000a(\u041a\u0430\u043b\u043d\u0438\u0448\u0435\u0432\u0441\u044c\u043a\u043e\u0433\u043e) \u0411\u0430\u0433\u0430\u0442\u043e\u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043b\u044c\u043d\u043e\u0433\u043e (1803).\u000d\u000a\u041f\u0440\u0430\u0432.: \u0415\u0444., 233 \u0437\u0430\u0447., VI, 10 \u2013 17. \u041c\u0444., 11 \u0437\u0430\u0447., V, 14 \u2013 19.\u000d\u000a\u0420\u044f\u0434.: 2 \u041a\u043e\u0440., 178 \u0437\u0430\u0447., V, 1 \u2013 10. \u041b\u043a., 29 \u0437\u0430\u0447., VII, 1 \u2013 10\u000d\u000a27\u000d\u000a28\u000d\u000a29\u000d\u000a30\u000d\u000a31\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430","72\u000d\u000a22-\u0433\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 5-\u0439.\u000d\u000a\u0411\u0435\u0437\u0441\u0440\u0440. \u0456 \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u0456\u0432 \u041a\u043e\u0441\u043c\u0438 \u0442\u0430 \u0414\u0430\u043c\u0456\u0430\u043d\u0430 \u0410\u0441\u0456\u0439\u0441\u044c\u043a\u0438\u0445 \u0456 \u043c\u0430\u0442\u0435\u0440\u0456 \u0457\u0445\u043d\u044c\u043e\u0457 \u000d\u000a\u043f\u0440\u043f. \u0424\u0435\u043e\u0434\u043e\u0442\u0456\u0457 (\u0406\u0406\u0406). \u0421\u0449\u043c\u0447\u0447. \u0406\u043e\u0430\u043d\u0430, \u0454\u043f., \u0456 \u042f\u043a\u043e\u0432\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u044f\u043a\u0456 \u0432 \u041f\u0435\u0440\u0441\u0456\u0457 \u000d\u000a\u043f\u043e\u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043b\u0438 (\u0431\u043b. 345). \u041c\u0446\u0446. \u041a\u0456\u0440\u0456\u0454\u043d\u0438 \u0442\u0430 \u042e\u043b\u0456\u0430\u043d\u0456\u0457 (305 \u2013 311). \u041c\u0447. \u0415\u0440\u043c\u0438\u043d\u0438\u043d\u0433\u0435\u043b\u044c\u0434\u0430, \u0446\u0430\u0440\u0435\u0432\u0438\u0447\u0430 \u0413\u043e\u0442\u0441\u044c\u043a\u043e\u0433\u043e (586). \u041c\u0447\u0447. \u041a\u0435\u0441\u0430\u0440\u0456\u044f, \u0414\u0430\u0441\u0456\u044f \u0456 \u0437 \u043d\u0438\u043c\u0438 \u000d\u000a\u043f\u2019\u044f\u0442\u044c\u043e\u0445 (V\u0406\u0406).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 11-\u0435, \u0406\u043d., 67 \u0437\u0430\u0447., XXI, 15 \u2013 25.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0413\u0430\u043b., 215 \u0437\u0430\u0447., VI, 11 \u2013 18. \u041b\u043a., 83 \u0437\u0430\u0447., XVI, 19 \u2013 31.\u000d\u000a\u0411\u0435\u0437\u0441\u0440\u0456\u0431\u043d\u0438\u043a\u0456\u0432: 1 \u041a\u043e\u0440., 153 \u0437\u0430\u0447., XII, 27 \u2013 XIII, 8. \u041c\u0444., 34 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), X, 1, 5 \u2013 8.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a1\u000d\u000a23-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u041c\u0447\u0447. \u0410\u043a\u0438\u043d\u0434\u0438\u043d\u0430, \u041f\u0438\u0433\u0430\u0441\u0456\u044f, \u000d\u000a\u0410\u0444\u043e\u043d\u0456\u044f, \u0415\u043b\u043f\u0456\u0434\u043e\u0444\u043e\u0440\u0430, \u0410\u043d\u0435\u043c\u043f\u043e\u0434\u0438\u0441\u0442\u0430 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 \u0437 \u043d\u0438\u043c\u0438 (\u0431\u043b. 341 \u2013 345). \u000d\u000a\u041f\u0440\u043f. \u041c\u0430\u0440\u043a\u0456\u0430\u043d\u0430 \u041a\u0438\u0440\u0438\u043d\u0435\u0439\u0441\u044c\u043a\u043e\u0433\u043e (388). \u000d\u000a1 \u0421\u043e\u043b., 262 \u0437\u0430\u0447., I, 1 \u2013 5. \u041b\u043a., 52 \u0437\u0430\u0447., X, 22 \u2013 24.\u000d\u000a\u041c\u0447\u0447.: \u0415\u0444., 233 \u0437\u0430\u0447., VI, 10 \u2013 17. \u041c\u0444., 36 \u0437\u0430\u0447., X, 16 \u2013 22.\u000d\u000a\u0421\u0449\u043c\u0447\u0447. \u0410\u043a\u0435\u043f\u0441\u0438\u043c\u0430, \u0454\u043f., \u0419\u043e\u0441\u0438\u0444\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442., \u0456 \u0410\u0457\u0444\u0430\u043b\u0430, \u0434\u0438\u044f\u043a. (\u0406V). \u041e\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044f \u0445\u0440\u0430\u043c\u0443 \u0432\u043c\u0447. \u042e\u0440\u0456\u044f (\u0413\u0435\u043e\u0440\u0433\u0456\u044f) \u0432 \u041b\u0456\u0434\u0434\u0456 (\u0406V). \u041c\u0447\u0447. \u0410\u0442\u0438\u043a\u0430, \u0410\u0433\u0430\u043f\u0456\u044f, \u0404\u0432\u0434\u043e\u043a\u0441\u0456\u044f, \u041a\u0430\u0442\u0435\u0440\u0456\u044f, \u0406\u0441\u0442\u0443\u043a\u0430\u0440\u0456\u044f, \u041f\u0430\u043a\u0442\u043e\u0432\u0456\u044f, \u041d\u0438\u043a\u0442\u043e\u043f\u043e\u043b\u0456\u043e\u043d\u0430 \u0442\u0430 \u0432\u043e\u0457\u043d\u0456\u0432 \u0457\u0445 (\u0431\u043b. 320). \u000d\u000a\u041f\u0440\u043f. \u0410\u043a\u0435\u043f\u0441\u0438\u043c\u0430 \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u041f\u0440\u0430\u0432. \u0421\u043d\u0430\u043d\u0434\u0443\u043b\u0456\u0457 (\u0406V). \u041f\u0440\u043f. \u0410\u043d\u043d\u0438 \u000d\u000a\u0412\u0441\u0435\u0432\u043e\u043b\u043e\u0434\u0456\u0432\u043d\u0438, \u043a\u043d\u044f\u0436\u043d\u0438 \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0457 (1112).\u000d\u000a1 \u0421\u043e\u043b., 263 \u0437\u0430\u0447., I, 6 \u2013 10. \u041b\u043a., 55 \u0437\u0430\u0447., XI, 1 \u2013 10.\u000d\u000a\u041f\u0440\u043f.: \u0413\u0430\u043b., 208 \u0437\u0430\u0447., \u0406\u0406I, 23 \u2013 29. \u041c\u0444., 21 \u0437\u0430\u0447., VI\u0406, 12 \u2013 21.\u000d\u000a\u041c\u0447. \u0413\u0430\u043b\u0430\u043a\u0442\u0456\u043e\u043d\u0430 \u0442\u0430 \u043c\u0446. \u0404\u043f\u0456\u0441\u0442\u0438\u043c\u0456\u0457 (\u0406\u0406\u0406). \u0410\u043f\u043f. \u0432\u0456\u0434 70-\u0445: \u041f\u0430\u0442\u0440\u043e\u0432\u0430, \u0404\u0440\u043c\u0430, \u000d\u000a\u041b\u0456\u043d\u0430, \u0413\u0430\u044f, \u0424\u0456\u043b\u043e\u043b\u043e\u0433\u0430 (\u0406). \u0421\u0432\u0442. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f, \u0430\u0440\u0445\u0456\u0454\u043f. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0425).\u000d\u000a1 \u0421\u043e\u043b., 265 \u0437\u0430\u0447., II, 9 \u2013 14. \u041b\u043a., 57 \u0437\u0430\u0447., XI, 14 \u2013 23.\u000d\u000a\u0421\u0449\u043c\u0447. \u041f\u0430\u0432\u043b\u0430, \u0430\u0440\u0445\u0456\u0454\u043f. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e, \u0441\u043f\u043e\u0432. (350). \u000d\u000a\u041f\u0440\u043f. \u041b\u0443\u043a\u0438, \u0456\u043a\u043e\u043d\u043e\u043c\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 \u000d\u000a(\u0425\u0406\u0406\u0406). \u041c\u0446\u0446. \u0422\u0435\u043a\u0443\u0441\u0438, \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0438, \u041f\u043e\u043b\u0430\u043a\u0442\u0456\u0457, \u041a\u043b\u0430\u0432\u0434\u0456\u0457, \u0404\u0432\u0444\u0440\u0430\u0441\u0456\u0457, \u0410\u0444\u0430\u043d\u0430\u0441\u0456\u0457 \u0456 \u041c\u043e\u0442\u0440\u043e\u043d\u0438 (\u0406\u0406\u0406). \u041f\u0440\u043f. \u041b\u0443\u043a\u0438 \u0422\u0430\u0432\u0440\u043e\u043c\u0435\u043d\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (800 \u2013 820).\u000d\u000a1 \u0421\u043e\u043b., 266 \u0437\u0430\u0447., II, 14 \u2013 19. \u041b\u043a., 58 \u0437\u0430\u0447., XI, 23 \u2013 26.\u000d\u000a\u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0438\u043a\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e (846). \u0421\u0449\u043c\u0447\u0447. \u041d\u0438\u043a\u0430\u043d\u0434\u0440\u0430, \u0454\u043f. \u041c\u0438\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u0404\u0440\u043c\u0456\u044f, \u043f\u0440\u0435\u0441\u0432\u0456\u0442. (\u0406). \u041f\u0430\u043c\u2019\u044f\u0442\u044c \u043e\u0441\u0432\u044f\u0447\u0435\u043d\u043d\u044f \u0441\u043e\u0431\u043e\u0440\u0443 \u0421\u0432\u044f\u0442\u043e\u0457 \u0421\u043e\u0444\u0456\u0457 \u0432 \u041a\u0438\u0454\u0432\u0456 \u000d\u000a(\u0425\u0406). \u041f\u0440\u043f. \u041c\u0435\u0440\u043a\u0443\u0440\u0456\u044f, \u043f\u043e\u0441\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u000d\u000a\u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406V). \u0421\u0432\u0442. \u041f\u0430\u0432\u043b\u0430 (\u041a\u043e\u043d\u044e\u0448\u043a\u0435\u0432\u0438\u0447\u0430), \u043c\u0438\u0442\u0440. \u0422\u043e\u0431\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (1770). \u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u041e\u0440\u0430\u043d\u0442\u0430-\u041d\u0435\u043f\u043e\u0440\u0443\u0448\u043d\u0430 \u0441\u0442\u0456\u043d\u0430\u00bb (\u0425\u0406).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 4 \u0437\u0430\u0447., I, 39 \u2013 49, 56.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u0421\u043e\u043b., 264 \u0437\u0430\u0447., II, 1 \u2013 8. \u041b\u043a., 56 \u0437\u0430\u0447., XI, 9 \u2013 13.\u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456: \u0424\u043b\u043f., 240 \u0437\u0430\u0447., II, 5 \u2013 11. \u041b\u043a., 54 \u0437\u0430\u0447., X, 38 \u2013 42; XI, 27 \u2013 28.\u000d\u000a2\u000d\u000a3\u000d\u000a5\u000d\u000a6\u000d\u000a4\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430","73\u000d\u000a\u041c\u0447\u0447. \u043f\u043e\u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043b\u0438\u0445 \u0443 \u041c\u0435\u043b\u0438\u0442\u0438\u043d\u0456: \u0406\u0454\u0440\u043e\u043d\u0430, \u0406\u0441\u0438\u0445\u0456\u044f, \u041d\u0438\u043a\u0430\u043d\u0434\u0440\u0430, \u0410\u0444\u0430\u043d\u0430\u0441\u0456\u044f, \u000d\u000a\u041c\u0430\u043c\u0430\u043d\u0442\u0430, \u0412\u0430\u0440\u0430\u0445\u0456\u044f, \u041a\u0430\u043b\u0438\u043d\u0438\u043a\u0430, \u0424\u0435\u043e\u0433\u0435\u043d\u0430, \u041d\u0438\u043a\u043e\u043d\u0430, \u041b\u043e\u043d\u0433\u0438\u043d\u0430, \u0424\u0435\u0434\u043e\u0440\u0430, \u000d\u000a\u0412\u0430\u043b\u0435\u0440\u0456\u044f, \u041a\u0441\u0430\u043d\u0444\u0430, \u0424\u0435\u043e\u0434\u0443\u043b\u0430, \u041a\u0430\u043b\u0438\u043c\u0430\u0445\u0430, \u0404\u0432\u0433\u0435\u043d\u0456\u044f, \u0424\u0435\u043e\u0434\u043e\u0445\u0430, \u041e\u0441\u0442\u0440\u0438\u0445\u0456\u044f, \u000d\u000a\u0415\u043f\u0456\u0444\u0430\u043d\u0456\u044f, \u041c\u0430\u043a\u0441\u0438\u043c\u0456\u0430\u043d\u0430, \u0414\u0443\u043a\u0438\u0442\u0456\u044f, \u041a\u043b\u0430\u0432\u0434\u0456\u0430\u043d\u0430, \u0424\u0435\u043e\u0444\u0456\u043b\u0430, \u0413\u0456\u0433\u0430\u043d\u0442\u0456\u044f, \u0414\u043e\u0440\u043e\u0444\u0435\u044f, \u0424\u0435\u043e\u0434\u043e\u0442\u0430, \u041a\u0430\u0441\u0442\u0440\u0438\u043a\u0456\u044f, \u0410\u043d\u0438\u043a\u0438\u0442\u0438, \u0424\u0435\u043c\u0435\u043b\u0456\u044f, \u0404\u0432\u0442\u0438\u0445\u0456\u044f, \u0406\u043b\u0430\u0440\u0456\u043e\u043d\u0430, \u0414\u0456\u043e\u0434\u043e\u0442\u0430 \u0439 \u0410\u043c\u043e\u043d\u0438\u0442\u0430 (\u0406\u0406\u0406). \u041f\u0440\u043f. \u041b\u0430\u0437\u0430\u0440\u044f \u0413\u0430\u043b\u0456\u0441\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0456\u0454\u0440\u043e\u043c. (1053). \u041c\u0447. \u0424\u0435\u043e\u0434\u043e\u0442\u0430 \u0410\u043d\u043a\u0438\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u043a\u043e\u0440\u0447\u043c\u0430\u0440\u044f (303). \u041c\u0447\u0447. \u041c\u0435\u043b\u0430\u0441\u0438\u043f\u0430 \u0456 \u041a\u0430\u0441\u0438\u043d\u0456\u0457 \u0442\u0430 \u0441\u0438\u043d\u0430 \u000d\u000a\u0457\u0445\u043d\u044c\u043e\u0433\u043e \u0410\u043d\u0442\u043e\u043d\u0456\u043d\u0430 (363). \u041c\u0447\u0447. \u0410\u0432\u043a\u0442\u0430, \u0422\u0430\u0432\u0440\u0456\u043e\u043d\u0430 \u0456 \u0424\u0435\u0441\u0430\u043b\u043e\u043d\u0456\u043a\u0456\u0457.\u000d\u000a2 \u041a\u043e\u0440., 185 \u0437\u0430\u0447., VIII, 1 \u2013 5. \u041b\u043a., 36 \u0437\u0430\u0447., VIII, 16 \u2013 21.\u000d\u000a7\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a23-\u0442\u044f \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 6-\u0439.\u000d\u000a\u0421\u043e\u0431\u043e\u0440 \u0430\u0440\u0445\u0456\u0441\u0442\u0440\u0430\u0442\u0438\u0433\u0430 \u041c\u0438\u0445\u0430\u0457\u043b\u0430 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 \u043d\u0435\u0431\u0435\u0441\u043d\u0438\u0445 \u0441\u0438\u043b \u0431\u0435\u0437\u043f\u043b\u043e\u0442\u043d\u0438\u0445. \u0410\u0440\u0445\u0430\u043d\u0433\u0435\u043b\u0456\u0432: \u0413\u0430\u0432\u0440\u0438\u0457\u043b\u0430, \u0420\u0430\u0444\u0430\u0457\u043b\u0430, \u0423\u0440\u0438\u0457\u043b\u0430, \u0421\u0435\u043b\u0430\u0444\u0438\u0457\u043b\u0430, \u0406\u0454\u0433\u0443\u0434\u0438\u0457\u043b\u0430, \u0412\u0430\u0440\u0430\u0445\u0438\u0457\u043b\u0430 \u0442\u0430 \u0406\u0454\u0440\u0435\u043c\u0438\u0457\u043b\u0430.\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 1-\u0435, \u041c\u0444., 116 \u0437\u0430\u0447., XXVIII, 16 \u2013 20.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0415\u0444., 220 \u0437\u0430\u0447., II, 4 \u2013 10. \u041b\u043a., 38 \u0437\u0430\u0447., VIII, 26 \u2013 39.\u000d\u000a\u0410\u0440\u0445\u0456\u0441\u0442\u0440.: \u0404\u0432\u0440., 305 \u0437\u0430\u0447., II, 2 \u2013 10. \u041b\u043a., 51 \u0437\u0430\u0447., X, 16 \u2013 21.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0442\u0435\u0431\u0435, \u0441\u0432\u044f\u0442\u0438\u0439 \u0430\u0440\u0445\u0456\u0441\u0442\u0440\u0430\u0442\u0438\u0436\u0435 \u0411\u043e\u0436\u0438\u0439 \u041c\u0438\u0445\u0430\u0457\u043b\u0435, \u0456 \u0432\u0441\u0456 \u0432\u043e\u0457\u043d\u0441\u0442\u0432\u0430 \u0445\u0435\u0440\u0443\u0432\u0438\u043c\u0456\u0432 \u0456 \u0441\u0435\u0440\u0430\u0444\u0438\u043c\u0456\u0432, \u0449\u043e \u043f\u0440\u043e\u0441\u043b\u0430\u0432\u043b\u044f\u0454\u0442\u0435 \u0413\u043e\u0441\u043f\u043e\u0434\u0430\u00bb.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a8\u000d\u000a24-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u041c\u0447\u0447. \u041e\u043d\u0438\u0441\u0438\u0444\u043e\u0440\u0430 \u0456 \u041f\u043e\u0440\u0444\u0438\u0440\u0456\u044f (\u0431\u043b. 284 \u2013 305). \u041f\u0440\u043f. \u041c\u043e\u0442\u0440\u043e\u043d\u0438 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0457 (\u0431\u043b. 492). \u000d\u000a\u041f\u0440\u043f. \u0424\u0435\u043e\u043a\u0442\u0438\u0441\u0442\u0438 (881). \u041f\u0440\u043f. \u041e\u043d\u0438\u0441\u0438\u0444\u043e\u0440\u0430, \u0441\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (1148). \u041c\u0447. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u0421\u043e\u043b\u0443\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u041c\u0447. \u0410\u043d\u0442\u043e\u043d\u0456\u044f \u0410\u043f\u0430\u043c\u0435\u0439\u0441\u044c\u043a\u043e\u0433\u043e (V). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430 \u041a\u043e\u043b\u043e\u0432\u0430 (V). \u000d\u000a\u041f\u0440\u043f\u043f. \u0404\u0432\u0441\u0442\u043e\u043b\u0456\u0457 (610) \u0456 \u0421\u043e\u0441\u0438\u043f\u0430\u0442\u0440\u0438 (625). \u0421\u0432\u0442. \u041d\u0435\u043a\u0442\u0430\u0440\u0456\u044f \u0415\u0433\u0456\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u000d\u000a\u043c\u0438\u0442\u0440. \u041f\u0435\u043d\u0442\u0430\u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0433\u043e, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (1920). \u041f\u0440\u043f. \u0421\u0438\u043c\u0435\u043e\u043d\u0430 \u041c\u0435\u0442\u0430\u0444\u0440\u0430\u0441\u0442\u0430 (\u0425)\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u0421\u043a\u043e\u0440\u043e\u043f\u043e\u0441\u043b\u0443\u0448\u043d\u0438\u0446\u044f\u00bb (X).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 4 \u0437\u0430\u0447., I, 39 \u2013 49, 56.\u000d\u000a\u041b\u0456\u0442. \u2013 1 \u0421\u043e\u043b., 267 \u0437\u0430\u0447., II, 20 \u2013 III, 8. \u041b\u043a., 59 \u0437\u0430\u0447., XI, 29 \u2013 33.\u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456: \u0424\u043b\u043f., 240 \u0437\u0430\u0447., II, 5 \u2013 11. \u041b\u043a., 54 \u0437\u0430\u0447., X, 38 \u2013 42; XI, 27 \u2013 28.\u000d\u000a\u0410\u043f\u043f. \u0432\u0456\u0434 70-\u0445: \u0415\u0440\u0430\u0441\u0442\u0430, \u041e\u043b\u0456\u043c\u043f\u0430, \u0420\u043e\u0434\u0456\u043e\u043d\u0430, \u0421\u043e\u0441\u0438\u043f\u0430\u0442\u0440\u0430, \u041a\u0443\u0430\u0440\u0442\u0430 (\u041a\u0432\u0430\u0440\u0442\u0430) \u0456 \u000d\u000a\u0422\u0435\u0440\u0442\u0456\u044f (\u0422\u0435\u0440\u0435\u043d\u0442\u0456\u044f) (\u0406). \u041c\u0447. \u041e\u0440\u0435\u0441\u0442\u0430 \u0422\u0456\u0430\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u043b\u0456\u043a\u0430\u0440\u044f (304). \u0421\u0449\u043c\u0447. \u041c\u0438\u043b\u0456\u044f, \u0454\u043f. \u041f\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u0434\u0432\u043e\u0445 \u0443\u0447\u043d\u0456\u0432 \u0439\u043e\u0433\u043e (341). \u041f\u0440\u043f. \u0424\u0435\u043e\u0441\u0442\u0438\u0440\u0438\u043a\u0442\u0430, \u0449\u043e \u0432 \u000d\u000a\u0421\u0438\u043c\u0432\u043e\u043b\u0430\u0445. \u041c\u0447. \u041a\u043e\u0441\u0442\u044f\u043d\u0442\u0438\u043d\u0430, \u043a\u043d. \u0413\u0440\u0443\u0437\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e (842). \u041a\u043e\u043b\u0435\u0441\u0443\u0432\u0430\u043d\u043d\u044f \u000d\u000a\u0432\u043c\u0447. \u0413\u0435\u043e\u0440\u0433\u0456\u044f (303, \u0413\u0440\u0443\u0437.).\u000d\u000a1 \u0421\u043e\u043b., 268 \u0437\u0430\u0447., III, 9 \u2013 13. \u041b\u043a., 60 \u0437\u0430\u0447., XI, 34 \u2013 41.\u000d\u000a\u0412\u043c\u0447. \u041c\u0438\u043d\u0438 \u0424\u0440\u0438\u0433\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0432\u043e\u0457\u043d\u0430 (304). \u041c\u0447. \u0412\u0456\u043a\u0442\u043e\u0440\u0430 \u0456 \u043c\u0446. \u0421\u0442\u0435\u0444\u0430\u043d\u0438\u0434\u0438 (\u0406\u0406). \u000d\u000a\u0421\u0449\u043c\u0447. \u0412\u0456\u043a\u0435\u043d\u0442\u0456\u044f \u0421\u0430\u0440\u0430\u0433\u043e\u0441\u044c\u043a\u043e\u0433\u043e, \u0434\u0438\u044f\u043a. (304). \u041f\u0440\u043f. \u0424\u0435\u0434\u043e\u0440\u0430 \u0421\u0442\u0443\u0434\u0438\u0442\u0430, \u000d\u000a\u0441\u043f\u043e\u0432. (826). \u041c\u0447. \u0421\u0442\u0435\u0444\u0430\u043d\u0430 \u0414\u0435\u0447\u0430\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 1336, \u0421\u0435\u0440\u0431.).\u000d\u000a1 \u0421\u043e\u043b., 269 \u0437\u0430\u0447., IV, 1 \u2013 12. \u041b\u043a., 61 \u0437\u0430\u0447., XI, 42 \u2013 46.\u000d\u000a\u041f\u0440\u043f.: \u0415\u0444., 233 \u0437\u0430\u0447., VI, 10 \u2013 17. \u041c\u0444., 10 \u0437\u0430\u0447., \u0406V, 25 \u2013 V, 12.\u000d\u000a9\u000d\u000a10\u000d\u000a11\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430","74\u000d\u000a\u0421\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 \u041c\u0438\u043b\u043e\u0441\u0442\u0438\u0432\u043e\u0433\u043e, \u043f\u0430\u0442\u0440. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (620). \u041f\u0440\u043f. \u041d\u0456\u043b\u0430, \u000d\u000a\u043f\u043e\u0441\u043d\u0438\u043a\u0430 (V). \u041f\u0440\u043e\u0440. \u0410\u0445\u0456\u0457 (960 \u0434\u043e \u0420. \u0425.).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u041c\u0438\u043b\u043e\u0441\u0442\u0438\u0432\u0430\u00bb.\u000d\u000a1 \u0421\u043e\u043b., 271 \u0437\u0430\u0447., V, 1 \u2013 8. \u041b\u043a., 62 \u0437\u0430\u0447., XI, 47 \u2013 XII, 1 (\u0437\u0430 \u0447\u0435\u0442\u0432\u0435\u0440).\u000d\u000a1 \u0421\u043e\u043b., 272 \u0437\u0430\u0447., V, 9 \u2013 13, 24 \u2013 28. \u041b\u043a., 63 \u0437\u0430\u0447., XII, 2 \u2013 12 (\u0437\u0430 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e).\u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 311 \u0437\u0430\u0447., IV, 14 \u2013 V, 6. \u041c\u0444., 16 \u0437\u0430\u0447., V\u0406, 1 \u2013 13 (\u043f\u0456\u0434 \u0437\u0430\u0447\u0430\u043b\u043e).\u000d\u000a\u0410\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u0424\u0438\u043b\u0438\u043f\u0430 (\u0406). \u0421\u0432. \u0431\u043b\u0433\u0432. \u0412\u0456\u0437\u0430\u043d\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u0456\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0430 \u042e\u0441\u0442\u0438\u043d\u0456\u0430\u043d\u0430 (565) \u0442\u0430 \u0456\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u0456 \u0424\u0435\u043e\u0434\u043e\u0440\u0438 (548). \u0421\u0432\u0442. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f \u041f\u0430\u043b\u0430\u043c\u0438, \u000d\u000a\u0430\u0440\u0445\u0456\u0454\u043f. \u0424\u0435\u0441\u0441\u0430\u043b\u043e\u043d\u0456\u043a\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 1360).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 67 \u0437\u0430\u0447., XXI, 15 \u2013 25.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0410\u043f.: 1 \u041a\u043e\u0440., 131 \u0437\u0430\u0447., IV, 9 \u2013 16. \u0406\u043d., 5 \u0437\u0430\u0447., I, 43 \u2013 51.\u000d\u000a\u0420\u044f\u0434.: 2 \u041a\u043e\u0440., 191 \u0437\u0430\u0447., XI, 1 \u2013 6. \u041b\u043a., 40 \u0437\u0430\u0447., IX, 1 \u2013 6.\u000d\u000a\u0417\u0430\u0433\u043e\u0432\u0438\u043d\u0438 \u043d\u0430 \u0420\u0456\u0437\u0434\u0432\u044f\u043d\u0438\u0439 (\u041f\u0438\u043b\u0438\u043f\u0456\u0432) \u043f\u0456\u0441\u0442.\u000d\u000a25-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0410\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u0456 \u0454\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0441\u0442\u0430 \u000d\u000a\u041c\u0430\u0442\u0444\u0435\u044f (60). \u041f\u0440\u0430\u0432. \u0424\u0443\u043b\u0432\u0456\u0430\u043d\u0430, \u043a\u043d. \u0415\u0444\u0456\u043e\u043f\u0441\u044c\u043a\u043e\u0433\u043e, \u0443 \u0441\u0432. \u0445\u0440\u0435\u0449\u0435\u043d\u043d\u0456 \u000d\u000a\u041c\u0430\u0442\u0444\u0435\u044f (\u0406). \u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 67 \u0437\u0430\u0447., XXI, 15 \u2013 25.\u000d\u000a\u041b\u0456\u0442. \u2013 2 \u0421\u043e\u043b., 274 \u0437\u0430\u0447., I, 1 \u2013 10. \u041b\u043a., 65 \u0437\u0430\u0447., XII, 13 \u2013 15, 22 \u2013 31.\u000d\u000a\u0410\u043f.: 1 \u041a\u043e\u0440., 131 \u0437\u0430\u0447., IV, 9 \u2013 16. \u041c\u0444., 30 \u0437\u0430\u0447., IX, 9 \u2013 13.\u000d\u000a\u0421\u0432\u0442. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f \u0427\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f, \u0454\u043f. \u041d\u0435\u043e\u043a\u0435\u0441\u0430\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 266 \u2013 270). \u000d\u000a\u041f\u0440\u043f. \u041b\u0430\u0437\u0430\u0440\u044f, \u0456\u043a\u043e\u043d\u043e\u043f\u0438\u0441\u0446\u044f (\u0431\u043b. 857). \u041c\u0447. \u0413\u043e\u0431\u0440\u043e\u043d\u0430, \u0443 \u0441\u0432. \u0445\u0440\u0435\u0449\u0435\u043d\u043d\u0456 \u041c\u0438\u0445\u0430\u0457\u043b\u0430, \u0456 \u0437 \u043d\u0438\u043c 133 \u0432\u043e\u0457\u043d\u0456\u0432 (914, \u0413\u0440\u0443\u0437.). \u041c\u0447\u0447. \u0410\u0446\u0456\u0441\u043a\u043b\u0430 \u0456 \u0412\u0456\u043a\u0442\u043e\u0440\u0456\u0457 \u041a\u043e\u0440\u0434\u0443\u0432\u0456\u0439\u0441\u044c\u043a\u0438\u0445 (\u041a\u043e\u0440\u0434\u0443\u0431\u0441\u044c\u043a\u0438\u0445) (IV).\u000d\u000a2 \u0421\u043e\u043b., 274 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), I, 10 \u2013 II, 2. \u041b\u043a., 68 \u0437\u0430\u0447., XII, 42 \u2013 48.\u000d\u000a\u0421\u0432\u0442.: 1 \u041a\u043e\u0440., 151 \u0437\u0430\u0447., XII, 7 \u2013 11. \u041c\u0444., 34 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b.), X, 1 \u2013 8.\u000d\u000a12\u000d\u000a14\u000d\u000a16\u000d\u000a17\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0421\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 \u0417\u043e\u043b\u043e\u0442\u043e\u0443\u0441\u0442\u043e\u0433\u043e, \u0430\u0440\u0445\u0456\u0454\u043f. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(407). \u0421\u0449\u043c\u0447. \u0410\u043d\u0442\u043e\u043d\u0456\u043d\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u043c\u0447\u0447. \u041d\u0438\u043a\u0438\u0444\u043e\u0440\u0430 \u0456 \u0413\u0435\u0440\u043c\u0430\u043d\u0430 (308). \u000d\u000a\u041c\u0446. \u041c\u0430\u043d\u0435\u0444\u0438 (308).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 35 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b.), X, 1 \u2013 9. \u000d\u000a\u041b\u0456\u0442. \u2013 \u0421\u0432\u0442.: \u0404\u0432\u0440., 318 \u0437\u0430\u0447., VII, 26 \u2013 VIII, 2. \u0406\u043d., 36 \u0437\u0430\u0447., X, 9 \u2013 16.\u000d\u000a24-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 7-\u0439.\u000d\u000a\u041c\u0447\u0447. \u0456 \u0441\u043f\u043e\u0432\u0432. \u0413\u0443\u0440\u0456\u044f, \u0421\u0430\u043c\u043e\u043d\u0430 (299 \u2013 306) \u0456 \u0441\u0449\u043c\u0447. \u0410\u0432\u0456\u0432\u0430, \u0434\u0438\u044f\u043a. (322). \u000d\u000a\u041f\u0440\u043f. \u041f\u0430\u0457\u0441\u0456\u044f \u0412\u0435\u043b\u0438\u0447\u043a\u043e\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1794). \u041c\u0447\u0447. \u0415\u043b\u043f\u0456\u0434\u0456\u044f, \u041c\u0430\u0440\u043a\u0435\u043b\u0430 \u0456 \u0404\u0432\u0441\u0442\u043e\u0445\u0456\u044f (361 \u2013 363). \u041c\u0447. \u0414\u0438\u043c\u0438\u0442\u0440\u0456\u044f (\u0431\u043b. 307).\u000d\u000a\u041a\u0443\u043f\u2019\u044f\u0442\u0438\u0446\u044c\u043a\u043e\u0457 \u0456\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 (1182).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 2-\u0435, \u041c\u043a., 70 \u0437\u0430\u0447., XVI, 1 \u2013 8.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0415\u0444., 221 \u0437\u0430\u0447., II, 14 \u2013 22. \u041b\u043a., 39 \u0437\u0430\u0447., VIII, 41 \u2013 56.\u000d\u000a\u041f\u0440\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u041f\u043e\u0447\u0430\u0442\u043e\u043a \u0420\u0456\u0437\u0434\u0432\u044f\u043d\u043e\u0433\u043e \u043f\u043e\u0441\u0442\u0443.\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a13\u000d\u000a15","75\u000d\u000a\u041c\u0447. \u041f\u043b\u0430\u0442\u043e\u043d\u0430 \u0410\u043d\u043a\u0438\u0440\u0441\u044c\u043a\u043e\u0433\u043e (302 \u0430\u0431\u043e 306). \u0421\u0449\u043c\u0447. \u0420\u043e\u043c\u0430\u043d\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0430, \u000d\u000a\u0456 \u043c\u0447. \u043e\u0442\u0440\u043e\u043a\u0430 \u0412\u0430\u0440\u0443\u043b\u0430 (303). \u0421\u0449\u043c\u0447. \u0417\u0430\u043a\u0445\u0435\u044f, \u0434\u0438\u044f\u043a. \u0413\u0430\u0434\u0430\u0440\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u043c\u0447. \u000d\u000a\u0410\u043b\u0444\u0435\u044f, \u0447\u0438\u0442\u0446\u044f \u041a\u0435\u0441\u0430\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (303).\u000d\u000a2 \u0421\u043e\u043b., 275 \u0437\u0430\u0447., II, 1 \u2013 12. \u041b\u043a., 69 \u0437\u0430\u0447., XII, 48 \u2013 59.\u000d\u000a\u041f\u0440\u043e\u0440. \u0410\u0432\u0434\u0456\u044f, \u0437 12-\u043e\u0445 (\u0406\u0425 \u0441\u0442. \u0434\u043e \u0420. \u0425.). \u041c\u0447. \u0412\u0430\u0440\u043b\u0430\u0430\u043c\u0430 (\u0431\u043b. 304). \u041f\u0440\u043f\u043f. \u000d\u000a\u0412\u0430\u0440\u043b\u0430\u0430\u043c\u0430, \u043f\u0443\u0441\u0442\u0435\u043b\u044c\u043d\u0438\u043a\u0430 \u0442\u0430 \u0406\u043e\u0430\u0441\u0430\u0444\u0430, \u0446\u0430\u0440\u0435\u0432\u0438\u0447\u0430 \u0406\u043d\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0456 \u0431\u0430\u0442\u044c\u043a\u0430 \u000d\u000a\u0439\u043e\u0433\u043e \u0410\u0432\u0435\u043d\u0456\u0440\u0430, \u0446\u0430\u0440\u044f (\u0406V). \u041f\u0440\u043f. \u0412\u0430\u0440\u043b\u0430\u0430\u043c\u0430, \u0456\u0433\u0443\u043c. \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (1065). \u041c\u0447\u0447. \u0410\u0437\u0438 \u0456 \u0437 \u043d\u0438\u043c 150 \u0432\u043e\u0457\u043d\u0456\u0432 (284 \u2013 \u000d\u000a305). \u041c\u0447. \u0406\u043b\u0456\u043e\u0434\u043e\u0440\u0430 \u041f\u0430\u043c\u0444\u0456\u043b\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 273). \u041f\u0440\u043f. \u0406\u043b\u0430\u0440\u0456\u043e\u043d\u0430, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (875, \u0413\u0440\u0443\u0437.). \u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u0412 \u0441\u043a\u043e\u0440\u0431\u043e\u0442\u0430\u0445 \u0456 \u043f\u0435\u0447\u0430\u043b\u044f\u0445 \u0443\u0442\u0456\u0445\u0430\u00bb (1863).\u000d\u000a2 \u0421\u043e\u043b., 276 \u0437\u0430\u0447., II, 13 \u2013 III, 5. \u041b\u043a., 70 \u0437\u0430\u0447., XIII, 1 \u2013 9.\u000d\u000a\u041f\u0435\u0440\u0435\u0434\u0441\u0432\u044f\u0442\u043e \u0412\u0432\u0435\u0434\u0435\u043d\u043d\u044f \u0432 \u0445\u0440\u0430\u043c \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456. \u041f\u0440\u043f. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f \u000d\u000a\u0414\u0435\u043a\u0430\u043f\u043e\u043b\u0456\u0442\u0430 (\u0431\u043b. 842). \u0421\u0432\u0442. \u041f\u0440\u043e\u043a\u043b\u0430, \u0430\u0440\u0445\u0456\u0454\u043f. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(446 \u2013 447). \u041c\u0447. \u0414\u0430\u0441\u0456\u044f \u0414\u043e\u0440\u043e\u0441\u0442\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (284 \u2013 305). \u041c\u0447\u0447. \u0404\u0432\u0441\u0442\u0430\u0444\u0456\u044f, \u000d\u000a\u0424\u0435\u0441\u043f\u0435\u0441\u0456\u044f \u0456 \u0410\u043d\u0430\u0442\u043e\u043b\u0456\u044f (312). \u0421\u0449\u043c\u0447\u0447. \u041d\u0438\u0440\u0441\u0438, \u0454\u043f., \u0442\u0430 \u0419\u043e\u0441\u0438\u0444\u0430, \u0443\u0447\u043d\u044f \u0439\u043e\u0433\u043e, \u000d\u000a\u0406\u043e\u0430\u043d\u0430, \u0421\u0430\u0432\u0435\u0440\u0456\u044f, \u0406\u0441\u0430\u043a\u0456\u044f \u0442\u0430 \u0406\u043f\u0430\u0442\u0456\u044f, \u0454\u043f\u043f. \u041f\u0435\u0440\u0441\u044c\u043a\u0438\u0445; \u043c\u0447\u0447. \u0410\u0437\u0430\u0442\u0430, \u0441\u043a\u043e\u043f\u0446\u044f, \u000d\u000a\u0421\u0430\u0441\u043e\u043d\u0456\u044f, \u0424\u0435\u043a\u043b\u0438, \u0410\u043d\u043d\u0438 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 \u0431\u0430\u0433\u0430\u0442\u044c\u043e\u0445 \u0447\u043e\u043b\u043e\u0432\u0456\u043a\u0456\u0432 \u0456 \u0436\u0456\u043d\u043e\u043a, \u044f\u043a\u0456 \u0432 \u041f\u0435\u0440\u0441\u0456\u0457 \u000d\u000a\u043f\u043e\u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043b\u0438 (343).\u000d\u000a2 \u0421\u043e\u043b., 277 \u0437\u0430\u0447., III, 6 \u2013 18. \u041b\u043a., 73 \u0437\u0430\u0447., XIII, 31 \u2013 35 (\u0437\u0430 \u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e).\u000d\u000a\u0413\u0430\u043b., 199 \u0437\u0430\u0447., I, 3 \u2013 10. \u041b\u043a., 46 \u0437\u0430\u0447., IX, 37 \u2013 43 (\u0437\u0430 \u0441\u0443\u0431\u043e\u0442\u0443).\u000d\u000a18\u000d\u000a19\u000d\u000a20\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0412\u0412\u0415\u0414\u0415\u041d\u041d\u042f \u0412 \u0425\u0420\u0410\u041c \u041f\u0420\u0415\u0421\u0412\u042f\u0422\u041e\u0407 \u0412\u041b\u0410\u0414\u0418\u0427\u0418\u0426\u0406 \u041d\u0410\u0428\u041e\u0407 \u0411\u041e\u0413\u041e\u0420\u041e\u0414\u0418\u0426\u0406 \u0406 \u041f\u0420\u0418\u0421\u041d\u041e\u0414\u0406\u0412\u0418 \u041c\u0410\u0420\u0406\u0407.\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 4 \u0437\u0430\u0447., I, 39 \u2013 49, 56.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0404\u0432\u0440., 320 \u0437\u0430\u0447., IX, 1 \u2013 7. \u041b\u043a., 54 \u0437\u0430\u0447., X, 38 \u2013 42; XI, 27 \u2013 28.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0422\u0435\u0431\u0435, \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u0430\u044f \u0414\u0456\u0432\u043e, \u0411\u043e\u0433\u043e\u043e\u0431\u0440\u0430\u043d\u0430 \u041e\u0442\u0440\u043e\u043a\u043e\u0432\u0438\u0446\u0435, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u0443 \u0445\u0440\u0430\u043c \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0456\u0439 \u0432\u0445\u043e\u0434\u0436\u0435\u043d\u043d\u044f \u0422\u0432\u043e\u0454\u00bb. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u000d\u000a\"\u0427\u0435\u0441\u043d\u0456\u0448\u0443...\" \u2013 \u043f\u0440\u0438\u0441\u043f\u0456\u0432\u0438 \u0441\u0432\u044f\u0442\u0430. 1-\u0439 \u043f\u0440\u0438\u0441\u043f\u0456\u0432: \"\u0410\u043d\u0433\u0435\u043b\u0438, \u0432\u0445\u043e\u0434\u0436\u0435\u043d\u043d\u044f \u041f\u0440\u0435\u0447\u0438\u0441\u0442\u043e\u0457 \u043f\u043e\u0431\u0430\u0447\u0438\u0432\u0448\u0438, \u0437\u0434\u0438\u0432\u0443\u0432\u0430\u043b\u0438\u0441\u044f, \u044f\u043a \u0414\u0456\u0432\u0430 \u0443\u0432\u0456\u0439\u0448\u043b\u0430 \u0443 \u0441\u0432\u044f\u0442\u0435\u0454 \u0441\u0432\u044f\u0442\u0438\u0445\". \u041d\u0430\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0430\u043d\u0442\u0438\u0444\u043e\u043d\u0438 \u0441\u0432\u044f\u0442\u043a\u043e\u0432\u0456 (\u0434\u0438\u0432. \u0443 \u0434\u043e\u0434\u0430\u0442\u043a\u0443 \u0441. 84), \u0437\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0414\u043e\u0441\u0442\u043e\u0439\u043d\u043e \u000d\u000a\u0454\u2026\u00bb \u2013 \u00ab\u0410\u043d\u0433\u0435\u043b\u0438, \u0432\u0445\u043e\u0434\u0436\u0435\u043d\u043d\u044f...\u00bb, \u00ab\u042f\u043a \u0434\u043e \u043e\u0434\u0443\u0445\u043e\u0442\u0432\u043e\u0440\u0435\u043d\u043e\u0433\u043e...\u00bb (\u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f). \u000d\u000a\u0417 \u0446\u044c\u043e\u0433\u043e \u0434\u043d\u044f \u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0420\u0456\u0437\u0434\u0432\u0430 \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u043e\u0433\u043e \u043d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439, \u043a\u043e\u043b\u0438 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u000d\u000a\u0432\u0435\u043b\u0438\u043a\u0435 \u0441\u043b\u0430\u0432\u043e\u0441\u043b\u0456\u0432'\u044f, \u043a\u0430\u0442\u0430\u0432\u0430\u0441\u0456\u044f \u00ab\u0425\u0440\u0438\u0441\u0442\u043e\u0441 \u043d\u0430\u0440\u043e\u0434\u0436\u0443\u0454\u0442\u044c\u0441\u044f \u2013 \u0441\u043b\u0430\u0432\u0442\u0435\u2026\u00bb.\u000d\u000a25-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 8-\u0439.\u000d\u000a\u041f\u0456\u0441\u043b\u044f\u0441\u0432\u044f\u0442\u043e \u0412\u0432\u0435\u0434\u0435\u043d\u043d\u044f. \u0410\u043f\u043f. \u0432\u0456\u0434 70-\u0445: \u0424\u0438\u043b\u0438\u043c\u043e\u043d\u0430 \u0439 \u0410\u0440\u0445\u0438\u043f\u0430 \u0456 \u043c\u0446. \u0440\u0456\u0432\u043d\u043e\u0430\u043f. \u0410\u043f\u0444\u0456\u0457 (\u0406). \u0411\u043b\u0433\u0432. \u042f\u0440\u043e\u043f\u043e\u043b\u043a\u0430, \u0443 \u0441\u0432. \u0445\u0440\u0435\u0449\u0435\u043d\u043d\u0456 \u041f\u0435\u0442\u0440\u0430, \u043a\u043d. \u0412\u043e\u043b\u043e\u0434\u0438\u043c\u0438\u0440\u0441\u044c\u043a\u043e\u0433\u043e (1086). \u041c\u0446. \u041a\u0438\u043a\u0438\u043b\u0456\u0457 (\u0426\u0435\u0446\u0438\u043b\u0456\u0457), \u043c\u0447\u0447. \u0412\u0430\u043b\u0435\u0440\u0456\u0430\u043d\u0430, \u0422\u0438\u0432\u0443\u0440\u0442\u0456\u044f \u0456 \u000d\u000a\u041c\u0430\u043a\u0441\u0438\u043c\u0430 (\u0431\u043b. 230). \u041c\u0447. \u041f\u0440\u043e\u043a\u043e\u043f\u0456\u044f \u041a\u0435\u0441\u0430\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0447\u0438\u0442\u0446\u044f (303). \u041c\u0447. \u041c\u0435\u043d\u0438\u0433\u043d\u0430 (250). \u041f\u0440\u043f. \u0410\u0433\u0430\u0432\u0438 \u0406\u0437\u0440\u0430\u0457\u043b\u044c\u0442\u044f\u043d\u0438\u043d\u0430 (V). \u041f\u0440\u0430\u0432. \u041c\u0438\u0445\u0430\u0457\u043b\u0430, \u0432\u043e\u0457\u043d\u0430, \u0431\u043e\u043b\u0433\u0430\u0440\u0438\u043d\u0430 (866).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 3-\u0454, \u041c\u043a., 71 \u0437\u0430\u0447., XVI, 9 \u2013 20.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0415\u0444., 224 \u0437\u0430\u0447., IV, 1 \u2013 6. \u041b\u043a., 53 \u0437\u0430\u0447., X, 25 \u2013 37.\u000d\u000a\u0410\u043f\u043f.: \u0424\u043b\u043c., 302 \u0437\u0430\u0447., I, 1\u201325. \u041b\u043a., 50 \u0437\u0430\u0447., X, 1 \u2013 15.\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a21\u000d\u000a22","76\u000d\u000a26-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0421\u0432\u0442. \u0410\u043c\u0444\u0456\u043b\u043e\u0445\u0456\u044f, \u0454\u043f. \u0406\u043a\u043e\u043d\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u043f\u0456\u0441\u043b\u044f 394). \u0421\u0432\u0442. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f, \u0454\u043f. \u0410\u043a\u0440\u0430\u0433\u0430\u043d\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406 \u2013 V\u0406\u0406). \u000d\u000a\u0421\u0449\u043c\u0447. \u0421\u0438\u0441\u0438\u043d\u0456\u044f, \u0454\u043f. \u041a\u0438\u0437\u0438\u0446\u044c\u043a\u043e\u0433\u043e (\u0406\u0406\u0406), \u0456 \u043c\u0447. \u0424\u0435\u0434\u043e\u0440\u0430 \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(\u0406V). \u041f\u0440\u043f. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430, \u0437\u0430\u0441\u043d\u043e\u0432\u043d\u0438\u043a\u0430 \u043e\u0431\u0438\u0442\u0435\u043b\u0456 \u00ab\u041d\u0435\u0432\u0441\u0438\u043f\u0443\u0449\u0438\u0445\u00bb (\u0431\u043b. 430).\u000d\u000a1 \u0422\u0438\u043c., 278 \u0437\u0430\u0447., I, 1 \u2013 7. \u041b\u043a., 75 \u0437\u0430\u0447., XIV, 12 \u2013 15.\u000d\u000a\u0421\u0432\u0442\u0442.: \u0404\u0432\u0440., 334 \u0437\u0430\u0447., XIII, 7 \u2013 16. \u041c\u0444., 103 \u0437\u0430\u0447., \u0425\u0425\u0406V, 42 \u2013 47.\u000d\u000a\u0412\u043c\u0447. \u041c\u0435\u0440\u043a\u0443\u0440\u0456\u044f (\u0406\u0406\u0406). \u0412\u043c\u0446. \u041a\u0430\u0442\u0435\u0440\u0438\u043d\u0438 (305 \u2013 313). \u041f\u0440\u043f. \u041c\u0435\u0440\u043a\u0443\u0440\u0456\u044f, \u043f\u043e\u0441\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406V).\u000d\u000a\u041c\u0446. \u0410\u0432\u0433\u0443\u0441\u0442\u0438 \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0457, \u043c\u0447\u0447. \u041f\u043e\u0440\u0444\u0438\u0440\u0456\u044f \u0421\u0442\u0440\u0430\u0442\u0438\u043b\u0430\u0442\u0430 \u0456 200 \u0432\u043e\u0457\u043d\u0456\u0432 (305 \u000d\u000a\u2013 313). \u041f\u0440\u043f. \u041c\u0430\u0441\u0442\u0440\u0438\u0434\u0456\u0457 \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0457. \u041f\u0440\u043f. \u041c\u0435\u0440\u043a\u0443\u0440\u0456\u044f \u0427\u0435\u0440\u043d\u0456\u0433\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e, \u0456\u0433\u0443\u043c. \u0411\u0440\u0438\u0433\u0438\u043d\u0441\u044c\u043a\u043e\u0433\u043e (1956).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u0444., 104 \u0437\u0430\u0447., \u0425\u0425V, 1 \u2013 13. \u000d\u000a\u041b\u0456\u0442. \u2013 1 \u0422\u0438\u043c., 279 \u0437\u0430\u0447., I, 8 \u2013 14. \u041b\u043a., 77 \u0437\u0430\u0447., XIV, 25 \u2013 35.\u000d\u000a\u0412\u043c\u0446.: 2 \u041a\u043e\u0440., 181 \u0437\u0430\u0447., VI, 1 \u2013 10. \u041b\u043a., 106 \u0437\u0430\u0447., \u0425\u0425I, 12 \u2013 19.\u000d\u000a\u042f\u043a\u0449\u043e \u0437\u0432\u0435\u0440\u0448\u0443\u0454\u0442\u044c\u0441\u044f \u043f\u043e\u043b\u0456\u0454\u043b\u0435\u0439\u043d\u0430 \u0441\u043b\u0443\u0436\u0431\u0430 \u043f\u0440\u0435\u043f\u043e\u0434\u043e\u0431\u043d\u043e\u043c\u0443 \u041c\u0435\u0440\u043a\u0443\u0440\u0456\u044e, \u0442\u043e \u000d\u000a\u043d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0447\u0438\u0442\u0430\u043d\u043d\u044f: \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30, \u043d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457: \u0413\u0430\u043b., 213 \u000d\u000a\u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u0412\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0430 \u0412\u0432\u0435\u0434\u0435\u043d\u043d\u044f \u0432 \u0445\u0440\u0430\u043c \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456. \u000d\u000a\u0421\u0449\u043c\u0447\u0447. \u041a\u043b\u0438\u043c\u0435\u043d\u0442\u0430, \u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0430 \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (101), \u0456 \u041f\u0435\u0442\u0440\u0430, \u0430\u0440\u0445\u0456\u0454\u043f. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (311). \u041f\u0440\u043f. \u041f\u0435\u0442\u0440\u0430 \u0413\u0430\u043b\u0430\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u043c\u043e\u0432\u0447\u0430\u043b\u044c\u043d\u0438\u043a\u0430 (\u0431\u043b. 429). \u000d\u000a1 \u0422\u0438\u043c., 281 \u0437\u0430\u0447., I, 18 \u2013 20; II, 8 \u2013 15. \u041b\u043a., 78 \u0437\u0430\u0447., XV, 1 \u2013 10.\u000d\u000a\u0421\u0449\u043c\u0447\u0447.: \u0424\u043b\u043f., 246 \u0437\u0430\u0447., \u0406\u0406\u0406, 20 \u2013 IV, 3. \u041c\u0444., 11 \u0437\u0430\u0447., V, 14 \u2013 19.\u000d\u000a\u0421\u043b\u0443\u0436\u0431\u0430 \u0437 \u0432\u0435\u043b\u0438\u043a\u0438\u043c \u0441\u043b\u0430\u0432\u043e\u0441\u043b\u0456\u0432\u2019\u044f\u043c. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0427\u0435\u0441\u043d\u0456\u0448\u0443...\u00bb \u0441\u043f\u0456\u0432\u0430\u044e\u0442\u044c\u0441\u044f \u000d\u000a\u043f\u0440\u0438\u0441\u043f\u0456\u0432\u0438 \u0441\u0432\u044f\u0442\u0430.\u000d\u000a\u041f\u0440\u043f. \u0410\u043b\u0456\u043f\u0456\u044f \u0421\u0442\u043e\u0432\u043f\u043d\u0438\u043a\u0430 (640). \u041f\u0440\u043f. \u0421\u0442\u0438\u043b\u0456\u0430\u043d\u0430 \u041f\u0430\u0444\u043b\u0430\u0433\u043e\u043d\u0441\u044c\u043a\u043e\u0433\u043e (V-VI \u000d\u000a\u0441\u0442.) \u0421\u0432\u0442. \u0406\u043d\u043e\u043a\u0435\u043d\u0442\u0456\u044f (\u041a\u0443\u043b\u044c\u0447\u0438\u0446\u044c\u043a\u043e\u0433\u043e), \u0454\u043f. \u0406\u0440\u043a\u0443\u0442\u0441\u044c\u043a\u043e\u0433\u043e (1731). \u000d\u000a\u041f\u0440\u043f. \u042f\u043a\u043e\u0432\u0430 \u0421\u0438\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u043f\u0443\u0441\u0442\u0435\u043b\u044c\u043d\u0438\u043a\u0430 (457). \u041e\u0441\u0432\u044f\u0447\u0435\u043d\u043d\u044f \u0445\u0440\u0430\u043c\u0443 \u000d\u000a\u0441\u0432. \u0432\u043c\u0447. \u042e\u0440\u0456\u044f \u041f\u0435\u0440\u0435\u043c\u043e\u0436\u0446\u044f, \u0449\u043e \u0432 \u041a\u0438\u0454\u0432\u0456 \u0431\u0456\u043b\u044f \u0417\u043e\u043b\u043e\u0442\u0438\u0445 \u0432\u043e\u0440\u0456\u0442 (\u0425\u0406).\u000d\u000a1 \u0422\u0438\u043c., 283 \u0437\u0430\u0447., III, 1 \u2013 13. \u041b\u043a., 80 \u0437\u0430\u0447., XVI, 1 \u2013 9.\u000d\u000a\u0412\u043c\u0447.: \u0414\u0456\u044f\u043d., 29 \u0437\u0430\u0447., XII, 1 \u2013 11. \u0406\u043d., 52 \u0437\u0430\u0447., XV, 17 \u2013 XVI, 2.\u000d\u000a\u0412\u043c\u0447. \u042f\u043a\u043e\u0432\u0430 \u041f\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e (421). \u041f\u0440\u043f. \u041f\u0430\u043b\u043b\u0430\u0434\u0456\u044f \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406 \u000d\u000a\u2013 V\u0406\u0406). \u041f\u0440\u043c\u0447\u0447. 17 \u043c\u043e\u043d\u0430\u0445\u0456\u0432 \u0432 \u0406\u043d\u0434\u0456\u0457 (\u0406V). \u041f\u0440\u043f. \u0420\u043e\u043c\u0430\u043d\u0430 \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (V). \u000d\u000a\u0417\u043d\u0430\u0439\u0434\u0435\u043d\u043d\u044f \u043c\u043e\u0449\u0456\u0432 \u0431\u043b\u0433\u0432. \u0412\u0441\u0435\u0432\u043e\u043b\u043e\u0434\u0430, \u0443 \u0441\u0432. \u0445\u0440\u0435\u0449\u0435\u043d\u043d\u0456 \u0413\u0430\u0432\u0440\u0438\u0457\u043b\u0430, \u043a\u043d. \u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\u0441\u044c\u043a\u043e\u0433\u043e, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (1192).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u0417\u043d\u0430\u043c\u0435\u043d\u043d\u044f\u00bb.\u000d\u000a1 \u0422\u0438\u043c., 285 \u0437\u0430\u0447., IV, 4 \u2013 8, 16. \u041b\u043a., 82 \u0437\u0430\u0447., XVI, 15 \u2013 18; XVII, 1 \u2013 4.\u000d\u000a\u0412\u043c\u0447.: \u0415\u0444., 233 \u0437\u0430\u0447., VI, 10 \u2013 17. \u0406\u043d., 50 \u0437\u0430\u0447., XV, 1 \u2013 7.\u000d\u000a23\u000d\u000a24\u000d\u000a25\u000d\u000a26\u000d\u000a27\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f","77\u000d\u000a\u041f\u043e\u043c\u0438\u043d\u0430\u043b\u044c\u043d\u0430 \u0441\u0443\u0431\u043e\u0442\u0430 \u0432\u0441\u0456\u0445, \u0432 \u0423\u043a\u0440\u0430\u0457\u043d\u0456 \u0433\u043e\u043b\u043e\u0434\u043e\u043c \u0437\u0430\u043c\u043e\u0440\u0435\u043d\u0438\u0445. \u041f\u0440\u043c\u0447. \u0456 \u000d\u000a\u0441\u043f\u043e\u0432. \u0421\u0442\u0435\u0444\u0430\u043d\u0430 \u041d\u043e\u0432\u043e\u0433\u043e (767). \u041c\u0447. \u0406\u0440\u0438\u043d\u0430\u0440\u0445\u0430 \u0421\u0435\u0432\u0430\u0441\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0441\u0432\u044f\u0442\u0438\u0445 \u0441\u0456\u043c\u043e\u0445 \u0436\u0456\u043d\u043e\u043a (303). \u041c\u0447\u0447. \u0421\u0442\u0435\u0444\u0430\u043d\u0430, \u0412\u0430\u0441\u0438\u043b\u0456\u044f, \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f, \u0456\u043d\u0448\u043e\u0433\u043e \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f, \u000d\u000a\u0406\u043e\u0430\u043d\u0430 \u0442\u0430 \u0431\u0430\u0433\u0430\u0442\u044c\u043e\u0445 \u0456\u043d. (V\u0406\u0406\u0406).\u000d\u000a\u0417\u0430 \u0441\u043f\u043e\u043a\u0456\u0439: 1 \u0421\u043e\u043b., 270 \u0437\u0430\u0447., IV, 13 \u2013 17. \u0406\u043d., 16 \u0437\u0430\u0447., V, 24 \u2013 30.\u000d\u000a\u0420\u044f\u0434.: \u0413\u0430\u043b., 205 \u0437\u0430\u0447., III, 8 \u2013 12. \u041b\u043a., 49 \u0437\u0430\u0447., IX, 57 \u2013 62.\u000d\u000a\u041f\u043e\u043c\u0438\u043d\u0430\u043d\u043d\u044f \u043f\u043e\u043c\u0435\u0440\u043b\u0438\u0445.\u000d\u000a\u041f\u0440\u043e\u0440. \u0410\u0432\u0430\u043a\u0443\u043c\u0430 (V\u0406\u0406 \u0441\u0442. \u0434\u043e \u0420. \u0425.). \u041f\u0440\u043f\u043f. \u0410\u0444\u0430\u043d\u0430\u0441\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0431\u043b. 1176), \u0442\u0430 \u0456\u043d\u0448\u043e\u0433\u043e \u000d\u000a\u0410\u0444\u0430\u043d\u0430\u0441\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406). \u041c\u0446. \u041c\u0438\u0440\u043e\u043f\u0456\u0457 \u0425\u0456\u043e\u0441\u044c\u043a\u043e\u0457 (\u0431\u043b. 251). \u041f\u0440\u043f\u043f. \u0406\u043e\u0430\u043d\u0430, \u0406\u0440\u0430\u043a\u043b\u0435\u043c\u043e\u043d\u0430, \u000d\u000a\u0410\u043d\u0434\u0440\u0456\u044f \u0442\u0430 \u0424\u0435\u043e\u0444\u0456\u043b\u0430 (\u0406V). \u0421\u0432\u0442. \u0406\u0441\u0435 (\u0406\u0454\u0441\u0435\u044f), \u0454\u043f. \u0426\u0438\u043b\u043a\u0430\u043d\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406, \u0413\u0440\u0443\u0437.). \u000d\u000a\u0421\u0432. \u0421\u0442\u0435\u0444\u0430\u043d\u0430 \u0423\u0440\u043e\u0448\u0430, \u0446\u0430\u0440\u044f \u0421\u0435\u0440\u0431\u0441\u044c\u043a\u043e\u0433\u043e (1367). \u0421\u0449\u043c\u0447. \u041f\u043e\u0440\u0444\u0438\u0440\u0456\u044f, \u000d\u000a\u0454\u043f. \u0421\u0456\u043c\u0444\u0435\u0440\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (1937). \u041f\u0440\u043f. \u041e\u043b\u0435\u043a\u0441\u0456\u044f \u041a\u0430\u0440\u043f\u0430\u0442\u043e\u0440\u0443\u0441\u044c\u043a\u043e\u0433\u043e (1947). \u041f\u0440\u043f. \u041f\u043e\u0440\u0444\u0438\u0440\u0456\u044f \u041a\u0430\u0432\u0441\u043e\u043a\u0430\u043b\u0456\u0432\u0456\u0442\u0430 (1991).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u0413\u0435\u0440\u043e\u043d\u0434\u0438\u0441\u0430\u00bb.\u000d\u000a1 \u0422\u0438\u043c., 287 \u0437\u0430\u0447., V, 22 \u2013 VI, 11. \u041b\u043a., 90 \u0437\u0430\u0447., XVIII, 15 \u2013 17, 26 \u2013 30.\u000d\u000a26-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 1-\u0439.\u000d\u000a\u041c\u0447. \u041f\u0430\u0440\u0430\u043c\u043e\u043d\u0430 \u0456 \u0437 \u043d\u0438\u043c 370 \u043c\u0447\u0447. (250). \u041c\u0447. \u0424\u0456\u043b\u0443\u043c\u0435\u043d\u0430 \u0410\u043d\u043a\u0438\u0440\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(\u0431\u043b. 274). \u041f\u0440\u043f. \u0410\u043a\u0430\u043a\u0456\u044f \u0421\u0438\u043d\u0430\u0439\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406). \u041f\u0440\u043f. \u041d\u0435\u043a\u0442\u0430\u0440\u0456\u044f \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406). \u0421\u0449\u043c\u0447. \u0410\u0432\u0456\u0432\u0430, \u0454\u043f. \u041d\u0435\u043a\u0440\u0435\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406, \u0413\u0440\u0443\u0437.).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 4-\u0435, \u041b\u043a., 112 \u0437\u0430\u0447., XXIV, 1 \u2013 12.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0415\u0444., 229 \u0437\u0430\u0447., V, 8\u201319. \u041b\u043a., 66 \u0437\u0430\u0447., XII, 16 \u2013 21.\u000d\u000a27-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0410\u043f\u043e\u0441\u0442\u043e\u043b\u0430 \u0410\u043d\u0434\u0440\u0456\u044f \u041f\u0435\u0440\u0448\u043e\u0437\u0432\u0430\u043d\u043e\u0433\u043e (62). \u0421\u0432\u0442. \u0424\u0440\u0443\u043c\u0435\u043d\u0442\u0456\u044f, \u0430\u0440\u0445\u0456\u0454\u043f. \u0406\u043d\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0415\u0444\u0456\u043e\u043f\u0441\u044c\u043a\u043e\u0433\u043e, \u0431\u043b. 380).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u0444., 9 \u0437\u0430\u0447., IV, 18 \u2013 23.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0410\u043f.: 1 \u041a\u043e\u0440., 131 \u0437\u0430\u0447., IV, 9 \u2013 16. \u0406\u043d., 4 \u0437\u0430\u0447., I, 35 \u2013 51.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f \u0430\u043f\u043e\u0441\u0442\u043e\u043b\u0443: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0442\u0435\u0431\u0435, \u0430\u043f\u043e\u0441\u0442\u043e\u043b\u0435 \u0425\u0440\u0438\u0441\u0442\u0456\u0432 \u000d\u000a\u0410\u043d\u0434\u0440\u0456\u044e \u041f\u0435\u0440\u0448\u043e\u0437\u0432\u0430\u043d\u0438\u0439, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043d\u043d\u044f \u0456 \u0442\u0440\u0443\u0434\u0438 \u0442\u0432\u043e\u0457, \u043d\u0438\u043c\u0438 \u0436 \u043f\u043e\u0442\u0440\u0443\u0434\u0438\u0432\u0441\u044f \u0442\u0438 \u0443 \u0431\u043b\u0430\u0433\u043e\u0432\u0456\u0441\u0442\u0456 \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u043e\u043c\u0443\u00bb.\u000d\u000a28\u000d\u000a2\u000d\u000a29\u000d\u000a30\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u041f\u0440\u043e\u0440. \u041d\u0430\u0443\u043c\u0430 (V\u0406\u0406 \u0441\u0442. \u0434\u043e \u0420. \u0425.). \u041f\u0440\u0430\u0432. \u0424\u0456\u043b\u0430\u0440\u0435\u0442\u0430 \u041c\u0438\u043b\u043e\u0441\u0442\u0438\u0432\u043e\u0433\u043e (792). \u000d\u000a\u041c\u0447. \u0410\u043d\u0430\u043d\u0456\u0457 \u041f\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e.\u000d\u000a1 \u0422\u0438\u043c., 285 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), V, 1 \u2013 10. \u041b\u043a., 86 \u0437\u0430\u0447., XVII, 20 \u2013 25 (\u0437\u0430 \u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a).\u000d\u000a1 \u0422\u0438\u043c., 286 \u0437\u0430\u0447., V, 11 \u2013 21. \u041b\u043a., 87 \u0437\u0430\u0447., XVII, 26 \u2013 37 (\u0437\u0430 \u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a).\u000d\u000a1\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a","78\u000d\u000a\u041f\u0440\u043e\u0440. \u0421\u043e\u0444\u043e\u043d\u0456\u0457 (635 \u2013 605 \u0434\u043e \u0420. \u0425.). \u041f\u0440\u043f. \u0424\u0435\u043e\u0434\u0443\u043b\u0430 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 440). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430 \u041c\u043e\u0432\u0447\u0430\u043b\u044c\u043d\u0438\u043a\u0430, \u043a\u043e\u043b\u0438\u0448\u043d\u044c\u043e\u0433\u043e \u0454\u043f. \u041a\u043e\u043b\u043e\u043d\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (558). \u0421\u0449\u043c\u0447. \u0424\u0435\u0434\u043e\u0440\u0430, \u0430\u0440\u0445\u0456\u0454\u043f. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (606).\u000d\u000a1 \u0422\u0438\u043c., 289 \u0437\u0430\u0447., VI, 17 \u2013 21. \u041b\u043a., 92 \u0437\u0430\u0447., XVIII, 31 \u2013 34.\u000d\u000a28-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0421\u0432\u0442. \u0410\u043c\u0432\u0440\u043e\u0441\u0456\u044f, \u0454\u043f. \u041c\u0435\u0434\u0456\u043e\u043b\u0430\u043d\u0441\u044c\u043a\u043e\u0433\u043e (397). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430, \u043f\u043e\u0441\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406). \u041c\u0447. \u0410\u0444\u0456\u043d\u043e\u0434\u043e\u0440\u0430 \u041c\u0435\u0441\u043e\u043f\u043e\u0442\u0430\u043c\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(\u0431\u043b. 304). \u041f\u0440\u043f. \u041f\u0430\u0432\u043b\u0430 \u041f\u043e\u0441\u043b\u0443\u0448\u043d\u043e\u0433\u043e. \u041c\u0446. \u0424\u0456\u043b\u043e\u0444\u0435\u0457 (1060, \u0420\u0443\u043c\u0443\u043d.).\u000d\u000a2 \u0422\u0438\u043c., 294 \u0437\u0430\u0447., II, 20 \u2013 26. \u041b\u043a., 97 \u0437\u0430\u0447., XIX, 37 \u2013 44.\u000d\u000a\u041f\u0440\u043f. \u041f\u0430\u0442\u0430\u043f\u0456\u044f \u0424\u0456\u0432\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406\u0406). \u0410\u043f\u043f. \u0432\u0456\u0434 70-\u0445: \u0421\u043e\u0441\u0444\u0435\u043d\u0430, \u0410\u043f\u043e\u043b\u043e\u0441\u0430, \u000d\u000a\u041a\u0438\u0444\u0438, \u0422\u0438\u0445\u0438\u043a\u0430, \u0415\u043f\u0430\u0444\u0440\u043e\u0434\u0438\u0442\u0430, \u041a\u0435\u0441\u0430\u0440\u0456\u044f \u0442\u0430 \u041e\u043d\u0438\u0441\u0438\u0444\u043e\u0440\u0430 (\u0406). \u0421\u0449\u043c\u0447\u0447. 62 \u000d\u000a\u0456\u0454\u0440\u0435\u0457\u0432 \u0442\u0430 \u043c\u0447\u0447. 300 \u043c\u0438\u0440\u044f\u043d, \u044f\u043a\u0456 \u0432 \u0410\u0444\u0440\u0438\u0446\u0456 \u0432\u0456\u0434 \u0430\u0440\u0456\u0430\u043d \u043f\u043e\u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043b\u0438 (477). \u000d\u000a\u041c\u0446. \u0410\u043d\u0444\u0456\u0441\u0438 \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0457 (V).\u000d\u000a2 \u0422\u0438\u043c., 297 \u0437\u0430\u0447., III, 16 \u2013 IV, 4. \u041b\u043a., 98 \u0437\u0430\u0447., XIX, 45 \u2013 48.\u000d\u000a3\u000d\u000a7\u000d\u000a8\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0412\u043c\u0446. \u0412\u0430\u0440\u0432\u0430\u0440\u0438 \u0456 \u043c\u0446. \u042e\u043b\u0456\u0430\u043d\u0456\u0457 (\u0431\u043b. 306). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430 \u0414\u0430\u043c\u0430\u0441\u043a\u0438\u043d\u0430 \u000d\u000a(\u0431\u043b. 780). \u041f\u0440\u043f. \u0406\u043e\u0430\u043d\u0430, \u0454\u043f. \u041f\u043e\u043b\u0456\u0432\u043e\u0442\u0441\u044c\u043a\u043e\u0433\u043e, \u0441\u043f\u043e\u0432. (V\u0406\u0406\u0406).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u0444., 104 \u0437\u0430\u0447., XXV, 1\u201313.\u000d\u000a\u041b\u0456\u0442. \u2013 2 \u0422\u0438\u043c., 290 \u0437\u0430\u0447., I, 1 \u2013 2, 8 \u2013 18. \u041b\u043a., 95 \u0437\u0430\u0447., XIX, 12 \u2013 28.\u000d\u000a\u0412\u043c\u0446.: \u0413\u0430\u043b., 208 \u0437\u0430\u0447., III, 23 \u2013 29. \u041c\u043a., 21 \u0437\u0430\u0447., V, 24 \u2013 34.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0442\u0435\u0431\u0435, \u0441\u0432\u044f\u0442\u0430 \u0432\u0435\u043b\u0438\u043a\u043e\u043c\u0443\u0447\u0435\u043d\u0438\u0446\u0435 \u000d\u000a\u0412\u0430\u0440\u0432\u0430\u0440\u043e, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u0447\u0435\u0441\u043d\u0456 \u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043d\u043d\u044f \u0442\u0432\u043e\u0457, \u044f\u043a\u0456 \u0437\u0430 \u0425\u0440\u0438\u0441\u0442\u0430 \u043f\u0435\u0440\u0435\u0442\u0435\u0440\u043f\u0456\u043b\u0430 \u0442\u0438\u00bb.\u000d\u000a\u041f\u0440\u043f. \u0421\u0430\u0432\u0438 \u041e\u0441\u0432\u044f\u0447\u0435\u043d\u043e\u0433\u043e (532). \u041c\u0447. \u0410\u043d\u0430\u0441\u0442\u0430\u0441\u0456\u044f \u0410\u043a\u0432\u0456\u043b\u0435\u0439\u0441\u044c\u043a\u043e\u0433\u043e. \u000d\u000a\u041f\u0440\u043f\u043f. \u041a\u0438\u0440\u0456\u043e\u043d\u0430, \u0447\u0435\u043d\u0446\u044f, \u0442\u0430 \u0441\u0438\u043d\u0430 \u0439\u043e\u0433\u043e \u0417\u0430\u0445\u0430\u0440\u0456\u0457, \u0454\u0433\u0438\u043f\u0442\u044f\u043d (\u0406V).\u000d\u000a\u0420\u0430\u043d. \u2013 \u041b\u043a., 24 \u0437\u0430\u0447., VI, 17 \u2013 23.\u000d\u000a\u041b\u0456\u0442. \u2013 \u041f\u0440\u043f.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30.\u000d\u000a\u0420\u044f\u0434.: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2 (\u0430\u043f\u043e\u0441\u0442\u043e\u043b\u044c\u0441\u044c\u043a\u0456 \u0447\u0438\u0442\u0430\u043d\u043d\u044f \u0441\u043f\u0456\u0432\u043f\u0430\u0434\u0430\u044e\u0442\u044c, \u000d\u000a\u043e\u0442\u0436\u0435 \u043d\u0435 \u043f\u043e\u0432\u0442\u043e\u0440\u044e\u0454\u043c\u043e \u0434\u0432\u0456\u0447\u0456). \u041b\u043a., 51 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), X, 19 \u2013 21. \u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f: \u00ab\u0423\u0431\u043b\u0430\u0436\u0430\u0454\u043c\u043e \u0442\u0435\u0431\u0435, \u043f\u0440\u0435\u043f\u043e\u0434\u043e\u0431\u043d\u0438\u0439 \u043e\u0442\u0447\u0435 \u0421\u0430\u0432\u043e, \u0456 \u000d\u000a\u0448\u0430\u043d\u0443\u0454\u043c\u043e \u0441\u0432\u044f\u0442\u0443 \u043f\u0430\u043c\u2019\u044f\u0442\u044c \u0442\u0432\u043e\u044e, \u043d\u0430\u0441\u0442\u0430\u0432\u043d\u0438\u043a\u0443 \u043c\u043e\u043d\u0430\u0445\u0456\u0432 \u0456 \u0441\u043f\u0456\u0432\u0440\u043e\u0437\u043c\u043e\u0432\u043d\u0438\u043a\u0443 \u000d\u000a\u0430\u043d\u0433\u0435\u043b\u0456\u0432\u00bb.\u000d\u000a4\u000d\u000a5\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a27-\u043c\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u0413\u043b\u0430\u0441 2-\u0439.\u000d\u000a\u0421\u0432\u044f\u0442\u0438\u0442\u0435\u043b\u044f \u041c\u0438\u043a\u043e\u043b\u0430\u044f, \u0430\u0440\u0445\u0456\u0454\u043f\u0438\u0441\u043a\u043e\u043f\u0430 \u041c\u0438\u0440 \u041b\u0456\u043a\u0456\u0439\u0441\u044c\u043a\u0438\u0445, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (\u0431\u043b. 345).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 5-\u0435, \u041b\u043a., 113 \u0437\u0430\u0447., XXIV, 12 \u2013 35.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0415\u0444., 233 \u0437\u0430\u0447., VI, 10 \u2013 17. \u041b\u043a., 71 \u0437\u0430\u0447., XIII, 10 \u2013 17.\u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 335 \u0437\u0430\u0447., \u0425\u0406II, 17 \u2013 21. \u041c\u0444., 11 \u0437\u0430\u0447., V, 14 \u2013 19.\u000d\u000a\u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0438\u0442\u0435\u043b\u044e: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0442\u0435\u0431\u0435, \u0441\u0432\u044f\u0442\u0438\u0442\u0435\u043b\u044e \u043e\u0442\u0447\u0435 \u000d\u000a\u041c\u0438\u043a\u043e\u043b\u0430\u044e, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u0441\u0432\u044f\u0442\u0443 \u043f\u0430\u043c\u2019\u044f\u0442\u044c \u0442\u0432\u043e\u044e, \u0431\u043e \u0442\u0438 \u043c\u043e\u043b\u0438\u0448 \u0437\u0430 \u043d\u0430\u0441 \u0425\u0440\u0438\u0441\u0442\u0430 \u000d\u000a\u0411\u043e\u0433\u0430 \u043d\u0430\u0448\u043e\u0433\u043e\u00bb.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a6","79\u000d\u000a\u0417\u0430\u0447\u0430\u0442\u0442\u044f \u043f\u0440\u0430\u0432. \u0410\u043d\u043d\u043e\u044e \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456. \u041f\u0440\u043e\u0440\u043e\u0447\u0438\u0446\u0456 \u0410\u043d\u043d\u0438, \u000d\u000a\u043c\u0430\u0442\u0435\u0440\u0456 \u043f\u0440\u043e\u0440. \u0421\u0430\u043c\u0443\u0457\u043b\u0430 (1100 \u0434\u043e \u0420. \u0425.). \u0421\u0432\u0442. \u0421\u043e\u0444\u0440\u043e\u043d\u0456\u044f, \u0430\u0440\u0445\u0456\u0454\u043f. \u041a\u0456\u043f\u0440\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406). \u041f\u0440\u043f. \u0421\u0442\u0435\u0444\u0430\u043d\u0430 \u041d\u043e\u0432\u043e\u0441\u044f\u044e\u0447\u043e\u0433\u043e (912).\u000d\u000a\u0406\u043a\u043e\u043d\u0438 \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456 \u00ab\u041d\u0435\u0441\u043f\u043e\u0434\u0456\u0432\u0430\u043d\u0430 \u0440\u0430\u0434\u0456\u0441\u0442\u044c\u00bb.\u000d\u000a2 \u0422\u0438\u043c., 299 \u0437\u0430\u0447., IV, 9 \u2013 22. \u041b\u043a., 99 \u0437\u0430\u0447., XX, 1 \u2013 8.\u000d\u000a\u041f\u0440\u0430\u0432. \u0410\u043d\u043d\u0438: \u0413\u0430\u043b., 210 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), IV, 22 \u2013 31. \u041b\u043a., 36 \u0437\u0430\u0447., VIII, \u000d\u000a16 \u2013 21.\u000d\u000a\u041c\u0447\u0447. \u041c\u0438\u043d\u0438, \u0404\u0440\u043c\u043e\u0433\u0435\u043d\u0430 \u0442\u0430 \u0404\u0432\u0433\u0440\u0430\u0444\u0430 \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0456\u0439\u0441\u044c\u043a\u0438\u0445 (\u0431\u043b. 313). \u000d\u000a\u0421\u0432\u0442. \u0406\u043e\u0430\u0441\u0430\u0444\u0430 (\u0413\u043e\u0440\u043b\u0435\u043d\u043a\u0430), \u0454\u043f. \u0411\u0456\u043b\u0433\u043e\u0440\u043e\u0434\u0441\u044c\u043a\u043e\u0433\u043e (1754). \u041c\u0447. \u0413\u0435\u043c\u0435\u043b\u0430 \u041f\u0430\u0444\u043b\u0430\u0433\u043e\u043d\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 361). \u041f\u0440\u043f. \u0424\u043e\u043c\u0438, \u0456\u0433\u0443\u043c. (\u0425). \u0421\u0432. \u0431\u043b\u0433\u0432\u0432. \u0406\u043e\u0430\u043d\u0430 (1503) \u0442\u0430 \u0431\u0430\u0442\u044c\u043a\u0456\u0432 \u0439\u043e\u0433\u043e, \u0421\u0442\u0435\u0444\u0430\u043d\u0430 (1446) \u0456 \u043f\u0440\u043f. \u0410\u043d\u0433\u0435\u043b\u0456\u043d\u0438, \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u0456\u0432 \u000d\u000a\u0421\u0435\u0440\u0431\u0441\u044c\u043a\u0438\u0445.\u000d\u000a\u0422\u0438\u0442., 300 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), I, 5 \u2013 II, 1. \u041b\u043a., 100 \u0437\u0430\u0447., XX, 9 \u2013 18.\u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 318 \u0437\u0430\u0447., V\u0406\u0406, 26 \u2013 V\u0406\u0406\u0406, 2. \u0406\u043d., 36 \u0437\u0430\u0447., \u0425, 9 \u2013 16.\u000d\u000a\u041f\u0440\u043f. \u0414\u0430\u043d\u0438\u0457\u043b\u0430 \u0421\u0442\u043e\u0432\u043f\u043d\u0438\u043a\u0430 (489 \u2013 490). \u041f\u0440\u043f. \u041d\u0438\u043a\u043e\u043d\u0430 \u0421\u0443\u0445\u043e\u0433\u043e, \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406). \u041c\u0447. \u041c\u0438\u0440\u0430\u043a\u0441\u0430 \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406\u0406). \u041c\u0447\u0447. \u0410\u043a\u0435\u043f\u0441\u0456\u044f \u0442\u0430 \u0410\u0457\u0444\u0430\u043b\u0430. \u041f\u0440\u043f. \u041b\u0443\u043a\u0438 \u0421\u0442\u043e\u0432\u043f\u043d\u0438\u043a\u0430, \u0456\u0454\u0440\u043e\u043c. \u000d\u000a(\u0431\u043b. 970 \u2013 980). \u000d\u000a\u0422\u0438\u0442., 301 \u0437\u0430\u0447., I, 15 \u2013 II, 10. \u041b\u043a., 101 \u0437\u0430\u0447., XX, 19 \u2013 26.\u000d\u000a29-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u041c\u0447\u0447. \u0424\u0456\u0440\u0441\u0430, \u041b\u0435\u0432\u043a\u0456\u044f \u0456 \u041a\u0430\u043b\u0438\u043d\u0438\u043a\u0430 \u000d\u000a(249 \u2013 251). \u041c\u0447\u0447. \u0424\u0438\u043b\u0438\u043c\u043e\u043d\u0430, \u0410\u043f\u043e\u043b\u043e\u043d\u0456\u044f, \u0410\u0440\u0456\u0430\u043d\u0430 \u0456 \u0424\u0435\u043e\u0442\u0438\u0445\u0430 (286 \u2013 287).\u000d\u000a\u0404\u0432\u0440., 308 \u0437\u0430\u0447., III, 5 \u2013 11, 17 \u2013 19. \u041b\u043a., 102 \u0437\u0430\u0447., XX, 27 \u2013 44.\u000d\u000a\u0421\u0432\u0442. \u0421\u043f\u0438\u0440\u0438\u0434\u043e\u043d\u0430, \u0454\u043f. \u0422\u0440\u0438\u043c\u0438\u0444\u0443\u043d\u0442\u0441\u044c\u043a\u043e\u0433\u043e, \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f (\u0431\u043b.348). \u000d\u000a\u0421\u0449\u043c\u0447. \u041e\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430, \u0454\u043f. \u0404\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (251). \u041c\u0447. \u0420\u043e\u0437\u0443\u043c\u043d\u0438\u043a\u0430 (\u0421\u0438\u043d\u0435\u0437\u0456\u044f) (270 \u2013 275).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 35 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b.), X, 1 \u2013 9. \u000d\u000a\u041b\u0456\u0442. \u2013 \u0421\u0432\u0442.: \u0404\u0432\u0440., 335 \u0437\u0430\u0447., XIII, 17 \u2013 21. \u041c\u0444., 11 \u0437\u0430\u0447., V, 14 \u2013 19.\u000d\u000a\u0420\u044f\u0434.: \u0415\u0444., 218 \u0437\u0430\u0447., I, 16 \u2013 23. \u041b\u043a., 67 \u0437\u0430\u0447., XII, 32 \u2013 40.\u000d\u000a9\u000d\u000a10\u000d\u000a11\u000d\u000a14\u000d\u000a12\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a28-\u043c\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456, \u0441\u0432\u044f\u0442\u0438\u0445 \u043f\u0440\u0430\u043e\u0442\u0446\u0456\u0432. \u0413\u043b\u0430\u0441 3-\u0439.\u000d\u000a\u041c\u0447\u0447. \u0404\u0432\u0441\u0442\u0440\u0430\u0442\u0456\u044f, \u0410\u0432\u043a\u0441\u0435\u043d\u0442\u0456\u044f, \u0404\u0432\u0433\u0435\u043d\u0456\u044f, \u041c\u0430\u0440\u0434\u0430\u0440\u0456\u044f \u0442\u0430 \u041e\u0440\u0435\u0441\u0442\u0430 (284 \u2013 305). \u000d\u000a\u041c\u0446. \u041b\u0443\u043a\u0456\u0457 \u0421\u0456\u0440\u0430\u043a\u0443\u0437\u044c\u043a\u043e\u0457 (304). \u041f\u0440\u043f. \u0410\u0440\u043a\u0430\u0434\u0456\u044f \u041d\u043e\u0432\u043e\u0442\u043e\u0440\u0437\u044c\u043a\u043e\u0433\u043e (\u0425\u0406). \u041f\u0440\u043f. \u000d\u000a\u041c\u0430\u0440\u0434\u0430\u0440\u0456\u044f, \u0437\u0430\u0442\u0432\u043e\u0440\u043d\u0438\u043a\u0430 \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406\u0406). \u041f\u0440\u043f. \u0410\u0440\u0441\u0435\u043d\u0456\u044f \u041b\u0430\u0442\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e, \u0456\u0433\u0443\u043c. (V\u0406\u0406\u0406 \u2013 \u0425). \u0421\u0432\u0442. \u0414\u043e\u0441\u0438\u0444\u0435\u044f, \u000d\u000a\u043c\u0438\u0442\u0440. \u041c\u043e\u043b\u0434\u043e\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1693, \u0420\u0443\u043c.).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 6-\u0435, \u041b\u043a., 114 \u0437\u0430\u0447., XXIV, 36 \u2013 53.\u000d\u000a\u041b\u0456\u0442. \u2013 \u041a\u043e\u043b. 257 \u0437\u0430\u0447.; \u0406\u0406\u0406, 4 \u2013 11 (\u0430\u043f\u043e\u0441\u0442\u043e\u043b\u044c\u0441\u044c\u043a\u0435 \u0447\u0438\u0442\u0430\u043d\u043d\u044f 29-\u0457 \u043d\u0435\u0434\u0456\u043b\u0456). \u041b\u043a., 76 \u000d\u000a\u0437\u0430\u0447., X\u0406V, 16 \u2013 24 (\u0446\u0435 \u0454\u0432\u0430\u043d\u0433\u0435\u043b\u044c\u0441\u044c\u043a\u0435 \u0447\u0438\u0442\u0430\u043d\u043d\u044f 28-\u0457 \u043d\u0435\u0434\u0456\u043b\u0456 \u0456 \u043d\u0435\u0434\u0456\u043b\u0456 \u043f\u0440\u0430\u043e\u0442\u0446\u0456\u0432).\u000d\u000a\u041c\u0447\u0447.: \u0415\u0444., 233 \u0437\u0430\u0447., VI, 10 \u2013 17. \u041b\u043a., 106 \u0437\u0430\u0447., XXI, 12 \u2013 19.\u000d\u000a13\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f","80\u000d\u000a\u0421\u0449\u043c\u0447. \u0404\u043b\u0435\u0432\u0444\u0435\u0440\u0456\u044f, \u0454\u043f., \u043c\u0430\u0442\u0435\u0440\u0456 \u0439\u043e\u0433\u043e \u043c\u0446. \u0410\u043d\u0444\u0456\u0457 \u0442\u0430 \u043c\u0447. \u041a\u043e\u0440\u0438\u0432\u0430, \u0454\u043f\u0430\u0440\u0445\u0430 \u000d\u000a(\u0406\u0406). \u041f\u0440\u043f. \u041f\u0430\u0432\u043b\u0430 \u041b\u0430\u0442\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (955). \u0421\u0432\u0442. \u0421\u0442\u0435\u0444\u0430\u043d\u0430, \u0441\u043f\u043e\u0432., \u0430\u0440\u0445\u0456\u0454\u043f. \u0421\u0443\u0440\u043e\u0437\u044c\u043a\u043e\u0433\u043e (V\u0406\u0406\u0406). \u0421\u043e\u0431\u043e\u0440 \u041a\u0440\u0438\u043c\u0441\u044c\u043a\u0438\u0445 \u0441\u0432\u044f\u0442\u0438\u0445. \u041c\u0447. \u0404\u043b\u0435\u0432\u0444\u0435\u0440\u0456\u044f \u000d\u000a\u0412\u0456\u0437\u0430\u043d\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (305 \u2013 311). \u041f\u0440\u043f. \u041f\u0430\u0440\u0434\u0430, \u0441\u0430\u043c\u0456\u0442\u043d\u0438\u043a\u0430 (V\u0406).\u000d\u000a\u0404\u0432\u0440., 310 \u0437\u0430\u0447., IV, 1 \u2013 13. \u041b\u043a., 106 \u0437\u0430\u0447., XXI, 12 \u2013 19.\u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 318 \u0437\u0430\u0447., V\u0406\u0406, 26 \u2013 V\u0406\u0406\u0406, 2. \u0406\u043d., 36 \u0437\u0430\u0447., \u0425, 9 \u2013 16.\u000d\u000a\u041f\u0440\u043e\u0440. \u0410\u0433\u0435\u044f (500 \u0434\u043e \u0420. \u0425.). \u041c\u0447. \u041c\u0430\u0440\u0438\u043d\u0430 \u0420\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (\u0406\u0406\u0406). \u0421\u0432. \u0431\u043b\u0433\u0432. \u0456\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u0456 \u0412\u0456\u0437\u0430\u043d\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0457 \u0424\u0435\u043e\u0444\u0430\u043d\u0456\u0457 (893 \u2013 894).\u000d\u000a\u0404\u0432\u0440., 312 \u0437\u0430\u0447., V, 11 \u2013 V\u0406, 8. \u041b\u043a., 104 \u0437\u0430\u0447., XXI, 5 \u2013 7, 10 \u2013 11, 20 \u2013 24. \u000d\u000a\u041c\u0447\u0447. \u0421\u0435\u0432\u0430\u0441\u0442\u0456\u0430\u043d\u0430 \u041c\u0435\u0434\u0456\u043e\u043b\u0430\u043d\u0441\u044c\u043a\u043e\u0433\u043e \u0442\u0430 \u0432\u043e\u0457\u043d\u0456\u0432 \u0439\u043e\u0433\u043e: \u041d\u0438\u043a\u043e\u0441\u0442\u0440\u0430\u0442\u0430 \u0441\u043a\u0430\u0440\u0431\u043d\u0438\u043a\u0430, \u0434\u0440\u0443\u0436\u0438\u043d\u0438 \u0439\u043e\u0433\u043e \u0417\u043e\u0457, \u041a\u0430\u0441\u0442\u043e\u0440\u0456\u044f, \u0441\u0449\u043c\u0447\u0447. \u0422\u0440\u0430\u043d\u043a\u0432\u0438\u043b\u043b\u0456\u043d\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430, \u000d\u000a\u0442\u0430 \u0441\u0438\u043d\u0456\u0432 \u0439\u043e\u0433\u043e \u041c\u0430\u0440\u043a\u0435\u043b\u0456\u043d\u0430 \u0442\u0430 \u041c\u0430\u0440\u043a\u0430, \u0434\u0438\u044f\u043a\u043e\u043d\u0456\u0432, \u043c\u0447\u0447. \u041a\u043b\u0430\u0432\u0434\u0456\u044f, \u043d\u0430\u0447\u0430\u043b\u044c\u043d\u0438\u043a\u0430 \u0432\u2019\u044f\u0437\u043d\u0438\u0446\u044c, \u0441\u0438\u043d\u0430 \u0439\u043e\u0433\u043e \u0421\u0438\u043c\u0444\u043e\u0440\u0456\u0430\u043d\u0430, \u0431\u0440\u0430\u0442\u0430 \u0439\u043e\u0433\u043e \u0412\u0456\u043a\u0442\u043e\u0440\u0438\u043d\u0430, \u0422\u0438\u0432\u0443\u0440\u0442\u0456\u044f \u0456 \u000d\u000a\u041a\u0430\u0441\u0442\u0443\u043b\u0430 (\u0431\u043b. 287). \u0421\u0432\u0442. \u041c\u043e\u0434\u0435\u0441\u0442\u0430, \u0430\u0440\u0445\u0456\u0454\u043f. \u0404\u0440\u0443\u0441\u0430\u043b\u0438\u043c\u0441\u044c\u043a\u043e\u0433\u043e (633 \u2013 634). \u000d\u000a\u041f\u0440\u043f. \u0424\u043b\u043e\u0440\u0430, \u0454\u043f. \u0410\u043c\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406\u0406). \u041f\u0440\u043f. \u041c\u0438\u0445\u0430\u0457\u043b\u0430 \u0421\u0438\u043d\u043a\u0435\u043b\u0430, \u0441\u043f\u043e\u0432\u0456\u0434\u043d\u0438\u043a\u0430 \u000d\u000a(\u0431\u043b. 845).\u000d\u000a\u0404\u0432\u0440., 317 \u0437\u0430\u0447., V\u0406\u0406, 18 \u2013 25. \u041b\u043a., 108 \u0437\u0430\u0447., XXI, 37 \u2013 XXII, 8.\u000d\u000a\u0421\u0443\u0431\u043e\u0442\u0430 \u043f\u0435\u0440\u0435\u0434 \u0420\u0456\u0437\u0434\u0432\u043e\u043c \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u0438\u043c. \u041c\u0447. \u0412\u043e\u043d\u0456\u0444\u0430\u0442\u0456\u044f (290). \u000d\u000a\u041f\u0440\u043f. \u0406\u043b\u043b\u0456 \u041c\u0443\u0440\u043e\u043c\u0446\u044f, \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 \u000d\u000a(\u0431\u043b. 1188). \u041c\u0447\u0447. \u0406\u043b\u043b\u0456, \u041f\u0440\u043e\u0432\u0430 \u0442\u0430 \u0410\u0440\u0438\u0441\u0430, \u0454\u0433\u0438\u043f\u0442\u044f\u043d (308). \u041c\u0447. \u041f\u043e\u043b\u0456\u0454\u0432\u043a\u0442\u0430 \u0456 \u0441\u0449\u043c\u0447. \u0422\u0438\u043c\u043e\u0444\u0456\u044f, \u0434\u0438\u044f\u043a\u043e\u043d\u0430 (\u0406V). \u0421\u0432\u0442. \u0412\u043e\u043d\u0456\u0444\u0430\u0442\u0456\u044f \u041c\u0438\u043b\u043e\u0441\u0442\u0438\u0432\u043e\u0433\u043e, \u000d\u000a\u0454\u043f. \u0424\u0435\u0440\u0435\u043d\u0442\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406). \u0421\u0432\u0442. \u0413\u0440\u0438\u0433\u043e\u0440\u0456\u044f, \u0454\u043f. \u041e\u043c\u0438\u0440\u0438\u0442\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 552). \u000d\u000a\u0421\u0443\u0431\u043e\u0442\u0438 \u043f\u0435\u0440\u0435\u0434 \u0420\u0456\u0437\u0434\u0432\u043e\u043c \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u0438\u043c: \u0413\u0430\u043b., 205 \u0437\u0430\u0447., III, 8 \u2013 12. \u041b\u043a., 72 \u000d\u000a\u0437\u0430\u0447., XIII, 18 \u2013 29.\u000d\u000a\u0420\u044f\u0434.: \u0415\u0444., 220 \u0437\u0430\u0447., \u0406\u0406, 11 \u2013 13. \u041b\u043a., 72 \u0437\u0430\u0447., XIII, 18 \u2013 29 (\u0454\u0432\u0430\u043d\u0433\u0435\u043b\u044c\u0441\u044c\u043a\u0456 \u000d\u000a\u0447\u0438\u0442\u0430\u043d\u043d\u044f \u0441\u043f\u0456\u0432\u043f\u0430\u0434\u0430\u044e\u0442\u044c, \u043e\u0442\u0436\u0435 \u0434\u0432\u0456\u0447\u0456 \u043d\u0435 \u043f\u043e\u0432\u0442\u043e\u0440\u044e\u0454\u043c\u043e).\u000d\u000a\u041f\u0440\u043e\u0440. \u0414\u0430\u043d\u0438\u0457\u043b\u0430 \u0442\u0430 \u0442\u0440\u044c\u043e\u0445 \u043e\u0442\u0440\u043e\u043a\u0456\u0432: \u0410\u043d\u0430\u043d\u0456\u0457, \u0410\u0437\u0430\u0440\u0456\u0457 \u0442\u0430 \u041c\u0438\u0441\u0430\u0457\u043b\u0430 (600 \u0434\u043e \u0420. \u0425.). \u000d\u000a\u041f\u0440\u043f. \u0414\u0430\u043d\u0438\u0457\u043b\u0430 \u0404\u0433\u0438\u043f\u0435\u0442\u0441\u044c\u043a\u043e\u0433\u043e, \u0441\u043f\u043e\u0432., \u0443 \u0441\u0445\u0438\u043c\u0456 \u0421\u0442\u0435\u0444\u0430\u043d\u0430 (\u0425).\u000d\u000a\u0404\u0432\u0440., 315 \u0437\u0430\u0447., V\u0406\u0406, 1 \u2013 6. \u041b\u043a., 107 \u0437\u0430\u0447., XXI, 28 \u2013 33. \u000d\u000a\u0421\u0432\u0432.: \u0404\u0432\u0440., 330 \u0437\u0430\u0447., XI, 33 \u2013 XII, 2. \u041b\u043a., 62 \u0437\u0430\u0447., XI, 47 \u2013 XII, 1. \u000d\u000a15\u000d\u000a16\u000d\u000a18\u000d\u000a19\u000d\u000a17\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440\u000d\u000a29-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456, \u043f\u0435\u0440\u0435\u0434 \u0420\u0456\u0437\u0434\u0432\u043e\u043c \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u0438\u043c, \u000d\u000a\u0441\u0432\u044f\u0442\u0438\u0445 \u043e\u0442\u0446\u0456\u0432. \u0413\u043b\u0430\u0441 4-\u0439.\u000d\u000a\u041f\u0435\u0440\u0435\u0434\u0441\u0432\u044f\u0442\u043e \u0420\u0456\u0437\u0434\u0432\u0430 \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u043e\u0433\u043e. \u0421\u0449\u043c\u0447. \u0406\u0433\u043d\u0430\u0442\u0456\u044f \u0411\u043e\u0433\u043e\u043d\u043e\u0441\u0446\u044f, \u0454\u043f. (107). \u000d\u000a\u041f\u0440\u043f. \u0406\u0433\u043d\u0430\u0442\u0456\u044f, \u0430\u0440\u0445\u0456\u043c. \u041a\u0438\u0454\u0432\u043e-\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u043e\u0433\u043e, \u0432 \u0414\u0430\u043b\u044c\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 \u000d\u000a(1435). \u0421\u0432\u0442. \u0424\u0456\u043b\u043e\u0433\u043e\u043d\u0456\u044f, \u0454\u043f. \u0410\u043d\u0442\u0456\u043e\u0445\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (323). \u0421\u0432\u0442. \u0414\u0430\u043d\u0438\u0457\u043b\u0430, \u0430\u0440\u0445\u0456\u0454\u043f. \u0421\u0435\u0440\u0431\u0441\u044c\u043a\u043e\u0433\u043e (1338).\u000d\u000a\u041d\u043e\u0432\u043e\u0434\u0432\u0456\u0440\u0446\u0456\u0432\u0441\u044c\u043a\u043e\u0457 \u0456 \u041b\u0435\u043d\u044c\u043a\u0456\u0432\u0441\u044c\u043a\u043e\u0457 (\u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434-\u0421\u0456\u0432\u0435\u0440\u0441\u044c\u043a\u043e\u0457), \u0437\u0432\u0430\u043d\u043e\u0457 \u00ab\u0421\u043f\u0430\u0441\u0438\u0442\u0435\u043b\u044c\u043a\u0430 \u043f\u043e\u0442\u043e\u043f\u0430\u044e\u0447\u0438\u0445\u00bb, \u0456\u043a\u043e\u043d \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456.\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a20","81\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 7-\u0435, \u0406\u043d., 63 \u0437\u0430\u0447., XX, 1 \u2013 10.\u000d\u000a\u041b\u0456\u0442. \u2013 \u043d\u0435\u0434\u0456\u043b\u0456 \u043f\u0435\u0440\u0435\u0434 \u0420\u0456\u0437\u0434\u0432\u043e\u043c \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u0438\u043c: \u0404\u0432\u0440., 328 \u0437\u0430\u0447., XI, 9 \u2013 10, 17 \u2013 \u000d\u000a23, 32 \u2013 40. \u041c\u0444., 1 \u0437\u0430\u0447., I, 1 \u2013 25.\u000d\u000a\u0417 \u0446\u044c\u043e\u0433\u043e \u0434\u043d\u044f \u0434\u043e 14-\u0433\u043e \u0441\u0456\u0447\u043d\u044f \u041e\u043a\u0442\u043e\u0457\u0445 \u0443 \u0431\u0443\u0434\u043d\u0456 \u043d\u0435 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f. \u0417 20-\u0433\u043e \u000d\u000a\u043f\u043e 24-\u0442\u0435 \u0433\u0440\u0443\u0434\u043d\u044f \u043d\u0430 \u043c\u0430\u043b\u043e\u043c\u0443 \u043f\u043e\u0432\u0435\u0447\u0456\u0440\u2019\u0457 \u0441\u043f\u0456\u0432\u0430\u044e\u0442\u044c\u0441\u044f \u0442\u0440\u0438\u043f\u0456\u0441\u043d\u0446\u0456 \u043f\u0435\u0440\u0435\u0434\u0441\u0432\u044f\u0442\u0443.\u000d\u000a30-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u041c\u0446. \u042e\u043b\u0456\u0430\u043d\u0456\u0457 \u0456 \u0437 \u043d\u0435\u044e \u043c\u0447\u0447. \u000d\u000a500 \u0447\u043e\u043b\u043e\u0432\u0456\u043a\u0456\u0432 \u0442\u0430 \u043c\u0446\u0446. 130 \u0436\u0456\u043d\u043e\u043a, \u044f\u043a\u0456 \u0432 \u041d\u0456\u043a\u043e\u043c\u0438\u0434\u0456\u0457 \u043f\u043e\u0441\u0442\u0440\u0430\u0436\u0434\u0430\u043b\u0438 \u000d\u000a(304). \u0421\u0432\u0442. \u041f\u0435\u0442\u0440\u0430, \u043c\u0438\u0442\u0440. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0432\u0441\u0456\u0454\u0457 \u0420\u0443\u0441\u0438 \u0447\u0443\u0434\u043e\u0442\u0432\u043e\u0440\u0446\u044f \u000d\u000a(1326). \u041c\u0447. \u0424\u0435\u043c\u0456\u0441\u0442\u043e\u043a\u043b\u0435\u044f \u041c\u0438\u0440\u043b\u0456\u043a\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (251). \u0421\u0432\u0442. \u0424\u0456\u043b\u0430\u0440\u0435\u0442\u0430, \u000d\u000a\u043c\u0438\u0442\u0440. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0413\u0430\u043b\u0438\u0446\u044c\u043a\u043e\u0433\u043e (1857).\u000d\u000a\u0404\u0432\u0440., 319 \u0437\u0430\u0447., VIII, 7 \u2013 13. \u041c\u043a., 33 \u0437\u0430\u0447., VIII, 11 \u2013 21.\u000d\u000a\u0412\u043c\u0446. \u0410\u043d\u0430\u0441\u0442\u0430\u0441\u0456\u0457 \u0423\u0437\u043e\u0440\u0456\u0448\u0438\u0442\u0435\u043b\u044c\u043d\u0438\u0446\u0456 (\u0431\u043b. 304). \u041c\u0447\u0447. \u0425\u0440\u0438\u0441\u043e\u0433\u043e\u043d\u0430, \u000d\u000a\u0424\u0435\u043e\u0434\u043e\u0442\u0456\u0457, \u0404\u0432\u043e\u0434\u0430, \u0404\u0432\u0442\u0438\u0445\u0456\u0430\u043d\u0430 \u0442\u0430 \u0456\u043d\u0448\u0438\u0445 (\u0431\u043b. 304).\u000d\u000a\u0404\u0432\u0440., 321 \u0437\u0430\u0447., IX, 8 \u2013 10, 15 \u2013 23. \u041c\u043a., 34 \u0437\u0430\u0447., VIII, 22 \u2013 26.\u000d\u000a\u0412\u043c\u0446.: \u0413\u0430\u043b., 208 \u0437\u0430\u0447., III, 23 \u2013 29. \u041b\u043a., 33 \u0437\u0430\u0447., VII, 36 \u2013 50.\u000d\u000a\u041c\u0447\u0447. \u043d\u0430 \u041a\u0440\u0438\u0442\u0456: \u0424\u0435\u043e\u0434\u0443\u043b\u0430, \u0421\u0430\u0442\u043e\u0440\u043d\u0438\u043d\u0430, \u0415\u0432\u043f\u043e\u0440\u0430, \u0413\u0435\u043b\u0430\u0441\u0456\u044f, \u0415\u0432\u043d\u0438\u043a\u0456\u0430\u043d\u0430, \u000d\u000a\u0417\u043e\u0442\u0438\u043a\u0430, \u041f\u043e\u043c\u043f\u0456\u044f, \u0410\u0433\u0430\u0444\u043e\u043f\u0443\u0441\u0430, \u0412\u0430\u0441\u0438\u043b\u0456\u0434\u0430 \u0442\u0430 \u0415\u0432\u0430\u0440\u0435\u0441\u0442\u0430 (\u0406\u0406\u0406). \u041f\u0440\u043f. \u041d\u0438\u0444\u043e\u043d\u0442\u0430, \u0454\u043f. \u041a\u0456\u043f\u0440\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V). \u041f\u0440\u043f. \u041f\u0430\u0432\u043b\u0430, \u0454\u043f. \u041d\u0435\u043e\u043a\u0435\u0441\u0430\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406V).\u000d\u000a\u0404\u0432\u0440., 323 \u0437\u0430\u0447., X, 1 \u2013 18. \u041c\u043a., 36 \u0437\u0430\u0447., VIII, 30 \u2013 34.\u000d\u000a\u041d\u0430\u0432\u0435\u0447\u0456\u0440\u2019\u044f \u0420\u0456\u0437\u0434\u0432\u0430 \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u043e\u0433\u043e (\u0420\u0456\u0437\u0434\u0432\u044f\u043d\u0438\u0439 \u0441\u0432\u044f\u0442\u0432\u0435\u0447\u0456\u0440). \u041f\u0440\u043c\u0446. \u0404\u0432\u0433\u0435\u043d\u0456\u0457 \u0456 \u0437 \u043d\u0435\u044e \u043c\u0447\u0447. \u041f\u0440\u043e\u0442\u0430, \u042f\u043a\u0438\u043d\u0444\u0430 \u0442\u0430 \u043c\u0446. \u041a\u043b\u0430\u0432\u0434\u0456\u0457 (\u0431\u043b. 262). \u041f\u0440\u043f. \u041c\u0438\u043a\u043e\u043b\u0430\u044f, \u0447\u0435\u043d\u0446\u044f (\u0406\u0425). \u041f\u0440\u043f. \u041a\u0443\u043a\u0448\u0456 \u041e\u0434\u0435\u0441\u044c\u043a\u043e\u0433\u043e (1964).\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0412\u0430\u0441\u0438\u043b\u0456\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e.\u000d\u000a\u041d\u0430 1-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0404\u0432\u0440., 303 \u0437\u0430\u0447., I, 1 \u2013 12. \u041c\u0444., 2 \u0437\u0430\u0447., I, 18 \u2013 25.\u000d\u000a\u041d\u0430 3-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0413\u0430\u043b., 208 \u0437\u0430\u0447., III, 23 \u2013 29. \u041b\u043a., 5 \u0437\u0430\u0447., II, 1 \u2013 20.\u000d\u000a\u041d\u0430 6-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0404\u0432\u0440., 304 \u0437\u0430\u0447., I, 10 \u2013 II, 3. \u041c\u0444., 3 \u0437\u0430\u0447., II, 1 \u2013 12.\u000d\u000a\u041d\u0430 9-\u043c\u0443 \u0447\u0430\u0441\u0456: \u0404\u0432\u0440., 306 \u0437\u0430\u0447., II, 11 \u2013 18. \u041c\u0444., 4 \u0437\u0430\u0447., II, 13 \u2013 23.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0404\u0432\u0440., 303 \u0437\u0430\u0447., I, 1 \u2013 12. \u041b\u043a., 5 \u0437\u0430\u0447., II, 1 \u2013 20.\u000d\u000a\u0423 \u0446\u0435\u0439 \u0434\u0435\u043d\u044c 1-\u0439 \u0447\u0430\u0441 \u0434\u043e \u0440\u0430\u043d\u043d\u044c\u043e\u0457 \u043d\u0435 \u043f\u0440\u0438\u0454\u0434\u043d\u0443\u0454\u0442\u044c\u0441\u044f, \u0430 \u0437\u0432\u0435\u0440\u0448\u0443\u044e\u0442\u044c\u0441\u044f \u000d\u000a\u043e\u043a\u0440\u0435\u043c\u043e \u0446\u0430\u0440\u0441\u044c\u043a\u0456 \u0447\u0430\u0441\u0438 \u0442\u0430 \u0437\u043e\u0431\u0440\u0430\u0436\u0430\u043b\u044c\u043d\u0456. \u0411\u043b\u0430\u0436\u0435\u043d\u043d\u0456 \u0447\u0438\u0442\u0430\u044e\u0442\u044c\u0441\u044f. \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u043f\u043e\u0447\u0438\u043d\u0430\u0454\u0442\u044c\u0441\u044f \u0437 \u0432\u0435\u0447\u0456\u0440\u043d\u0456. \u00ab\u0411\u043b\u0430\u0436\u0435\u043d \u043c\u0443\u0436\u00bb \u043d\u0435 \u0441\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f. \u000d\u000a\u0412\u0445\u0456\u0434 \u0437 \u0404\u0432\u0430\u043d\u0433\u0435\u043b\u0456\u0454\u043c, \u0447\u0438\u0442\u0430\u043d\u043d\u044f \u0432\u043e\u0441\u044c\u043c\u0438 \u043f\u0430\u0440\u0435\u043c\u0456\u0439. \u041f\u0456\u0441\u043b\u044f 3-\u0457 \u0442\u0430 6-\u0457 \u043f\u0430\u0440\u0435\u043c\u0456\u0457 \u0432\u0456\u0434\u0447\u0438\u043d\u044f\u044e\u0442\u044c\u0441\u044f \u0446\u0430\u0440\u0441\u044c\u043a\u0456 \u0432\u0440\u0430\u0442\u0430 \u0456 \u0441\u043f\u0456\u0432\u0430\u044e\u0442\u044c\u0441\u044f \u0437\u0430\u0441\u043f\u0456\u0432\u0438 \u00ab\u0417 \u043d\u0438\u043c\u0438 \u0436 \u000d\u000a\u043f\u043e\u043c\u0438\u043b\u0443\u0439 \u043d\u0430\u0441\u00bb \u0442\u0430 \u00ab\u0416\u0438\u0442\u0442\u0454\u0434\u0430\u0432\u0447\u0435, \u0441\u043b\u0430\u0432\u0430 \u0422\u043e\u0431\u0456\u00bb. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0414\u043e\u0441\u0442\u043e\u0439\u043d\u043e\u00bb \u000d\u000a\u2013 \u00ab\u0422\u043e\u0431\u043e\u044e \u0440\u0430\u0434\u0443\u0454\u0442\u044c\u0441\u044f\u2026\u00bb. \u041f\u0440\u0438\u0447\u0430\u0441\u043d\u0438\u0439: \u00ab\u0425\u0432\u0430\u043b\u0456\u0442\u044c \u0413\u043e\u0441\u043f\u043e\u0434\u0430 \u0437 \u043d\u0435\u0431\u0435\u0441\u2026\u00bb. \u000d\u000a\u041f\u0456\u0441\u043b\u044f \u0432\u0456\u0434\u043f\u0443\u0441\u0442\u0443 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u0447\u0438\u043d \u0441\u043b\u0430\u0432\u043b\u0435\u043d\u043d\u044f, \u043a\u043b\u0456\u0440\u0438\u043a\u0438 \u043f\u0435\u0440\u0435\u0434 \u0456\u043a\u043e\u043d\u043e\u044e \u0456 \u000d\u000a\u0441\u0432\u0456\u0447\u043d\u0438\u043a\u043e\u043c \u0437 \u0437\u0430\u043f\u0430\u043b\u0435\u043d\u043e\u044e \u0441\u0432\u0456\u0447\u043a\u043e\u044e \u0441\u043f\u0456\u0432\u0430\u044e\u0442\u044c \u0442\u0440\u043e\u043f\u0430\u0440 \u0456 \u043a\u043e\u043d\u0434\u0430\u043a \u0441\u0432\u044f\u0442\u0430 \u000d\u000a\u0420\u0456\u0437\u0434\u0432\u0430 \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u043e\u0433\u043e.\u000d\u000a21\u000d\u000a22\u000d\u000a23\u000d\u000a24\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440","82\u000d\u000a\u0420\u0406\u0417\u0414\u0412\u041e \u0413\u041e\u0421\u041f\u041e\u0414\u0410 \u0411\u041e\u0413\u0410 \u0406 \u0421\u041f\u0410\u0421\u0418\u0422\u0415\u041b\u042f \u041d\u0410\u0428\u041e\u0413\u041e \u0406\u0421\u0423\u0421\u0410 \u0425\u0420\u0418\u0421\u0422\u0410.\u000d\u000a\u041b\u0456\u0442\u0443\u0440\u0433\u0456\u044f \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u0441\u0432\u0442. \u0406\u043e\u0430\u043d\u0430 \u0417\u043e\u043b\u043e\u0442\u043e\u0443\u0441\u0442\u043e\u0433\u043e.\u000d\u000a\u0420\u0430\u043d. \u2013 \u041c\u0444., 2 \u0437\u0430\u0447., I, 18 \u2013 25.\u000d\u000a\u041b\u0456\u0442. \u2013 \u0413\u0430\u043b., 209 \u0437\u0430\u0447., IV, 4 \u2013 7. \u041c\u0444., 3 \u0437\u0430\u0447., II, 1 \u2013 12.\u000d\u000a\u0412\u0456\u0434 25 \u0433\u0440\u0443\u0434\u043d\u044f \u0434\u043e 4 \u0441\u0456\u0447\u043d\u044f \u2013 \u0441\u0432\u044f\u0442\u043a\u0438 (\u0441\u0432\u044f\u0442\u0456 \u0434\u043d\u0456). \u041d\u0435\u043c\u0430\u0454 \u043f\u043e\u0441\u0442\u0443 \u0432 \u0441\u0435\u0440\u0435\u0434\u0443 \u0456 \u000d\u000a\u043f\u2019\u044f\u0442\u043d\u0438\u0446\u044e. \u0412\u0441\u0435\u043d\u0456\u0447\u043d\u0430 \u043f\u043e\u0447\u0438\u043d\u0430\u0454\u0442\u044c\u0441\u044f \u0437 \u0432\u0438\u0433\u043e\u043b\u043e\u0441\u0443: \u00ab\u0421\u043b\u0430\u0432\u0430 \u0421\u0432\u044f\u0442\u0456\u0439, \u0404\u0434\u0438\u043d\u043e\u0441\u0443\u0449\u043d\u0456\u0439, \u0416\u0438\u0432\u043e\u0442\u0432\u043e\u0440\u0447\u0456\u0439 \u0456 \u041d\u0435\u0440\u043e\u0437\u0434\u0456\u043b\u044c\u043d\u0456\u0439 \u0422\u0440\u043e\u0439\u0446\u0456 \u0437\u0430\u0432\u0436\u0434\u0438, \u043d\u0438\u043d\u0456 \u0456 \u043f\u043e\u0432\u0441\u044f\u043a\u0447\u0430\u0441, \u0456 \u043d\u0430 \u000d\u000a\u0432\u0456\u043a\u0438 \u0432\u0456\u043a\u0456\u0432\u00bb. \u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0422\u0435\u0431\u0435, \u0416\u0438\u0442\u0442\u0454\u0434\u0430\u0432\u0447\u0435 \u0425\u0440\u0438\u0441\u0442\u0435, \u000d\u000a\u0449\u043e \u0437\u0430\u0440\u0430\u0434\u0438 \u043d\u0430\u0441 \u043d\u0438\u043d\u0456 \u043f\u043b\u043e\u0442\u0442\u044e \u043d\u0430\u0440\u043e\u0434\u0438\u0432\u0441\u044f \u0432\u0456\u0434 \u0411\u0435\u0437\u043d\u0435\u0432\u0456\u0441\u043d\u043e\u0457 \u0456 \u041f\u0440\u0435\u0447\u0438\u0441\u0442\u043e\u0457 \u0414\u0456\u0432\u0438 \u000d\u000a\u041c\u0430\u0440\u0456\u0457\u00bb. \u041f\u0440\u0438\u0441\u043f\u0456\u0432 \u043d\u0430 9-\u0439 \u043f\u0456\u0441\u043d\u0456 \u043a\u0430\u043d\u043e\u043d\u0443: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0439, \u0434\u0443\u0448\u0435 \u043c\u043e\u044f, \u0447\u0435\u0441\u043d\u0456\u0448\u0443 \u0456 \u0441\u043b\u0430\u0432\u043d\u0456\u0448\u0443 \u0432\u0456\u0434 \u0433\u043e\u0440\u043d\u0456\u0445 \u0432\u043e\u0457\u043d\u0441\u0442\u0432 \u0414\u0456\u0432\u0443 \u041f\u0440\u0435\u0447\u0438\u0441\u0442\u0443 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u044e\u00bb. \u041d\u0430 \u041b\u0456\u0442\u0443\u0440\u0433\u0456\u0457 \u2013 \u0430\u043d\u0442\u0438\u0444\u043e\u043d\u0438 \u0441\u0432\u044f\u0442\u0430, \u0432\u0445\u0456\u0434\u043d\u0438\u0439 \u0441\u0442\u0438\u0445: \u00ab\u0406\u0437 \u0443\u0442\u0440\u043e\u0431\u0438 \u0440\u0430\u043d\u0456\u0448\u0435 \u0432\u0456\u043a\u0456\u0432 \u042f \u043f\u043e\u0440\u043e\u0434\u0438\u0432 \u0422\u0435\u0431\u0435. \u000d\u000a\u041a\u043b\u044f\u0432\u0441\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u0456 \u043d\u0435 \u0440\u043e\u0437\u043a\u0430\u0454\u0442\u044c\u0441\u044f: \u201c\u0422\u0438 \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0438\u043a \u043f\u043e\u0432\u0456\u043a \u0437\u0430 \u0447\u0438\u043d\u043e\u043c \u000d\u000a\u041c\u0435\u043b\u0445\u0438\u0441\u0435\u0434\u0435\u043a\u043e\u0432\u0438\u043c\u201d\u00bb. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u0442\u0440\u0438\u0441\u0432\u044f\u0442\u043e\u0433\u043e \u2013 \u00ab\u0412\u0441\u0456 \u0432\u0438, \u0449\u043e \u0432 \u0425\u0440\u0438\u0441\u0442\u0430 \u0445\u0440\u0435\u0441\u0442\u0438\u043b\u0438\u0441\u044f...\u00bb. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u00ab\u0414\u043e\u0441\u0442\u043e\u0439\u043d\u043e \u0454\u2026\u00bb \u2013 \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0439, \u0434\u0443\u0448\u0435 \u043c\u043e\u044f...\u00bb, \u00ab\u0422\u0430\u0457\u043d\u0441\u0442\u0432\u043e \u000d\u000a\u0434\u0438\u0432\u043d\u0435 \u0431\u0430\u0447\u0443 \u0456 \u043f\u0440\u0435\u0441\u043b\u0430\u0432\u043d\u0435...\u00bb (\u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f). \u0412 \u0441\u0435\u0434\u043c\u0438\u0447\u043d\u0456 \u0434\u043d\u0456 \u0442\u0430 \u043d\u0430 \u0430\u0440\u0445\u0456\u0454\u0440\u0435\u0439\u0441\u044c\u043a\u0438\u0445 \u0441\u043b\u0443\u0436\u0431\u0430\u0445 \u043f\u0456\u0441\u043b\u044f \u043c\u0430\u043b\u043e\u0433\u043e \u0432\u0445\u043e\u0434\u0443 \u00ab\u041f\u0440\u0438\u0439\u0434\u0456\u0442\u044c, \u043f\u043e\u043a\u043b\u043e\u043d\u0456\u043c\u043e\u0441\u044c... \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u000d\u000a\u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, \u0449\u043e \u0432\u0456\u0434 \u0414\u0456\u0432\u0438 \u043d\u0430\u0440\u043e\u0434\u0438\u0432\u0441\u044f...\u00bb (\u0434\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f). \u0414\u043e \u0432\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0432 \u0441\u0435\u0434\u043c\u0438\u0447\u043d\u0456 \u0434\u043d\u0456 \u0432\u0456\u0434\u043f\u0443\u0441\u0442 \u0441\u0432\u044f\u0442\u043a\u043e\u0432\u0438\u0439, \u0430 \u0432 \u043d\u0435\u0434\u0456\u043b\u044c\u043d\u0456 \u2013 \u0432\u043e\u0441\u043a\u0440\u0435\u0441\u043d\u0438\u0439.\u000d\u000a\u041d\u0430 \u0432\u0435\u0447\u0456\u0440\u043d\u0456 \u0432 \u0434\u0435\u043d\u044c \u0441\u0432\u044f\u0442\u0430 \u0420\u0456\u0437\u0434\u0432\u0430 \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u043e\u0433\u043e \u0432\u0445\u0456\u0434 \u0456 \u0432\u0435\u043b\u0438\u043a\u0438\u0439 \u043f\u0440\u043e\u043a\u0438\u043c\u0435\u043d \u000d\u000a\u00ab\u0425\u0442\u043e \u0411\u043e\u0433 \u0432\u0435\u043b\u0438\u043a\u0438\u0439\u2026\u00bb.\u000d\u000a\u0421\u0443\u0431\u043e\u0442\u0430 \u043f\u0456\u0441\u043b\u044f \u0420\u0456\u0437\u0434\u0432\u0430 \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u043e\u0433\u043e. \u041f\u0456\u0441\u043b\u044f\u0441\u0432\u044f\u0442\u043e \u0420\u0456\u0437\u0434\u0432\u0430 \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u043e\u0433\u043e. \u000d\u000a\u0421\u043e\u0431\u043e\u0440 \u041f\u0440\u0435\u0441\u0432\u044f\u0442\u043e\u0457 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446i. \u0421\u0449\u043c\u0447. \u0404\u0432\u0444\u0438\u043c\u0456\u044f, \u0454\u043f. \u0421\u0430\u0440\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e \u000d\u000a(\u0431\u043b. 840). \u041f\u0440\u043f. \u041a\u043e\u0441\u0442\u044f\u043d\u0442\u0438\u043d\u0430 \u0421\u0438\u043d\u0430\u0434\u0441\u044c\u043a\u043e\u0433\u043e (V\u0406\u0406\u0406). \u041f\u0440\u043f. \u0415\u0432\u0430\u0440\u0435\u0441\u0442\u0430 \u0421\u0442\u0443\u0434\u0438\u0442\u0430 (825).\u000d\u000a\u0412\u0456\u043b\u0435\u043d\u0441\u044c\u043a\u043e-\u041e\u0441\u0442\u0440\u043e\u0431\u0440\u0430\u043c\u0441\u044c\u043a\u0438\u0445, \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0445 \u00ab\u0422\u0440\u044c\u043e\u0445 \u0440\u0430\u0434\u043e\u0441\u0442\u0435\u0439\u00bb \u0442\u0430 \u00ab\u041c\u0438\u043b\u043e\u0441\u0442\u0438\u0432\u0430\u00bb \u0456\u043a\u043e\u043d \u0411\u043e\u0436\u043e\u0457 \u041c\u0430\u0442\u0435\u0440\u0456.\u000d\u000a\u0421\u0443\u0431\u043e\u0442\u0438 \u043f\u0456\u0441\u043b\u044f \u0420\u0456\u0437\u0434\u0432\u0430 \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u043e\u0433\u043e: 1 \u0422\u0438\u043c., 288 \u0437\u0430\u0447., VI, 11 \u2013 16. \u041c\u0444., 46 \u000d\u000a\u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), XII, 15 \u2013 21.\u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456: \u0404\u0432\u0440., 306 \u0437\u0430\u0447., II, 11 \u2013 18. \u041c\u0444., 4 \u0437\u0430\u0447., II, 13 \u2013 23.\u000d\u000a\u041d\u0430 \u0432\u0435\u0447\u0456\u0440\u043d\u0456 \u0432\u0445\u0456\u0434, \u043f\u0440\u043e\u043a\u0438\u043c\u0435\u043d \u0432\u0435\u043b\u0438\u043a\u0438\u0439 \u00ab\u0425\u0442\u043e \u0431\u043e\u0433 \u0432\u0435\u043b\u0438\u043a\u0438\u0439...\u00bb. \u0417\u0430\u043c\u0456\u0441\u0442\u044c \u000d\u000a\u00ab\u0427\u0435\u0441\u043d\u0456\u0448\u0443\u00bb \u0441\u043f\u0456\u0432\u0430\u044e\u0442\u044c\u0441\u044f \u043f\u0440\u0438\u0441\u043f\u0456\u0432\u0438 \u0441\u0432\u044f\u0442\u0430. \u0421\u043f\u0456\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0432\u0435\u043b\u0438\u043a\u0435 \u0441\u043b\u0430\u0432\u043e\u0441\u043b\u0456\u0432\u2019\u044f.\u000d\u000a30-\u0442\u0430 \u043d\u0435\u0434\u0456\u043b\u044f \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456, \u043f\u0456\u0441\u043b\u044f \u0420\u0456\u0437\u0434\u0432\u0430 \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u043e\u0433\u043e. \u000d\u000a\u0413\u043b\u0430\u0441 5-\u0439.\u000d\u000a\u041f\u0440\u0430\u0432. \u0419\u043e\u0441\u0438\u0444\u0430 \u041e\u0431\u0440\u0443\u0447\u043d\u0438\u043a\u0430, \u0414\u0430\u0432\u0438\u0434\u0430, \u0446\u0430\u0440\u044f, \u0456 \u042f\u043a\u043e\u0432\u0430, \u0431\u0440\u0430\u0442\u0430 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u044c\u043e\u0433\u043e. (\u043f\u0435\u0440\u0435\u0445\u0456\u0434\u043d\u0435 \u0441\u0432\u044f\u0442\u043a\u0443\u0432\u0430\u043d\u043d\u044f \u0443 \u043d\u0435\u0434\u0456\u043b\u044e \u043f\u0456\u0441\u043b\u044f \u0420\u0456\u0437\u0434\u0432\u0430 \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u043e\u0433\u043e). \u000d\u000a\u0410\u043f. \u043f\u0435\u0440\u0448\u043e\u043c\u0447. \u0442\u0430 \u0430\u0440\u0445\u0456\u0434\u0438\u044f\u043a\u043e\u043d\u0430 \u0421\u0442\u0435\u0444\u0430\u043d\u0430 (34). \u041f\u0440\u043f. \u0424\u0435\u0434\u043e\u0440\u0430 \u041d\u0430\u043a\u0440\u0435\u0441\u043b\u0435\u043d\u043e\u0433\u043e, \u0441\u043f\u043e\u0432. (\u0431\u043b. 840). \u0421\u0432\u0442. \u0424\u0435\u0434\u043e\u0440\u0430, \u0430\u0440\u0445\u0456\u0454\u043f. \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0433\u043e (\u0431\u043b. 686). \u041f\u0440\u043f. \u0412\u043e\u043d\u0456\u0444\u0430\u0442\u0456\u044f, \u0456\u0433\u0443\u043c. \u0424\u0435\u043e\u0444\u0430\u043d\u0456\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1871).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0404\u0432. 8-\u0435, \u0406\u043d., 64 \u0437\u0430\u0447., XX, 11 \u2013 18.\u000d\u000a\u041b\u0456\u0442. \u2013 \u043d\u0435\u0434\u0456\u043b\u0456 \u043f\u0456\u0441\u043b\u044f \u0420\u0456\u0437\u0434\u0432\u0430 \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u043e\u0433\u043e: \u0413\u0430\u043b., 200 \u0437\u0430\u0447., I, 11 \u2013 19. \u041c\u0444., 4 \u000d\u000a\u0437\u0430\u0447., II, 13 \u2013 23.\u000d\u000a\u0421\u0432\u0432. \u0411\u043e\u0433\u043e\u043e\u0442\u0446\u0456\u0432: \u0413\u0430\u043b., 200 \u0437\u0430\u0447., I, 11 \u2013 19. \u041c\u0444., 4 \u0437\u0430\u0447., II, 13 \u2013 23 (\u0447\u0438\u0442\u0430\u043d\u043d\u044f \u0441\u043f\u0456\u0432\u043f\u0430\u0434\u0430\u044e\u0442\u044c, \u043e\u0442\u0436\u0435 \u0457\u0445 \u043d\u0435 \u043f\u043e\u0432\u0442\u043e\u0440\u044e\u0454\u043c\u043e).\u000d\u000a\u041f\u0435\u0440\u0448\u043e\u043c\u0447.: \u0414\u0456\u044f\u043d., 17 \u0437\u0430\u0447., VI, 8 \u2013 15; VII, 1\u20135, 47 \u2013 60. \u041c\u0444., 87 \u0437\u0430\u0447., \u000d\u000aXXI, 33 \u2013 42.\u000d\u000a\u043f'\u044f\u0442\u043d\u0438\u0446\u044f\u000d\u000a\u0441\u0443\u0431\u043e\u0442\u0430\u000d\u000a\u043d\u0435\u0434\u0456\u043b\u044f\u000d\u000a25\u000d\u000a26\u000d\u000a27","83\u000d\u000a31-\u0439 \u0442\u0438\u0436\u0434\u0435\u043d\u044c \u043f\u0456\u0441\u043b\u044f \u041f\u2019\u044f\u0442\u0434\u0435\u0441\u044f\u0442\u043d\u0438\u0446\u0456. \u041c\u0447\u0447. 20 000, \u044f\u043a\u0456 \u0432 \u041d\u0456\u043a\u043e\u043c\u0438\u0434\u0456\u0457 \u0431\u0443\u043b\u0438 \u0441\u043f\u0430\u043b\u0435\u043d\u0456: \u0441\u0449\u043c\u0447. \u0413\u043b\u0438\u043a\u0435\u0440\u0456\u044f, \u043f\u0440\u0435\u0441\u0432\u0456\u0442., \u043c\u0447. \u0417\u0438\u043d\u043e\u043d\u0430, \u0441\u0449\u043c\u0447. \u0424\u0435\u043e\u0444\u0456\u043b\u0430, \u0434\u0438\u044f\u043a., \u043c\u0447\u0447. \u0414\u043e\u0440\u043e\u0444\u0435\u044f, \u041c\u0430\u0440\u0434\u043e\u043d\u0456\u044f, \u0441\u0449\u043c\u0447. \u041c\u0438\u0433\u0434\u043e\u043d\u0456\u044f, \u0434\u0438\u044f\u043a., \u043c\u0447\u0447. \u000d\u000a\u0406\u043d\u0434\u0438\u0441\u0430, \u0413\u043e\u0440\u0433\u043e\u043d\u0456\u044f, \u041f\u0435\u0442\u0440\u0430, \u0404\u0432\u0444\u0438\u043c\u0456\u044f, \u043c\u0446\u0446. \u0410\u0433\u0430\u0444\u0456\u0457, \u0414\u043e\u043c\u043d\u0438, \u0424\u0435\u043e\u0444\u0456\u043b\u0438 \u0442\u0430 \u000d\u000a\u0456\u043d\u0448\u0438\u0445 (302). \u0410\u043f. \u0432\u0456\u0434 70-\u0445 \u041d\u0438\u043a\u0430\u043d\u043e\u0440\u0430 (34).\u000d\u000a\u0404\u0432\u0440., 329 \u0437\u0430\u0447., XI, 17 \u2013 23, 27 \u2013 31. \u041c\u043a., 42 \u0437\u0430\u0447., IX, 42 \u2013 X, 1.\u000d\u000a\u041c\u0447\u0447.: \u0420\u0438\u043c., 96 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), VIII, 3 \u2013 9. \u041b\u043a., 51 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0438), X, 19 \u2013 21.\u000d\u000a\u041f\u0440\u043f. \u0406\u043e\u0432\u0430 \u041c\u0430\u043d\u044f\u0432\u0441\u044c\u043a\u043e\u0433\u043e (1621). \u041c\u0447\u0447. 14 000 \u043d\u0435\u043c\u043e\u0432\u043b\u044f\u0442, \u044f\u043a\u0438\u0445 \u0406\u0440\u043e\u0434 \u000d\u000a\u0443\u0431\u0438\u0432 \u0443 \u0412\u0438\u0444\u043b\u0435\u0454\u043c\u0456 (\u0406). \u041f\u0440\u043f. \u041c\u0430\u0440\u043a\u0435\u043b\u0430, \u0456\u0433\u0443\u043c\u0435\u043d\u0430 \u043e\u0431\u0438\u0442\u0435\u043b\u0456 \u00ab\u041d\u0435\u0432\u0441\u0438\u043f\u0443\u0449\u0438\u0445\u00bb \u000d\u000a(485). \u041f\u0440\u043f\u043f. \u041c\u0430\u0440\u043a\u0430, \u0433\u0440\u043e\u0431\u043e\u043a\u043e\u043f\u0430\u0447\u0430, \u0424\u0435\u043e\u0444\u0456\u043b\u0430 \u0442\u0430 \u0406\u043e\u0430\u043d\u0430 \u041a\u0438\u0454\u0432\u043e\u041f\u0435\u0447\u0435\u0440\u0441\u044c\u043a\u0438\u0445, \u0432 \u0411\u043b\u0438\u0436\u043d\u0456\u0445 \u043f\u0435\u0447\u0435\u0440\u0430\u0445 (\u0425\u0406\u0406). \u041f\u0440\u043f. \u0424\u0430\u0434\u0435\u044f \u0421\u0442\u0443\u0434\u0438\u0442\u0430, \u000d\u000a\u0441\u043f\u043e\u0432. (818). \u000d\u000a\u0404\u0432\u0440., 333 \u0437\u0430\u0447., XII, 25 \u2013 26; XIII, 22 \u2013 25. \u041c\u043a., 43 \u0437\u0430\u0447., X, 2 \u2013 12.\u000d\u000a\u041d\u0435\u043c\u043e\u0432\u043b\u044f\u0442 \u043c\u0447\u0447.: 2 \u041a\u043e\u0440., 180 \u0437\u0430\u0447., V, 15 \u2013 21. \u041c\u0444., 4 \u0437\u0430\u0447., II, 13 \u2013 23.\u000d\u000a\u041f\u0440\u043f: \u0413\u0430\u043b., 213 \u0437\u0430\u0447., V, 22 \u2013 VI, 2. \u041c\u0444., 43 \u0437\u0430\u0447., XI, 27 \u2013 30 (\u043f\u0456\u0434 \u0437\u0430\u0447\u0430\u043b\u043e).\u000d\u000a\u041c\u0446. \u0410\u043d\u0456\u0441\u0456\u0457 \u0421\u043e\u043b\u0443\u043d\u0441\u044c\u043a\u043e\u0457 (285 \u2013 305). \u0421\u0449\u043c\u0447. \u0417\u043e\u0442\u0438\u043a\u0430, \u043f\u0440\u0435\u0441\u0432\u0456\u0442\u0435\u0440\u0430 (\u0406V). \u000d\u000a\u0410\u043f. \u0432\u0456\u0434 70-\u0445 \u0422\u0438\u043c\u043e\u043d\u0430, \u0454\u043f. \u0411\u043e\u0441\u0442\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (\u0406). \u041c\u0447. \u0424\u0456\u043b\u0435\u0442\u0435\u0440\u0430 \u041d\u0456\u043a\u043e\u043c\u0438\u0434\u0456\u0439\u0441\u044c\u043a\u043e\u0433\u043e (311). \u041f\u0440\u043f. \u0424\u0435\u043e\u0434\u043e\u0440\u0438 \u041a\u0435\u0441\u0430\u0440\u0456\u0439\u0441\u044c\u043a\u043e\u0457 (V\u0406\u0406\u0406). \u041f\u0440\u043f. \u0424\u0435\u043e\u0434\u043e\u0440\u0438 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u044c\u043a\u043e\u0457 (940).\u000d\u000a\u042f\u043a., 50 \u0437\u0430\u0447., I, 1 \u2013 18. \u041c\u043a., 44 \u0437\u0430\u0447., X, 11 \u2013 16.\u000d\u000a\u0412\u0456\u0434\u0434\u0430\u043d\u043d\u044f \u0441\u0432\u044f\u0442\u0430 \u0420\u0456\u0437\u0434\u0432\u0430 \u0425\u0440\u0438\u0441\u0442\u043e\u0432\u043e\u0433\u043e. \u041f\u0440\u043f. \u041c\u0435\u043b\u0430\u043d\u0456\u0457 \u0420\u0438\u043c\u043b\u044f\u043d\u043a\u0438 \u000d\u000a(439). \u0421\u0432\u0442. \u041f\u0435\u0442\u0440\u0430 \u041c\u043e\u0433\u0438\u043b\u0438, \u043c\u0438\u0442\u0440. \u041a\u0438\u0457\u0432\u0441\u044c\u043a\u043e\u0433\u043e \u0456 \u0413\u0430\u043b\u0438\u0446\u044c\u043a\u043e\u0433\u043e, \u0442\u0430 \u000d\u000a\u0432\u0441\u0456\u0454\u0457 \u0420\u0443\u0441\u0438 (1647). \u0421\u0432\u0442. \u0424\u0435\u043e\u0444\u0456\u043b\u0430\u043a\u0442\u0430, \u0430\u0440\u0445\u0456\u0454\u043f. \u0411\u043e\u043b\u0433\u0430\u0440\u0441\u044c\u043a\u043e\u0433\u043e (1107).\u000d\u000a\u0420\u0430\u043d. \u2013 \u0406\u043d., 35 \u0437\u0430\u0447. (\u0432\u0456\u0434 \u043f\u043e\u043b.), X, 1 \u2013 9. \u000d\u000a\u041b\u0456\u0442. \u2013 \u042f\u043a., 51 \u0437\u0430\u0447., I, 19 \u2013 27. \u041c\u043a., 45 \u0437\u0430\u0447., X, 17 \u2013 27.\u000d\u000a\u0421\u0432\u0442.: \u0404\u0432\u0440., 318 \u0437\u0430\u0447., VII, 26 \u2013 VIII, 2. \u0406\u043d., 36 \u0437\u0430\u0447., X, 9 \u2013 16.\u000d\u000a\u0421\u043b\u0443\u0436\u0431\u0430 \u0441\u0432\u0442. \u041f\u0435\u0442\u0440\u0443 \u041c\u043e\u0433\u0438\u043b\u0456 \u0443 \u041c\u0456\u043d\u0435\u0457 \u0437\u0430 1 \u0441\u0456\u0447\u043d\u044f. \u041d\u0430 \u0440\u0430\u043d\u043d\u0456\u0439 \u0432\u0435\u043b\u0438\u0447\u0430\u043d\u043d\u044f \u000d\u000a\u0441\u0432\u044f\u0442\u0438\u0442\u0435\u043b\u044e: \u00ab\u0412\u0435\u043b\u0438\u0447\u0430\u0454\u043c\u043e \u0442\u0435\u0431\u0435, \u0441\u0432\u044f\u0442\u0438\u0442\u0435\u043b\u044e \u043e\u0442\u0447\u0435 \u043d\u0430\u0448 \u041f\u0435\u0442\u0440\u0435, \u0456 \u0448\u0430\u043d\u0443\u0454\u043c\u043e \u0441\u0432\u044f\u0442\u0443 \u043f\u0430\u043c\u2019\u044f\u0442\u044c \u0442\u0432\u043e\u044e, \u0431\u043e \u0442\u0438 \u043c\u043e\u043b\u0438\u0448 \u0437\u0430 \u043d\u0430\u0441 \u0425\u0440\u0438\u0441\u0442\u0430 \u0411\u043e\u0433\u0430 \u043d\u0430\u0448\u043e\u0433\u043e\u00bb.\u000d\u000a28\u000d\u000a29\u000d\u000a30\u000d\u000a31\u000d\u000a\u043f\u043e\u043d\u0435\u0434\u0456\u043b\u043e\u043a\u000d\u000a\u0432\u0456\u0432\u0442\u043e\u0440\u043e\u043a\u000d\u000a\u0441\u0435\u0440\u0435\u0434\u0430\u000d\u000a\u0447\u0435\u0442\u0432\u0435\u0440","84\u000d\u000a\u0420\u0406\u0417\u0414\u0412\u041e \u0411\u041e\u0413\u041e\u0420\u041e\u0414\u0418\u0426\u0406 (8 \u0432\u0435\u0440\u0435\u0441\u043d\u044f)\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 1\u000d\u000a\u0421\u0442\u0438\u0445 1: \u041f\u043e\u043c'\u044f\u043d\u0438, \u0413\u043e\u0441\u043f\u043e\u0434\u0438, \u0414\u0430\u0432\u0438\u0434\u0430 / \u0456 \u000d\u000a\u0432\u0441\u044e \u043b\u0430\u0433\u0456\u0434\u043d\u0456\u0441\u0442\u044c \u0439\u043e\u0433\u043e.\u000d\u000a\u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0421\u043f\u0430\u0441\u0435, / \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u041e\u0441\u044c, \u043c\u0438 \u0447\u0443\u043b\u0438 \u043f\u0440\u043e \u041d\u044c\u043e\u0433\u043e \u0432 \u0404\u0444\u0440\u0430\u0444\u0456, / \u0437\u043d\u0430\u0439\u0448\u043b\u0438 \u0419\u043e\u0433\u043e \u043d\u0430 \u043f\u043e\u043b\u044f\u0445 \u0406\u0430\u0440\u0438\u043c\u0430. \u000d\u000a\u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0421\u043f\u0430\u0441\u0435, / \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 3: \u041f\u0440\u0435\u0441\u043b\u0430\u0432\u043d\u0435 \u0433\u043e\u0432\u043e\u0440\u044f\u0442\u044c \u043f\u0440\u043e \u0442\u0435\u0431\u0435, \u000d\u000a/ \u043c\u0456\u0441\u0442\u043e \u0411\u043e\u0436\u0435.\u000d\u000a\u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0421\u043f\u0430\u0441\u0435, / \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u043b\u0430\u0432\u0430, \u0456 \u043d\u0438\u043d\u0456: \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u000d\u000a\u0421\u043f\u0430\u0441\u0435, / \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 2\u000d\u000a\u0421\u0442\u0438\u0445 1: \u041a\u043b\u044f\u0432\u0441\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u0414\u0430\u0432\u0438\u0434\u0443 \u0432\u0456\u0440\u043d\u0456\u0441\u0442\u044e / \u0456 \u043d\u0435 \u0437\u0440\u0435\u0447\u0435\u0442\u044c\u0441\u044f \u0457\u0457.\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u043c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: \u0430\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u0406\u0437 \u0441\u0438\u043d\u0456\u0432 \u0440\u043e\u0434\u0443 \u0442\u0432\u043e\u0433\u043e / \u043f\u043e\u0441\u0430\u0434\u0436\u0443 \u000d\u000a\u043d\u0430 \u043f\u0440\u0435\u0441\u0442\u043e\u043b\u0456 \u0442\u0432\u043e\u0457\u043c.\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u043c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: \u0430\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 3: \u0422\u0430\u043c \u042f \u0432\u0438\u0440\u043e\u0449\u0443 \u0441\u043f\u0430\u0441\u0456\u043d\u043d\u044f \u0414\u0430\u0432\u0438\u0434\u043e\u0432\u0456, / \u043f\u043e\u0441\u0442\u0430\u0432\u043b\u044e \u0441\u0432\u0456\u0442\u0438\u043b\u044c\u043d\u0438\u043a \u043f\u043e\u043c\u0430\u0437\u0430\u043d\u0438\u043a\u0443 \u041c\u043e\u0454\u043c\u0443. \u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, \u000d\u000a/ \u043c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u000d\u000a\u0422\u043e\u0431\u0456: \u0430\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 4: \u0412\u0438\u0431\u0440\u0430\u0432 \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u0421\u0438\u043e\u043d, / \u0437\u0430\u0431\u0430\u0436\u0430\u0432 \u0439\u043e\u0433\u043e \u043d\u0430 \u043e\u0441\u0435\u043b\u044e \u0434\u043b\u044f \u0421\u0435\u0431\u0435.\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u043c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: \u0430\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u043b\u0430\u0432\u0430, \u0456 \u043d\u0438\u043d\u0456: \u0404\u0434\u0438\u043d\u043e\u0440\u043e\u0434\u043d\u0438\u0439 \u0421\u0438\u043d\u0443:\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 3\u000d\u000a\u0421\u0442\u0438\u0445 1: \u0426\u0435 \u043c\u0456\u0441\u0446\u0435 \u0441\u043f\u043e\u043a\u043e\u044e \u041c\u043e\u0433\u043e \u043f\u043e\u0432\u0456\u043a \u000d\u000a\u0432\u0456\u043a\u0443, \u0441\u043a\u0430\u0437\u0430\u0432 \u0413\u043e\u0441\u043f\u043e\u0434\u044c, \u0442\u0443\u0442 \u043e\u0441\u0435\u043b\u044e\u0441\u044f, / \u0431\u043e \u000d\u000a\u042f \u043f\u043e\u043b\u044e\u0431\u0438\u0432 \u0439\u043e\u0433\u043e.\u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440, \u0433\u043b\u0430\u0441 4: \u0420\u0456\u0437\u0434\u0432\u043e \u0422\u0432\u043e\u0454, \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0435 \u0414\u0456\u0432\u043e, \u0440\u0430\u0434\u0456\u0441\u0442\u044c \u0437\u0432\u0456\u0441\u0442\u0438\u043b\u043e \u0432\u0441\u0456\u0439 \u0432\u0441\u0435\u043b\u0435\u043d\u043d\u0456\u0439, \u0437 \u0422\u0435\u0431\u0435 \u0431\u043e \u0437\u0430\u0441\u044f\u044f\u043b\u043e \u0421\u043e\u043d\u0446\u0435 \u043f\u0440\u0430\u0432\u0434\u0438 \u000d\u000a\u2013 \u0425\u0440\u0438\u0441\u0442\u043e\u0441 \u0411\u043e\u0433 \u043d\u0430\u0448, \u0456, \u0437\u0440\u0443\u0439\u043d\u0443\u0432\u0448\u0438 \u043a\u043b\u044f\u0442\u0432\u0443, \u0412\u0456\u043d \u0434\u0430\u0432 \u0431\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0435\u043d\u043d\u044f \u0456 \u043f\u0435\u0440\u0435\u043c\u0456\u0433\u0448\u0438 \u000d\u000a\u0441\u043c\u0435\u0440\u0442\u044c, \u0434\u0430\u0440\u0443\u0432\u0430\u0432 \u043d\u0430\u043c \u0436\u0438\u0442\u0442\u044f \u0432\u0456\u0447\u043d\u0435.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u041f\u043e\u0442\u043e\u043a\u0438 \u0440\u0456\u043a \u0432\u0435\u0441\u0435\u043b\u044f\u0442\u044c \u043c\u0456\u0441\u0442\u043e \u000d\u000a\u0411\u043e\u0436\u0435, / \u0441\u0432\u044f\u0442\u0443 \u043e\u0441\u0435\u043b\u044e \u0412\u0441\u0435\u0432\u0438\u0448\u043d\u044c\u043e\u0433\u043e. \u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440: \u0420\u0456\u0437\u0434\u0432\u043e \u0422\u0432\u043e\u0454, \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0435 \u000d\u000a\u0414\u0456\u0432\u043e:\u000d\u000a\u0421\u0442\u0438\u0445 3: \u041d\u0430\u0441\u0438\u0442\u0438\u043c\u043e\u0441\u044c \u0434\u043e\u0431\u0440\u043e\u043c \u0434\u043e\u043c\u0443 \u000d\u000a\u0422\u0432\u043e\u0433\u043e, / \u0441\u0432\u044f\u0442\u043e\u0433\u043e \u0445\u0440\u0430\u043c\u0443 \u0422\u0432\u043e\u0433\u043e.\u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440: \u0420\u0456\u0437\u0434\u0432\u043e \u0422\u0432\u043e\u0454, \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0435 \u000d\u000a\u0414\u0456\u0432\u043e:\u000d\u000a\u0421\u0442\u0438\u0445 4: \u0421\u0438\u043b\u0430 \u0439 \u043a\u0440\u0430\u0441\u0430 / \u0443 \u0441\u0432\u044f\u0442\u0438\u043d\u0456 \u0419\u043e\u0433\u043e.\u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440: \u0420\u0456\u0437\u0434\u0432\u043e \u0422\u0432\u043e\u0454, \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0435 \u000d\u000a\u0414\u0456\u0432\u043e:\u000d\u000a\u0412\u0412\u0415\u0414\u0415\u041d\u041d\u042f \u0412 \u0425\u0420\u0410\u041c \u041f\u0420\u0415\u0421\u0412\u042f\u0422\u041e\u0407 \u000d\u000a\u0411\u041e\u0413\u041e\u0420\u041e\u0414\u0418\u0426\u0406 (21 \u043b\u0438\u0441\u0442\u043e\u043f\u0430\u0434\u0430)\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 1\u000d\u000a\u0421\u0442\u0438\u0445 1: \u0412\u0435\u043b\u0438\u043a\u0438\u0439 \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u0456 \u0432\u0435\u043b\u044c\u043c\u0438 \u000d\u000a\u0445\u0432\u0430\u043b\u044c\u043d\u0438\u0439 / \u0443 \u043c\u0456\u0441\u0442\u0456 \u0411\u043e\u0433\u0430 \u043d\u0430\u0448\u043e\u0433\u043e, \u043d\u0430 \u000d\u000a\u0433\u043e\u0440\u0456 \u0441\u0432\u044f\u0442\u0456\u0439 \u0419\u043e\u0433\u043e. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0421\u043f\u0430\u0441\u0435, / \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u041f\u0440\u0435\u0441\u043b\u0430\u0432\u043d\u0435 \u0433\u043e\u0432\u043e\u0440\u044f\u0442\u044c \u043f\u0440\u043e \u0442\u0435\u0431\u0435, \u000d\u000a/ \u043c\u0456\u0441\u0442\u043e \u0411\u043e\u0436\u0435.\u000d\u000a\u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0421\u043f\u0430\u0441\u0435, / \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 3: \u0411\u043e\u0433 \u0443 \u0445\u0440\u0430\u043c\u0456 \u0421\u0432\u043e\u0454\u043c\u0443 \u0437\u043d\u0430\u043d\u0438\u0439 / \u000d\u000a\u044f\u043a \u0437\u0430\u0445\u0438\u0441\u043d\u0438\u043a\u000d\u000a\u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0421\u043f\u0430\u0441\u0435, / \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 4: \u042f\u043a \u0447\u0443\u043b\u0438 \u043c\u0438, \u0442\u0430\u043a \u0456 \u043f\u043e\u0431\u0430\u0447\u0438\u043b\u0438 / \u0443 \u000d\u000a\u043c\u0456\u0441\u0442\u0456 \u0413\u043e\u0441\u043f\u043e\u0434\u0430 \u0421\u0438\u043b, \u0443 \u043c\u0456\u0441\u0442\u0456 \u0411\u043e\u0433\u0430 \u043d\u0430\u0448\u043e\u0433\u043e. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0421\u043f\u0430\u0441\u0435, / \u000d\u000a\u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u043b\u0430\u0432\u0430, \u0456 \u043d\u0438\u043d\u0456: \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u000d\u000a\u0421\u043f\u0430\u0441\u0435, / \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.","85\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 2\u000d\u000a\u0421\u0442\u0438\u0445 1: \u041f\u043e\u0442\u043e\u043a\u0438 \u0440\u0456\u043a \u0432\u0435\u0441\u0435\u043b\u044f\u0442\u044c \u043c\u0456\u0441\u0442\u043e \u000d\u000a\u0411\u043e\u0436\u0435, / \u0441\u0432\u044f\u0442\u0443 \u043e\u0441\u0435\u043b\u044e \u0412\u0441\u0435\u0432\u0438\u0448\u043d\u044c\u043e\u0433\u043e. \u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u043c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: / \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u0421\u0438\u043b\u0430 \u0439 \u043a\u0440\u0430\u0441\u0430 / \u0443 \u0441\u0432\u044f\u0442\u0438\u043d\u0456 \u0419\u043e\u0433\u043e.\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u043c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: / \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 3: \u041e\u0441\u044c \u0432\u0440\u0430\u0442\u0430 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0456; / \u043f\u0440\u0430\u0432\u0435\u0434\u043d\u0456 \u0443\u0432\u0456\u0439\u0434\u0443\u0442\u044c \u043d\u0438\u043c\u0438.\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u043c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: / \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 4: \u041d\u0430\u0441\u0438\u0442\u0438\u043c\u043e\u0441\u044c \u0434\u043e\u0431\u0440\u043e\u043c \u0434\u043e\u043c\u0443 \u000d\u000a\u0422\u0432\u043e\u0433\u043e, / \u0441\u0432\u044f\u0442\u043e\u0433\u043e \u0445\u0440\u0430\u043c\u0443 \u0422\u0432\u043e\u0433\u043e. \u0421\u043f\u0430\u0441\u0438 \u000d\u000a\u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u043c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: / \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u043b\u0430\u0432\u0430, \u0456 \u043d\u0438\u043d\u0456: \u0404\u0434\u0438\u043d\u043e\u0440\u043e\u0434\u043d\u0438\u0439 \u0421\u0438\u043d\u0443:\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 3, \u0433\u043b\u0430\u0441 4\u000d\u000a\u0421\u0442\u0438\u0445 1: \u041d\u0430\u0439\u0431\u0430\u0433\u0430\u0442\u0448\u0456 \u0437 \u043d\u0430\u0440\u043e\u0434\u0456\u0432 \u043f\u043e\u043c\u043e\u043b\u044f\u0442\u044c\u0441\u044f \u043b\u0438\u0446\u044e \u0442\u0432\u043e\u0454\u043c\u0443.\u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440, \u0433\u043b\u0430\u0441 4: \u0421\u044c\u043e\u0433\u043e\u0434\u043d\u0456, \u0431\u043b\u0430\u0433\u043e\u0432\u043e\u043b\u0456\u043d\u043d\u044f \u0411\u043e\u0436\u043e\u0433\u043e \u043f\u0440\u043e\u0432\u0456\u0449\u0435\u043d\u043d\u044f \u0456 \u0441\u043f\u0430\u0441\u0456\u043d\u043d\u044f \u043b\u044e\u0434\u0435\u0439 \u043f\u0440\u043e\u043f\u043e\u0432\u0456\u0434\u0430\u043d\u043d\u044f, \u0443 \u0445\u0440\u0430\u043c\u0456 \u0411\u043e\u0436\u043e\u043c\u0443 \u044f\u0441\u043d\u043e \u000d\u000a\u0414\u0456\u0432\u0430 \u044f\u0432\u043b\u044f\u0454\u0442\u044c\u0441\u044f, \u0456 \u0425\u0440\u0438\u0441\u0442\u0430 \u0432\u0441\u0456\u043c \u043f\u0440\u043e\u0432\u0456\u0449\u0430\u0454; \u000d\u000a\u0407\u0439 \u0436\u0435 \u043c\u0438 \u0433\u043e\u043b\u043e\u0441\u043d\u043e \u0437\u0430\u0441\u043f\u0456\u0432\u0430\u0439\u043c\u043e: \u00ab\u0420\u0430\u0434\u0443\u0439\u0441\u044f, \u000d\u000a\u043f\u0440\u043e\u043c\u0438\u0441\u043b\u0443 \u0441\u0442\u0432\u043e\u0440\u0438\u0442\u0435\u043b\u044f \u0437\u0434\u0456\u0439\u0441\u043d\u0435\u043d\u043d\u044f\u00bb.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u0412\u0441\u044f \u0441\u043b\u0430\u0432\u0430 \u0434\u043e\u0447\u043a\u0438 \u0446\u0430\u0440\u044f \u0432 \u043d\u0456\u0439 \u0441\u0430\u043c\u0456\u0439, / \u043e\u0434\u0435\u0436\u0430 \u0457\u0457 \u0448\u0438\u0442\u0430 \u0437\u043e\u043b\u043e\u0442\u043e\u043c.\u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440: \u0421\u044c\u043e\u0433\u043e\u0434\u043d\u0456, \u0431\u043b\u0430\u0433\u043e\u0432\u043e\u043b\u0456\u043d\u043d\u044f \u0411\u043e\u0436\u043e\u0433\u043e \u043f\u0440\u043e\u0432\u0456\u0449\u0435\u043d\u043d\u044f:\u000d\u000a\u0421\u0442\u0438\u0445 3: \u0412 \u0434\u043e\u0440\u043e\u0433\u0438\u0445 \u043f\u0440\u0438\u043a\u0440\u0430\u0448\u0435\u043d\u0438\u0445 \u0440\u0438\u0437\u0430\u0445 \u0432\u0435\u0434\u0443\u0442\u044c \u0457\u0457 \u0434\u043e \u0426\u0430\u0440\u044f. / \u041f\u0440\u0438\u0432\u0435\u0434\u0435\u043d\u0456 \u0431\u0443\u0434\u0443\u0442\u044c \u0434\u0456\u0432\u0438 \u0432\u0441\u043b\u0456\u0434 \u0437\u0430 \u043d\u0435\u044e, \u043f\u043e\u0434\u0440\u0443\u0433\u0438 \u0457\u0457. \u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440: \u0421\u044c\u043e\u0433\u043e\u0434\u043d\u0456, \u0431\u043b\u0430\u0433\u043e\u0432\u043e\u043b\u0456\u043d\u043d\u044f \u0411\u043e\u0436\u043e\u0433\u043e \u043f\u0440\u043e\u0432\u0456\u0449\u0435\u043d\u043d\u044f:\u000d\u000a\u0421\u0442\u0438\u0445 4: \u041f\u0440\u0438\u0432\u0435\u0434\u0443\u0442\u044c \u0457\u0445 \u0437 \u043f\u0456\u0441\u043d\u044f\u043c\u0438 \u0440\u0430\u0434\u043e\u0441\u0442\u0456 / \u0456 \u0432\u0432\u0435\u0434\u0443\u0442\u044c \u0457\u0445 \u0443 \u043f\u0430\u043b\u0430\u0442\u0443 \u0426\u0430\u0440\u044f \u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440: \u0421\u044c\u043e\u0433\u043e\u0434\u043d\u0456, \u0431\u043b\u0430\u0433\u043e\u0432\u043e\u043b\u0456\u043d\u043d\u044f \u0411\u043e\u0436\u043e\u0433\u043e \u043f\u0440\u043e\u0432\u0456\u0449\u0435\u043d\u043d\u044f:\u000d\u000a\u041e\u0411\u0420\u0406\u0417\u0410\u041d\u041d\u042f \u0413\u041e\u0421\u041f\u041e\u0414\u041d\u0404 (1 \u0441\u0456\u0447\u043d\u044f)\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 1\u000d\u000a\u0421\u0442\u0438\u0445 1: \u0412\u0438\u043a\u043b\u0438\u043a\u043d\u0456\u0442\u044c \u0413\u043e\u0441\u043f\u043e\u0434\u0443, \u0432\u0441\u044f \u0437\u0435\u043c\u043b\u0435! / \u0421\u043f\u0456\u0432\u0430\u0439\u0442\u0435 \u0436 \u0456\u043c\u0435\u043d\u0456 \u0419\u043e\u0433\u043e, \u0432\u0456\u0434\u0434\u0430\u0439\u0442\u0435 \u000d\u000a\u0441\u043b\u0430\u0432\u0443 \u0443 \u0445\u0432\u0430\u043b\u0456 \u0419\u043e\u043c\u0443. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, / \u0421\u043f\u0430\u0441\u0435, \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u0421\u043f\u0456\u0432\u0430\u0439\u0442\u0435 \u0419\u043e\u043c\u0443 \u0456 \u0441\u043b\u0430\u0432\u0442\u0435 \u0419\u043e\u0433\u043e, \u000d\u000a/ \u0440\u043e\u0437\u043f\u043e\u0432\u0456\u0434\u0430\u0439\u0442\u0435 \u043f\u0440\u043e \u0432\u0441\u0456 \u0447\u0443\u0434\u0435\u0441\u0430 \u0419\u043e\u0433\u043e. \u000d\u000a\u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, / \u0421\u043f\u0430\u0441\u0435, \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 3: \u041f\u0440\u043e\u043c\u043e\u0432\u043b\u044f\u0439\u0442\u0435 \u0411\u043e\u0433\u043e\u0432\u0456: \u042f\u043a \u0432\u0435\u043b\u0438\u0447\u043d\u0456 \u0434\u0456\u043b\u0430 \u0422\u0432\u043e\u0457, / \u043f\u0435\u0440\u0435\u0434 \u043c\u043d\u043e\u0436\u0435\u0441\u0442\u0432\u043e\u043c \u000d\u000a\u0441\u0438\u043b\u0438 \u0422\u0432\u043e\u0454\u0457 \u0441\u043a\u043e\u0440\u044f\u0442\u044c\u0441\u044f \u0422\u043e\u0431\u0456 \u0432\u043e\u0440\u043e\u0433\u0438 \u0422\u0432\u043e\u0457. \u000d\u000a\u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, / \u0421\u043f\u0430\u0441\u0435, \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u043b\u0430\u0432\u0430, \u0456 \u043d\u0438\u043d\u0456: \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u000d\u000a/ \u0421\u043f\u0430\u0441\u0435, \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 2\u000d\u000a\u0421\u0442\u0438\u0445 1: \u041d\u0435\u0445\u0430\u0439 \u0432\u0435\u0441\u0435\u043b\u044f\u0442\u044c\u0441\u044f \u043d\u0435\u0431\u0435\u0441\u0430, / \u0456 \u000d\u000a\u0440\u0430\u0434\u0456\u0454 \u0437\u0435\u043c\u043b\u044f!\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u0449\u043e \u043f\u043b\u043e\u0442\u0442\u044e \u000d\u000a\u043e\u0431\u0440\u0456\u0437\u0430\u0432\u0441\u044f, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456. \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u041f\u0440\u043e\u0441\u043b\u0430\u0432\u043b\u044f\u0439\u0442\u0435 \u0413\u043e\u0441\u043f\u043e\u0434\u0430, / \u043f\u0440\u0438\u043a\u043b\u0438\u043a\u0430\u0439\u0442\u0435 \u0419\u043e\u0433\u043e \u0406\u043c\u2019\u044f.\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, /\u0449\u043e \u043f\u043b\u043e\u0442\u0442\u044e \u000d\u000a\u043e\u0431\u0440\u0456\u0437\u0430\u0432\u0441\u044f, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0442\u043e\u0431\u0456. \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 3: \u0412\u0456\u0434 \u0421\u0438\u043e\u043d\u0443 \u0432\u0435\u043b\u0438\u0447 / \u043a\u0440\u0430\u0441\u0438 \u0439\u043e\u0433\u043e.\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u0449\u043e \u043f\u043b\u043e\u0442\u0442\u044e \u000d\u000a\u043e\u0431\u0440\u0456\u0437\u0430\u0432\u0441\u044f, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456. \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 4: \u0411\u043e\u0433 \u043d\u0430\u0448 \u043d\u0430 \u043d\u0435\u0431\u0435\u0441\u0430\u0445 \u0456 \u043d\u0430 \u0437\u0435\u043c\u043b\u0456, \u000d\u000a/ \u0432\u0441\u0435, \u0449\u043e \u0437\u0430\u0445\u043e\u0442\u0456\u0432 \u0441\u0442\u0432\u043e\u0440\u0438\u0432.\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u0449\u043e \u043f\u043b\u043e\u0442\u0442\u044e \u000d\u000a\u043e\u0431\u0440\u0456\u0437\u0430\u0432\u0441\u044f, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456. \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u043b\u0430\u0432\u0430, \u0456 \u043d\u0438\u043d\u0456: \u0404\u0434\u0438\u043d\u043e\u0440\u043e\u0434\u043d\u0438\u0439 \u0421\u0438\u043d\u0443:\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 3\u000d\u000a\u0421\u0442\u0438\u0445 1: \u041c\u0438\u043b\u043e\u0441\u0442\u0456 \u0422\u0432\u043e\u0457, \u0413\u043e\u0441\u043f\u043e\u0434\u0438, \u043f\u043e\u0432\u0456\u043a\u0438 \u000d\u000a\u0441\u043f\u0456\u0432\u0430\u0442\u0438\u043c\u0443.\u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440, \u0433\u043b\u0430\u0441 1: \u041d\u0430 \u043f\u0440\u0435\u0441\u0442\u043e\u043b\u0456 \u0432\u043e\u0433\u043d\u0435\u0432\u0438\u0434\u0456\u043c, \u043d\u0430 \u043d\u0435\u0431\u0435\u0441\u0430\u0445 \u0441\u0438\u0434\u0438\u0448 \u0422\u0438 \u0437 \u041e\u0442\u0446\u0435\u043c \u000d\u000a\u0411\u0435\u0437\u043d\u0430\u0447\u0430\u043b\u044c\u043d\u0438\u043c \u0456 \u0411\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0438\u043c \u0422\u0432\u043e\u0457\u043c ","86\u000d\u000a\u0414\u0443\u0445\u043e\u043c, \u0431\u043b\u0430\u0433\u043e\u0437\u0432\u043e\u043b\u0438\u0432 \u0422\u0438 \u043d\u0430\u0440\u043e\u0434\u0438\u0442\u0438\u0441\u044f \u000d\u000a\u0432\u0456\u0434 \u0411\u043e\u0433\u043e\u043e\u0442\u0440\u043e\u043a\u043e\u0432\u0438\u0446\u0456, \u0431\u0435\u0437\u043d\u0435\u0432\u0456\u0441\u043d\u043e\u0457 \u0422\u0432\u043e\u0454\u0457 \u041c\u0430\u0442\u0435\u0440\u0456, \u0406\u0441\u0443\u0441\u0435; \u0442\u043e\u043c\u0443 \u0436 \u0456 \u043e\u0431\u0440\u0456\u0437\u0430\u043d\u0438\u0439 \u000d\u000a\u0431\u0443\u0432, \u044f\u043a \u043b\u044e\u0434\u0438\u043d\u0430 \u0432\u043e\u0441\u044c\u043c\u0438\u0434\u0435\u043d\u043d\u0430. \u0421\u043b\u0430\u0432\u0430 \u000d\u000a\u0432\u0441\u0435\u0431\u043b\u0430\u0433\u043e\u043c\u0443 \u0422\u0432\u043e\u0454\u043c\u0443 \u0437\u0432\u043e\u043b\u0435\u043d\u043d\u044e, \u0441\u043b\u0430\u0432\u0430 \u000d\u000a\u043f\u0440\u043e\u0432\u0438\u0434\u0456\u043d\u043d\u044e \u0422\u0432\u043e\u0454\u043c\u0443, \u0441\u043b\u0430\u0432\u0430 \u0441\u043c\u0438\u0440\u0435\u043d\u043d\u044e \u000d\u000a\u0422\u0432\u043e\u0454\u043c\u0443, \u0454\u0434\u0438\u043d\u0438\u0439 \u041b\u044e\u0434\u0438\u043d\u043e\u043b\u044e\u0431\u0447\u0435.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u0421\u043f\u043e\u0432\u0456\u0449\u0430\u0442\u0438\u043c\u0443 \u0456\u0441\u0442\u0438\u043d\u0443 \u0422\u0432\u043e\u044e \u000d\u000a\u0443\u0441\u0442\u0430\u043c\u0438 \u043c\u043e\u0457\u043c\u0438. \u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440: \u041d\u0430 \u043f\u0440\u0435\u0441\u0442\u043e\u043b\u0456 \u0432\u043e\u0433\u043d\u0435\u0432\u0438\u0434\u0456\u043c: \u000d\u000a\u0421\u0442\u0438\u0445 3: \u0422\u0438 \u043f\u043e\u043b\u044e\u0431\u0438\u0432 \u043f\u0440\u0430\u0432\u0435\u0434\u043d\u0456\u0441\u0442\u044c, \u0430 \u000d\u000a\u0431\u0435\u0437\u0437\u0430\u043a\u043e\u043d\u043d\u044f \u0437\u043d\u0435\u043d\u0430\u0432\u0438\u0434\u0456\u0432. \u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440: \u041d\u0430 \u043f\u0440\u0435\u0441\u0442\u043e\u043b\u0456 \u0432\u043e\u0433\u043d\u0435\u0432\u0438\u0434\u0456\u043c: \u000d\u000a\u0412\u0445\u0456\u0434\u043d\u0435: \u041f\u0440\u0438\u0439\u0434\u0456\u0442\u0435 \u043f\u043e\u043a\u043b\u043e\u043d\u0456\u043c\u043e\u0441\u044c, \u0456 \u043f\u0440\u0438\u043f\u0430\u0434\u0456\u043c \u0434\u043e \u0425\u0440\u0438\u0441\u0442\u0430. \u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, \u0449\u043e \u043f\u043b\u043e\u0442\u0442\u044e \u043e\u0431\u0440\u0456\u0437\u0430\u0432\u0441\u044f, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u000d\u000a\u0422\u043e\u0431\u0456. \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0422\u0420\u0406\u0422\u0415\u041d\u041d\u042f \u0413\u041e\u0421\u041f\u041e\u0414\u041d\u0404 (2 \u043b\u044e\u0442\u043e\u0433\u043e)\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 1\u000d\u000a\u0421\u0442\u0438\u0445 1: \u0412\u0438\u043b\u0438\u043b\u043e \u0441\u0435\u0440\u0446\u0435 \u043c\u043e\u0454 / \u0441\u043b\u043e\u0432\u043e \u000d\u000a\u0431\u043b\u0430\u0433\u0435. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, / \u0421\u043f\u0430\u0441\u0435, \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u042f\u0437\u0438\u043a \u043c\u0456\u0439 \u2013 / \u043c\u043e\u0432 \u043f\u0435\u0440\u043e \u043a\u043d\u0438\u0436\u043d\u0438\u043a\u0430-\u0441\u043a\u043e\u0440\u043e\u043f\u0438\u0441\u0446\u044f. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, / \u0421\u043f\u0430\u0441\u0435, \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 3: \u0412\u0438\u043b\u0438\u0432\u0430\u0454\u0442\u044c\u0441\u044f \u0431\u043b\u0430\u0433\u043e\u0434\u0430\u0442\u044c / \u0456\u0437 \u000d\u000a\u0443\u0441\u0442 \u0422\u0432\u043e\u0457\u0445. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, / \u000d\u000a\u0421\u043f\u0430\u0441\u0435, \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 4: \u0422\u043e\u043c\u0443 \u0431\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0438\u0432 \u0422\u0435\u0431\u0435 / \u0411\u043e\u0433 \u000d\u000a\u043d\u0430\u0432\u0456\u043a\u0438. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, / \u0421\u043f\u0430\u0441\u0435, \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u043b\u0430\u0432\u0430, \u0456 \u043d\u0438\u043d\u0456: \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u000d\u000a\u0421\u043f\u0430\u0441\u0435, / \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 2\u000d\u000a\u0421\u0442\u0438\u0445 1: \u041f\u0440\u0438\u0432\u2019\u044f\u0436\u0438 \u043c\u0435\u0447 \u0422\u0432\u0456\u0439 / \u0434\u043e \u0441\u0442\u0435\u0433\u043d\u0430 \u000d\u000a\u0422\u0432\u043e\u0433\u043e, \u0421\u0438\u043b\u044c\u043d\u0438\u0439.\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u0449\u043e \u043d\u0430 \u0440\u0443\u043a\u0430\u0445 \u000d\u000a\u043f\u0440\u0430\u0432\u0435\u0434\u043d\u043e\u0433\u043e \u0421\u0438\u043c\u0435\u043e\u043d\u0430 c\u043f\u043e\u0447\u0438\u0432\u0430\u0442\u0438 \u0437\u0432\u043e\u043b\u0438\u0432, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: \u0430\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u0406 \u043d\u0430\u0442\u044f\u0433\u043d\u0438 \u043b\u0443\u043a, \u0456 \u0432\u0441\u0442\u0438\u0433\u0430\u0439, / \u0456 \u0446\u0430\u0440\u044e\u0439 \u0437\u0430\u0440\u0430\u0434\u0438 \u0456\u0441\u0442\u0438\u043d\u0438.\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u0449\u043e \u043d\u0430 \u0440\u0443\u043a\u0430\u0445 \u000d\u000a\u043f\u0440\u0430\u0432\u0435\u0434\u043d\u043e\u0433\u043e \u0421\u0438\u043c\u0435\u043e\u043d\u0430 c\u043f\u043e\u0447\u0438\u0432\u0430\u0442\u0438 \u0437\u0432\u043e\u043b\u0438\u0432, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: \u0430\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 3: \u0413\u043e\u0441\u0442\u0440\u0456 \u0441\u0442\u0440\u0456\u043b\u0438 \u0422\u0432\u043e\u0457, \u0421\u0438\u043b\u044c\u043d\u0438\u0439! / \u000d\u000a\u0412\u043f\u0430\u0434\u0443\u0442\u044c \u043d\u0430\u0440\u043e\u0434\u0438 \u043f\u0435\u0440\u0435\u0434 \u0422\u043e\u0431\u043e\u044e. \u0421\u043f\u0430\u0441\u0438 \u000d\u000a\u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u0449\u043e \u043d\u0430 \u0440\u0443\u043a\u0430\u0445 \u043f\u0440\u0430\u0432\u0435\u0434\u043d\u043e\u0433\u043e \u0421\u0438\u043c\u0435\u043e\u043d\u0430 c\u043f\u043e\u0447\u0438\u0432\u0430\u0442\u0438 \u0437\u0432\u043e\u043b\u0438\u0432, \u000d\u000a\u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: \u0430\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 4: \u0416\u0435\u0437\u043b \u043f\u0440\u0430\u0432\u043e\u0442\u0438 \u2013 / \u0436\u0435\u0437\u043b \u0426\u0430\u0440\u0441\u0442\u0432\u0430 \u0422\u0432\u043e\u0433\u043e.\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u0449\u043e \u043d\u0430 \u0440\u0443\u043a\u0430\u0445 \u000d\u000a\u043f\u0440\u0430\u0432\u0435\u0434\u043d\u043e\u0433\u043e \u0421\u0438\u043c\u0435\u043e\u043d\u0430 c\u043f\u043e\u0447\u0438\u0432\u0430\u0442\u0438 \u0437\u0432\u043e\u043b\u0438\u0432, / \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: \u0430\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u043b\u0430\u0432\u0430, \u0456 \u043d\u0438\u043d\u0456: \u0404\u0434\u0438\u043d\u043e\u0440\u043e\u0434\u043d\u0438\u0439 \u0421\u0438\u043d\u0443:\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 3, \u0433\u043b\u0430\u0441 1\u000d\u000a\u0421\u0442\u0438\u0445 1: \u0421\u043b\u0443\u0445\u0430\u0439, \u0414\u043e\u0447\u043a\u043e, \u0456 \u0441\u043f\u043e\u0433\u043b\u044f\u043d\u044c,/ \u0456 \u000d\u000a\u043f\u0440\u0438\u0445\u0438\u043b\u0438 \u0432\u0443\u0445\u043e \u0422\u0432\u043e\u0454.\u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440, \u0433\u043b\u0430\u0441 1: \u0420\u0430\u0434\u0443\u0439\u0441\u044f, \u0411\u043b\u0430\u0433\u043e\u0434\u0430\u0442\u043d\u0430 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0435 \u0414\u0456\u0432\u043e, \u0431\u043e \u0437 \u0422\u0435\u0431\u0435 \u0437\u0430\u0441\u044f\u044f\u043b\u043e \u000d\u000a\u0421\u043e\u043d\u0446\u0435 \u043f\u0440\u0430\u0432\u0434\u0438 \u2013 \u0425\u0440\u0438\u0441\u0442\u043e\u0441 \u0411\u043e\u0433 \u043d\u0430\u0448, \u0449\u043e \u000d\u000a\u043f\u0440\u043e\u0441\u0432\u0456\u0447\u0443\u0454 \u0442\u0438\u0445, \u0449\u043e \u0432 \u0442\u0435\u043c\u0440\u044f\u0432\u0456. \u0412\u0435\u0441\u0435\u043b\u0438\u0441\u044f \u000d\u000a\u0456 \u0442\u0438, \u0441\u0442\u0430\u0440\u0447\u0435 \u043f\u0440\u0430\u0432\u0435\u0434\u043d\u0438\u0439, \u0449\u043e \u043f\u0440\u0438\u0439\u043d\u044f\u0432 \u0432 \u000d\u000a\u043e\u0431\u0456\u0439\u043c\u0438 \u0412\u0438\u0437\u0432\u043e\u043b\u0438\u0442\u0435\u043b\u044f \u0434\u0443\u0448 \u043d\u0430\u0448\u0438\u0445, \u042f\u043a\u0438\u0439 \u000d\u000a\u0434\u0430\u0440\u0443\u0454 \u043d\u0430\u043c \u0432\u043e\u0441\u043a\u0440\u0435\u0441\u0456\u043d\u043d\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u041d\u0430\u0439\u0431\u0430\u0433\u0430\u0442\u0448\u0456 \u0437 \u043d\u0430\u0440\u043e\u0434\u0456\u0432 \u043f\u043e\u043c\u043e\u043b\u044f\u0442\u044c\u0441\u044f \u043b\u0438\u0446\u044e \u0442\u0432\u043e\u0454\u043c\u0443.\u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440: \u0420\u0430\u0434\u0443\u0439\u0441\u044f, \u0411\u043b\u0430\u0433\u043e\u0434\u0430\u0442\u043d\u0430 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0435 \u0414\u0456\u0432\u043e:\u000d\u000a\u0421\u0442\u0438\u0445 3: \u041f\u043e\u043c'\u044f\u043d\u0443 \u0456\u043c'\u044f \u0422\u0432\u043e\u0454 / \u0443 \u0432\u0441\u044f\u043a\u043e\u043c\u0443 \u000d\u000a\u0440\u043e\u0434\u0456 \u0456 \u0440\u043e\u0434\u0456.\u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440: \u0420\u0430\u0434\u0443\u0439\u0441\u044f, \u0411\u043b\u0430\u0433\u043e\u0434\u0430\u0442\u043d\u0430 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0435 \u0414\u0456\u0432\u043e:\u000d\u000a\u0412\u0445\u0456\u0434\u043d\u0438\u0439 \u0441\u0442\u0438\u0445: \u042f\u0432\u0438\u0432 \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u0441\u043f\u0430\u0441\u0456\u043d\u043d\u044f \u0421\u0432\u043e\u0454, / \u043f\u0435\u0440\u0435\u0434 \u043d\u0430\u0440\u043e\u0434\u0430\u043c\u0438 \u0432\u0456\u0434\u043a\u0440\u0438\u0432 \u000d\u000a\u043f\u0440\u0430\u0432\u0434\u0443 \u0421\u0432\u043e\u044e.","87\u000d\u000a\u041d\u0415\u0414\u0406\u041b\u042f \u0422\u041e\u0420\u0416\u0415\u0421\u0422\u0412\u0410 \u041f\u0420\u0410\u0412\u041e\u0421\u041b\u0410\u0412\u2019\u042f\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 1\u000d\u000a\u0421\u0442\u0438\u0445 1: \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u0432\u043e\u0446\u0430\u0440\u0438\u0432\u0441\u044f, / \u0443 \u043a\u0440\u0430\u0441\u0443 \u000d\u000a\u0437\u043e\u0434\u044f\u0433\u043d\u0443\u0432\u0441\u044f. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, / \u000d\u000a\u0421\u043f\u0430\u0441\u0435 \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u0411\u043e \u0412\u0456\u043d \u0443\u0442\u0432\u0435\u0440\u0434\u0438\u0432 \u0432\u0441\u0435\u043b\u0435\u043d\u043d\u0443 / \u0456 \u000d\u000a\u043d\u0435 \u043f\u043e\u0445\u0438\u0442\u043d\u0435\u0442\u044c\u0441\u044f \u0432\u043e\u043d\u0430. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, / \u0421\u043f\u0430\u0441\u0435 \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 3: \u0425\u0442\u043e \u0432\u0438\u0441\u043b\u043e\u0432\u0438\u0442\u044c \u043c\u043e\u0433\u0443\u0442\u043d\u0456\u0441\u0442\u044c \u0413\u043e\u0441\u043f\u043e\u0434\u0430, / \u0437\u0432\u0456\u0441\u0442\u0438\u0442\u044c \u0443\u0441\u0456 \u0445\u0432\u0430\u043b\u0438 \u0419\u043e\u0433\u043e. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, / \u0421\u043f\u0430\u0441\u0435 \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 4: \u0422\u0430\u043a \u043d\u0435\u0445\u0430\u0439 \u0441\u043a\u0430\u0436\u0443\u0442\u044c \u0432\u0438\u0437\u0432\u043e\u043b\u0435\u043d\u0456 \u0413\u043e\u0441\u043f\u043e\u0434\u043e\u043c, / \u044f\u043a\u0438\u0445 \u0412\u0456\u043d \u0432\u0438\u0437\u0432\u043e\u043b\u0438\u0432 \u0456\u0437 \u000d\u000a\u0440\u0443\u043a\u0438 \u0432\u043e\u0440\u043e\u0433\u0430. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u000d\u000a/ \u0421\u043f\u0430\u0441\u0435 \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u043b\u0430\u0432\u0430, \u0456 \u043d\u0438\u043d\u0456. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u000d\u000a/ \u0421\u043f\u0430\u0441\u0435 \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 2\u000d\u000a\u0421\u0442\u0438\u0445 1: \u041d\u0435\u0445\u0430\u0439 \u0436\u0435 \u043f\u0440\u043e\u0441\u043b\u0430\u0432\u043b\u044f\u044e\u0442\u044c \u0413\u043e\u0441\u043f\u043e\u0434\u0430 \u0437\u0430 \u043c\u0438\u043b\u0456\u0441\u0442\u044c \u0419\u043e\u0433\u043e, / \u0456 \u0437\u0430 \u0434\u0438\u0432\u043d\u0456 \u0434\u0456\u043b\u0430 \u000d\u000a\u0419\u043e\u0433\u043e \u0434\u043b\u044f \u0441\u0438\u043d\u0456\u0432 \u043b\u044e\u0434\u0441\u044c\u043a\u0438\u0445. \u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u000d\u000a\u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u0449\u043e \u0432\u043e\u0441\u043a\u0440\u0435\u0441 \u0456\u0437 \u043c\u0435\u0440\u0442\u0432\u0438\u0445 \u000d\u000a\u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456. \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u041d\u0435\u0445\u0430\u0439 \u0432\u0438\u0445\u0432\u0430\u043b\u044f\u044e\u0442\u044c \u0419\u043e\u0433\u043e \u0432 \u0437\u0456\u0431\u0440\u0430\u043d\u043d\u0456 \u043b\u044e\u0434\u0435\u0439 / \u0456 \u043f\u0440\u043e\u0441\u043b\u0430\u0432\u043b\u044f\u044e\u0442\u044c \u0419\u043e\u0433\u043e \u000d\u000a\u043d\u0430 \u0437\u0431\u043e\u0440\u0430\u0445 \u0441\u0442\u0430\u0440\u0456\u0439\u0448\u0438\u043d. \u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u000d\u000a\u0411\u043e\u0436\u0438\u0439, / \u0449\u043e \u0432\u043e\u0441\u043a\u0440\u0435\u0441 \u0456\u0437 \u043c\u0435\u0440\u0442\u0432\u0438\u0445, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456. \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 3: \u0411\u043e \u043e\u0441\u044c \u043e\u0447\u0456 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0456 \u043d\u0430 \u0442\u0438\u0445, / \u000d\u000a\u0449\u043e \u043d\u0430\u0434\u0456\u044e\u0442\u044c\u0441\u044f \u043d\u0430 \u043c\u0438\u043b\u0456\u0441\u0442\u044c \u0419\u043e\u0433\u043e. \u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u0449\u043e \u0432\u043e\u0441\u043a\u0440\u0435\u0441 \u0456\u0437 \u000d\u000a\u043c\u0435\u0440\u0442\u0432\u0438\u0445, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456. \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 4: \u0429\u043e\u0431 \u043f\u043e\u0447\u0443\u0442\u0438 \u0441\u0442\u043e\u0433\u0456\u043d \u0443\u0432\u2019\u044f\u0437\u043d\u0435\u043d\u0438\u0445, / \u000d\u000a\u0437\u0432\u0456\u043b\u044c\u043d\u0438\u0442\u0438 \u0441\u0438\u043d\u0456\u0432, \u043d\u0430 \u0441\u043c\u0435\u0440\u0442\u044c \u0437\u0430\u0441\u0443\u0434\u0436\u0435\u043d\u0438\u0445. \u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u0449\u043e \u0432\u043e\u0441\u043a\u0440\u0435\u0441 \u0456\u0437 \u000d\u000a\u043c\u0435\u0440\u0442\u0432\u0438\u0445, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456. \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u043b\u0430\u0432\u0430, \u0456 \u043d\u0438\u043d\u0456. \u0404\u0434\u0438\u043d\u043e\u0440\u043e\u0434\u043d\u0438\u0439 \u0421\u0438\u043d\u0443:\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 3\u000d\u000a\u0421\u0442\u0438\u0445 1: \u041d\u0435\u0445\u0430\u0439 \u0445\u0432\u0430\u043b\u044f\u0442\u044c \u0419\u043e\u0433\u043e \u043d\u0435\u0431\u0435\u0441\u0430 \u0456 \u000d\u000a\u0437\u0435\u043c\u043b\u044f.\u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440, \u0433\u043b\u0430\u0441 2: \u041f\u0440\u0435\u0447\u0438\u0441\u0442\u043e\u043c\u0443 \u0422\u0432\u043e\u0454\u043c\u0443 \u000d\u000a\u043e\u0431\u0440\u0430\u0437\u0443 \u043f\u043e\u043a\u043b\u043e\u043d\u044f\u0454\u043c\u043e\u0441\u044f, \u0411\u043b\u0430\u0433\u0438\u0439, \u0431\u043b\u0430\u0433\u0430\u044e\u0447\u0438 \u043f\u0440\u043e\u0449\u0435\u043d\u043d\u044f \u043f\u0440\u043e\u0432\u0438\u043d \u043d\u0430\u0448\u0438\u0445, \u0425\u0440\u0438\u0441\u0442\u0435 \u000d\u000a\u0411\u043e\u0436\u0435; \u0422\u0438 \u0431\u043e \u0437 \u0432\u043e\u043b\u0456 \u0421\u0432\u043e\u0454\u0457 \u0437\u0456\u0439\u0448\u043e\u0432 \u0442\u0456\u043b\u043e\u043c \u000d\u000a\u043d\u0430 \u0445\u0440\u0435\u0441\u0442, \u0449\u043e\u0431 \u0432\u0438\u0437\u0432\u043e\u043b\u0438\u0442\u0438 \u0441\u0442\u0432\u043e\u0440\u0435\u043d\u0438\u0445 \u000d\u000a\u0422\u043e\u0431\u043e\u044e \u0437 \u043d\u0435\u0432\u043e\u043b\u0456 \u0432\u043e\u0440\u043e\u0436\u043e\u0457; \u0442\u043e\u043c\u0443 \u0432\u0434\u044f\u0447\u043d\u043e \u000d\u000a\u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e: \u0422\u0438 \u0440\u0430\u0434\u0456\u0441\u0442\u044e \u043d\u0430\u043f\u043e\u0432\u043d\u0438\u0432 \u0443\u0441\u0435, \u000d\u000a\u0421\u043f\u0430\u0441\u0435 \u043d\u0430\u0448, \u043f\u0440\u0438\u0439\u0448\u043e\u0432\u0448\u0438 \u0441\u043f\u0430\u0441\u0442\u0438 \u0441\u0432\u0456\u0442.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u0420\u0430\u0434\u0456\u0439\u043c\u043e \u0456 \u0432\u0435\u0441\u0435\u043b\u0456\u043c\u043e\u0441\u044c \u0432 \u043d\u0456\u043c. \u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440: \u041f\u0440\u0435\u0447\u0438\u0441\u0442\u043e\u043c\u0443 \u0422\u0432\u043e\u0454\u043c\u0443 \u043e\u0431\u0440\u0430\u0437\u0443\u2026\u000d\u000a\u0421\u0442\u0438\u0445 3: \u0411\u0443\u0434\u0443 \u0432\u0438\u0445\u0432\u0430\u043b\u044f\u0442\u0438 \u0422\u0435\u0431\u0435, \u0413\u043e\u0441\u043f\u043e\u0434\u0438 \u0411\u043e\u0436\u0435 \u043c\u0456\u0439.\u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440: \u041f\u0440\u0435\u0447\u0438\u0441\u0442\u043e\u043c\u0443 \u0422\u0432\u043e\u0454\u043c\u0443 \u043e\u0431\u0440\u0430\u0437\u0443\u2026\u000d\u000a\u041d\u0415\u0414\u0406\u041b\u042f 3 \u0412\u0415\u041b\u0418\u041a\u041e\u0413\u041e \u041f\u041e\u0421\u0422\u0423 \u000d\u000a\u0425\u0420\u0415\u0421\u0422\u041e\u041f\u041e\u041a\u041b\u0406\u041d\u041d\u0410\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 1\u000d\u000a\u0421\u0442\u0438\u0445 1: \u0422\u0438 \u044f\u0432\u0438\u0432 \u043d\u0430\u043c / \u0441\u0432\u0456\u0442\u043b\u043e \u043b\u0438\u0446\u044f \u0422\u0432\u043e\u0433\u043e, \u0413\u043e\u0441\u043f\u043e\u0434\u0438. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, / \u000d\u000a\u0421\u043f\u0430\u0441\u0435 \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u0414\u0430\u0439 \u0436\u0435 \u0437\u043d\u0430\u043c\u0435\u043d\u043d\u044f \u0442\u0438\u043c, \u0449\u043e \u0431\u043e\u044f\u0442\u044c\u0441\u044f \u0422\u0435\u0431\u0435, / \u0449\u043e\u0431 \u0432\u043e\u043d\u0438 \u043c\u043e\u0433\u043b\u0438 \u0432\u0442\u0435\u043a\u0442\u0438 \u000d\u000a\u0432\u0456\u0434 \u0441\u0442\u0440\u0456\u043b\u0438 \u0432\u043e\u0440\u043e\u0436\u043e\u0457. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, / \u0421\u043f\u0430\u0441\u0435 \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 3: \u0422\u0438 \u0437\u0456\u0439\u0448\u043e\u0432 \u043d\u0430 \u0432\u0438\u0441\u043e\u0442\u0443, / \u043f\u043e\u043b\u043e\u043d\u0438\u0432 \u043f\u043e\u043b\u043e\u043d. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, / \u000d\u000a\u0421\u043f\u0430\u0441\u0435 \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 4: \u0414\u0430\u0432 \u043c\u0435\u043d\u0456 \u043d\u0430\u0441\u043b\u0456\u0434\u0434\u044f \u0437 \u0442\u0438\u043c\u0438, / \u000d\u000a\u0449\u043e \u0431\u043e\u044f\u0442\u044c\u0441\u044f \u0456\u043c\u0435\u043d\u0456 \u0422\u0432\u043e\u0433\u043e. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, / \u0421\u043f\u0430\u0441\u0435 \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u043b\u0430\u0432\u0430, \u0456 \u043d\u0438\u043d\u0456: \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u000d\u000a/ \u0421\u043f\u0430\u0441\u0435 \u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 2\u000d\u000a\u0421\u0442\u0438\u0445 1: \u041f\u043e\u0431\u0430\u0447\u0438\u043b\u0438 \u0432\u0441\u0456 \u043a\u0456\u043d\u0446\u0456 \u0437\u0435\u043c\u043b\u0456 / \u0441\u043f\u0430\u0441\u0456\u043d\u043d\u044f \u0411\u043e\u0433\u0430 \u043d\u0430\u0448\u043e\u0433\u043e.\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441. \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u0449\u043e \u0432\u043e\u0441\u043a\u0440\u0435\u0441 \u000d\u000a\u0456\u0437 \u043c\u0435\u0440\u0442\u0432\u0438\u0445, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456. \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u041f\u043e\u043a\u043b\u043e\u043d\u0456\u043c\u043e\u0441\u044f / \u043f\u0456\u0434\u043d\u0456\u0436\u0436\u044e \u043d\u0456\u0433 \u000d\u000a\u0419\u043e\u0433\u043e.","88\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u0449\u043e \u0432\u043e\u0441\u043a\u0440\u0435\u0441 \u000d\u000a\u0456\u0437 \u043c\u0435\u0440\u0442\u0432\u0438\u0445, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456. \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 3: \u0411\u043e\u0433 \u0436\u0435, \u0426\u0430\u0440 \u043d\u0430\u0448, / \u0440\u0430\u043d\u0456\u0448\u0435 \u0432\u0456\u043a\u0456\u0432 \u0443\u0447\u0438\u043d\u0438\u0432 \u0441\u043f\u0430\u0441\u0456\u043d\u043d\u044f \u043f\u043e\u0441\u0435\u0440\u0435\u0434 \u0437\u0435\u043c\u043b\u0456. \u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u0449\u043e \u0432\u043e\u0441\u043a\u0440\u0435\u0441 \u000d\u000a\u0456\u0437 \u043c\u0435\u0440\u0442\u0432\u0438\u0445, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456. \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 4: \u041f\u0456\u0434\u043d\u0435\u0441\u0443\u0441\u044f \u043c\u0456\u0436 \u043d\u0430\u0440\u043e\u0434\u0430\u043c\u0438 / \u0456 \u000d\u000a\u043f\u0440\u043e\u0441\u043b\u0430\u0432\u043b\u044e\u0441\u044f \u043d\u0430 \u0437\u0435\u043c\u043b\u0456.\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u0449\u043e \u0432\u043e\u0441\u043a\u0440\u0435\u0441 \u000d\u000a\u0456\u0437 \u043c\u0435\u0440\u0442\u0432\u0438\u0445, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456. \u0410\u043b\u0438\u043b\u0443\u044f. \u000d\u000a\u0421\u043b\u0430\u0432\u0430, \u0456 \u043d\u0438\u043d\u0456: \u0404\u0434\u0438\u043d\u043e\u0440\u043e\u0434\u043d\u0438\u0439 \u0421\u0438\u043d\u0443:\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 3\u000d\u000a\u0421\u0442\u0438\u0445 1: \u0412\u043e\u0437\u043d\u043e\u0441\u044c\u0442\u0435 \u0413\u043e\u0441\u043f\u043e\u0434\u0430 \u0411\u043e\u0433\u0430 \u043d\u0430\u0448\u043e\u0433\u043e \u0456 \u043f\u043e\u043a\u043b\u043e\u043d\u044f\u0439\u0442\u0435\u0441\u044f \u043f\u0456\u0434\u043d\u0456\u0436\u0436\u044e \u043d\u0456\u0433 \u000d\u000a\u0419\u043e\u0433\u043e, \u0431\u043e \u0412\u0456\u043d \u0441\u0432\u044f\u0442\u0438\u0439.\u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440, \u0433\u043b\u0430\u0441 1: \u0421\u043f\u0430\u0441\u0438, \u0413\u043e\u0441\u043f\u043e\u0434\u0438, \u043b\u044e\u0434\u0435\u0439 \u0422\u0432\u043e\u0457\u0445 \u0456 \u0431\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0438 \u043d\u0430\u0441\u043b\u0456\u0434\u0434\u044f \u0422\u0432\u043e\u0454, \u000d\u000a\u043f\u0435\u0440\u0435\u043c\u043e\u0433\u0443 \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u0438\u043c \u0445\u0440\u0438\u0441\u0442\u0438\u044f\u043d\u0430\u043c \u000d\u000a\u043d\u0430\u0434 \u0441\u0443\u043f\u0440\u043e\u0442\u0438\u0432\u043d\u0438\u043a\u0430\u043c\u0438 \u043f\u043e\u0434\u0430\u0439 \u0456 \u0425\u0440\u0435\u0441\u0442\u043e\u043c \u000d\u000a\u0422\u0432\u043e\u0457\u043c \u043e\u0445\u043e\u0440\u043e\u043d\u044f\u0439 \u043d\u0430\u0441, \u0433\u0440\u043e\u043c\u0430\u0434\u0443 \u0422\u0432\u043e\u044e.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u0421\u043f\u0430\u0441\u0438, \u0413\u043e\u0441\u043f\u043e\u0434\u0438, \u043b\u044e\u0434\u0435\u0439 \u0422\u0432\u043e\u0457\u0445 \u000d\u000a\u0456 \u0431\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0438 \u043d\u0430\u0441\u043b\u0456\u0434\u0434\u044f \u0422\u0432\u043e\u0454.\u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440, \u0433\u043b\u0430\u0441 1: \u0421\u043f\u0430\u0441\u0438, \u0413\u043e\u0441\u043f\u043e\u0434\u0438, \u043b\u044e\u0434\u0435\u0439 \u0422\u0432\u043e\u0457\u0445:\u000d\u000a\u0421\u0442\u0438\u0445 3: \u041f\u0430\u0441\u0438 \u0457\u0445 \u0456 \u043f\u0456\u0434\u043d\u043e\u0441\u044c \u0457\u0445 \u043f\u043e\u0432\u0456\u043a\u0438.\u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440, \u0433\u043b\u0430\u0441 1: \u0421\u043f\u0430\u0441\u0438, \u0413\u043e\u0441\u043f\u043e\u0434\u0438, \u043b\u044e\u0434\u0435\u0439 \u0422\u0432\u043e\u0457\u0445:\u000d\u000a\u0411\u041b\u0410\u0413\u041e\u0412\u0406\u0429\u0415\u041d\u041d\u042f \u041f\u0420\u0415\u0421\u0412\u042f\u0422\u041e\u0407 \u000d\u000a\u0411\u041e\u0413\u041e\u0420\u041e\u0414\u0418\u0426\u0406\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 1\u000d\u000a\u0421\u0442\u0438\u0445 1: \u0411\u043e\u0436\u0435, \u0441\u0443\u0434 \u0422\u0432\u0456\u0439 \u0446\u0430\u0440\u0435\u0432\u0456 \u0434\u0430\u0439 / \u0456 \u000d\u000a\u0441\u0438\u043d\u043e\u0432\u0456 \u0446\u0430\u0440\u044f \u2013 \u0441\u043f\u0440\u0430\u0432\u0435\u0434\u043b\u0438\u0432\u0456\u0441\u0442\u044c \u0422\u0432\u043e\u044e. \u000d\u000a\u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0421\u043f\u0430\u0441\u0435, / \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u0429\u043e\u0431 \u0433\u043e\u0440\u0438 \u043f\u0440\u0438\u043d\u0435\u0441\u043b\u0438 \u043c\u0438\u0440 \u043b\u044e\u0434\u044f\u043c, / \u0456 \u043f\u0430\u0433\u043e\u0440\u0431\u0438 \u2013 \u043f\u0440\u0430\u0432\u0434\u0443.\u000d\u000a\u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0421\u043f\u0430\u0441\u0435, / \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 3: \u0411\u043b\u0430\u0433\u043e\u0432\u0456\u0441\u0442\u0456\u0442\u044c \u0434\u0435\u043d\u044c \u0443 \u0434\u0435\u043d\u044c \u043f\u0440\u043e \u000d\u000a\u0441\u043f\u0430\u0441\u0456\u043d\u043d\u044f \u0419\u043e\u0433\u043e. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0421\u043f\u0430\u0441\u0435, / \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 4: \u041a\u043b\u044f\u0432\u0441\u044f \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u0414\u0430\u0432\u0438\u0434\u0443 \u0432\u0456\u0440\u043d\u0456\u0441\u0442\u044e / \u0456 \u043d\u0435 \u0437\u0440\u0435\u0447\u0435\u0442\u044c\u0441\u044f \u0457\u0457.\u000d\u000a\u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0421\u043f\u0430\u0441\u0435, / \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u043b\u0430\u0432\u0430, \u0456 \u043d\u0438\u043d\u0456: \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u000d\u000a\u0421\u043f\u0430\u0441\u0435, / \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 2\u000d\u000a\u0421\u0442\u0438\u0445 1: \u0412\u0456\u043d \u0437\u0456\u0439\u0434\u0435, \u044f\u043a \u0434\u043e\u0449 \u043d\u0430 \u0442\u0440\u0430\u0432\u0443, / \u0456 \u000d\u000a\u044f\u043a \u0440\u043e\u0441\u0430, \u0449\u043e \u043f\u0430\u0434\u0430\u0454 \u043d\u0430 \u0437\u0435\u043c\u043b\u044e.\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u0449\u043e \u0437\u0430\u0440\u0430\u0434\u0438 \u000d\u000a\u043d\u0430\u0441 \u0442\u0456\u043b\u043e \u043f\u0440\u0438\u0439\u043d\u044f\u0432, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: \u0430\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u041f\u043e\u0442\u043e\u043a\u0438 \u0440\u0456\u043a \u0432\u0435\u0441\u0435\u043b\u044f\u0442\u044c \u043c\u0456\u0441\u0442\u043e \u000d\u000a\u0411\u043e\u0436\u0435, / \u0441\u0432\u044f\u0442\u0443 \u043e\u0441\u0435\u043b\u044e \u0412\u0441\u0435\u0432\u0438\u0448\u043d\u044c\u043e\u0433\u043e. \u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u0449\u043e \u0437\u0430\u0440\u0430\u0434\u0438 \u000d\u000a\u043d\u0430\u0441 \u0442\u0456\u043b\u043e \u043f\u0440\u0438\u0439\u043d\u044f\u0432, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: \u0430\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 3: \u0413\u0440\u044f\u0434\u0435 \u0411\u043e\u0433 \u043d\u0430\u0448 \u2013 / \u0456 \u043d\u0435 \u043c\u043e\u0432\u0447\u0438\u0442\u044c. \u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u0449\u043e \u0437\u0430\u0440\u0430\u0434\u0438 \u043d\u0430\u0441 \u0442\u0456\u043b\u043e \u043f\u0440\u0438\u0439\u043d\u044f\u0432, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: \u000d\u000a\u0430\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 4: \u0423 \u0447\u0430\u0441\u0438 \u0434\u043d\u0456\u0432 \u0439\u043e\u0433\u043e \u0437\u0430\u0441\u044f\u0454 \u043f\u0440\u0430\u0432\u0434\u0430 \u000d\u000a/ \u0456 \u0431\u0443\u0434\u0435 \u0432\u0435\u043b\u0438\u043a\u0438\u0439 \u043c\u0438\u0440.\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u0449\u043e \u0437\u0430\u0440\u0430\u0434\u0438 \u000d\u000a\u043d\u0430\u0441 \u0442\u0456\u043b\u043e \u043f\u0440\u0438\u0439\u043d\u044f\u0432, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: \u0430\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u043b\u0430\u0432\u0430, \u0456 \u043d\u0438\u043d\u0456: \u0404\u0434\u0438\u043d\u043e\u0440\u043e\u0434\u043d\u0438\u0439 \u0421\u0438\u043d\u0443:\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 3\u000d\u000a\u0421\u0442\u0438\u0445 1: \u041d\u0435\u0445\u0430\u0439 \u0431\u0443\u0434\u0435 \u0456\u043c'\u044f \u0419\u043e\u0433\u043e \u0431\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0435\u043d\u043d\u0435 \u043d\u0430\u0432\u0456\u043a\u0438.\u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440, \u0433\u043b\u0430\u0441 4: \u0421\u044c\u043e\u0433\u043e\u0434\u043d\u0456 \u0441\u043f\u0430\u0441\u0456\u043d\u043d\u044f \u000d\u000a\u043d\u0430\u0448\u043e\u0433\u043e \u043f\u043e\u0447\u0430\u0442\u043e\u043a \u0456 \u0432\u0456\u0434 \u0432\u0456\u043a\u0443 \u0442\u0430\u0457\u043d\u0441\u0442\u0432\u0430 \u044f\u0432\u043b\u0435\u043d\u043d\u044f: \u0421\u0438\u043d \u0411\u043e\u0436\u0438\u0439 \u0441\u0442\u0430\u0454 \u0441\u0438\u043d\u043e\u043c \u0414\u0456\u0432\u0438, \u0456 \u000d\u000a\u0413\u0430\u0432\u0440\u0438\u0457\u043b \u0431\u043b\u0430\u0433\u043e\u0434\u0430\u0442\u044c \u0431\u043b\u0430\u0433\u043e\u0432\u0456\u0441\u0442\u0438\u0442\u044c. \u0422\u043e\u043c\u0443 \u000d\u000a\u0439 \u043c\u0438 \u0437 \u043d\u0438\u043c \u0434\u043e \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456 \u0432\u0437\u0438\u0432\u0430\u0454\u043c\u043e: \u000d\u000a\u00ab\u0420\u0430\u0434\u0443\u0439\u0441\u044f, \u0411\u043b\u0430\u0433\u043e\u0434\u0430\u0442\u043d\u0430, \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u0437 \u0422\u043e\u0431\u043e\u044e\u00bb.","89\u000d\u000a\u0421\u0442\u0438\u0445 2: \u0411\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0435\u043d \u0413\u043e\u0441\u043f\u043e\u0434\u044c, \u0411\u043e\u0433 \u0406\u0437\u0440\u0430\u0457\u043b\u0456\u0432, \u0449\u043e \u0442\u0432\u043e\u0440\u0438\u0442\u044c \u0447\u0443\u0434\u0435\u0441\u0430 \u0454\u0434\u0438\u043d\u0438\u0439. \u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440: \u0421\u044c\u043e\u0433\u043e\u0434\u043d\u0456 \u0441\u043f\u0430\u0441\u0456\u043d\u043d\u044f \u043d\u0430\u0448\u043e\u0433\u043e \u000d\u000a\u043f\u043e\u0447\u0430\u0442\u043e\u043a:\u000d\u000a\u0421\u0442\u0438\u0445 3: \u0406 \u0431\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0435\u043d\u043d\u0435 \u0456\u043c'\u044f \u0441\u043b\u0430\u0432\u0438 \u000d\u000a\u0419\u043e\u0433\u043e \u043f\u043e\u0432\u0456\u043a\u0438. \u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440: \u0421\u044c\u043e\u0433\u043e\u0434\u043d\u0456 \u0441\u043f\u0430\u0441\u0456\u043d\u043d\u044f \u043d\u0430\u0448\u043e\u0433\u043e \u000d\u000a\u043f\u043e\u0447\u0430\u0442\u043e\u043a:\u000d\u000a\u0410\u041d\u0422\u0418\u0424\u041e\u041d\u0418 \u0423 \u0414\u0415\u041d\u042c \u0421\u0412\u042f\u0422\u0410\u000d\u000a\u0425\u0420\u0415\u0429\u0415\u041d\u041d\u042f \u0423\u041a\u0420\u0410\u0407\u041d\u0418-\u0420\u0423\u0421\u0418\u000d\u000a\u0422\u0410 \u0414\u0415\u041d\u042c \u041f\u0410\u041c\u2019\u042f\u0422\u0406 \u0421\u0412\u042f\u0422\u041e\u0413\u041e\u000d\u000a\u0420\u0406\u0412\u041d\u041e\u0410\u041f\u041e\u0421\u0422\u041e\u041b\u042c\u041d\u041e\u0413\u041e \u041a\u041d\u042f\u0417\u042f\u000d\u000a\u041a\u0418\u0407\u0412\u0421\u042c\u041a\u041e\u0413\u041e \u0412\u041e\u041b\u041e\u0414\u0418\u041c\u0418\u0420\u0410\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 1\u000d\u000a\u0421\u0442\u0438\u0445 1: \u0411\u043b\u0430\u0436\u0435\u043d\u043d\u0456, \u043a\u043e\u043c\u0443 \u043f\u0440\u043e\u0449\u0435\u043d\u043e \u0431\u0435\u0437\u0437\u0430\u043a\u043e\u043d\u043d\u044f \u0456 \u0447\u0438\u0457 \u0433\u0440\u0456\u0445\u0438 \u043f\u043e\u043a\u0440\u0438\u0442\u043e. \u000d\u000a\u041f\u0440\u0438\u0441\u043f\u0456\u0432: \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u000d\u000a\u0421\u043f\u0430\u0441\u0435, \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441. \u000d\u000a\u0421\u0442\u0438\u0445 2: \u0411\u043b\u0430\u0436\u0435\u043d\u043d\u0456 \u043d\u0435\u043f\u043e\u0440\u043e\u0447\u043d\u0456, \u0449\u043e \u0445\u043e\u0434\u044f\u0442\u044c \u0432 \u0437\u0430\u043a\u043e\u043d\u0456 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0456\u043c. \u000d\u000a\u041f\u0440\u0438\u0441\u043f\u0456\u0432: \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u000d\u000a\u0421\u043f\u0430\u0441\u0435, \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441. \u000d\u000a\u0421\u0442\u0438\u0445 3: \u0420\u0430\u0434\u0443\u0439\u0442\u0435\u0441\u044f, \u043f\u0440\u0430\u0432\u0435\u0434\u043d\u0456, \u0443 \u0413\u043e\u0441\u043f\u043e\u0434\u0456, \u043f\u0440\u0430\u0432\u0435\u0434\u043d\u0438\u043c \u043f\u043e\u0434\u043e\u0431\u0430\u0454 \u043f\u043e\u0445\u0432\u0430\u043b\u0430. \u000d\u000a\u041f\u0440\u0438\u0441\u043f\u0456\u0432: \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u000d\u000a\u0421\u043f\u0430\u0441\u0435, \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441. \u000d\u000a\u0421\u0442\u0438\u0445 4: \u0412\u0435\u0441\u0435\u043b\u0456\u0442\u044c\u0441\u044f \u0432 \u0413\u043e\u0441\u043f\u043e\u0434\u0456 \u0456 \u0440\u0430\u0434\u0443\u0439\u0442\u0435\u0441\u044f, \u043f\u0440\u0430\u0432\u0435\u0434\u043d\u0456, \u0456 \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0443\u0439\u0442\u0435 \u0432\u0441\u0456 \u000d\u000a\u043f\u0440\u0430\u0432\u0456 \u0441\u0435\u0440\u0446\u0435\u043c. \u000d\u000a\u041f\u0440\u0438\u0441\u043f\u0456\u0432: \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u000d\u000a\u0421\u043f\u0430\u0441\u0435, \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441. \u000d\u000a\u0421\u043b\u0430\u0432\u0430 \u0456 \u043d\u0438\u043d\u0456:\u000d\u000a\u041f\u0440\u0438\u0441\u043f\u0456\u0432: \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u000d\u000a\u0421\u043f\u0430\u0441\u0435, \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441. \u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 2\u000d\u000a\u0421\u0442\u0438\u0445 1: \u0411\u043b\u0430\u0436\u0435\u043d\u043d\u0438\u0439 \u043d\u0430\u0440\u043e\u0434, \u0443 \u044f\u043a\u043e\u0433\u043e \u0411\u043e\u0433 \u000d\u000a\u0454 \u0413\u043e\u0441\u043f\u043e\u0434\u043e\u043c, \u2013 \u043b\u044e\u0434\u0438, \u044f\u043a\u0438\u0445 \u043e\u0431\u0440\u0430\u0432 \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u0443 \u043d\u0430\u0441\u043b\u0456\u0434\u0434\u044f \u0421\u043e\u0431\u0456. \u000d\u000a\u041f\u0440\u0438\u0441\u043f\u0456\u0432: \u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, \u0449\u043e \u000d\u000a\u043f\u0440\u043e\u0441\u0432\u0456\u0442\u0438\u0432 \u043d\u0430\u0441 \u0425\u0440\u0435\u0449\u0435\u043d\u043d\u044f\u043c, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u000d\u000a\u0422\u043e\u0431\u0456: \u0430\u043b\u0438\u043b\u0443\u044f. \u000d\u000a\u0421\u0442\u0438\u0445 2: \u041f\u0440\u043e\u0441\u0438 \u0443 \u041c\u0435\u043d\u0435, \u0456 \u0434\u0430\u043c \u0422\u043e\u0431\u0456 \u043d\u0430\u0440\u043e\u0434\u0438 \u0443 \u0441\u043f\u0430\u0434\u0449\u0438\u043d\u0443 \u0422\u0432\u043e\u044e \u0456 \u043a\u0440\u0430\u0457 \u0437\u0435\u043c\u043b\u0456 \u0443 \u000d\u000a\u0432\u043e\u043b\u043e\u0434\u0456\u043d\u043d\u044f \u0422\u0432\u043e\u0454. \u000d\u000a\u041f\u0440\u0438\u0441\u043f\u0456\u0432: \u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, \u0449\u043e \u000d\u000a\u043f\u0440\u043e\u0441\u0432\u0456\u0442\u0438\u0432 \u043d\u0430\u0441 \u0425\u0440\u0435\u0449\u0435\u043d\u043d\u044f\u043c, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u000d\u000a\u0422\u043e\u0431\u0456: \u0430\u043b\u0438\u043b\u0443\u044f. \u000d\u000a\u0421\u0442\u0438\u0445 3: \u0421\u043f\u0430\u0441\u0438, \u0413\u043e\u0441\u043f\u043e\u0434\u0438, \u043b\u044e\u0434\u0435\u0439 \u0422\u0432\u043e\u0457\u0445 \u0456 \u0431\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0438 \u043d\u0430\u0441\u043b\u0456\u0434\u0434\u044f \u0422\u0432\u043e\u0454: \u043f\u0430\u0441\u0438 \u0457\u0445 \u0456 \u000d\u000a\u043f\u0456\u0434\u043d\u043e\u0441\u044c \u0457\u0445 \u043f\u043e\u0432\u0456\u043a\u0438. \u000d\u000a\u041f\u0440\u0438\u0441\u043f\u0456\u0432: \u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, \u0449\u043e \u000d\u000a\u043f\u0440\u043e\u0441\u0432\u0456\u0442\u0438\u0432 \u043d\u0430\u0441 \u0425\u0440\u0435\u0449\u0435\u043d\u043d\u044f\u043c, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u000d\u000a\u0422\u043e\u0431\u0456: \u0430\u043b\u0438\u043b\u0443\u044f. \u000d\u000a\u0421\u0442\u0438\u0445 4: \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u2013 \u041f\u0440\u043e\u0441\u0432\u0456\u0447\u0435\u043d\u043d\u044f \u043c\u043e\u0454 \u0456 \u000d\u000a\u0421\u043f\u0430\u0441\u0438\u0442\u0435\u043b\u044c \u043c\u0456\u0439, \u043a\u043e\u0433\u043e \u0443\u0431\u043e\u044e\u0441\u044f? \u000d\u000a\u041f\u0440\u0438\u0441\u043f\u0456\u0432: \u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, \u0449\u043e \u000d\u000a\u043f\u0440\u043e\u0441\u0432\u0456\u0442\u0438\u0432 \u043d\u0430\u0441 \u0425\u0440\u0435\u0449\u0435\u043d\u043d\u044f\u043c, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u000d\u000a\u0422\u043e\u0431\u0456: \u0430\u043b\u0438\u043b\u0443\u044f. \u000d\u000a\u0421\u043b\u0430\u0432\u0430 \u0456 \u043d\u0438\u043d\u0456:\u000d\u000a\u0404\u0434\u0438\u043d\u043e\u0440\u043e\u0434\u043d\u0438\u0439 \u0421\u0438\u043d\u0443 \u0456 \u0421\u043b\u043e\u0432\u043e \u0411\u043e\u0436\u0435...\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 3\u000d\u000a\u0421\u0442\u0438\u0445 1: \u0413\u043e\u043b\u043e\u0441 \u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0456\u0439 \u043d\u0430\u0434 \u0432\u043e\u0434\u0430\u043c\u0438, \u000d\u000a\u0411\u043e\u0433 \u0441\u043b\u0430\u0432\u0438 \u0437\u0430\u0433\u0440\u0438\u043c\u0456\u0432. \u0417\u0430\u0433\u0440\u0438\u043c\u0456\u0432 \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u000d\u000a\u043d\u0430\u0434 \u0432\u043e\u0434\u0430\u043c\u0438 \u0432\u0435\u043b\u0438\u043a\u0438\u043c\u0438. \u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440, \u0433\u043b\u0430\u0441 8: \u0411\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0435\u043d\u043d\u0438\u0439 \u0422\u0438, \u000d\u000a\u0425\u0440\u0438\u0441\u0442\u0435 \u0411\u043e\u0436\u0435 \u043d\u0430\u0448, \u0449\u043e \u0437\u0435\u043c\u043b\u044e \u0423\u043a\u0440\u0430\u0457\u043d\u0441\u044c\u043a\u0443 \u0425\u0440\u0435\u0449\u0435\u043d\u043d\u044f\u043c \u043f\u0440\u043e\u0441\u0432\u0456\u0442\u0438\u0432, \u043b\u044e\u0434\u044f\u043c \u0457\u0457 \u000d\u000a\u043f\u043e\u0441\u043b\u0430\u0432\u0448\u0438 \u0414\u0443\u0445\u0430 \u0421\u0432\u044f\u0442\u043e\u0433\u043e, \u0456 \u0434\u043e \u0441\u043f\u0430\u0441\u0456\u043d\u043d\u044f \u000d\u000a\u0457\u0445 \u043f\u0440\u0438\u0432\u0456\u0432, \u041b\u044e\u0434\u0438\u043d\u043e\u043b\u044e\u0431\u0447\u0435, \u0441\u043b\u0430\u0432\u0430 \u0422\u043e\u0431\u0456.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u0414\u0443\u0445 \u0422\u0432\u0456\u0439 \u0431\u043b\u0430\u0433\u0438\u0439 \u043d\u0430\u0441\u0442\u0430\u0432\u0438\u0442\u044c \u000d\u000a\u043c\u0435\u043d\u0435 \u043d\u0430 \u0437\u0435\u043c\u043b\u044e \u043f\u0440\u0430\u0432\u0434\u0438. \u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440, \u0433\u043b\u0430\u0441 8: \u0411\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0435\u043d\u043d\u0438\u0439 \u0422\u0438, \u000d\u000a\u0425\u0440\u0438\u0441\u0442\u0435 \u0411\u043e\u0436\u0435 \u043d\u0430\u0448 \u2026 \u000d\u000a\u0421\u0442\u0438\u0445 3: \u0412\u043e\u0441\u043a\u0440\u00e9\u0441\u043d\u0438, \u0411\u043e\u0436\u0435, \u0441\u0443\u0434\u0438 \u0437\u0435\u043c\u043b\u044e, \u0431\u043e \u0422\u0438 \u0443\u0441\u043f\u0430\u0434\u043a\u0443\u0432\u0430\u0432 \u0443\u0441\u0456 \u043d\u0430\u0440\u043e\u0434\u0438. \u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440, \u0433\u043b\u0430\u0441 8: \u0411\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0435\u043d\u043d\u0438\u0439 \u0422\u0438, \u000d\u000a\u0425\u0440\u0438\u0441\u0442\u0435 \u0411\u043e\u0436\u0435 \u043d\u0430\u0448 \u2026 ","\u0421\u0442\u0438\u0445 4: \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u0437 \u043d\u0435\u0431\u0430 \u0434\u0438\u0432\u0438\u0442\u044c\u0441\u044f \u0456 \u0431\u0430\u0447\u0438\u0442\u044c \u0443\u0441\u0456\u0445 \u0441\u0438\u043d\u0456\u0432 \u043b\u044e\u0434\u0441\u044c\u043a\u0438\u0445. \u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440, \u0433\u043b\u0430\u0441 8: \u0411\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0435\u043d\u043d\u0438\u0439 \u0422\u0438, \u000d\u000a\u0425\u0440\u0438\u0441\u0442\u0435 \u0411\u043e\u0436\u0435 \u043d\u0430\u0448 \u2026 \u000d\u000a\u0412\u0445\u0456\u0434\u043d\u0435: \u041f\u0440\u0438\u0439\u0434\u0456\u0442\u044c, \u043f\u043e\u043a\u043b\u043e\u043d\u0456\u043c\u043e\u0441\u044c \u0456 \u043f\u0440\u0438\u043f\u0430\u0434\u0456\u043c\u043e \u0434\u043e \u0425\u0440\u0438\u0441\u0442\u0430. \u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u000d\u000a\u0411\u043e\u0436\u0438\u0439, \u0449\u043e \u043f\u0440\u043e\u0441\u0432\u0456\u0442\u0438\u0432 \u043d\u0430\u0441 \u0425\u0440\u0435\u0449\u0435\u043d\u043d\u044f\u043c, \u000d\u000a\u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0423\u0421\u041f\u0406\u041d\u041d\u042f \u041f\u0420\u0415\u0421\u0412\u042f\u0422\u041e\u0407 \u0411\u041e\u0413\u041e\u0420\u041e\u0414\u0418\u0426\u0406\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 1\u000d\u000a\u0421\u0442\u0438\u0445 1: \u0412\u0438\u043a\u043b\u0438\u043a\u043d\u0456\u0442\u044c \u0413\u043e\u0441\u043f\u043e\u0434\u0443, \u0432\u0441\u044f \u0437\u0435\u043c\u043b\u0435! / \u0421\u043f\u0456\u0432\u0430\u0439\u0442\u0435 \u0436 \u0456\u043c\u0435\u043d\u0456 \u0419\u043e\u0433\u043e, \u0432\u0456\u0434\u0434\u0430\u0439\u0442\u0435 \u000d\u000a\u0441\u043b\u0430\u0432\u0443 \u0443 \u0445\u0432\u0430\u043b\u0456 \u0419\u043e\u043c\u0443. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, / \u0421\u043f\u0430\u0441\u0435, \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u0423 \u043c\u0456\u0441\u0442\u0456 \u0413\u043e\u0441\u043f\u043e\u0434\u0430 \u0421\u0438\u043b, / \u0443 \u043c\u0456\u0441\u0442\u0456 \u000d\u000a\u0411\u043e\u0433\u0430 \u043d\u0430\u0448\u043e\u0433\u043e. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u000d\u000a\u0421\u043f\u0430\u0441\u0435, / \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u0442\u0438\u0445 3: \u0406 \u0431\u0443\u043b\u0430 \u0432 \u0421\u0430\u043b\u0438\u043c\u0456 \u043e\u0441\u0435\u043b\u044f \u0419\u043e\u0433\u043e, / \u000d\u000a\u0456 \u043f\u0435\u0440\u0435\u0431\u0443\u0432\u0430\u043d\u043d\u044f \u0419\u043e\u0433\u043e \u043d\u0430 \u0421\u0438\u043e\u043d\u0456. \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0421\u043f\u0430\u0441\u0435, / \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0421\u043b\u0430\u0432\u0430, \u0456 \u043d\u0438\u043d\u0456: \u041c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u000d\u000a\u0421\u043f\u0430\u0441\u0435, / \u0441\u043f\u0430\u0441\u0438 \u043d\u0430\u0441.\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 2\u000d\u000a\u0421\u0442\u0438\u0445 1: \u041b\u044e\u0431\u0438\u0442\u044c \u0413\u043e\u0441\u043f\u043e\u0434\u044c \u0432\u0440\u0430\u0442\u0430 \u0421\u0438\u043e\u043d\u0443 \u000d\u000a/ \u0431\u0456\u043b\u044c\u0448\u0435 \u0437\u0430 \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u043d\u044f \u042f\u043a\u043e\u0432\u0430.\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u043c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u041f\u0440\u0435\u0441\u043b\u0430\u0432\u043d\u0435 \u0433\u043e\u0432\u043e\u0440\u044f\u0442\u044c \u043f\u0440\u043e \u000d\u000a\u0422\u0435\u0431\u0435, / \u043c\u0456\u0441\u0442\u043e \u0411\u043e\u0436\u0435.\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u043c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 3: \u0411\u043e\u0433 \u0443\u0442\u0432\u0435\u0440\u0434\u0438\u0432 \u0439\u043e\u0433\u043e / \u043d\u0430\u0432\u0456\u043a\u0438.\u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u043c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u0442\u0438\u0445 4: \u041f\u043e\u0442\u043e\u043a\u0438 \u0440\u0456\u043a \u0432\u0435\u0441\u0435\u043b\u044f\u0442\u044c \u043c\u0456\u0441\u0442\u043e \u000d\u000a\u0411\u043e\u0436\u0435, / \u0441\u0432\u044f\u0442\u0443 \u043e\u0441\u0435\u043b\u044e \u0412\u0441\u0435\u0432\u0438\u0448\u043d\u044c\u043e\u0433\u043e. \u000d\u000a\u0421\u043f\u0430\u0441\u0438 \u043d\u0430\u0441, \u0421\u0438\u043d\u0443 \u0411\u043e\u0436\u0438\u0439, / \u043c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u000d\u000a\u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0456, \u0441\u043f\u0456\u0432\u0430\u0454\u043c\u043e \u0422\u043e\u0431\u0456: \u0410\u043b\u0438\u043b\u0443\u044f.\u000d\u000a\u0421\u043b\u0430\u0432\u0430, \u0456 \u043d\u0438\u043d\u0456: \u0404\u0434\u0438\u043d\u043e\u0440\u043e\u0434\u043d\u0438\u0439 \u0421\u0438\u043d\u0443:\u000d\u000a\u0410\u043d\u0442\u0438\u0444\u043e\u043d 3\u000d\u000a\u0421\u0442\u0438\u0445 1: \u0413\u043e\u0442\u043e\u0432\u0435 \u0441\u0435\u0440\u0446\u0435 \u043c\u043e\u0454, \u0411\u043e\u0436\u0435, / \u0433\u043e\u0442\u043e\u0432\u0435 \u0441\u0435\u0440\u0446\u0435 \u043c\u043e\u0454.\u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440, \u0433\u043b\u0430\u0441 1: \u0423 \u0440\u0456\u0437\u0434\u0432\u0456 \u0434\u0456\u0432\u0441\u0442\u0432\u043e \u0437\u0431\u0435\u0440\u0435\u0433\u043b\u0430 \u0422\u0438, \u0432 \u0443\u0441\u043f\u0456\u043d\u043d\u0456 \u0436 \u0441\u0432\u0456\u0442\u0443 \u043d\u0435 \u0437\u0430\u043b\u0438\u0448\u0438\u043b\u0430 \u0422\u0438, \u0411\u043e\u0433\u043e\u0440\u043e\u0434\u0438\u0446\u0435, \u043f\u0435\u0440\u0435\u0439\u0448\u043b\u0430 \u0422\u0438 \u0434\u043e \u000d\u000a\u0436\u0438\u0442\u0442\u044f, \u0431\u043e \u0422\u0438 \u041c\u0430\u0442\u0438 \u0416\u0438\u0442\u0442\u044f, \u0456 \u043c\u043e\u043b\u0438\u0442\u0432\u0430\u043c\u0438 \u0422\u0432\u043e\u0457\u043c\u0438 \u0432\u0438\u0437\u0432\u043e\u043b\u044f\u0454\u0448 \u0432\u0456\u0434 \u0441\u043c\u0435\u0440\u0442\u0456 \u0434\u0443\u0448\u0456 \u000d\u000a\u043d\u0430\u0448\u0456.\u000d\u000a\u0421\u0442\u0438\u0445 2: \u0429\u043e \u0432\u0456\u0434\u0434\u0430\u043c \u0413\u043e\u0441\u043f\u043e\u0434\u0435\u0432\u0456 / \u0437\u0430 \u0432\u0441\u0456 \u000d\u000a\u043c\u0438\u043b\u043e\u0441\u0442\u0456 \u0419\u043e\u0433\u043e \u0434\u043e \u043c\u0435\u043d\u0435?!\u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440: \u0423 \u0440\u0456\u0437\u0434\u0432\u0456 \u0434\u0456\u0432\u0441\u0442\u0432\u043e \u0437\u0431\u0435\u0440\u0435\u0433\u043b\u0430 \u0422\u0438:\u000d\u000a\u0421\u0442\u0438\u0445 3: \u0427\u0430\u0448\u0443 \u0441\u043f\u0430\u0441\u0456\u043d\u043d\u044f \u043f\u0440\u0438\u0439\u043c\u0443 / \u0439 \u0456\u043c'\u044f \u000d\u000a\u0413\u043e\u0441\u043f\u043e\u0434\u043d\u0454 \u043f\u0440\u0438\u0437\u0432\u0443.\u000d\u000a\u0422\u0440\u043e\u043f\u0430\u0440: \u0423 \u0440\u0456\u0437\u0434\u0432\u0456 \u0434\u0456\u0432\u0441\u0442\u0432\u043e \u0437\u0431\u0435\u0440\u0435\u0433\u043b\u0430 \u0422\u0438:\u000d\u000a90","",""]